INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (10451960, 'Natures Way Banana Keeper, Banana Holder', 3.98, '085865211013', 'Have a safe and designated place for your fruit with the Nature\'s Way Banana Keeper. It\'s made of a strong, durable material and is easy to use. This banana stand raises your fruit off of the counter, allowing them to hang naturally. This position lets the air flow freely around and through the bananas similar to hanging from a tree, helping them retain the proper pulp temperature and to ripen evenly. This stand also prevents the development of soft spots and damaging bruises. It keeps them fresher longer and gives them a better taste. It\'s dishwasher safe for easy care. Natures Way Banana Keeper:', 'Attractive design decorates and complements any decor Strong and durable Easy to clean Dishwasher safe Hanging banana holder keeps fruit fresh longer Prevents black bruises, soft spots Bananas taste better', 'Nature\'s Way', 'https://i5.walmartimages.com/asr/0799ff2d-7a25-42a2-9c9c-4a5f2fbfd0cc.3f00f5004a88ddbb52b6d01a5ac686e0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0799ff2d-7a25-42a2-9c9c-4a5f2fbfd0cc.3f00f5004a88ddbb52b6d01a5ac686e0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0799ff2d-7a25-42a2-9c9c-4a5f2fbfd0cc.3f00f5004a88ddbb52b6d01a5ac686e0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (10795084, 'Del Monte Red Grapefruit, Jarred Fruit, 64 oz. Jar, Fresh Refrigerated Fruit', 8.97, '810051010657', 'Del Monte Red Grapefruit In Extra Light Syrup makes it easy to enjoy high quality fruit in minutes. The jarred fruit is packed with delicious, ripe grapefruit slices in extra light syrup for a ready to eat fruit snack you can feel good about. Del Monte grapefruit offers a good source of vitamin C, making them a convenient, wholesome and ready to eat citrus fruit option for busy nights. Picked and packed at the peak of freshness, peeled and sectioned, and immersed in extra light syrup, the jarred fruit slices are ideal as part of a quick lunch snack or as a flavorful addition to fruit cocktail. Each 64-ounce jar is easy to open, reseal, and store for a convenient fruit snack whenever you need delicious fruit on-the-go. Bring the wholesome goodness of Del Monte Red Grapefruit In Extra Light Syrup to your family.', 'One 64-ounce jar of Del Monte Red Grapefruit In Extra Light Syrup Bring wholesome goodness to your family with Del Monte Red Grapefruit Ideal for fruit cocktails Jarred fruits are easy to open, reseal and store as quick lunch snacks Made with red grapefruit picked at the peak of freshness and immersed in extra light syrup Jarred grapefruit makes a great ready-to-eat fruit snack for busy nights Easy way to have a citrus fruit snack in just minutes', 'Del Monte', 'https://i5.walmartimages.com/asr/fbf4937f-c1f9-4d16-b5e2-9350a1bb5d93.4ab2d5d5fd76d5b2977e9c084a5dcd03.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fbf4937f-c1f9-4d16-b5e2-9350a1bb5d93.4ab2d5d5fd76d5b2977e9c084a5dcd03.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fbf4937f-c1f9-4d16-b5e2-9350a1bb5d93.4ab2d5d5fd76d5b2977e9c084a5dcd03.jpeg?odnHeight=450