INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (10813390, 'Fresh Green Seedless Grapes, 2 lb', 4.97, '033383250557', 'Treat yourself to the delicious, juicy flavor of Fresh Green Grapes. These grapes are bursting with sweet flavor, so you can easily enjoy a handful as a fresh snack any time of day. Enjoy them for breakfast, lunch, dinner, or dessert. They are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Fresh Green Grapes.', 'Fresh Green Seedless Grapes Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e227d687-d4b5-4f05-a61e-e55f8f526075.39679801746d29ef48d99c92d7e4bcef.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e227d687-d4b5-4f05-a61e-e55f8f526075.39679801746d29ef48d99c92d7e4bcef.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e227d687-d4b5-4f05-a61e-e55f8f526075.39679801746d29ef48d99c92d7e4bcef.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
