INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (10813392, 'Fresh Organic Red Seedless Grapes from California, 2 lb Package', 5.27, '851781005612', 'Marketside Organic Red Grapes are seedless for you convenience and deliver a pleasantly refreshing taste in every bite. These fresh grapes have a firm texture and a vibrant red color. Enjoy them as a healthy snack or use as an ingredient in sweet and savory dishes. Use them in salads, pies, tarts, chicken salad and more. They are great for health conscious individuals as they are USDA organic. They are also a nutrient dense fruit that is low in calories. This container comes with two pounds of grapes making it easy to stock up on your favorite fruit. Enjoy fresh from the farm flavors with Marketside Organic Red Grapes. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Fresh Organic Red Seedless Grapes Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Marketside', 'https://i5.walmartimages.com/asr/abaf57b8-4b92-4b87-9be4-8b77e031073f.167672647b84e3503555fa9f6f68405f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/abaf57b8-4b92-4b87-9be4-8b77e031073f.167672647b84e3503555fa9f6f68405f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/abaf57b8-4b92-4b87-9be4-8b77e031073f.167672647b84e3503555fa9f6f68405f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (11025598, 'Fresh Mandarin Oranges, 3 lb Bag', 3.97, '899783002024', 'Enjoy the juicy goodness of citrus when you eat a Fresh Mandarin Orange. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, clementines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, mandarins are now available year-round in most markets. Mandarins are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, mandarins are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious fresh mandarin on hand for an easy, healthy treat.', 'Fresh Clementines, 3 lb Bag Delicious, sweet, juicy citrus Pleasing sweet-tart flavor Easy to peel and segment Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless You\'ll have plenty for everyone with this 3-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6f74508d-b685-4657-b5a0-2d29ab6a026f.a8d3beade57c94b66b31d9cf87e12e13.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6f74508d-b685-4657-b5a0-2d29ab6a026f.a8d3beade57c94b66b31d9cf87e12e13.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6f74508d-b685-4657-b5a0-2d29ab6a026f.a8d3beade57c94b66b31d9cf87e12e13.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (13424464, 'Fresh Valencia Oranges, 4 lb, Bag', 3.97, '033383120584', 'Known for their sweet flavor, Valencia Oranges have a thin skin and are typically very juicy. It is the most popular orange for juicing. It\'s juice will remain perfectly sweet even after air exposure. With a balanced sweet-to-tart flavor ratio that carries over to their juice, Valencia Oranges are widely available during the spring and summer months. Use Valencia oranges to make fresh orange juice, or use their flesh, juice, and zest in baked goods, cocktails, sauces, and marinades. Keep some sunshine on hand with Valencia Oranges. Available in a 4 lb bag.', '4 lb bag of Valencia oranges Thin skin and very juicy Most popular orange for juicing Balanced sweet-to-tart flavor ratio Widely available during the spring and summer months Use their flesh, juice, and zest in baked goods, cocktails, sauces, and marinades', 'Fresh Produce', 'https://i5.walmartimages.com/asr/aa6059cd-c60c-4fd5-b4ee-52d402de51db.e50ceff4098f3006f5000acb3c8941d5.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aa6059cd-c60c-4fd5-b4ee-52d402de51db.e50ceff4098f3006f5000acb3c8941d5.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aa6059cd-c60c-4fd5-b4ee-52d402de51db.e50ceff4098f3006f5000acb3c8941d5.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (13908231, 'Fresh Cranberries, 12 oz, Bag', 0.98, '854641003001', 'Savor the tart taste of Fresh Cranberries. Cranberries have a wonderful tart flavor that can easily take on the sweetness of your favorite sweetener. Use them to make a tart cranberry sauce, bake them into delicious cranberry and orange scones, combine with baked Brie for a gooey, sweet appetizer, or reduce them for a glaze to use on grilled chicken or turkey. They contain essential vitamins and nutrients like vitamin C, vitamin B, fiber, and antioxidants making them perfect for a healthy diet. Prior to use simply gently wash them with cool water, drain, and enjoy the zesty taste. Refrigerate the berries to keep them fresh and ready for use. Pick up a Fresh Cranberries container today and relish the delectable flavor.', 'Fresh Field Grown Cranberries, 12 oz Bag: Enjoy with your favorite sweetener, baked good, or savory dish Enjoy with your favorite sweetener, baked good, or savory dish Light, tart taste Healthy treat Prior to use gently wash them with cool water Refrigerate your berries in the original container to maintain freshness Light, tart taste Healthy treat Prior to use gently wash them with cool water Refrigerate your berries in the original container to maintain freshness Keep dry for optimal freshness Cranberries can be stored up to 4 weeks in the refrigerator and up to 1 year in the freezer Keep dry for optimal freshness Cranberries can be stored up to 4 weeks in the refrigerator and up to 1 year in the freezer', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f9943649-faa7-4963-972e-1bcc4b468b57.d540cac6a95f56e03208080aaeb56f75.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f9943649-faa7-4963-972e-1bcc4b468b57.d540cac6a95f56e03208080aaeb56f75.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f9943649-faa7-4963-972e-1bcc4b468b57.d540cac6a95f56e03208080aaeb56f75.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (15716498, 'Del Monte Red Grapefruit Fruit Cup Snacks, No Sugar Added, 6.5 oz Cup', 1.97, '024000507932', 'Del Monte Red Grapefruit Fruit Cup Snacks, 6.5 oz Cup is packed with delicious, wholesome fruit with no sugar added for a snack you can feel good about. These bite-sized grapefruit pieces are conveniently packaged in easy-to-open individual fruit cups for a quick on the go snack. Each of these no sugar added fruit cups is rich in Vitamin C and contains 60% less sugar than Red Grapefruit in artificially sweetened water. Easily pack these fruit cups in a school lunchbox for a tasty school snack, or grab a few to take on a weekend trip with the family. Each refrigerated fruit cup comes with an easy peel-off lid for a tasty fruit snack you can say yes to every day. Bring goodness to your family with Del Monte Red Grapefruit Fruit Cup Snacks.', 'One 6.5 oz cup of Del Monte Red Grapefruit Fruit Cup Snacks Enjoy the delicious taste of juicy Del Monte Red Grapefruit with no added sugar, in every fruit cup These bite-sized red grapefruit pieces are bursting with juicy flavor for a nourishing and convenient fruit snack Bring a pack of fruit cups for a weekend trip with the family, or pack some grapefruit cups in a school lunchbox for a tasty school snack Each individual grapefruit Fruit Cup Snack offers a rich source of Vitamin C', 'Del Monte', 'https://i5.walmartimages.com/asr/e4a819ce-d11a-4da1-8804-4c5780a2db54.96d188063be69a5385a805c43c5fc7b7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4a819ce-d11a-4da1-8804-4c5780a2db54.96d188063be69a5385a805c43c5fc7b7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4a819ce-d11a-4da1-8804-4c5780a2db54.96d188063be69a5385a805c43c5fc7b7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
