INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (20680599, 'Concord Foods, Chiquita Banana Bread Mix, 13.7 oz', 2.64, '041409002479', 'Banana Bread Mix 13.7 OZ Pouch. Just add 2 fresh & ripe bananas, water and egg. Easy to make. Shelf-Stable in plastic pouch. No partially hydrogenated oils. No artificial flavors. No preservatives. For more tasty suggestions and Concord Foods recipes, visit our website at www.concordfoods.com. You Will Need: 1 cup mashed banana approx. 2 bananas (over-ripe); 1 large egg (lightly beaten); 1/3 cup water. 1. Pre-heat oven to 350 degrees F. Grease and lightly flour 8 x 4 inch loaf pan. 2. Stir contents of Chiquita Banana Bread pouch with water, lightly beaten egg and mashed bananas for 1-2 minutes or until all ingredients are wet. 3. Pour batter into greased and floured loaf pan. 4. Bake at 350 degrees for 45-50 minutes or until toothpick inserted into center comes out clean. If using a 9 x 5-inch baking pan adjust baking time to 40-45 minutes. Cool 20 minutes. Loosen edges with knife and remove from pan. Makes 12 servings! 13.7 oz (390 g). Pouch is #2 recyclable. Approved for store drop-off programs.', 'Banana Bread Mix Just add 2 fresh bananas, water and egg. Easy to make. No partially hydrogenated oils. No artificial flavors. No preservatives. Shelf-Stable Plastic Pouch .', 'Chiquita', 'https://i5.walmartimages.com/asr/9118f2e8-5ae8-491f-89a2-0f1044b657ff.eef1aa6ba2eb2b41db1d9c03d67f99ab.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9118f2e8-5ae8-491f-89a2-0f1044b657ff.eef1aa6ba2eb2b41db1d9c03d67f99ab.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9118f2e8-5ae8-491f-89a2-0f1044b657ff.eef1aa6ba2eb2b41db1d9c03d67f99ab.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
