INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (24538641, 'Fresh Kiwi, 16 oz, Package', 3.12, '054107401000', 'Treat yourself to the delicious and refreshing taste of kiwi. Kiwi are known for their sweet, tangy, and soft flesh and nutritional benefits. They are packed with vitamin C, fiber, and antioxidants. They\'re also fat-free and have a low glycemic index. Enjoy a fresh kiwi with your breakfast to start your day off on the right foot or bring one to work and treat yourself to a scrumptious healthy snack at the office. You can also serve them up in a big fresh fruit salad with all your favorite fruits like strawberries, apples, blueberries and more. They\'re even perfect for topping pies, tres leches cakes, tarts and more for dessert. The possibilities are endless when you bring home Kiwi', 'Delicious sweet and tangy kiwi fruit Packed with Vitamin C, fiber and antioxidants with a scrumptious fruit taste Enjoy a fresh kiwi with your breakfast to start your day off on the right foot Bring one to work and treat yourself to a scrumptious healthy snack at the office Great for school lunches Perfect for topping desserts', 'Fresh Produce', 'https://i5.walmartimages.com/asr/15bd81c7-5450-4d7a-8b58-a9256c868da0.4d15c3921b6f2774c1db0be4f5e39158.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15bd81c7-5450-4d7a-8b58-a9256c868da0.4d15c3921b6f2774c1db0be4f5e39158.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15bd81c7-5450-4d7a-8b58-a9256c868da0.4d15c3921b6f2774c1db0be4f5e39158.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (28826837, 'Marketside Fresh Cut Mango, 16 oz Tray', 5.44, '074641003171', 'Enjoy the sweet, tropical flavor of Marketside Mango. These precut pieces are great for breakfast, lunch, dessert, or when you want a snack. Mango is a good source of vitamin C making it an excellent healthy treat. You can eat it right out of the container, infuse them with water and mint for a refreshing drink, or chop them up and make a mouthwatering mango salsa with jalapenos, tomatoes, and red onion. With 16-ounces in each container, this mango is great for sharing with friends and family or keep it for yourself. It comes in a closable container to help maintain freshness. Bring home Marketside Mango today for a refreshing, healthy treat. Marketside provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Marketside item.', 'Marketside Mango 16 oz Comes in a re-closable container to help maintain freshness Great for breakfast, lunch, dessert, or when you want a snack No preservatives, artificial colors, or artificial flavors Convenient and portable Share with friends and family or keep for yourself Make a fruit bowl topped with whipped cream or a yogurt parfait Enjoy on their own or in a variety of recipes', 'Marketside', 'https://i5.walmartimages.com/asr/70a13b6e-8fc2-4689-8f7c-f116bd06db60.c6d1ff904eb5cdbe90ce7f35604cb74d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/70a13b6e-8fc2-4689-8f7c-f116bd06db60.c6d1ff904eb5cdbe90ce7f35604cb74d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/70a13b6e-8fc2-4689-8f7c-f116bd06db60.c6d1ff904eb5cdbe90ce7f35604cb74d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
