INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (29823646, 'Concord Foods Lemon Juice from Concentrate, No Pulp, 4.5 oz', 0.98, '041409000055', 'Concord Foods Lemon Juice contains no pulp and will add zest and flavor to your favorite recipes. Use this lemon juice in sweet treats like lemon thumbprint cookies, lemon snowball cookies, or cheesecake lemon bars. You can also use it to add flavor to savory foods like lemon chicken, lemon spinach dip or a leafy green salad. There are 26 servings in each bottle which equates to the juice of almost three lemons. Enjoy the caffeine-free taste and versatility of Concord Foods Lemon Juice. Shelf-Stable (Refrigerate after opening).', 'Concord Foods Lemon Juice, From Concentrate, 4.5 FL OZ May be used in a variety of savory or sweet recipes Drizzle on fish or add to your favorite sauces Caffeine-free, no pulp Use to make refreshing beverages 3 tbsp. of juice equals 1 medium lemon Refrigerate after opening Shelf-Stable', 'Concord Foods', 'https://i5.walmartimages.com/asr/bc849737-899a-460b-bc58-d2d7a8158687.768b4d9d7a618e0a5e6a29aa31af28f5.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bc849737-899a-460b-bc58-d2d7a8158687.768b4d9d7a618e0a5e6a29aa31af28f5.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bc849737-899a-460b-bc58-d2d7a8158687.768b4d9d7a618e0a5e6a29aa31af28f5.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (32176609, 'Fresh Green Seedless Grapes, 3 lb', 4.97, '854957001364', 'Treat yourself to the delicious, juicy flavor of Fresh Green Seedless Grapes. These grapes are bursting with flavor and are completely seedless. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Fresh Green Seedless Grapes.', 'Fresh Green Seedless Grapes Bag Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/63e94312-19b8-4874-9e43-518a58288cee.7e323d21847755a8a1b7fe3f7ff8dad1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/63e94312-19b8-4874-9e43-518a58288cee.7e323d21847755a8a1b7fe3f7ff8dad1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/63e94312-19b8-4874-9e43-518a58288cee.7e323d21847755a8a1b7fe3f7ff8dad1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (32196592, 'Fresh Tomatillo Milpero, 1 Pound Bag', 2.52, '045255128581', 'Enjoy the delicious flavor of fresh Milpero Tomatillos. Milpero tomatillos are a miniaturized version of the tomatillo, about half the size of their cousin. The flavor is more concentrated with a sweeter, less acidic taste than the tomatillo. This versatile ingredient is perfect for a variety of mouthwatering dishes. Use them raw by chopping and mixing into a salsa for a tangy addition or puree them and pour over a pork butt in a slow cooker. After cooking for several hours, you\'ll have a tender, juicy pork butt that\'s great for taco or burritos. Simply shuck the husk off the tomatillos and wash then prepare them for your dish. With so many so many ways to prepare them, Milpero Tomatillos will become a staple in your dishes.', 'Milpero Tomatillos, Per Pound: A smaller, sweeter, less acidic version of the tomatillo Acidic, tangy flavor raw and a sweeter, less acidic taste cooked Versatile ingredient perfect for a variety of dishes Chop and mix with onions, cilantro, and lime juice for salsa Puree and pour over pork butt in a slow cooker for a tender and juicy protein for tacos and burritos Shuck off the husk, wash, and then prepare', 'Fresh Produce', 'https://i5.walmartimages.com/asr/116839f7-1173-4dfc-bd1c-5edbf81212f3.020e98934faa2f36ed2308046787fc1a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/116839f7-1173-4dfc-bd1c-5edbf81212f3.020e98934faa2f36ed2308046787fc1a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/116839f7-1173-4dfc-bd1c-5edbf81212f3.020e98934faa2f36ed2308046787fc1a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
