INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (34143814, 'Fresh Plantain, 1 Count', 0.58, '717524210005', 'Get creative in the kitchen with these delicious Plantains. While you can eat plantains uncooked, they\'re typically cooked to bring out their amazing flavor. Larger and starchier than bananas, plantains may be used in a wide variety of recipes. For a quick and easy treat, you can fry them in oil and serve with your favorite dipping sauce. You can also incorporate them into a hearty stew or try them as a topping for your tacos or nachos. For dessert, you can thinly slice them, bake them, and serve with chocolate drizzle. Create your next culinary masterpiece with these fresh Plantains.', 'Plantains: Used in a wide variety of recipes Fry and serve with your favorite dipping sauce Use to top tacos or nachos Larger and starchier than a banana Good source of vitamins and minerals Also known as Plátano Macho, Cooking Banana, Green Plantain, and Maduro around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8f09649d-0bb9-49f0-8aef-89da183e9b96.319b2632d4a2c10aab70a569a0d3036b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8f09649d-0bb9-49f0-8aef-89da183e9b96.319b2632d4a2c10aab70a569a0d3036b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8f09649d-0bb9-49f0-8aef-89da183e9b96.319b2632d4a2c10aab70a569a0d3036b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
