INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (37295421, 'Fresh Produce Tropical Avocado, Each', 2.68, '000000042215', 'Fresh Whole Tropical Avocado are not only great-tasting fruit, but they are a nutrient-dense food enjoyed around the world. They are a versatile ingredient that can be used in many different types of recipes and dishes. Enjoy it on its own or as part of a salad, sandwiches, wraps, in a smoothie or on your avocado toast. Tropical avocado a great ingredient to use in numerous ways, but it is also a healthy food that adds many health benefits that contributes unsaturated \"good\" fats and a variety of vitamins including vitamin E, vitamin K, vitamin C, and vitamins B5 and B9. Tropical avocados, also known as green skin avocados, are larger than a traditional avocado. They have smooth skin, and with most varieties remain green when ripe. Tropical avocados are harvested in Florida or the Dominican Republic. Fresh Produce Avocado.', 'Versatile ingredient Enjoy it on its own or as part of a salad, fresh guacamole, taco, burrito, or avocado toast Good source of unsaturated \"good\" fats and a variety of vitamins Tropical avocados are larger than a conventional avocado with have smooth skin, and with most varieties remain green when ripe Grown in Florida and Dominican Republic Fresh produce', 'Fresh Produce', 'https://i5.walmartimages.com/asr/447c8d99-28ba-428b-af97-ec514ae263e3_1.0928ed0270b508fa08c84c3d9efe4f8e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/447c8d99-28ba-428b-af97-ec514ae263e3_1.0928ed0270b508fa08c84c3d9efe4f8e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/447c8d99-28ba-428b-af97-ec514ae263e3_1.0928ed0270b508fa08c84c3d9efe4f8e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
