INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (38127803, 'Fresh Red Onions, 2 lb, Bag', 3.48, '091434001312', 'Add some Fresh Red Onions to your favorite recipes. There are a variety of ways to add this fresh produce to your recipes. Add them to your pasta sauces; use them to top pizza; enhance the flavors of your soups, stews, and gumbo; incorporate them into meatloaf; or make delicious omelets or hearty casseroles. You can also dice them and put them in a zesty stir fry or dip the onions in batter to fry up some crowd-pleasing onion rings. Try them in a spicy salsa recipe or on your hamburgers and hot dogs. However you choose to use them, these Fresh Red Onions are a must-have for every kitchen pantry.', 'Red Onions, 2 lb Bag Add savory flavor to a variety of dishes Perfect for at-home cooking Have a mild flavor that is not overpowering or pungent, making them highly versatile for a variety of meals including pizza, a fresh salad topper, on the BBQ and in a burger; Adds color and exceptional flavor to any meal, whether slivered, chopped or diced, making them perfect for at-home cooking Delicious fresh produce item', 'Fresh Produce', 'https://i5.walmartimages.com/asr/73f2f373-5441-47fb-b38c-ad396be33738.3c7b9d6e7e75b12b6f326b0fa1f9c9b6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/73f2f373-5441-47fb-b38c-ad396be33738.3c7b9d6e7e75b12b6f326b0fa1f9c9b6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/73f2f373-5441-47fb-b38c-ad396be33738.3c7b9d6e7e75b12b6f326b0fa1f9c9b6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
