INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (41781273, 'Fresh Black Seedless Grapes, Bag (2.25 lbs/Bag Est.)', 2.27, '204957000001', 'Treat yourself to the delicious, juicy flavor of Fresh Black Seedless Grapes. These grapes are bursting with flavor and are completely seedless, so you can easily enjoy a handful as a fresh snack any time of day. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Fresh Black Seedless Grapes.', 'Fresh Black Seedless Grapes Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ade17cfd-b528-426e-a4e8-1744cd837766.971df50b9d7a3b0325702e7ad6e46907.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ade17cfd-b528-426e-a4e8-1744cd837766.971df50b9d7a3b0325702e7ad6e46907.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ade17cfd-b528-426e-a4e8-1744cd837766.971df50b9d7a3b0325702e7ad6e46907.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (42132297, 'Marketside Organic Baby Kale, 5 oz', 3.46, '681131072793', 'Marketside Organic Baby Kale is picked young for its tenderness and mild flavor. Kale is a very healthy addition to your daily diet as it is a rich source of vitamin A, vitamin C, vitamin K, calcium and iron. You can serve kale after braising it, either alone or mixed with greens like collard, mustard or turnip. It can also be used in salads, or as a side dish. They are certified organic as per USDA standards. They are washed and ready to eat from the pack, so you don\'t have to work towards getting a healthy meal. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Baby Kale Organic 5 oz', 'Marketside', 'https://i5.walmartimages.com/asr/b694cf44-0b27-4caf-9525-9d886b4d4ea6_2.771a9975f3fe9eaa7949e380d4c7b081.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b694cf44-0b27-4caf-9525-9d886b4d4ea6_2.771a9975f3fe9eaa7949e380d4c7b081.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b694cf44-0b27-4caf-9525-9d886b4d4ea6_2.771a9975f3fe9eaa7949e380d4c7b081.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (42353640, 'Fresh Produce, Bagged Whole Red Radish, 1 Bag Each', 1.74, '033383670027', 'Serve up something amazing when you cook with Fresh Red Radish. This versatile root vegetable is a great addition to a healthy diet and can be prepared in a variety of ways. Their slightly peppery flavor adds a natural, subtle spice to salads and slaws. Their crisp texture makes them a natural, healthy choice for dips. Try them as a low-carb substitute for potatoes when roasted or as a healthy side dish when grilled. However, you choose to use them, these fresh radishes will add big flavor and unforgettable taste to any meal. The culinary possibilities are endless with Fresh Red Radish..', 'Fresh Produce, Bagged Red Whole Radish, 1 Each Wholesome, versatile, and delicious Cool and crunchy with a peppery taste to salads Great in soups, salads, slaws, dips or raw Also known as Bolsa de rábanos, luóbo dài and mūlī kī thailī around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5121964c-a2e6-40b2-bdf0-9271cdc00835.9d768f180827f9842fafc0c053b1da7d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5121964c-a2e6-40b2-bdf0-9271cdc00835.9d768f180827f9842fafc0c053b1da7d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5121964c-a2e6-40b2-bdf0-9271cdc00835.9d768f180827f9842fafc0c053b1da7d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
