INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (42408862, 'Fresh Thai Chile Peppers, 4 Ounce Bag', 2.98, '045255115406', 'Add some color and heat to your next meal with our fresh Thai Chile Peppers. Also known as the bird\'s eye chili, Thai chile peppers are a popular ingredient in Southeast Asian cuisine. You can pickle these peppers and serve with a savory noodle dish or make them into a curry paste. Use them to make a spicy coconut milk chicken curry soup or a zesty chicken stir-fry. However you choose to use them, these chile peppers will add spice to any recipe. Explore new recipes and discover all the delicious ways to prepare this tasty and nutritious pepper. Add a kick of heat to your next meal with our fresh Thai Chile Peppers.', 'Thai Chile Peppers, 4 oz: Extremely versatile vegetable Also known as the bird\'s eye chili Perfect ingredient for Southeast Asian cuisine Try them pickled & serve with noodles Make a spicy soup or a savory stir-fry Explore delicious new recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/75d3a4e5-72c5-42c3-84a3-0a34e39800e2.5f384a14349a03e4e678ef65eac8b434.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75d3a4e5-72c5-42c3-84a3-0a34e39800e2.5f384a14349a03e4e678ef65eac8b434.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75d3a4e5-72c5-42c3-84a3-0a34e39800e2.5f384a14349a03e4e678ef65eac8b434.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
