INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (42700530, 'Yellow Potatoes Whole Fresh, 3lb Bag', 2.64, '033383533032', 'Introducing our premium Yukon Gold Potatoes, a 3 Lb. pack of earthy goodness! These versatile, golden-fleshed potatoes boast a buttery flavor and velvety texture, perfect for all your culinary needs. Ideal for boiling, mashing, roasting, or frying, their thin, smooth skin retains essential nutrients and ensures easy preparation. Sustainably grown and carefully handpicked, our Yukon Gold Potatoes are non-GMO and free from harmful chemicals. With their rich, satisfying taste and exceptional quality, elevate your dishes to new heights with this 3 Lb. pack of wholesome Yukon Gold Potatoes.', 'Guarantee Brand Yukon Gold Potatoes, 3 lb Introducing our premium Yukon Gold Potatoes, a 3 Lb. pack of earthy goodness! These versatile, golden-fleshed potatoes boast a buttery flavor and velvety texture, perfect for all your culinary needs. Ideal for boiling, mashing, roasting, or frying, their thin, smooth skin retains essential nutrients and ensures easy preparation. Sustainably grown and carefully handpicked, our Yukon Gold Potatoes are non-GMO and free from harmful chemicals. With their rich, satisfying taste and exceptional quality, elevate your dishes to new heights with this 3 Lb. pack of wholesome Yukon Gold Potatoes.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a9f2e4a2-dbe2-44b5-b4a2-7a58c51ac7d5.7d44e9d9995635646c94d3556f42ef2d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a9f2e4a2-dbe2-44b5-b4a2-7a58c51ac7d5.7d44e9d9995635646c94d3556f42ef2d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a9f2e4a2-dbe2-44b5-b4a2-7a58c51ac7d5.7d44e9d9995635646c94d3556f42ef2d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (42794616, 'Fresh Shiitake Mushrooms, 3.2 oz', 3.98, '037102678103', 'Enjoy the rich, full flavor of fresh Shiitake Mushrooms. This versatile ingredient is perfect for a variety of dishes, whether its for breakfast, lunch, or dinner. Mince some up and put them in your omelet with peppers and ham for a filling breakfast. Slice them and add them to a healthy salad for lunch or slice them thin and sauté with barbeque sauce for a delicious, mouthwatering vegan burger. Shitake mushrooms are an excellent source of selenium and are naturally fat-free, cholesterol-free, and are low in calories and sodium. Enjoy the delicious taste of Shiitake Mushrooms any way you prepare them.', 'Rich, full flavor Great for breakfast, lunch, or dinner Mince them for an omelet, slice them for a salad, or sauté in barbeque sauce for a vegan sandwich Naturally fat-free and cholesterol-free Low in sodium and calories Excellent source of selenium', 'Monterey Mushrooms', 'https://i5.walmartimages.com/asr/6eadb39a-7463-4d65-a0f9-df8aab5eb7ce_1.4348b31319fdcad5927f8362a8f56a48.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6eadb39a-7463-4d65-a0f9-df8aab5eb7ce_1.4348b31319fdcad5927f8362a8f56a48.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6eadb39a-7463-4d65-a0f9-df8aab5eb7ce_1.4348b31319fdcad5927f8362a8f56a48.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (43236028, 'Fresh Petite Carrots, 12 oz, Bag', 1.86, '033383088037', 'Fresh Petite Carrots are cut, peeled and ready to eat for your convenience. Enjoy them as an ingredient in your favorite recipes or simply enjoy them as a healthy snack on the go. Make a tasty snack and serve these petite carrots with celery and ranch dressing or hummus for dipping. These carrots come in a microwavable bag, making them easy to prepare for a dinnertime side dish. Carrots are one of nature\'s best sources of nutrients, rich in Vitamin A with antioxidant beta-carotene. Carrots provide dietary fiber and potassium. Health agencies recommend that you eat five or more servings of fruits and vegetables, which include carrots, every day for good health. Enjoy the delicious flavor and healthy crunch of Fresh Petite Carrots.', 'Fresh Petite Carrots 12-ounce bag Excellent source of beta carotene, fiber, vitamin K1, potassium, and antioxidants No preservatives Washed and ready to eat Perfect for packing in lunches or serving as a snack with dip Microwaveable packaging', 'Fresh Produce', 'https://i5.walmartimages.com/asr/3e12070f-d731-4c6a-bda8-4e47ef043025.3f7f33acdb814ceeb7f749980acf7ebf.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e12070f-d731-4c6a-bda8-4e47ef043025.3f7f33acdb814ceeb7f749980acf7ebf.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e12070f-d731-4c6a-bda8-4e47ef043025.3f7f33acdb814ceeb7f749980acf7ebf.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
