INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (43278218, 'Yam Root Whole Fresh, Each (Name Florido)', 9.12, '000000032766', 'Create something delicious with this fresh Yam (Name) Root. Also known as a \"true yam,\" the name yam is a versatile root that may be prepared like a potato. Commonly used in tropical regions, this yam should be peeled and cooked before eaten. Name yams can be cooked in a variety of ways, such as mashed, baked, boiled, fried, and more. Use it to make crispy fries, a comforting stew, or even a sweet cake. It\'s also a good source of fiber, B vitamins, and vitamin C. Make your next culinary masterpiece with Yam (Name) Root.', 'Great source of fiber Rich in B vitamins and vitamin C Can be boiled, mashed, roasted, fried, and more Fresh and whole Must be peeled and cooked before eaten Versatile and delicious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2ad2dcdb-9aca-4cc4-b024-a7303762f6c6.0a3c22ca0f682d57e4e58497385bf0d8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2ad2dcdb-9aca-4cc4-b024-a7303762f6c6.0a3c22ca0f682d57e4e58497385bf0d8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2ad2dcdb-9aca-4cc4-b024-a7303762f6c6.0a3c22ca0f682d57e4e58497385bf0d8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (43279694, 'Savoy Cabbage Repollo', 1.48, '000000045551', 'Get creative in the kitchen with super versatile and yummy Green Cabbage. Green cabbage is low in calories and high in fiber and antioxidants making it a great part of any healthy diet. Best of all, this cabbage can be used a myriad of different recipes and cuisines. This amazing vegetable can be incorporated into everything from delicious and creamy cole slaw, stuffed cabbage, and wraps, to egg rolls, grilled cabbage, curry, kimchi and more. You can even use it during breakfast in a delicious frittata. Green cabbage can be roasted, boiled, braised, grilled, sauted, and even blanched. The possibilities are endless when you bring home Green Cabbage', '1 head of green cabbage Versatile and healthy ingredient Can be roasted, boiled, braised, grilled, sauted, and even blanched Incorporate into everything from delicious and creamy cole slaw, stuffed cabbage, and wraps, to egg rolls, grilled cabbage, curry, kimchi and more Low in calories and high in fiber and antioxidants', 'Fresh Produce', 'https://i5.walmartimages.com/asr/223b5fb6-e842-49fb-9679-7745b5ad1eee.068229ec90a55030fdc11bc646b9cbd4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/223b5fb6-e842-49fb-9679-7745b5ad1eee.068229ec90a55030fdc11bc646b9cbd4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/223b5fb6-e842-49fb-9679-7745b5ad1eee.068229ec90a55030fdc11bc646b9cbd4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (43923182, 'Fresh Fuji Apple, Each', 0.83, '030767041299', 'Treat your family to the healthy taste of Fuji Apples. Low in calories, these crisp and crunchy apples can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these apples to make a rich and creamy yogurt parfait or serve them alongside your pancakes, sausage, and eggs. Slice these apples and use them to add flavor to a lunchtime salad or spread peanut butter on them for a protein-filled snack. Fuji Apples are used in many tasty desserts like apple cobbler, apple crisp, and apple pie. Get creative in the kitchen and make homemade apple butter or applesauce. However you choose to use them, Fuji Apples add sweetness to any meal.', 'Fresh Fuji Apple, Each: Crunchy, crisp & sweet flavor Low in calories Enjoy on their own or in a variety of recipes Make a creamy yogurt parfait Serve with your pancake breakfast Adds flavor to a variety of recipes Make apple butter or applesauce Make sweet desserts like apple cobbler, apple crisp & apple pie', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ecbe0124-9333-4b2f-9f99-b37fc032fb52.d9f86f3c2d89f8fb4570cb1c42e91006.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ecbe0124-9333-4b2f-9f99-b37fc032fb52.d9f86f3c2d89f8fb4570cb1c42e91006.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ecbe0124-9333-4b2f-9f99-b37fc032fb52.d9f86f3c2d89f8fb4570cb1c42e91006.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (43923235, 'Fresh Tomatillos by Weight', 1.85, '853447003154', 'Enjoy the delicious flavor of Fresh Tomatillos raw or cooked. Tomatillos have a slightly acidic, tangy flavor when raw and have a sweeter, less acidic taste when cooked. This versatile ingredient is perfect for a variety of mouthwatering dishes. Use them raw and chop it and mix into a salsa for a tangy addition. Puree them and pour over a pork butt in a slow cooker and let it cook for several hours for a tender, juicy pork butt that?s great for taco or burritos. Simply, shuck the husk off the tomatillos and wash then prepare them for your dish. With so many so many ways to prepare Fresh Tomatillos will become a staple in your dishes. Also known as Green Tomato and Tomatillo around the word.', 'Tomatillos, Per Pound: Acidic, tangy flavor raw and a sweeter, less acidic taste cooked Versatile ingredient perfect for a variety of dishes Chop and mix with onions, cilantro, and lime juice for salsa Puree and pour over pork butt in a slow cooker for a tender and juicy protein for tacos and burritos Shuck off the husk, wash, and then prepare', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c6d94102-7d80-4fbb-ad3c-334aea20566a.dd190789e6e95eb0cbc06fd6545fd761.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c6d94102-7d80-4fbb-ad3c-334aea20566a.dd190789e6e95eb0cbc06fd6545fd761.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c6d94102-7d80-4fbb-ad3c-334aea20566a.dd190789e6e95eb0cbc06fd6545fd761.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (43923746, 'Fresh SugarBee Apple, Each', 1.69, '000000034869', 'With exceptional crispness and delicious sweet flavor, SugarBee Apples deliver an un-bee-lievable eating experience. This unique, natural marvel was created by honeybees who mixed the pollen of a mystery apple variety with Honey crisp. With great versatility and nutritional value, SugarBee Apples make for the perfect snack or ingredient in apple pies, tarts, turnovers, juices and more. Sweeter. Crispier. Honey-r. From bee to you.', 'Sugarbee Apples Notes of honey, caramel and molasses Crisp, firm texture and a crunchy bite Juicy, aromatic and just the right amount of sweetness Perfect for a variety of seasonal treats like caramel apples, ciders and more Pairs well with cheeses like gouda and sharp cheddar Adds flavor to a variety of recipes', 'SugarBee', 'https://i5.walmartimages.com/asr/0fabf6bb-bbfc-4cf6-bda1-5faffb98e98b.ca073c0767dd716961a4aebed5259d93.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0fabf6bb-bbfc-4cf6-bda1-5faffb98e98b.ca073c0767dd716961a4aebed5259d93.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0fabf6bb-bbfc-4cf6-bda1-5faffb98e98b.ca073c0767dd716961a4aebed5259d93.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390943, 'Fresh Green Seedless Grapes, Bag (2.25 lbs/Bag Est.)', 3.65, '000000044981', 'Treat yourself to the delicious, juicy flavor of Fresh Green Seedless Grapes. These grapes are bursting with flavor and are completely seedless. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Fresh Green Seedless Grapes.', 'Fresh Green Seedless Grapes Bag Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7a31dc3a-cf2c-4e7e-829c-88e40e488e7a.e79a0599056e495b799eb1a237b5452f.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7a31dc3a-cf2c-4e7e-829c-88e40e488e7a.e79a0599056e495b799eb1a237b5452f.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7a31dc3a-cf2c-4e7e-829c-88e40e488e7a.e79a0599056e495b799eb1a237b5452f.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390944, 'Fresh Roma Tomato, Each', 0.23, '000000032827', 'With Fresh Roma Tomatoes from Walmart, it\'s easy to make a wholesome, delicious meal. Roma tomatoes are a fresh produce ingredient for whipping up a variety of wonderful dishes. You can use them to create a zesty tomato sauce for stirring into a homemade pasta dish, crush them up to make a delightful Roma tomato bruschetta, or simply enjoy them on their own as a nutritious snack or as a party platter option for dipping in your favorite vegetable dipping sauce. If you\'re feeling a classic tomato dish, Roma tomatoes can even lend themselves in making a comforting and appetizing tomato soup or a flavorful salsa. However you choose to use them, each Roma tomato will add stunning flavor to your meal. Just find the recipe and experience the tasty results for yourself! Elevate your recipes with Roma Tomatoes.', 'Fresh Roma Tomato, Each: Wholesome and delicious fresh produce Ideal ingredient for a variety of dishes Perfect for making zesty tomato sauces Enjoyable as a nutritious snack Excellent for homemade salsa', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ecef8a3e-ab96-445e-a16a-d639b40eb5fb.93fcc627f542f02488e5ee9d8e26f152.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ecef8a3e-ab96-445e-a16a-d639b40eb5fb.93fcc627f542f02488e5ee9d8e26f152.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ecef8a3e-ab96-445e-a16a-d639b40eb5fb.93fcc627f542f02488e5ee9d8e26f152.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390945, 'Green Bell Pepper, 1 each', 0.98, '000000040655', 'Enhance your meals with the delicious flavor of Green Bell Peppers. This vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Green bell pepper, also known as green capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them and add to a deli sandwich, saute them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out green bell pepper can be filled with sausage, mushrooms, and rice to create a delicious stuffed pepper that will have the family asking for seconds. Lunches and dinners are more scrumptious when fresh green peppers are part of the meal. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudite. Cooked or uncooked, Green Bell Peppers are an excellent item to have on hand. Also known as Pimiento verde, Green chili, Filfil akhdar and Hari mirch around the world.', 'Green Bell Pepper, 1 each: Naturally low in calories Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh green peppers', 'Fresh Produce', 'https://i5.walmartimages.com/asr/15c8fcf1-7b73-429e-8a7c-802091d818f1.4730164455d5cc0a04d2b1f675971dd1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15c8fcf1-7b73-429e-8a7c-802091d818f1.4730164455d5cc0a04d2b1f675971dd1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15c8fcf1-7b73-429e-8a7c-802091d818f1.4730164455d5cc0a04d2b1f675971dd1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390947, 'Fresh Produce, Whole Zucchini, 1 Each', 0.88, '000000040679', 'This Zucchini, Each provides a healthy dose of vitamins to add to your diet. Ideal for many types of cuisines, it can be enjoyed year-round in many recipes. It can be used as a simple side dish, sauteed in oil, herbs and spices. You can also serve it with a protein and a starch for a wholesome meal. This zucchini vegetable is sold in the store at a per-unit price, so you can stock up on as many as you need. You can even buy just one single zucchini at a time. Also known as Calabacin, Kousa and Tori around the world.', 'Fresh zucchini Sold individually Ideal for use in a savory side dish Highly nutritious vegetable that offers an excellent source of fiber Also known as Calabacin, Kousa and Tori around the world.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7d7a2618-ed85-45bd-bf30-11b14b289c34.d484064e9e02e1132b6a3da45c871632.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7d7a2618-ed85-45bd-bf30-11b14b289c34.d484064e9e02e1132b6a3da45c871632.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7d7a2618-ed85-45bd-bf30-11b14b289c34.d484064e9e02e1132b6a3da45c871632.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390948, 'Fresh Banana, Each', 0.2, '717524111128', 'Enhance breakfast and baking dishes by incorporating fresh Banana (Guineo) Fruit into family-favorite recipes. Each banana is a versatile fruit that\'s packed with potassium and dietary fiber to help maintain a balanced and nutritional diet. They\'re essential to a wealth of traditional recipes, as well as a healthy, easy snack the entire family will enjoy. Their soft, ripened fruit is a favorite of all ages and offers a sweet and delicious bite that makes a tasty smoothie and snack addition. Raw bananas have a universal use that complements many flavors and can easily add a different and delicious dimension to ice cream and dessert treats.', 'Fresh produce Easy-to-peel bananas Can be enjoyed raw or cooked Can elevate dessert and breakfast recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5939a6fa-a0d6-431c-88c6-b4f21608e4be.f7cd0cc487761d74c69b7731493c1581.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5939a6fa-a0d6-431c-88c6-b4f21608e4be.f7cd0cc487761d74c69b7731493c1581.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5939a6fa-a0d6-431c-88c6-b4f21608e4be.f7cd0cc487761d74c69b7731493c1581.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390949, 'Fresh Hass Avocados, Each', 0.97, '405563623039', 'Whole conventional avocados are a versatile and nutrient-dense fruit that can be enjoyed in many different recipes. They are perfect for barbecues and outdoor gatherings with friends and family. Avocados can be used in Mexican food items like tacos or burritos, as appetizers like avocado crostini, or in a fresh guacamole or avocado dip. They provide unsaturated \"good\" fats and almost 20 vitamins, minerals, and phytonutrients. When selecting avocados, look for a dark green to nearly black skin color, a bumpy texture, and they should yield to gentle pressure without feeling mushy. They are creamy, mild, and light. Enjoy all kinds of healthy foods and recipes at your next gathering with friends and family.', 'Fresh fruit with a creamy texture and mild flavor A cholesterol free fruit that contains almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9 Avocados are the lowest sugar fruit and provide unsaturated “good fats” that help absorb Vitamin A, Vitamin D, Vitamin K and Vitamin E Ripe avocados will have dark green to nearly black skin color, a bumpy texture and should yield to gentle pressure without leaving indentations', 'Fresh Produce', 'https://i5.walmartimages.com/asr/af510d27-f416-4691-99fa-0943d730f8d2.8607ec56ce71993860620dc4c8ca9cd6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/af510d27-f416-4691-99fa-0943d730f8d2.8607ec56ce71993860620dc4c8ca9cd6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/af510d27-f416-4691-99fa-0943d730f8d2.8607ec56ce71993860620dc4c8ca9cd6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390950, 'Fresh Honeycrisp Apple, Each', 1.06, '748790328378', 'Honeycrisp Apples are the ultimate healthy choice for busy families, offering a sweet-tart crunch that kids adore and parents trust. Say goodbye to snack-time negotiations! These premium, U.S. Extra Fancy Honeycrisp Apples deliver guaranteed quality and flavor, making them the perfect lunchbox hero and an ideal ingredient for versatile home cooking. Their unique, crisp texture and honey-sweet flavor profile means they are fantastic enjoyed fresh as a healthy snack or cooked into delicious family favorites, from classic applesauce to a quick morning smoothie. Stock up on these premium fresh apples and confidently provide your family with a convenient, nutritious, and absolutely irresistible option.', 'The Flavor Kids Beg For: Perfectly balanced sweet-tart flavor with a hint of honey. It\'s the guilt-free treat your family will choose first. Lunchbox Hero & Easy Snack: Ready-to-eat convenience makes packing lunches a breeze. Just wash and toss one in the bag! Unmatched Versatility: Crisp enough for on-the-go snacking, yet bakes beautifully into pies, sauces, and crumbles. Maximize your grocery value! Premium, U.S. Extra Fancy Quality: confident in our quality - expect a beautiful, vibrant red-orange apple that looks as good as it tastes.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fdffb720-8b75-43df-bffe-4ffc4e9369d8_3.d4460fa9146eb9716b5804d61d4b26b9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fdffb720-8b75-43df-bffe-4ffc4e9369d8_3.d4460fa9146eb9716b5804d61d4b26b9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fdffb720-8b75-43df-bffe-4ffc4e9369d8_3.d4460fa9146eb9716b5804d61d4b26b9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390951, 'Fresh Mandarin Oranges, 5 lb Bag', 6.67, '605049428640', 'Enjoy the juicy goodness of citrus when you eat a Fresh Mandarin Orange. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, clementines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, mandarins are now available year-round in most markets. Mandarins are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, mandarins are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious fresh mandarin on hand for an easy, healthy treat.', 'Fresh Mandarins, 5 lb Bag Delicious, sweet, juicy citrus Pleasing sweet-tart flavor Easy to peel and segment Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless You\'ll have plenty for the whole family with this 5-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/74f9c12b-7d59-4b92-bfc7-8ca35ceb0bbc.6825cad59a8e52c10d2bdb436b093770.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/74f9c12b-7d59-4b92-bfc7-8ca35ceb0bbc.6825cad59a8e52c10d2bdb436b093770.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/74f9c12b-7d59-4b92-bfc7-8ca35ceb0bbc.6825cad59a8e52c10d2bdb436b093770.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390952, 'Fresh Produce, Green Whole Asparagus, 1 Bunch Bundle', 3.08, '012842001534', 'Asparagus is a fresh and flavorful vegetable that has a crisp texture and mild earthy taste. This nutrient-rich vegetable that is packed with vitamins, minerals & fiber. Asparagus is the perfect ingredient item that is elicious in pasta, salads, casseroles or soups. They are also simple to prepare as a side, saute in olive oil or wrap in bacon for the grill. Asparagus is a healthy side that complements any meal. Asparagus is also know as Espárragos, Asuparagasu, Hilyawn, Asfaraj & Shatavari around the world.', 'Asparagus is fresh & flavorful with a crsip texture & a mild earthy taste Nutrient-rich vegetable that is packed with vitamins, minerals & fiber Simple to prepare, saute in olive oil or wrap in bacon for the grill Perfect ingredient item that is elicious in pasta, salads, casseroles or soups A healthy side that complements a wide variety of main dishes Also known as Espárragos, Asuparagasu, Hilyawn, Asfaraj & Shatavari around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5556f793-0600-4e42-812e-ae2cb11c0047.2635cfb5344dbbbee8ff1cb6d52877c8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5556f793-0600-4e42-812e-ae2cb11c0047.2635cfb5344dbbbee8ff1cb6d52877c8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5556f793-0600-4e42-812e-ae2cb11c0047.2635cfb5344dbbbee8ff1cb6d52877c8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
