cidity Make a creamy smoothie or a nutritious juice blend Perfect as a healthy treat or seasonal baking ingredient Great for packing in lunches Make a creamy smoothie or a nutritious juice blend Adds flavor to a variety of recipes', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/bcfd9451-a73b-411f-84e3-1d866f833ae8.3e996f05a24facfa2ac526d6c631401d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bcfd9451-a73b-411f-84e3-1d866f833ae8.3e996f05a24facfa2ac526d6c631401d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bcfd9451-a73b-411f-84e3-1d866f833ae8.3e996f05a24facfa2ac526d6c631401d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390964, 'Sweet Potatoes Whole Fresh, Each (Batata Mameya)', 1.11, '000000048163', 'Create something wholesome, fresh and delicious with these Sweet Potatoes (Yams) .These versatile vegetables can be used to make savory sides or sweet treats. Try them roasted or baked for a tasty addition to any dish. You could also use them to make seasoned sweet potato fries or a flavorful hummus dip for your next party. If you want to satisfy your sweet tooth, try them in a traditional sweet potato casserole or use them to make sweet potato and brown sugar ice cream. The mouthwatering possibilities are endless with this hearty vegetable. Add something amazing to your meals with Sweet Potatoes.', 'Wholesome, versatile, and delicious Ideal ingredient for a variety of dishes Make seasoned sweet potato fries or a flavorful hummus dip Use them for a sweet potato casserole or sweet potato and brown sugar ice cream Sometimes referred to as yams', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1696f72c-2214-4f16-9a53-f737b4039260.5059dac4fe3ac4097e944e7e59ac55b9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1696f72c-2214-4f16-9a53-f737b4039260.5059dac4fe3ac4097e944e7e59ac55b9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1696f72c-2214-4f16-9a53-f737b4039260.5059dac4fe3ac4097e944e7e59ac55b9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
