INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390977, 'Fresh Muscadine Bronze Grapes, Whole, 1 lb Tray', 3.88, '033383250731', 'Enjoy the sweet taste of these Fresh Muscadine Bronze Grapes. Native to the southern United States, these muscadine grapes have a thick, tough skin and a sweet, juicy interior. These large, round grapes come in various shades of purple to bronze and are known for their unique musky whole flavor. Rich in antioxidants and vitamins, muscadine grapes are enjoyed fresh, as well as in jams, jellies, and wines. With a sweet flavor, they\'re great for snacking and can be used in salads, smoothies, and desserts, making them a perfect addition to any meal. Bring home some Fresh Muscadine Bronze Grapes today.', 'Fresh Muscadine Bronze Grapes, Whole, 1 lb Tray Tasty, nutritious fruit ideal for snacking or adding to recipes Muscadine grapes have a high concentration of antioxidants These grapes provide dietary fiber, supporting digestive health, cholesterol regulation, and weight maintenance With a sweet flavor, they\'re great for snacking and can be used in salads, smoothies, and desserts, making them a perfect addition to any meal Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7c72acc7-6cdc-465f-8699-f5062fae2d7e.6c465b360f3f7b24a97185c6001423ad.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7c72acc7-6cdc-465f-8699-f5062fae2d7e.6c465b360f3f7b24a97185c6001423ad.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7c72acc7-6cdc-465f-8699-f5062fae2d7e.6c465b360f3f7b24a97185c6001423ad.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390980, 'Fresh Pink Lady Apple, Each', 0.82, '000000041300', 'Treat yourself to the delicious, crisp taste of Pink Lady Apples. These apples are known for their vivid green skin covered in a pinkish blush, crunchy texture, and tart taste with a sweet finish. Enjoy one with breakfast or lunch or as a fresh snack any time of day. with Pink Lady Apples. These are some of the fresh produce we offer that is made with organic ingredients.', 'Fresh Pink Lady Apples, Each: Crisp and aromatic with a pleasant sweet but tart flavor Great morning, noon, or night Chop them up and add to a salad, dice and top with oats, spices, and butter for an apple crisp, or serve with a dollop of peanut butter Versatile ingredient great for a variety of dishes Make a creamy smoothie or a nutritious juice blend Perfect as a healthy treat or seasonal baking ingredient Great for packing in lunches Make a creamy smoothie or a nutritious juice blend Adds flavor to a variety of recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fb057123-7b14-45f0-8b95-0b7ba1aca744.5a3e368f1b6db1be85515a4e5015a780.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb057123-7b14-45f0-8b95-0b7ba1aca744.5a3e368f1b6db1be85515a4e5015a780.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb057123-7b14-45f0-8b95-0b7ba1aca744.5a3e368f1b6db1be85515a4e5015a780.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390986, 'Fresh Personal Seedless Watermelon, Each', 4.18, '823298000138', 'Discover the refreshing taste and convenience of a Fresh Personal Seedless Watermelon. Ideally sized for modern kitchens, these personal watermelons are often sought after as a mini watermelon because of their compact shape that fits neatly into refrigerator drawers. Slice through the vibrant green rind to reveal crisp, juicy red flesh bursting with natural sweetness. Known as sandia in many households, this whole fruit serves as a wonderful choice for backyard picnics, fresh fruit salads, or blending into cooling smoothies. The manageable size allows you to enjoy fresh melon with ease, making it simple to wash, carry, and prepare whenever you crave a healthy treat.', 'Compact personal size fits easily in refrigerator drawers and travel coolers Crisp red flesh offers a sweet and juicy texture for a refreshing treat Naturally hydrating snack that is fat-free and low in calories Lightweight whole fruit is effortless to carry, wash and slice for quick preparation Delicious addition to fruit salads, sandia fresh waters, lunch boxes and sorbets Convenient mini watermelon size reduces food waste and storage needs', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d3ac703a-9c91-451a-8218-f522602003d7.fc560b0a40424cda1152890f8f927344.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d3ac703a-9c91-451a-8218-f522602003d7.fc560b0a40424cda1152890f8f927344.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d3ac703a-9c91-451a-8218-f522602003d7.fc560b0a40424cda1152890f8f927344.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390991, 'Fresh Granny Smith Apples, 3 lb Bag', 3.62, '888289401073', 'Treat yourself to Freshness Guaranteed Granny Smith Apples. Granny Smith apples are firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor, perfect for use in a variety of dishes morning, noon, and night. Slice them up and cook in a skillet with brown sugar, butter, cloves, and nutmeg for a simple, sweet treat. Mix them with cabbage, grapes, honey, mayonnaise and, celery to make a fresh, apple slaw for a summer cookout. Use them to make a sweet, classic apple pie that your friends and family with love. Create delicious meals and treats with Freshness Guaranteed Granny Smith Apples. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor Great for breakfast, lunch, dinner, or dessert Cook in a skillet with butter, brown sugar, and spices; mix with cabbage, grapes, honey, mayonnaise and, celery for apple slaw; or make a classic apple pie Versatile ingredient perfect for both savory and sweet dishes Meets or exceeds U.S. Extra Fancy They have a creamy white flesh with low acidity', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/50a4f85e-f8c7-4ff3-857b-92066c31ab5e.b05cce25b6be38f5892bad0ebb8ff078.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/50a4f85e-f8c7-4ff3-857b-92066c31ab5e.b05cce25b6be38f5892bad0ebb8ff078.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/50a4f85e-f8c7-4ff3-857b-92066c31ab5e.b05cce25b6be38f5892bad0ebb8ff078.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390992, 'Fresh Whole Sweet Onion, Each', 0.96, '204166000007', 'Add flavor to your next meal with fresh Sweet Onions. This versatile vegetable adds flavor and texture to a variety of recipes. For breakfast, you could dice them and add to an omelet loaded with cheese, ham, and mushrooms. You can dice these onions and add them to a fresh garden salad for a satisfying crunch or sprinkle them on top of your fish tacos. Sweet onions also make delicious golden onion rings to serve alongside juicy hamburgers and hot dogs at your next backyard barbecue. You can keep these onions at room temperature until ready to use. Stock your pantry with several of these fresh, whole Sweet Onions.', 'Whole fresh sweet onions, each: Less pungent than other varieties of onions Mild, sweet flavor Great in dishes that feature onion as a primary flavor, like onion soup Yummy addition to salads and sandwiches Store in the refrigerator for best results Packed with minerals and vitamins Delicious and nutritious Less pungent than other varieties of onions Mild, sweet flavor Great in dishes that feature onion as a primary flavor, like onion soup Yummy addition to salads and sandwiches Store in the Bag refrigerator for best results Packed with minerals and vitamins Delicious and nutritious, No Preservatives', 'Fresh Produce', 'https://i5.walmartimages.com/asr/751d9737-f277-476b-853c-e0051119e55f.6682664c7777fd9f7ceec9e4078bf383.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/751d9737-f277-476b-853c-e0051119e55f.6682664c7777fd9f7ceec9e4078bf383.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/751d9737-f277-476b-853c-e0051119e55f.6682664c7777fd9f7ceec9e4078bf383.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44390996, 'Fresh Long English Cucumber, Each', 0.97, '003338301009', 'Enjoy the fresh, crisp, delicious flavor of English Cucumber. Packed with nutritional benefits such as being naturally low in calories, carbohydrates, sodium, fat, and cholesterol, cucumbers also provide potassium, fiber, and vitamin C and clock in at a cool 16 calories per cup. Use this cucumber to make healthy treats such as a cucumber salad with tomatoes and onions in a vinaigrette dressing, toss with fresh mozzarella, tomatoes, and a drizzle of balsamic vinegar, mix diced cucumbers with Greek yogurt, lemon, dill, and garlic for a refreshing tzatziki sauce for gyros or veggies, add to a crisp, fresh veggie salad, or thinly slice and add to a vinegar brine for quick pickles. Any way you slice, dice, or spiralize them, English Cucumber is a refreshing, healthy addition to any meal.', 'English Cucumber, 1 Each: Single cucumber Crisp, delicious, and refreshing Naturally low in calories, carbohydrates, sodium, fat, and cholesterol Provides potassium, fiber, and vitamin C, among other nutrients Create delicious recipes with this fresh cucumber', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ab5b3a59-55ca-4e21-b071-d6410abcd75b.d4490acd083eb12bee46c4335a6dceb4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ab5b3a59-55ca-4e21-b071-d6410abcd75b.d4490acd083eb12bee46c4335a6dceb4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ab5b3a59-55ca-4e21-b071-d6410abcd75b.d4490acd083eb12bee46c4335a6dceb4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391001, 'Fresh Carrot Chips, 1 lb, Bag', 2.07, '033383088006', 'Serve up a delicious snack with Fresh Carrot Chips. Carrots are a great source of beta carotene, fiber, vitamin K, potassium, and antioxidants. Ready to eat as-is, serve them with your favorite healthy dip for a snack that is better for you than traditional potato chips, add them to a crudité platter with other fresh vegetables, roast them in the oven with some olive oil and a little honey for a delectable side dish, or make a quick refrigerator pickle with radish slices and onions for a fun condiment with Mexican flair for your next Taco Tuesday. Perfectly portable, it’s easy to pack some carrot chips in your lunch or take a bag with you for a mid-afternoon pick-me-up. Keep healthy snacks within reach when you stock of up Fresh Carrot Chips.', 'Fresh Carrot Chips 1-pound bag Great source of beta carotene, fiber, vitamin K, potassium, and antioxidants Ready to eat Serve with your favorite dip as an alternative to traditional potato chips', 'Unbranded', 'https://i5.walmartimages.com/asr/39b48ca6-6c78-4f45-8a68-3106bd77c507.295daa91ace35ef1e629b902a19ff2c0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39b48ca6-6c78-4f45-8a68-3106bd77c507.295daa91ace35ef1e629b902a19ff2c0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39b48ca6-6c78-4f45-8a68-3106bd77c507.295daa91ace35ef1e629b902a19ff2c0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391003, 'Fresh Orange Bell Pepper, Each', 1.48, '203121000007', 'Enhance your meals with the delicious flavor of Greenhouse grown Orange Bell Peppers. Orange bell pepper has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them and add to a deli sandwich, sauté them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper. They also taste delicious raw alongside other vegetables. Orange Bell Peppers are an excellent item to have on hand', 'Naturally low in calories, Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh bell peppers', 'Fresh Produce', 'https://i5.walmartimages.com/asr/eb1893c6-ff33-4a36-ba05-d7fe42b67fbf.830244cad6037e9c0b18c4c237259b5d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/eb1893c6-ff33-4a36-ba05-d7fe42b67fbf.830244cad6037e9c0b18c4c237259b5d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/eb1893c6-ff33-4a36-ba05-d7fe42b67fbf.830244cad6037e9c0b18c4c237259b5d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391004, 'Russet Baking Potatoes Whole Fresh, Each', 0.75, '000000040723', 'Russet Baking Potatoes are the perfect addition to your pantry. With so many ways to prepare potatoes, you\'ll want to add them to every meal. For breakfast, you could make crispy hash browns smothered in cheese and diced ham or add them to a savory omelet. For lunch or dinner, you could use these fresh potatoes to make au gratin potatoes, garlic mashed potatoes, or a baked potato loaded with cheese, sour cream, green onions, and bacon bits. If you\'re hosting a neighborhood get-together, you can use them to make creamy potato salad or homestyle French fries. Serve up something delicious when you cook with Russet Baking Potatoes.', 'Fresh Russet Baking Potatoes, each: Ideal addition to every pantry Make crispy hash browns or add to an omelet Serve garlic mashed potatoes or a loaded baked potato Great for potato salad or homestyle French fries Explore all the delicious ways to serve these satisfying potatoes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c638c006-a982-48f7-aa33-6d3a8dc2983c.8fd015937ebfdd46c8fcb6177d0d1b1d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c638c006-a982-48f7-aa33-6d3a8dc2983c.8fd015937ebfdd46c8fcb6177d0d1b1d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c638c006-a982-48f7-aa33-6d3a8dc2983c.8fd015937ebfdd46c8fcb6177d0d1b1d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391005, 'Fresh Ginger Root, Each', 0.97, '000000046121', 'Fresh Ginger Root has a light brown, textured skin and white to yellow flesh. Its peppery, pungent, zesty flavor is a great way to bring acidity and just a touch of sweetness to juices, teas, stir-fries, and more. With a fibrous, somewhat juicy texture, ginger can be used fresh, dried, powdered, or as an oil or juice. Plus, it is known to have amazing health benefits, and has been used to help digestion, reduce nausea, and fight the flu, thanks to its impressive array of vitamins and minerals like iron, potassium, and vitamin C. Whether you\'re garlic-ginger chicken and broccoli, candied ginger, or an immune-boosting ginger tea, you\'ll want to have Fresh Ginger Root on hand. Also known as Jengibre, Sheng Jiang, Zanjabeel and Adrak around the world.', 'Fresh Ginger Root, per lb: Light brown, textured skin and white to yellow flesh Peppery, pungent, zesty flavor Can be used fresh, dried, powdered, or as an oil or juice Great addition to juices, teas, and stir-fries', 'Fresh Produce', 'https://i5.walmartimages.com/asr/19b5b581-826c-4d16-9a51-4260b57d15a4.262bf459282bb9c9d6e73db2d0db0cfa.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19b5b581-826c-4d16-9a51-4260b57d15a4.262bf459282bb9c9d6e73db2d0db0cfa.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19b5b581-826c-4d16-9a51-4260b57d15a4.262bf459282bb9c9d6e73db2d0db0cfa.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391008, 'Fresh Lime, Each', 0.25, '883616002763', 'Add zest and flavor to your meals and beverages with these Limes (Lima). Freshly squeezed limes provide a healthy dose of vitamin C to your diet and are a key ingredient in many recipes, from homemade salsa to chicken dishes. The citrusy tropical flavor of these limes are sure to add a zing to all your cooked meals. Drizzle lime juice over fish or add it to your favorite sauces. Serve wedges of raw lime with your favorite cocktails and use them when baking cakes, cookies, and tarts. Enjoy the refreshing, tart flavor of Limes.', 'Juicy and fresh, packed with vitamin C Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use them when baking cakes, cookies and tarts Refreshing, tart flavor Available by the each', 'Fresh Produce', 'https://i5.walmartimages.com/asr/12314833-2e54-4739-94a2-7db45b63109d.16ff07e3c111df9be4158853c2e505ef.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/12314833-2e54-4739-94a2-7db45b63109d.16ff07e3c111df9be4158853c2e505ef.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/12314833-2e54-4739-94a2-7db45b63109d.16ff07e3c111df9be4158853c2e505ef.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391012, 'Fresh Navel Oranges, 4 lb Bag', 5.83, '033383120805', 'Fresh Navel Oranges are a good addition to a healthy diet along with other fruit. They\'re oval with a thick, easy-to-remove peel and segments that separate cleanly. Oranges are a fruit that contains vitamin C and other nutrients that can be eaten as is or juiced for a smooth beverage at breakfast. It is suitable for use in all kinds of sweet and savory dishes, from cakes to weeknight chicken dinners. Citric acid fruits like oranges can be stored at room temperature for several days or in the refrigerator for up to two weeks. Available in a 4 lb package, these Fresh Navel Oranges are great for the entire family.', 'Fresh Navel Oranges, 4 lb Bag A good addition to a healthy diet Easy to peel segments Contains vitamin C and other nutrients Can be juiced for a breakfast beverage Suitable for use in all kinds of sweet and savory dishes Store fresh oranges at room temperature or refrigerate', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fde3a905-a587-489d-baf8-399c6a685b03.30b341eb36f6f629e51f36434db8015f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fde3a905-a587-489d-baf8-399c6a685b03.30b341eb36f6f629e51f36434db8015f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fde3a905-a587-489d-baf8-399c6a685b03.30b341eb36f6f629e51f36434db8015f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391016, 'Kiwi Bulk, 1ea', 0.56, '066022040301', 'Kiwi, it is a fruit native to China, very popular for its sweet-tart flavor and its green flesh with small black seeds. It has a high water content and few calories. Rich in vitamins, fiber, antioxidants, vitamin K, and potassium, it is also low in calories. It is a refreshing fruit and can be eaten on its own, in fruit salads, smoothies, and more.', 'Rich in vitamin C, strengthens the immune system. Fiber, aids digestion and intestinal transit. Antioxidants, protect cells from damage. Vitamin K and potassium, support bones and heart health. Low in calories, ideal for healthy diets.', 'Unbranded', 'https://i5.walmartimages.com/asr/ea2f1505-0449-4d67-b4b4-d64294748ab5_2.ccee6b1b5876b8a7d2ef2395829076ad.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea2f1505-0449-4d67-b4b4-d64294748ab5_2.ccee6b1b5876b8a7d2ef2395829076ad.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea2f1505-0449-4d67-b4b4-d64294748ab5_2.ccee6b1b5876b8a7d2ef2395829076ad.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391018, 'Fresh Jalapeno Pepper, Approx. 3-5 per 0.25 Pound', 0.41, '853447003208', 'Enhance your meals with the delicious flavor of Jalapeno Peppers. Naturally low in calories, fat, and cholesterol, this vegetable is a great source of vitamins C, B6, A, and K, as well as folate and manganese. Jalapeno peppers have a range of pungency, and a crisp flavor that enhances a variety of recipes. Stuff jalapeno peppers with cheese and wrap in bacon for everyone?s favorite poppers, add them to enchiladas, put some diced jalapeno in your famous chili recipe, or make a zesty salsa using fresh jalapeno peppers. You can even add some diced jalapeno peppers and cheese to cornbread batter for a delectable chile cheese cornbread that will have everyone asking for seconds. Lunches and dinners are more scrumptious when fresh Jalapeno Peppers are part of the meal. Also known as Jalapeño, Spicy chili, Filfil har and Mirch around the world.', 'Jalapeno Pepper, 1 each: Naturally low in calories Rich in vitamins C, B6, A, and K Stuff jalapeno peppers and wrap in bacon for poppers, add to enchiladas or chili, or make a zesty salsa Approximately 3-5 peppers per .25 lb Versatile and delicious Jalapeno Peppers, 1 lb. Approximately 17 jalapenos per lb.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/540e857c-d063-4ad1-96a4-553c237171b3.080e0d33d92e26a5822927761234c7f1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/540e857c-d063-4ad1-96a4-553c237171b3.080e0d33d92e26a5822927761234c7f1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/540e857c-d063-4ad1-96a4-553c237171b3.080e0d33d92e26a5822927761234c7f1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391023, 'Fresh Green Beans, Bag (26.5 oz / Bag Est.)', 2.95, '000000040662', 'Add fresh flavor to your meal with fresh Green Beans. These green beans are an excellent source of vitamin A and vitamin C. Serve just as they are or add your favorite seasonings for additional flavor. Roast them with oil and spices for a rich and flavorful dish or add butter, shallots, salt, and pepper to green beans to create a yummy side dish. Serve with pork chops, chicken breasts, and other meats for a well-rounded meal. With so many uses, these greens beans will become a kitchen staple for your home. Fresh Green Beans are a quick and healthy side dish and a great addition to any meal.', 'Excellent source of vitamins A and C Roast with oil and spices or add butter, shallots, salt, and pepper for the perfect side dish Versatile ingredient Serve with pork chops, chicken breasts, and other meats for a well-rounded meal A kitchen staple', 'Fresh Produce', 'https://i5.walmartimages.com/asr/0f89b2d3-88e2-4bf2-a948-a78bde5e886f.66904022b5a6e51cf5c329a2ac19c822.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0f89b2d3-88e2-4bf2-a948-a78bde5e886f.66904022b5a6e51cf5c329a2ac19c822.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0f89b2d3-88e2-4bf2-a948-a78bde5e886f.66904022b5a6e51cf5c329a2ac19c822.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
