INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391032, 'Marketside Organic Yellow Onions Whole Fresh, 3 lb Bag', 4.78, '033383900018', 'Give all of your dishes a wonderful flavor with these Organic Yellow Onions 3-lb Bags. They can be added to all of your favorite foods including hamburgers, stir-fries, soups, and pizza and used to make onion rings or blooming onions. These onions can be sauteed or served raw and stored in a cool, dry area until you are ready to use them. They have a fresh taste that will put something extra in your dish. These onions are easy to peel and quick to prepare so you can serve them on your dinner plate in no time. Add these veggies to your next dish and impress others with your culinary skills.', 'Staple ingredient for a variety of recipes Organic onions have a sharp taste that sweetens as it cooks 3 lb bag', 'Marketside', 'https://i5.walmartimages.com/asr/7494d3f2-fc20-4038-8be8-ba9a5088b94d.6b1d272e8ec503d8881db5bacb729afc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7494d3f2-fc20-4038-8be8-ba9a5088b94d.6b1d272e8ec503d8881db5bacb729afc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7494d3f2-fc20-4038-8be8-ba9a5088b94d.6b1d272e8ec503d8881db5bacb729afc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391037, 'Fresh Romaine Fillets, 7 oz', 2.98, '716519090080', 'Introducing our refreshing Fresh Romaine Fillets, a delightful addition to any meal. These crisp, 7 oz bags are packed with delicious, hand-picked romaine lettuce, specifically chosen for their tender and succulent fillets. Our romaine is sustainably grown and harvested at peak freshness, ensuring a vibrant and nutritious experience in every bite. Perfect for salads, wraps, or as a crunchy snack, our Fresh Romaine Fillets are a versatile and healthy option. Enjoy the unbeatable taste and quality of these convenient and appetizing greens today!', 'Romaine Fillets, 7 oz Introducing our refreshing Fresh Romaine Fillets, a delightful addition to any meal. These crisp, 7 oz bags are packed with delicious, hand-picked romaine lettuce, specifically chosen for their tender and succulent fillets. Our romaine is sustainably grown and harvested at peak freshness, ensuring a vibrant and nutritious experience in every bite. Perfect for salads, wraps, or as a crunchy snack, our Fresh Romaine Fillets are a versatile and healthy option. Enjoy the unbeatable taste and quality of these convenient and appetizing greens today!', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9aa35949-161b-4c31-8f76-eb76190ca730.449bb4a9c1fe483e0b882c97f41c5029.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9aa35949-161b-4c31-8f76-eb76190ca730.449bb4a9c1fe483e0b882c97f41c5029.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9aa35949-161b-4c31-8f76-eb76190ca730.449bb4a9c1fe483e0b882c97f41c5029.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391040, 'Fresh Yellow Squash', 0.95, '000000047845', 'Create something wholesome and delicious with Yellow Squash. These versatile vegetables can be used to make savory sides or sweet treats. Try them dipped in batter and fried for a comforting side or, for a healthier option, you can make a filling squash and chicken chowder, or roast them in the oven stuffed with ground turkey. If you\'re looking for something sweet, you can use squash to make a zesty lemon squash bread, a creamy squash custard pie, or even a squash chocolate loaf. Use your imagination to create something amazing and tasty with this squash. The mouthwatering possibilities are endless with this hearty vegetable. Add something amazing to your meals with fresh Yellow Squash.', 'Yellow Squash Wholesome and delicious Ideal ingredient for a variety of dishes Make fried squash, a fresh squash salad, or a hearty autumn squash soup Use to make lemon squash bread and squash custard pie Versatile and hearty', 'Fresh Produce', 'https://i5.walmartimages.com/asr/cac77957-3d9b-4bd3-bb94-53dbacf7241a.6e34f4c036af69455baa7a228c0eff91.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cac77957-3d9b-4bd3-bb94-53dbacf7241a.6e34f4c036af69455baa7a228c0eff91.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cac77957-3d9b-4bd3-bb94-53dbacf7241a.6e34f4c036af69455baa7a228c0eff91.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391042, 'Fresh Green Cabbage, Each', 2.66, '763478723924', 'Get creative in the kitchen with green cabbage. Fresh green cabbage is low in calories and high in fiber and antioxidants making it a great part of any healthy diet. Best of all, cabbage can be used for many different recipes and cuisines. Cabbage can be incorporated into everything from delicious and creamy cole slaw, wraps, egg rolls, curry, kimchi and more. Green cabbage can be roasted, boiled, braised, grilled, sauted, and even blanched. The possibilities are endless when you bring home green cabbage. Also known as Repollo verde, Malfoof and Patta Gobhi around the world.', 'Green Cabbage, Head: 1 head of green cabbage Versatile and healthy ingredient Can be roasted, boiled, braised, grilled, sauted, and even blanched Incorporate into everything from delicious and creamy cole slaw, stuffed cabbage, and wraps, to egg rolls, grilled cabbage, curry, kimchi and more Low in calories and high in fiber and antioxidants', 'Fresh Produce', 'https://i5.walmartimages.com/asr/164666b6-9c50-4505-bc1d-29f4d316f7dc.754a17269329372872578ecaef0c9d99.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/164666b6-9c50-4505-bc1d-29f4d316f7dc.754a17269329372872578ecaef0c9d99.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/164666b6-9c50-4505-bc1d-29f4d316f7dc.754a17269329372872578ecaef0c9d99.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391050, 'Fresh Yellow Grape Tomato, 10 oz Package', 2.98, '751666470064', 'These Yellow Grape Tomatoes deliver fresh, versatile flavor to take you from sauces to salads and beyond. A unique spin on the time-tested grape tomato, these colorful cousins of the grape tomato boast unique citrusy, floral notes. Refreshingly vibrant and versatile, you can enjoy them for snacking, salads, grilling, roasting or sauteing. You can combine these tasty little tomatoes with fresh mozzarella and basil drizzled with olive oil or slice them up and add them to a freshly tossed salad. If you\'re feeling something classic, you can always cut one up to add that fresh tomato taste to a sandwich or dice up a few to make a delightful pizza topping. Be sure to add Yellow Grape Tomatoes to your inventory of fresh ingredients today.', 'Yellow Grape Tomato, 10 oz Package: Wholesome, versatile, and delicious Colorful tomatoes with citrusy, floral notes Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Fresh produce in a convenient package Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fb428654-2801-4914-a853-7b57912d3df3.564b08cd4bb64c7880b1736f897970bb.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb428654-2801-4914-a853-7b57912d3df3.564b08cd4bb64c7880b1736f897970bb.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb428654-2801-4914-a853-7b57912d3df3.564b08cd4bb64c7880b1736f897970bb.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391051, 'Marketside Organic Fresh Green Onions, 1 Bunch', 1.97, '073574850012', 'Add flavor to your next meal with Marketside Organic Fresh Green Onions. For breakfast, you could dice them and add to an omelet loaded with cheese, ham, and mushrooms. Chop up the stalks into little rings and mix them into sour cream to create a delicious chip dip. You can also add them to a fresh garden salad or sprinkle them on top of your fish tacos. Add color and flavor to any dish with these Marketside Organic Fresh Green Onions. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Use in a variety of recipes Adds a hint of boldness to your dishes Dice them and add to a savory breakfast omelet Chop into little rings and add to sour cream to make a delicious chip dip Easy way to add color and flavor to a dish', 'Marketside', 'https://i5.walmartimages.com/asr/b579fc12-871b-43bb-9c37-5a818ee5a730.7e0ee1a74497207bf600bc66f9e4b7c3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b579fc12-871b-43bb-9c37-5a818ee5a730.7e0ee1a74497207bf600bc66f9e4b7c3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b579fc12-871b-43bb-9c37-5a818ee5a730.7e0ee1a74497207bf600bc66f9e4b7c3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391060, 'Fresh Large Braeburn Apple, Each', 0.88, '813200010157', 'Indulge in the pure bliss of Fresh Braeburn Apples - the epitome of fresh produce made with organic ingredients. Harvested at their prime, our apples are juicy, crisp and flavorful. Filled with vitamins, antioxidants and fiber, these apples are a healthy snacking option that can be enjoyed on-the-go or incorporated into your favorite recipes. Treat your taste buds to the delightful crunch that only our Fresh Braeburn Apples can offer!', 'Fresh Braeburn Apple, Each: Sweet, crisp & juicy Mild lemon-citrus undertones Excellent snacking apple Make a creamy smoothie or a nutritious juice blend Serve with your pancake breakfast Adds flavor to a variety of recipes Make apple butter or applesauce Make sweet desserts like apple cobbler, apple crisp & apple pie', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6afbeabb-2816-4a5c-a0aa-f4255269f28e.98948ebdba2b724102eec9a1f7260ef8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6afbeabb-2816-4a5c-a0aa-f4255269f28e.98948ebdba2b724102eec9a1f7260ef8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6afbeabb-2816-4a5c-a0aa-f4255269f28e.98948ebdba2b724102eec9a1f7260ef8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391064, 'Fresh Limes, 2 lb Bag', 4.98, '033383115498', 'Limes are a versatile citrus fruit, loved for their tangy, refreshing flavor and vibrant green color. Perfect for enhancing drinks, marinades, and desserts, they add a zesty twist to both sweet and savory dishes. Rich in vitamin C and bursting with aroma, limes are a kitchen staple that brings freshness and flavor to every meal. Available in a 2 lb bag.', 'Juicy and fresh, packed with vitamin C Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use them when baking cakes, cookies and tarts Refreshing, tart flavor Available in a 2-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a49d8849-2b49-466c-a479-91b6cc4c8266.d46302dad12444be222c84dac705d51f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a49d8849-2b49-466c-a479-91b6cc4c8266.d46302dad12444be222c84dac705d51f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a49d8849-2b49-466c-a479-91b6cc4c8266.d46302dad12444be222c84dac705d51f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391069, 'Fresh Navel Oranges, 8 lb Bag', 7.97, '033383130033', 'Enjoy the juicy goodness of Fresh Navel Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these navel oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Fresh Navel Oranges add flavor to any meal or beverage.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes Use as a garnish for your favorite cocktail Make sweet desserts like ambrosia, orange bars, and orange pie', 'Unbranded', 'https://i5.walmartimages.com/asr/9a25f6b3-e35b-43b6-b39a-c29cae0cfed1.be63ddb1f1f88e79fcaf0ee8c6123561.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9a25f6b3-e35b-43b6-b39a-c29cae0cfed1.be63ddb1f1f88e79fcaf0ee8c6123561.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9a25f6b3-e35b-43b6-b39a-c29cae0cfed1.be63ddb1f1f88e79fcaf0ee8c6123561.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391071, 'Fresh Produce, Whole Beets, 1 Bunch', 2.57, '735718700705', 'Serve up something amazing when you cook with Fresh Beets. This versatile root vegetable is known for its bright red color and is a great addition to a healthy diet and can be prepared in a variety of ways. Roast them with your favorite seasonings and serve with a juicy steak and homemade rolls or add them to a goat cheese and arugula salad. Use them in a comforting soup recipe, a delicious casserole, or even a cake. However, you choose to use them, these beets will add big flavor and unforgettable taste to any meal. The culinary possibilities are endless with Fresh Beets. Also known as Remolacha, Beetroot, Shamandar, and Chukandar around the world.', 'Fresh Beets, Bunch Healthy vegetable root, known for their ruby red hue Enjoy the deep, earthy flavor in your favorite dish or juice Great for a variety of dishes and a great addition to a healthy diet that can be prepared in many ways Also known as Remolacha, Beetroot, Shamandar, and Chukandar around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/bcb52aec-0033-4349-8053-9dbf60a5475b.f8318e88e815cff3ae4d1332c48ac5ef.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bcb52aec-0033-4349-8053-9dbf60a5475b.f8318e88e815cff3ae4d1332c48ac5ef.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bcb52aec-0033-4349-8053-9dbf60a5475b.f8318e88e815cff3ae4d1332c48ac5ef.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391079, 'Fresh Organic Granny Smith Apples, 2lb Bag', 1.68, '847473003912', 'Treat yourself to Organic Granny Smith Apples. Granny Smith apples are firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor, perfect for use in a variety of dishes morning, noon, and night. Slice them up and cook in a skillet with brown sugar, butter, cloves, and nutmeg for a simple, sweet treat. Mix them with cabbage, grapes, honey, mayonnaise and, celery to make a fresh, apple slaw for a summer cookout. Use them to make a sweet, classic apple pie that your friends and family with love. Create delicious meals and treats with Organic Granny Smith Apples.', 'Organic Granny Smith Apples, 2lb Bag: Firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor Great for breakfast, lunch, dinner, or dessert Cook in a skillet with butter, brown sugar, and spices, mix with cabbage, grapes, honey, mayonnaise and, celery for apple slaw, or make a classic apple pie Versatile ingredient perfect for both savory and sweet dishes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/757a2485-0b01-43a0-aac6-4b6e91b1d13e.839a05ccafbc235a8f6b38559ccff0c7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/757a2485-0b01-43a0-aac6-4b6e91b1d13e.839a05ccafbc235a8f6b38559ccff0c7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/757a2485-0b01-43a0-aac6-4b6e91b1d13e.839a05ccafbc235a8f6b38559ccff0c7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391083, 'Freshness Guaranteed Fruit Tray with Vanilla Dip, 48 oz - Fresh and Delicious', 13.47, '717524782540', 'The Freshness Guaranteed Fruit Tray with Vanilla Dip, 48 oz is perfect for any occasion, offering a delightful assortment of fresh fruits. This fruit tray is an excellent choice for gatherings, parties, or simply enjoying a healthy snack at home. Packed with an enticing variety of seasonal fruits, it includes crisp grapes, juicy pineapples, succulent strawberries, and more. Accompanied by a creamy vanilla dip, this fruit tray ensures both flavor and freshness. Ideal for those who appreciate quality and convenience, our fruit tray is a testament to our commitment to providing fresh, high-quality produce for the modern consumer. With the brand Freshness Guaranteed, you can trust in consistent freshness and quality. Make it a staple for your next event or everyday enjoyment.', 'Includes an assortment of fresh, seasonal fruits Accompanied by a creamy vanilla cream cheese dip 48 oz size perfect for gatherings and parties Convenient and ready-to-serve packaging Ideal for healthy snacking and entertaining Freshness Guaranteed brand ensures quality and taste', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1357e144-4200-477c-be4e-69dcd7001201.210cdc1c9aa0543bb011e44b182a4e6f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1357e144-4200-477c-be4e-69dcd7001201.210cdc1c9aa0543bb011e44b182a4e6f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1357e144-4200-477c-be4e-69dcd7001201.210cdc1c9aa0543bb011e44b182a4e6f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391085, 'Fresh Spaghetti Squash, Each', 5.7, '204776000008', 'Treat yourself to a delicious and healthy meal with fresh, Produce Unbranded Spaghetti Squash. When, cooked this unique squash falls apart into ribbons that are the perfect substitute for spaghetti. Roast the squash and serve with marinara sauce and meatballs for a healthy spin on a classic or bake some with pancetta and make a creamy, decadent carbonara. You can even make scrumptious vegan or vegetarian meals using this versatile squash. If you’re feeling creative you can make Spaghetti Squash tacos, Spaghetti Squash casserole, or even pad Thai. Try serving it for breakfast by making Spaghetti Squash nests with a sunny side up egg. The possibilities are endless when you bring home Spaghetti Squash.', 'Fresh Spaghetti Squash, Each: Produce Unbranded Perishable, fresh produce When cooked, this squash falls apart into ribbons that are the perfect substitute for spaghetti Perfect for a healthy dinner Incorporate into all sorts of recipes from traditional Italian cuisine to Asian inspired dishes Can even be enjoyed for breakfast with eggs Great for vegan and vegetarian options', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a372db03-ecec-4fe4-ada6-1937224a090d.08af8ffcd30cb5fd83d57f6db282c355.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a372db03-ecec-4fe4-ada6-1937224a090d.08af8ffcd30cb5fd83d57f6db282c355.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a372db03-ecec-4fe4-ada6-1937224a090d.08af8ffcd30cb5fd83d57f6db282c355.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391086, 'Fresh Purple Eggplant - Versatile & Delicious', 2.45, '204081000007', 'Create something wholesome and delicious with Purple Eggplant. Eggplants are incredibly versatile and can be used to make a myriad of different recipes. Try them coated in breadcrumbs and fried for a comforting side, or for a healthier option you can stuff them and roast them in the oven. They can also be used to make cheesy eggplant rollatini, decadent eggplant parmesan, and scrumptious eggplant ravioli. You can even incorporate them into hearty stews or use them to top pizzas and more. Use your imagination to create something amazing and tasty with this squash. The mouthwatering possibilities are endless with this hearty vegetable. Add something amazing to your meals with fresh Purple Eggplant.', 'Healthy and delicious Versatile vegetable for various recipes Ideal for frying, stuffing, or roasting Perfect for eggplant parmesan, rollatini or Ratatouille Great addition to stews and pizzas Main ingredient for Baba Ganoush', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4307b532-ea7b-4b41-82b0-5ece9e9ab30c.431696526ff3c9ed9dbb45c1f9f233e7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4307b532-ea7b-4b41-82b0-5ece9e9ab30c.431696526ff3c9ed9dbb45c1f9f233e7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4307b532-ea7b-4b41-82b0-5ece9e9ab30c.431696526ff3c9ed9dbb45c1f9f233e7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391089, 'Fresh Cameo Apples, Each', 1.47, '840156101721', 'Cameo apples are known for their crisp texture, juicy flesh, and a unique combination of sweet and tangy flavors. With their beautiful red and yellow striped skin, Cameo apples are not only delicious but also visually appealing.', 'Cameo apples have a satisfyingly crisp texture that makes each bite a delightful experience. The flesh is firm and holds up well in various preparations. These apples offer a perfect balance of sweetness and tanginess. The flavor profile is often described as mildly sweet with subtle hints of acidity, making them enjoyable for a wide range of taste preferences. With their vibrant red and yellow striped skin, Cameo apples are visually appealing. Their unique coloring adds a touch of beauty to fruit bowls, desserts, and other culinary creations.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fb1a90ea-ce05-41b6-b825-71e15212655d.fb910fb70848500c56a43a14fe0e3a7e.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb1a90ea-ce05-41b6-b825-71e15212655d.fb910fb70848500c56a43a14fe0e3a7e.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb1a90ea-ce05-41b6-b825-71e15212655d.fb910fb70848500c56a43a14fe0e3a7e.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391093, 'Fresh Ambrosia Apple, Each', 1.25, '203438000004', 'Treat yourself to Ambrosia Apples. Ambrosia apples are crisp and juicy with a sweet honey-like flavor perfect for use in a variety of dishes morning, noon, and night. Perfect for snacking, they have a low acidity and are slow to brown. Chop the apples up and add them to a salad with walnut, mixed greens, and a poppy seed vinaigrette for a crunchy delicious salad that you can enjoy for lunch or dinner. Slice and plate them up on the side of your breakfast for a healthy start to your day. Serve them with a dollop of peanut butter for a delicious treat or add them to your cheese board for a mouthwatering sweet and salty combination. Create delicious meals and treats with Ambrosia Apples.', 'Fresh Jazz Apple, Each: Crisp with dense flesh and a fruity-sweet tartness Great morning, noon, or night Chop them up and add to a salad, slice and plate them up on the side of your breakfast, or serve with a dollop of peanut butter Add them to a cheese board for a sweet and salty combination', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6ba3d69b-4c3e-4d74-b875-e565b7bab40f_2.4077a6a330f2ce5a08708847a6e011c0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6ba3d69b-4c3e-4d74-b875-e565b7bab40f_2.4077a6a330f2ce5a08708847a6e011c0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6ba3d69b-4c3e-4d74-b875-e565b7bab40f_2.4077a6a330f2ce5a08708847a6e011c0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
