INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391100, 'Garlic Bulb Fresh Whole, Each', 5.1, '000000046114', 'Take your culinary creations to the next level with fresh, flavorful Garlic. Garlic\'s signature flavors become caramelized and sweeter when cooked, making it a perfect accompaniment to many dishes such as pasta, shrimp, chicken, stews, and more. Garlic also goes great in creamed soups, on all types of roasts, in a variety of egg dishes, or used simply with sauteed or roasted vegetables. To prepare garlic for cooking, you\'ll need to break it up into individual cloves and peel the skin. Once you\'ve done this, you can mince the garlic by chopping it into fine pieces. Spice up your next meal with a tasty clove of fresh Garlic.', 'Single garlic bulb Must-have pantry staple Flavorful addition to a wide variety of recipes Add to pasta, shrimp, chicken, stews, and more Delivers a bold, pungent flavor when eaten raw but transforms into a lightly sweet and buttery flavor when cooked Explore all the delicious ways to add fresh garlic to your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a4f114d9-93ab-4d39-a8d6-9170536f57a9.f9f8e58c8e3e74894050c7c2267437e3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a4f114d9-93ab-4d39-a8d6-9170536f57a9.f9f8e58c8e3e74894050c7c2267437e3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a4f114d9-93ab-4d39-a8d6-9170536f57a9.f9f8e58c8e3e74894050c7c2267437e3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391101, 'Fresh Seedless Watermelon, Each', 8.1, '040000040323', 'Enjoy the sweet, refreshing taste of a Seedless Watermelon. Seedless Watermelon is great for breakfast, lunch, dessert, or when you want a snack. Watermelon is a good source of vitamin C, vitamin A, and potassium making them an excellent healthy treat. Cut the watermelon into chunks for a quick snack, infuse it with water for a refreshing drink, or chop it up and make a mouthwatering watermelon salad with feta and mint. This watermelon is great for sharing with friends and family or keep it for yourself. Bring it to your next cookout or get it as a sweet after dinner treat with friends.', 'Explore all the delicious ways to add fresh watermelon to your favorite recipes. No added sugar Enjoy a fresh seedless Watermelon on its own or add to a mixed fruit salad Serve at your next neighborhood barbecue Get creative and make a watermelon cocktail or a refreshing sorbet Sweet and Juicy Watermelon', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e2ec527d-fe7b-4309-9373-186de34557cf.1c562d1a69a2a8f4cb7b5de8f125fc76.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e2ec527d-fe7b-4309-9373-186de34557cf.1c562d1a69a2a8f4cb7b5de8f125fc76.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e2ec527d-fe7b-4309-9373-186de34557cf.1c562d1a69a2a8f4cb7b5de8f125fc76.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391102, 'Fresh Leeks Bunch, Each', 4.37, '000000046299', 'Bring the delicious taste of Fresh Leeks into your home. These leeks deliver unmistakable flavor with each bite and are an ideal ingredient in a variety of recipes. Use them to top a gourmet pizza, add to a comforting potato soup, or use in a crowd-pleasing casserole. You could also mix them into a garden salad, a creamy dip, or use them as a garnish for roasted vegetables. However you choose to use them, these fresh leeks will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with these Fresh Leeks.', 'Wholesome, versatile, and delicious Ideal ingredient for a variety of dishes Use to make a comforting potato soup or a casserole Adds unmistakable flavor to dips and salads Try using leeks instead of onions in your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/590b5c73-8c51-4266-841d-aa1473abd554.b44a72e4346bd1ba0776c889275e0858.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/590b5c73-8c51-4266-841d-aa1473abd554.b44a72e4346bd1ba0776c889275e0858.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/590b5c73-8c51-4266-841d-aa1473abd554.b44a72e4346bd1ba0776c889275e0858.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
