INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391104, 'Marketside Organic Red Delicious Apples, 2 lb Bag', 3.56, '741839007913', 'Marketside Organic Red Delicious Apples are a treat for everyone. Enjoy them on their own or serve with a side of peanut butter for dipping. You can also turn your snack time into a sweet occasion and cover with caramel. Chop them up and add them to yogurt for a parfait, mix them with other fruit for a refreshing fruit salad, or use them to bake a decadent pie. Enjoy a healthier snack everyday with these Marketside Organic Red Delicious Apples. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Red Delicious Apples, 2 lb Bag Good for snacking Use to make a wonderful apple pie Makes tasty apple sauce Whole apples are delicious fresh produce', 'Marketside', 'https://i5.walmartimages.com/asr/d85954a3-dcb5-434e-a8c4-68906fad6a04.bd7209045c915c96d89c85e80e82e8d4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d85954a3-dcb5-434e-a8c4-68906fad6a04.bd7209045c915c96d89c85e80e82e8d4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d85954a3-dcb5-434e-a8c4-68906fad6a04.bd7209045c915c96d89c85e80e82e8d4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391105, 'Fresh Sweet Onions, 3 lb, Bag', 3.67, '851533003743', 'Add flavor to your next meal with fresh Sweet Onions. This versatile vegetable adds flavor and texture to a variety of recipes. For breakfast, you could dice them and add to an omelet loaded with cheese, ham, and mushrooms. You can dice these onions and add them to a fresh garden salad for a satisfying crunch or sprinkle them on top of your fish tacos. Sweet onions also make delicious golden onion rings to serve alongside juicy hamburgers and hot dogs at your next backyard barbecue. You can keep these onions at room temperature until ready to use. Stock your pantry with this three-pound bag of fresh Sweet Onions.', 'Whole fresh sweet onions, 3 lb bag Ideal addition to every pantry Add flavor and texture to any meal Dice them and add to a savory breakfast omelet Sprinkle them onto a fresh garden salad for extra crunch Make delicious golden onion rings to serve with hamburgers and hot dogs', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e806ef18-d648-46cf-a232-3456b038974f.a883644337a1532e30af7e10f9dc3706.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e806ef18-d648-46cf-a232-3456b038974f.a883644337a1532e30af7e10f9dc3706.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e806ef18-d648-46cf-a232-3456b038974f.a883644337a1532e30af7e10f9dc3706.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391108, 'Organic Kale, bunch', 2.46, '688962145306', 'Organic KaleKale has a subtle flavor that blends well with many dishes. It is the perfect addition to soups, sautés, stir-fries, even coleslaws. Use kale in any recipe that calls for hardy greens.', 'Farm Fresh Cooking Greens', 'Fresh Produce', 'https://i5.walmartimages.com/asr/633b59e5-eba5-4da8-986a-37736b6e172f_1.7201e10d6faa872505a2e9c57f1a35d2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/633b59e5-eba5-4da8-986a-37736b6e172f_1.7201e10d6faa872505a2e9c57f1a35d2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/633b59e5-eba5-4da8-986a-37736b6e172f_1.7201e10d6faa872505a2e9c57f1a35d2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391110, 'Fresh Butter Lettuce, Each', 2.88, '027918908235', 'Switch up your lettuce game with Fresh Butter Lettuce. One of the most nutritious of the lettuces, Butter Lettuce is high in folate, iron, and potassium as well as a group of potent antioxidants called carotenoids, including beta carotene, lutein, and zeaxanthin. Butter lettuce has a soft, delicate texture and a mild, sweet flavor that lends itself to all kinds of uses. Also known as Boston or bibb lettuce, use butter lettuce to amp up a salad, add some leafy crunch to a sandwich, or in place of a tortilla or burger bun as a lettuce wrap. Whether you’re a fan of traditional salads or looking for a new way to add some green to your meals, Fresh Butter Lettuce is a delicious and nutritious choice.', 'Fresh Butter Lettuce High in folate, iron, and potassium Soft, delicate texture and a mild, sweet flavor Use in salads, add to a sandwich, or use in place of a tortilla or burger bun', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2217aae8-70cd-4e84-8406-0594dcc21ccb.47082a3150c3225a71c2577157100314.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2217aae8-70cd-4e84-8406-0594dcc21ccb.47082a3150c3225a71c2577157100314.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2217aae8-70cd-4e84-8406-0594dcc21ccb.47082a3150c3225a71c2577157100314.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391112, 'Marketside Premium Romaine Salad Blend, 9 oz Bag (Fresh)', 3.03, '681131387538', 'Sit down to a healthy meal with Marketside Premium Romaine Salad. With zero cholesterol, zero fat, and only 15 calories per serving, this 9-ounce bag of pre-washed salad is an excellent lunch or dinner option. All this salad needs is your favorite dressing, and you\'ve got yourself a tasty, no-hassle meal. Add a protein like chicken, steak, or garbanzo beans for a hearty and satisfying dish. Whether you serve it as a side or the main course, Marketside Premium Romaine Salad is sure to please. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Premium Romaine Salad Blend, 9 oz Bag (Fresh) Includes romaine lettuce, carrots, and red cabbage Washed and ready to be served out of the bag Convenient and nutritious 9oz package', 'Marketside', 'https://i5.walmartimages.com/asr/a3602ca5-370c-4605-a63d-9bc865a053a2.ce687c5389b10f67f194691795a68c1c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a3602ca5-370c-4605-a63d-9bc865a053a2.ce687c5389b10f67f194691795a68c1c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a3602ca5-370c-4605-a63d-9bc865a053a2.ce687c5389b10f67f194691795a68c1c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391113, 'Fresh Honeydew Melon, Each', 4.99, '799939040347', 'Treat yourself to the juicy goodness of a Fresh Honeydew Melon. Enjoy this tasty melon on its own as a healthy snack or incorporate it into a variety of delicious recipes. For breakfast, you can make a sweet fruit bowl with sliced honeydew melon, strawberries, pineapple, banana, and kiwi. For an extra special treat, top with a dollop of whipped cream. Cut it into small pieces and put it in a fresh salad along with chicken, cucumbers, tomatoes, and a light dressing. You can even use this melon to make a refreshing summer cocktail, a spreadable jam, or a light sorbet. Enjoy the sweet and juicy taste of Fresh Honeydew Melon.', 'Juicy and sweet honeydew melon Enjoy on its own or add to a mixed fruit bowl, No Container Add to your fresh garden salad Get creative and make a melon cocktail or a refreshing sorbet Explore all the delicious ways to add fresh honeydew melon to your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a7b3bd36-e71d-41aa-9ace-cf70a2bade2b.e880a17b460f81c9ea3b7ec5f49d2d05.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a7b3bd36-e71d-41aa-9ace-cf70a2bade2b.e880a17b460f81c9ea3b7ec5f49d2d05.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a7b3bd36-e71d-41aa-9ace-cf70a2bade2b.e880a17b460f81c9ea3b7ec5f49d2d05.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391114, 'Fresh Romaine Lettuce, Each', 1.28, '854186005027', 'Treat yourself to the healthy, delicious taste of Fresh Romaine Lettuce. This romaine is perfect for a variety of healthy and delicious meals and is packed with vitamins, minerals and antioxidants. You can use it to whip up a classic Caesar salad with all the fixings or let your creativity run wild. You can also use it to make lettuce wraps filled with all your favorite fillings or top your favorite sandwich or burger. The possibilities are endless with Fresh Romaine Lettuce.', 'Sturdy dark green leaves with firm ribs down their centers Extremely low-calorie content and high-water volume Packed full of vitamins, minerals, and antioxidants Perfect for salads, smoothies, lettuce wraps, sandwiches, and more Organic and fresh from the farm Ideal for health-conscious diets and meal prep', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f1702b46-b866-4b41-9d65-bafdd5714b89.42b7c93565cf399acd8154734d64d85a.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f1702b46-b866-4b41-9d65-bafdd5714b89.42b7c93565cf399acd8154734d64d85a.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f1702b46-b866-4b41-9d65-bafdd5714b89.42b7c93565cf399acd8154734d64d85a.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391123, 'Fresh Yellow Baby Potatoes, 1.5 lb Bag', 3.44, '045255118803', 'Baby Yellow Potatoes are hand selected for excellent quality. Firm, well-shaped, and smooth, these fresh potatoes can be cooked in almost any way imaginable. They have a light, subtle flavor and creamy texture that make them the perfect side dish to chicken, fish, steak, and other delicious proteins. Simply grill, roast, or toss into salads along with your favorite seasonings. To preserve the nutrients, leave the skins on and simply scrub gently in water before cooking. Always store potatoes in a cool, well-ventilated area rather than in the refrigerator. Enjoy nutrients, flavor, and all-around deliciousness when you cook up Baby Potatoes.', 'Pre-Washed to save you time in the kitchen No need to peel-Thin skinned but NOT thin on taste! Fast, Easy Prep For additional information and recipes, visit tastefulselections.com', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ed528ea7-87ab-4de2-9fb2-a0c9cc543933.8bf991656a8723b7600c208324b644b0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed528ea7-87ab-4de2-9fb2-a0c9cc543933.8bf991656a8723b7600c208324b644b0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed528ea7-87ab-4de2-9fb2-a0c9cc543933.8bf991656a8723b7600c208324b644b0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391135, 'Fresh Poblano Pepper, Each', 0.68, '000000047050', 'Enhance your meals with the delicious flavor of Poblano Peppers. Naturally low in calories, fat, and cholesterol, this vegetable is an excellent source of vitamin A and vitamin B6, as well as iron and magnesium. Poblano pepper, also known as an ancho Chile, has a crisp flavor that enhances a variety of recipes. Stuff poblano peppers with cheese and meat for delicious rellenos, add them to enchiladas, put some diced poblano in your famous chili recipe, or make a zesty salsa using fresh poblano peppers. You can even add some diced poblano peppers and cheese to cornbread batter for a delectable Chile cheese cornbread that will have everyone asking for seconds. Lunches and dinners are more scrumptious when fresh Poblano Peppers are part of the meal.', 'Naturally low in calories Exceptionally rich in vitamins A and B6 Stuff poblano peppers for rellenos, add to enchiladas or chili, or make a zesty salsa Versatile and delicious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d5805f54-ccba-440a-a73c-1f47a56fca12_1.17cbe45fef678754efdc98e365207640.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d5805f54-ccba-440a-a73c-1f47a56fca12_1.17cbe45fef678754efdc98e365207640.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d5805f54-ccba-440a-a73c-1f47a56fca12_1.17cbe45fef678754efdc98e365207640.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391136, 'Fresh Marketside Organic Carrots, 16 oz', 1.16, '071464016913', 'Add some fresh and tender carrots to your meal with Marketside Organic Whole Carrots. These whole carrots are certified organic, and are an excellent source of vitamin A. They are perfect for adding as an ingredient in stews, casseroles and soups. Add your favorite sauce or seasoning for a quick and healthy side dish. You can serve them with grilled chicken breast and green beans, roast them or use them in your own recipes. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see.', 'They are perfect for adding as an ingredient in stews, casseroles and soups. With their crunchy texture and fresh taste, it is a must-have vegetable in your kitchen. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside', 'https://i5.walmartimages.com/asr/e2dca10f-1419-421b-ac99-ba6ba888f8c6_2.1ae51990e30e30b7b768f1157514f85f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e2dca10f-1419-421b-ac99-ba6ba888f8c6_2.1ae51990e30e30b7b768f1157514f85f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e2dca10f-1419-421b-ac99-ba6ba888f8c6_2.1ae51990e30e30b7b768f1157514f85f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391140, 'Fresh Jonagold Apple Large, Each', 1.47, '741839041474', 'This Fresh apple tends to be large in size and is tangy sweet with honey-like flavor notes.Jonagold is high quality American apple, developed in the 1940s. As its name suggests, this is a cross between a Jonathan and a Golden Delicious. Although it\'s known to be a great fresh-eating apple, because of its sweet/tart flavor, this apple variety is great for baking. Whip up some delicious apple crisp or pies with this variety and treat yourself to some homemade apple sauce.', 'Fresh Jonagold Apple, Each: Crisp with dense flesh and a fruity-sweet tartness Great morning, noon, or night Chop them up and add to a salad, slice and plate them up on the side of your breakfast, or serve with a dollop of peanut butter Add them to a cheese board for a sweet and salty combination', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/de530635-1316-44a7-9923-ed57e8eb30ac.fe2ef957bce8c012d6e00a0ff1145c1f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de530635-1316-44a7-9923-ed57e8eb30ac.fe2ef957bce8c012d6e00a0ff1145c1f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de530635-1316-44a7-9923-ed57e8eb30ac.fe2ef957bce8c012d6e00a0ff1145c1f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391143, 'Serrano Pepper, Each', 0.62, '000000047098', 'Enhance your meals with the delicious flavor of Serrano Peppers. Naturally low in calories, fat, and cholesterol, this vegetable is a great source of vitamins C, B6, and A, as well as iron and magnesium. Serrano peppers have a bright and biting flavor that enhances a variety of recipes. Make a zesty Pico de gallon or salsa using fresh serrano peppers, add to a sweet peach jam to make a glaze for hot wings, or add to eggs for out of this world huevos rancheros. You can even add some diced serrano peppers and cheese to cornbread batter for a delectable Chile cheese cornbread that will have everyone asking for seconds. Lunches and dinners are more scrumptious when fresh Serrano Peppers are part of the meal.', 'Approximately 40 Serrano Peppers per lb Naturally low in calories, and fat Low in cholesterol is a great source of vitamins C, B6', 'Fresh Produce', 'https://i5.walmartimages.com/asr/cf45f59d-f968-4fa4-ad3a-880a310705d1.3649588ea7699bd5520d1e7bc4f6a44b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cf45f59d-f968-4fa4-ad3a-880a310705d1.3649588ea7699bd5520d1e7bc4f6a44b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cf45f59d-f968-4fa4-ad3a-880a310705d1.3649588ea7699bd5520d1e7bc4f6a44b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391144, 'Fresh Produce, Whole Red Radish, 1 Bunch', 1.74, '073150103426', 'Serve up something amazing when you cook with Fresh Red Radish. This versatile root vegetable is a great addition to a healthy diet and can be prepared in a variety of ways. Their slightly peppery flavor adds a natural, subtle spice to salads and slaws. Their crisp texture makes them a natural, healthy choice for dips. Try them as a low-carb substitute for potatoes when roasted or as a healthy side dish when grilled. However, you choose to use them, these fresh radishes will add big flavor and unforgettable taste to any meal. The culinary possibilities are endless with Fresh Red Radish.', 'Fresh Produce, Whole Red Radish, 1 Bunch Wholesome, versatile, and delicious Enjoy raw, pickled, roasted, in tacos, in soups, and so much more Cool and crunchy Lends a peppery taste to salads Also known as rábanos, yī kǔn luóbo and mūlī kā gucchā around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ea0e9022-05d6-4e6a-ad18-633471a03a0b.0c926e45ad97705e24c87ed57f663122.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea0e9022-05d6-4e6a-ad18-633471a03a0b.0c926e45ad97705e24c87ed57f663122.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea0e9022-05d6-4e6a-ad18-633471a03a0b.0c926e45ad97705e24c87ed57f663122.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391147, 'Fresh Plum, Each', 0.76, '812985015012', 'Enrich your day with some juicy plums. Fruit is a healthy snack and an important part of a healthy diet for most people. It provides fiber and essential vitamins and minerals. Black plums are no exception. They contain vitamin A and other vitamins and minerals. Each plum fruit bite is sweet and delicious. Slice one and enjoy it alone, or add it to salads and other recipes. Plums are a versatile fruit with a unique flavor and a meaty yet juicy texture. There are approximately 3-4 plums per lb. Plums, each:', 'Approximately 3-4 plums per lb Sweet and juicy Delicious as a snack Excellent ingredient for salads Black plums contain vitamin A and other essential vitamins and minerals Approximately 3-4 plums per Bag lb Sweet and juicy Delicious as a snack Excellent ingredient for salads Black plums contain vitamin A and other essential vitamins and minerals', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e8de249f-8c2e-4cfc-a225-4ff6486978ed.1d00c2aec5c70bf24944314ac910fb6f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e8de249f-8c2e-4cfc-a225-4ff6486978ed.1d00c2aec5c70bf24944314ac910fb6f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e8de249f-8c2e-4cfc-a225-4ff6486978ed.1d00c2aec5c70bf24944314ac910fb6f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391152, 'Fresh Red Pear, Each', 0.99, '851191002041', 'The Fresh Red pear carries a true pyriform \"pear shape;\" a rounded bell on the bottom half of the fruit, then a definitive shoulder with a smaller neck or stem end. Color goes from a dark red often with light vertical striping to become a beautiful bright red. As they ripen, Red Pears offer different flavors and textures, starting crunchy and tart when underripe, and finishing super sweet and juicy when fully ripened.', 'Fresh Red Pear, Each Sweet, crisp, and juicy Excellent snacking pear Make a creamy smoothie or a nutritious juice blend Add to your salad for extra crunch and flavor Adds flavor to a variety of recipes Make pear butter or poached pears Make sweet desserts like pear cobbler, pear crisp or pear tarts', 'Fresh Produce', 'https://i5.walmartimages.com/asr/bd8f2d47-7640-4d6b-81ea-b85905a185d9.0743c431f7e9e19ffca02c585558334a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bd8f2d47-7640-4d6b-81ea-b85905a185d9.0743c431f7e9e19ffca02c585558334a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bd8f2d47-7640-4d6b-81ea-b85905a185d9.0743c431f7e9e19ffca02c585558334a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391159, 'Butternut Squash, each', 5.64, '000000047593', 'Add some fresh flavor to your meal with Butternut Squash. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. Roast the whole squash for a simple and flavorful side dish, chop it into cubes and put it in the slow cooker with chicken breast, kidney beans, and spices, or make butternut noodles for a gluten-free pasta alternative. For a sweet treat turn the squash into a rich and spicy pie, perfect for the holiday season. With so many uses, this vegetable will become a pantry staple. Create tasty and flavorful meals with Butternut Squash.', 'Butternut Squash, 1 Each: Versatile ingredient Roast the whole squash for the perfect side dish or chop into cubes, put into a slow cooker, and mix with chicken breast, beans, and spices for a flavorful dish Use it to create a sweet and decadent pie Make butternut squash noodles for a gluten free pasta alternative Will become a pantry staple', 'Greenpoint', 'https://i5.walmartimages.com/asr/76a18a23-dc4f-45a8-90ae-452e50fd5923.c254801fb641a0df6bbd5e83640d8d9c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/76a18a23-dc4f-45a8-90ae-452e50fd5923.c254801fb641a0df6bbd5e83640d8d9c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/76a18a23-dc4f-45a8-90ae-452e50fd5923.c254801fb641a0df6bbd5e83640d8d9c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391186, 'Gourmet Garden Gluten Free Garlic Stir-in Paste, 4.0 oz Tube', 3.94, '875208000646', 'Gourmet Garden Gluten Free Garlic Stir-in Paste, 4 oz Tube. Give everyday meals the bold flavor they deserve with Gourmet Garden Garlic Stir-in Paste. No prep needed- it\'s so easy to add a squeeze of our convenient garlic paste to any savory recipe. In each squeezable tube is garlic that\'s been peeled and finely chopped to deliver its signature punch. Our garlic paste is at its best flavor, color and aroma when it reaches your family\'s table. Use it at the beginning of cooking to create a sweet, garlicky base. Add it at the end- traditionally garlic bread, marinades and sauces- for a deeper, more pungent flavor. Use 1 teaspoon of paste in place of 1 medium garlic clove. Store refrigerated for weeks after opening. This Gourmet Garden Garlic Stir-in Paste is in a Plastic tube that is 4 ounces. Store this Refrigerated item at an ambient temperature.', 'Gourmet Garden Gluten Free Garlic Stir-in Paste, 4 oz Tube Chopped garlic packed into a convenient squeezable tube No prep necessary Stays fresh in refrigerator for weeks after opening. Gluten Free Adds bold flavor to garlic bread, marinades and sauces Use 1 tsp. of paste in place of 1 medium garlic clove This product is in a Plastic Tube', 'Gourmet Garden', 'https://i5.walmartimages.com/asr/63564f7b-54ac-462e-8788-20f63e460170.431352b482af53e84cd9398959a6ac8d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/63564f7b-54ac-462e-8788-20f63e460170.431352b482af53e84cd9398959a6ac8d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/63564f7b-54ac-462e-8788-20f63e460170.431352b482af53e84cd9398959a6ac8d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391191, 'Fresh Papaya, Each, 1 Count', 3.97, '850940002103', 'Get flavor and nutrition with our Fresh Papaya. Papaya is a tropical fruit that originated in the tropics of the Americas and is known to be a great source of vitamins C, A, fiber, and antioxidants. When ripe, this fruit has a butter-like texture with a fairly sweet flavor similar to cantaloupe and can be eaten raw, without skin or seeds. Papaya can be prepared in a variety of ways; you can mix them with grapefruit and avocado for a bright summer salad, add them to a zesty salsa for some sweetness, freeze them and turn them into refreshing popsicle spears, or bake them in the oven with a melted brown sugar mixture. The sky\'s the limit! Get ready for a taste-bud party with Fresh Papaya.', 'Creamy, butter-like flavor when ripe Rich in vitamins A, C, fiber, and antioxidants Fairly sweet flavor like cantaloupe and mango Great addition to smoothies, salads, salsa, and more Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7bca4cb8-f2fa-481b-8d18-969c8ddb4f1a.dc09b3bdd116b64b15f7abd16ad085b4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7bca4cb8-f2fa-481b-8d18-969c8ddb4f1a.dc09b3bdd116b64b15f7abd16ad085b4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7bca4cb8-f2fa-481b-8d18-969c8ddb4f1a.dc09b3bdd116b64b15f7abd16ad085b4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
