INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391236, 'Fresh Roma Tomato, 2 lb Bag', 1.82, '606105032917', 'Create something wholesome and delicious with Roma Tomatoes. These ripe tomatoes are the ideal fresh produce ingredient for a variety of tasty dishes. Use them to make a zesty Roma tomato sauce for a pasta dish, try using them to make a Roma tomato bruschetta, or simply enjoy them on their own as a nutritious snack. They would make a comforting and appetizing tomato soup and a flavorful salsa. You could also serve them at your next party alongside your favorite vegetable dipping sauce or add them to your famous guacamole recipe. How ever you choose to use them, these tomatoes will add flavor and taste to any meal. Elevate your recipes with this two-pound bag of Roma Tomatoes.', 'Fresh Roma Tomato, 2-pound Bag Wholesome, versatile, and delicious Rich, juicy flavor in each bite Ideal ingredient for a variety of dishes Use to make pasta sauce, tomato soup, or fresh salsa Make a tasty pesto or bruschetta to serve at your next dinner party Delicious and nutritious fresh produce', 'Fresh Produce', 'https://i5.walmartimages.com/asr/0a6850cf-3900-4801-b917-7b54dd621720.9caff3d450f89d792208a67e47ecc822.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0a6850cf-3900-4801-b917-7b54dd621720.9caff3d450f89d792208a67e47ecc822.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0a6850cf-3900-4801-b917-7b54dd621720.9caff3d450f89d792208a67e47ecc822.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
