INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391255, 'Fresh and Vibrant Whole Napa Cabbage, Each', 4.37, '000000045520', 'Cook up a healthy and flavorful meal the whole family will enjoy with Napa Cabbage. It features a vibrant green color and a fresh, crisp texture that makes it a tasty addition to a variety of dishes. Enjoy it raw in a creamy coleslaw recipe, or pair it with several other colorful vegetables and meats to make everything from soups to stir-fry and more. It even makes a flavorful choice for vegetarian meals. This Chinese cabbage vegetable may be sliced, chopped or left whole as a garnish. This Napa Cabbage can be found fresh in your produce section for all of your cooking needs.', 'Fresh and crisp Vibrant, green, leafy vegetable Napa vegetable may be eaten raw or cooked A tasty addition to a variety of recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ea08de03-6e2c-4c26-9f75-e0a2a26851bd.c7696a6a5ed348ee387669c4e7891820.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea08de03-6e2c-4c26-9f75-e0a2a26851bd.c7696a6a5ed348ee387669c4e7891820.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea08de03-6e2c-4c26-9f75-e0a2a26851bd.c7696a6a5ed348ee387669c4e7891820.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391289, 'Fresh Produce, Whole Bok Choy, 1 Each', 3.47, '000000045452', 'Discover the versatility of Fresh Bok Choy, a crisp and flavorful vegetable also known as spoon cabbage. Perfect for a wide range of dishes, bok choy can be: Steamed or sautéed and paired with your favorite protein Used in stir-fries, soups, and garden salads Added to gourmet sandwiches for a crunchy twist Low in calories and packed with essential vitamins and minerals, bok choy is a nutritious choice for any meal. Whether you\'re cooking for the family or experimenting with new recipes, this leafy green brings bold flavor and unforgettable taste to your kitchen. Endless culinary possibilities await with Fresh Bok Choy! Fresh Bok Choy can be found at your local Walmart and is sold whole, fresh out of a container.', 'Fresh Whole Bok Choy or Spoon Cabbage Bok Choy is a versatile vegetable that can be prepared in a variety of ways Great in your favorite recipe, soups, salads or even sandwiches Bok Choy is a fresh and healthy vegetable full of essential vitamins and minerals Also known as Col China, xiǎo báicài, shànghǎi qīng, chingensai and cheonggyeongchae around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/39c383e0-15c8-48f0-a376-ef8f0dd5b241.229ed6ebd251ad73bd70d0f3a758326a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39c383e0-15c8-48f0-a376-ef8f0dd5b241.229ed6ebd251ad73bd70d0f3a758326a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39c383e0-15c8-48f0-a376-ef8f0dd5b241.229ed6ebd251ad73bd70d0f3a758326a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391299, 'Marketside Fresh Cut Watermelon Chunks, 10 oz Tray', 2.77, '077745245720', 'Experience a burst of summertime goodness with this delicious Marketside Watermelon. This pre-cut ripe watermelon is juicy, sweet, and refreshing to the taste. In addition, watermelons are a great natural source of vitamins A and C. Carry them with you and eat them straight out of the tray any time you want, at home, or on-the-go. Pair them with a tasty salad or sandwich for a nutritious and delicious lunch. You can also use them as a naturally sweet ingredient in a fruit salad. Add some fresh fruit to your daily menu with this Marketside Watermelon.Marketside provides you and your family with high quality fresh food that save you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Marketside item.', 'Marketside Watermelon Chunks 10 oz Pre-Cut Convenience: Fresh, sweet, juicy watermelon chunks are ready to eat, saving you time on preparation. Portable Packaging: Comes in a 10 oz re-closable container, making it easy for grab-and-go convenience. Nutrient-Rich: A good source of vitamins A and C, contributing to your daily nutritional needs. No Artificial Additives: Free from preservatives, artificial colors, and artificial flavors, ensuring a natural taste. Versatile Use: Perfect as a standalone snack, addition to fruit salads, or as a refreshing side dish. Perishable Item: Keep refrigerated to maintain freshness and quality.', 'Marketside', 'https://i5.walmartimages.com/asr/d40b8924-955e-494c-ae47-9505fddbfc49.ac8d150d52b9839951550f7435f099d7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d40b8924-955e-494c-ae47-9505fddbfc49.ac8d150d52b9839951550f7435f099d7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.