INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391302, 'Nature\'s Greens Organic Rainbow Chard, 8 oz', 7.67, '028764900077', 'Create fresh and delicious meals with Nature\'s Greens Organic Rainbow Chard. This USDA certified organic chard features a mix of red, green or rainbow varieties and is bursting with fresh flavor. Mix up this chard with almonds, pecans, shredded cheese and your favorite dressing for a healthy and tasty salad or wilt some in a skillet with your favorite seasonings ¬– the possibilities are endless! Not only is this rainbow chard a versatile ingredient, but it\'s also packed with vitamins A, C, and K making it perfect for a healthy lifestyle. Bring hoe Nature\'s Green Organic Rainbow Chard today.', 'Nature\'s Greens Organic Rainbow Chard, 8 oz: Rainbow Swiss chard comes with red and green varieties Has a delicious taste Mix with your own ingredients for making a salad Goes nicely with almonds, pecans, shredded cheese and more Add your favorite dressing on the top Makes a perfect side for a variety of dishes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ce51660f-2b20-4fd2-891f-64e2c64678d3.cec05b2ce1afc19eaec7f0101e2c20f1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ce51660f-2b20-4fd2-891f-64e2c64678d3.cec05b2ce1afc19eaec7f0101e2c20f1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ce51660f-2b20-4fd2-891f-64e2c64678d3.cec05b2ce1afc19eaec7f0101e2c20f1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391306, 'Fresh Chayote Squash, Each', 1.17, '000000047616', 'Create tasty meals and side dishes with Chayote Squash. It\'s ideal to use for creating authentic Cajun cuisine and can be grilled, stir-fried, boiled, steamed or baked. This chayote squash can also be sliced or shredded and used in salads and slaws, or you can boil it and mash like a potato. It has a mild and slightly sweet taste with light notes of cucumber. Naturally low in calories and fat, chayote squash is an excellent source of vitamin C, vitamin B6, folate, fiber, and potassium. Expand your culinary repertoire when you use Chayote Squash to create delicious dishes.', 'Ideal for making authentic Cajun dishes Can be grilled, stir-fried, boiled, steamed or baked Slice or shred raw chayote to use in salads and slaws Mild and slightly sweet taste Provides an excellent source of vitamin C, vitamin B6, folate, dietary fiber and potassium Use in soups, stews, curries and casseroles Boil and mash like a potato Also known as Mirliton, Christophene, Choko, Güisquil & Chuchu across the world.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/daeb7eb2-0625-4419-9fb8-e031974d225f.9f7a99116d625d5dd8bae596507ab35b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/daeb7eb2-0625-4419-9fb8-e031974d225f.9f7a99116d625d5dd8bae596507ab35b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/daeb7eb2-0625-4419-9fb8-e031974d225f.9f7a99116d625d5dd8bae596507ab35b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391315, 'Fresh Pomegranate, Each', 1.98, '854335004925', 'Add a some zing to your meals with with Fresh Pomegranate. It has a sweet and tangy flavor that\'s made it a Mediterranean favorite for centuries. Pomegranate fruit is soft and tender and you can squeeze it for juice. This product is filled with edible seeds. At only 72 calories per serving this product is an easy indulgence to add to your diet plan.', 'Fresh Pomegranate, sold by the each Pleasing sweet-tart taste Great addition to salads or enjoy on its own Contains 3g of fiber and a good source of vitamin C per 1/2 cup Unopened pomegranates can last up to two months in the refrigerator or up to one month at room temperature', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c8bb0100-dfb6-47b6-ad72-1b3c4d27c853.ffd069e6a7379f244c201de3c1a2a3d5.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c8bb0100-dfb6-47b6-ad72-1b3c4d27c853.ffd069e6a7379f244c201de3c1a2a3d5.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c8bb0100-dfb6-47b6-ad72-1b3c4d27c853.ffd069e6a7379f244c201de3c1a2a3d5.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391317, 'Fresh Collard Greens Bunch, Each', 1.97, '000000046220', 'Fresh Collard Greens are the perfect addition to your dishes. They are packed full of minerals and nutrients making them an excellent healthy option to add to your meals. These collard greens are a versatile ingredient that can be transformed in many ways. Sautee them with a garlic and onions for a delicious side dish or add it to a stew for a nutrient dense addition. Use them as a substitute for spinach in your favorite recipes. They come in a bunch, so you can choose exactly how you want to cut and prepare them. Elevate mealtime with Fresh Collard Greens Bunch.', 'Fresh Collard Greens Bunch, Each Packed full of vitamins and minerals Versatile ingredient that can be used in a variety of dishes Sautee with garlic and onions or add it to a stew Great way to incorporate greens into your diet Nutrient dense vegetable Use it as a substitute for spinach in your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9fd904ba-cd80-4c29-93d0-94116a778937.48e8b2ad7de0848ca2a89b30edb9ff51.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9fd904ba-cd80-4c29-93d0-94116a778937.48e8b2ad7de0848ca2a89b30edb9ff51.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9fd904ba-cd80-4c29-93d0-94116a778937.48e8b2ad7de0848ca2a89b30edb9ff51.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391352, 'Pinata Apple Large, Each', 1.66, '203435000007', 'The Pinata Apple Large is the perfect choice for those who crave a unique and flavorful apple experience. Each fresh apple is grown to perfection, resulting in a large, juicy, and crisp fruit that will delight your taste buds. With its vibrant red and yellow skin, the Pinata Apple is as visually appealing as it is delicious. Whether you enjoy it on its own, sliced up in a salad, or baked into a mouthwatering dessert, the Pinata Apple Large will be a delightful addition to any meal or snack. Order yours today and indulge in the sweet and tangy flavors of this extraordinary apple variety.', 'Pinata Apple Large, 1 lb', 'Unbranded', 'https://i5.walmartimages.com/asr/e7ec1bc6-f6d3-4017-95fe-b535bfb3ec4c.0b7c12e78e0765ee92a2471a7ad89c0e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e7ec1bc6-f6d3-4017-95fe-b535bfb3ec4c.0b7c12e78e0765ee92a2471a7ad89c0e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e7ec1bc6-f6d3-4017-95fe-b535bfb3ec4c.0b7c12e78e0765ee92a2471a7ad89c0e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391430, 'Fresh Sweet Corn on the Cob (1 each)', 0.68, '204077000004', 'While sweet corn typically invokes images of summer barbeques, it has many health benifits. Sweet corn is a great source of Vitamin A and C, with one ear of corn containing over 10% of the Daily Value (DV) of Vitamin C and over 6% DV of Vitamin A. It\'s not truly summer until you\'ve had some Fresh Corn on the Cob- just add butter and salt! Also known as Maíz, Dura and Makka around the world.', 'Fresh Corn on the Cob: Freshly picked Sweet and juicy Perfect for grilling or boiling Great addition to summer dinners, BBQs, picnics, and camping trips Just add butter, salt, and pepper Naturally low in calories Great source of potassium and antioxidants Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a79ee74c-836e-4c81-81d7-3ffd8deca0c4.c333e398e5c4da78062aa64b6db07eba.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a79ee74c-836e-4c81-81d7-3ffd8deca0c4.c333e398e5c4da78062aa64b6db07eba.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a79ee74c-836e-4c81-81d7-3ffd8deca0c4.c333e398e5c4da78062aa64b6db07eba.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391479, 'Fresh Keylimes, 1 Each', 0.1, '000000043052', 'Add zest and flavor to your meals and beverages with these Key Limes. Freshly squeezed limes provide a healthy dose of vitamin C to your diet and are a key ingredient in many recipes, from homemade salsa to chicken dishes. The citrusy tropical flavor of these limes are sure to add a zing to all your cooked meals. Drizzle lime juice over fish or add it to your favorite sauces. Serve wedges of raw lime with your favorite cocktails and use them when baking cakes, cookies, and tarts. These limes are sold in a one-pound bag, so you\'ll have plenty for all your culinary creations. Enjoy the refreshing, tart flavor of Key Limes.', 'Fresh and juicy key limes Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use them when baking cakes, cookies, and tarts Refreshing, slightly sweet, tart flavor Available by the each', 'Fresh Produce', 'https://i5.walmartimages.com/asr/726ce64a-28fd-49b1-96d0-e3607b64adb7.7b147c809b5d0354853d8da08bd42afe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/726ce64a-28fd-49b1-96d0-e3607b64adb7.7b147c809b5d0354853d8da08bd42afe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/726ce64a-28fd-49b1-96d0-e3607b64adb7.7b147c809b5d0354853d8da08bd42afe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391515, 'Fresh Whole Carrots, 1 lb Bag', 1.32, '852442002001', 'This 1 lb. Bag of Whole Carrots can make a versatile addition to various meals. They have a crisp crunch and a bold taste. These California carrots are easy to cut into pieces for adding to a stew, pot roast or meat pie. Slice them thin and add them to a salad with some lettuce, tomatoes, olives and other ingredients. These fresh carrots are also ideal for dipping in dressing.', 'Approximately 6 carrots per lb. California carrots have a crunchy texture and a bold taste Fun to eat in many different ways Cut into slices for stews or a meat pie Cut thin to add to a salad along with other vegetables Ideal for use with dips and dressings 16 oz (1 lb./454g) Also known as Zanahoria entera, Whole carrot, Jazar and Gajar around the world', 'ATV Farms', 'https://i5.walmartimages.com/asr/a6c9eb5f-51b2-465e-aaf4-502d4a905604.1bdb1d7098cc222b894d86f999f81579.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6c9eb5f-51b2-465e-aaf4-502d4a905604.1bdb1d7098cc222b894d86f999f81579.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6c9eb5f-51b2-465e-aaf4-502d4a905604.1bdb1d7098cc222b894d86f999f81579.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
