INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391520, 'The Little Potato Company Garlic Parsley Potatoes, 1 lb Tray', 4.38, '629307015342', 'Taste the difference with The Little Potato Company Garlic Parsley Potatoes. They pair well as a side with a variety of dishes. Fresh creamer potatoes with a seasoning pack, it only takes five minutes in the microwave to have them hot and ready to eat! At just 60 calories per serving, these potatoes are a good source of potassium and are gluten free with no artificial colors or flavors. Three cups of vegetables per tray ensures that you have plenty for your family dinner. Add a delicious touch to dinner with The Little Potato Company Garlic Parsley Potatoes.', 'Fresh creamer potatoes with seasoning pack Microwave ready Cooks in 5 minutes Garlic parsley seasoned 3 cups of vegetables per tray Gluten free Good source of potassium 60 calories per serving', 'The Little Potato Company', 'https://i5.walmartimages.com/asr/d536213f-39fe-40b4-9d80-eadbb4fb0ffe.97cdb6a5ebdfe99304c3756fa2b06c6c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d536213f-39fe-40b4-9d80-eadbb4fb0ffe.97cdb6a5ebdfe99304c3756fa2b06c6c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d536213f-39fe-40b4-9d80-eadbb4fb0ffe.97cdb6a5ebdfe99304c3756fa2b06c6c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391543, 'The Little Potato Company Microwave-Ready Savory Herb Potatoes, 1 lb Tray', 4.38, '629307015045', 'In 1996, when my father and I introduced these flavorful The Little Potato Company Microwave-Ready Savory Herb Potatoes, we grew a one-acre plot that we harvested, washed and bagged by hand. Since then, we focus solely on selecting and growing fresh Creamer potatoes that are outstanding in taste, nutrition and texture. It\'s all we do: Our proprietary varietals are harvested when they are mature and at their best. My family and I still enjoy the original, diverse taste of these exceptional Creamer potatoes, and I am excited to share them with you. - Angela, Co-Founder and Chief Potato Champion.', 'The Little Potato Company Microwave-Ready Savory Herb Potatoes, 1 lb (16 ounces) A tantalizing blend of savory herbs and spices Good source of potassium Microwave ready Gluten free Contains no artificial flavors, colors or preservatives Vegan 80 calories per serving 8% DV of vitamin C Naturally fat-free Cholesterol free Fresh produce', 'The Little Potato Company', 'https://i5.walmartimages.com/asr/63499740-ad84-4bb3-9850-1b7624ea84ea.a7fe5c4d4624c9a6adc42d728c3fa148.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/63499740-ad84-4bb3-9850-1b7624ea84ea.a7fe5c4d4624c9a6adc42d728c3fa148.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/63499740-ad84-4bb3-9850-1b7624ea84ea.a7fe5c4d4624c9a6adc42d728c3fa148.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
