INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391565, 'Fresh Acorn Squash, Each', 7.32, '204750000000', 'Add some fresh flavor to your meal with Acorn Squash. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. Roast the whole squash for a simple and flavorful side dish, chop it into cubes and put it in the slow cooker with chicken breast, kidney beans, and spices, or make butternut noodles for a gluten-free pasta alternative. For a sweet treat turn the squash into a rich and spicy pie, perfect for the holiday season. With so many uses, this vegetable will become a pantry staple. Create tasty and flavorful meals with Acorn Squash.', 'Versatile ingredient Roast the whole squash for the perfect side dish or chop into cubes, put into a slow cooker, and mix with chicken breast, beans, and spices for a flavorful dish Use it to create a sweet and decadent pie Make acorn squash noodles for a gluten free pasta alternative Will become a pantry staple', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7f9f4de4-8301-498f-923c-0aadcbd145ac.19a506d251535265665235f80586b147.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7f9f4de4-8301-498f-923c-0aadcbd145ac.19a506d251535265665235f80586b147.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7f9f4de4-8301-498f-923c-0aadcbd145ac.19a506d251535265665235f80586b147.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391581, 'Fresh Red Bell Pepper, 1 Each', 1.48, '405551853776', 'Enhance your meals with the delicious flavor of Red Bell Peppers. This vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Red bell pepper, also known as red capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them, saute them with onions or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out red bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudite. Cooked or uncooked, Red Bell Peppers are an excellent item to have on hand.', 'Naturally low in calories, Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh red peppers Also known as Pimiento rojo, Red Chili, Filfil ahmar and Lal mirch around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7be94a8e-9a5d-4f87-842f-5fe4084138ba.c95d36e140f5e0d492ca632b42e4543c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7be94a8e-9a5d-4f87-842f-5fe4084138ba.c95d36e140f5e0d492ca632b42e4543c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7be94a8e-9a5d-4f87-842f-5fe4084138ba.c95d36e140f5e0d492ca632b42e4543c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391602, 'Fresh Yellow Bell Pepper, Each', 1.48, '890773002116', 'Enhance your meals with the delicious flavor of Yellow Bell Peppers. This vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Yellow bell pepper, also known as yellow capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them and add to a deli sandwich, saute them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out yellow bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. Lunches and dinners are more scrumptious when fresh yellow peppers are part of the meal. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudite. Cooked or uncooked, Yellow Bell Peppers are an excellent item to have on hand.', 'Yellow Bell Pepper, 1 each: Naturally low in calories Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh red peppers', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4afb6fc7-4b33-4dc9-b938-035666ab2fe6.dca886c2d62ffc4a948e28a2d0039ea2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4afb6fc7-4b33-4dc9-b938-035666ab2fe6.dca886c2d62ffc4a948e28a2d0039ea2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4afb6fc7-4b33-4dc9-b938-035666ab2fe6.dca886c2d62ffc4a948e28a2d0039ea2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391605, 'Fresh Strawberries, 1 lb', 3.12, '071430007525', 'The sweet, juicy flavor of Fresh Strawberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. They contain essential vitamins and nutrients like, vitamin C, dietary fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Fresh Strawberries today and savor the delectable flavor.', 'Prior to serving gently wash the fruit and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b54a64ad-e961-46cf-b60c-bc763716fb0b.a481cdfd237c5ab5438d5c9e90bead07.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b54a64ad-e961-46cf-b60c-bc763716fb0b.a481cdfd237c5ab5438d5c9e90bead07.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b54a64ad-e961-46cf-b60c-bc763716fb0b.a481cdfd237c5ab5438d5c9e90bead07.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391639, 'Fresh Fuji Apples, 3 lb Bag', 3.54, '033383017242', 'There is an inherent spicy-savory flavor to these Freshness Guaranteed Fuji Apples that makes them an all-around favorite for both fresh and cooked uses. It is perhaps natural that this apple, with its Japanese heritage, would pair well with Asian flavors such as cilantro, chili pepper, rice vinegar and sesame. This is a wine-friendly apple, making it a good choice for recipes served as an appetizer or main course accompanied by wine. It pairs particularly well with Riesling, Chianti, Merlot and Pinot Noir wines. Pick up a bag of Freshness Guaranteed Fuji Apples today. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Fuji Apples, 3 lb Bag Super sweet Fresh and sophisticated flavor Hints of spice and savory earth character Juicy and aromatic Healthy snack Convenient bag packaging Meets or exceeds U.S. Extra Fancy Super sweet Fresh and sophisticated flavor Hints of spice and savory earth character Juicy and aromatic Healthy snack Convenient bag packaging Meets or exceeds U.S. Extra Fancy Super sweet Fresh and sophisticated flavor Hints of spice and savory earth character Juicy and aromatic Healthy snack Convenient bag packaging Meets or exceeds U.S. Extra Fancy Make a creamy smoothie or a nutritious juice blend Perfect as a healthy treat or seasonal baking ingredient Great for packing in lunches Make a creamy smoothie or a nutritious juice blend Adds flavor to a variety of recipes', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/e70c5b78-90d7-4248-b791-79cd6999b309.0975f20dc3d3e039b772d0fdd73af3d0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e70c5b78-90d7-4248-b791-79cd6999b309.0975f20dc3d3e039b772d0fdd73af3d0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e70c5b78-90d7-4248-b791-79cd6999b309.0975f20dc3d3e039b772d0fdd73af3d0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391659, 'Fresh Lemons, 2 lb Bag', 3.92, '033383140032', 'Add zest and flavor to your meals and beverages with these fresh Lemons. A great source of vitamin C, lemons are a staple citrus fruit essential for any kitchen. Slice them and use them in your iced or hot tea or use the lemon juice to make satisfying and refreshing strawberry lemonade. Zest the lemon peel to use in recipes such as lemon cookies or a tasty lemon loaf. You can also use lemons in savory recipes like asparagus with lemon zest or shrimp scampi with linguini. Enhance the flavor of your next meal with fresh Lemons.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Add to your iced or hot tea Make a satisfying and refreshing strawberry lemonade Use lemon zest to make lemon cookies or lemon loaf Adds flavor to a variety or recipes Available in a 2-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ea02745f-85ec-4437-b558-99017aa55ba0_1.54e4ccd90fb051e0422baf290b61d661.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea02745f-85ec-4437-b558-99017aa55ba0_1.54e4ccd90fb051e0422baf290b61d661.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea02745f-85ec-4437-b558-99017aa55ba0_1.54e4ccd90fb051e0422baf290b61d661.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44391666, 'Fresh Raspberries, 6 oz. Container', 3.37, '715756100019', 'The sweet, juicy flavor of Fresh Raspberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes or yogurt, bake them into mouthwatering raspberry crumble bars, mix them with other fruit for a light and flavorful salad, or add them to a creamy smoothie. They contain essential vitamins and nutrients like vitamin C, fiber, potassium, vitamin K and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them with cool water and enjoy the fresh taste. Refrigerate the berries to keep them fresh and ready for use. Pick up a Fresh Raspberry container today and savor the delectable flavor.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Raspberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Raspberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of raspberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these tasty gems into your baking endeavors, whether it\'s muffins, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are raspberries delicious, but they also offer an array of health benefits. Loaded with vitamins and dietary fiber, raspberries are are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Raspberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Raspberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7f2a89a0-04cc-4272-ad39-f3c96525b57b.a243dab95fc3537540fbf5cbb7a8365b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7f2a89a0-04cc-4272-ad39-f3c96525b57b.a243dab95fc3537540fbf5cbb7a8365b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7f2a89a0-04cc-4272-ad39-f3c96525b57b.a243dab95fc3537540fbf5cbb7a8365b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44419692, 'Marketside Organic Fresh Cucumber, Each', 2.98, '033383911045', 'The Marketside Organic Fresh Cucumber is crisp, refreshing, and naturally hydrating, making it a perfect addition to any meal. Grown by trusted organic farmers, this cucumber is USDA certified organic, ensuring it is free from synthetic pesticides and fertilizers. Its cool and clean flavor pairs wonderfully with salads, sandwiches, wraps, or as a simple snack with your favorite dip. Slice it up for a crisp crunch, or add it to a pitcher of water for a fresh, spa-like taste. With its vibrant green color and garden-fresh taste, the Marketside Organic Fresh Cucumber is a versatile choice that delivers both nutrition and flavor. Enjoy the wholesome goodness of the Marketside Organic Fresh Cucumber every time you reach for a healthy option. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to delivering freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Fresh Cucumber USDA certified organic and grown without synthetic pesticides Crisp, refreshing flavor perfect for salads, wraps, and snacks Hydrating and low-calorie option for a healthy lifestyle Versatile use from cooking to infused water', 'Marketside', 'https://i5.walmartimages.com/asr/9b051d0b-d6ed-43fb-8a53-2d26eeeebb31_1.c1ecc4eff47d63fb3ce42a9c4adb9780.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b051d0b-d6ed-43fb-8a53-2d26eeeebb31_1.c1ecc4eff47d63fb3ce42a9c4adb9780.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b051d0b-d6ed-43fb-8a53-2d26eeeeb