INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44419695, 'Cooking with Spinach, Classic, Fresh Spinach, Net Wt 16 oz (1LB) 454g', 2.98, '012842410015', 'Spinach, Classic 16 oz (454 g) Triple washed & ready to cook! No time for cooking? Great as a salad too! The perfect size and texture for cooking. Specially grown for cooking. Rich in antioxidants - beta carotene, vitamins A & C. Excellent source of folate and vitamin K with 10.4 mg of lutein per 85 g serving! For more nutritional info and more recipes, go to www.newstarfresh.com. Produce of USA. Classic 3-Minute Spinach! 1 bag Cooking with Spinach Classic; 1 tbsp olive oil (or our favorite cooking oil); salt and pepper. Heat oil in large skillet over high heat. When hot, add spinach and cover with lid. Stir spinach after 1 minute and replace lid. Cook 2 minutes more until wilted but still bright green. Season with salt and pepper to taste. Serves 2-3 as a side dish. Spice up your spinach by adding 1/2 tsp hot chili flakes and 1 tsp lemon juice after first minute of cooking! Keep refrigerated. 16 oz (454 g) 900 Work Street Salinas, CA 93901 888-STAR-220 2012 NewStar', 'Spinach, Classic Triple washed & ready to cook! No time for cooking? Great as a salad too! The perfect size and texture for cooking. Specially grown for cooking. Rich in antioxidants - beta carotene, vitamins A & C. Excellent source of folate and vitamin K with 10.4 mg of lutein per 85 g serving! Produce of USA.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/71047ede-75dd-4bad-a2ca-cbd360dc7dea.900f32bab8bfac704613f1a78808c297.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71047ede-75dd-4bad-a2ca-cbd360dc7dea.900f32bab8bfac704613f1a78808c297.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71047ede-75dd-4bad-a2ca-cbd360dc7dea.900f32bab8bfac704613f1a78808c297.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44659372, 'Fresh Summer Kiss Melon, Each', 2.98, '850940002431', 'Enjoy the fruits of summer with a Summer Kiss Melon. Summer Kiss melons are sweet but not overbearing, mellow, and creamy. They have a creamy, green textured flesh that will add interest and color to any fruit bowl. Mix some cubes of Summer Kiss melon with watermelon, honeydew, and cantaloupe for a melon bowl that will satisfy anyone\'s fruit cravings, mix into a morning smoothie, sprinkle with lime juice and salt, or pair with fresh herbs such as mint, cilantro, oregano, tarragon, or basil for a refreshing treat. Sugar Kiss melon is a wonderful accompaniment to salty meats, soft cheeses, dried fruits, and nuts. Bring home the flavor of summer with a Sugar Kiss Melon.', 'Fresh Sugar Kiss melon Sweet but not overbearing flavor Creamy, green textured flesh Adds interest and color to any fruit bowl Mix with watermelon, honeydew, and cantaloupe for a delicious melon bowl', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2c0c9fce-2930-48cd-8974-c897e6b63c4b.cf73021f24ffff716bdca17e76a2bbc8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2c0c9fce-2930-48cd-8974-c897e6b63c4b.cf73021f24ffff716bdca17e76a2bbc8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2c0c9fce-2930-48cd-8974-c897e6b63c4b.cf73021f24ffff716bdca17e76a2bbc8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (44901266, 'Mann Packing Manns Snap Pea Sensations, 1 ea', 2.38, '716519011085', 'Snap Pea Sensations, Mediterranean Style, Bag 10.14 OZ Nt wt. Snap Peas & Topping: 10.14 oz (287.5 g). Dressing: 1.0 fl oz (29.6 ml). Complete Kit: Serve hot or cold. Sugar snap peas, basil garlic olive oil & parmesan cheese. Three generations. Est. 1939. Serve as a cold salad or hot saute. Healthy cooking made easy! Simply toss these delicious ingredients together for a quick & easy side dish or meal. Serve hot or cold! For more information contact us: Mann\'s Customer Service PO Box 690, Salinas, CA 93902 or call 800-285-1002. Veggiesmadeeasy.com. At Mann\'s we are moms creating solutions for moms. Certified WBENC. Women\'s business enterprise. Facebook. Twitter. Pinterest. Instagram. YouTube. Dating back to the 1930s, farming has been a family business for three generations. We are dedicated to providing the highest quality, fresh produce. We grow on family-owned farms using sustainable practices & follow strict quality standards. Keep refrigerated. Washed & ready to eat. Perishable. Enjoy as a Cold Salad: 1. Pour the pre-washed sugar snap peas into a bowl. 2. Add the parmesan cheese and basil garlic olive oil. 3. Toss to coat evenly; serve immediately for best results. Enjoy as a Hot Saute: 1. Pour the pre-washed sugar snap peas into a bowl. 2. Drizzle the basil garlic olive oil over the sugar snap peas. Toss to coat evenly. 3. Preheat a non-stick skillet until hot. 4. Pour the coated sugar snap peas into the skillet and saute quickly - 1 to 2 minutes. 5. Remove from heat. Add parmesan cheese. Toss gently. 6. For best results serve immediately. Suggestions for Hot & Cold Dishes: Add to pasta or pair with your favorite grilled fish, chicken or beef. Contains milk. 1 kit PO Box 690 Salinas, CA 93902', 'Snap Pea Sensations, Mediterranean Style Nt wt. Snap Peas & Topping: 10.14 oz (287.5 g). Dressing: 1.0 fl oz (29.6 ml). Complete Kit: Serve hot or cold. Sugar snap peas, basil garlic olive oil & parmesan cheese. Three generations. Est. 1939. Serve as a cold salad or hot saute. Healthy cooking made easy! Simply toss these delicious ingredients together for a quick & easy side dish or meal. Serve hot or cold! For more information contact us: Mann\'s Customer Service PO Box 690, Salinas, CA 93902 or call 800-285-1002. Veggiesmadeeasy.com. At Mann\'s we are moms creating solutions for moms. Certified WBENC. Women\'s business enterprise. Facebook. Twitter. Pinterest. Instagram. YouTube. Dating back to the 1930s, farming has been a family business for three generations. We are dedicated to providing the highest quality, fresh produce. We grow on family-owned farms using sustainable practices & follow strict quality standards.', 'Mann\'s', 'https://i5.walmartimages.com/asr/c8178d5b-c2b9-413b-9449-d02128049ceb_1.6a10ea294aa600cb61e86d109c2e9563.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c8178d5b-c2b9-413b-9449-d02128049ceb_1.6a10ea294aa600cb61e86d109c2e9563.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c8178d5b-c2b9-413b-9449-d02128049ceb_1.6a10ea294aa600cb61e86d109c2e9563.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
