INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (45127027, 'Fresh Red Baby Potatoes, 1.5 lb Bag', 3.44, '045255118643', 'Baby Red Potatoes are hand selected for excellent quality. Firm, well-shaped, and smooth, these fresh creamer potatoes can be cooked in almost any way imaginable. They have a light, subtle flavor and creamy texture that make them the perfect side dish to chicken, fish, steak, and other delicious proteins. Simply grill, roast, or toss into salads along with your favorite seasonings. To preserve the nutrients, leave the skins on and simply scrub gently in water before cooking. Always store potatoes in a cool, well-ventilated area rather than in the refrigerator. Enjoy nutrients, flavor, and all-around deliciousness when you cook up Baby Potatoes.', 'Firm, well-shaped, and smooth Can be cooked in almost any way imaginable, including grilled, roasted, or in salads Light, subtle flavor and creamy texture Perfect side dish to chicken, fish, steak, and other delicious proteins Great addition to holiday meals and celebrations Good source of potassium', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b893e478-176e-40ea-ae5e-0b0def2711c7.e38013c56d6d975720185ad48d3f5af2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b893e478-176e-40ea-ae5e-0b0def2711c7.e38013c56d6d975720185ad48d3f5af2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b893e478-176e-40ea-ae5e-0b0def2711c7.e38013c56d6d975720185ad48d3f5af2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (45618183, 'Fresh USDA Organic Strawberries, 1 lb Container', 6.99, '033383200385', 'The sweet, juicy flavor of Fresh USDA Organic Strawberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. These organic berries contain essential vitamins and nutrients like, vitamin C, fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Fresh USDA Organic Strawberries today and savor the delectable flavor.', 'Certified organic Prior to serving gently wash the strawberries and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail Prior to serving gently wash the strawberries and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fb148fa5-193e-479c-8e89-dca9d61e2ff7_1.0d26c201e069d9940a4d0cb0c85d776d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb148fa5-193e-479c-8e89-dca9d61e2ff7_1.0d26c201e069d9940a4d0cb0c85d776d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fb148fa5-193e-479c-8e89-dca9d61e2ff7_1.0d26c201e069d9940a4d0cb0c85d776d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (45619132, 'Fresh Premium Grape Tomato, 10 oz Package', 3.48, '751666370050', 'Bring the fresh, delicious taste of Premium Grape Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this package of Premium Grape Tomatoes.', 'Premium Grape Tomato, 10 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8c3423a6-d5f1-4e00-926a-41f316288808.89ce7b3f27c9a70b987d7c19edc72f1a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8c3423a6-d5f1-4e00-926a-41f316288808.89ce7b3f27c9a70b987d7c19edc72f1a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8c3423a6-d5f1-4e00-926a-41f316288808.89ce7b3f27c9a70b987d7c19edc72f1a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
