INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46341599, 'Fresh Quick Cook Brussel Sprouts, 16 oz', 2.98, '000651319018', 'Green Giant™ Fresh Halved Brussels Sprouts.Recipe ready.Steams in pack.Per serving:35 Calories.0g Sat fat, 0% DV.20mg Sodium, 1% DV.2g Sugars.Net Wt 16 oz (454 g). Refrigerate for best quality.Microwave directions:1. Tear bag at notch.2. Open pouch and run under cold water to rinse Brussels Sprouts. Drain water from pouch. Reseal pouch leaving about 1 inch open.3. Place bag standing up in microwave; microwave on high for 2-3 minutes or until desired tenderness*. Let stand 1 minute in microwave.Because microwaves cook differently, times are approximate.Caution: Hot! Pouch may be hot to the touch. Let stand 1 minute in microwave before removing.Serving suggestions:Drizzle Halved Brussels Sprouts with olive oil, sea salt, and pepper. Roast at 400°F for 20 minutes. Great dipped into a garlic aioli.Halved Brussel Sprouts are a great addition to your cooked pasta dishes. Just roast and toss with cooked pasta, olive oil and parmesan cheese.Perfect for sauteing with Pancetta and freshly, chopped garlic.', 'Brussels Sprouts, Sprout Halves, Quick Cook Halved for faster and even cooking! 5 min. Season, seal & steam in the bag. Ready to serve fresh veggies. Visit OceanMist.com for recipes and ideas to personalize your Season & Steam meals! Visit OceanMist.com for brussels sprouts facts, videos and recipes. Gluten free. GMO free. Vegan. Washed and ready to use. Excellent source of vitamin C. Rich in antioxidants and good source of fiber. No artificial ingredients or preservatives.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/be686bcd-6ab5-46cb-b0b4-0034d467e1fd.f78a4e6a858aa8ff551f12118381b22c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/be686bcd-6ab5-46cb-b0b4-0034d467e1fd.f78a4e6a858aa8ff551f12118381b22c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/be686bcd-6ab5-46cb-b0b4-0034d467e1fd.f78a4e6a858aa8ff551f12118381b22c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
