INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46491668, 'Fresh White Potatoes, Each', 0.3, '000000040839', 'These White Potatoes are a must-have for any pantry. With so many ways to prepare potatoes, you\'ll want to add them to every meal. For breakfast, you could make crispy hash browns smothered in cheese and diced ham or add them to a savory omelet. For lunch or dinner, you could use these fresh potatoes to make au gratin potatoes, garlic mashed potatoes, or a baked potato loaded with cheese, sour cream, green onions, and bacon bits. If you\'re hosting a neighborhood get-together, you can use them to make creamy potato salad or homestyle French fries. Serve up something delicious when you cook with White Potatoes.', 'White Potatoes, 1 lb. Approximately 2 potatoes per lb. These White Potatoes are a must-have for any pantry. With so many ways to prepare potatoes, you\'ll want to add them to every meal. For breakfast, you could make crispy hash browns smothered in cheese and diced ham or add them to a savory omelet. For lunch or dinner, you could use these fresh potatoes to make au gratin potatoes, garlic mashed potatoes, or a baked potato loaded with cheese, sour cream, green onions, and bacon bits. If you\'re hosting a neighborhood get-together, you can use them to make creamy potato salad or homestyle French fries. Serve up something delicious when you cook with White Potatoes.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4ad2392e-7783-4d52-a5da-642ed12519da.0c7a0e38aa1d4f9ef6314fd72ff657f8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4ad2392e-7783-4d52-a5da-642ed12519da.0c7a0e38aa1d4f9ef6314fd72ff657f8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4ad2392e-7783-4d52-a5da-642ed12519da.0c7a0e38aa1d4f9ef6314fd72ff657f8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff'