INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46491672, 'Fresh Shredded Carrots, 10 oz Bag', 1.87, '078783514106', 'Add color and nutrition to your diet with Fresh Shredded Carrots. Carrots are a great source of beta carotene, fiber, vitamin K1, potassium, and antioxidants. Washed and ready to eat with no preservatives, keep a bag of these shredded carrots on hand to add to any meal at a moment’s notice. Add this nutritional powerhouse to all kinds of recipes to add a delicious dose of vitamins and minerals. Slightly cook shredded carrots and add to a grilled cheese sandwich, add to macaroni and cheese as you’re boiling the noodles, sprinkle into an omelet, add to your award-winning lasagna recipe, use as an ingredient for a delicious salad, or mix into muffins batter. You’ll be serving up an extra-nutritious meal that nobody will object to! Give your dishes an extra boost of color and nutrition with Fresh Shredded Carrots.', 'Fresh Shredded Carrots 10-ounce bag No preservatives Washed and ready to eat Fresh and crunchy Excellent source of beta carotene, fiber, vitamin K1, potassium, and antioxidants', 'Grimmway Farms', 'https://i5.walmartimages.com/asr/35817df3-4652-4035-9e07-0d073658c7d3.f739e89b28b14d00be573312547a31db.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/35817df3-4652-4035-9e07-0d073658c7d3.f739e89b28b14d00be573312547a31db.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/35817df3-4652-4035-9e07-0d073658c7d3.f739e89b28b14d00be573312547a31db.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46491694, 'Fresh Red Cherries, 2.25 lb Bag', 8.93, '000000040457', 'Enjoy our deliciously sweet red cherries grown in US. Full of nutrition, these fresh red cherries are not only delicious, but also packed with vitamins and minerals like vitamin C, potassium, and vitamin B complex. Enjoy these cherries on their own, as part of desserts and entrees, or add them to drinks. Cherries can stay fresh when frozen for up to three months, so you\'ll be able to enjoy them throughout the fall and winter seasons. Make sure you use a freezer bag that removes as much air as possible. Then, when you\'re ready to eat them, thaw cherries in the refrigerator and enjoy. Get powerful nutrition and flavor with these Fresh Red Cherries.', 'Fresh Red Cherries Bag Bursting with antioxidants, phytochemicals, vitamins, nutrients, and fiber Rich source of vitamin C, potassium, and vitamin B complex Versatile and delicious Wonderful addition to entrees, desserts, and beverages To enjoy fresh cherries: store in the refrigerator and wash just before eating Grown in US', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ae909d05-c36d-42f7-bcfe-bcf43201fc73.477cac022ebe2e0acad63c17124ca733.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ae909d05-c36d-42f7-bcfe-bcf43201fc73.477cac022ebe2e0acad63c17124ca733.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ae909d05-c36d-42f7-bcfe-bcf43201fc73.477cac022ebe2e0acad63c17124ca733.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46491703, 'Freshly Harvested BBQ Green Onions, 1 Bunch', 1.8, '814905011296', 'Add flavor to your next meal with Fresh BBQ Green Onions. Also known as Mexican BBQ onions, they\'re similar in taste to the typical green onion variety. This versatile vegetable adds flavor and texture to a variety of recipes. For breakfast, you could dice them and add to an omelet loaded with cheese, ham, and mushrooms. Chop up the stalks into little rings and mix them into sour cream to create a delicious chip dip. You can also add them to a fresh garden salad or sprinkle them on top of your fish tacos. Stock your pantry with these Fresh BBQ Green Onions.', 'Great addition to every pantry Adds flavor and texture to any meal Dice them and add to a savory breakfast omelet Chop into little rings and add to sour cream to make a delicious chip dip Similar in taste to the typical green onion variety Fresh condition for optimal flavor and texture Also known as Cebollitas Asadas, Basal Akhdar Mashwi, Hara Pyaaz & Kǎo Xiāng Cōng around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/88304921-0043-4e1b-a4a6-b53a2459aa3b_1.cf00c8cf6d80aeb06274fa8f1a44bbd0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/88304921-0043-4e1b-a4a6-b53a2459aa3b_1.cf00c8cf6d80aeb06274fa8f1a44bbd0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/88304921-0043-4e1b-a4a6-b53a2459aa3b_1.cf00c8cf6d80aeb06274fa8f1a44bbd0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46491714, 'Fresh Yellow Mangoes, Each', 0.76, '000000043120', 'Get ready for big flavor with our Yellow Mangoes. This sweet, juicy tropical fruit, also known as an \"Ataulfo\" mango, originated in Mexico and has a soft, buttery texture and naturally sweet taste that the whole world has grown to love. They\'re delicious and nutritious, containing loads of vitamin C, which may act as an antioxidant and contribute to healthy immunity. They also have vitamin A, calcium, iron and fiber, so you can feel good about eating them. Slice up a mango and enjoy as a healthy, sweet snack, use it to make fresh mango salsa, or add it to sweet treats like creamy mango-lime bars or mango sorbet! The sky is the limit with this versatile fruit. Life is better when you have Yellow Mangoes.', 'Soft, buttery texture and naturally sweet taste Rich in vitamins A, C, calcium, iron, and fiber Makes a healthy snack Great addition to smoothies, salads, salsa, and more Can also be used to cook and bake with Delicious and nutritious Also known as Ataulfo Mango, Honey Mango, and Champagne Mango around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/701b5e2d-45a5-46fc-bac5-5b77e634792d.b4da8c2e4ad44ef5825b5f0c57cac35b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/701b5e2d-45a5-46fc-bac5-5b77e634792d.b4da8c2e4ad44ef5825b5f0c57cac35b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/701b5e2d-45a5-46fc-bac5-5b77e634792d.b4da8c2e4ad44ef5825b5f0c57cac35b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46491725, 'Honeycrisp Apples, 2lb Bag', 6.12, 'deleted_033383047904', 'Treat yourself to the delicious, crisp taste of Honeycrisp Apples. These medium-to-large apples are known for their light green and yellow background covered with a red-orange flush and a strong hint of pink, and a honey-sweet, tart flavor. Enjoy one with breakfast or lunch or as a fresh snack any time of day. Best of all, these delicious apples hold up well when cooked and can be used in both savory and sweet dishes. They can be used for baking, snacking, salads, pairing, or made into a delicious sauce that pairs perfectly with pork. Try incorporating them into soups and compotes or using to make yummy jam or juice. Use them to create apple crisp, pie and strudel for a sweet treat. You can even pair them with sharp cheeses and crackers to create a stunning appetizer cheese board to share with guests. The possibilities are endless with Honeycrisp Apples.', 'Honeycrisp Apples, 2lb Bag: Light green and yellow background covered with a red-orange flush and a strong hint of pink Honey-sweet, tart flavor Good for baking and applesauce Can be enjoyed fresh or cooked into both savory and sweet dishes', 'Generic', 'https://i5.walmartimages.com/asr/710231ac-34ab-41a3-9b6c-04d7261ada17_1.a866a242aeccff90ad46e37b7fdf3940.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/710231ac-34ab-41a3-9b6c-04d7261ada17_1.a866a242aeccff90ad46e37b7fdf3940.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/710231ac-34ab-41a3-9b6c-04d7261ada17_1.a866a242aeccff90ad46e37b7fdf3940.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46491765, 'Fresh Jicama, Each, 1 Count', 2.44, '000000046268', 'The wonderful jicama is thick, slightly sweet, hearty and offers a very satisfying crunch. It is a staple of many different cuisines, including Mexican, and makes a wonderful addition to a variety of tasty dishes. Chop it or shred it to sprinkle on a salad or put it in a soup. The jicama vegetable is loaded with fiber, which is useful for maintaining digestive regularity and promotes a feeling of fullness after eating. It\'s also a very rich source of the antioxidant vitamin C, a potent immune booster.', 'Sweet and crunchy 1 serving is 23.25 oz 250 calories per jicama-food serving No fat No cholesterol Low sodium High in potassium 128% daily recommended fiber 221% daily recommended vitamin C High in iron Source of vitamin B6 and magnesium Also known as Mexican Turnip and Yam Bean around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/01cd7508-0f53-47e6-9d78-4792cc1c085e.13951d9e889a9fe8ddcf20ca5dc2e0c9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/01cd7508-0f53-47e6-9d78-4792cc1c085e.13951d9e889a9fe8ddcf20ca5dc2e0c9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/01cd7508-0f53-47e6-9d78-4792cc1c085e.13951d9e889a9fe8ddcf20ca5dc2e0c9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (46521533, 'Fresh Organic Zucchini Squash, 2 Count', 2.96, '711069660011', 'Organic zucchini is always fresh, and has a light, delicate flavor with a creamy texture. It can be enjoyed raw with your favorite veggie dip or cooked. Like other summer squash, it has tender edible skin that does not require long cooking making it a very versatile ingredient for soups, chilis, sauté\'s and skewers. Dice and sauté with other fresh veggies, roast in the oven topped with parmesan cheese or grate it into delicious zucchini frittatas. Zucchini also makes a great low-carb pasta alternative. Simply spiralize the fresh zucchini and prepare it with your choice of toppings. Best yet, zucchini is packed with many essential vitamins such as vitamin B6 and rich in antioxidants, making it a great addition to a healthy diet. The possibilities are endless and always flavorful with fresh organic zucchini.', 'Organic Zucchini Squash Certified Organic 2 Count Zucchini Great for grilling Great pasta alternative Responsibly grown', 'Marketside', 'https://i5.walmartimages.com/asr/b21707a9-3f97-4ebd-ad43-373bac8a190b.da052b2bc8586765fefad0261123eee9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b21707a9-3f97-4ebd-ad43-373bac8a190b.da052b2bc8586765fefad0261123eee9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b21707a9-3f97-4ebd-ad43-373bac8a190b.da052b2bc8586765fefad0261123eee9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
