INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (47308014, 'King Pak Whole Fresh Golden Potatoes 160 oz. Bag', 10.98, '605806002236', 'King Pak Golden Potatoes are a versatile and delicious ingredient that can be used in a variety of dishes. This 160 oz. (10 lbs) bag contains a generous amount of golden potatoes, making it perfect for large families, meal planning, or for those who simply enjoy incorporating potatoes into their meals. Golden potatoes, also known as yellow potatoes, are known for their smooth, slightly waxy texture and buttery flavor. They are a great all-purpose potato, suitable for various cooking methods such as boiling, baking, roasting, and frying.', 'Fresh King Pak Golden Potatoes are a versatile and delicious ingredient that can be used in a variety of dishes. This 160 oz. (10 lbs) bag contains a generous amount of golden potatoes, making it perfect for large families, meal planning, or for those who simply enjoy incorporating potatoes into their meals. Golden potatoes, also known as yellow potatoes, are known for their smooth, slightly waxy texture and buttery flavor. They are a great all-purpose potato, suitable for various cooking methods such as boiling, baking, roasting, and frying.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6728348a-f754-44ae-93cd-0743b4cadd26.b43807451fec54cc07921c982ca25d15.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6728348a-f754-44ae-93cd-0743b4cadd26.b43807451fec54cc07921c982ca25d15.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6728348a-f754-44ae-93cd-0743b4cadd26.b43807451fec54cc07921c982ca25d15.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (47314766, 'Fresh White Nectarine, Each', 0.76, '850892002541', 'Discover the delightful sweetness of these Fresh White Nectarines. Enjoy them on their own as a sweet snack or use them in a variety of recipes. For breakfast, you could slice them to put into your oatmeal or use them to make a delicious yogurt parfait. You can also use these fresh nectarines in several baking recipes including a comforting crisp topped with ice cream, a tasty upside-down cake, or a scrumptious tart. You can even use them to make a jam or a smooth sorbet. However you choose to use them, their sweet flavor will bring a smile to everyone\'s face. Treat the family to the irresistible taste of Fresh White Nectarines.', 'Fresh White Nectarine, Each Enjoy on their own as a satisfying snack Bag Use in a variety of baking recipes Make a tasty jam or a smooth sorbet Slice as a sweet topping for waffles or pancakes Add to iced tea to create a refreshing summertime flavor', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5885f7a0-9ea1-47f8-94cc-8434f0cc5344.25ca231d45cd1f96b34be3024d8fa151.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5885f7a0-9ea1-47f8-94cc-8434f0cc5344.25ca231d45cd1f96b34be3024d8fa151.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5885f7a0-9ea1-47f8-94cc-8434f0cc5344.25ca231d45cd1f96b34be3024d8fa151.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (47314798, 'Fresh Blackberries, 6 oz. Container', 2.37, '033383211053', 'The sweet, juicy flavor of Fresh Blackberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes or yogurt, bake them into mouthwatering blackberry cobbler, mix them with other fruit for a light and flavorful salad, or add them to a creamy smoothie. They contain essential vitamins and nutrients like vitamin C, fiber, potassium, vitamin K and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them with cool water and enjoy the fresh taste. Refrigerate the berries to keep them fresh and ready for use. Pick up a Fresh Blackberry container today and savor the delectable flavor.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blackberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blackberries are plump, juicy, and bursting with natural sweetness. The versatility of blackberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these tasty gems into your baking endeavors, whether it\'s cobblers, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blackberries delicious, but they also offer an array of health benefits. Loaded with vitamins and dietary fiber, blackberries are are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blackberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blackberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Multiple', 'https://i5.walmartimages.com/asr/793944b7-a276-4e20-af31-f1c8b32ad824.d9f7092e633054695c13dd73233d3769.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/793944b7-a276-4e20-af31-f1c8b32ad824.d9f7092e633054695c13dd73233d3769.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/793944b7-a276-4e20-af31-f1c8b32ad824.d9f7092e633054695c13dd73233d3769.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
