INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (49238696, 'The Little Potato Company Three Cheese Potatoes, 1 Lb.', 3.97, '629307016042', 'Potatoes, Three Cheese, Tray 1 LB New. Microwave ready. Fresh creamer potatoes with seasoning pack. 5 min. Good source of potassium. Gluten free. 8% DV of fiber for serving. A savory blend of rich parmesan, romano and cheddar cheese. In 1996, when my father and I introduced these flavorful little potatoes, we grew a one-acre plot that we harvested, washed and bagged by hand. Since then, we focus solely on selecting and growing creamer potatoes that are outstanding in taste, nutrition and texture. It\'s all we do. Our proprietary varietals are harvested when they are mature and at their best. My family and I still enjoy the original, diverse taste of these exceptional Creamer potatoes, and I am excited to share them with you. - Angela, co-founder and chief potato champion. 90 calories per serving. 4% DV of vitamin C. Naturally fat-free. Cholesterol free. Contains no artificial flavors or colors. LittlePotatoes.com. Facebook. Twitter. Pinterest. Instagram. These potatoes are washed and ready to cook. Do not puncture or remove the plastic film before cooking. 1. Remove cardboard sleeve and seasoning pack. 2. Place tray in microwave. Cook on high for 5 minutes (cooking times may vary). 3. Let rest 2 minutes then carefully remove plastic film and stir in seasoning pack. If desired, add 2 tbsp of butter or oil. Caution - contents will be hot. Serve and enjoy! To help retain freshness, please store in a cool, dry and dark place. Contains: milk. 16 oz (1 lb) 454 g Edmonton AB Canada T5S 2H6 855-516-6075', 'The Little Potato Company Three Cheese Potatoes, 1.0 lb', 'Fresh Produce', 'https://i5.walmartimages.com/asr/563e1dc9-13c0-4b9e-ae61-e299dfe7e6d2.663bc23f9c783ff05e8827f1f8a7aa19.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/563e1dc9-13c0-4b9e-ae61-e299dfe7e6d2.663bc23f9c783ff05e8827f1f8a7aa19.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/563e1dc9-13c0-4b9e-ae61-e299dfe7e6d2.663bc23f9c783ff05e8827f1f8a7aa19.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
