INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (49400465, 'Marketside Fresh Cut Fruit Duo, 10 oz Tray', 6.18, '717524778727', 'Enjoy a healthy snack with these Fresh Strawberries and Blueberries. The sweet juicy strawberries pair perfectly with the tender and slightly tart blueberries to provide you with the essential nutrients and a convenient snacking option. It is a great way to add a serving of delicious fruits in your daily diet. You could also use these fresh berries as a topping for your favorite ice cream or add them to a decadent cheesecake. The fruit is packed in a secure plastic bowl with a lid, making it convenient and portable. Have an easy, healthy treat on hand with these Fresh Strawberries and Blueberries.', 'Marketside Strawberry and Blueberry Fruit Duo 10 oz Comes in a re-closable plastic container to help maintain freshness Great for breakfast, lunch, dessert, or when you want a snack No preservatives, artificial colors or artificial flavors Convenient and portable Share with friends and family or keep for yourself Make a fruit bowl topped with whipped cream or a yogurt parfait Enjoy on their own or in a variety of recipes', 'Marketside', 'https://i5.walmartimages.com/asr/297846f5-314e-44eb-ae0c-2e19cb1b951e.a58a490d0ce36b3e5bb7ff76efc812db.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/297846f5-314e-44eb-ae0c-2e19cb1b951e.a58a490d0ce36b3e5bb7ff76efc812db.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/297846f5-314e-44eb-ae0c-2e19cb1b951e.a58a490d0ce36b3e5bb7ff76efc812db.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (49400484, 'Fresh Grape Tomato, 4 oz Cup', 1.42, '714581000884', 'Add color and flavor to your next salad with these personal-sized fresh Grape Tomatoes. Similar to larger tomatoes, grape tomatoes have a lower water content than other snacking tomatoes, making them meatier and more flavorful, as well as less likely to make a mess when you bite into them. They are perfectly bite-sized which makes them not only ideal in salads and salsas but also perfect as a delicious and convenient snack all on their own. Plus, these small tomatoes also have a longer shelf-life, making it easy to store them for several days at a time and they are hardier and less fragile than a traditional tomato, meaning you no longer have to worry about bruising. Be sure to pick up Grape Tomatoes and experience just how convenient enjoying tomatoes can be.', 'Grape Tomatoes, 4 oz: Lower water content and longer shelf-life than cherry tomatoes Fresh produce Hardier and more resistant to bruising than traditional tomatoes Conveniently bite-sized Quick and excellent addition to salads and snack trays Best stored at room temperature out of sunlight', 'Fresh Produce', 'https://i5.walmartimages.com/asr/03c6a972-a393-4d91-b327-ceb4f03c465c.3ea08772d2d38cb4a989be66a8a1e104.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03c6a972-a393-4d91-b327-ceb4f03c465c.3ea08772d2d38cb4a989be66a8a1e104.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03c6a972-a393-4d91-b327-ceb4f03c465c.3ea08772d2d38cb4a989be66a8a1e104.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
