INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (49699139, 'Marketside Fresh Cut Watermelon, 32 oz Tray', 7.36, '826766225309', 'Experience a burst of tropical flavors with some Marketside Cut Watermelon. This 32-ounce package of pre-cut ripe watermelon is juicy, sweet, and refreshing to the taste. In addition, watermelons are a great natural source of vitamins A and C. Carry them with you and eat them straight out of the tray any time you want, at home, or on-the-go. Pair them with a tasty salad or sandwich for a nutritious and delicious lunch. You can also use them part of a fruit salad. Add some fresh fruits to your daily menu and enjoy the refreshing taste of Marketside Cut Watermelon. Marketside provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Marketside item.', 'Marketside Fresh Cut Watermelon, 32 oz Pre-Cut Convenience: Fresh, sweet, juicy watermelon chunks are ready to eat, saving you time on preparation. Portable Packaging: Comes in a 32 oz tray, making it easy to take on the go for snacks or meals. Nutrient-Rich: A good source of vitamins A and C, contributing to your daily nutritional needs. No Artificial Additives: Free from preservatives, artificial colors, and artificial flavors, ensuring a natural taste. Versatile Use: Perfect as a standalone snack, addition to fruit salads, or as a refreshing side dish. Perishable Item: Keep refrigerated to maintain freshness and quality.', 'Marketside', 'https://i5.walmartimages.com/asr/d97b530a-d558-4503-825d-be0f281cd3f3.95a5a60085a6e868f8035a1f96052942.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d97b530a-d558-4503-825d-be0f281cd3f3.95a5a60085a6e868f8035a1f96052942.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https: