INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259163, 'Dried Guajillo Chile Peppers, Bulk per lb', 7.64, '000000047128', 'Dried Guajillo Chile is a type of dried chili pepper that is widely used in Mexican cuisine. It is a moderately hot chili that is dark red in color and has a smooth, shiny skin. The Guajillo chile has a tangy, slightly sweet flavor with notes of berry and green tea. It is often used in sauces, salsas, and marinades for meats and fresh vegetables. The Guajillo chile is also an essential ingredient in adobo sauce, a popular Mexican seasoning paste that is used to flavor meats and stews.', '-Enjoy the great flavor of Dried Guajillo Chile in Mexican style cuisine for sauces, salsas, and marinades. - Key ingredient in adobo sauce for flavoring meats and stews. - Versatile ingredient in authentic Mexican recipes, enhancing both the visual and taste appeal of dishes!.', 'Melissa\'s', 'https://i5.walmartimages.com/asr/d04a7272-a78e-4ab2-b7bd-d418338e71f4.e44afed7299a0bf1ee822b869de99bbc.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d04a7272-a78e-4ab2-b7bd-d418338e71f4.e44afed7299a0bf1ee822b869de99bbc.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d04a7272-a78e-4ab2-b7bd-d418338e71f4.e44afed7299a0bf1ee822b869de99bbc.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
