INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259193, 'Fresh Organic Lemons, 2 lb Bag', 4.92, '729062120272', 'Add zest and flavor to your meals and beverages with Marketside Organic Lemons. A great source of vitamin C, lemons are a staple citrus fruit essential for any kitchen. Slice them and use them in your iced or hot tea or use the lemon juice to make satisfying and refreshing strawberry lemonade. Zest the lemon peel to use in recipes such as lemon cookies or a tasty lemon loaf. You can also use lemons in savory recipes like asparagus with lemon zest or shrimp scampi with linguini. You can even use lemon peels to clean around the house. For example, use lemon peels to clean microwaves and stovetops or as an all-purpose cleaner. Enhance the flavor of your next meal with Marketside Organic Lemons. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Lemons, 2 lb Bag: Great source of vitamin C Certified USDA organic Use to add zest & flavor to your meals & beverages Add to your iced or hot tea Make a satisfying & refreshing strawberry lemonade Use lemon zest to make lemon cookies or lemon loaf Adds flavor to a variety of recipes Lemons contain more potassium than apples or grapes Lemons also contain citric acid, flavonoids, B-complex vitamins, calcium, copper, iron, magnesium, phosphorus, potassium & fiber', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f61894c0-418d-4480-aee1-75053bc0416b.2196dcd833d1991780ecf36bd299451e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f61894c0-418d-4480