INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259195, 'Fresh Red Grapefruit, 5 lb Bag', 5.76, '877629002766', 'The ideal balance between tart and sweet, this Fresh Red Grapefruit is great for both savory and sweet dishes any time of day. Enjoy half of a grapefruit sprinkled with sugar with some eggs in the morning for a light, sweet breakfast. Slice it up and put in a salad with spinach, avocado, and red onion topped with a mustard and balsamic vinegar dressing for lunch or dinner. Make delicious grapefruit bars that showcase the sweet and tartness of this versatile fruit. In addition, it\'s a great source of vitamin C and vitamin A. With such versatility, Fresh Red Grapefruit will become a pantry staple in your home.', 'Fresh red grapefruit is great for both savory and sweet dishes Enjoy it for breakfast, lunch, dinner, or dessert Enjoy half a grapefruit sprinkled with sugar in the morning Slice it up and put it in salad for lunch or dinner Make delicious grapefruit bars Great source of vitamin C and vitamin A', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9b84af97-6b8d-4eae-b425-f5c61f424ac5.24cc26efbf95c43c758eac871c485527.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b84af97-6b8d-4eae-b425-f5c61f424ac5.24cc26efbf95c43c758eac871c485527.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b84af97-6b8d-4eae-b425-f5c61f424ac5.24cc26efbf95c43c758eac871c485527.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
