INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259208, 'Fresh Whole White Onions, Each', 1.03, '853120003129', 'Add flavor to your next meal with these Fresh, Whole White Onions. For breakfast, you could dice them and add to an omelet loaded with cheese, ham, and mushrooms. You can dice these onions and add them to a fresh garden salad for a satisfying crunch or sprinkle them on top of your fish tacos. White onions also make delicious golden onion rings to serve alongside juicy hamburgers and hot dogs at your next backyard barbecue. You can keep these onions at room temperature until ready to use. Stock your pantry with several Fresh, Whole, White Onions.', 'Fresh whole white onions Ideal ingredient in a variety of recipes Can be sauteed and put in your favorite foods for added flavor Use to top sandwiches, hamburgers, and hot dogs Fresh onions can be stored in a cabinet or pantry and are easy to prepare', 'Fresh Produce', 'https://i5.walmartimages.com/asr/efe28fe8-5537-45ff-9de2-bb534a963c97.00e9aa917c1121c4874b00e3fc312ec7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/efe28fe8-5537-45ff-9de2-bb534a963c97.00e9aa917c1121c4874b00e3fc312ec7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/efe28fe8-5537-45ff-9de2-bb534a963c97.00e9aa917c1121c4874b00e3fc312ec7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
