INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259212, 'Fresh Whole Yellow Onion, Each', 0.7, '851339002179', 'Give all of your dishes a wonderful flavor with these Fresh Yellow Onions. They can be added to all of your favorite foods including hamburgers, stir-fries, soups, and pizza and used to make onion rings and blooming onions as well. These onion vegetables can be sauteed or served raw and stored in a cool, dry area until you are ready to use them. They have a fresh taste that will put something extra in your dish. These onions are easy to peel and quick to prepare so you can serve them on your dinner plate in no time. Add these Fresh Yellow Onions to your next dish and impress others with your culinary skills.', 'Whole fresh yellow onions, each Less pungent than other varieties of onions Mild, all-purpose flavor Great for roasting, caramelizing, grilling, and more Good for long cooking times (roasts, braises, stews, etc.) Yummy addition to salads and relishes Can be made into onion confit or onion rings Packed with minerals and vitamins', 'Fresh Produce', 'https://i5.walmartimages.com/asr/980c6780-7179-491e-978f-8101cdda6760.60f5a7e656c6aea9d94f732ca795dddf.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/980c6780-7179-491e-978f-8101cdda6760.60f5a7e656c6aea9d94f732ca795dddf.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/980c6780-7179-491e-978f-8101cdda6760.60f5a7e656c6aea9d94f732ca795dddf.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
