INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259215, 'Fresh Whole Red Onion, Each', 0.99, '851339002186', 'Fresh Red Onions offer a delicious and simple way to add more vegetables to your diet. These onions are perfect for adding to multiple of your favorite recipes. Add them to your favorite pasta sauces; use them to top pizza; enhance the flavors of your soups, stews, and gumbo, incorporate them into meatloaf; or make delicious omelets or hearty casseroles. You can also dice them and put them in a zesty stir fry or dip the onions in batter to fry up some crowd-pleasing onion rings. Try them in a spicy salsa recipe or on your hamburgers and hot dogs. However you choose to use them, this fresh produce is a must-have for every kitchen pantry. Fresh Red Onions are tasty, versatile and the ideal choice for health-conscious individuals.', 'Fresh Red Onions offer a delicious and simple way to add more vegetables to your diet. These onions are perfect for adding to multiple of your favorite recipes. Add them to your favorite pasta sauces; use them to top pizza; enhance the flavors of your soups, stews, and gumbo, incorporate them into meatloaf; or make delicious omelets or hearty casseroles. You can also dice them and put them in a zesty stir fry or dip the onions in batter to fry up some crowd-pleasing onion rings. Try them in a spicy salsa recipe or on your hamburgers and hot dogs. However you choose to use them, this fresh produce is a must-have for every kitchen pantry. Fresh Red Onions are tasty, versatile and the ideal choice for health-conscious individuals.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6bf5e2ca-9924-4ba6-b74c-775f3f4a1f0f.e20492ce3de3076bfa0bc40c862c9c6c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6bf5e2ca-9924-4ba6-b74c-775f3f4a1f0f.e20492ce3de3076bfa0bc40c862c9c6c.jpeg?odnHei