INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259223, 'Fresh Calabacita Squash, Each', 1.1, '000000047883', 'Add some fresh flavor to your meal with Calabacita Squash. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. Roast the whole squash for a simple and flavorful side dish, chop it into cubes and put it in the slow cooker with chicken breast, kidney beans, and spices, or make noodles for a gluten-free pasta alternative. For a sweet treat turn the squash into a rich and spicy pie, perfect for the holiday season. With so many uses, this vegetable will become a pantry staple. Create tasty and flavorful meals with Calabacita Squash.', 'Versatile ingredient Roast the whole squash for the perfect side dish or chop into cubes, put into a slow cooker, and mix with chicken breast, beans, and spices for a flavorful dish Use it to create a sweet and spicy pie Will become a pantry staple', 'Fresh Produce', 'https://i5.walmartimages.com/asr/3215e13c-345e-4a78-857c-67d6208b86b5.35c20643d7fb623f6697919e1cea88b4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3215e13c-345e-4a78-857c-67d6208b86b5.35c20643d7fb623f6697919e1cea88b4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3215e13c-345e-4a78-857c-67d6208b86b5.35c20643d7fb623f6697919e1cea88b4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
