INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259229, 'Fresh Mangoes, Each', 0.66, '094922506344', 'Get ready for big flavor with our Fresh Mangoes. This sweet, juicy tropical fruit originated in South Asia and has a soft, buttery texture and naturally sweet taste that the whole world has grown to love. They\'re delicious and nutritious, containing loads of vitamin C, which may act as an antioxidant and contribute to healthy immunity. They also have vitamin A, calcium, iron and fiber, so you can feel good about eating them. Slice up a mango and enjoy as a healthy, sweet snack, use it to make fresh mango salsa, or add it to sweet treats like creamy mango-lime bars or mango sorbet! The sky is the limit with this versatile fruit. Life is better when you have Fresh Mangoes.', 'Fresh Mangoes, each: Soft, buttery texture and naturally sweet taste Rich in vitamins A, C, calcium, iron, and fiber Makes a healthy snack Great addition to smoothies, salads, salsa, and more Can also be used to cook and bake with Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/cc54242f-cb87-4a25-9baa-fccaa20f5443.64fa79325ad44a7352dcd3c2a8b477be.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc54242f-cb87-4a25-9baa-fccaa20f5443.64fa79325ad44a7352dcd3c2a8b477be.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc54242f-cb87-4a25-9baa-fccaa20f5443.64fa79325ad44a7352dcd3c2a8b477be.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259230, 'Fresh Persimmons, 1 Each', 0.49, '000000044288', 'Persimmons are rich in antioxidants and important nutrients, such as fiber and vitamin A. They have also been linked to several potential health benefits and can be enjoyed in a variety of dishes. You can eat persimmons fresh, dried, or cooked. They are also commonly used around the world in jellies, drinks, pies, curries, and puddings. They make a great addition to any sweet or savory dessert!', 'Creamy texture and a tangy-sweet vanilla like flavor Make a great addition in both sweet dishes for breakfast or dessert, or paired with cheese and greens for a salad or appetizer Contains a good amount of vitamin A and some vitamin C Sold by the each', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c7ac26ed-4227-44d7-aff5-d088d95435a2_1.aac06e588578c578cf553db9ca16a2c6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ac26ed-4227-44d7-aff5-d088d95435a2_1.aac06e588578c578cf553db9ca16a2c6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ac26ed-4227-44d7-aff5-d088d95435a2_1.aac06e588578c578cf553db9ca16a2c6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
