INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259250, 'Monterey Dried Shitake Mushrooms, 1 oz', 3.74, '037102289101', 'Fresh Shiitake, Bag 1 OZ Fine gourmet dried mushrooms. Recipe inside! 100% natural. Wildcrafted in Nature\'s Lab - the forest floor. Wild Light mushrooms - one of nature\'s miracles! Are full of rich flavor, nutritional goodness, and (some say) healing properties. Their fragrant magic, when preserved by drying, can be enjoyed year round. Simply soak dried mushrooms in warm water (or wine, or stock) for 20-30 minutes, then add to your favorite recipe. Save that soaking liquid and use as a stock or gravy base - it\'s full of concentrated mushroom flavor! Dried mushrooms keep for months, without refrigeration, and for a year or more if frozen. The traditional black mushroom of Oriental cuisine. The meaty flesh of the shiitake has a full-bodied, distinctively woodsy flavor. Originally wild-harvested in Japan and Korea, shiitakes are now cultivated around the world. Many health benefits have been attributed to eating shiitake mushrooms, including strengthening the immune system. Use shittake for a hearty mushroom soup or in savory sauces for meat and poultry. Excellent in risottos, omelettes, and quiche. Product of China. Always cook mushrooms before eating. 1 oz (24.8 g) Okemos, MI 800-367-4709', 'Dried Shiitake Mushrooms, 1 oz: Rich, full flavor Great for breakfast, lunch, or dinner Mince them for an omelet, slice them for a salad, or saute in barbeque sauce for a vegan sandwich Naturally fat-free and cholesterol-free Low in sodium and calories Excellent source of selenium Soak in warm water, wine, or stock fro 20-30 minutes Can keep for months, without refrigeration, and for a year or more if frozen ***Discontinued***GHS***MSH DRIED WHLE SHTKE', 'Monterey', 'https://i5.walmartimages.com/asr/3b405e18-dc4e-45bd-be5c-d26aef8a32a