INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259258, 'Marketside Fresh Butternut Squash, 16 oz', 3.47, '681131122351', 'Marketside Butternut Squash makes preparing this fantastic hard-shelled gourd easier than ever! Whole butternut squash can be difficult to cut and peel, so we\'ve done the work for you. Each bag includes a full pound of washed, chopped, and ready-to-cook butternut squash. This versatile and delicious vegetable can be prepared with an array of spices. Use it for sweet sides, such as cinnamon and brown sugar roasted squash, or for savory creations like garlic, Parmesan, and herb roasted squash. You can also add it to a casserole or make roasted butternut squash with pecans by following the recipe featured on the package. Explore the many possibilities of our Marketside Butternut Squash today. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Steams in minutes in the microwave Washed and ready to cook Keep refrigerated Great for both sweet and savory dishes', 'Marketside', 'https://i5.walmartimages.com/asr/f6a75a41-7654-49ae-a514-c3d2e85e3e88.512b168166d83aad565c934aaf178b1e.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f6a75a41-7654-49ae-a514-c3d2e85e3e88.512b168166d83aad565c934aaf178b1e.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f6a75a41-7654-49ae-a514-c3d2e85e3e88.512b168166d83aad565c934aaf178b1e.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
