INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259299, 'Fresh Whole Carrots, 5 lb Bag', 4.77, '033383660035', 'Fresh Whole Carrots are delicious crunchy veggies perfect for snacking or using in recipes. Enjoy them as an ingredient in your favorite recipes or simply enjoy them as a healthy snack on the go. Peel, slice, and go! Make a tasty snack and serve these carrots with celery and ranch dressing or hummus for dipping. You can roast them in the oven with a little bit of olive oil and honey for a delectable side dish, or boil and mash them for a fun twist on traditional mashed potatoes. Carrots are one of nature\'s best sources of nutrients, rich in Vitamin A with antioxidant beta-carotene. Carrots provide dietary fiber and potassium. Health agencies recommend that you eat five or more servings of fruits and vegetables, which include carrots, every day for good health. Enjoy the delicious flavor and healthy crunch of Fresh Whole Carrots.', 'Fresh Whole Carrots 5-pound bag Excellent source of beta carotene, fiber, vitamin K1, potassium, and antioxidants No preservatives Perfect for snacking or using in recipes Perfect for packing in lunches or serving as a snack with dip', 'Fresh Produce', 'https://i5.walmartimages.com/asr/40af4930-3308-4d3d-a8f1-8f50ca6116a3.42dda044924c7d41d2f97c8d67217a08.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/40af4930-3308-4d3d-a8f1-8f50ca6116a3.42dda044924c7d41d2f97c8d67217a08.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/40af4930-3308-4d3d-a8f1-8f50ca6116a3.42dda044924c7d41d2f97c8d67217a08.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259300, 'Fresh Organic Marketside Petite Carrots, 12 oz Bag', 2.26, '032601046637', 'Marketside Organic Petite Carrots are cut, peeled and ready to eat for your convenience. These carrots are full of flavor and certified USDA organic. Enjoy them as an ingredient in your favorite recipes or simply enjoy them as a healthy snack on the go. Make it a tasty snack and serve with celery and ranch dressing or hummus for dipping. They also offer nutritional benefits as they are a good source of dietary fiber and vitamins A and C. These carrots come in a bag that is steamable in the microwave or you can heat them up on the stovetop. Enjoy farm fresh flavors with Marketside Organic Petite Carrots. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Cut and peeled USDA organic Ready to eat Microwaveable, steam in bag Great snack Serve with hummus and ranch dip', 'Marketside', 'https://i5.walmartimages.com/asr/0b8acef8-75c2-45c8-9400-2555ad7ad29d.6e57f30701d8db84abf702005614bd7e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0b8acef8-75c2-45c8-9400-2555ad7ad29d.6e57f30701d8db84abf702005614bd7e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0b8acef8-75c2-45c8-9400-2555ad7ad29d.6e57f30701d8db84abf702005614bd7e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259301, 'Fresh Organic Grape Tomato, 10 oz Package', 2.83, '826375018224', 'Organic Grape Tomatoes are an exciting summer treat, and they\'re the perfect size for skewers, salads and roasting. These bite-sized grape tomatoes look and taste great. Grape tomatoes are a low-calorie treat that are also low in sodium and are a good source of fiber. Whether you are snacking or adding them to your favorite dish. their uses are almost limitless. Try these grape tomatoes with feta cheese, fresh dill and a drizzle of olive oil for a light and delicious Mediterranean treat. Or make a caprese salad with grape tomatoes, fresh basil, fresh mozzarella and balsamic vinegar. With 10-ounces of tomatoes in each package, you\'ll have plenty to make mouthwatering meals. Use your imagination to create delicious dishes with Organic Grape Tomatoes.', 'Organic Cherry Tomatoes, 10 oz Package: Perfect size for skewers, salads and roasting Low-calorie, low in sodium, and a good source of fiber Pair with feta cheese, fresh dill, and a drizzle of olive oil for a Mediterranean dish Certified organic', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6b6dd728-49bd-438f-abbe-dc65033b7fc8.8f14e50c2cd84c4bfeb071d7d98cbadd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6b6dd728-49bd-438f-abbe-dc65033b7fc8.8f14e50c2cd84c4bfeb071d7d98cbadd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6b6dd728-49bd-438f-abbe-dc65033b7fc8.8f14e50c2cd84c4bfeb071d7d98cbadd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259302, 'Fresh Produce Whole Artichoke Vegetable, 1 Each', 2.78, '204516000008', 'Fresh globe artichokes are crisp and delicious, picked at the peak of freshness. They are easy to cook, boil, braise, stuff or bake for a tasty result. You can also enjoy as an appetizer, side dish or as a healthy snack. Artichokes have a tender and buttery flavor, softening beautifully when properly cooked. Add a nutrient-rich vegetable, that is naturally high in folate, vitamin C and K to your diet', 'Fresh Globe Artichoke – Crisp and delicious, picked at peak freshness Easy to Cook – Boil, grill, braise, or stuff and bake for tasty results. Tender & Buttery Flavor – Softens beautifully when properly cooked Healthy & Versatile – Enjoy as an appetizer, side dish, or wholesome snack Nutrient-Rich Vegetable – Naturally high in folate plus vitamins C and K', 'Fresh Produce', 'https://i5.walmartimages.com/asr/963a2841-33e9-4f14-9447-97a386e98b57.8e1796f357fdc621a34080ea9587a3eb.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/963a2841-33e9-4f14-9447-97a386e98b57.8e1796f357fdc621a34080ea9587a3eb.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/963a2841-33e9-4f14-9447-97a386e98b57.8e1796f357fdc621a34080ea9587a3eb.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259305, 'Fresh Whole Heirloom Tomato, 2 Pack', 3.98, '686478999994', 'Enjoy the robust flavor of Fresh Whole Organic Heirloom Tomatoes. These tomatoes feature vibrant colors with sweet, juicy flavor in each bite, making them a versatile ingredient that\'s perfect for a wide range of dishes. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. They make an excellent addition to meals or simply enjoy them alone for a healthy and refreshing snack. Bring the fresh and delicious taste of Fresh Whole Organic Heirloom Tomatoes to your kitchen today!', 'Fresh Whole Heirloom Tomato, 2 Pack Sweet and juicy flavor in every bite Versatile ingredient that\'s perfect for a wide range of dishes Slice them up to garnish a sandwich or burger for added flavor and texture Dice them up to create a pizza or pasta topping Crush them up to make a decadent bruschetta or sauce Finely blend them to create your own personalized salsa', 'Fresh Produce', 'https://i5.walmartimages.com/asr/0d3dd139-c5cb-4d25-9d2e-ca28307c381f.5917af0f7369587011a3183ba17f1708.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d3dd139-c5cb-4d25-9d2e-ca28307c381f.5917af0f7369587011a3183ba17f1708.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d3dd139-c5cb-4d25-9d2e-ca28307c381f.5917af0f7369587011a3183ba17f1708.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
