INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259330, 'Fresh Envy Apples, Each', 1.06, '000000033152', 'Treat your family to the wildly juicy, sweet and crisp taste of Envy Apples. With a classic apple cider flavor, these apples have a firm texture with flesh that is slow to brown. This variety was developed in New Zealand by master farmers and now grown in Zillah, Washington. A crossing of Braeburn and Gala varieties, this apple fruit is always cross-pollinated to ensure genetic diversity. Envy Apples retain their white color long after you\'ve cut them open, which ensures that your refreshing fruit salads and other desserts look beautiful and appetizing. Free of gluten, fat and cholesterol, these apples are a wholesome way to indulge your sweet tooth. Enjoy the sweet and healthy taste of Envy Apples.', 'Excellent snacking apple Make a creamy smoothie or a nutritious juice blend Free from genetic modification Make apple butter or applesauce Make sweet desserts like apple cobbler, apple crisp & apple pie', 'ENVY APPLES', 'https://i5.walmartimages.com/asr/32451a10-0563-426a-9a16-a8865b2c3774_3.b3be01fcc4c956f51fe3890589897d31.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/32451a10-0563-426a-9a16-a8865b2c3774_3.b3be01fcc4c956f51fe3890589897d31.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/32451a10-0563-426a-9a16-a8865b2c3774_3.b3be01fcc4c956f51fe3890589897d31.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259331, 'Fresh Red Globe Seeded Grapes, Bag (2.25 lbs/Bag Est.)', 4.21, '895321002037', 'Treat yourself to the delicious, juicy flavor of Fresh Red Globe Whole Seeded Grapes. These grapes are bursting with sweet flavor and known for their large size. Enjoy a handful as a fresh snack any time of day or dry them for scrumptious raisins. You can even use them to make refreshing grape juice. They are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with cheese, crackers, or delectable meats like prosciutto. If you want to be creative, you can freeze them and use them as ice cubes in your favorite drinks. Treat yourself to the whole fresh taste of Red Globe Whole Seeded Grapes.', 'Fresh Red Globe Whole Seeded Grapes, Bag (2.25 lbs/Bag Est.) Bursting with flavor and known for their large size Enjoy a handful as a fresh snack Add to a stunning cheese board or charcuterie plate Dry them to make raisins Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/56a93cf7-e9e8-45d7-8891-b0f2dde7b90c.0bc56cfb5776a10494d8114303e1f507.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/56a93cf7-e9e8-45d7-8891-b0f2dde7b90c.0bc56cfb5776a10494d8114303e1f507.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/56a93cf7-e9e8-45d7-8891-b0f2dde7b90c.0bc56cfb5776a10494d8114303e1f507.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259334, 'Fresh Minneola, Each', 0.44, '000000044561', 'Known for their sweet, unique flavor, Minneola\'s add a sophisticated twist to your beverages and cocktails. Add a pinch of zest to your meals or add peeled sections to your salads. Due to its easy to peel skin and lack of seeds, these make a great snack for lunchboxes or on-the-go. These are also an excellent source of fiber and Vitamin C that help strengthen the immune system. Available by the each.', 'Delicious, sweet, juicy citrus Easy to peel and segment Excellent source of vitamin C, folate and potassium Seedless Great choice for lunchboxes or snacks on-the-go', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5144f96d-e0bc-47ea-aebd-801db965a311.2b7f30c61a7dd7caa2d6a012432c72e0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5144f96d-e0bc-47ea-aebd-801db965a311.2b7f30c61a7dd7caa2d6a012432c72e0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5144f96d-e0bc-47ea-aebd-801db965a311.2b7f30c61a7dd7caa2d6a012432c72e0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259335, 'Gourmet Garden Gluten Free Minced Garlic Stir-in Paste, 4.0 oz Tube', 3.94, '875208000707', 'Gourmet Garden Gluten Free Minced Garlic Stir-in Paste, 4 oz Tube. Gourmet Garden Minced Garlic Stir-in Paste is made for garlic lovers who make sure they always have their favorite herb on-hand. It\'s an easy way to add bold, savory flavor and minced garlic texture to your meals. Packed inside each squeezable tube is fresh garlic that\'s been peeled and minced to deliver its signature punch. Our garlic paste is at its best flavor, color and aroma when it reaches your table. Use it at the beginning of cooking to create a sweet, garlicky base. Add it at the end- traditionally garlic bread, marinades and sauces- for a deeper, more pungent flavor. Use 1 teaspoon of paste in place of 1 medium garlic clove. Store refrigerated for weeks after opening. This Gourmet Garden Minced Garlic Stir-in Paste is in a Plastic tube that is 4 ounces. Store this Refrigerated item at an ambient temperature.', 'Gourmet Garden Gluten Free Minced Garlic Stir-in Paste, 4 oz Tube Fresh minced garlic paste packed into a convenient squeezable tube No prep necessary Stays fresh in refrigerator for weeks after opening. Gluten Free Adds bold flavor to garlic bread, marinades and sauces Use 1 tsp. of paste in place of 1 medium garlic clove This product is in a Plastic Tube', 'Gourmet Garden', 'https://i5.walmartimages.com/asr/e5e65329-4010-4377-aa08-2942e4defd74.3d2a67ef309f8f58cc8f0fd0875c5a18.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5e65329-4010-4377-aa08-2942e4defd74.3d2a67ef309f8f58cc8f0fd0875c5a18.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5e65329-4010-4377-aa08-2942e4defd74.3d2a67ef309f8f58cc8f0fd0875c5a18.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259338, 'Marketside Fresh Organic Bananas, Bunch', 1.71, '000000940115', 'Enjoy the sweet, tropical taste of Marketside Organic Bananas. Bananas are a good source of several vitamins and minerals including potassium, vitamin B6 and vitamin C and are low in sodium. Enjoy them at breakfast, lunch, dessert, or anytime you want a healthy snack. Use them to make a whole loaf of moist banana bread and enjoy with a hot cup of coffee in the mornings or layer them with pudding and vanilla wafer cookies for a light, sweet banana pudding that\'s perfect for dessert. Simply peel open the banana and savor the delicious taste of this sweet fruit. Bring home Marketside Organic Bananas and make them a part of your day. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Fresh Organic Whole Bananas, Bunch Sweet, tropical flavor Enjoy at breakfast, lunch, dessert, or when you want a snack Good source of potassium, vitamin B6 and vitamin C and low in sodium Make banana bread or banana pudding and enjoy with a hot cup of coffee Peel open and enjoy One bunch contains approximately 5-7 bananas', 'Marketside', 'https://i5.walmartimages.com/asr/f17ef225-0999-4035-9ed1-7a06607333b4.7c3b33492f937bcc19fe3339d5230929.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f17ef225-0999-4035-9ed1-7a06607333b4.7c3b33492f937bcc19fe3339d5230929.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f17ef225-0999-4035-9ed1-7a06607333b4.7c3b33492f937bcc19fe3339d5230929.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259339, 'Fresh Mini Bananas, Bunch, Sweet', 1.11, '000000042345', 'Our fresh mini bananas are made with organic ingredients and are the perfect healthy snack! These sweet and delicious sweet fruits are filled with essential vitamins and minerals that provide energy and help maintain a balanced diet. Enjoy them as a quick on-the-go snack or add them to smoothies and desserts for a delicious treat. Trust us, you won\'t be disappointed!', 'Whole mini bananas, also known as baby bananas or finger bananas, are a type of fresh produce that comes in a smaller size compared to regular bananas, offering a convenient and portable snack option. As a fresh produce item, mini bananas retain their full nutritional value, providing essential vitamins and minerals such as potassium, vitamin C, and vitamin B6, which contribute to overall health and well-being. When consumed whole and ripe, mini bananas have a sweet, creamy taste and a soft texture, making them a delightful and satisfying snack or addition to various recipes, such as smoothies, fruit salads, or baked goods.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/351f0494-e31f-4021-b85e-06f255e3398c.8ab1a7c8e2f554c22428bf44fe7a680f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/351f0494-e31f-4021-b85e-06f255e3398c.8ab1a7c8e2f554c22428bf44fe7a680f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/351f0494-e31f-4021-b85e-06f255e3398c.8ab1a7c8e2f554c22428bf44fe7a680f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
