INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259342, 'Dried Mushrooms, 1 oz', 3.74, '037102289606', 'A popular ingredient in Europe and Asia for many, many centuries, Dried Mushrooms have been receiving attention in the culinary world due their versatility and economy. The flavor of dried mushrooms is more concentrated than their fresh counterparts, so less is needed for your favorite recipes. This particular blend of mushrooms features dried porcini, boletes, shiitake, morel, oyster and lobster mushrooms to provide you with a savory and versatile mixture of wild and cultivated flavors. For full flavor potential, use this blend to add a rich, hearty flavor to beef, pork and poultry recipes, vegetable soups, stir fry recipes, hunter stew, casseroles, rice dishes, pasta, stuffings, and sauces. Experience a recipe favorite in a new light with our Dried Mushrooms.', 'Dried Mushrooms, 1 oz: Store in a cool, dark place Shelf life is 6 to 12 months can be extended by freezing To reconstitute, cover with boiling water for 20-30 minutes Drain; reserve fluid for adding flavor to dishes, if desired Trim tough stems 1 ounce of reconstituted mushrooms equals 4 ounces of fresh mushrooms May contain naturally occurring sulfites', 'Unbranded', 'https://i5.walmartimages.com/asr/39023d4c-f04c-4302-8188-38ac557ac255.5ac744e7cba5d645e63aa319fd1f94c4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39023d4c-f04c-4302-8188-38ac557ac255.5ac744e7cba5d645e63aa319fd1f94c4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39023d4c-f04c-4302-8188-38ac557ac255.5ac744e7cba5d645e63aa319fd1f94c4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
