INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259344, 'Fresh Cherry Tomato, 10 oz Clam Shell', 2.98, '033383655208', 'Bring the fresh, delicious taste of Slicing Tomatoes into your home. These tomatoes deliver sweet and juicy flavor with each bite and are an ideal ingredient in a variety of recipes. They would make a tasty, garden-inspired addition to salads, burgers, gourmet sandwiches, and so much more. They are picked at peak freshness and specially bred for deep red color, intense flavor, and higher lycopene content than standard tomatoes. Whether you slice or dice them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with these fresh Slicing Tomatoes.', 'Cherry Tomato, 1 Bag Wholesome, fresh, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a59807a2-bd89-4a64-9d7e-f263efc3d7a6.21a9d203fad771b7b512830fa740034f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a59807a2-bd89-4a64-9d7e-f263efc3d7a6.21a9d203fad771b7b512830fa740034f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a59807a2-bd89-4a64-9d7e-f263efc3d7a6.21a9d203fad771b7b512830fa740034f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
