450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259357, 'Marketside Cauliflower Florets, 16 oz', 2.47, '681131122320', 'Add fresh and ready to eat cauliflower florets to your meal with Marketside Cauliflower Florets. Serve as is, or add your favorite spices for additional flavor. Add onion, thyme, garlic, olive oil, parmesan cheese, salt and pepper to cauliflower to create a yummy side dish. Marketside Cauliflower Florets are a quick and healthy side dish and a great addition to any meal. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes. Microwave: Pierce holes in bag with fork. Place on a microwave safe dish and microwave on high for 2 or 3 minutes. Using caution as the steam from the bag will be very hot.', 'Marketside Cauliflower Florets, 16 oz Microwave in bag Washed and ready to eat Ready in 3 minutes Picked fresh for you', 'Marketside', 'https://i5.walmartimages.com/asr/0aad7a2c-1854-465b-8a12-fb461b892220.0b915611b36ea3eb5e807e96c2c3be14.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0aad7a2c-1854-465b-8a12-fb461b892220.0b915611b36ea3eb5e807e96c2c3be14.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0aad7a2c-1854-465b-8a12-fb461b892220.0b915611b36ea3eb5e807e96c2c3be14.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259358, 'Green Giant Cauliflower Crumbles, 16 oz', 2.98, '605806000713', 'Green Giant™ Cauliflower Crumbles®.Chopped cauliflower.Great for mashing, pizza crusts, sauces & more!Recipe ready.Steams in pack.Gluten free.Per Serving:20 Calories.0g Sat fat, 0% DV.25mg Sodium, 1% DV.2g Sugars.Net Wt 16 oz (1 lb) (454 g). Perishable, keep refrigerated.Steam in pack Directions:1. Tear bag at notch.2. Close bag with zipper leaving 1-inch opening.3. Place bag standing up in microwave; microwave on high 4 minutes, or until desired tenderness*. Let stand 1 minute in microwave.4. Carefully remove bag. Caution hot!5. Ready to use as recipe ingredient, or add desired seasonings to taste and enjoy!*Because microwaves cook differently, times are approximate.', 'Cauliflower, Crumbles, Chopped Great for mashing, pizza crusts, sauces & more! Making comfort food healthy! Steams in pack. Box Tops for Education. Gluten free. Per serving: 20 calories; 0 g sat fat (0% DV0; 25 mg sodium (1% DV); 2 g sugars; Vitamin C (70% DV); Vitamin K (15% DV). Find delicious recipes, helpful tips & more: Scan code with app. greengiantfresh.com/cauliflower-crumbles. Find Delicious Recipes: GreenGiantFresh.com. Questions or comments? 1-800-998-9996. Follow Us On: Facebook and Twitter. Facebook. Twitter.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7b6d30da-69b0-4e78-9f25-3b94ec11c921.9b7c470841bebbf0ac5a4261238a84c2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7b6d30da-69b0-4e78-9f25-3b94ec11c921.9b7c470841bebbf0ac5a4261238a84c2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7b6d30da-69b0-4e78-9f25-3b94ec11c921.9b7c470841bebbf0ac5a4261238a84c2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259361, 'Fresh Green Onions Bunch, Each', 0.98, '723525040022', 'Add flavor to your next meal with Fresh Green Onions. For breakfast, you could dice them and add to an omelet loaded with cheese, ham, and mushrooms. Chop up the stalks into little rings and mix them into sour cream to create a delicious chip dip. You can also add them to a fresh garden salad or sprinkle them on top of your fish tacos. However you choose to use it, this fresh produce will add something delicious to any meal. Add color and flavor to any dish with these Fresh Green Onions. Also known as Cebollino, Scallion, Basal akhdar and Hara pyaz around the world.', 'Fresh Green Onion Bunch, Each Versatile ingredient Chop up the stalks into little rings and mix them into sour cream to create a delicious chip dip Use them to garnish a mouthwatering bowl of ramen Adds a hint of boldness to your dishes Easy way to add color and flavor to a dish Tasty fresh produce', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e3e6b87a-735c-4e00-b35b-c566d3f56ff3.e7440b87be49eb20ac956d0a2690822e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e3e6b87a-735c-4e00-b35b-c566d3f56ff3.e7440b87be49eb20ac956d0a2690822e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e3e6b87a-735c-4e00-b35b-c566d3f56ff3.e7440b87be49eb20ac956d0a2690822e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259365, 'Earthy Delights Mushrooms, 1 Oz.', 5.98, '037102289309', 'Porcini, Bag 1 OZ Fine gourmet dried mushrooms. Recipe inside! 100% natural. Wildcrafted in Nature\'s Lab - the forest floor. Wild mushrooms - one of nature\'s miracles! Are full of rich flavor, nutritional goodness, and (some say) healing properties. Their fragrant magic, when preserved by drying, can be enjoyed year round. Simply soak dried mushrooms in warm water (or wine, or stock) for 20-30 minutes, then add to your favorite recipe. Save that soaking liquid and use as a stock or gravy base - it\'s full of concentrated mushroom flavor! Dried mushrooms keep for months, without refrigeration, and for a year or more if frozen. Delectable fresh or dried, porcini mushrooms are among the most sought-after of all wild-harvest mushrooms. Porcini means little pigs in Italian, so called for their plump floor. In France they are known as cepes; to the Germans they are Steinpilz. With a rich, earthy flavor and heady aroma, porcini may be featured in savory sauces to accompany meat or poultry. Excellent in risottos, omelettes, or served with polenta. Wild harvested. www.earthy.com. Product of China. Always cook mushrooms before eating. May contain naturally occurring sulfites. 1 oz (24.8 g) Okemos, MI 800-367-4709', 'Mushrooms, Dried, Porcini Fine gourmet dried mushrooms. Recipe inside! 100% natural. Wildcrafted in Nature\'s Lab - the forest floor. Wild mushrooms - one of nature\'s miracles! Are full of rich flavor, nutritional goodness, and (some say) healing properties. Their fragrant magic, when preserved by drying, can be enjoyed year round. Simply soak dried mushrooms in warm water (or wine, or stock) for 20-30 minutes, then add to your favorite recipe. Save that soaking liquid and use as a stock or gravy base - it\'s full of concentrated mushroom flavor! Dried mushrooms keep for months, without refrigeration, and for a year or more if frozen. Delectable fresh or dried, porcini mushrooms are among the most sought-after of all wild-harvest mushrooms. Porcini means little pigs in Italian, so called for their plump floor. In France they are known as cepes; to the Germans they are Steinpilz. With a rich, earthy flavor and heady aroma, porcini may be featured in savory sauces to accompany meat or poultry. Excellent in risottos, omelettes, or served with polenta. Wild harvested. www.earthy.com. Product of China.', 'Earthy', 'https://i5.walmartimages.com/asr/bb8faf50-9f1c-43f2-90aa-db89382dc5e4_1.0f4800e434b68382af92ecc44ef5588d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bb8faf50-9f1c-43f2-90aa-db89382dc5e4_1.0f4800e434b68382af92ecc44ef5588d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bb8faf50-9f1c-43f2-90aa-db89382dc5e4_1.0f4800e434b68382af92ecc44ef5588d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259368, 'Fresh Green Leaf Lettuce, Each', 2.06, '033383651415', 'Fresh Green Leaf Lettuce is the perfect way to add more greens to your diet. This leafy lettuce is the perfect base for creating a variety of salads. Chop it up, add a protein like grilled chicken, a cheese like feta, candied pecans, and dried cranberries with a sweet vinaigrette for a sweet and tangy salad. Add it to spring rolls for a crunchy, refreshing addition. You could use it as a lettuce boat or wrap when you are wanting to still eat leafy greens but don\'t want a salad. It\'s low in calories making it perfect for adding to a healthy diet. Enjoy the crisp and refreshing taste of Fresh Green Leaf Lettuce.', 'Fresh Green Leaf Lettuce, Each Perfect base for creating salads Chop it and mix with grilled chicken, feta cheese, candied pecans, dried cranberries and a vinaigrette Add it to a spring roll for fresh addition Use it as a lettuce wrap or lettuce boat for something different Low calorie making it perfect for a healthy diet', 'Fresh Produce', 'https://i5.walmartimages.com/asr/43584fcd-d522-41d9-8b26-c8e671d4850e.86fe376258eaa7ba3a75e3e261877292.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/43584fcd-d522-41d9-8b26-c8e671d4850e.86fe376258eaa7ba3a75e3e261877292.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/43584fcd-d522-41d9-8b26-c8e671d4850e.86fe376258eaa7ba3a75e3e261877292.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259369, 'Fresh Keylimes, 1 lb Bag', 2.98, '033383146812', 'Add zest and flavor to your meals and beverages with these Key Limes. Freshly squeezed limes provide a healthy dose of vitamin C to your diet and are a key ingredient in many recipes, from homemade salsa to chicken dishes. The citrusy tropical flavor of these limes are sure to add a zing to all your cooked meals. Drizzle lime juice over fish or add it to your favorite sauces. Serve wedges of raw lime with your favorite cocktails and use them when baking cakes, cookies, and tarts. These limes are sold in a one-pound bag, so you\'ll have plenty for all your culinary creations. Enjoy the refreshing, tart flavor of Key Limes.', 'Fresh and juicy key limes Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use them when baking cakes, cookies, and tarts Refreshing, tart flavor Available in a 1-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/55de190c-7ec6-4b89-9dc6-2cdb721d6eb5.48fc6c58092b173dce51eeacf4703a2b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/55de190c-7ec6-4b89-9dc6-2cdb721d6eb5.48fc6c58092b173dce51eeacf4703a2b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/55de190c-7ec6-4b89-9dc6-2cdb721d6eb5.48fc6c58092b173dce51eeacf4703a2b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259372, 'Lil Snapper Blood Oranges, 3 Lb.', 4.5, '605049458302', 'The Moro Blood Orange is called \"the blood orange\" because of my intense maroon color on the inside. It has a rich orange taste with hints of berry flavor with an orange peel with a red blush.', 'Lil Snapper Blood Oranges', 'Fresh Produce', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259374, 'Robinson Fresh Orange Habanero Chili Peppers, 4 oz', 2.97, '852966005182', 'Add some spice to your meals with Habanero Peppers. Habanero chilies have a high spice level, so it\'s perfect for adding heat to your meals. These versatile peppers are an excellent addition to a multitude of dishes. For a sweet and spicy dish dice the habanero and mix it with diced mango, onion, cilantro, and tomatoes. You can make pepper jelly with the chopped chilis for a delicious jelly that can be spread on bagels, toast, and more. Make a habanero sauce to brush over your choice of protein, like buffalo wings, pork loin, or ribs. Use as little or as much of this fresh produce item as you like to get that perfect level of heat. Wash the peppers before use. Make this four-ounce tray of Habanero Peppers a staple in your pantry.', 'Fresh Habanero Peppers, 4 Ounce Tray High spice level peppers Perfect for adding heat to your dishes Versatile pepper Dice for pepper jelly, dice and mix with mango, onions, and tomatoes for salsa, or make a sauce and brush over your choice of protein Use as little or as much as you want to get the perfect amount of heat Delicious and fresh produce item Wash chilies before use', 'Robinson Fresh', 'https://i5.walmartimages.com/asr/5335890b-e820-43b4-a77d-99655c77526f.fad2dc5ccee7726bf0499aaec2ae908e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5335890b-e820-43b4-a77d-99655c77526f.fad2dc5ccee7726bf0499aaec2ae908e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5335890b-e820-43b4-a77d-99655c77526f.fad2dc5ccee7726bf0499aaec2ae908e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259378, 'Fresh Broccoli Crowns, Each', 1.83, '203082000009', 'These fresh broccoli crowns are a top-quality, nutritious choice for your meals. They are the premium cut of broccoli, with stalks trimmed just under the head to deliver maximum florets. Ideal for a variety of dishes such as steaming, roasting, or sautéing. These crowns are about 0.75 lbs each and packed in a recyclable, food-grade cardboard container, ensuring they are kept fresh and environmentally friendly. Enjoy them as a healthy side dish or snack with your favorite dip. Perfect for adding flavor and nutrients to soups and salads. Always choose fresh, organic produce for the best results. Also known as Brocoli and Kai-lan around the world.', 'Healthy side to any meal Excellent steamed, roasted, sautéed, in soups or served raw with a favorite dip Stalks cut short to offer greater ratio of florets per lb Approximately .75 lbs per crown Vegetable type: Fresh Broccoli Food condition: Fresh, never frozen Container type: Cardboard Box Container material: Recyclable, food-grade cardboard', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c721459d-3826-4461-9e79-c077d5cf191e_3.ca214f10bb3c042f473588af8b240eca.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c721459d-3826-4461-9e79-c077d5cf191e_3.ca214f10bb3c042f473588af8b240eca.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c721459d-3826-4461-9e79-c077d5cf191e_3.ca214f10bb3c042f473588af8b240eca.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259381, 'Fresh Coconut, Each, 1 Count', 2.74, '064081402009', 'Enjoy a taste of the tropics with a Fresh Coconut. Enjoying a fresh coconut couldn\'t be easier: just puncture the pre-scored eyes on top with a dull knife and pour out the delicious coconut water. After the water is gone, crack the coconut along the scored line, remove the coconut meat with a dull knife, and enjoy! There are so many ways to enjoy a fresh coconut; you can blend it into smoothies, cut it into chunks and add to stir fries and stews, use it as a garnish, blend it into dips and spreads, or even make your own shredded coconut for delicious desserts. Enjoy a tropical treat any time of year when you bring home a Fresh Coconut.', 'Enjoy the taste of the tropics any time of year Puncture the pre-scored eyes on top and pour out the coconut water When water is gone, crack along the scored line and remove the coconut meat Use in smoothies, stir fries, dips and spreads, as a garnish, or make your own shredded coconut Also known as Coco and Brown Coconut around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/81131765-9311-47ed-ae77-15dddde6b01d.7363231977ed5579d57e0b24cd7c1d9f.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/81131765-9311-47ed-ae77-15dddde6b01d.7363231977ed5579d57e0b24cd7c1d9f.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/81131765-9311-47ed-ae77-15dddde6b01d.7363231977ed5579d57e0b24cd7c1d9f.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259387, 'Fresh Grapefruit, Each', 1.24, '072240062063', 'Grapefruit is the perfect balance between tart and sweet. The balance between tart and sweet is great for both savory and sweet dishes any time of day. Enjoy half of a grapefruit sprinkled with sugar with some eggs in the morning for a light, sweet breakfast. Slice it up and put in a salad with spinach, avocado, and red onion topped with a mustard and balsamic vinegar dressing for lunch or dinner. Make delicious grapefruit bars that showcase the sweet and tartness of this versatile fruit. For an adult recipe juice the grapefruit and pair with some simple syrup and alcohol for a refreshing cocktail. This fruit is the perfect addition to a healthy diet as it is a great source of vitamin C and vitamin A. With such versatility, Grapefruit will become a pantry staple in your home.', 'Great for both savory and sweet dishes Enjoy it for breakfast, lunch, dinner, or dessert Enjoy half a grapefruit sprinkled with sugar in the morning, slice it up and put it in salad for lunch or dinner, or make grapefruit bars Great source of vitamin C and vitamin A', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9b886c2a-7fc2-4dbd-98fe-99c8e48e6944.f2698681c6f777003cfd13d7c6086d09.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b886c2a-7fc2-4dbd-98fe-99c8e48e6944.f2698681c6f777003cfd13d7c6086d09.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b886c2a-7fc2-4dbd-98fe-99c8e48e6944.f2698681c6f777003cfd13d7c6086d09.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259388, 'Fresh Hass Organic Bagged Avocados, 3-4 Count', 3.93, '701080310170', 'Avocados aren’t just great-tasting fresh produce items, but they are a nutrient-dense fruit that can be enjoyed throughout the year. Hass avocados are a versatile ingredient with a creamy texture and mild flavor that can be used in many different types of recipes and dishes that are perfect for enjoying at barbecues and outdoor gatherings with friends and family during the summer. Enjoy organic avocados in countless ways that will make those barbecues and gatherings with family and friends even more exciting. Use avocados in flavorful recipes that everybody can share and enjoy while being together outside. Try avocados in individual Mexican food items like tacos or burritos, as part of appetizers like avocado crostini, or in a fresh guacamole or avocado dip so everybody can dip tortilla chips into something delicious. The possibilities are deliciously endless if you need additional food options for barbecues. Not only is an organic avocado a great ingredient to use in numerous ways, but it is also a healthy food that contributes unsaturated “good” fats and almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9. An organic ripe avocado will have a dark green to nearly black skin color, a bumpy skin texture and should yield to gentle pressure without leaving indentations or feeling mushy. Avocados with a slightly bumpy texture should be ripe in 1 to 2 days. They will also be somewhat firm and have a dark green and black speckled color. Once you’ve selected the perfect bag of avocados, you’ll be ready to enjoy all kinds of different healthy foods and recipes for the next time you’re enjoying an outdoor gathering with friends and families.', 'Fresh fruit with a creamy texture and mild flavor Fresh avocados are great for using in tacos, burritos, appetizers, avocado dip and fresh guacamole so that you have delicious food to share and enjoy during barbecues and the summer months A cholesterol free fruit that contains almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9 Hass organic avocados are the lowest sugar fruit and provide unsaturated “good fats” that help absorb Vitamin A, Vitamin D, Vitamin K and Vitamin E Organic ripe avocados will have dark green to nearly black skin color, a bumpy texture and should yield to gentle pressure without leaving indentations', 'Unbranded', 'https://i5.walmartimages.com/asr/fccbe414-7ac5-49ba-8dfd-40f9ee96e683.f4a4225a6944971b127b8b012bf5a987.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fccbe414-7ac5-49ba-8dfd-40f9ee96e683.f4a4225a6944971b127b8b012bf5a987.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fccbe414-7ac5-49ba-8dfd-40f9ee96e683.f4a4225a6944971b127b8b012bf5a987.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259389, 'Marketside Fresh Broccoli Florets, 32 oz', 5.98, '681131122344', 'Add fresh and ready-to-eat broccoli florets to your meal with Marketside Broccoli Florets. These florets are an excellent source of vitamin A and vitamin C. Plus, they\'re easy to prepare! Just place desired amount of vegetables in a microwave safe dish and add one inch of water. Cover with a damp paper towel or plastic wrap and microwave on high for three to four minutes. Serve as is, or add your favorite spices for additional flavor. Add butter and cheese to steamed broccoli to create a tasty side dish. Marketside Broccoli Florets are a quick and delicious side dish and a great addition to any meal. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Fresh Broccoli Florets, 32 oz: Excellent source of vitamins A and C Serve as is, or season with salt, pepper, chili powder or garlic powder for additional flavor Quick and healthy side dish', 'Marketside', 'https://i5.walmartimages.com/asr/28f3e0d9-697b-4327-90f5-497042ebded3_1.dac2593a9c33b9ec08c83dcc0143e5f6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28f3e0d9-697b-4327-90f5-497042ebded3_1.dac2593a9c33b9ec08c83dcc0143e5f6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28f3e0d9-697b-4327-90f5-497042ebded3_1.dac2593a9c33b9ec08c83dcc0143e5f6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259397, 'Fresh Blueberries, 24 oz Container', 6.18, '665290050243', 'Create decadent meals with sweet and light Fresh Blueberries. Enjoy them for breakfast, lunch, dinner, or dessert. Use them to make a lemon and blueberry galette, bake them into delicious blueberry muffins, cook up a sweet and savory pizza topped with blueberries and bacon, or reduce them for a sauce to use on grilled chicken or cheesecake. They contain essential vitamins and nutrients like, vitamin C, vitamin K, antioxidants, and manganese making them perfect for a healthy diet. Prior to serving simply gently wash them with cool water and enjoy the fresh taste. Refrigerate the berries to keep them fresh and ready for use. Pick up a Fresh Blueberry container today and savor the delectable flavor.', 'Fresh Blueberries, 24 oz Container: Best when enjoyed at room temperature Light, refreshing taste Healthy treat Prior to serving gently wash them with cool water Refrigerate your berries in the original container to maintain freshness They should approximately last 3-5 days after purchase Keep dry for optimal freshness', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/77811688-c7bf-403f-802f-831985dc7758_1.16cf6cf228f841d5c565c35925f0cbf9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77811688-c7bf-403f-802f-831985dc7758_1.16cf6cf228f841d5c565c35925f0cbf9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77811688-c7bf-403f-802f-831985dc7758_1.16cf6cf228f841d5c565c35925f0cbf9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259398, 'Fresh Red Potatoes, Each', 0.44, '000000040730', 'These Red Potatoes are a must-have for any pantry. With so many ways to prepare potatoes, you\'ll want to add them to every meal. For breakfast, you could make crispy sliced potatoes smothered in cheese and diced ham or add them to a savory omelet. For lunch or dinner, you could use these fresh potatoes to make au gratin potatoes, garlic mashed potatoes, or roast them with your favorite spices to serve with a juicy steak and rolls. If you\'re hosting a neighborhood get-together, you can use them to add flavor and color to a creamy potato salad. Serve up something delicious when you cook with Red Potatoes.', 'Must-have addition to every pantry Roast them with your favorite spices and serve with a juicy steak Add them to a savory omelet for a mouthwatering breakfast Use them to add color and flavor to your potato salad Explore all the delicious ways to serve these satisfying potatoes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6123387a-ad45-4fd4-ad0a-d712cb5e0a38.fb33c9142ca45aa08dc52db010a12334.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6123387a-ad45-4fd4-ad0a-d712cb5e0a38.fb33c9142ca45aa08dc52db010a12334.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6123387a-ad45-4fd4-ad0a-d712cb5e0a38.fb33c9142ca45aa08dc52db010a12334.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
