INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259402, 'Microwaveable Sweet Potato Whole Fresh, Each', 1.64, '855555002067', 'Make dinner simple and delicious when you serve these Microwave-Ready Sweet Potatoes. Ready to eat in ten to twelve minutes, these whole potatoes are pre-washed and ready to heat up. Simply cook them in the microwave for a satisfying side dish or main course. You can also serve them alongside a tender and juicy steak, a succulent grilled chicken breast or a country-fried pork chop. Convenient and delicious, these sweet potatoes will please the entire family. Serve up something fresh fast and delicious when you bring home Microwave-Ready Sweet Potatoes.', 'Microwave-Ready Sweet Potato, each: Ideal addition to every pantry Cooks in 10-12 minutes Pre-washed & ready to cook Add butter, salt & pepper for a quick side Load it with your favorite toppings for a full meal 8 oz minimum weight Fresh. All natural. No preservatives. Microwavable. Product of USA.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8ccc9cad-cbe4-45ba-9a66-eaac7da18d79.1cb840929bb828ecd979f16ddd831f66.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8ccc9cad-cbe4-45ba-9a66-eaac7da18d79.1cb840929bb828ecd979f16ddd831f66.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8ccc9cad-cbe4-45ba-9a66-eaac7da18d79.1cb840929bb828ecd979f16ddd831f66.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
