INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259410, 'Fresh Sweet Corn on the Cob, 4 Count Tray', 3.47, '894624001136', 'It\'s not truly summer until you\'ve had some Fresh Corn on the Cob. Just add butter and salt. While sweet corn typically invokes images of summer barbeques, it has many health benifits. Sweet corn is a great source of Vitamin A and C, with one ear of corn containing over 10% of the Daily Value (DV) of Vitamin C and over 6% DV of Vitamin A. It\'s not truly summer until you\'ve had some Fresh Corn on the Cob- just add butter and salt! Also known as Maíz empacado, Dura and Makka around the world.', 'Fresh Corn on the Cob, 4 Pack, Sweet gourmet corn on the cob, Husked, field fresh, prewashed, and ready to eat. Low in fat and cholesterol free. Ideal for your next backyard barbecue or summer camp out, May be cooked in the microwave, steamed or boiled. Serve with mashed potatoes, steak and your favorite green. U.S. Fancy Grade. Sweet gourmet corn on the cob Husked, field fresh, prewashed, and ready to eat Low in fat and cholesterol free Ideal for your next backyard barbecue or summer camp out May be cooked in the microwave, steamed or boiled Serve with mashed potatoes, steak and your favorite green U.S. Fancy Grade Fresh Sweet gourmet corn on the cob Husked, field fresh, prewashed, and ready to eat Low in fat and cholesterol free Ideal for your next backyard barbecue or summer camp out May be cooked in the microwave, steamed or boiled Serve with mashed potatoes, steak and your favorite green U.S. Fancy Grade', 'Fresh Produce', 'https://i5.walmartimages.com/asr/54b0dbba-34af-4097-9155-27a08dca29e6.e0fb7ee3bb64792004f0103789cbafd6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/54b0dbba-34af-4097-9155-27a08dca29e6.e0fb7ee3bb64792004f0103789cbafd6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/54b0dbba-34af-4097-9155-27a08dca29e6.e0fb7ee3bb64792004f0103789cbafd6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259411, 'Fresh Celery Stalk, Each', 1.54, '204070000001', 'Promote healthy bones by adding Fresh Celery to your diet. Celery is a low-calorie vegetable that consists mostly of water but is packed full of antioxidants and fiber. Cut off the leafy tops and bulky bottoms and enjoy them as a crisp and healthy snack or chop them up and create a fresh salad with romaine lettuce, carrots, cherry tomatoes, and croutons. They\'re also delicious when stuffed with peanut butter and dried fruit, like raisins and cranberries. Each bite is crunchy, crispy, and full of vitamins and minerals like vitamin K, which is known for helping with bone metabolism and regulating blood calcium levels. Being healthy can be fun, especially with Fresh Celery! Also known as Apio, Qin cai, Karafs and Ajmoda around the world.', 'Fresh Celery, each: Promotes healthy bones Packed full of vitamin K, antioxidants, and fiber Try dipping in a variety of sauces, like peanut butter, hummus, cheese sauce, and salad dressing Add to salads, stir fry, and soup Crispy, crunchy texture Healthy snack option Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/64e099e6-9c88-4516-b6d9-fb081114720d.0c080b0f52c5271fb6f5480eb7ad1759.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/64e099e6-9c88-4516-b6d9-fb081114720d.0c080b0f52c5271fb6f5480eb7ad1759.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/64e099e6-9c88-4516-b6d9-fb081114720d.0c080b0f52c5271fb6f5480eb7ad1759.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259412, 'Mann\'s Snap Pea Sensations Asian Sesame Style Kit, 11.35 oz', 2.38, '716519011092', 'Snap Pea Sensations, Asian Sesame, Bag 10.14 OZ Snap Peas & Topping: 10.1 oz (286 g); Dressing: 1.25 fl oz (37 ml). Sugar snap peas, Asian dressing & sesame seeds. Serve as a cold salad or hot saute. Three generations. Est. 1939. New try me! Complete Kit: Serve hot or cold. Washed & ready to eat. Preservative free. For more information contact us: Mann\'s Customer Service, PO Box 690, Salinas, CA 93902 or call 800-285-1002. veggiesmadeeasy.com. At Mann\'s, We\'re moms creating solutions for moms. Certified WBENC: Women\'s Business Enterprise. Facebook. Twitter. Pinterest. Instagram. YouTube. Dating back to the 1930\'s, farming has been a family business for three generations. We are dedicated to proving the highest quality. Fresh produce. We grow on family-owned farms using sustainable practices & follow strict quality standards. Product of USA. Keep refrigerated. Perishable. Healthy cooking made easy. Simply toss these delicious ingredients together for a quick & easy side dish or meal. Serve hot or cold! Enjoy as a Cold Salad: 1. Pour the pre-washed sugar snap peas into a bowl. 2. Add the Asian dressing and sesame seeds. 3. Toss to coat evenly; serve immediately for best results. Enjoy as a Hot Saute: 1. Pour the pre-washed sugar snap peas into a bowl. 2. Add the Asian dressing. Toss to coat evenly. 3. Preheat a non-stick skillet until hot. 4. Pour the coated sugar snap peas into the skillet and saute quickly - 1 to 2 minutes. 5. Remove from heat. Sprinkle with sesame seeds. 6. For best results serve immediately. Suggestions for Hot & Cold Dishes: Add pre-cooked quinoa or rice. Pair with grilled fish, chicken or beef. Contains soy, wheat. 1 kit Salinas, CA 93901 800-285-1002', 'Snap Pea Sensations Kit, Asian Sesame Snap Peas & Topping: 10.1 oz (286 g); Dressing: 1.25 fl oz (37 ml). Sugar snap peas, Asian dressing & sesame seeds. Serve as a cold salad or hot saute. Three generations. Est. 1939. New try me! Complete Kit: Serve hot or cold. Washed & ready to eat. Preservative free. For more information contact us: Mann\'s Customer Service, PO Box 690, Salinas, CA 93902 or call 800-285-1002. veggiesmadeeasy.com. At Mann\'s, We\'re moms creating solutions for moms. Certified WBENC: Women\'s Business Enterprise. Facebook. Twitter. Pinterest. Instagram. YouTube. Dating back to the 1930\'s, farming has been a family business for three generations. We are dedicated to proving the highest quality. Fresh produce. We grow on family-owned farms using sustainable practices & follow strict quality standards. Product of USA.', 'Mann\'s', 'https://i5.walmartimages.com/asr/ba0fa981-d121-4df5-b46f-6b63f63fc53a_1.70aece7d497d04b8b249f3094e89ab5a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ba0fa981-d121-4df5-b46f-6b63f63fc53a_1.70aece7d497d04b8b249f3094e89ab5a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ba0fa981-d121-4df5-b46f-6b63f63fc53a_1.70aece7d497d04b8b249f3094e89ab5a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51259427, 'Fresh Celery Sticks, 20 oz Bag', 2.96, '073150152233', 'Add flavor and texture to your meals with these Fresh Celery Sticks. This versatile vegetable is ideal for a variety of dishes, whether it\'s for breakfast, lunch, or dinner. Mince some up and put them in your omelet with peppers and ham for a filling and nutritious breakfast. Add them to a healthy salad for lunch or enjoy them with peanut butter and dried fruits for a quick snack. Celery is also a wonderful addition to comforting soups, hearty stews, and crowd-pleasing casseroles. Enjoy the delicious taste of Fresh Celery Sticks any way you prepare them. Also known as Palitos de apio, Karafs and Ajmoda around the world.', 'Adds flavor and texture to your meals Great for breakfast, lunch, or dinner Mince them for an omelet or put them in a salad Enjoy with peanut butter and dried fruits Delicious addition to soups, stews, and casseroles Equivalent to 2 stalks of celery Naturally sweeter and crispier Pre-cut, washed, and ready to eat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7cf2e316-000b-4d96-bdb0-b7e5545ffe28.7fe22eeb04592e2447ffeacf29b12ff1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7cf2e316-000b-4d96-bdb0-b7e5545ffe28.7fe22eeb04592e2447ffeacf29b12ff1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7cf2e316-000b-4d96-bdb0-b7e5545ffe28.7fe22eeb04592e2447ffeacf29b12ff1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (51822900, 'Fresh Minneolas, 3 lb Bag', 3.98, '814683010115', 'Enjoy the fresh sweetness of a Minneola. Sometimes called a tangelo, this citrus fruit is a hybrid of a tangerine and a grapefruit. This unique fruit can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these minneolas to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice them and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. You can also use them to make scrumptious baked goods like muffins, cakes, and tarts. However you choose to use them, fresh Minneolas add flavor to any meal or beverage.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy smoothie Serve with your pancake breakfast Use as a garnish for your favorite cocktail Use to make muffins, cakes, and tarts Available in a 3-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/cb719495-ecde-430f-ac16-f50569418a1d.a680eeba8ecae5cdab9837a2d2939757.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cb719495-ecde-430f-ac16-f50569418a1d.a680eeba8ecae5cdab9837a2d2939757.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cb719495-ecde-430f-ac16-f50569418a1d.a680eeba8ecae5cdab9837a2d2939757.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
