INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (53314544, 'Melissa\'s Sweet Tamarind, 10 oz', 4.97, 'deleted_045255147261', 'Use Melissa\'s Sweet Tamarind for a variety of dishes. It works well in Indian and Middle Eastern cuisine. This fresh tamarind has a sweet and sour pulp. It makes a good seasoning for chutneys and curries. Each fruit is hand-selected to ensure high quality. Try adding it to Worcestershire sauce or make a syrup out of it to flavor your favorite soft drink. This fruit can be stored for a long time when kept in a cool place. It\'s available in a 10 oz bag. Keep it handy in the kitchen to add sweet flavor to your meals or snacks.', 'Melissa\'s Sweet Tamarind, 10 oz: Useful for Indian and Middle Eastern cooking Good for chutneys and curries Melissa\'s tamarind has a sweet and sour flavor Can be used as a seasoning or a syrup for flavoring drinks and food Keeps a long time in a cool place', 'Fresh Produce', 'https://i5.walmartimages.com/asr/aee5f74e-d32e-42b0-9fad-0c9bd3740bd1.94b9a36a6e32fba2f4f3101c9c2f8b30.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aee5f74e-d32e-42b0-9fad-0c9bd3740bd1.94b9a36a6e32fba2f4f3101c9c2f8b30.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aee5f74e-d32e-42b0-9fad-0c9bd3740bd1.94b9a36a6e32fba2f4f3101c9c2f8b30.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
