INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (55014398, 'Fresh Garlic Sleeve, 3 Count', 1.74, '023562080099', 'Take your culinary creations to the next level with fresh, flavorful Garlic. Garlic\'s signature flavors become caramelized and sweeter when cooked, making it a perfect accompaniment to many dishes such as pasta, shrimp, chicken, stews, and more. Garlic also goes great in creamed soups, on all types of roasts, in a variety of egg dishes, or used simply with sauteed or roasted vegetables. To prepare garlic for cooking, you\'ll need to break it up into individual cloves and peel the skin. Once you\'ve done this, you can mince the garlic by chopping it into fine pieces. Spice up your next meal with a tasty clove of fresh Garlic.', 'Fresh garlic Sleeve of 3 bulbs Must-have pantry staple Flavorful addition to a wide variety of recipes Add to pasta, shrimp, chicken, stews, and more Delivers a bold, pungent flavor when eaten raw but transforms into a lightly sweet and buttery flavor when cooked Explore all the delicious ways to add fresh garlic to your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1987f303-5f7b-4250-a4be-15735b797999.ee158276b27318447e0e876cc3b1291b.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1987f303-5f7b-4250-a4be-15735b797999.ee158276b27318447e0e876cc3b1291b.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1987f303-5f7b-4250-a4be-15735b797999.ee158276b27318447e0e876cc3b1291b.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
