INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (55317047, 'Dole California Pitted Dates, 8 Oz Snack', 4.38, '075700045002', 'Picked at the peak of ripeness for maximum sweetness and flavor, our 100% natural dates are great for snacking, baking and anything else you can name under the sun. Rich in nutrients, Dole dried fruit gives you the healthy energy you need to feel refreshed and ready to shine! Grown in the Coachella Valley of California, we use Deglet Noor dates for a uniform taste, size, shape, firmness and light coloring. So we can ensure you get the same delicious, high quality date with every bite, every time. Dole California Whole Pitted Dates, 100% All Natural California Dates, 8 Oz Pouch Naturally sweet California-grown pitted dates Resealable pouch keeps dry dates fresh Dried in warm flowing air & packed for maximum freshness and flavor Naturally cholesterol free Fat free, gluten free and certified non-GMO Use for baking, cooking or enjoy as a snack on their own! Also available in Dole Chopped Dates Learn more about Dole products at dolesunshine.com WHY KIDS & PARENTS CHOOSE DOLE: FIBER-RICH SNACK: Picked at the peak of ripeness for maximum sweetness & flavor, our 100% natural dates are great for snacking, baking & anything else you can name under the sun. GLUTEN FREE: Naturally sweet DOLE Whole Pitted California Dates are a good source of dietary fiber, cholesterol free, and fat free. They\'re also gluten free and great for salads, toppings, baking, and snacking. DELICIOUS CALIFORNIA DATES: With Dole\'s shelf-stable date products, you can have the sweet taste of California Dates anywhere & anytime. For another delicious, dried fruit snack try DOLE California Dates. HEALTHY SNACKS AND JUICES: From packaged shelf stable fruit, to dried fruit, fruit juices, and frozen fruit, Dole is a world leader in growing, sourcing, distributing, and marketing packaged fruit and healthy snacks to brighten your day. REFRESHING FLAVOR: Try the refreshing bright flavor of Dole\'s packed fruit, fruit juice, and other pantry staples in all your favorite recipes!', 'Trail Mix with Dates Enjoy \"fruit chips\" as a healthy and easy-to-take alternative to potato chips Ingredients (6) 1 pkg. (8 oz.) DOLE Dates, Chopped 2 cups whole grain, square-shaped cereal 1 cup whole almonds, toasted 1 cup DOLE Seedless or Golden Raisins 1 cup dried banana chips 1 cup dried apricots, cut in half Directions Combine all ingredients in large bowl. Store in tightly sealed container or zip lock bag. Enjoy 100% All Natural Fruit with Dole: Fruit Bowls | Fruit Juice | Frozen Fruit | Frozen Smoothie Blends | Fruit Fridge Packs | Dried Fruit | Snack Bites | Dole Mixations About Dole: Dole Packaged Foods, LLC, is a world leader in growing, sourcing, distributing and marketing fruit and healthy snacks. Dole sells a full line of packaged shelf stable fruit, frozen fruit, dried fruit and juices. The company focuses on four pillars of sustainability in all of its operations: water management, carbon footprint, soil conservation and waste reduction.', 'Dole', 'https://i5.walmartimages.com/asr/59f8e989-8ca5-4623-9e1a-f364c9d2c9cb_1.4f72ec6bda2ff54fd748bc269bd17d36.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59f8e989-8ca5-4623-9e1a-f364c9d2c9cb_1.4f72ec6bda2ff54fd748bc269bd17d36.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59f8e989-8ca5-4623-9e1a-f364c9d2c9cb_1.4f72ec6bda2ff54fd748bc269bd17d36.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
