INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (100390215, 'Soy Wax Melts (Various Scents)', 41.53, '000000004060', 'Wax melts are scented pieces of wax without a wick. A wax melt can give off a slight scent when cold; however, they are designed to be slowly warmed using a tart or wax warmer. Our wax warmers on our website complements these wonderful scents. Our wax warmers are electric and provide a large aroma Wax melts are very easy to use. You simply take your wax melt and place one or more in your warmer and then turn on your heat warmer. When you are finished using them, you just turn off the warmer and the wax will solidify until you are ready to use it again. When you are ready to use it again, just turn the warmer back on to begin the melting process. When you are ready to dispose of the used wax melts, you just allow the wax to harden, then just allow it to heat for a few minutes to loosen it and it should pop right out. Our wax is safe to throw away without any harm to our environment.', 'Broccoli', 'unknown', 'https://i5.walmartimages.com/asr/6975c4f4-4050-48b0-a7ab-12d9aef71b05_1.e508323f2758d9260355211d7109e4c8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6975c4f4-4050-48b0-a7ab-12d9aef71b05_1.e508323f2758d9260355211d7109e4c8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6975c4f4-4050-48b0-a7ab-12d9aef71b05_1.e508323f2758d9260355211d7109e4c8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
