INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (100674698, 'Fresh Baby Yellow Potatoes, 28oz.', 4.47, '858143004085', 'Yellow Potatoes are hand selected for excellent quality. Firm, well-shaped, and smooth, these potatoes can be cooked in almost any way imaginable. They have a wonderful, buttery texture and flavor when baked, roasted, boiled, steamed, sauteed, or mashed. Feature them in a potato salad or cook them up and serve as a savory side dish to your favorite protein. To preserve the nutrients, leave the skins on and simply scrub gently in water before cooking. Always store potatoes in a cool, well-ventilated area rather than in the refrigerator. Enjoy nutrients, flavor, and all-around deliciousness when you cook up Yellow Potatoe', '4 ounce bag of fresh Honey Gold potatoes Fast and easy prep Triple washed No need to peel Offering naturally creamy textures and buttery sweet flavor Great for every day or gourmet meals', 'Agro', 'https://i5.walmartimages.com/asr/2d3c7ddd-775f-4cdf-9afa-1d79d80aad37.47ca71f24a61781ee07f37884ba4ef7b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2d3c7ddd-775f-4cdf-9afa-1d79d80aad37.47ca71f24a61781ee07f37884ba4ef7b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2d3c7ddd-775f-4cdf-9afa-1d79d80aad37.47ca71f24a61781ee07f37884ba4ef7b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
