INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (100892590, 'Marketside Organic Fresh Broccoli Slaw, 16 oz', 3.77, '681131179430', 'Marketside Organic Broccoli Slaw is packed with a wholesome blend of broccoli, carrots and red cabbage. This crisp medley of USDA approved organic vegetable shreds is packed fresh, washed and ready to eat for your convenience. Use this blend to make our delicious broccoli slaw with raisins recipe located directly on the back of the packaging, or use it to create a brand-new slaw recipe that you and your family will serve for generations to come. Serve this tasty blend with baked chicken and grilled asparagus for a delicious and healthy meal. Dinner sides are made easy with Marketside Organic Broccoli Slaw. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Blend of crisp broccoli, carrots and red cabbage Washed and ready to eat USDA Organic Includes broccoli slaw with raisins recipe 5 servings per container Requires to be kept refrigerated', 'Marketside', 'https://i5.walmartimages.com/asr/0bcb3eac-a7e2-43a7-8b1a-9d387436fc51.59f68144ad3fec0eedd67f3386eb6e36.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0bcb3eac-a7e2-43a7-8b1a-9d387436fc51.59f68144ad3fec0eedd67f3386eb6e36.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0bcb3eac-a7e2-43a7-8b1a-9d387436fc51.59f68144ad3fec0eedd67f3386eb6e36.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (101054749, 'Fresh Cubanelle Peppers, lb', 2.17, '400094251041', 'Cubanelle pepper, a culinary delight! With its narrow, round-tipped shape and vibrant pale to glossy green color, this pepper measures approximately 6-8 inches in length. It is cherished for its sweet and mild flavor. Elevate your dishes with the irresistible taste of the cubanelle pepper - a true culinary gem.', 'Peppers are a great way to add flavor into one\'s diet and lessen the need to add salt. For a more mild, smoky flavor, roast before using. For a fresh, hot flavor, consume raw. refrigerate in its original packaging for up to one week. Wash well before using', 'Unbranded', 'https://i5.walmartimages.com/asr/b14520bb-32ef-4943-a03c-c854e6f7030d.0e9c2b154c902f128e4b7c69bd1ce880.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b14520bb-32ef-4943-a03c-c854e6f7030d.0e9c2b154c902f128e4b7c69bd1ce880.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b14520bb-32ef-4943-a03c-c854e6f7030d.0e9c2b154c902f128e4b7c69bd1ce880.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (101143466, 'Sliced Baby Bella Mushrooms, 8 oz', 2.37, 'deleted_081453618752', 'Experience the fresh taste of our Sliced Baby Bella Mushrooms. Baby bella mushrooms look similar in size and shape to white mushrooms, but they\'re hardier and provide a deeper earthy taste. They are just like the large portabella mushrooms you know and love but have been harvested just a few days before becoming large enough to fit a burger. This means they have that same firm, meaty texture you love about portabella caps, just in a tasty bite-size form. Pre-cleaned and pre-sliced, their hearty, full-bodied taste makes them an excellent addition to beef, wild game, and vegetable dishes. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out our Sliced Baby Bella Mushrooms.', 'Sliced Baby Bella Mushrooms, 8 oz: 8-ounce package of sliced baby bella mushrooms Naturally fat free Cholesterol free Low in calories, carbs and sodium Fresh and all natural Pre-cleaned Natural source of the antioxidant selenium Excellent addition to beef, wild game and vegetable dishes', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/e765cc1a-41e9-4289-89ac-067b6b616291.efaf86c523518e6c4b003a3fb33b65c1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e765cc1a-41e9-4289-89ac-067b6b616291.efaf86c523518e6c4b003a3fb33b65c1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e765cc1a-41e9-4289-89ac-067b6b616291.efaf86c523518e6c4b003a3fb33b65c1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
