INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (102527901, 'Fresh Whole Organic Heirloom Tomato, 1 lb Package', 3.77, '044419310213', 'Enjoy the robust flavor of Fresh Whole Organic Heirloom Tomatoes. These tomatoes feature vibrant colors with sweet, juicy flavor in each bite, making them a versatile ingredient that\'s perfect for a wide range of dishes. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. These organic tomatoes are certified organic, meaning that you can enjoy a healthy, flavorful addition to elevate the taste and texture of any meal. They make an excellent addition to meals or simply enjoy them alone for a healthy and refreshing snack. Bring the fresh and delicious taste of Fresh Whole Organic Heirloom Tomatoes to your kitchen today!', 'Fresh Whole Organic Heirloom Tomato, 1 lb Package Sweet and juicy flavor in every bite Versatile ingredient that\'s perfect for a wide range of dishes Slice them up to garnish a sandwich or burger for added flavor and texture Dice them up to create a pizza or pasta topping Crush them up to make a decadent bruschetta or sauce Finely blend them to create your own personalized salsa USDA certified organic', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
