INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (103397459, 'Fresh Slicing Tomato, 6 Pack', 4.27, '858143004139', 'Create something wholesome and delicious with Tomatoes. These fresh tomatoes are the perfect ingredient for a variety of tasty dishes. Use them to make a decadent tomato sauce for a pasta dish; try slicing them up and pairing with mozzarella cheese, basil and balsamic vinegar; or simply enjoy them on their own as a nutritious snack. They would make a comforting and appetizing tomato soup and a flavorful salsa. You could also slice them up and use them to top burgers and pizza or use them to make a delicious grilled cheese and tomato sandwich. However you choose to use them, these tomatoes will add flavor and taste to any meal. Be sure to add these fresh tomatoes to your Walmart purhase today.', 'Slicing Tomatoes, 6 Count Pack of 3 fresh, whole slicing tomatoes Firm and thick-skinned Large size is perfect for slicing up and garnishing sandwiches and burgers Classic tomato flavor lends itself to a wide variety of recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/d54fc0c1-a72c-453f-9a53-7961df8d9fc9.0960fbc3fd414e71298c1c3bd35b69f8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d54fc0c1-a72c-453f-9a53-7961df8d9fc9.0960fbc3fd414e71298c1c3bd35b69f8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d54fc0c1-a72c-453f-9a53-7961df8d9fc9.0960fbc3fd414e71298c1c3bd35b69f8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
