INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (103562120, 'Fresh Large Heirloom Pumpkin, Whole, Each (Color and Variety May Vary)', 6.88, '892961001215', 'Celebrate the arrival of fall with our Large Heirloom Pumpkins, the perfect blend of beauty and purpose. Each pumpkin is fresh, whole, and uniquely shaped, offering rich colors and textures that transform any space into an autumn showcase. Whether you’re stacking them by a hay bale with bright fall foliage, creating a cozy Thanksgiving centerpiece, or building a playful Halloween scene with scarecrows and cobwebs, these pumpkins bring warmth and charm to your seasonal décor. Unlike ordinary carving pumpkins, heirloom varieties such as Cinderella, Fairytale, and Jarrahdale provide both decorative appeal and culinary value. Their thick, sweet flesh is ideal for homemade pies, soups, and roasted sides—making them as delicious as they are beautiful. Available only during the fall harvest, these pumpkins embody the spirit of the season and add an authentic touch to every autumn celebration.', 'Fresh Autumn Harvest – Whole heirloom pumpkin in unique colors, shapes, and textures (variety may vary from image). Perfect for Décor – Elevates front porch displays, Thanksgiving buffets, and seasonal table centerpieces. Ideal for Stacking - create layered porch displays or tiered centerpiece arrangements Halloween Ready – Arrange with scarecrows, cobwebs, and lanterns for a festive, spooky touch. Heirloom Varieties – Distinctive pumpkins like Cinderella, Fairytale, and Jarrahdale bring storybook charm and heritage flavor. Dual-Purpose Value – Beautiful for decorating and rich in thick, sweet flesh for pies, soups, and roasting. Generous Size – Large, impactful pumpkins that make a statement indoors and outdoors. Seasonal Treasure – A limited-time harvest product available only in the fall—get them while they last.', 'Fresh Large Heirloom Pumpkin', 'https://i5.walmartimages.com/asr/95a721a0-add1-4fc8-9598-d212f571e6ec.ddec8e112381727de01da55e3dd7707f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/95a721a0-add1-4fc8-9598-d212f571e6ec.ddec8e112381727de01da55e3dd7707f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/95a721a0-add1-4fc8-9598-d212f571e6ec.ddec8e112381727de01da55e3dd7707f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
