INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (103796373, 'Fresh Red Seedless Grapes, 3 lbs', 8.47, '033383250786', 'Treat yourself to the delicious, juicy flavor of Fresh Red Seedless Grapes. These grapes are bursting with flavor and are completely seedless. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Fresh Red Seedless Grapes.', 'Fresh Red Seedless Grapes Bag Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ac20bc3f-2c7e-43f8-a259-b6313b4f7d2b_1.f9875210e261388818a4ed495a62d0fc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ac20bc3f-2c7e-43f8-a259-b6313b4f7d2b_1.f9875210e261388818a4ed495a62d0fc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ac20bc3f-2c7e-43f8-a259-b6313b4f7d2b_1.f9875210e261388818a4ed495a62d0fc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (103799684, 'Fresh Whole Grape Tomato, 10 oz Bag', 3.97, '816239013328', 'Fresh Whole Grape Tomatoes are an exciting summer treat, and they\'re the perfect size for skewers, salads and roasting. These bite-sized grape tomatoes look and taste great. Grape tomatoes are a low-calorie treat that are also low in sodium and are a good source of fiber. Whether you are snacking or adding them to your favorite dish. their uses are almost limitless. Try these grape tomatoes with feta cheese, fresh dill, and a drizzle of olive oil for a light and delicious Mediterranean treat. Or make a caprese salad with grape tomatoes, fresh basil, fresh mozzarella, and balsamic vinegar. With 10-ounces of tomatoes in each package, you\'ll have plenty to make mouthwatering meals. Use your imagination to create delicious dishes with Fresh Whole Grape Tomatoes.', 'Fresh Whole Grape Tomatoes, 10 oz Package Perfect size for skewers, salads and roasting Low-calorie, low in sodium, and a good source of fiber Pair with feta cheese, fresh dill, and a drizzle of olive oil for a Mediterranean dish Make a caprese salad with grape tomatoes, fresh basil, fresh mozzarella, and balsamic vinegar', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (103864881, 'Cherry Tomato, 10 oz Package', 2.98, 'deleted_606105112657', 'Bring the fresh, delicious taste of Cherry Tomatoes into your home. Because of their notable flavor and thicker skin, they are a versatile tomato that\'s great for grilling, sauteing, roasting, or baking. Their small size also makes them a quick and simple addition to a fresh salad as well as an excellent finger food for whenever you\'re in the mood for a light snack. Packed with nutrients, cherry tomatoes are a deliciously healthy ingredient that adds both vibrant color and mouthwatering flavor to any recipe. For the best flavor and freshness, store these tomatoes at room temperature on your kitchen counter. Make your next meal a marvelous one with these fresh Cherry Tomatoes.', 'Cherry Tomato, 10 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/39585953-8ae1-4909-a68a-40c3288c87ba.b7af54eb72069bdaca0bd4d3d88f9d2b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39585953-8ae1-4909-a68a-40c3288c87ba.b7af54eb72069bdaca0bd4d3d88f9d2b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39585953-8ae1-4909-a68a-40c3288c87ba.b7af54eb72069bdaca0bd4d3d88f9d2b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
