INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (104073068, 'Fresh Organic Green Grapes, Estimate 2.25 lbs, Bag', 6.97, '681131133739', 'Marketside Organic Green Seedless grapes are the perfect sweet snack that your whole family will enjoy. The fresh grapes are crisp and sweet and make an excellent addition to your breakfast, lunch, dinner or snack. A ¾ cup of grapes contains just 90 calories with no fat, no cholesterol, and virtually no sodium. Grapes are also a good source of Vitamin K and a natural source of antioxidants. This container conveniently contains two pounds of grapes making it easy to have your favorite fruit on hand for everyone in the house.', 'Fresh Organic Green Seedless Grapes Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e251457a-f630-4464-90fb-70778c7258b8_1.230b88422efcf5fbf819fd5fa8bedfa1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e251457a-f630-4464-90fb-70778c7258b8_1.230b88422efcf5fbf819fd5fa8bedfa1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e251457a-f630-4464-90fb-70778c7258b8_1.230b88422efcf5fbf819fd5fa8bedfa1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (104367434, 'Mt. Olive Bread & Butter Garden Salad with Vidalia Onions, 16 fl oz Jar', 2.48, '009300003667', 'Mt. Olive’s Vidalia Bread and Butter Garden Salad 16 fl oz combines your favorite ingredients in one jar creating mouth-watering results. Our beloved bread and butter chips mixed with Vidalia onions and carrots mix together for a delicious bread and butter pickle garden salad you can use as an ingredient in a recipe or alone as a snack or side dish. Our Simply Vidalia Bread and Butter Garden Salad makes a tasty topping for sandwiches, an excellent addition to salads, and wonderful inclusion in a variety of other dishes. Enjoy Mt. Olive’s Vidalia Bread and Butter Garden Salad today! Available in a 16 fl oz. jar.', 'One 16 ounce jar of Mt. Olive Vidalia Bread & Butter Chips Crafted from the Corner of Cucumber and Vine with Mt. Olive\'s exclusive pickle brine Certified Kosher and Vegan Resealable jar that locks in the perfect crunch and crispy flavor Pickled with only the freshest onions and cucumbers straight from the farm The perfect addition to any Hotdog, Hamburger or Salad Refrigerate to ensure freshness', 'Mt. Olive Pickle', 'https://i5.walmartimages.com/asr/1cc4bdca-e54a-4b40-a9c5-667e135d464a_1.1aa984270f3c6bde33621e2b61be7bc7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1cc4bdca-e54a-4b40-a9c5-667e135d464a_1.1aa984270f3c6bde33621e2b61be7bc7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1cc4bdca-e54a-4b40-a9c5-667e135d464a_1.1aa984270f3c6bde33621e2b61be7bc7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (104387879, 'Freshness Guaranteed Whole Brown Mushrooms, 16 oz', 4.67, 'deleted_021706162298', 'Experience the fresh taste of our Whole Organic Brown Mushrooms. Brown Mushrooms give you that same earthy taste you love about mushrooms but take it up a notch with their firm, meaty texture. Similar in size and shape to white mushrooms, Brown mushrooms are hardier and provide a deeper earthy taste. They\'re the same portabella mushrooms you\'ve enjoyed before - they\'ve just been harvested a few days earlier before becoming those large caps you\'ve seen in vegetarian and vegan cuisines. With their hearty, full-bodied taste, brown mushrooms are an excellent addition to beef, wild game, and vegetable dishes. Plus, these whole brown mushrooms are certified USDA Organic, making them a wholesome addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out our Whole Organic Brown Mushrooms.', 'Fresh Whole Brown Mushrooms, 16 oz tray: 16-ounce package of sliced white mushrooms Naturally fat free Cholesterol free Low in calories, carbs and sodium Fresh and all natural Pre-cleaned Natural source of the antioxidant selenium Excellent addition to beef, wild game and vegetable dishes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/75f685b0-5daf-4963-a9a2-e258834dc40f.b07cfd6f55a79891fae7dba36d0e5879.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75f685b0-5daf-4963-a9a2-e258834dc40f.b07cfd6f55a79891fae7dba36d0e5879.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75f685b0-5daf-4963-a9a2-e258834dc40f.b07cfd6f55a79891fae7dba36d0e5879.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
