INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (104504727, 'Taylor Farms Ginger Garlic Stir Fry Kit Packaged Meal, 14 oz', 3.28, '030223041252', 'The Taylor Farms Ginger Garlic Stir Fry Kit allows you to become a first-class stir fry chef in a matter of minutes. An aromatic blend of kale, broccoli, brussels sprouts, Bok choy, cabbage, and carrots paired with a ginger garlic sauce will leave everyone asking for seconds and giving compliments to the chef of course. It cooks in six minutes, so you\'ll have dinner on the table in no time. It\'s dairy-free, nut-free, vegetarian, and vegan. Keep this 14-ounce bag refrigerated until ready to enjoy. Treat the entire family to the delicious taste of Taylor Farms Ginger Garlic Stir Fry Kit.', 'An aromatic blend of kale, broccoli, brussels sprouts, Bok choy, cabbage, and carrots Keep refrigerated 3.5 servings per 14-ounce package 70 calories per serving Ready in 6 minutes Dairy-free, nut-free, vegetarian, and vegan Includes a garlic ginger sauce', 'Taylor Farms', 'https://i5.walmartimages.com/asr/1b57d12d-b3b5-4bdf-a4e7-d3921e293bfa.fe006147c6a6cb13febcc7e53c9061cc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1b57d12d-b3b5-4bdf-a4e7-d3921e293bfa.fe006147c6a6cb13febcc7e53c9061cc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1b57d12d-b3b5-4bdf-a4e7-d3921e293bfa.fe006147c6a6cb13febcc7e53c9061cc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (104604725, 'Slicing Tomato, Each', 2.18, '714548031517', 'Slicing Tomatoes are the leader when it comes to big, yummy, fresh tomatoes. The large size, juicy tomato taste and meaty texture make these tomatoes the perfect choice for slicing up and topping your favorite burger and sandwiches. Use them to make a hearty grilled cheese and tomato sandwich that\'s bursting with flavor. Slice some up and pair with fresh mozzarella, basil, and balsamic vinegar for a delicious appetizer. You can even enjoy a slice topped with a sprinkle of salt and pepper for a fresh, healthy snack. Add Slicing Tomatoes to your fresh produce basket today for a delicious juicy addition.', 'Slicing Tomatoes, Each: Wholesome, versatile, and delicious Large size with a juicy, delicious flavor Meaty texture makes them perfect for slicing Enjoy on burgers, sandwiches and more Enjoy on its own seasoned with salt and pepper as a heathy snack Create a mouthwatering salad or appetizer', 'Fresh Produce', 'https://i5.walmartimages.com/asr/596ed5a2-6558-42d6-9a5b-c318bc9f4ae2.4927131d05c00312cf51744e17e11473.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/596ed5a2-6558-42d6-9a5b-c318bc9f4ae2.4927131d05c00312cf51744e17e11473.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/596ed5a2-6558-42d6-9a5b-c318bc9f4ae2.4927131d05c00312cf51744e17e11473.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (104689162, 'Fresh Produce, Cubanelle Pepper, Pimiento De Cocinar, lb', 0.67, '000000046879', 'Add rich flavor and color to your meals with these fresh Cubanelle Peppers. These versatile peppers are light green in color before they ripen and then turn red once they\'re ripe. The Cubanelle is a mild pepper that may be used much like you would use a bell pepper. Try these peppers stuffed with your favorite ingredients like cheese, sirloin steak, and zesty spices. You could also use them in your next stir fry to add a mild sweetness or even pan fry them and season them for a quick and tasty snack. They are low in calories, and they\'re a great source of vitamins C and A. Fresh Produce, Cubanelle Pepper, Pimiento De Cocinar, lb', 'Mild and sweet Perfect stuffed with your favorite ingredients Try them in your next stir fry Fry and season by themselves for a quick and nutritious snack Low in calories Good source of vitamins A and C', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a102ed08-5558-4082-a09e-52808ee4d408.803492be2ec14b8165519900f65e102b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a102ed08-5558-4082-a09e-52808ee4d408.803492be2ec14b8165519900f65e102b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a102ed08-5558-4082-a09e-52808ee4d408.803492be2ec14b8165519900f65e102b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (104813441, 'Sunset Organic Cocktail Tomatoes, 12 oz Package, Fresh', 5.47, '057836020771', 'SUNSET Organic Cocktail Tomatoes are 12 ounces of flavorful and fresh tomatoes! From salsa to salads, this Organic Cocktail Tomato is the most versatile tomato in the kitchen. The perfect balance of sweetness and acidity, their small size makes them an ideal choice for salads, sauces, appetizers, and more. Hothouse grown to ensure consistent quality and freshness. Certified organic and non-GMO tomatoes grown without pesticides or herbicides. Store at room temperature for optimal flavor, and wash before enjoying. Clamshell packaging makes washing and storing a breeze. Enjoy SUNSET Organic Cocktail Tomatoes all year long.', 'SUNSET fresh Organic Cocktail Tomato Perfectly balanced sweetness and acidity Small size is ideal for salads and appetizers Wash and enjoy Available all-year-long Non-GMO certified Certified organic Hothouse grown to ensure consistent quality and freshness No pesticides or herbicides 12-oz clamshell container makes washing and storing a breeze Store at room temperature for optimal flavor', 'SUNSET', 'https://i5.walmartimages.com/asr/536c0d46-76f3-44f0-bbab-e68d0c59dd1c_1.d35c06395805ec11922ebb51d73195c7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/536c0d46-76f3-44f0-bbab-e68d0c59dd1c_1.d35c06395805ec11922ebb51d73195c7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/536c0d46-76f3-44f0-bbab-e68d0c59dd1c_1.d35c06395805ec11922ebb51d73195c7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
