y salads possible! Our team of food scientists and and agriculture experts are committed to exceeding industry standards so we can guarantee the freshness of our salads, every single day. SmartLabel: Scan for more food information. Tender leaf. Get delicious recipes & more! Questions? Comments? 1-8880-242-5472 or www.freshexpress.com. Product of USA.', 'Fresh Express', 'https://i5.walmartimages.com/asr/71c33aae-f9a8-416d-aae7-3cd1c3bcc2ea.e0b4214d776a3814bda8076543a5e8ac.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71c33aae-f9a8-416d-aae7-3cd1c3bcc2ea.e0b4214d776a3814bda8076543a5e8ac.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71c33aae-f9a8-416d-aae7-3cd1c3bcc2ea.e0b4214d776a3814bda8076543a5e8ac.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
