INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (108556583, 'Elephant Garlic Whole Fresh, Each', 4.28, 'deleted_718940001376', 'Sweet and mild, Fresh Elephant Garlic is terrific for a mild garlic butter with mixed herbs. Elephant garlic bulbs are an excellent source of vitamins E, C, and A. Similar to conventional garlic, elephant garlic also contains allicin, which has been known for its antibacterial properties. Commonly used as a substitute for common garlic in cooking, use elephant garlic when you’re looking for a more subtle garlic flavor. You can sautee elephant garlic, roast it, grill it, or use it raw in salads or dips. These large bulbs, sometimes as large as a man’s fist, are an excellent addition to any home cook’s arsenal. Add the distinctive zing of garlic to your dishes with Fresh Elephant Garlic.', 'Elephant Garlic Per Each', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8b7f762f-60bf-482e-ba11-7fbcc49063b5.d7cd588fc644dbe8ba9e46d36c14b375.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8b7f762f-60bf-482e-ba11-7fbcc49063b5.d7cd588fc644dbe8ba9e46d36c14b375.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8b7f762f-60bf-482e-ba11-7fbcc49063b5.d7cd588fc644dbe8ba9e46d36c14b375.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
