INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (109112488, 'Fresh Roma Tomato, Each', 1.28, '688962361133', 'With Fresh Roma Tomatoes from Walmart, it\'s easy to make a wholesome, delicious meal. Roma tomatoes are a fresh produce ingredient for whipping up a variety of wonderful dishes. You can use them to create a zesty tomato sauce for stirring into a homemade pasta dish, crush them up to make a delightful Roma tomato bruschetta, or simply enjoy them on their own as a nutritious snack or as a party platter option for dipping in your favorite vegetable dipping sauce. If you\'re feeling a classic tomato dish, Roma tomatoes can even lend themselves in making a comforting and appetizing tomato soup or a flavorful salsa. However you choose to use them, each Roma tomato will add stunning flavor to your meal. Just find the recipe and experience the tasty results for yourself! Elevate your recipes with Roma Tomatoes.', 'Roma Tomato, Each: Wholesome, versatile, and delicious Rich, juicy flavor in each bite Ideal ingredient for a variety of dishes Use to make pasta sauce, tomato soup, or fresh salsa Make a tasty pesto or bruschetta to serve at your next dinner party Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2f860752-38f8-43a5-96b7-afda3b890630.59821395b55a4259f90cc71edfa15258.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2f860752-38f8-43a5-96b7-afda3b890630.59821395b55a4259f90cc71edfa15258.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2f860752-38f8-43a5-96b7-afda3b890630.59821395b55a4259f90cc71edfa15258.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
