INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (109482590, 'Fresh Organic Whole White Beech Mushroom, 3.5 oz', 3.98, '037102678707', 'Add flavor and texture to your meals with the Organic Whole White Beech Mushrooms. This versatile ingredient is perfect for a variety of dishes, whether its for breakfast, lunch, or dinner. Mince some up and put them in your omelet with peppers and ham for a filling breakfast. Slice them and add them to a healthy salad for lunch or stuff them with cream cheese, parmesan, and sharp cheddar cheese for a delicious, mouthwatering meal. White mushrooms are an excellent source of riboflavin and are naturally fat-free, cholesterol-free, and are low in calories and sodium. Enjoy the delicious taste of Organic Whole White Beech Mushrooms any way you prepare them.', 'Adds flavor and textures to your meals Great for breakfast, lunch, or dinner Mince them for an omelet, slice them for a salad, or stuff them with cheese Naturally fat-free and cholesterol-free Low in sodium and calories', 'Unbranded', 'https://i5.walmartimages.com/asr/9092a857-197a-4f03-acc1-b68e5b10ecf1.52281570b6d812ca72dda6fce973c461.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9092a857-197a-4f03-acc1-b68e5b10ecf1.52281570b6d812ca72dda6fce973c461.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9092a857-197a-4f03-acc1-b68e5b10ecf1.52281570b6d812ca72dda6fce973c461.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
