INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (111521775, 'Fresh Athena Cantaloupe, Each', 3.28, '689076992596', 'Fresh Athena Cantaloupe is a high-sugar melon with a delectable flavor enhanced with honeyed nuances. Athena melons have a sweet and floral flavor that is well suited for fresh and cooked meals. They are great added to a cheese plate, tossed into an herb-based salad or eaten freshly cut. Cut it into small pieces and put it in a fresh salad along with chicken, cucumbers, tomatoes, and a light dressing. You can even use this sweet cantaloupe to make a refreshing summer cocktail, a spreadable jam, or a light sorbet. Enjoy the sweet and juicy taste of Fresh Athena Cantaloupe.', 'Fresh Athena Cantaloupe, Each Flavorful addition to many recipes Enjoy on its own or add to a mixed fruit salad Add to your fresh garden salad High sugar content A great source of potassium and vitamin C Sweeter taste and more fragrant than other melons', 'Fresh Produce', 'https://i5.walmartimages.com/asr/59aad4b7-b020-47cc-b7b7-3c85277229ce.6d58d83c48301f60e92519256dd3a3fe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59aad4b7-b020-47cc-b7b7-3c85277229ce.6d58d83c48301f60e92519256dd3a3fe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59aad4b7-b020-47cc-b7b7-3c85277229ce.6d58d83c48301f60e92519256dd3a3fe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (111731346, 'Fresh Organic Bosc Pears, 2 lb, Bag', 4.98, '888289402506', 'Introducing the sweet and juicy Fresh Bosc Organic pear, known for its distinct elongated shape and brownish-golden skin. This versatile fruit is perfect for snacking, cooking, and baking. Its firm flesh holds up well under heat, making it the ideal ingredient for pies, tarts, and baked goods. Enjoy the subtle honey-like flavor of the Organic Bosc pear in a 2lb Bag in salads or sliced with your favorite cheese. Fill your fruit basket with the delicious and nutritious Bosc pear today.', 'This package includes 2 lbs of pears, each with a distinctive brownish-yellow skin and a long, tapered neck. The flesh of the Organic Bosc Pear is dense and juicy, with a sweet and spicy flavor that is perfect for eating fresh or cooking. These pears are certified organic, which means that they are grown without the use of synthetic pesticides, fertilizers, or genetically modified organisms (GMOs). Organic Bosc Pears are a good source of fiber, vitamin C, and antioxidants, and are a healthy and flavorful addition to any diet. With their unique taste and appearance, Organic Bosc Pears are a premium choice for pear lovers who value organic and sustainable farming practices. The flesh of the Organic Bosc Pear is dense and juicy, with a sweet and spicy flavor that is perfect for eating fresh or cooking. These pears are certified organic, which means that they are grown without the use of synthetic pesticides, fertilizers, or genetically modified organisms (GMOs). Organic Bosc Pears are a good source of fiber, vitamin C, and antioxidants, and are a healthy and flavorful addition to any diet. With their unique taste and appearance, Organic Bosc Pears are a premium choice for pear lovers who value organic and sustainable farming practices. These pears are certified organic, which means that they are grown without the use of synthetic pesticides, fertilizers, or genetically modified organisms (GMOs). Organic Bosc Pears are a good source of fiber, vitamin C, and antioxidants, and are a healthy and flavorful addition to any diet. With their unique taste and appearance, Organic Bosc Pears are a premium choice for pear lovers who value organic and sustainable farming practices.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5d196224-2231-471f-936c-8e469e3939e0_1.093fc731528375e86c28ce931fa79eae.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d196224-2231-471f-936c-8e469e3939e0_1.093fc731528375e86c28ce931fa79eae.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d196224-2231-471f-936c-8e469e3939e0_1.093fc731528375e86c28ce931fa79eae.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (111835793, 'Yellow Squash, 2 Pack', 1.57, '711069541143', 'Yellow Squash is an extremely versatile vegetable that is a must-have for every cook. This yellow squash is rich in vitamin C, so you know you\'re getting a wholesome vegetable. You can prepare the squash in many different ways. Sauté it with butter and serve with your choice of protein, like pork chops or grilled chicken breast. You can slice it and fry it up Southern-style, or you can incorporate it into a casserole for a little comfort food. For a sweet treat use the squash to bake a decadent lemon and yellow squash muffins, you can through in some blueberries for a fresh addition. The culinary possibilities are endless with Yellow Squash.', 'Fresh, versatile ingredient Sauté it with butter, slice it and fry it up Southern-style, or bake into sweet lemon and yellow squash muffins Rick in vitamin C Wash before use and use within 2-3 days of opening', 'Fresh Produce', 'https://i5.walmartimages.com/asr/981cb5fe-eb0c-4954-adcc-c4a004043213_1.e7342e4945605edb54577accf3314284.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/981cb5fe-eb0c-4954-adcc-c4a004043213_1.e7342e4945605edb54577accf3314284.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/981cb5fe-eb0c-4954-adcc-c4a004043213_1.e7342e4945605edb54577accf3314284.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
