INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (112030832, 'Milpas Japones Whole Chile Pods, 3 Oz', 1.64, '074734184145', 'Milpas Japones Whole Chile Pods offer an authentic taste of Mexican culinary tradition. These whole dried Japones chiles are known for their mild to medium heat and distinct, slightly fruity flavor, making them a versatile ingredient in a wide range of dishes. The 3 oz package provides a convenient amount for home cooks looking to add a touch of authentic spice and depth to their meals. Perfect for crafting traditional salsas, marinades, or infusing oils, these chile pods can also be rehydrated and incorporated into stews and braises. Their whole form allows for controlled flavor release, and they are a staple for anyone seeking to explore or recreate authentic Mexican flavors. Elevate your cooking with the simple yet impactful addition of Milpas Japones Whole Chile Pods.', 'Authentic Japones whole chile podsMild to medium heat level, perfect for various dishes3 oz package for convenient useAdds a distinct flavor and subtle spiceIdeal for sauces, marinades, stir-fries, and traditional Mexican cuisine', 'Milpas', 'https://i5.walmartimages.com/asr/1d2cb315-75f4-47c0-b694-3e6df18accfc.bb0e67b9789460945e019f1e25432b88.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1d2cb315-75f4-47c0-b694-3e6df18accfc.bb0e67b9789460945e019f1e25432b88.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1d2cb315-75f4-47c0-b694-3e6df18accfc.bb0e67b9789460945e019f1e25432b88.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
