INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (112244005, 'Fresh Valencia Oranges, 4 lb Bag', 7.57, '605049510895', 'Orange Valencia is a variety of orange that is highly sought after for its sweet and juicy flavor. Named after the city of Valencia in Spain, where it is believed to have originated, this orange has become popular worldwide for its exceptional taste and vibrant color. The fruit is medium-sized with a smooth and slightly pebbled skin that is easy to peel. Its bright orange hue is a visual delight, adding a touch of sunshine to any fruit bowl. The flesh of the Orange Valencia is tender, succulent, and bursting with tangy-sweet juice.', 'Orange Valencia is a variety of orange that is highly sought after for its sweet and juicy flavor. Named after the city of Valencia in Spain, where it is believed to have originated, this orange has become popular worldwide for its exceptional taste and vibrant color. The fruit is medium-sized with a smooth and slightly pebbled skin that is easy to peel. Its bright orange hue is a visual delight, adding a touch of sunshine to any fruit bowl. The flesh of the Orange Valencia is tender, succulent, and bursting with tangy-sweet juice.', 'Sunkist', 'https://i5.walmartimages.com/asr/4967e330-10dc-4669-acb2-401efa61a63d.c5824c6c3b0f1240b36d09393c76904d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4967e330-10dc-4669-acb2-401efa61a63d.c5824c6c3b0f1240b36d09393c76904d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4967e330-10dc-4669-acb2-401efa61a63d.c5824c6c3b0f1240b36d09393c76904d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
