INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (112614055, 'Fresh Organic Brown Sliced Mushrooms, 8 oz', 3.88, '678286889000', 'Experience the fresh taste of Organic Brown Sliced Mushrooms. If you\'re looking for a traditional mushroom with a mild earthy taste, brown mushrooms are just what you need. Versatile and meaty, these mushrooms are a great addition to any meal. Pre-cleaned and sliced, they are perfect for adding to stir-fries, sauces, soups, pizzas, salads, and stews to create culinary works all your own. They are free of fat and cholesterol and are low in calories and sodium. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out Organic Brown Sliced Mushrooms.', '8-ounce package of organic brown sliced mushrooms Naturally fat-free Cholesterol-free Low in calories, carbs and sodium Fresh and all natural Natural source of the antioxidant selenium Great for salads, pizzas, and much more', 'Unbranded', 'https://i5.walmartimages.com/asr/9845e302-060b-4a1e-ac36-9fd1e741f660_4.989f447e486395f3bfa28d1f6b935ab0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9845e302-060b-4a1e-ac36-9fd1e741f660_4.989f447e486395f3bfa28d1f6b935ab0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9845e302-060b-4a1e-ac36-9fd1e741f660_4.989f447e486395f3bfa28d1f6b935ab0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
