INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (113108793, 'Fresh Slicing Tomato, 3 Pack', 2.5, '057836655812', 'Create something wholesome and delicious with 4pk tomatoes. These fresh tomatoes are the perfect ingredient for a variety of tasty dishes. Use them to make a decadent tomato sauce for a pasta dish; try slicing them up and pairing with mozzarella cheese, basil and balsamic vinegar; or simply enjoy them on their own as a nutritious snack. They would make a comforting and appetizing tomato soup and a flavorful salsa. You could also slice them up and use them to top burgers and pizza or use them to make a delicious grilled cheese and tomato sandwich. However you choose to use them, these tomatoes will add flavor and taste to any meal. Be sure to add these fresh tomatoes to your Walmart purhase today.', 'Slicing Tomatoes, 4 Count: Pack of 4 whole slicing tomatoes Firm and thick-skinned Large size is perfect for slicing up and garnishing sandwiches and burgers Classic tomato flavor lends itself to a wide variety of recipes Delicious base for making salsas, soups, sauces, and more', 'Sunset Grown', 'https://i5.walmartimages.com/asr/66a57190-3844-4a00-8135-3466bbfce8b0.d49d3461c8a0b731cc67c52cceea0bb9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/66a57190-3844-4a00-8135-3466bbfce8b0.d49d3461c8a0b731cc67c52cceea0bb9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/66a57190-3844-4a00-8135-3466bbfce8b0.d49d3461c8a0b731cc67c52cceea0bb9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
