INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (113706232, 'Fresh Blueberries, 2 lb Box', 6.94, '812049006246', 'Create decadent meals with sweet and light Fresh Blueberries. Enjoy them for breakfast, lunch, dinner, or dessert. Use them to make a lemon and blueberry galette, bake them into delicious blueberry muffins, cook up a sweet and savory pizza topped with blueberries and bacon, or reduce them for a sauce to use on grilled chicken or cheesecake. They contain essential vitamins and nutrients like, vitamin C, vitamin K, antioxidants, and manganese making them perfect for a healthy diet. Prior to serving simply gently wash them with cool water and enjoy the fresh taste. Refrigerate the berries to keep them fresh and ready for use. Pick up Fresh Blueberries today and savor the delectable flavor.', 'Fresh Blueberries, 2 lb Box: Best when enjoyed at room temperature Light, refreshing taste Healthy treat Prior to serving gently wash them with cool water Refrigerate your berries in the original container to maintain freshness They should approximately last 3-5 days after purchase Keep dry for optimal freshness', 'Unbranded', 'https://i5.walmartimages.com/asr/95dcb6db-b793-4da5-8bdc-f0884cc337fc.aa761c55c1ab1460c3451fbc379b662a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/95dcb6db-b793-4da5-8bdc-f0884cc337fc.aa761c55c1ab1460c3451fbc379b662a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/95dcb6db-b793-4da5-8bdc-f0884cc337fc.aa761c55c1ab1460c3451fbc379b662a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (113716180, 'Gefen Organic Vacuum Pack Beets, 17.6 Oz', 4.93, '710069011014', 'Gefen Organic Vacuum Pack Beets offer a convenient and healthy way to enjoy this nutritious root vegetable. Sourced from organic farms and vacuum-sealed to preserve their natural flavor and vibrant color, these beets are ready to be incorporated into your favorite meals. Their tender texture and earthy taste make them a versatile addition to salads, grain bowls, or as a simple, delicious side dish. Perfect for busy households and health-conscious consumers, Gefen\'s organic beets eliminate the need for peeling and cooking from scratch. They are a staple in many Eastern European and Kosher cuisines, often enjoyed pickled, roasted, or mashed. Whether you\'re preparing a traditional borscht or a modern beet salad, these ready-to-eat beets provide exceptional quality and convenience.', 'Certified organic beets, vacuum-sealed for freshnessConvenient 17.6 oz packageTender, earthy flavor and vibrant colorReady to eat, perfect for salads and side dishesVersatile ingredient for various culinary creations', 'Gefen', 'https://i5.walmartimages.com/asr/0a9405f5-63eb-4849-9de2-debcc156ac9f_1.c00291e6af5df99f138f828e0ef756a8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0a9405f5-63eb-4849-9de2-debcc156ac9f_1.c00291e6af5df99f138f828e0ef756a8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0a9405f5-63eb-4849-9de2-debcc156ac9f_1.c00291e6af5df99f138f828e0ef756a8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
