INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (114189769, 'Fresh Organic Blueberries, 6 oz Container', 2.67, '899062002264', 'Fresh Blueberries are a delightful and nutritious treat that brings a burst of flavor to any dish. These plump and juicy berries are picked at the peak of freshness, ensuring a sweet and tangy taste that is hard to resist. Perfect for snacking, baking, or adding to your favorite recipes, these blueberries are a versatile fruit that can be enjoyed in countless ways. Whether you sprinkle them on top of your morning cereal, blend them into a smoothie, or bake them into a delicious pie, Fresh Blueberries are sure to satisfy your cravings for a healthy and delicious snack.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blueberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blueberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blueberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these blue gems into your baking endeavors, whether it\'s muffins, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blueberries delicious, but they also offer an array of health benefits. Loaded with antioxidants, vitamins, and dietary fiber, blueberries are known to promote heart health, support brain function, and boost the immune system. They are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blueberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blueberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/738b6006-e4bb-41a7-bd14-5a4e7adf1b24.0925ca0c47211b0a3a12fb1897566002.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/738b6006-e4bb-41a7-bd14-5a4e7adf1b24.0925ca0c47211b0a3a12fb1897566002.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/738b6006-e4bb-41a7-bd14-5a4e7adf1b24.0925ca0c47211b0a3a12fb1897566002.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
