INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (116598552, 'Fresh Ugli-uniq Fruit, Each', 1.68, '204459000004', 'Experience the exotic taste of the Caribbean with our fresh Ugli-Uniq fruit, a unique and delectable citrus variety from Jamaica. This fruit boasts an easy-to-peel skin, making it perfect for on-the-go snacking. With its delightful blend of sweet and tangy flavors, it adds a tropical twist to salads and recipes. Ideal for health enthusiasts, it is rich in Vitamin C and supports a balanced diet. Discover the distinct bumpy exterior that sets it apart from other fruits. Try it today for a refreshing tropical indulgence that brings the taste of the tropics to your table, simply irresistible!', 'Ugli-Uniq Fruit Unique Appearance: Ugli-Uniq Fruit has a distinctive, rough, and bumpy exterior that\'s unlike any other fruit. High in Vitamin C: Ugli-Uniq Fruit is an excellent source of vitamin C, making it a great addition to a healthy diet. Sweet and Tangy Flavor: Enjoy the perfect balance of sweet and tangy flavors in every bite. Easy-to-Peel: Convenient for snacking and culinary use. Food Condition: Fresh and ready to eat. Imported from Jamaica: Authentic Caribbean taste.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/baefe933-2874-4c8a-bf2a-5b544ac4a6b2_1.7e76110c509aa345797ba03c7a4be1b3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/baefe933-2874-4c8a-bf2a-5b544ac4a6b2_1.7e76110c509aa345797ba03c7a4be1b3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/baefe933-2874-4c8a-bf2a-5b544ac4a6b2_1.7e76110c509aa345797ba03c7a4be1b3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
