INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (117174014, 'Fresh Peras (Pears) Anjou, 3 lb Bag, Sweet', 8.97, '400094308042', 'Introducing the Anjou Pears – a bag of fresh, full and organic produce! Bursting with flavor, these sweet delights are carefully made with organic ingredients to ensure optimal quality. Whether you’re looking for a healthy snack or want to add some fruity goodness to your favorite meals, these Anjou Pears are perfect for you. Satisfy your cravings and enjoy the natural sweetness that nature has to offer with every bite!', 'Organic Anjou pears are a classic variety grown using organic farming practices, ensuring they are free from harmful chemicals and pesticides. They have a sweet, juicy flavor and smooth, firm texture that makes them a versatile ingredient in a variety of dishes - Certified organic, they are non-GMO and free from synthetic fertilizers and pesticides. High in dietary fiber and vitamin C, making them a healthy snack option. The 3lb bag size is convenient for families and individuals looking for a larger supply of fresh pears - Organic Anjou pears are harvested at their peak ripeness and carefully packed to ensure maximum freshness and flavor. They have a long shelf life and can be stored in the refrigerator for up to 2-3 weeks. Organic Anjou pears are available year-round, making them a reliable choice for any occasion. Find these in your local stores!', 'Fresh Peras', 'https://i5.walmartimages.com/asr/3d896424-8396-449b-a52e-d7cc4ab59073.d62f3e8ee1a90b3756728a940d4e21d7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3d896424-8396-449b-a52e-d7cc4ab59073.d62f3e8ee1a90b3756728a940d4e21d7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3d896424-8396-449b-a52e-d7cc4ab59073.d62f3e8ee1a90b3756728a940d4e21d7.jpeg?odnHeight=450&odnWidth=450&odnB