INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (119752152, 'Fresh USDA Organic Blackberries, 6 oz. Container', 4.16, '852990008098', 'The sweet, juicy flavor of Fresh Blackberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes or yogurt, bake them into mouthwatering blackberry cobbler, mix them with other fruit for a light and flavorful salad, or add them to a creamy smoothie. They contain essential vitamins and nutrients like vitamin C, fiber, potassium, vitamin K and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them with cool water and enjoy the fresh taste. Refrigerate the berries to keep them fresh and ready for use. Pick up a Fresh Blackberry container today and savor the delectable flavor.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blackberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blackberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blackberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these tasty gems into your baking endeavors, whether it\'s cobblers, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blackberries delicious, but they also offer an array of health benefits. Loaded with vitamins and dietary fiber, blackberries are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blackberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blackberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/cc59ff3c-2e82-477b-b73e-0381bac00fac_1.8cea8b96440dc796935f0ad4bc140919.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc59ff3c-2e82-477b-b73e-0381bac00fac_1.8cea8b96440dc796935f0ad4bc140919.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc59ff3c-2e82-477b-b73e-0381bac00fac_1.8cea8b96440dc796935f0ad4bc140919.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (119856351, 'Fresh Cherimoya, Each', 5.27, '000000042574', 'Indulge in the sweet and tangy taste of cherimoya, a tropical fruit from south America. our fresh cherimoya is carefully selected to ensure optimal flavor and texture. enjoy it as a healthy snack or add it to your favorite recipes for a burst of exotic flavor.', 'Item Type: Assembly Heater Defrost 115V Unique Flavor: Cherimoya has a sweet and slightly tangy flavor, often described as a combination of pineapple, strawberry, and banana. Creamy Texture: Enjoy the creamy and smooth texture of Cherimoya, similar to a pear. Rich in Antioxidants: Cherimoya is rich in antioxidants, which can help protect against free radicals and support overall health. Exotic and Rare: Cherimoya is a rare and exotic fruit, making it a unique addition to your fruit bowl.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/485a0081-e1aa-41f3-9992-19e2c9bc6f9b.2cc3a8305928ba55b4d40dfea95b7895.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/485a0081-e1aa-41f3-9992-19e2c9bc6f9b.2cc3a8305928ba55b4d40dfea95b7895.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/485a0081-e1aa-41f3-9992-19e2c9bc6f9b.2cc3a8305928ba55b4d40dfea95b7895.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
