INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (122699969, 'Fresh Apple Granny Smith, 1 Lb Package', 1.97, '400094435090', 'Our Granny Smith fresh apples are a delightfully tart and crunchy treat. With their bright green skin and firm flesh, they\'re perfect for snacking or adding a refreshing twist to your favorite recipes. These apples are packed with fiber, vitamins, and antioxidants, making them a healthy choice for anytime indulgence. Enjoy the deliciously tangy taste and characteristic juicy crunch of our fresh Granny Smith apples today.', 'Granny apples are a classic and beloved apple variety that has been a staple in kitchens for generations. These apples are known for their tart flavor and crisp texture, making them perfect for baking in pies, crisps, and other desserts. They are also a popular choice for making homemade applesauce and apple cider. Granny apples are an excellent source of dietary fiber and vitamin C, making them a healthy snack option that can be enjoyed anytime. Our Granny apples are carefully selected and picked at the peak of their freshness to ensure maximum flavor and quality. With their distinct flavor and versatility, Granny apples are a must-have for any apple lover\'s pantry. Whether you\'re a seasoned baker or simply enjoy the classic taste of a tart apple, Granny apples are sure to become a favorite in your household. Give them a try and discover why they have been a beloved apple variety for generations.', 'Unbranded', 'https://i5.walmartimages.com/asr/b5e97858-b90e-43cb-9c32-25734ddf948d.acc09060e7faa2752339ab01bcdfbb5f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b5e97858-b90e-43cb-9c32-25734ddf948d.acc09060e7faa2752339ab01bcdfbb5f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b5e97858-b90e-43cb-9c32-25734ddf948d.acc09060e7faa2752339ab