INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (126839909, 'Premium Injecto Snap On Hard Shell Case for Samsung DoubleTime - Blue/ White', 5.83, '033383110561', 'Looking for a case that protects your phone without adding bulk then this is the perfect solution for all of your worries. It fits like second skin to your phone and protect it from scratches, dust, drops and keep your phone new. The case has all required cut outs to charge, listen to music without removing.', 'The new Blue/ White Amzer Injecto Snap On Case is designed specifically for your Samsung DoubleTime, hugging every curve. Made of lightweight yet durable plastic material, it will safeguard your Samsung DoubleTime without adding extra bulk. So say good-bye to accidental bumps and scratches on your Samsung DoubleTime. Exact cutouts allow speedy access to critical controls. Protecting your new gadget has never been this easy. Get your Injecto Snap On Case for your Samsung DoubleTime today! Product Features: Made of lightweight yet durable Hard Plastic material. Perfect to showcase your device. Precise Cutouts for Charging, Audio. Charge, Listen to music without removing case Provide best protection from bumps and dust Easy Installation and Removal', 'Amzer', 'https://i5.walmartimages.com/asr/730a8993-0c66-40bf-83be-53ebbf3f4229_1.7a7fc5953f79acabe6ca2a3cc2e39a97.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/730a8993-0c66-40bf-83be-53ebbf3f4229_1.7a7fc5953f79acabe6ca2a3cc2e39a97.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/730a8993-0c66-40bf-83be-53ebbf3f4229_1.7a7fc5953f79acabe6ca2a3cc2e39a97.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (127000582, 'Fresh Red Pears, 1 lb Bag', 2.97, '405530349702', 'Indulge in the naturally sweet and juicy flavor of our whole Red Pear fruit! Our fresh produce is carefully picked and delivered straight to your doorstep. Our Red Pears are picked at peak ripeness for delicious, refreshing taste. Enjoy the pure, unadulterated goodness in every bite with no artificial colors or preservatives added. Perfect for snacking or adding to salads. Order yours today and taste the difference!', 'Red pears are a unique variety known for their striking red skin and sweet, juicy flavor. They have a tender, buttery texture that makes them ideal for eating fresh or using in cooking and baking. High in dietary fiber and vitamin C, making them a healthy snack option. The 3lb bag size is convenient for families and individuals looking for a larger supply of fresh pears - Red pears are harvested at their peak ripeness and carefully packed to ensure maximum freshness and flavor. They have a long shelf life and can be stored in the refrigerator for up to 2-3 weeks. Red pears are available seasonally, making them a special treat to enjoy during their peak harvest time.', 'Unbranded', 'https://i5.walmartimages.com/asr/28d00e39-19b9-4fcc-bc6c-9f99a6e17cf6.64c61c830ea98646824d6cb3e2d8e72a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28d00e39-19b9-4fcc-bc6c-9f99a6e17cf6.64c61c830ea98646824d6cb3e2d8e72a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28d00e39-19b9-4fcc-bc6c-9f99a6e17cf6.64c61c830ea98646824d6cb3e2d8e72a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (127073635, 'Fresh Strawberries, 4 lb Container', 7.98, '071430011065', 'The sweet, juicy flavor of Fresh Strawberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. They contain essential vitamins and nutrients like, vitamin C, dietary fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Fresh Strawberries today and savor the delectable flavor.', 'Prior to serving gently wash them and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b99dc93e-639c-48ef-8848-989e0463bbe4_1.a7c565756d8c3b1110392ae7bffa42dc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b99dc93e-639c-48ef-8848-989e0463bbe4_1.a7c565756d8c3b1110392ae7bffa42dc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b99dc93e-639c-48ef-8848-989e0463bbe4_1.a7c565756d8c3b1110392ae7bffa42dc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
