INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (130970827, 'Fresh Red Plumcot, Each, Whole', 0.76, '895009002519', 'Fresh Plumcots are the perfect blend of flavor and texture of a plum and an apricot. There are more than 20 different plumcot varieties, each one with its own distinct appearance, color, and size. You can use them as a substitute in recipes with plums for a sweet twist. Bake a mouthwatering plumcot cake, plumcot and blueberry crisp, or roast them with honey and goat cheese for a decadent dish. Enjoy it as is as a healthy snack, add it to your lunch for a healthy side, or pack multiple and take on a picnic with friends and family. Enjoy the delicious flavor of Fresh Plumcots.', 'Fresh Plumcots, Each Enjoy it as is as a healthy snack, add it to your lunch for a healthy side, or pack multiple and take on a picnic More than 20 different plumcot varieties Use as a substitute in recipes using plums Bake a mouthwatering plumcot cake, plumcot and blueberry crisp, or roast them with honey and goat cheese Perfect blend of a plum and an apricot Find this in your local Walmart!', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2ab51fef-1649-445e-9feb-a3fde91f698e.c20a5939ea1b87d9589b70a7d31c4002.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2ab51fef-1649-445e-9feb-a3fde91f698e.c20a5939ea1b87d9589b70a7d31c4002.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2ab51fef-1649-445e-9feb-a3fde91f698e.c20a5939ea1b87d9589b70a7d31c4002.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (131164824, 'Fresh Valencia Orange, Each', 1.37, '400094287675', 'Enjoy the juicy goodness of Fresh Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Fresh Oranges add flavor to any meal or beverage.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast', 'China Valencia', 'https://i5.walmartimages.com/asr/cd81a81a-1a3f-4aca-8a8b-2270ca30443b.0fcb013b5071e2419f934364c85b0e5a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cd81a81a-1a3f-4aca-8a8b-2270ca30443b.0fcb013b5071e2419f934364c85b0e5a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cd81a81a-1a3f-4aca-8a8b-2270ca30443b.0fcb013b5071e2419f934364c85b0e5a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
