INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (131454366, 'Fresh Rambutan, 12 oz', 4.97, '037842037680', 'Fresh Rambutan brings a burst of tropical sweetness to your table with its juicy, mildly tart flavor and exotic appeal. This unique fruit has a soft, translucent flesh that\'s easy to peel and enjoy, revealing a refreshing taste similar to lychee or grapes. The seed in the center can even be cooked and eaten, adding versatility to your kitchen creations. Perfect for snacking, fruit salads, or party platters, rambutan makes a colorful and fun addition to any occasion. Add a touch of the tropics to your day with Fresh Rambutan.', 'Fresh Rambutan, 12 oz Sweet and mildly acidic tropical fruit with juicy flesh Easy to peel to enjoy the soft, refreshing inside Seed in the center can be cooked and eaten Great for fruit salads, desserts, or snacking Vibrant, eye-catching fruit ideal for entertaining Also known as Hairy Lychee around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/392edd21-1311-4e90-8ab4-a2d4e49bd34a.f57f876be1f72078125ae14ff5b0e6a4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/392edd21-1311-4e90-8ab4-a2d4e49bd34a.f57f876be1f72078125ae14ff5b0e6a4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/392edd21-1311-4e90-8ab4-a2d4e49bd34a.f57f876be1f72078125ae14ff5b0e6a4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
