INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (131871565, 'Van Zyverden Grape Seedless Himrod (1 Dormant Bare Plant Root) Full Sun, Green, Woody Perennial', 6.88, '030641780542', 'Grow your own fresh fruit! Grape Seedless Himrod Dormant Plant Root is the perfect addition to your edible garden that will reap benefits for years to come! Grapevines are deciduous, woody perennial plants. Plant in Full Sun. Grapes will grow in a variety of soils. Grapes are excellent when used as an ornamental and can be trained onto arbors, or on pergolas to provide a unique addition to the landscape. Once established, care consists entirely of annual pruning and picking the fruit. Grapes contain antioxidants that may help prevent heart disease and some cancers. Grapes are also an excellent source of vitamins A, C, and K. Grapes need deep, well-drained, loose soil with pH levels 5.5 to 6.5. Add 2-3\" of mulch to maintain soil moisture. Pruning is important. Don\'t be afraid to remove at least 90% of the previous season\'s growth when vines are dormant.', 'Van Zyverden Grape Seedless Himrod Woody Perennial Plant in full sun Grow your own fruit Garden to table freshness! Harvest when vines are dormant Excellent source of vitamins A, C, and K GMO Free Can be eaten fresh or used to make wine, jam, juice, or raisins', 'Van Zyverden', 'https://i5.walmartimages.com/asr/19353b71-aebb-45f0-9876-89aa1dcb0d46.9cbe63d5718beae6931a59f26e23074a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19353b71-aebb-45f0-9876-89aa1dcb0d46.9cbe63d5718beae6931a59f26e23074a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19353b71-aebb-45f0-9876-89aa1dcb0d46.9cbe63d5718beae6931a59f26e23074a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
