INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (133838470, 'Sabra Spicy Guacamole 8 oz', 5.38, '040822012225', 'Sabra Spicy Guacamole is coming in hot to your summer parties this year. Our authentic recipe combines ripe, hand-scooped, Mexican-grown Hass avocados, fresh jalapenos, fragrant cilantro, and tangy lime juice. This fiery chunky guacamole dip tastes just like homemade but is easy to store until serving. Sabra Spicy Guacamole dip is the ultimate avocado spread for anyone looking to turn up the flavor on gluten-free chips, tacos, quesadillas, and more. Whether you\'re enjoying summer fun by the pool, Memorial Day, or July 4th celebrations, it won\'t be long before Sabra Spicy Guacamole becomes the snacking staple at every summer event. In addition to Spicy Guacamole, Sabra offers chunky guacamole dip in a variety of irresistible flavors, including Classic, Classic With Lime, and Mexican Street Corn Inspired. The Classic Guacamole and Spicy Guacamole are also available in convenient on-the-go singles. For a fast, delicious breakfast, try Sabra Breakfast Avocado Toast, a creamy avocado dip made with Hass avocados and served alongside crispy whole wheat bread, or Sabra Snackers for a quick bite to eat. No matter the occasion, Sabra has a snack for you.', 'Our chunky, homestyle guacamole (made with ripe avocado, fragrant cilantro, tangy lime juice, and tomato) gets extra heat from jalapeño peppers. Saba Spicy Guacamole is served best with tortilla chips, tacos, and more for summer entertaining and BBQs. Made with ripe, hand-scooped, Mexican-grown Hass avocados (see product image for list of ingredients). Vegetarian; Kosher; GMO-free', 'Sabra', 'https://i5.walmartimages.com/asr/7d95af19-2d49-4e00-a447-4fc03847839c.55f624d36bb1a1f640d19a0aff253595.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7d95af19-2d49-4e00-a447-4fc03847839c.55f624d36bb1a1f640d19a0aff253595.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7d95af19-2d49-4e00-a447-4fc03847839c.55f624d36bb1a1f640d19a0aff253595.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (133856205, 'Fresh Clementines, 1 Each', 0.44, '000000044509', 'Enjoy the juicy goodness of citrus when you eat a Clementine. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, clementines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, clementines are now available year-round in most markets. Clementines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, clementines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Clementines on hand for an easy, healthy treat.', 'Sweet & Juicy Flavor Naturally sweet with a pleasing sweet-tart balance, perfect for snacking. Easy to Peel Thin, loose skin makes them simple and mess-free to enjoy. Seedless Typically seedless for a smooth, fuss-free eating experience. Compact & Portable Ideal for lunchboxes, gym bags, or road trips healthy and travel-friendly.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/36ab60a4-249e-4602-8802-93ef8e98e468.70e4e1db9a9564f67c41cbf669561a78.webp?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/36ab60a4-249e-4602-8802-93ef8e98e468.70e4e1db9a9564f67c41cbf669561a78.webp?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/36ab60a4-249e-4602-8802-93ef8e98e468.70e4e1db9a9564f67c41cbf669561a78.webp?odnHeight=450&odnWidth=450&odnBg=ffffff');
