INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (134382335, 'Fresh Apple Braeburn, 5 lb Bag', 4.92, '033383087399', 'Fresh Apple Braeburn, 5 lb Bag is a pack of fresh and juicy apples that are perfect for snacking or baking. These apples are known for their sweet and tangy flavor, crispy texture, and vibrant red and green skin. They are carefully handpicked and packed to ensure their freshness and quality. Whether you\'re making a pie or just need a healthy snack, Fresh Apple Braeburn, 5 lb Bag is the ideal choice.', 'Fashion Sleeve Pouch for your 7 Inch Samsung Galaxy Tab A 2016, Samsung Galaxy J Max, Samsung Galaxy Tab 3 Lite 7.0, Samsung Galaxy Tab 4 7.0 is Tough enough to protect your tablet yet stylish to take everywhere you go. The high-grade and highly durable neoprene is water resistant and offers advanced protection from bumps, scratches and dust. And the smooth, non-scratch interior lining offers enhanced screen protection while your device is tucked away. Ideal for any tablet or e-book up to 7.75 inches, this no-bulk case easily slides into your bag, briefcase or backpack and perfect for those of you on the go. This Sleeve is compatible for most Tablets or Netbooks upto 7.75 inch. This pouch can accommodate your Samsung Galaxy Tab A 7.0 2016, Samsung Galaxy J Max, Samsung Galaxy Tab 3 Lite 7.0, Samsung Galaxy Tab 4 7.0. Product Features: Constructed of shock-absorbing & weather resistant neoprene material Non-abrasive material lines interior securing your device for safe travel and storage Slim and lightweight design provides low-profile protection against every day wear and tear Stylish exterior graphic and Dual zippers make accessing your device quick and easy', 'Unbranded', 'https://i5.walmartimages.com/asr/a2731ef5-32e9-4e85-8feb-748b2fb78bb5.bf99906400182e7f876d75c78b05c271.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://