INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (136520613, 'Fresh Fuyu Persimmons, 2 LB Bag', 4.24, '847081000686', 'Fuyu persimmons are a sweet, crisp treat with a vibrant orange hue and a delicate honey-like flavor. Unlike other varieties, they can be enjoyed firm or soft, making them versatile for snacking, salads, and desserts. Packed with fiber, vitamins, and antioxidants, Fuyu persimmons are a delicious and nutritious addition to your seasonal fruit selection. Available in a 2 lb bag.', 'Non-Stringy: Fuyu Persimmons are known for their non-stringy flesh, making them a great choice for eating fresh or using in recipes. Seasonal Availability: Fresh Fuyu Persimmons are available from September to February, making them a great winter treat Sweet and Juicy: Fuyu Persimmons are known for their sweet and juicy flesh, perfect for snacking or baking. Percinnamon Pouch 2lb', 'Fresh Produce', 'https://i5.walmartimages.com/asr/dca81229-099c-403a-a93c-978ccbe0d1c8_2.a4f326d1d6ca3335514c641adc65b3a0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dca81229-099c-403a-a93c-978ccbe0d1c8_2.a4f326d1d6ca3335514c641adc65b3a0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dca81229-099c-403a-a93c-978ccbe0d1c8_2.a4f326d1d6ca3335514c641adc65b3a0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (136640966, 'Sunkist Lil Snappers Granny Smith, 3 Lb.', 7.97, '741839005971', 'Granny Smith apples are available as Lil Snapper organics! Granny Smith Apples get their name from its founder, Mrs. Maria Ann (Granny) Smith. The variety has a solid green exterior with a greenish to yellowish-white, fine-grained flesh. The taste is mildly sweet with a tart after taste, which sweetens in storage. Today, Granny Smith is one of the most well-known apple varieties around. Firm with strong tartness resembling that of a lemon; this famously green apple is bound to make your mouth water!', 'Sunkist Lil Snappers Granny Smith 3 Lb', 'Lil Snappers', 'https://i5.walmartimages.com/asr/ca4295ce-ba18-4f7c-9436-03f061163d66_1.a294c511e738575ea58bfd076fbce897.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ca4295ce-ba18-4f7c-9436-03f061163d66_1.a294c511e738575ea58bfd076fbce897.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ca4295ce-ba18-4f7c-9436-03f061163d66_1.a294c511e738575ea58bfd076fbce897.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
