INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (138129120, 'Fresh Paula Apples, Each', 1.27, '000000041577', 'Tamarind is a tangy and sweet fruit with numerous health benefits. It is versatile and can be used in a variety of dishes. Our tamarind is fully matured, hand-picked, and sun-dried to ensure maximum flavor and quality. Its distinct taste is perfect for adding a zing to your cooking and is an essential ingredient in many international cuisines. Try our tamarind today and experience its unique taste and benefits.', 'Paula apples are a unique and delicious variety with a sweet flavor and firm texture. These apples are perfect for snacking, baking, and cooking, and their distinct taste sets them apart from other apple varieties. They are also an excellent source of dietary fiber and vitamin C, making them a healthy addition to any diet. Our Paula apples are carefully selected and packed at the peak of their freshness to ensure maximum flavor and quality. Whether you\'re enjoying them on their own, using them in a recipe, or sharing them with friends and family, Paula apples are sure to impress with their delicious taste and satisfying crunch. Perfect for foodies and apple enthusiasts looking for a unique and flavorful apple variety, Paula apples are a must-try for anyone who loves apples.', 'Fresh', 'https://i5.walmartimages.com/asr/845043ea-5f53-4195-a994-3ea4d314c425.eb2eb37e071be719c64a1b4e1ef5d58b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/845043ea-5f53-4195-a994-3ea4d314c425.eb2eb37e071be719c64a1b4e1ef5d58b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/845043ea-5f53-4195-a994-3ea4d314c425.eb2eb37e071be719c64a1b4e1ef5d58b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
