INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (140304102, 'Fresh Dragon Fruit, Each', 4.97, '405509651621', 'Dragon fruit, also known as pitaya, is a vibrant tropical fruit native to Central America. Recognizable for its bright pink or yellow, spiky skin and creamy pulp filled with tiny seeds, it offers a subtly sweet taste reminiscent of kiwi or pear. Dragon fruit is a nutritional powerhouse, providing high amounts of fiber, vitamin C, essential minerals, and antioxidants. Grown on a climbing cactus, this refreshing fruit is harvested when its skin color fully develops, offering a unique and healthful treat.', 'Dragon fruit, also known as pitaya, is a tropical fruit that belongs to the cactus family. Native to Central America but now grown all over the world, dragon fruit is known for its unique appearance, vibrant color, and a wealth of health benefits. The fruit has a leathery, slightly leafy skin that is bright pink or yellow in color, while the inside boasts a sweet, creamy pulp dotted with tiny, crunchy seeds. Appearance and Taste: Dragon fruit stands out for its flamboyant appearance, with its bright pink or yellow, spiky skin, and white or red flesh speckled with small black seeds. The taste of dragon fruit is subtly sweet and often compared to that of a kiwi or pear, with the seeds providing a satisfying crunch. Its texture is wonderfully juicy and creamy, making it a refreshing treat on a hot day. Health Benefits: Dragon fruit is a nutritional powerhouse, packed with a range of beneficial compounds. It\'s high in fiber, vitamin C, and several essential minerals like iron and magnesium. Dragon fruit is also rich in antioxidants, which help fight off free radicals and prevent cell damage. Moreover, it contains prebiotics, which promote the growth of beneficial bacteria in your gut, contributing to a healthy digestive system. Cultivation and Harvest: Dragon fruit grows on a cactus plant that climbs up trees or walls with the help of its aerial roots. It thrives best in a dry tropical climate with a moderate amount of rain. The fruit is harvested when its skin color changes from bright green to pink or yellow, depending on the variety. Despite its exotic appearance, dragon fruit is easy to eat; simply slice it in half and scoop out the flesh with a spoon.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f528e325-51fe-44d1-a17f-2f9ff63f1713.6010e393face2dfefaa3560054b8f514.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f528e325-51fe-44d1-a17f-2f9ff63f1713.6010e393face2dfefaa3560054b8f514.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f528e325-51fe-44d1-a17f-2f9ff63f1713.6010e393face2dfefaa3560054b8f514.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (141113501, 'Fresh Navel Orange, Each', 1.37, '405536998607', 'Enjoy the juicy goodness of Fresh Navel Oranges (China Nebo). A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these navel oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Fresh Navel Oranges add flavor to any meal or beverage', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes Use as a garnish for your favorite cocktail', 'China Nebo', 'https://i5.walmartimages.com/asr/d4d3c917-dcc2-4ea4-bc0a-bf037237336a.95d3da224dc1740c5facfa2b1ac56481.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d4d3c917-dcc2-4ea4-bc0a-bf037237336a.95d3da224dc1740c5facfa2b1ac56481.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d4d3c917-dcc2-4ea4-bc0a-bf037237336a.95d3da224dc1740c5facfa2b1ac56481.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (141199612, 'Fresh Ginger Gold Apples, 5 lb Tote', 1.68, '681131124195', 'Our ginger gold apples are the perfect addition to your fresh produce selection. With whole and organic ingredients, these apples provide a delicious and healthy snacking option. Enjoy the crisp sweetness and tangy flavor of these juicy fruits as a snack, in a salad or baked dish. They are sure to impress your taste buds and are a great source of essential nutrients.', 'The Ginger Gold Fresh Apples have a crisp and juicy texture with a sweet and slightly tart flavor. They are great for eating fresh, adding to salads, or using in baking recipes . The 5 lb Tote provides a convenient and cost-effective way to stock up on these delicious apples . Listed apple varieties are rich in fiber, vitamins, and antioxidants, making them a healthy snacking option. They are also versatile and can be used in a variety of recipes, from sweet to savory. Whether you prefer the sweet and tart flavor of Ginger Gold Apples or the firm and sweet taste of Fuji Apples, both varieties offer a delicious and nutritious addition to your diet.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5deaecab-4f69-4029-b8be-5c2a3f8f0a5e_1.62a68d0b698540fc3e7be86b9e3ce9f2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5deaecab-4f69-4029-b8be-5c2a3f8f0a5e_1.62a68d0b698540fc3e7be86b9e3ce9f2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5deaecab-4f69-4029-b8be-5c2a3f8f0a5e_1.62a68d0b698540fc3e7be86b9e3ce9f2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
