INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (142505318, 'Organic Personal Sized Seedless Watermelon, Each', 4.18, '033383402697', 'Enjoy the sweet, refreshing taste of an Organic, Personal Seedless Watermelon. Watermelons are great for breakfast, lunch, dessert, or when you want a snack. Watermelon is a good source of vitamin C, vitamin A, and potassium making them an excellent healthy treat. Cut the watermelon into chunks for a quick snack, infuse it with water for a refreshing drink, or chop it up and make a mouthwatering watermelon salad with feta and mint. This watermelon is great for sharing with friends and family or keep it for yourself. Bring it to your next cookout or get it as a sweet after dinner treat with friends.', 'Juicy and fresh organic personal watermelon Enjoy on its own or add to a mixed fruit salad Serve at your next neighborhood barbecue Get creative and make a watermelon cocktail or a refreshing sorbet Explore all the delicious ways to add fresh organically grown watermelon to your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a4354248-7204-46da-9c9a-16085000fec5.e50fa8651db9c595777b69a457922483.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a4354248-7204-46da-9c9a-16085000fec5.e50fa8651db9c595777b69a457922483.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a4354248-7204-46da-9c9a-16085000fec5.e50fa8651db9c595777b69a457922483.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
