INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (151443931, 'Fresh Grapefruit, Each', 11.97, '032601502508', 'Grapefruit is the perfect balance between tart and sweet. The balance between tart and sweet is great for both savory and sweet dishes any time of day. Enjoy half of a grapefruit sprinkled with sugar with some eggs in the morning for a light, sweet breakfast. Slice it up and put in a salad with spinach, avocado, and red onion topped with a mustard and balsamic vinegar dressing for lunch or dinner. Make delicious grapefruit bars that showcase the sweet and tartness of this versatile fruit. For an adult recipe juice the grapefruit and pair with some simple syrup and alcohol for a refreshing cocktail. This fruit is the perfect addition to a healthy diet as it is a great source of vitamin C and vitamin A. With such versatility, Grapefruit will become a pantry staple in your home.', 'Great for both savory and sweet dishes Enjoy it for breakfast, lunch, dinner, or dessert Enjoy half a grapefruit sprinkled with sugar in the morning, slice it up and put it in salad for lunch or dinner, or make grapefruit bars Great source of vitamin C and vitamin A', 'Unbranded', 'https://i5.walmartimages.com/asr/4ddf5bd9-20aa-483f-858a-8e7b636989e4.422b7ae9ad103680a1fb86e708b34815.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4ddf5bd9-20aa-483f-858a-8e7b636989e4.422b7ae9ad103680a1fb86e708b34815.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4ddf5bd9-20aa-483f-858a-8e7b636989e4.422b7ae9ad103680a1fb86e708b34815.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (151762086, 'Fresh Honeycrisp Apples, 3 lb Bag', 5.46, '033383088044', '3 lb bag of Honeycrisp apples — fresh, crisp, and juicy. Crisp. Juicy. Perfectly sweet. Bite into the ultimate apple experience with Honeycrisp apples — loved for their refreshing crunch and balanced sweet-tart flavor. Each bite bursts with juice, making them an irresistible favorite for snacking, baking, and salads alike. Hand-picked at peak ripeness, these Honeycrisp apples deliver farm-fresh quality in every 3 lb bag. Great for families, lunchboxes, and meal prep. Crisp and juicy texture with a sweet, refreshing flavor. Perfect for snacking, salads, and baking. Good source of fiber and vitamin C. Hand-picked for peak ripeness and freshness. Enjoy chilled for a refreshing snack. Slice into salads for extra crunch and sweetness. Pair with peanut butter or cheese for a healthy combo. Bake into pies, crisps, or muffins for homemade treats.', 'Crisp, juicy Honeycrisp apples with sweet-tart flavor 3 lb bag—perfect for families, snacks, and meal prep Fresh, hand-picked apples for premium quality and taste Great for healthy snacks, lunchboxes, salads, and baking Naturally high in fiber and vitamin C Perfect balance of sweetness and crunch in every bite Ideal for apple pies, crisps, tarts, and caramel apples Farm-fresh Honeycrisp apples picked at peak ripeness Great value and freshness from Walmart Produce', 'Marketside', 'https://i5.walmartimages.com/asr/fc711cde-aa4a-49c2-8870-1d909354b78e.fd77ae610969e9058336736a4e65f7fd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fc711cde-aa4a-49c2-8870-1d909354b78e.fd77ae610969e9058336736a4e65f7fd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fc711cde-aa4a-49c2-8870-1d909354b78e.fd77ae610969e9058336736a4e65f7fd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (151988482, 'Disney Frozen II Tri-Color Seedless Table Grapes, 3 Lb', 5.98, '814326010298', 'Frozen II Tri-Color Grapes are seedless for your convenience and deliver a pleasantly refreshing taste in every bite. These California Grown grapes have a firm crisp texture with a sweet mild grape flavor. Grapes that are naturally high in vitamins and low in calories. Enjoy them as or use as an ingredient in sweet and savory dishes. Use them sliced in salads, pies, tarts, chicken salad, veggie wraps and more. They can also be frozen and whipped into an instant sorbet or smoothie for a refreshing frozen treat. Tri-Color grapes can be paired with soft texture cheeses, olives and charcuteries for an easy appetizer. They are great for health conscious individuals as they are high in natural antioxidant qualities that can help boost overall health. They are also a nutrient dense fruit that is low in calories. This container comes with three pounds of grapes making it easy to stock up on your favorite fruit. Enjoy fresh from the farm flavors with Frozen II Tri-Color Seedless Grapes. Before eating wash grapes under cool running water for about 30 seconds to a minute. To ensure freshness store grapes in refrigerator at 32-34 degrees. You can also freeze grapes to enjoy for a refreshing, nutritious frozen treat.', 'Disney Frozen II Tri-Color Seedless Table Grapes, 3 Lb', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b1f2a83c-8e76-4172-9601-0c825760f101_1.ab3da40a7ff7541a83315b4a624ee104.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b1f2a83c-8e76-4172-9601-0c825760f101_1.ab3da40a7ff7541a83315b4a624ee104.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b1f2a83c-8e76-4172-9601-0c825760f101_1.ab3da40a7ff7541a83315b4a624ee104.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
