INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (152592177, 'Fresh Granny Apple, 5 lb Bag', 5, '033383001555', 'Our Granny Smith apples are a delightfully tart and crunchy treat. With their bright green skin and firm flesh, they\'re perfect for snacking or adding a refreshing twist to your favorite recipes. These apples are packed with fiber, vitamins, and antioxidants, making them a healthy choice for anytime indulgence made with organic ingredients. Enjoy the deliciously tangy taste and characteristic juicy crunch of our fresh Granny Smith apples today.', 'Apple Granny is a classic apple variety known for its tart and tangy flavor, firm texture, and versatility in cooking and baking. Each Apple Granny is medium to large in size, with a round shape and a green background that is often streaked with red. The flesh of the Apple Granny is crisp and juicy, with a tart and acidic taste that is balanced by a subtle sweetness. This apple variety is perfect for making pies, sauces, and baked goods, but can also be enjoyed as a healthy snack. Apple Granny apples are a good source of fiber, vitamin C, and antioxidants, and are a nutritious and flavorful addition to any diet. With their distinctive taste and texture, Apple Granny apples are a popular choice for apple lovers and foodies alike.', 'Unbranded', 'https://i5.walmartimages.com/asr/aaf26660-1a7d-4f4b-961a-b07f9cd94ad7_1.4ad07051fe63abcc9eccdda62639a1f4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aaf26660-1a7d-4f4b-961a-b07f9cd94ad7_1.4ad07051fe63abcc9eccdda62639a1f4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aaf26660-1a7d-4f4b-961a-b07f9cd94ad7_1.4ad07051fe63abcc9eccdda62639a1f4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
