INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (157005099, 'Fresh Organic Peaches, 2 lb Bag', 5.66, '683953001449', 'Discover the delightful sweetness of Fresh Organic Peaches. Enjoy them on their own as a sweet snack or use them in a variety of recipes. For breakfast, you could slice them to put into your oatmeal or use them to make a delicious yogurt parfait. You can also use these organic peaches in several baking recipes including a comforting crisp topped with ice cream, a tasty upside-down cake, or a scrumptious tart. You can even use them to make a jam or a smooth sorbet. However you choose to use them, their sweet flavor will bring a smile to everyone\'s face. Treat the family to the irresistible taste of Fresh Organic Peaches.', 'Fresh Organic Peaches, 2 lb Bag Sweet and juicy organic peaches Enjoy on their own as a satisfying snack Use in a variety of baking recipes Make a tasty jam or a smooth sorbet Ideal snack to take to work or on a road trip', 'Fresh Produce', 'https://i5.walmartimages.com/asr/248fc84d-1607-415c-955e-788cd596d218.03af188de26b138b710defbe4b5c566c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/248fc84d-1607-415c-955e-788cd596d218.03af188de26b138b710defbe4b5c566c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/248fc84d-1607-415c-955e-788cd596d218.03af188de26b138b710defbe4b5c566c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
