INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (157184028, 'Fresh Bosc Pears, 3 lb Bag', 5.47, '033383300511', 'The fresh Bosc Pear is a one-of-a-kind fruit. Featuring a 3 Lb Bag, the Pear white flesh that is slightly firmer and denser than other pears, this unique winter variety are widely used for baking, broiling, or poaching. With subtle notes of cinnamon and nutmeg, this flavorful pear is a great choice for baking as well; try baking these pears with walnuts and honey or creating a bosc pear crumble with brown sugar, rolled oats, cinnamon, and butter. Pears are also known to have great health benefits, as they include a wide variety of nutrients like folate, vitamin C, copper, and potassium. No matter how you enjoy, Bosc Pears are sure to leave your taste buds satisfied.', 'Fresh Bosc Pears, 3 lb Bag Sweet, crisp, and juicy Excellent snacking pear Make a creamy smoothie or a nutritious juice blend Add to your salad for extra crunch and flavor Adds flavor to a variety of recipes Make pear butter or poached pears Make sweet desserts like pear cobbler, pear crisp or pear tarts', 'Fresh Produce', 'https://i5.walmartimages.com/asr/3ca70784-4dfc-40c9-8f42-f0c4155d8c5f.fa3bb306d71ddf06055217909b92cc62.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3ca70784-4dfc-40c9-8f42-f0c4155d8c5f.fa3bb306d71ddf06055217909b92cc62.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3ca70784-4dfc-40c9-8f42-f0c4155d8c5f.fa3bb306d71ddf06055217909b92cc62.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
