INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (157250373, 'Marketside Pineapple, 16 oz Tray', 4.97, '681131180467', 'Enjoy the sweet, tropical flavor of Marketside Pineapple. These precut chunks are great for breakfast, lunch, dessert, or when you want a snack. Pineapple is a good source of vitamin C, vitamin A and vitamin B6 making them an excellent healthy treat. You can eat the chunks right out of the container, infuse them with water and mint for a refreshing drink, or chop them up and make a mouthwatering pineapple salsa with jalapenos, tomatoes, and red onion. With 16-ounces in each container, this pineapple is great for sharing with friends and family or keep it for yourself. It comes in a closable container to help maintain freshness. Bring home Marketside Pineapple today for a refreshing, healthy treat. Marketside provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Marketside item.', 'Marketside Pineapple 16 oz Comes in a re-closable container to help maintain freshness Great for breakfast, lunch, dessert, or when you want a snack No preservatives, artificial colors or artificial flavors Convenient and portable Share with friends and family or keep for yourself Make a fruit bowl topped with whipped cream or a yogurt parfait Enjoy on their own or in a variety of recipes', 'Marketside', 'https://i5.walmartimages.com/asr/f4376da2-1090-4847-b1f1-5cee6e1af8ba.fa5e9b190849ba0a897c8f83347a6021.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f4376da2-1090-4847-b1f1-5cee6e1af8ba.fa5e9b190849ba0a897c8f83347a6021.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f4376da2-1090-4847-b1f1-5cee6e1af8ba.fa5e9b190849ba0a897c8f83347a6021.jpeg?odnHeight=4