INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (157381791, 'Fresh Organic Granny Smith Apples, 3 lb Pouch', 5.84, '033383009889', 'Treat yourself to the delicious, crisp taste of Marketside Organic Granny Smith Apples. These apples are known for their bright green skin speckled with faint white spots, bright white and crisp flesh, and tart, acidic yet subtly sweet flavor. Enjoy one with breakfast or lunch or as a fresh snack any time of day. Best of all, these delicious apples hold up well when cooked and can be used in both savory and sweet dishes. They are a favorite of pie bakers and can be used for snacking, salads, pairing, or made into a delicious sauce that pairs perfectly with pork. Try incorporating them into soups and compotes or use them to make yummy jam or juice. Use them to create apple crisp, pie, and strudel for a sweet treat. You can even pair them with sharp cheeses and crackers to create a stunning appetizer cheese board to share with guests. The possibilities are endless with Marketside Organic Granny Smith Apples. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to delivering freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Bright green skin speckled with faint white spots Bright white, crisp flesh USDA organic Tart, acidic yet subtly sweet flavor Can be enjoyed fresh or cooked into both savory and sweet dishes Meets or exceeds U.S. Extra Fancy Minimum diameter: 2.25\"', 'Marketside', 'https://i5.walmartimages.com/asr/c74d3488-a852-4732-8b5a-e937cb442670.bb2aaa079cec891fbfdc9463d0dc023a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c74d3488-a852-473