INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (161861341, 'Fresh Cantaloupe, Each', 2.5, '405544695017', 'Treat yourself to the refreshing flavor of a fresh Cantaloupe. Enjoy this tasty melon on its own as a healthy snack or incorporate it into a variety of delicious recipes. For breakfast, you can make a sweet fruit bowl with sliced cantaloupe, strawberries, pineapple, and kiwi. For an extra special treat, top with a dollop of whipped cream. Cut it into small pieces and put it in a fresh salad along with chicken, cucumbers, tomatoes, and a light dressing. You can even use cantaloupe to make a refreshing summer cocktail, a spreadable jam or a light sorbet. Enjoy the sweet and juicy taste of fresh Cantaloupe.', 'Ideal addition to every kitchen Flavorful addition to many recipes Enjoy on its own or add to a mixed fruit salad Add to your fresh garden salad Get creative & make a cantaloupe cocktail or a refreshing sorbet Explore all the delicious ways to add fresh cantaloupe to your favorite recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/cf901ec3-9e25-4e79-ab8b-296b6e94d3e6.aa2c19f4402d076204c6eead51241c30.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cf901ec3-9e25-4e79-ab8b-296b6e94d3e6.aa2c19f4402d076204c6eead51241c30.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cf901ec3-9e25-4e79-ab8b-296b6e94d3e6.aa2c19f4402d076204c6eead51241c30.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
