INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (166239443, 'Fresh Manzana (Apples) Jonagold, 1 lb, Package, Sweet', 1.68, 'deleted_400094433478', 'Looking for the perfect apple? Fresh Jonagold apples are a sweet, juicy, and versatile option for all your snacking and baking needs. With a crisp texture and a balanced flavor, these apples are perfect for pies, tarts, and other baked goods. Their beautiful blend of red and yellow skin makes them an attractive addition to any fruit basket or decorative display. Enjoy the delicious taste of Jonagold apples today!', 'Jonagold apples are a hybrid variety, combining the best features of Jonathan and Golden Delicious apples. They have a sweet and tangy flavor with a crisp texture, making them a versatile apple for a variety of uses. High in dietary fiber, vitamin C, and antioxidants for a healthy snack option - Great for baking and cooking, retaining their shape and flavor when heated. Jonagold apples are available year-round, making them a reliable choice for any occasion. They have a long shelf life and can be stored for several months when kept in a cool, dry place.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/71cd183d-aa98-4033-bd3f-05428a1a4215.a650133cdb53a8bb5908c7d0e9a67b14.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71cd183d-aa98-4033-bd3f-05428a1a4215.a650133cdb53a8bb5908c7d0e9a67b14.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71cd183d-aa98-4033-bd3f-05428a1a4215.a650133cdb53a8bb5908c7d0e9a67b14.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
