INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (174250135, 'Star Fruit, 10 oz container', 6.97, '400094287880', 'The Star Fruit, in a 10 oz container, is a tropical wonder that will transport your taste buds on a journey to paradise. This unique fruit, also known as carambola, is aptly named for its distinctive star-shaped appearance. Grown in lush, sun-drenched orchards, the Star Fruit boasts a vibrant yellow color and a smooth, waxy skin. Its unique shape and bright hue make it a visually striking addition to any fruit display or recipe. When you slice into the Star Fruit, you\'ll be greeted with a sight that is as beautiful as it is delicious. Each slice reveals a perfect star shape, making it a stunning addition to fruit salads, desserts, or even cocktails. But it\'s not just the appearance that makes the Star Fruit special. The taste is truly something to savor. With a flavor profile that is a delightful blend of sweet and tangy, the Star Fruit offers a refreshing burst of tropical goodness. Its juicy flesh is crisp and succulent, leaving a lingering citrusy note on your palate. Perfectly ripened and carefully selected, the 10 oz container of Star Fruit ensures that you\'ll have plenty to enjoy. Whether you\'re indulging in a healthy snack, creating a tropical-inspired dish, or simply wanting to experience the exotic flavors of the tropics, the Star Fruit in a 10 oz container is a delicious and visually stunning choice.', 'Carambola', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/59f9a143-ba57-4e06-8f3d-3eda0c4b8419.40034ea258fba271104e368f9940c918.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59f9a143-ba57-4e06-8f3d-3eda0c4b8419.40034ea258fba271104e368f9940c918.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59f9a143-ba57-4e06-8f3d-3eda0c4b8419.40034ea258fba271104e368f9940c918.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (174311984, 'WHOLLY GUACAMOLE Homestyle, 8 oz', 3.38, '616112278680', 'Need a little flavor in your day? We have an easy way to make your meals OMGuac! WHOLLY GUACAMOLE Homestyle Guacamole contains precut chunks of 100% Hass avocados with diced veggies to give you that homemade taste without any of the hassle. Dip it with veggies and pretzels. Top it on burgers and salads. Spread it on sandwiches and wraps. Love it! Every meal of the day (and some in between!). Goodbye mayo, hello Guac! Dip it, top it, spread it, love it. WHOLLY GUACAMOLE is a trademark of Avomex, Inc.', 'That homemade taste without the hassle of tricky avocados America’s #1 selling refrigerated guacamole Keep refrigerated 50 calories per serving No Preservatives added and gluten free', 'WHOLLY GUACAMOLE', 'https://i5.walmartimages.com/asr/1a1624bf-00e9-4395-9a6f-6524862cb843_1.cabf369b117a45811436156b4ddb2efe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1a1624bf-00e9-4395-9a6f-6524862cb843_1.cabf369b117a45811436156b4ddb2efe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1a1624bf-00e9-4395-9a6f-6524862cb843_1.cabf369b117a45811436156b4ddb2efe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
