INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (175768727, 'Missing Key Attributes : This title includes key attributes such as \'food condition\', but is missing others such as \'flavor notes\'.', 5.47, '033383300054', 'Treat yourself to the delicious, sweet taste of Fresh Anjou Pears.Enjoy one with breakfast or lunch or as a fresh snack any time of day. Best of all, these delicious pears have a dense flesh that holds up well when cooked. They can be used for baking, snacking, salads, pairing, or made into a delicious sauce that pairs perfectly with pork. Try incorporating them into soups and compotes or using to make yummy jam or juice. They are delicious when sliced fresh in salads or eaten out-of-hand for a refreshing snack. You can even pair them with sharp cheeses and crackers to create a stunning appetizer cheese board to share with guests. The possibilities are endless with Anjou Pears.', '- D\'Anjou pears are a classic variety known for their sweet, juicy flavor and smooth, firm texture - They are versatile and can be used in a variety of dishes, from salads to desserts - High in dietary fiber and vitamin C, making them a healthy snack option - The 3lb bag size is convenient for families and individuals looking for a larger supply of fresh pears - D\'Anjou pears are harvested at their peak ripeness and carefully packed to ensure maximum freshness and flavor - They have a long shelf life and can be stored in the refrigerator for up to 2-3 weeks - D\'Anjou pears are available year-round, making them a reliable choice for any occasion.', 'Unbranded', 'https://i5.walmartimages.com/asr/1768e8ef-865f-48d4-912f-b986d583fdf5.08b640e3e963a277c891bfd44fa1dbd6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1768e8ef-865f-48d4-912f-b986d583fdf5.08b640e3e963a277c891bfd44fa1dbd6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1768e8ef-865f-48d4-912f-b986d583fdf5.08b640e3e963a277c891bfd44fa1dbd6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
