INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (178283560, 'Fresh Aloe Leaf, Each', 1.67, '045255117264', 'Renowned for its versatility, Aloe Vera Leaves are sure to be a must-have in your home. Aloe Vera is known for its ability to help soothe sunburn and treat skin irritation with its cooling abilities. Its packed with vitamins and minerals that are great for your skin and even your hair. But it doesn\'t stop there! Aloe Vera is also edible and perfect for blending into smoothies and shakes for added nutrients. All you need to do is carefully slice the leaf open to reveal the clear gel inside. Scrape it out with a spoon and apply it to your skin or hair, or blend into your favorite drink. The possibilities are endless with Aloe Vera Leaves.', '1 piece per unit Fresh aloe vera is only available within the store\'s produce section 100% natural plant material Used as both a home remedy and for food and drink Also known as Sábila and Aloe Vera around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8e286b82-c071-46f8-a956-2462b685847d.242620a41b08ac767ca346350f56b39e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8e286b82-c071-46f8-a956-2462b685847d.242620a41b08ac767ca346350f56b39e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8e286b82-c071-46f8-a956-2462b685847d.242620a41b08ac767ca346350f56b39e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (178285011, 'Fresh Organic Nectarines, 2 lb Bag', 5.66, '849315000394', 'Savor the irresistible taste of these Fresh Organic Nectarines in 2# Bags. With a red and yellow coloration, these juicy nectarines are round, slightly heart-shaped with smooth skin. The flesh is soft and yellow with a sweet flavor and a slightly acidic taste. Certified USDA organic, these nectarines have a firm bite with juicy flesh. These are a great quick, healthy snack for on-the-go people. You could also slice them for kids\' snacks and lunches. These also make a great addition to the grill for a delicious summer barbeque. Treat the entire family to the sweet flavor of Fresh Organic Nectarines.', 'Fresh Organic Nectarines, 2 lb Bag Certified USDA organic Packaged in a resealable bag to maintain freshness Add to baked goods for a unique flavor Use to top your salad for extra flavor or make a tasty fruit salad Pair with meat, poultry, and fish Slice as a sweet topping for waffles or pancakes Add to iced tea to create a refreshing summertime flavor', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f42523cf-104d-40d8-8ab2-e9fd59af1dbd.f37a1b293b03fa5f369807b8431de7aa.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f42523cf-104d-40d8-8ab2-e9fd59af1dbd.f37a1b293b03fa5f369807b8431de7aa.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f42523cf-104d-40d8-8ab2-e9fd59af1dbd.f37a1b293b03fa5f369807b8431de7aa.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
