INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (179052840, 'Good Foods Tableside Greek Yogurt Guacamole', 3.56, '736798901884', 'with simple, kitchen fresh ingredients, Good Foods Tableside Guacamole delivers superior tastes without compromise. We believe that real ingredients make really good foods; no need to add sugar, preservatives, dehydrated vegetables like some competitive offerings. Good Foods Tableside Guacamole is never heated – preserves the product flavor and nutrients. Good Foods harnesses the power of cold water pressure to give us a preservative-free way to keep our guacamole fresher, longer.', 'Good Foods Tableside Greek Yogurt Guacamole, 7 oz. Made with Hand-Scooped, Fresh Hass Avocados and rBST-Free Greek Yogurt No Artificial Colors, Flavors or Preservatives', 'Good Foods', '', '', '');
