INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (183694367, 'Van Zyverden Grape Seedless Concord (1 Dormant Bare Plant Root) Full Sun, Blue, Perennial', 6.88, '030641780511', 'Grow your own fresh fruit! Grape Seedless Concord Dormant Plant Root is the perfect addition to your edible garden that will reap benefits for years to come! Plant Grapes in full sun. Grapes will grow in a variety of soils. Grapes are excellent when used as an ornamental and can be trained onto arbors, or on pergolas to provide a unique addition to the landscape. Once established, care consists entirely of annual pruning and picking the fruit. Grapes contain antioxidants that may help prevent heart disease and some cancers. Grapes are also an excellent source of vitamins A, C, and K. Grapes need deep, well-drained, loose soil with pH levels 5.5 to 6.5. Add 2-3\" of mulch to maintain soil moisture. Pruning is important. Don\'t be afraid to remove at least 90% of the previous season\'s growth when vines are dormant. Perennial', 'Grape Seedless Concord Edible Grow your own fruit Garden to table freshness! Plant in a full sun location Harvest Mid Season Excellent source of vitamins A, C, and K Can be eaten fresh or used to make wine, jam, juice, or raisins GMO Free Perennial', 'Van Zyverden', 'https://i5.walmartimages.com/asr/c0c7ff3c-b963-4655-9589-1f384e5c2b55.33b95a2d00b113260075f20bf3c0f13d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c0c7ff3c-b963-4655-9589-1f384e5c2b55.33b95a2d00b113260075f20bf3c0f13d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c0c7ff3c-b963-4655-9589-1f384e5c2b55.33b95a2d00b113260075f20bf3c0f13d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
