INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (186979264, 'Fresh Red Apples, 3 lb Bag', 5.57, '033383002774', 'Apples, Red Rome, Bag 48 OZ US extra fancy - 2-1/2 inch min. Grown and packed by Fitzgerald\'s Orchards. Washed and coated with a food grade lac-resin based waxy to preserve freshness. Produce of USA. 48 oz (3 lb) 1.36 kg Tyro, VA 22976 434-277-5798. Savor the sweet taste of Red Apples that have a classic sweet flavor and are crisp and juicy with higher antioxidants due to the rich deep red skin. Perfect for snacking, they have a creamy white flesh with low acidity. Chop the apples up and add them to a slow cooker with lemon juice, water and cinnamon for a sweet and tasty apple sauce that everyone is sure to love. Add it to your favorite smoothie or juice blend for a morning pick me up to get your day started right. Serve with a dollop of peanut butter and enjoy as a healthy snack that both kids and adults will love. Enjoy the delicious taste of Red Apples.', 'Apples, Red Rome US extra fancy - 2-1/2 inch min. Grown and packed by Fitzgerald\'s Orchards. Washed and coated with a food grade lac-resin based waxy to preserve freshness. Produce of USA.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/02b8a627-7446-4ddb-9802-24328c117b2c.a66b7ba953580f36a1b7cf618a58fee1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/02b8a627-7446-4ddb-9802-24328c117b2c.a66b7ba953580f36a1b7cf618a58fee1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/02b8a627-7446-4ddb-9802-24328c117b2c.a66b7ba953580f36a1b7cf618a58fee1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (187159123, 'Fresh Cranberries, 32 oz Bag', 3.58, '031200900111', 'Savor the tart taste of Fresh Cranberries. Cranberries have a wonderful tart flavor that can easily take on the sweetness of your favorite sweetener. Use them to make a tart cranberry sauce, bake them into delicious cranberry and orange scones, combine with baked Brie for a gooey, sweet appetizer, or reduce them for a glaze to use on grilled chicken or turkey. They contain essential vitamins and nutrients like vitamin C, vitamin B, fiber, and antioxidants making them perfect for a healthy diet. Prior to use simply gently wash them with cool water, drain, and enjoy the zesty taste. Refrigerate the berries to keep them fresh and ready for use. Pick up Fresh Cranberries today and relish the delectable flavor.', 'Fresh Cranberries, 32 oz: Enjoy with your favorite sweetener, baked good, or savory dish Light, tart taste Healthy treat Prior to use gently wash them with cool water Refrigerate your berries in the original container to maintain freshness Keep dry for optimal freshness Cranberries can be stored up to 4 weeks in the refrigerator and up to 1 year in the freezer', 'Unbranded', 'https://i5.walmartimages.com/asr/27b6e404-9171-4feb-a69e-3ae7e8b51fe2.16454745b2d2da4194075b1433d8212e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/27b6e404-9171-4feb-a69e-3ae7e8b51fe2.16454745b2d2da4194075b1433d8212e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/27b6e404-9171-4feb-a69e-3ae7e8b51fe2.16454745b2d2da4194075b1433d8212e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
