INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (188889007, 'Fresh Mamey, Each', 2.47, '000000043106', 'Fresh Mamey fruit is a tropical delight known for its rich, creamy flavor and impressive nutritional benefits. Packed with vitamins A, C, and E, along with powerful antioxidants, it supports healthy skin, strong immunity, and clear vision. Its natural sugars and dietary fiber promote sustained energy and smooth digestion, while minerals like potassium, iron, and magnesium contribute to heart health and overall vitality. With its abundance of nutrients and naturally sweet taste, fresh mamey is not only delicious but also a wholesome, energy-boosting fruit that enhances wellness and supports a balanced lifestyle.', 'Packed with Vitamins A & C Naturally Sweet and Creamy Flavor Boosts Energy and Vitality Supports Eye and Skin Health Aids in Healthy Digestion Rich in Dietary Fiber and Antioxidants Helps Strengthen the Immune System Also known as Mamey Sapote, Zapote, and Mamey Colorado around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6c5ee02b-8f69-4940-9aa7-f6aada45231f.70086e33d42f39d7c09afbfa89721f11.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6c5ee02b-8f69-4940-9aa7-f6aada45231f.70086e33d42f39d7c09afbfa89721f11.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6c5ee02b-8f69-4940-9aa7-f6aada45231f.70086e33d42f39d7c09afbfa89721f11.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
