INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (198700570, 'Fresh Magenta Melon, Each', 2.68, '000000031028', 'Treat yourself to the refreshing flavor of a fresh Magenta Melons. Enjoy this tasty melon on its own as a healthy snack or incorporate it into a variety of delicious recipes. For breakfast, you can make a sweet fruit bowl with sliced Magenta, strawberries, pineapple, and kiwi. For an extra special treat, top with a dollop of whipped cream. Cut it into small pieces and put it in a fresh salad along with chicken, cucumbers, tomatoes, and a light dressing. You can even use the magenta melons to make a refreshing summer cocktail, a spreadable jam or a light sorbet. Enjoy the sweet and juicy taste of fresh Magenta Melon.', 'Fresh Magenta Melons, Each: Ideal addition to every kitchen Flavorful addition to many recipes Enjoy on its own or add to a mixed fruit salad Add to your fresh garden salad Get creative & make a melon cocktail or a refreshing sorbet Explore all the delicious ways to add fresh melon to your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1935136a-1e17-4b5f-8d6a-b362a07e7163.03d5778a809fbcaa05e17582053f6cf0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1935136a-1e17-4b5f-8d6a-b362a07e7163.03d5778a809fbcaa05e17582053f6cf0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1935136a-1e17-4b5f-8d6a-b362a07e7163.03d5778a809fbcaa05e17582053f6cf0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
