INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (198819926, 'Fresh Manzana (Apples) Roja, 1 lb.', 1.57, 'deleted_400094433751', 'Our Gala Apples are grown with care, hand-picked at peak ripeness, and delivered straight to your doorstep. Each bite bursts with the sweet, juicy flavor characteristic of the Gala variety. Perfect for snacking on-the-go, baking into a pie, or adding to your favorite salad recipe. Stock up on these delicious, healthy apples today! This is some delicious organic fresh produce, available for you!', 'Red apples are a classic variety loved for their sweet, juicy flavor and crisp texture. These apples are versatile and can be used in a variety of dishes, from salads to desserts. They are also a great source of dietary fiber and vitamin C, making them a healthy snack option. Our red apples are carefully selected and packed at the peak of their freshness to ensure maximum flavor and quality. Whether you\'re biting into one for a quick snack or using them to create a delicious apple pie, our red apples are sure to satisfy with their delicious taste and satisfying crunch. Perfect for families and individuals looking for a healthy and delicious addition to their diet, these red apples are a staple in any kitchen.', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/72bba039-d136-4929-a22b-bf6168248e81.4f906c353fe8bce2de49f18dd60f7600.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/72bba039-d136-4929-a22b-bf6168248e81.4f906c353fe8bce2de49f18dd60f7600.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/72bba039-d136-4929-a22b-bf6168248e81.4f906c353fe8bce2de49f18dd60f7600.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (199196212, 'Super Fresh Kids Red Apple, 2lb Pouch', 4.47, '883391000787', 'The Super fresh Kids Red 2lb apples offer a vibrant and healthy option for sharing with the whole family. Packed in a convenient 2-pound bag, these red apples have been selected for their mildly sweet flavor, crisp bite, and ideal size for young hands. The packaging features colorful and fun graphics designed especially for children, making them perfect as a snack, to take to school or work, or simply to have at home ready to enjoy. The brand combines quality and presentation to encourage the daily consumption of fresh fruit in an easy and appealing way for kids.', 'Convenient 2lb bag of fresh red apples. Mildly sweet flavor with a crisp, crunchy texture. Ideal for snacks: perfect for school, work, or at-home consumption. Encourages healthy eating: promotes daily fruit consumption among children. Ready-to-use: easy to slice or eat on the go.', 'Superfresh Kids', 'https://i5.walmartimages.com/asr/7e18e0c0-3fb9-43f2-8b8e-71168e1d5ab0.c863336d54e1add79aaa77032f6f230a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7e18e0c0-3fb9-43f2-8b8e-71168e1d5ab0.c863336d54e1add79aaa77032f6f230a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7e18e0c0-3fb9-43f2-8b8e-71168e1d5ab0.c863336d54e1add79aaa77032f6f230a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (199507043, 'Fresh Sugar Kiss Melon, Each', 2.78, '000000043762', 'Each Fresh Sugar Kiss Melon will be a delight to eat. This variety of this fruit originated in Taiwan and is one of the sweetest. Choose a sweet melon that has a firm rind. The soft orange flesh is delicious at room temperature, and any uneaten, cut melon should be refrigerated. Delightful for nearly any meal, it can be eaten by itself, in smoothies, salads or paired with cured meant for an appetizer. Plus, melons have no container. Sugar Kiss Melons are a good source of vitamins A and C.', 'Fresh Sugar Kiss Melon, Each Sweet and juicy taste that is pleasant Sugar melon provides vitamins A and C One of the sweetest varieties for you to enjoy Sure to please the whole family Melons have no container', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fe880c46-de66-48b1-b882-8b5df2e5a9a9.a433268d7cedb81e6ac949c8a4652bf9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fe880c46-de66-48b1-b882-8b5df2e5a9a9.a433268d7cedb81e6ac949c8a4652bf9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fe880c46-de66-48b1-b882-8b5df2e5a9a9.a433268d7cedb81e6ac949c8a4652bf9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
