INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (204518138, 'Fresh Grape Tomato, 2.5 oz Cup', 2.98, '751666778856', 'Bring the fresh, delicious taste of Grape Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this package of Grape Tomatoes.Fair Trade Certified tomatoes are the best way to have a positive impact on the lives of farmers, workers, and their communities. Through fair wages, enhanced health and safety on the job, and Community Development Funds that workers invest to solve their most pressing needs, every Fair Trade purchase you make has an impact. And you get to enjoy great quality tomatoes while making a difference!', 'Grape Tomatoes, 2.5 oz: Lower water content and longer shelf-life than cherry tomatoes Hardier and more resistant to bruising than traditional tomatoes Flavor in each bite Conveniently bite-sized Quick and excellent addition to salads and snack trays Best stored at room temperature out of sunlight Fresh produce', 'Fresh Produce', 'https://i5.walmartimages.com/asr/44b85fa9-33c6-4723-aac5-16d0f972e57c.3742aa7e897a91931c525ae5478ac756.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/44b85fa9-33c6-4723-aac5-16d0f972e57c.3742aa7e897a91931c525ae5478ac756.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/44b85fa9-33c6-4723-aac5-16d0f972e57c