INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (205177857, 'Fresh Mandarins, Each', 1.86, '405874101813', 'Enjoy the juicy goodness of citrus when you eat a Clementine. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, clementines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, clementines are now available year-round in most markets. Clementines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, clementines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Clementines on hand for an easy, healthy treat.', 'Delicious, sweet, juicy citrus Pleasing sweet-tart flavor Easy to peel and segment Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless You\'ll have plenty for everyone with this 5-pound bag Fresh Mandarin', 'Unbranded', 'https://i5.walmartimages.com/asr/bd763dda-b163-438e-ba60-79d19ecfd261.f1a7381116ace62844e1d4f7f4de1fc0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bd763dda-b163-438e-ba60-79d19ecfd261.f1a7381116ace62844e1d4f7f4de1fc0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bd763dda-b163-438e-ba60-79d19ecfd261.f1a7381116ace62844e1d4f7f4de1fc0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (205480599, 'Freshness Guaranteed Pineapple Large', 3.77, '262830000005', 'Experience a burst of tropical flavors with these Freshness Guaranteed Pineapple Chunks. The pre-cut slices of ripe pineapple are juicy and sweet to taste and are packed in its own juice. Carry them with you and eat them straight out of the tray any time you want, at home or on-the-go. You can also use them to top desserts and ice creams, in a fruit salad or blend them with milk to make milkshakes. Pineapples are known to have a number of nutrients, and they are especially rich in vitamin C. Add some fresh fruits to your daily menu today with these Freshness Guaranteed Pineapple Chunks.Freshness Guaranteed provides you and your family with high quality fresh food that save you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Pineapple Large', 'Freshness Guaranteed', '', '', '');
