INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (221372857, 'Louisiana Pepper Exchange 4oz Red Habanero Pepper Puree Sauce', 6.63, '850014104047', 'Louisiana Pepper Exchange 4oz Red Habanero Pepper Puree Sauce Ignite your taste buds with the bold heat and fruity twist of our Red Habanero Pepper Puree. This spicy habanero pepper sauce delivers intense heat while elevating your dishes with its rich, flavorful essence. From BBQ sauces and curries to Thai rice dishes and even Bloody Marys, this versatile puree adds the perfect kick to any meal. A convenient alternative to fresh peppers, our habanero salsa offers consistent flavor without the hassle of chopping or deseeding. Made with just red habanero peppers and a pinch of salt, it\'s gluten-free, calorie-free, and packed with natural flavor. Pair this habanero seasoning with mango, pineapple, seafood, or peaches to explore its dynamic flavor combinations. Whether you\'re a home cook or an aspiring chef, our habanero hot sauce will bring the heat to your culinary creations.', 'HOT, FRUITY FLAVOR – Experience the fiery heat and fruity essence of our red habanero pepper seasoning perfect for salsas, marinades, and more. NO CHOPPING NEEDED – Our super hot habanero sauce provides instant flavor like minced garlic, making cooking easier. SIMPLE INGREDIENTS – Made with just red habanero peppers and a pinch of salt, this gluten-free, calorie-free spicy sauce offers pure, guilt-free heat. EASY PEPPER SUBSTITUTE – One spoon of our habanero puree equals one whole habanero pepper, providing effortless recipe conversion. VERSATILE HEAT – Perfect for enhancing curries, BBQ sauces, fried chicken, and more, this habanero spicy seasoning brings bold heat to any dish.', 'Louisiana Pepper Exchange', 'https://i5.walmartimages.com/asr/64ce6a35-68db-4ae2-a1ec-b18b65390839.c4e7d5f76937d7ae6f2dc8e04dc32624.jpeg?odnHeight