INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (223592987, 'Fresh Tamarillo, Each', 1.97, '000000047937', 'Indulge in the sweet and tangy flavor of fresh tamarillo, a unique and exotic fruit from south america. with its vibrant red skin and juicy pulp, this small but mighty fruit is perfect for snacking, adding to salads, or using in recipes. try it today and discover a new world of flavors!', 'Unique Fruit: Tamarillos are a unique and exotic fruit that\'s not commonly found in most supermarkets, making them a great addition to any fruit platter. Sweet and Tart Flavor: Tamarillos have a unique sweet and tart flavor profile, making them a great addition to salads, smoothies, or desserts. High in Antioxidants: Tamarillos are a good source of antioxidants, which can help protect against cell damage and support overall health. Perfect for Snacking: Enjoy Fresh Tamarillos as a healthy snack on their own or add them to salads, smoothies, or desserts.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/074f10b1-d88d-4d67-b6cd-ff666de67a2d.bdf3ab41536192507b75bcad00ed96cf.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/074f10b1-d88d-4d67-b6cd-ff666de67a2d.bdf3ab41536192507b75bcad00ed96cf.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/074f10b1-d88d-4d67-b6cd-ff666de67a2d.bdf3ab41536192507b75bcad00ed96cf.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
