INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (225625757, 'Fresh Multi Color Grapes, 3lb Clamshell', 5.98, '887271000003', 'Enjoy the best of both worlds with Fresh Multi Color Grapes. This three-pound clamshell contains both red and green seedless grapes for delicious, juicy flavor. Bursting with flavor and completely seedless, you can easily enjoy a handful as a fresh snack any time of the day. Create stunning cheese boards and charcuterie plates by pairing these grapes with fresh cheeses, crackers, or delectable meats like prosciutto. Freeze the grapes and use them as ice cubs that won\'t melt and release water into your favorite drinks. Or incorporate them into a delicious fresh fruit salad for the perfect side dish for your meal. Treat yourself to the delicious taste of Fresh Multi Color Grapes.', 'Fresh Multi Color Grapes, 3lb Clamshell: Clamshell contains both red and green seedless grapes Bursting with flavor and completely seedless Enjoy a handful as a fresh snack any time of day pair with your favorite meats and cheeses for a charcuterie appetizer Incorporate into fruit salad Perfect for a quick, easy, and healthy snack', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a53f3bc1-7db7-4697-bc92-c1a5db9c2c14.ed91dd2c54f478d3e741b214e7b4ffef.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a53f3bc1-7db7-4697-bc92-c1a5db9c2c14.ed91dd2c54f478d3e741b214e7b4ffef.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a53f3bc1-7db7-4697-bc92-c1a5db9c2c14.ed91dd2c54f478d3e741b214e7b4ffef.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (225642643, 'Fresh Green Beans, bagged', 1.68, 'deleted_711069040660', 'Add fresh flavor to your meal with Green Beans. These beans are an excellent source of vitamin A and vitamin C. Serve as is or add your favorite spices for additional flavor. Roast them with oil and spices for a rich and flavorful dish or add butter, shallots, salt and pepper to green beans to create a yummy side dish. Serve with pork chops, chicken breasts, and other meats for a well-rounded meal. With so many uses, these greens beans will become a pantry staple for your home. Green Beans are a quick and healthy side dish and a great addition to any meal.', 'Green Beans, Per lb: Excellent source of vitamin A and C Roast with oil and spices or add butter, shallots, salt, and pepper the perfect side dish Versatile ingredient Serve with pork chops, chicken breasts, and other meats for a well-rounded meal Will become a pantry staple', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/9b80006b-97e0-46e9-b76f-911db42e55f2_3.dcfcd8dd0dcf9c21eb31a9f1c7572d77.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b80006b-97e0-46e9-b76f-911db42e55f2_3.dcfcd8dd0dcf9c21eb31a9f1c7572d77.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b80006b-97e0-46e9-b76f-911db42e55f2_3.dcfcd8dd0dcf9c21eb31a9f1c7572d77.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (226168734, 'Fresh Organic Medley Tomatoes, 10 oz Package', 3.46, 'deleted_684924900280', 'Organic Medley Tomatoes are an exciting summer treat, and they\'re the perfect size for skewers, salads and roasting. These bite-sized medley tomatoes look and taste great. Medley tomatoes are a low-calorie treat that are also low in sodium and are a good source of fiber. Whether you are snacking or adding them to your favorite dish. their uses are almost limitless. Try these grape tomatoes with feta cheese, fresh dill and a drizzle of olive oil for a light and delicious Mediterranean treat. Or make a caprese salad with medley tomatoes, fresh basil, fresh mozzarella and balsamic vinegar. With 10-ounces of tomatoes in each package, you\'ll have plenty to make mouthwatering meals. Use your imagination to create delicious dishes with Organic Medley Tomatoes.', 'Organic Medley Tomatoes, 10 oz Package: Perfect size for skewers, salads and roasting Low-calorie, low in sodium, and a good source of fiber Pair with feta cheese, fresh dill, and a drizzle of olive oil for a Mediterranean dish Certified organic', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d89fbddf-e7a5-4dfa-aaa8-9de2080146d9_1.649ce383bc8d6b2758468cffe627d28d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d89fbddf-e7a5-4dfa-aaa8-9de2080146d9_1.649ce383bc8d6b2758468cffe627d28d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d89fbddf-e7a5-4dfa-aaa8-9de2080146d9_1.649ce383bc8d6b2758468cffe627d28d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
