INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (227261707, 'Fresh Tomatillos, 1 lb', 4.57, '750455000031', 'Add rich flavor and color to your meals with fresh Tomatillos. Most cooks use this versatile ingredient as you would a vegetable even though it is actually a fruit. They have a tart flavor that adds a delicious tang to salsas, moles, and stews. The tomatillo is most commonly used to create a zesty and delicious salsa verde. Serve the salsa verde with chips or use it to enhance the flavors of your meal. Use these tomatillos to make tasty chicken tamales verdes. Tomatillos are also a great source of vitamin C, and they are low in calories. Explore all the delicious possibilities with fresh Tomatillos.', 'Tomatillos, 1 lb: Tart & tangy Make tasty chicken tamales verdes Perfect for salsas, moles & stews Use to make a zesty salsa verde Good source of vitamin C Low in calories 1 lb bag Explore delicious new recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5510837c-06f9-410d-9a26-d3a798426815_2.840b8d1bbac92ab814d2164200607109.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5510837c-06f9-410d-9a26-d3a798426815_2.840b8d1bbac92ab814d2164200607109.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5510837c-06f9-410d-9a26-d3a798426815_2.840b8d1bbac92ab814d2164200607109.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
