INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (229772737, 'Medley Tomato, 12 oz Package', 4.48, '626074919293', 'Bring the fresh, delicious taste of Medley Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this package of Medley Tomatoes.', 'Medley Tomato, 12 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/114aa65a-601d-43bd-be7a-ca357d821a18.ef98efe2f7ed66e720145ded0b09dbed.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/114aa65a-601d-43bd-be7a-ca357d821a18.ef98efe2f7ed66e720145ded0b09dbed.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/114aa65a-601d-43bd-be7a-ca357d821a18.ef98efe2f7ed66e720145ded0b09dbed.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
