INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (229970570, 'Organic Red Globe Grapes, 2 Lb', 6.97, 'deleted_638550012060', 'Treat yourself to the delicious, juicy flavor of Fresh Organic Red Globe Whole Seeded Grapes. These organic grapes are bursting with sweet flavor and known for their large size. Enjoy a handful as a fresh snack any time of day or dry them for scrumptious raisins. You can even use them to make refreshing organic grape juice. They are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with cheese, crackers, or delectable meats like prosciutto. If you want to be creative, you can freeze them and use them as ice cubes in your favorite drinks. Treat yourself to the whole fresh taste of Organic Red Globe Whole Seeded Grapes.', 'Organic Red Globe Grapes, 2 Lb Bursting with flavor and known for their large size Enjoy a handful as a fresh snack', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b041db3b-5145-4e28-99f0-f57f90e279fe_2.05260a3612d96115eb0fb3fe9f0cf599.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b041db3b-5145-4e28-99f0-f57f90e279fe_2.05260a3612d96115eb0fb3fe9f0cf599.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b041db3b-5145-4e28-99f0-f57f90e279fe_2.05260a3612d96115eb0fb3fe9f0cf599.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
