INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (230651706, 'Spice World Easy Onion, 9.5 oz Jar', 7.33, '070969004173', 'Spice World Squeezable 9.5oz Minced Onion is the perfect addition to pack in your picnic basket for an outdoor party, add to your cooler for a tailgate this fall, or keep in your fridge to make meal prep easy! Delicious on burgers, chicken, fish, steak, veggies, and hot dogs! It is ready-to-use and comes in a convenient plastic squeeze bottle to use just the right amount for your dish. No peeling, chopping, or tears. Remember that while this Fresh Produce item is Shelf-Stable, it should be refrigerated after opening and always shake well before using Latex-Free.', 'Ready-to-use Minced onion in a convenient squeeze bottle to be easily added to any dish Makes picnics and tailgating a breeze \'Fresh Produce\', \'Latex-Free\', \'Fresh\', and \'Plastic\' No peeling, chopping, or tears', 'Fresh Produce', 'https://i5.walmartimages.com/asr/75fa4342-00c1-4c02-944c-f95dc49c614d.5071a8f6dd102db49225b9831afa7cf2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75fa4342-00c1-4c02-944c-f95dc49c614d.5071a8f6dd102db49225b9831afa7cf2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75fa4342-00c1-4c02-944c-f95dc49c614d.5071a8f6dd102db49225b9831afa7cf2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
