INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (230831397, 'Homeboy Caliente Guacamole, 8oz', 3.58, '855420002666', 'Homeboy provides much more than flavor for your chips. It fuels transformation for thousands of former gang members on a journey to recovery through Homeboy Industries. Father Greg Boyle, \"G\", founded Homeboy Industries 27 years ago to provide hope, training, and support to formerly gang-involved and recently incarcerated men and women, allowing them to redirect their lives and become contribution members of our community. With every purchase you join a virtuous circle helping men and women develop the strength and skills to change for the better. We heal families. We create thriving communities. We provide the Strength to Change. Thank you for being a part of the Strength to Change at Homeboy Industries. Enjoy our Homeboy Caliente Guacamole!', 'Homeboy Caliente Guacamole, 8oz.', 'Homeboy', 'https://i5.walmartimages.com/asr/5b22c331-a194-4013-99c1-92cc474ead9d.26891323d1d4483dcf31c98ac1d6f2ba.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5b22c331-a194-4013-99c1-92cc474ead9d.26891323d1d4483dcf31c98ac1d6f2ba.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5b22c331-a194-4013-99c1-92cc474ead9d.26891323d1d4483dcf31c98ac1d6f2ba.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
