INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (233949940, 'Daikon', 2.84, 'deleted_045255181838', 'Daikon, also called Chinese radish, is an essential ingredient in a wide variety of Asian dishes. The origin of the radish can be traced back to ancient China, but the word Daikon actually comes from two Japanese words: dai (meaning large) and kon (meaning root). As one of the largest radishes, daikon is characterized by its long, narrow appearance and crisp texture. It can range in length from 6 to 15 inches and can average 2 to 3 inches in diameter. The skin is usually white but can also be black. Although it may look similar to a carrot in appearance, its flavor is anything but. It has been described as mildly sweet and juicy with a slightly spicy, peppery bite. This is one versatile Asian vegetable and its fresh flavor is delicious served raw or pickled. It is often used as a condiment, garnish or ingredient in soups, stews, salads and more. Besides enjoying them raw, you can also cook them in many different ways from roasting to steaming and more. They can also be thrown into classic braise with meat, since they absorb their braising liquid beautifully and take on the texture of turnips once cooked. Daikon should be scrubbed with a brush under running water, prior to use. Peel before using or grate with a sharp metal grater', 'Contains: Vitamin C Potassium Phosphorus', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/bc5f1a84-30cb-4796-a258-d3112fa3beec_1.dc4e700cc293daa7e0fe599d0fb2cc77.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bc5f1a84-30cb-4796-a258-d3112fa3beec_1.dc4e700cc293daa7e0fe599d0fb2cc77.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bc5f1a84-30cb-4796-a258-d3112fa3beec_1.dc4e700cc293daa7e0fe599d0fb2cc77.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
