INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (237958112, 'Fresh Whole Grape Tomatoes, 10 oz Package', 4.98, '606105801575', 'Enjoy the refreshing taste of Fresh Whole Grape Tomatoes. They are an exciting summer treat, and they\'re the perfect size for skewers, salads and roasting. These bite-sized grape tomatoes look and taste great. Grape tomatoes are a low-calorie treat that are also low in sodium and are a good source of fiber. Whether you are snacking or adding them to your favorite dish. their uses are almost limitless. Try these grape tomatoes with feta cheese, fresh dill, and a drizzle of olive oil for a light and delicious Mediterranean treat. Or make a caprese salad with grape tomatoes, fresh basil, fresh mozzarella, and balsamic vinegar. With 10-ounces of tomatoes in each package, you\'ll have plenty to make mouthwatering meals. Use your imagination to create delicious dishes with Fresh Whole Grape Tomatoes.', 'Fresh Whole Grape Tomatoes, 10 oz Package Perfect size for skewers, salads and roasting Low-calorie, low in sodium, and a good source of fiber Pair with feta cheese, fresh dill, and a drizzle of olive oil for a Mediterranean dish Make a caprese salad with grape tomatoes, fresh basil, fresh mozzarella, and balsamic vinegar', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
