INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (238627435, 'Fresh Slicing Tomato, 3 Pack', 1.5, '811857020512', 'Create something wholesome and delicious with 3pk tomatoes. These fresh tomatoes are the perfect ingredient for a variety of tasty dishes. Use them to make a decadent tomato sauce for a pasta dish; try slicing them up and pairing with mozzarella cheese, basil and balsamic vinegar; or simply enjoy them on their own as a nutritious snack. They would make a comforting and appetizing tomato soup and a flavorful salsa. You could also slice them up and use them to top burgers and pizza or use them to make a delicious grilled cheese and tomato sandwich. However you choose to use them, these tomatoes will add flavor and taste to any meal. Be sure to add these fresh tomatoes to your Walmart purhase today.', 'Slicing Tomatoes, 3 Count: Pack of 3 whole slicing tomatoes Firm and thick-skinned Large size is perfect for slicing up and garnishing sandwiches and burgers Classic tomato flavor lends itself to a wide variety of recipes Delicious base for making salsas, soups, sauces, and more', 'Fresh Produce', 'https://i5.walmartimages.com/asr/66a57190-3844-4a00-8135-3466bbfce8b0.d49d3461c8a0b731cc67c52cceea0bb9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/66a57190-3844-4a00-8135-3466bbfce8b0.d49d3461c8a0b731cc67c52cceea0bb9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/66a57190-3844-4a00-8135-3466bbfce8b0.d49d3461c8a0b731cc67c52cceea0bb9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (238720430, 'Good Healthy Organic Superfood Blend Microgreens Salad, 3 oz Clam Shell, Fresh', 3.48, '856642007224', 'GoodHealthy Organic Superfood Blend is the perfect mix of protein-rich kale and organic tender beetroot to ensure you get all the veggie goodness you need! Perfect to top off your family’s favorite pasta dish, a warm winter soup, or burgers from the grill. Make every recipe GoodHealthy with our Superfood Blend! At GoodHealthy, we’re changing the way you think about farming! Every seed we plant is nurtured in organic soil, rich in nutrients, and cared for by our sustainable SmartFarm technology. Grown locally 365 days a year, our AI-driven farms are turning less into more; using less water, less land, and less energy to produce more of the farm-fresh organic veggies you love! Going beyond organic, our regenerative greenhouses restore nutrients to the soil with every harvest, reducing our carbon footprint and supporting the local environment. Making the world GoodHealthy, one plant at a time!', 'GoodHealthy Organic Superfood Blend 3oz', 'Good Healthy', 'https://i5.walmartimages.com/asr/b787d27c-e9a5-42eb-b338-ba9e563f3f0e.336e699fd8a9d7f447807be376a7adbe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b787d27c-e9a5-42eb-b338-ba9e563f3f0e.336e699fd8a9d7f447807be376a7adbe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b787d27c-e9a5-42eb-b338-ba9e563f3f0e.336e699fd8a9d7f447807be376a7adbe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
