INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (238959223, 'Simply Perfect Microwaveable Sweet Potato, 8 Oz', 1.18, 'deleted_819614010066', 'These delicious sweet potatoes are microwavable and cook in 5-8 minutes, making it easy to cook a quick and healthy meal. They are thoroughly washed and ready to microwave for you to enjoy! This sweet potato is orange on the outside and orange on the inside, delivering a sweet and earthy flavor. What are you waiting for? Pop it in the microwave and enjoy!m Designed to accommodate the individual on the go, our microwaveable sweet potato is nutritious, earthy, and delicious, these singles can complement any dish throughout the day or offer a snack in itself. Sweet potatoes are a pantry essential that you should have always in your kitchen. Just one sweet potato is an excellent source of vitamin containing 368% Vitamin A daily value. They are loaded with beta carotene which acts as a potent antioxidant, making it easy to feel good about what you are about to enjoy!', 'Microwaveable Sweet Potatoes Per Each', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/75f4050a-0e69-4bc0-8604-11f44ec405b3.8481ac97edd8fe483b8ec619a7f3458b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75f4050a-0e69-4bc0-8604-11f44ec405b3.8481ac97edd8fe483b8ec619a7f3458b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75f4050a-0e69-4bc0-8604-11f44ec405b3.8481ac97edd8fe483b8ec619a7f3458b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
