INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (248260406, 'Marketside Kosher Ruby Grapefruit Bites Segments, 64 oz Jar', 8.97, '681131161442', 'Marketside Ruby Grapefruit Segments are peeled and soaked in a slightly sweetened water to lock in all their delicious fruit flavors. This tasty citrus fruit is perfect for fruit cocktails, salsas, desserts, salads and can also be used as a garnish for meat and vegetable dishes. Enjoy them chilled for a refreshing snack that you can enjoy at anytime of the day. They also offer a nutritional benefit as they are a rich low calorie source of vitamin C. This large four pound container makes it easy to stock up on your favorite fresh fruit. Enjoy a healthy and delicious snack with the wholesome taste of Marketside Ruby Grapefruit Segments. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Kosher Ruby Grapefruit Bites Segments, 64 oz Jar Ruby grapefruit segments soaked in slightly sweetened water Great in salads High in vitamin C 1 plastic cup container has 15 servings Net weight: 4 pounds Keep refrigerated until ready to enjoy', 'Marketside', 'https://i5.walmartimages.com/asr/8bc86217-b71c-4263-a29c-eb81a43769b0_3.aa27b4db730405ef392d90f78a6324d7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8bc86217-b71c-4263-a29c-eb81a43769b0_3.aa27b4db730405ef392d90f78a6324d7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8bc86217-b71c-4263-a29c-eb81a43769b0_3.aa27b4db730405ef392d90f78a6324d7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
