INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (248745453, 'Fresh Pineapple, Each', 0.88, '405810385161', 'Enjoy a burst of tropical flavor with this Fresh Pineapple. This pineapple can be a satisfying afternoon snack, or you can use it in a variety of recipes. For breakfast, use this pineapple to make a rich and creamy smoothie or serve it alongside your pancakes, sausage, and eggs. Slice it up and use to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. For dessert, you could make a crowd-pleasing pineapple upside down cake or a comforting pineapple crisp. However you choose to use it, this Fresh Pineapple will add flavor to any meal or beverage.', 'Aside from its sweetness, pineapple is abundant in potassium, iodine and vitamins A, B and C. It contains 85% water, carbohydrates and fiber, and provides great nutritional and health benefits. It is excellent for weight loss diets.', 'Pina Corona De Pr', 'https://i5.walmartimages.com/asr/32f4cb1f-71f8-4cbb-9539-e9c6718ca645.51d59e41d011e0a4fc92bc7bcd210c6a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/32f4cb1f-71f8-4cbb-9539-e9c6718ca645.51d59e41d011e0a4fc92bc7bcd210c6a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/32f4cb1f-71f8-4cbb-9539-e9c6718ca645.51d59e41d011e0a4fc92bc7bcd210c6a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
