INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (254642460, 'Fresh Slicing Tomato, 4 Pack', 2.48, '856441005001', 'Create something wholesome and delicious with Fresh Slicing Tomatoes. These fresh tomatoes are the perfect ingredient for a variety of tasty dishes. Use them to make a decadent tomato sauce for a pasta dish; try pairing with mozzarella cheese, basil, and balsamic vinegar for a delectable caprese salad; or simply enjoy them on their own as a nutritious snack. They would make a comforting and delicious tomato soup or a flavorful homemade salsa. You could also slice them up and use them to top burgers and pizza or use them to make a delicious grilled cheese and tomato sandwich. No matter how you choose to use them, these tomatoes will add flavor and taste to any meal. Be sure to add Fresh Slicing Tomatoes to your Walmart produce purchase today.', 'Slicing Tomatoes, Each: Wholesome, versatile, and delicious Large size with a juicy, delicious flavor Meaty texture makes them perfect for slicing Enjoy on burgers, sandwiches and more Enjoy on its own seasoned with salt and pepper as a heathy snack Create a mouthwatering salad or appetizer', 'Fresh Produce', 'https://i5.walmartimages.com/asr/596ed5a2-6558-42d6-9a5b-c318bc9f4ae2.4927131d05c00312cf51744e17e11473.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/596ed5a2-6558-42d6-9a5b-c318bc9f4ae2.4927131d05c00312cf51744e17e11473.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/596ed5a2-6558-42d6-9a5b-c318bc9f4ae2.4927131d05c00312cf51744e17e11473.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
