INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (259842087, 'POM Wonderful Pomegranate Arils, Ready to Eat Pomegranate Seeds, 4 oz', 4.97, '824150910015', 'One 4 Ounce Cup of POM Wonderful Pomegranate Arils, Ready to Eat Pomegranate Seeds. Best Snack Award Winner: POM Wonderful Pomegranate Arils offer a deliciously convenient way to enjoy the sweet and tart flavor of fresh pomegranates anytime, anywhere. Each cup is packed with juicy, ruby-red arils that are bursting with flavor and naturally rich in antioxidants. Whether you\'re looking for a healthy snack between meetings, a vibrant topping for your morning yogurt, or a flavorful addition to your favorite salad, these arils deliver versatility and taste in every bite. You can even melt dark chocolate and sprinkle the arils on top for a decadent, antioxidant-rich treat. Their bold flavor complements both savory and sweet dishes, making them a must-have ingredient in your kitchen. The resealable, cup-like container is designed for freshness and portability, perfect for busy lifestyles. With POM Wonderful, you’re not just snacking, you’re choosing a smart, flavorful option that supports your wellness goals while satisfying your cravings.', 'One cup of 4 oz ready to eat POM Wonderful Pomegranate Arils (also known as pomegranate seeds) Pomegranates are known for their unique antioxidants and sweet, tart taste Conveniently packed in individual fruit cups with an easy peel lid. So simple for an on-the-go snack, lunch boxes, road trip or to enjoy at home Eat straight from the cup, or add a refreshing crunch to salads, smoothies, charcuterie boards or any of your favorite dishes Pomegranate arils (seeds) are a good source of fiber and vitamin C. A healthy treat Non-GMO, certified Kosher and Gluten Free', 'POM Wonderful', 'https://i5.walmartimages.com/asr/a266b2cf-b77a-45c0-aa2a-0a3c35cdd234.c6b1e198234376c7489f651ba2f46090.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a266b2cf-b77a-45c0-aa2a-0a3c35cdd234.c6b1e198234376c7489f651ba2f46090.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a266b2cf-b77a-45c0-aa2a-0a3c35cdd234.c6b1e198234376c7489f651ba2f46090.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
