INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (265105313, 'Spice World, ORGANIC MINCED GARLIC - LARGE Container - 32 OZ', 14.99, '070969000182', 'READY-TO-USE FRESH GARLIC – Add bold garlic flavor to a meal without the hassle of chopping or mincing. Spice World’s Organic Minced Garlic in jar is always just a spoonful away, offering an easy way to flavor your favorite dishes. DELICIOUS HEALTH FOOD – Our organic garlic minced is fresh, delicious, and good for you! It’s grown, processed, and handled naturally with no use of synthetic chemicals, preservatives, or sodium. Our garlic cloves are fat-free, non-GMO, and Kosher. BULK CONTAINER – There are so many ways to use our organic minced garlic, such as in pasta sauces, salsas, marinades, garlic bread, soups, and much more! Always have flavor on hand with this 32oz bulk-sized seasoning container. 1 TEASPOON EQUALS 1 CLOVE – Make meal prep a snap while adding savory flavor with minced garlic seasoning. Simply spoon straight from the minced garlic jar to amplify any meal. One teaspoon of pre minced garlic equals approximately one garlic clove. FLAVOR WITHOUT BOUNDARIES – It’s time to stir up adventure in your kitchen! Spice World grows our garlic fresh all year long. We make bringing bold flavor even easier for busy home chefs with our fresh minced, peeled, and squeezable flavors and blends.', 'Garlic, Organic, Minced USDA Organic. Certified Organic by CCOF. Non-GMO ingredients. Est 1949. Ready to use. Bold savory flavor! 1 tsp = 1 clove of garlic. spiceworldinc.com.', 'Spice World', 'https://i5.walmartimages.com/asr/f774f9d4-8181-4ab7-96ad-127efafc1ddb.35dc45e6bab33a8e28116fbc9f67ad00.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f774f9d4-8181-4ab7-96ad-127efafc1ddb.35dc45e6bab33a8e28116fbc9f67ad00.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmart