INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (266453017, 'Fresh Whole Squash, Pound', 2.47, '405854077329', 'Add some fresh flavor to your meal with Squash. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. Roast the whole squash for a simple and flavorful side dish, chop it into cubes and put it in the slow cooker with chicken breast, kidney beans, and spices, or make noodles for a gluten-free pasta alternative. For a sweet treat turn the squash into a rich and spicy pie, perfect for the holiday season. With so many uses, this vegetable will become a pantry staple. Create tasty and flavorful meals with Squash', 'Versatile ingredient Roast the whole squash for the perfect side dish or chop into cubes, put into a slow cooker, and mix with chicken breast, beans, and spices for a flavorful dish Use it to create a sweet and decadent pie Make butternut squash noodles for a gluten free pasta alternative Will become a pantry staple', 'Unbranded', 'https://i5.walmartimages.com/asr/f57a6cdc-89ed-40bc-87d7-4f99067ee489.0b975be7fa233a234711a62552c2bf7a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f57a6cdc-89ed-40bc-87d7-4f99067ee489.0b975be7fa233a234711a62552c2bf7a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f57a6cdc-89ed-40bc-87d7-4f99067ee489.0b975be7fa233a234711a62552c2bf7a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
