INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (267265556, 'Dallas Cowboys Original Guacamole with Hass Avocados, Gluten-Free, 15 oz', 4.98, '810041599223', 'Our “classic original” guacamole is made with hand scooped avocados and the perfect blend of spices. Enjoy with chips or on your favorite sandwich. ¡Yo Quiero! and the Dallas Cowboys partnered up to bring easy snacks, easy lunches, and easy dinners to life. Whether you\'re planning for tailgating, Friday night dinners or prepping a vegan lunch, the Original Guacamole is sure to satisfy your cravings and delight your guests. Made with the freshest ingredients from real Hass Avocados to jalapeno peppers, this convenient snack or appetizer is perfect for your lunch menu, parties, packed lunch, vegan dinner, or whatever else you might crave. The Dallas Cowboys Original Guacamole pairs wonderfully with chips, sandwhiches, tacos, and snacks. You can even turn it into your own version of avocado toast or use as dip for carrots and other vegetables. Game day snacking just got better.', 'Our “classic original” guacamole is made with hand scooped avocados and the perfect blend of spices. Enjoy with chips or on your favorite sandwich. ¡Yo Quiero! and the Dallas Cowboys partnered up to bring easy snacks, easy lunches, and easy dinners to life. Whether you\'re planning for tailgating, Friday night dinners or prepping a vegan lunch, the Original Guacamole is sure to satisfy your cravings and delight your guests. Made with the freshest ingredients from real Hass Avocados to jalapeno peppers, this convenient snack or appetizer is perfect for your lunch menu, parties, packed lunch, vegan dinner, or whatever else you might crave. The Dallas Cowboys Original Guacamole pairs wonderfully with chips, sandwhiches, tacos, and snacks. You can even turn it into your own version of avocado toast or use as dip for carrots and other vegetables. Game day snacking just got better.', 'Yo Quiero', 'https://i5.walmartimages.com/asr/c93540a4-0821-4545-83b4-711c39ee08b9.411a9b938c74963319b7a36f8b9dcbdd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c93540a4-0821-4545-83b4-711c39ee08b9.411a9b938c74963319b7a36f8b9dcbdd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c93540a4-0821-4545-83b4-711c39ee08b9.411a9b938c74963319b7a36f8b9dcbdd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
