INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (269323363, 'Fresh Poblano Peppers, 16 oz bag', 2.64, '711069541174', 'Enjoy the fresh and delicious flavor of Poblano Peppers. Poblano peppers are known for their mild heat and rich flavor. Best of all this versatile pepper can be used in a myriad of recipes. Use them to make delicious Mexican-inspired recipes like chile relleno. Stuff some with sausage, rice, and spices to make a hearty, healthy and delicious dinner. Pan roast some with your favorite cheese and herbs for a yummy side, add them to your hearty chili recipes or turn some into a wonderful autumn soup. Any way you slice, dice, or cook them, Poblano Peppers are a refreshing, healthy addition to any meal. Also know as Chile Poblano, Mild Greeb Chili, Mild Green Pepper and Bhavnagri Mirch around the world.', 'Poblano Peppers, 16 oz: Includes 1 pound of poblano peppers Known for their mild heat and rich flavor Versatile pepper can be used in a myriad of recipes Use them to make delicious Mexican-inspired recipes like chile relleno Stuff some with sausage, rice, and spices to make a hearty, healthy and delicious dinner', 'Fresh Produce', 'https://i5.walmartimages.com/asr/fa7312e7-f5c6-4762-8003-2b958a10a9ad.ff6d8a61a9e33f4261fc327524c66242.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fa7312e7-f5c6-4762-8003-2b958a10a9ad.ff6d8a61a9e33f4261fc327524c66242.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fa7312e7-f5c6-4762-8003-2b958a10a9ad.ff6d8a61a9e33f4261fc327524c66242.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
