INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (270884033, 'Fresh Muscadine Black Grapes, Whole, 1 lb Tray', 3.88, '033383250762', 'Enjoy the sweet taste of these Fresh Muscadine Black Grapes. Native to the southern United States, these muscadine grapes have a thick, tough skin and a sweet, juicy interior. These large, round grapes come in various shades of purple to bronze and are known for their unique musky whole flavor. Rich in antioxidants and vitamins, muscadine grapes are enjoyed fresh, as well as in jams, jellies, and wines. With a sweet flavor, they\'re great for snacking and can be used in salads, smoothies, and desserts, making them a perfect addition to any meal. Bring home some Fresh Muscadine Black Grapes today.', 'Fresh Muscadine Black Grapes, Whole, 1 lb Tray Tasty, nutritious fruit ideal for snacking or adding to recipes Muscadine grapes have a high concentration of antioxidants These grapes provide dietary fiber, supporting digestive health, cholesterol regulation, and weight maintenance With a sweet flavor, they\'re great for snacking and can be used in salads, smoothies, and desserts, making them a perfect addition to any meal Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/29385b13-e2e5-4c88-b8ad-f7ed872349fc.7229afd5a49d7875b8a066e250ab31e4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/29385b13-e2e5-4c88-b8ad-f7ed872349fc.7229afd5a49d7875b8a066e250ab31e4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/29385b13-e2e5-4c88-b8ad-f7ed872349fc.7229afd5a49d7875b8a066e250ab31e4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
