INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (277010990, 'Slofoodgroup Dried Porcini Mushrooms Gourmet Boletus Edulis Grade-a - 2oz', 12.95, '810023052678', 'Found growing naturally in the wild hidden amongst the forest under bushes and pines, Porcini mushrooms are beloved by chefs, cooks, and food lovers alike. The Porcini is a versatile mushroom that is used in soups, stews, stocks, sauces, pastas, rice, you name it. The prized boletus edulis fungi is used in recipes the world over from Italy, France, Spain, and all throughout Asia. The meaty umami-ness of Porcini makes these mushrooms a must have for any mushroom lover. What do Porcini taste like? Often described as meaty, earthy, woody and umami porcini are a favorite in many cuisines. Try for yourself and see what everyone is talking about and enjoy the rich, chewy, nutty and earth flavor profile that makes these mushrooms so darn good. BPA free stand up pouch. In each 100g serving of these Dried Porcini Mushrooms, you\'re treated to a burst of nutritional goodness. With just 370 calories, they\'re low in energy while delivering a solid 25g of protein, making them an excellent source for plant-based protein intake. Carbohydrates come in at 68g, including 9g of beneficial fiber, helping to maintain healthy digestion. The total fat content is 3g, with minimal saturated fat at 0.6g, and there\'s no cholesterol or sodium to worry about. Impressively, these mushrooms offer a substantial 3,700mg of potassium, essential for various bodily functions, along with 100mg of calcium and 3mg of iron, contributing to overall health. Truly a nutritional powerhouse, adding both flavor and wellness to your culinary endeavors. Not only do these mushrooms enhance the taste, but they also bring a wealth of nutrition to your meals. With a low-calorie count, high protein content, and a notable presence of essential minerals like potassium, calcium, and iron, these porcini mushrooms are not just a flavorful choice, but also a wholesome one. Experience the culinary magic of Slofoodgroup\'s Dried Porcini Mushrooms, a must-have for any food enthusiast looking to elevate their dishes with the finest gourmet ingredients.', '2oz Grade A Dried Porcini Mushrooms Our dried porcini are grade A sliced, dried naturally and uniform in thickness. Using Porcini or any dried mushrooms in cooking is really quite easy. Simply rehydrate the mushrooms in warm water until just tender and cook as you would normally with fresh mushrooms. Porcini Mushrooms can add umami flavor to your risottos, stews, stroganoff and more.', 'Slofoodgroup', 'https://i5.walmartimages.com/asr/7ed03fc4-8e0c-430c-b15b-a0bdc4ac6d14.63d8db524900cae3eb7f13831ab9622c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7ed03fc4-8e0c-430c-b15b-a0bdc4ac6d14.63d8db524900cae3eb7f13831ab9622c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7ed03fc4-8e0c-430c-b15b-a0bdc4ac6d14.63d8db524900cae3eb7f13831ab9622c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
