INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (286846442, 'Crunch Pak Fresh Sweet Peeled Apple Slices, 24 oz Resealable Bag', 5.97, '732313001725', 'Savor the sweet taste of Crunch Pak Fresh Sweet Peeled Apple Slices. These perfectly peeled and sliced apples are the ultimate quick, easy, and healthy treat. Serve with a dollop of peanut butter and enjoy as a healthy snack that both kids and adults will love. Chop the apples up and add them to a salad with walnut, mixed greens, and a poppy seed vinaigrette for a crunchy delicious salad that you can enjoy for lunch or dinner. Add it to your favorite smoothie or juice blend for a morning pick me up to get your day started right. Throw some in a bag in with your lunch for a healthy side, take with you as you go travel or pack a couple of bags and take on a picnic with your family. Only 80 calories per serving and no added sugars. Enjoy the convenience and taste of Crunch Pak Fresh Peeled Sweet Apple Slices.', 'Crunch Pak Fresh Peeled Apple Slices Perfect on-the-go healthy snack Good source of vitamin C Equals 2.25 lbs of whole apples 80 calories per serving Family Size No added sugars', 'Crunch Pak', 'https://i5.walmartimages.com/asr/dfa419aa-fbcb-4bda-be03-06981403c391.e5d13a45fb9eb81fda2f2f73e9ad43ac.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dfa419aa-fbcb-4bda-be03-06981403c391.e5d13a45fb9eb81fda2f2f73e9ad43ac.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dfa419aa-fbcb-4bda-be03-06981403c391.e5d13a45fb9eb81fda2f2f73e9ad43ac.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (286974795, 'Fresh Tejocote Fruit, 1 lb Clamshell', 3.98, '861863000374', 'Fresh Tejocote Fruit brings vibrant, seasonal flavor to your kitchen with small golden fruits that offer a naturally sweet tart taste perfect for a wide range of recipes. These firm, aromatic fruits are widely used in traditional Latin cooking, especially for simmering in syrup, preparing homemade jams, or adding depth to festive fruit punch during the holiday season. Their mild sweetness, bright aroma, and versatile texture make them a great ingredient for both sweet and savory dishes. Conveniently packaged in a one pound clamshell, Fresh Tejocote Fruit is easy to store, simple to prep, and ready to inspire your next culinary creation.', 'Fresh Tejocote Fruit, 1 lb Clamshell Small golden fruits with a naturally sweet tart flavor Great for syrups, jams, fruit punch, and seasonal dishes Versatile texture suitable for sweet and savory recipes Convenient 1 lb clamshell for easy storage and use Also known as Mexican hawthorn and manzanita', 'Unbranded', 'https://i5.walmartimages.com/asr/577c3547-e431-4b18-9426-664684c9548f.9b07b6240ac718672265af6b14431240.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/577c3547-e431-4b18-9426-664684c9548f.9b07b6240ac718672265af6b14431240.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/577c3547-e431-4b18-9426-664684c9548f.9b07b6240ac718672265af6b14431240.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
