INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (288529694, 'Fresh Pineapple, Each', 3.57, '051497137458', 'Enjoy a burst of tropical flavor with this Fresh Pineapple. This pineapple can be a satisfying afternoon snack, or you can use it in a variety of recipes. For breakfast, use this pineapple to make a rich and creamy smoothie or serve it alongside your pancakes, sausage, and eggs. Slice it up and use to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. For dessert, you could make a crowd-pleasing pineapple upside down cake or a comforting pineapple crisp. However you choose to use it, this Fresh Pineapple will add flavor to any meal or beverage.', 'Fresh Pineapple To make juices Add flavor to meals', 'Unbranded', 'https://i5.walmartimages.com/asr/0ca9811e-fe6d-4410-880a-e7a82901e4ac.20a195a0038bb3075d8bc23a7b477e03.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0ca9811e-fe6d-4410-880a-e7a82901e4ac.20a195a0038bb3075d8bc23a7b477e03.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0ca9811e-fe6d-4410-880a-e7a82901e4ac.20a195a0038bb3075d8bc23a7b477e03.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (288610949, 'Fresh Grape Tomato, 10 oz Package', 2.48, 'deleted_038259117002', 'Fresh grape tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily compliments your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Grape Tomatoes are the perfect choice.', 'Grape Tomato, 10 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Fresh produce in a convenient package Store at room temperature for best results', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
