INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (292835452, 'Autumn Glory Fresh Apples, Each', 2.22, '000000036016', 'Indulge in the crisp sweetness of Autumn Glory Apples, the perfect Fresh autumn treat! These apples are grown in the Pacific Northwest where the unique climate and soil create the perfect environment for the apples to thrive. Bursting with juicy, caramel flavor, these apples are perfect for snacking, baking or as an addition to your favorite fall recipes. Grab a bag today and savor the taste of the season!', 'Autumn Glory apples are a distinct variety with a unique flavor profile that sets them apart from other apples. Autumn Glory apples are high in dietary fiber and contain antioxidants, making them a healthy snacking choice. The 2lb bag size is convenient for families and individuals looking for a longer-lasting supply of fresh apples .Autumn Glory apples are harvested at their peak ripeness and packed immediately for maximum freshness, ensuring a delicious and crisp eating experience.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/42fad949-7cf9-43ee-b5be-3ea67cb987fe.72abc25b01aa7824a1a69229b82f0015.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/42fad949-7cf9-43ee-b5be-3ea67cb987fe.72abc25b01aa7824a1a69229b82f0015.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/42fad949-7cf9-43ee-b5be-3ea67cb987fe.72abc25b01aa7824a1a69229b82f0015.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
