INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (299053128, 'Fresh Driscoll\'s Strawberries, 15 oz Heart-Shaped Container', 7.97, '715756200320', 'The sweet, juicy flavor of Fresh Strawberries make them a refreshing and delicious treat. The heart-shaped clamshell makes the perfect gift for special occasions. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. They contain essential vitamins and nutrients like, vitamin C, dietary fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Fresh Strawberries today and savor the delectable flavor.', 'Served in a Heart-Shaped Container Prior to serving gently wash the fruit and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'Driscoll\'s', 'https://i5.walmartimages.com/asr/1e9bd70c-17fe-4ec1-b0d8-125caca67bc1.7a4b44a2e7f752bc9d40e4e6172e7527.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1e9bd70c-17fe-4ec1-b0d8-125caca67bc1.7a4b44a2e7f752bc9d40e4e6172e7527.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1e9bd70c-17fe-4ec1-b0d8-125caca67bc1.7a4b44a2e7f752bc9d40e4e6172e7527.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (299394301, 'Fresh Tomato on the Vine, Bag', 1.98, 'deleted_684924020056', 'Keep your recipes simple and classic with fresh tomatoes on the vine. With their vibrant red color, firm and juicy flesh, and unmistakably delicious flavor, this fresh produce item is sure to impress more than just your taste buds. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. The list is endless! Plus, they come right to your kitchen still on the vine that they grew on, meaning that their mouthwatering taste and freshness will be long-lasting for your culinary convenience. Stock up on Walmart\'s Tomatoes On The Vine and keep your dishes looking great and tasting equally as excellent.', 'Tomato on the Vine, Bag: Wholesome, versatile, and delicious Ideal ingredient for a variety of dishes Make a zesty tomato sauce to go along with your favorite pasta Enjoy on their own as a nutritious snack Make a flavorful salsa or add some pop to your guacamole', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
