INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (302234817, 'Stir Fry Mushrooms, 4 oz', 3.48, '084348273043', 'Experience the fresh taste of Stir Fry Mushrooms. This convenient mix of mushrooms features a blend of sliced mushrooms including shiitake, baby bella, white, and portabella. Pre-sliced, the hearty, full-bodied taste of this mushroom blend makes them an excellent addition to beef, wild game, and vegetable dishes. Or add this hearty blend to broths, soups, stews, pizzas, or pasta sauces for a pleasing flavor and texture. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try Stir Fry Mushrooms.', 'Stir Fry Mushrooms, 4 oz: 4-ounce package of sliced mushrooms Blend of sliced mushrooms including shiitake, baby bella, white, and portabella Naturally fat-free Cholesterol-free Low in calories, carbs and sodium Fresh and all natural Best if kept refrigerated Wash before use Natural source of the antioxidant selenium Excellent addition to beef, wild game and vegetable dishes', 'Unbranded', 'https://i5.walmartimages.com/asr/d2f44286-90b8-46ea-a3b7-ad6366b02c1f.78a3c8dc89f092447c8a9b68eb933704.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d2f44286-90b8-46ea-a3b7-ad6366b02c1f.78a3c8dc89f092447c8a9b68eb933704.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d2f44286-90b8-46ea-a3b7-ad6366b02c1f.78a3c8dc89f092447c8a9b68eb933704.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
