INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (303278953, 'Great Value Potato Salad, American Style, 5.4 oz', 1.48, '078742237978', 'Great Value American Style Potato Salad is made with traditional tangy russel potatoes, red bell peppers, green bell peppers, carrots, shallots, celery and a touch of mustard. This American classic is packed with mouthwatering flavors your whole family will enjoy. It is perfect for dozens of occasions whether it be a summer barbecue or a family picnic at the park. Serve it with juicy meatloaf and a garden fresh salad or simply enjoy on its own. It\'s great for health conscious individuals as it contains no trans-fat and cholesterol and is made with no artificial flavors. Boil, mix and serve in minutes to enjoy delicious American Style Potato Salad. Great Value products provide families with affordable, high quality grocery and household consumable options. With our wide range of product categories spanning grocery and household consumables, we offer you a variety of products for your family\'s needs. Our products are conveniently available online and in Walmart stores nationwide, allowing you to stock up and save money at the same time. Stovetop Instructions: in a large pot, bring 6 cups water to a boil. Add sliced potatoes and vegetable blend; boil for 15-17 minutes. Drain. Use a colander to rinse under cold water until potatoes are cold. Drain for 2-3 minutes until completely free from water. Add drained potatoes to a large mixing bowl; add the seasoning blend and mix until well blended. Refrigerate for 1 hour and mix before serving.', 'Great Value American Style Potato Sala: Traditional tangy russel potatoes and a touch of mustard No artificial flavors Made with real potatoes Net weight 5.4 oz', 'Great Value', 'https://i5.walmartimages.com/asr/966c6d02-9214-4417-a1d2-37ec48636044_4.6fe960675003be6ff9e38d58dfa9a7c7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/966c6d02-9214-4417-a1d2-37ec48636044_4.6fe960675003be6ff9e38d58dfa9a7c7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/966c6d02-9214-4417-a1d2-37ec48636044_4.6fe960675003be6ff9e38d58dfa9a7c7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
