INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (304855330, 'Fresh Graprefruit, Each', 2.97, '000000042796', 'Grapefruit is the perfect balance between tart and sweet. The balance between tart and sweet is great for both savory and sweet dishes any time of day. Enjoy half of a grapefruit sprinkled with sugar with some eggs in the morning for a light, sweet breakfast. Slice it up and put in a salad with spinach, avocado, and red onion topped with a mustard and balsamic vinegar dressing for lunch or dinner. Make delicious grapefruit bars that showcase the sweet and tartness of this versatile fruit. For an adult recipe juice the grapefruit and pair with some simple syrup and alcohol for a refreshing cocktail. This fruit is the perfect addition to a healthy diet as it is a great source of vitamin C and vitamin A. With such versatility, Grapefruit will become a pantry staple in your home.', 'Great for both savory and sweet dishes Enjoy it for breakfast, lunch, dinner, or dessert Enjoy half a fresh grapefruit sprinkled with sugar in the morning, slice it up and put it in salad for lunch or dinner, or make grapefruit bars Great source of vitamin C and vitamin A', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9b886c2a-7fc2-4dbd-98fe-99c8e48e6944.f2698681c6f777003cfd13d7c6086d09.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b886c2a-7fc2-4dbd-98fe-99c8e48e6944.f2698681c6f777003cfd13d7c6086d09.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b886c2a-7fc2-4dbd-98fe-99c8e48e6944.f2698681c6f777003cfd13d7c6086d09.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (305458076, 'Apricot, 1 lb Pack', 3.98, 'deleted_896460002797', 'Fresh California Grown Apricots are a treat for the entire family. With a wonderfully sweet and smooth flavor, these apricots are a great snack at any time of the day. For breakfast, you could slice them and put them in your oatmeal or use them to make a satisfying yogurt parfait. You can also incorporate them into a variety of recipes. Use them to make a delectable apricot crisp or apricot cobbler and serve warm topped with ice cream. You can even use them to make a nutritious smoothie or a tasty adult beverage. However you choose to enjoy them, these apricots will satisfy everyone\'s sweet tooth. Enjoy the sweet and refreshing taste of Fresh California Grown Apricots.', 'Fresh California Grown Apricots, 16 oz: Wonderfully smooth and sweet flavor Great snack at any time of the day Use to make a delicious yogurt parfait Make a decadent apricot crisp and top with your favorite ice cream Wonderful addition to smoothies', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4b1fd233-b92f-4557-8c16-d9de02eafde2.cb4e49d4db2c636f20058c32dc26a658.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4b1fd233-b92f-4557-8c16-d9de02eafde2.cb4e49d4db2c636f20058c32dc26a658.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4b1fd233-b92f-4557-8c16-d9de02eafde2.cb4e49d4db2c636f20058c32dc26a658.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
