INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (307114818, 'Fresh Nectarines, 2 lb Bag', 3.97, '095829210860', 'Fresh nectarines are a juicy and flavorful fruit with a smooth skin that ranges in color from pale yellow to vibrant orange-red. These stone fruits have a sweet and tangy taste, similar to peaches but with a slightly firmer texture. With their refreshing and aromatic qualities, fresh nectarines are perfect for enjoying as a healthy snack, adding a burst of flavor to summer salads, or using in a variety of culinary creations. Whether eaten on their own or incorporated into recipes, fresh nectarines are a delicious and nutritious choice for fruit lovers.', 'In terms of nutrition, fresh nectarines are a great choice. They are low in calories and fat, making them a guilt-free indulgence. Additionally, they are an excellent source of vitamins A and C, which are important for maintaining healthy skin, boosting the immune system, and promoting overall well-being. Nectarines also provide dietary fiber, which aids digestion and helps keep you feeling full and satisfied. Whether you\'re looking for a healthy snack, a burst of flavor in your salad, or a versatile ingredient for your culinary creations, fresh nectarines are a fantastic choice. Their juicy sweetness and vibrant color make them a true summer treat that will leave you craving more. So go ahead, savor the taste of these luscious fruits and experience the joy they bring to your palate.', 'Welch\'s', 'https://i5.walmartimages.com/asr/be4ba06a-2659-4db4-99e2-da039bfd1997.2db0b58f2a22bf66bb9e9eae0f74cb30.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/be4ba06a-2659-4db4-99e2-da039bfd1997.2db0b58f2a22bf66bb9e9eae0f74cb30.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/be4ba06a-2659-4db4-99e2-da039bfd1997.2db0b58f2a22bf66bb9e9eae0f74cb30.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
