INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (309762096, 'Fresh Rockit, Crisp Sweet Miniature Apples, 3lb Tub', 9.18, '888289403510', 'Experience the perfect combination of sweetness and crispness with our Fresh Rockit Miniature Apples. Naturally grown to be miniature, these apples are rich in flavor and high in energy. Ideal for snacking, baking, and adding a burst of taste to salads or charcuterie boards. Enjoy the benefits of consuming fewer calories with just two apples totaling 70 calories. Packaged sustainably in 80% rPET containers that can be recycled, it\'s a great choice for conscious consumers who value freshness and environmental responsibility. Available while stocks last.', 'Sweet, crisp and juicy with every bite Conveniently sized for on-the-go snacking Perfect as a healthy treat or seasonal baking ingredient Excellent source of fiber and vitamin C Two apples = 70 calories 80% rPET packaging that can be upcycled or recycled Adds flavor to a variety of recipes Fresh and ready-to-eat food condition Includes Rockit plant variety for a unique taste', 'Rock It', 'https://i5.walmartimages.com/asr/de6d6d44-507a-43e4-9bd9-d86286473870.4d6dbcb5c200885859982510d4314077.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de6d6d44-507a-43e4-9bd9-d86286473870.4d6dbcb5c200885859982510d4314077.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de6d6d44-507a-43e4-9bd9-d86286473870.4d6dbcb5c200885859982510d4314077.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (310071420, 'Sunset One Sweet Tomatoes, 16 oz Flavor Bowl Package, Fresh', 3.5, '057836022577', 'SUNSET One Sweet Tomatoes are 16 ounces of premium cherry snacking tomatoes! Garden inspired flavor perfect for snacking, lunch, or dinner. Try them in salads, pastas, omelets, flatbreads, and more. Mellow juiciness, and the ideal crunch, these tomatoes are perfectly balanced with just the right amount of acidity. Hothouse grown to ensure consistent quality and freshness. Certified non-GMO tomatoes grown without pesticides or herbicides. Store at room temperature for optimal flavor, and wash before enjoying. Plastic football shaped bowl is fun for parties. Enjoy SUNSET One Sweet Tomatoes Flavor Bowl for every game.', 'SUNSET fresh One Sweet cherry snacking tomatoes Mellow juiciness, and the ideal crunch Perfectly balanced with just the right amount of acidity Garden inspired flavor, perfect for snacking, lunch, or dinner Try them in salads, pastas, dips, flatbreads, and more Wash and enjoy Available all-year-long Non-GMO certified Hothouse grown to ensure consistent quality and freshness No pesticides or herbicides 16 oz. plastic footballed shaped bowl is run for parties Store at room temperature for optimal flavor', 'SUNSET', 'https://i5.walmartimages.com/asr/314139fe-54ff-4a08-9f54-0fc154897ac2.89b8253dde0e95a6bc6f2b4ccef83306.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/314139fe-54ff-4a08-9f54-0fc154897ac2.89b8253dde0e95a6bc6f2b4ccef83306.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/314139fe-54ff-4a08-9f54-0fc154897ac2.89b8253dde0e95a6bc6f2b4ccef83306.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
