INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (310765960, 'Fresh Grape Tomato, 9 oz Cup', 3.1, '626074674512', 'Bring the fresh, delicious taste of Grape Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this convenient cup of Grape Tomatoes.', 'Grape Tomato, 9 oz Cup: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Fresh produce in a convenient cup Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/dea2ab29-f27f-4316-b259-b0d076509043.c2aa675524913f14104f23b65651d6ab.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dea2ab29-f27f-4316-b259-b0d076509043.c2aa675524913f14104f23b65651d6ab.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dea2ab29-f27f-4316-b259-b0d076509043.c2aa675524913f14104f23b65651d6ab.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
