INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (317386581, 'Fresh Cherubs Grape Tomatoes, 24 oz Package', 5.38, '751666776050', 'Bring the fresh, delicious taste of NatureSweet Cherubs Grape Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this package of Cherubs Grape Tomatoes. Fair Trade Certified tomatoes are the best way to have a positive impact on the lives of farmers, workers, and their communities. Through fair wages, enhanced health and safety on the job, and Community Development Funds that workers invest to solve their most pressing needs, every fair trade purchase you make has an impact. And you get to enjoy great quality tomatoes while making a difference!', 'Great for Snacking Great for Salads Fair Trade Certified We build them good homes, we protect and nurture them, and the struggle is worth it when the outcome is so fresh and sweet Our associates give our tomatoes the best chance for success Tomatoes raised right', 'NatureSweet', 'https://i5.walmartimages.com/asr/d14b0ded-6657-45bd-b5dd-25f25b815d02.b514981226b2bf924f4f2fe8629d6002.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d14b0ded-6657-45bd-b5dd-25f25b815d02.b514981226b2bf924f4f2fe8629d6002.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d14b0ded-6657-45bd-b5dd-25f25b815d02.b514981226b2bf924f4f2fe8629d6002.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
