INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (318460628, 'Fresh Sweet Twister Peppers, 12 Ounce Bag', 3.98, '057836000179', 'Enjoy the satisfying crunch and flavor of Sweet Twister Peppers. Slice them up and roast for a sweeter, smoky flavor that goes well with your choice of protein. For an appetizer, cut the peppers in half and stuff with a mixture of ground sausage and cream cheese topped with a sprinkle of shredded cheese. You can also eat them on their own for a satisfying crunch or dipped in some ranch for a hint of savory flavors. They\'re an excellent source for vitamin C, low in calories, have no fat or cholesterol, making them perfect as part of a healthy diet. Simply wash the the fresh produce before use and keep refrigerated. Savor the sweet taste of this 12-ounce bag of Sweet Twister Peppers.', 'Fresh Sweet Twister Peppers, 12 Ounce Bag Sweet, crunchy mini bell pepper Roast, bake, or enjoy alone Great for stuffing, sauteing, or dipping in dressing Excellent source for vitamin C, low in calories, have no fat or cholesterol USDA certified organic fresh produce', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e0a44938-aee5-48ea-94d8-6ebec8f467bb_2.cb7ef34fd51165845f91c979202ff17d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e0a44938-aee5-48ea-94d8-6ebec8f467bb_2.cb7ef34fd51165845f91c979202ff17d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e0a44938-aee5-48ea-94d8-6ebec8f467bb_2.cb7ef34fd51165845f91c979202ff17d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
