INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (336420149, 'Fresh Organic Gala Apples, 2 lb Bag', 4.36, '847473003790', 'Treat yourself to the delicious, crisp taste of Organic Gala Apples. Enjoy one with breakfast or lunch or as a fresh snack any time of day. Best of all, these delicious apples hold up well when cooked and can be used in both savory and sweet dishes. They can be used for baking, snacking, salads, pairing, or made into a delicious sauce that pairs perfectly with pork. Try incorporating them into soups and compotes or using to make yummy jam or juice. Use them to create apple crisp, pie, and strudel for a sweet treat. You can even pair them with sharp cheeses and crackers to create a stunning appetizer cheese board to share with guests. The possibilities are endless with Organic Gala Apples.', 'Organic Gala Apples, 2 lb Bag: Includes 2 pounds of crisp apples USDA organic Pair them with sharp cheeses and crackers for a stunning appetizer board Can be enjoyed fresh or cooked into both savory and sweet dishes Meets or exceeds U.S. Extra Fancy Minimum diameter: 2.25\"', 'Fresh Produce', 'https://i5.walmartimages.com/asr/bea96770-c117-4fe8-9d65-070240d40b8c.806bfdc237bdaab49588c964a266e615.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bea96770-c117-4fe8-9d65-070240d40b8c.806bfdc237bdaab49588c964a266e615.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bea96770-c117-4fe8-9d65-070240d40b8c.806bfdc237bdaab49588c964a266e615.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
