INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (338588000, 'Fresh Organic Clementines, 2 lb Bag', 3.98, '014668410019', 'Enjoy the juicy goodness of citrus when you eat a Fresh Organic Clementine. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, clementines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, clementines are now available year-round in most markets. Clementines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, clementines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Fresh Organic Clementines on hand for an easy, healthy treat.', 'Delicious, sweet, juicy fresh citrus Pleasing sweet-tart flavor Easy to peel and segment Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless USDA organic', 'Fresh Produce', 'https://i5.walmartimages.com/asr/19ae05d6-ea3b-4ac0-ae57-7166e37dca18_3.b04fb12f9b7fd7a78a5bb358420c6ad2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19ae05d6-ea3b-4ac0-ae57-7166e37dca18_3.b04fb12f9b7fd7a78a5bb358420c6ad2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19ae05d6-ea3b-4ac0-ae57-7166e37dca18_3.b04fb12f9b7fd7a78a5bb358420c6ad2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
