INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (344246387, 'Fresh Kiku Apple, Each', 1.67, '847473004582', 'Grown with care and picked at the peak of ripeness, our Red Apples are sure to satisfy your cravings. With their sweet and juicy taste, they make for a perfect snack any time of the day. Graced with a classic, vibrant red color, these apples are full of nutrients such as fiber, vitamin C, and antioxidants. Get your daily dose of health and deliciousness with our Red Apples.', 'The Kiku Fresh Apple is a premium apple variety known for its exceptional sweetness, juiciness, and crisp texture. Each apple is medium to large in size, with a round shape and a bright, reddish-orange color. The flesh of the Kiku apple is firm and dense, with a creamy white color that resists browning when cut. The flavor is a perfect balance of sweetness and tartness, with hints of honey and cinnamon. These apples are ideal for snacking, baking, and cooking, and are a great source of fiber, vitamin C, and antioxidants. Whether eaten fresh or used in your favorite recipe, the Kiku apple is a delicious and healthy choice for any apple lover.', 'Unbranded', 'https://i5.walmartimages.com/asr/b0bfd0e9-7888-4463-85d1-fd74defbb5d8.b6aa27465cb48e21debff2c4b1a8c2f2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b0bfd0e9-7888-4463-85d1-fd74defbb5d8.b6aa27465cb48e21debff2c4b1a8c2f2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b0bfd0e9-7888-4463-85d1-fd74defbb5d8.b6aa27465cb48e21debff2c4b1a8c2f2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (344288928, 'Fresh Cut Wrapped Squash, Each', 0.77, '405874800709', 'Add some fresh flavor to your meal with Squash. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. Roast the whole squash for a simple and flavorful side dish, chop it into cubes and put it in the slow cooker with chicken breast, kidney beans, and spices, or make noodles for a gluten-free pasta alternative. For a sweet treat turn the squash into a rich and spicy pie, perfect for the holiday season. With so many uses, this vegetable will become a pantry staple. Create tasty and flavorful meals with Squash', 'Versatile ingredient Roast the whole squash for the perfect side dish or chop into cubes, put into a slow cooker, and mix with chicken breast, beans, and spices for a flavorful dish Use it to create a sweet and decadent pie Make butternut squash noodles for a gluten free pasta alternative Will become a pantry staple', 'Unbranded', 'https://i5.walmartimages.com/asr/b47fe6e6-c49f-4d09-b116-3f98189cac58.4483800345a33f2526ceeee1f5a31453.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b47fe6e6-c49f-4d09-b116-3f98189cac58.4483800345a33f2526ceeee1f5a31453.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b47fe6e6-c49f-4d09-b116-3f98189cac58.4483800345a33f2526ceeee1f5a31453.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (344574482, 'Cece’s® Veggie Co. Organic Summer Squash Grillerz', 4.98, '852287006592', 'At Cece’s® Veggie Co., we believe in simple nutrition. Grillerz are a hot new twist on your favorite grilling fare- 100% organic veggies, crinkle-cut to the ideal size and thickness for flame-kissed flavor. Finished with savory herb butter, Grillerz can be paired with dip for healthy finger food snacking or served as a tasty accompaniment to your favorite protein. Your daily dose of veggies is just a hot rack away! Less prep. Less mess. More veggies. More fun', 'Grillerz are 100% Organic Zucchini and Yellow Squash, crinkle-cut to the ideal size and thickness for flame-kissed flavor. Ready to go from the package straight to the grill, Grillerz will add a healthy sizzle to your summer gatherings!', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f95fdc42-8414-4f4d-a893-70bb84303a6e.42d523cfe30c2adb3e7ef0c0f0182b75.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f95fdc42-8414-4f4d-a893-70bb84303a6e.42d523cfe30c2adb3e7ef0c0f0182b75.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f95fdc42-8414-4f4d-a893-70bb84303a6e.42d523cfe30c2adb3e7ef0c0f0182b75.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
