INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (344728564, 'Marketside Fresh Cauliflower Florets, 12 oz', 2.47, '681131221740', 'Mealtime just got easier with Marketside Cauliflower Florets. You and your dinner guests will love the fresh flavor of these washed and ready-to-eat florets. Each bag contains four 1-cup servings that can be cooked in minutes on the stovetop or in the microwave. Eat them straight from the bag, serve them steamed with a touch of butter and a dash of salt and pepper, or add them to a vegetable soup or casserole. You can even whirl these florets in the food processor to make a low-carb, gluten-free rice alternative. Marketside Cauliflower Florets are bound to be a family favorite! Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Steams right in the bag Keep refrigerated Washed and ready to eat 20 calories per serving 4 servings per bag', 'Marketside', 'https://i5.walmartimages.com/asr/0c6b8a74-e546-4804-bf83-2b35c98aa1b2.5265d9b1455c737239360c6e19cedbbd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0c6b8a74-e546-4804-bf83-2b35c98aa1b2.5265d9b1455c737239360c6e19cedbbd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0c6b8a74-e546-4804-bf83-2b35c98aa1b2.5265d9b1455c737239360c6e19cedbbd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
