INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (346925976, 'Fresh Organic Lady Alice Apple, 2 Lb Bag', 2.5, '804305001256', 'The Organic Lady Alice Apple 2 Lb Bag is a delightful and healthful choice for apple enthusiasts. These apples are organically grown, ensuring they are free from harmful pesticides and chemicals. Each bag contains approximately 8 to 10 apples, offering a perfect snack or addition to any meal. The Lady Alice apple variety is known for its crisp texture and sweet-tart flavor, making it a favorite among apple lovers. With its beautiful red and yellow skin, this apple is not only delicious but also visually appealing. Enjoy the natural goodness and freshness of Organic Lady Alice Apples in this convenient 2 lb bag.', 'Organic Lady Alice Apple 2 Lb Bag The Lady Alice apples in this 2 lb bag are organically grown, ensuring that they are free from harmful pesticides and chemicals. You can enjoy these apples with peace of mind, knowing that they have been produced in an environmentally friendly and sustainable manner. Crisp Texture and Sweet-Tart Flavor: Lady Alice apples are known for their delightful combination of a crisp texture and a sweet-tart flavor. Each bite is a refreshing and satisfying experience, making these apples a favorite among apple enthusiasts. Whether eaten on their own or used in various recipes, these apples are sure to please your taste buds.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b3358f48-ae9c-4136-95ec-b22a32990f45.80007481161d6bb9c080a8104b2e3b3c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b3358f48-ae9c-4136-95ec-b22a32990f45.80007481161d6bb9c080a8104b2e3b3c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b3358f48-ae9c-4136-95ec-b22a32990f45.80007481161d6bb9c080a8104b2e3b3c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
