INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (349305148, 'Fresh Premium Grape Tomato, 1.5 lb Package', 4.98, '057836021495', 'Premium Grape Tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily complements your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Premium Grape Tomatoes are the perfect choice.', 'Premium Grape Tomato, 24 oz Wholesome, versatile, and delicious Greenhouse grown for a sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and snacking Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/41c02210-fe4f-45ab-8926-d9c9725e9e3c.a829a05a0264881ece358da94679204e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/41c02210-fe4f-45ab-8926-d9c9725e9e3c.a829a05a0264881ece358da94679204e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/41c02210-fe4f-45ab-8926-d9c9725e9e3c.a829a05a0264881ece358da94679204e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (349351812, 'Fresh Bosc Pears, Each', 1.21, '804305044130', 'Savor the sweet taste of Fresh Bosc Pears. Bosc Pears are juicy with a honey-sweet flavor that makes them great for breakfast, lunch, dinner, and dessert. Chop the pears up and add them to muffins with walnuts and vanilla for a sweet treat that\'s great for breakfast to get your morning started on a high note. Slice them up and top a pizza with prosciutto, goat cheese, and arugula for a mouthwatering meal perfect for family dinner or dinner party. You could even cut the pear in half and cook it in a skillet with butter, brown sugar, and vanilla for a decadent dessert. Enjoy tasty meals any time of day with Bosc Pears.', 'Fresh Bosc Pear, Each with a honey-sweet flavor Great for breakfast, lunch, dinner, and dessert Chop them up and add to muffins with walnuts and vanilla, slice and add to pizza with prosciutto, goat cheese, and arugula, or cut in half and cook in a skillet with butter, brown sugar, and vanilla Versatile ingredient perfect for both savory and sweet dishes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d888a776-9b9f-4137-b2ec-b685e82ac033.705c44014f935231537c862a7a551e92.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d888a776-9b9f-4137-b2ec-b685e82ac033.705c44014f935231537c862a7a551e92.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d888a776-9b9f-4137-b2ec-b685e82ac033.705c44014f935231537c862a7a551e92.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
