INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (349763385, 'Fresh Organic Grape Tomatoes, 10 oz Package', 2.96, '751666567054', 'Organic Medley Tomatoes are an exciting summer treat, and they\'re the perfect size for skewers, salads and roasting. These bite-sized medley tomatoes look and taste great. Medley tomatoes are a low-calorie treat that are also low in sodium and are a good source of fiber. Whether you are snacking or adding them to your favorite dish. their uses are almost limitless. Try these grape tomatoes with feta cheese, fresh dill and a drizzle of olive oil for a light and delicious Mediterranean treat. Or make a caprese salad with medley tomatoes, fresh basil, fresh mozzarella and balsamic vinegar. With 10-ounces of tomatoes in each package, you\'ll have plenty to make mouthwatering meals. Use your imagination to create delicious dishes with Organic Medley Tomatoes.', 'Organic Medley Tomatoes, 10 oz Package: Perfect size for skewers, salads and roasting Low-calorie, low in sodium, and a good source of fiber Pair with feta cheese, fresh dill, and a drizzle of olive oil for a Mediterranean dish Certified organic', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c12abd1f-2dcc-48ec-8f2f-7ae68c5c7191.f5ee8743ba711fe48df16e3eadf72686.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c12abd1f-2dcc-48ec-8f2f-7ae68c5c7191.f5ee8743ba711fe48df16e3eadf72686.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c12abd1f-2dcc-48ec-8f2f-7ae68c5c7191.f5ee8743ba711fe48df16e3eadf72686.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (350018260, 'Marketside Fresh Halved Brussels Sprouts, 12 oz', 3.47, '681131221764', 'Marketside Halved Brussels Sprouts are packed fresh, washed and ready to eat for your convenience. These brussels sprouts are loaded with nutrients and have a great fresh taste. They are halved and packaged in a convenient microwave safe bag that allows you to steam them in just three minutes. Enjoy them as a wholesome side or use them in all your favorite recipes. They are also delicious roasted, grilled, sauteed, or steamed and will add a great pop of color to your meals. For a quick and easy addition to any dish, bring home Marketside Halved Brussels Sprouts today! Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Washed and ready to eat 4 servings per container Steams in the microwave in minutes Great as a healthy side or snack', 'Marketside', 'https://i5.walmartimages.com/asr/397fe05c-e020-4294-bcad-29f9c82b6c5f.6384d688bbaf2ee63db5fd4981416dd4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/397fe05c-e020-4294-bcad-29f9c82b6c5f.6384d688bbaf2ee63db5fd4981416dd4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/397fe05c-e020-4294-bcad-29f9c82b6c5f.6384d688bbaf2ee63db5fd4981416dd4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
