INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (353767624, 'Dallas Cowboys On-The-Go Guacamole Dip Mini Cups, Gluten-Free, 6 Ct', 4.98, '810041599247', 'Our Original Guacamole is now available in an easy-to-grab cup that is perfect to pack for school lunches, snacking on the go, or topping your tacos, big veggie salads, turkey burgers, and everything in between! ¡Yo Quiero! and the Dallas Cowboys partnered up to bring easy snacks, easy lunches, and easy dinners to life. Whether you\'re planning for tailgating, Friday night dinners or prepping a vegan lunch, the Original Guacamole Mini Cups are sure to satisfy your cravings and delight your guests. Made with the freshest ingredients from real Hass Avocados to jalapeno peppers, this convenient snack or appetizer is perfect for your lunch menu, parties, packed lunch, vegan dinner, or whatever else you might crave. ¡Yo Quiero! Original Guacamole Mini Cups pair wonderfully with chips, sandwhiches, tacos, salads, burgers, and more. You can even turn it into your own version of avocado toast or a dip on the go for vegetables such as carrots. Game day snacking just got better.', 'Our Original Guacamole is now available in an easy-to-grab cup that is perfect to pack for school lunches, snacking on the go, or topping your tacos, big veggie salads, turkey burgers, and everything in between! ¡Yo Quiero! and the Dallas Cowboys partnered up to bring easy snacks, easy lunches, and easy dinners to life. Whether you\'re planning for tailgating, Friday night dinners or prepping a vegan lunch, the Original Guacamole Mini Cups are sure to satisfy your cravings and delight your guests. Made with the freshest ingredients from real Hass Avocados to jalapeno peppers, this convenient snack or appetizer is perfect for your lunch menu, parties, packed lunch, vegan dinner, or whatever else you might crave. ¡Yo Quiero! Original Guacamole Mini Cups pair wonderfully with chips, sandwhiches, tacos, salads, burgers, and more. You can even turn it into your own version of avocado toast or a dip on the go for vegetables such as carrots. Game day snacking just got better.', 'Yo Quiero', 'https://i5.walmartimages.com/asr/0bf6cfa6-28a4-4c27-9d95-5d4f3aa33508.ca2207f73ba74078dce12ece7099164f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0bf6cfa6-28a4-4c27-9d95-5d4f3aa33508.ca2207f73ba74078dce12ece7099164f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0bf6cfa6-28a4-4c27-9d95-5d4f3aa33508.ca2207f73ba74078dce12ece7099164f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
