INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (356079112, 'Orange Cherry Tomato, 12 oz Package', 2.98, '689259004085', 'Bring the fresh, delicious taste of Orange Cherry Tomatoes into your home. Because of their notable flavor and thicker skin, they are a versatile tomato that\'s great for grilling, sauteing, roasting, or baking. Their small size also makes them a quick and simple addition to a fresh salad as well as an excellent finger food for whenever you\'re in the mood for a light snack. Packed with nutrients, orange cherry tomatoes are a deliciously healthy ingredient that adds both vibrant color and mouthwatering flavor to any recipe. For the best flavor and freshness, store these tomatoes at room temperature on your kitchen counter. Make your next meal a marvelous one with these fresh Orange Cherry Tomatoes.', 'Orange Cherry Tomato, 12 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1b00a5d0-81db-4899-a159-9eff72f6dea9.6ba2b4e416def4f2b57223a96d10c4a4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1b00a5d0-81db-4899-a159-9eff72f6dea9.6ba2b4e416def4f2b57223a96d10c4a4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1b00a5d0-81db-4899-a159-9eff72f6dea9.6ba2b4e416def4f2b57223a96d10c4a4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
