INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (356354152, 'Fresh Radish White Daikon', 2.97, '000000045988', 'Add the spicy taste of a Fresh white daikon radish to your next stir fry or salad. Also known as winter radish or Oriental radish, this white root vegetable has a mild flavor and is used in a variety of food dishes. Some cultures pickle it while others grate it and mix it with soy sauce and citrus juice to create a condiment. This white radish has a mild flavor after being boiled and is an excellent addition to soups and stews.', 'Also known as Winter Radish Mild Flavor Great pickled or grated Excellent addition to soups and stews', 'Fresh Produce', 'https://i5.walmartimages.com/asr/29c52535-d2ab-4909-b4f8-c5e1dc0999b2_1.dc4e700cc293daa7e0fe599d0fb2cc77.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/29c52535-d2ab-4909-b4f8-c5e1dc0999b2_1.dc4e700cc293daa7e0fe599d0fb2cc77.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/29c52535-d2ab-4909-b4f8-c5e1dc0999b2_1.dc4e700cc293daa7e0fe599d0fb2cc77.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
