INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (359183113, 'Fresh Grape Tomato, 4 oz Cup', 3.48, '751666418950', 'Add color and flavor to your next meal with Grape Tomatoes. Similar to larger Roma tomatoes, grape tomatoes have a lower water content than cherry tomatoes, making them meatier, more flavorful, and even a little tidier with every bite. They are hardier and less fragile than a traditional tomato as well, so there\'s no need to worry about bruising either. Perfectly bite-sized, grape tomatoes are not only a simple and delicious addition to salads and pasta, but also serve as a quick and convenient snack all on their own. Plus, grape tomatoes have a longer shelf-life, which means it\'s perfectly fine to keep them in storage for several days at a time. All you have to do is grab and enjoy to experience the class tomato taste of Grape tomatoes.', 'Fresh Grape Tomatoes, 3 Pack: Lower water content and longer shelf-life than cherry tomatoes Hardier and more resistant to bruising than traditional tomatoes Conveniently bite-sized Quick and excellent addition to salads and snack trays Best stored at room temperature out of sunlight', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2ff3c060-1f0b-42fb-9dda-6a55cd8a6195.9b473449043488ad84406f3495c0bdaa.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2ff3c060-1f0b-42fb-9dda-6a55cd8a6195.9b473449043488ad84406f3495c0bdaa.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2ff3c060-1f0b-42fb-9dda-6a55cd8a6195.9b473449043488ad84406f3495c0bdaa.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (359815064, 'Gourmet212 Oven Roasted Cherry Tomatoes 8.11oz (6 Pack), Glass, Jarred', 74.95, '191822007084', 'Have you tried semi dried cherry tomatoes? If your answer is no, you should try our product to not to miss out. Sun dried tomatoes are highly recommended just as semi dried tomatoes if it is not the season of fresh tomatoes, however, oven semi dried tomatoes are closer to natural tomato taste than sun dried tomatoes. The semi dried tomatoes are juicier and lighter in color and are also sliced. They are then put in high quality ovens for 6-7 hours with low temperatures. Dehydrated slowly, semi dried tomatoes preserve their taste in flavored oil for long time without any additives. This product is packed with so high quality that keeps fresh for one year on the shelf without oxygen exposure. Some reasons to buy our semi dried cherry tomatoes: It is Halal Certified It is Kosher Certified It?s made with seasonal tomatoes It?s the perfect product for any meat or chicken dish It?s a delicious ingredient for antipasti, pizza, salad, sandwich and pasta Ingredients: sun dried tomatoes (57%), canola oil, salt, sugar, vinegar, garlic powder, spices, acidity regulator (citric acid), antioxidant (ascorbic acid) If you like cherry tomatoes, you shouldn?t miss this product.', 'Gourmet212 Oven Roasted Cherry Tomatoes 8.11 oz (6 Pack), Stuffed, Airtight Glass Jar The semi-dried tomatoes are juicier and lighter in color. They are put in high-quality ovens for 6-7 hours with low temperatures. Dehydrated slowly, semi-dried tomatoes preserve their taste in flavored oil for a long time without any additives. It is Halal and Kosher Certified. Ingredients: sun-dried tomatoes (57%), canola oil, salt, sugar, vinegar, garlic powder, spices, acidity regulator (citric acid), antioxidant (ascorbic acid).', 'Gourmet212', 'https://i5.walmartimages.com/asr/770067a7-88a3-4f16-b19a-de30287ed2d0.35f332d483fde4ae40a3b344022d8220.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/770067a7-88a3-4f16-b19a-de30287ed2d0.35f332d483fde4ae40a3b344022d8220.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/770067a7-88a3-4f16-b19a-de30287ed2d0.35f332d483fde4ae40a3b344022d8220.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
