INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (366347376, 'Organic Way Shatavari Powder (Asparagus Racemosus) Herbal Tea- Organic & Kosher Certified | Raw, Vegan, Non GMO & Gluten Free | USDA Certified | Origin - India (1/4 lbs / 4 oz)', 23.07, '781584828579', 'Organic Way Shatavari Powder (Asparagus Racemosus) Herbal Tea- Organic & Kosher Certified | Raw, Vegan, Non GMO & Gluten Free | USDA Certified | Origin - India (1/4 lbs / 4 oz) Shatavari, scientifically known as Asparagus racemosus, is an herb in Ayurvedic medicine that is a complete health tonic that boosts energy and overall health. This amazing herb supports many bodily functions so it’s a must have in any natural health regime. At Organic Way we go above and beyond to provide products that are authentic and potent. We source high quality, organically grown herbs from around the world and process them in the USA to meet the American market needs. Our commitment to quality is reflected in the fact that all our products are USDA and Kosher certified so you can be sure they are safe to consume. Trust Organic Way for your wellness journey, you know you’re getting the best.', 'Authentic Ayurvedic Tradition: Our Shatavari herbal supplement is a tribute to the time-honored practices of Ayurveda, where Shatavari has been cherished for centuries for its profound benefits. Ethical and Eco-Friendly: We are committed to sustainability and ethical practices. By choosing our organic Shatavari powder, you support responsible farming and the preservation of traditional herbal knowledge. Rejuvenating and Nourishing: Embrace the rejuvenating power of Shatavari as it aids in revitalizing the body and promoting a natural sense of vitality and energy. Resealable Packaging: Our product is packaged in a resealable bag, preserving the shatavari powder freshness and aroma. Enjoy the convenience of portioning out what you need and sealing the rest for later. Satisfaction Guarantee: We are confident with the quality of our product which is why we offer a satisfaction guarantee. This means that if you are not satisfied (although this is highly unlikely to happen), we will give you back your money with no questions asked.', 'Organic Way', 'https://i5.walmartimages.com/asr/77713827-15b8-40e9-b358-c830006abeb7.b5a9d0364326d8d1c40e36f12793becd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77713827-15b8-40e9-b358-c830006abeb7.b5a9d0364326d8d1c40e36f12793becd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77713827-15b8-40e9-b358-c830006abeb7.b5a9d0364326d8d1c40e36f12793becd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
