INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (373016572, 'Freshness Guaranteed Cantaloupe Medium', 4.27, '262824000004', 'Discover the sweet and juicy flavor of Freshness Guaranteed Cantaloupe, a delicious and refreshing fruit that\'s perfect for any occasion. Our Cantaloups are carefully selected to ensure the highest quality and freshness. Whether you\'re adding it to a fruit salad or enjoying it as a healthy snack, Cantaloup is the perfect choice for anyone who loves the taste of fresh, natural fruit. Order now and experience the irresistible flavor of Cantaloup for yourself!', 'Freshness Guaranteed Cantaloupe Medium Contains Cantaloupe Packed in a secure plastic bowl with lid Portable and convenient Provides many essential nutrients', 'Freshness Guaranteed', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (373238289, 'Fresh Limes, 1 lb Bag', 2.48, '729062142724', 'Add zest and flavor to your meals and beverages with these Marketside Organic Limes. Limes are a key ingredient in many recipes, from homemade salsa to chicken dishes. Drizzle lime juice over fish or add it to your favorite sauces. Serve wedges of raw lime with your favorite cocktails and use them when baking cakes, cookies, and tarts. These limes are sold in a one-pound bag, so you\'ll have plenty for all your culinary creations. Enjoy the refreshing, tart flavor of Marketside Organic Limes.Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Limes, 1 each: Juicy and fresh, packed with vitamin C Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use them when baking cakes, cookies and tarts Refreshing, tart flavor', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f072f9e2-a6a0-4eaa-af29-7c2a03f7a91a.106bb77212a805ddc392bdd73180acd9.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f072f9e2-a6a0-4eaa-af29-7c2a03f7a91a.106bb77212a805ddc392bdd73180acd9.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f072f9e2-a6a0-4eaa-af29-7c2a03f7a91a.106bb77212a805ddc392bdd73180acd9.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (373294615, 'Fresh Fieldpack Unbranded Japanese Eggplant', 3.48, '000000046015', 'Savor the unique flavor and texture of our Fresh Whole Japanese Eggplant, a versatile and delectable addition to your culinary adventures. These slender, glossy purple eggplants boast a delicate, mildly sweet taste, and a tender, creamy texture when cooked. Ideal for a variety of dishes, from traditional Japanese cuisine to modern fusion recipes, our Japanese Eggplant can be grilled, roasted, or stir-fried to perfection. Elevate your meals with the exceptional taste and versatility of our exquisite Japanese Eggplant.', 'Fieldpack Unbranded Japanese Eggplant Savor the unique flavor and texture of our Fresh Whole Japanese Eggplant, a versatile and delectable addition to your culinary adventures. These slender, glossy purple eggplants boast a delicate, mildly sweet taste, and a tender, creamy texture when cooked. Ideal for a variety of dishes, from traditional Japanese cuisine to modern fusion recipes, our Japanese Eggplant can be grilled, roasted, or stir-fried to perfection. Elevate your meals with the exceptional taste and versatility of our exquisite Japanese Eggplant.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7cdc4c15-cec9-40f7-95f3-92171c36cf31.f7fb6b8fb72fbf416a1eb47bfbec9f3d.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7cdc4c15-cec9-40f7-95f3-92171c36cf31.f7fb6b8fb72fbf416a1eb47bfbec9f3d.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7cdc4c15-cec9-40f7-95f3-92171c36cf31.f7fb6b8fb72fbf416a1eb47bfbec9f3d.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
