INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (374006257, 'Crunch Pak Fresh Sweet Apple Slices, Family Size, 14 oz Resealable Bag', 3.97, '732313001701', 'Savor the fresh sweet taste of Crunch Pak Sweet Apple Slices. These perfectly sweet, sliced apples are the ultimate quick, easy, and healthy treat. Serve with a dollop of peanut butter and enjoy as a healthy snack that both kids and adults will love. Chop the apples up and add them to a salad with walnut, mixed greens, and a poppy seed vinaigrette for a crunchy delicious salad that you can enjoy for lunch or dinner. Add it to your favorite smoothie or juice blend for a morning pick me up to get your day started right. Throw some in a bag in with your lunch for a healthy side, take with you as you go travel or pack a couple of bags and take on a picnic with your family. Enjoy the convenience and taste of Crunch Pak Sweet Apple Slices in a Resealable Bag. Only 80 calories per serving. No added sugars.', 'Crunch Pak Fresh Sweet Apple Slices Perfect on-the-go healthy snack Good source of vitamin C Equals 1.3 lbs of whole apples 80 calories per serving No added sugars Conveniently Sliced', 'Crunch Pak', 'https://i5.walmartimages.com/asr/31107388-55e1-4f11-ab07-1b8d71532953.ed1d75cd1d8bcedda1fb600b03234061.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/31107388-55e1-4f11-ab07-1b8d71532953.ed1d75cd1d8bcedda1fb600b03234061.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/31107388-55e1-4f11-ab07-1b8d71532953.ed1d75cd1d8bcedda1fb600b03234061.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
