INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (378975500, 'AVO BAG 10/4 40 MXGF', 3.28, 'deleted_850758006584', 'Avocados aren’t just great-tasting fresh produce, but they are a nutrient-dense food enjoyed around the world. Because of the creamy texture and mild flavor of Hass avocados, they are a versatile ingredient that can be used in many different types of recipes and dishes. Not only are our jumbo avocado a great ingredient to use in numerous ways, but it is also a healthy food that contributes unsaturated “good” fats and almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9. Jumbo ripe avocados will have dark green to nearly black skin color, a bumpy skin texture and should yield to gentle pressure without leaving indentations or feeling mushy. Avocados with a slightly bumpy texture should be ripe in 1 to 2 days. They will also be somewhat firm and have a dark green and black speckled color. You’ll be ready to enjoy tasty avocados on their own or as part of a salad, fresh guacamole, taco, burrito or avocado toast. The possibilities are deliciously endless.', 'Large Avocado 4 Count Bag', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/bff80901-b099-4450-9ea6-7505bedb8071.7fcbc0bfea3f5d81022267d85718fbb7.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bff80901-b099-4450-9ea6-7505bedb8071.7fcbc0bfea3f5d81022267d85718fbb7.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bff80901-b099-4450-9ea6-7505bedb8071.7fcbc0bfea3f5d81022267d85718fbb7.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
