INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (380396374, 'Sweet Potatoes Whole Fresh, 3 lb Bag', 4.88, 'deleted_819614010059', 'Create something wholesome and delicious with these Sweet Potatoes. Sometimes referred to as yams, these versatile vegetables can be used multiple ways: to make savory sides or sweet treats. Try them roasted or baked for a tasty addition to any dish. You could also use them to make seasoned sweet potato fries or a flavorful hummus dip for your next party. If you want to satisfy your sweet tooth, try them in a traditional sweet potato casserole or use them to make sweet potato and brown sugar ice cream. The mouthwatering possibilities are endless with this hearty fresh produce vegetable. Add something amazing to your meals with this three-pound bag of Sweet Potatoes.', 'Sweet Potatoes Whole Fresh, 3 lb Bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d6ffc4ab-e36b-43d4-886c-5e5e022d32a6_2.9eb8a55e9bbca5ef2220ed8d9562a9fe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d6ffc4ab-e36b-43d4-886c-5e5e022d32a6_2.9eb8a55e9bbca5ef2220ed8d9562a9fe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d6ffc4ab-e36b-43d4-886c-5e5e022d32a6_2.9eb8a55e9bbca5ef2220ed8d9562a9fe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
