INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (384521299, 'Fresh Kiwi Puerto Rico, Each', 0.57, '405980551571', 'Kiwi, or kiwifruit, is a small fruit native to China with a unique tart-sweet flavor and a vibrant green flesh covered by a fuzzy brown skin. It is highly nutritious, packed with essential nutrients like vitamins C and E, potassium, and dietary fiber. Kiwi is often enjoyed raw, in salads, smoothies, or desserts. Its high vitamin C content surpasses the daily recommended intake, and it also contains beneficial antioxidants and serotonin.', 'Fresh kiwi, also known as kiwifruit or Chinese gooseberry, is a small, fuzzy, brown-skinned fruit native to China but now primarily grown in New Zealand, Italy, and California (Genus Epithet). Its vibrant green flesh offers a unique tart-sweet flavor and is encased by a thin, edible skin. Kiwi is highly nutritious and is often enjoyed raw in salads, smoothies, or simply scooped straight from the skin. Taste and Culinary Uses: Kiwi has a distinctive tart-sweet flavor, often described as a mix of strawberries, melons, and bananas. Its bright green flesh and black seeds make it visually appealing, and it can be used in salads, desserts, smoothies, or served with yogurt. Kiwi can also be used as a tenderizer for meats due to its high content of the enzyme actinidin. Health Benefits: Kiwi is packed with essential nutrients such as vitamins C and E, potassium, and dietary fiber. It is particularly known for its high vitamin C content, with just one kiwi providing more than the daily recommended intake. Kiwi also contains antioxidants and serotonin, which can improve sleep quality. Cultivation and Harvest: Kiwi plants are vine-grown, often requiring trellising for support. They thrive in temperate climates with plenty of sunshine and well-drained soil. Kiwi fruit is typically harvested before it is fully ripe, as it continues to ripen after being picked. The fruit is ready to eat when it yields to gentle pressure, similar to a ripe peach.', 'Unbranded', 'https://i5.walmartimages.com/asr/da37e01a-625d-449f-b01b-ec9cac9ae320.d0a65591ed49fbd83843a2b9434eb2c1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/da37e01a-625d-449f-b01b-ec9cac9ae320.d0a65591ed49fbd83843a2b9434eb2c1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/da37e01a-625d-449f-b01b-ec9cac9ae320.d0a65591ed49fbd83843a2b9434eb2c1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (385190443, 'Fresh Organic Limes, 1 lb Bag', 2.98, 'deleted_744430275514', 'Add zest and flavor to your meals and beverages with these Marketside Organic Limes. Limes are a key ingredient in many recipes, from homemade salsa to chicken dishes. Drizzle lime juice over fish or add it to your favorite sauces. Serve wedges of raw lime with your favorite cocktails and use them when baking cakes, cookies, and tarts. These limes are sold in a one-pound bag, so you\'ll have plenty for all your culinary creations. Enjoy the refreshing, tart flavor of Marketside Organic Limes.Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Fresh and juicy limes USDA organic Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use them when baking cakes, cookies, and tarts Refreshing, tart flavor', 'Fresh Produce', 'https://i5.walmartimages.com/asr/99fcff31-ba31-463d-b48e-a1a4bae790e6.5f21184a1be56cc76c91d42deb49313d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/99fcff31-ba31-463d-b48e-a1a4bae790e6.5f21184a1be56cc76c91d42deb49313d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/99fcff31-ba31-463d-b48e-a1a4bae790e6.5f21184a1be56cc76c91d42deb49313d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
