INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (387924353, 'Organic Yellow Squash', 2.96, '741243003020', 'Organic Yellow Squash is an extremely versatile vegetable that is a must-have for every cook. This yellow squash is USDA certified organic, so you know you are getting a wholesome vegetable. You can prepare the squash in many different ways. Saute it with butter and serve with your choice of protein, like pork chops or grilled chicken breast. You can slice it and fry it up Southern-style, or you can incorporate it into a casserole for a little comfort food. For a sweet treat use the squash to bake a decadent lemon and yellow squash muffins, you can through in some blueberries for a fresh addition. The culinary possibilities are endless with Organic Yellow Squash.', 'Organic Yellow Squash', 'Wholesum', 'https://i5.walmartimages.com/asr/95621439-ba87-4d86-949f-9439f6d1cd94.4ae5136ff13cc71e137af2c9fab4192d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/95621439-ba87-4d86-949f-9439f6d1cd94.4ae5136ff13cc71e137af2c9fab4192d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/95621439-ba87-4d86-949f-9439f6d1cd94.4ae5136ff13cc71e137af2c9fab4192d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
