INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (388472287, 'Earthbound Farms Fresh Organic Vegetable Medley Blend, 9 oz', 3.98, '032601952754', 'What\'s better than organic vegetables? Earthbound Farms Organic Vegetable Medley, a medley of three organic vegetables! All washed, prepped, and ready to eat, this organic medley contains fresh broccoli florets, fresh cauliflower florets, and fresh baby carrots. The nine-ounce package contains about three servings. Each three-ounce serving is only 30 calories and gives you two grams of fiber and two grams of protein. To serve, use this versatile mix as the single easiest way to lay out your own vegetable tray the next time you\'re expecting company, or simply eat it right out of the bag with your favorite dip. This combination is also great in colorful stir fry recipes. Toss into a hot pan or wok with oil and your favorite tangy stir fry sauce, and serve over rice. Or, for a cheesier side dish, try baking the Earthbound Farms Organic Vegetable Medley with a white sauce or cheese sauce and feel great about the dish you\'re serving up tonight.', 'Earthbound Farms Fresh Organic Vegetable Medley Blend in a 9-ounce bag Ready to eat on the go Recipe-ready vegetables Washed and ready to enjoy Fresh organic snack Make your own veggie tray', 'Earthbound Farm', 'https://i5.walmartimages.com/asr/a65f2c68-5a88-4ada-8f12-1184306f59a3.5bbb011cd33a5d92a64c58e37cb40ad8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a65f2c68-5a88-4ada-8f12-1184306f59a3.5bbb011cd33a5d92a64c58e37cb40ad8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a65f2c68-5a88-4ada-8f12-1184306f59a3.5bbb011cd33a5d92a64c58e37cb40ad8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
