INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (388803367, 'Fresh Medley Tomato, 10 oz Package', 3.48, 'deleted_669058801245', 'Bring the fresh, delicious taste of Medley Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this package of Medley Tomatoes.', 'Medley Tomato, 10 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ed6a8bd2-fe74-41cc-ab71-a490692de4ca.233a3367c52ebed8e8129d2546c9a195.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed6a8bd2-fe74-41cc-ab71-a490692de4ca.233a3367c52ebed8e8129d2546c9a195.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed6a8bd2-fe74-41cc-ab71-a490692de4ca.233a3367c52ebed8e8129d2546c9a195.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
