INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (390125991, 'SWEET MINI PEPPERS', 2.88, 'deleted_689259003453', 'Whether you’re looking for a healthy and simple on-the-go snack, or a fresh new ingredient to brighten up an appetizer, Mini Sweet Peppers are a nutritious and delicious option you are sure to enjoy. These vibrant, snack-size Peppers are easy to add to school lunches, appetizers, salads, and so much more. It takes so little time to prepare Mini Sweet Peppers for snacking or serving that they will easily become your favorite fresh ingredient! Their crisp bite, sweet flavor, and satisfying crunch will always hit the spot (even for the pickiest eaters). Although Mini Sweet Peppers are on the smaller end of the Sweet Pepper family, they are still a great source of essential nutrients including vitamin C. And we can’t forget about where they come from: greenhouse-grown in a controlled environment, Mini Sweet Peppers are given the utmost care before being picked, packed, and shipped to your local Walmart store', 'Sweet Mini Peppers', 'Produce Unbranded', 'https://i5.walmartimages.com/asr/8157ba8c-67d0-44fc-acd4-e1d3ce9e4c38.9ff81bf52c35fd82f0039571bdd6db5f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8157ba8c-67d0-44fc-acd4-e1d3ce9e4c38.9ff81bf52c35fd82f0039571bdd6db5f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8157ba8c-67d0-44fc-acd4-e1d3ce9e4c38.9ff81bf52c35fd82f0039571bdd6db5f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
