INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (395538498, 'Marketside Fresh Cut Pineapple, 10 oz Tray', 3.72, '681131180429', 'Experience a burst of tropical flavors with these Marketside Pineapple Chunks. The pre-cut chunks of ripe pineapple are juicy and sweet to taste and are packed in its own juice. Carry them with you and eat them straight out of the tray any time you want, at home or on-the-go. You can also use them to top desserts and ice creams, in a fruit salad or blend them with milk to make milkshakes. Add some fresh fruit to your daily menu today with these Marketside Pineapple Chunks. Marketside provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Marketside item.', 'Marketside Pineapple 10 oz Comes in a re-closable container to help maintain freshness Great for breakfast, lunch, dessert, or when you want a snack No preservatives, artificial colors or artificial flavors Convenient and portable Share with friends and family or keep for yourself Make a fruit bowl topped with whipped cream or a yogurt parfait Enjoy on their own or in a variety of recipes', 'Marketside', 'https://i5.walmartimages.com/asr/d370fb9e-85ea-41f2-9521-ea0457694fde.606024c46189cc90a16e547c839ca17a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d370fb9e-85ea-41f2-9521-ea0457694fde.606024c46189cc90a16e547c839ca17a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d370fb9e-85ea-41f2-9521-ea0457694fde.606024c46189cc90a16e547c839ca17a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
