INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (396378609, 'Red Bell Pepper, each', 1.38, 'deleted_856745008043', 'Enhance your meals with the delicious flavor of Red Bell Peppers. This vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Red bell pepper, also known as red capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them and add to a deli sandwich, saute them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out red bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. Lunches and dinners are more scrumptious when fresh red peppers are part of the meal. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudite. Cooked or uncooked, Red Bell Peppers are an excellent item to have on hand.', 'Red Bell Pepper, 1 each: Naturally low in calories Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh red peppers', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/3e7798c2-b396-47ca-af17-78dfa3ce2b4a_2.013ab2925acb792bc065227f97aac0da.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e7798c2-b396-47ca-af17-78dfa3ce2b4a_2.013ab2925acb792bc065227f97aac0da.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e7798c2-b396-47ca-af17-78dfa3ce2b4a_2.013ab2925acb792bc065227f97aac0da.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (396556953, 'Fresh Opal Apples, 2 lb Bag', 3.97, '885880029637', 'These sunny fruits are like no other! Opal® apples are beautifully bright yellow with a distinctively crunchy texture and a sweet, tangy flavor. Sweet, crisp, and naturally non-browning, Opal® apples won\'t brown after cutting making them snack time heroes by staying fresh all day long. Opal® apples are also known as the apple that gives back, as they sponsor the Youth Make a Difference initiative to address food issues in communities across the U.S. Taste the difference and make a difference with your purchase of Opal® apples.', 'Crisp and Sweet Naturally Non-Browning Non-GMO Certified Bright Golden Color', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4fd38e8b-b132-437c-9033-fb23bdafd879.e8761603ae728940f2bcd989fa0c04e8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4fd38e8b-b132-437c-9033-fb23bdafd879.e8761603ae728940f2bcd989fa0c04e8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4fd38e8b-b132-437c-9033-fb23bdafd879.e8761603ae728940f2bcd989fa0c04e8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
