INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (396803200, 'Fresh Purple Cauliflower, Each', 8.47, '405779412335', 'Fresh Colorful Cauliflower - a vibrant twist on the classic white variety. With the same great taste, this cauliflower offers an extra antioxidant boost from its purple pigment. Add a pop of color to your plate effortlessly with this nutritious and delicious option. Brighten up your meals and enjoy the benefits of a colorful and nutritious addition to your diet. Try our Colorful Cauliflower today and elevate your culinary experience.', 'Protein, carbohydrates Ample Vitamin C antioxidant contains fiber', 'PRODUCE UNBRANDED', '', '', '');
