INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (408053397, 'Fresh Premium Grape Tomato, 4 oz Package', 0.01, '751666772458', 'Bring the fresh, delicious taste of Premium Grape Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this package of Premium Grape Tomatoes.', 'Premium Grape Tomato, 10 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8c3423a6-d5f1-4e00-926a-41f316288808.89ce7b3f27c9a70b987d7c19edc72f1a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8c3423a6-d5f1-4e00-926a-41f316288808.89ce7b3f27c9a70b987d7c19edc72f1a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8c3423a6-d5f1-4e00-926a-41f316288808.89ce7b3f27c9a70b987d7c19edc72f1a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (408384428, 'Fresh Samba Papaya, Each', 1.14, '858335003285', 'Fresh Samba Papaya is a delightful variety of the tropical fruit, known for its sweetness and vibrant color. This variety is native to South America but has gained popularity across the globe due to its unique flavor and health benefits. The fruit is oval-shaped and has a rich, orange hue when ripe. Its flesh is juicy, sweet, and loaded with a wealth of health-enhancing nutrients. The taste is often compared to melons, but with a more exotic, tropical twist. The texture is incredibly soft and buttery, melting in your mouth with every bite. The fruit\'s black seeds are edible but have a bitter flavor, so they are usually removed before eating. Samba Papayas are a powerhouse of nutrients. They are rich in vitamin C, vitamin A, folate, and dietary fiber. The fruit is also an excellent source of antioxidants which help to combat free radicals in the body. Additionally, Samba Papayas contain a unique enzyme called papain, known for its digestive benefits and ability to break down proteins. Samba Papaya trees are usually grown in tropical and subtropical climates, requiring ample sunlight and well-drained soil. The trees start bearing fruit within a year of planting and can be harvested year-round. The fruits are picked when they show hints of changing from green to yellow, as they continue to ripen even after being picked.', 'Fresh Samba Papaya, Each Known for its sweetness and vibrant color Juicy, sweet, and loaded with a wealth of health-enhancing nutrients Rich in vitamin C, vitamin A, folate, and dietary fiber Taste is often compared to melons, but with a more exotic, tropical twist Also known as Hawaiian Papaya, Solo Papaya, and Samba Papaya', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1502c948-f96e-4266-a437-43fd24410d85.66080b9b6b123c13cda48a40e4ef49cd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1502c948-f96e-4266-a437-43fd24410d85.66080b9b6b123c13cda48a40e4ef49cd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1502c948-f96e-4266-a437-43fd24410d85.66080b9b6b123c13cda48a40e4ef49cd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (408435428, 'Fresh Tangerine, Each', 1.86, '405717637660', 'Enjoy the juicy goodness of citrus when you eat a Fresh Tangerine. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, tangerines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, tangerines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the tangerines hang out in a bowl on your counter or table to breathe. Compact and portable, tangerines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Fresh Tangerines on hand for an easy, healthy treat.', 'Delicious, sweet, juicy citrus Pleasing sweet-tart flavor Easy to peel and segment Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless Enjoy by the each.', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/e1b8f441-4bf5-41f8-a70f-351a43586ba3.a21ce8e0a5c89e75f4ffcb40bb0c2144.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e1b8f441-4bf5-41f8-a70f-351a43586ba3.a21ce8e0a5c89e75f4ffcb40bb0c2144.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e1b8f441-4bf5-41f8-a70f-351a43586ba3.a21ce8e0a5c89e75f4ffcb40bb0c2144.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
