INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (409437225, 'Fresh Navel Oranges, 8 lb Bag', 8.94, 'deleted_845963110089', 'Enjoy the juicy goodness of these Large Bagged Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, these Large Bagged Oranges will add flavor to any meal or beverage.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes Use as a garnish for your favorite cocktail Make sweet desserts like ambrosia, orange bars, and orange pie', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9620d207-bf74-4dc0-a4d6-c3a4cfba9673.6b99ac0a6eb8d3ac87c83df2e7b72d6f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9620d207-bf74-4dc0-a4d6-c3a4cfba9673.6b99ac0a6eb8d3ac87c83df2e7b72d6f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9620d207-bf74-4dc0-a4d6-c3a4cfba9673.6b99ac0a6eb8d3ac87c83df2e7b72d6f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
