INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (411358147, 'Fresh Organic Roma Tomatoes, 1 lb Bag', 2.46, '885773045195', 'Bring the fresh, delicious taste of Organic Roma Tomatoes into your home. These tomatoes deliver rich and juicy flavor with each bite and are an ideal ingredient in a variety of recipes. Use them to make a tasty homemade pasta sauce, a comforting tomato soup, or fresh salsa. You could also use them to make a delicious pesto or bruschetta that you can serve at your next dinner party. Whether you slice or dice them, these organic tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with these fresh Organic Roma Tomatoes.', 'Wholesome, versatile, and delicious Rich, juicy flavor in each bite Ideal ingredient for a variety of dishes Use to make pasta sauce, tomato soup, or fresh salsa Make a tasty pesto or bruschetta to serve at your next dinner party USDA organic Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
