INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (416974854, 'Fresh Kiwi Puerto Rico, Each', 4.68, '405699466128', 'Kiwi, or kiwifruit, is a small fruit native to China with a unique tart-sweet flavor and a vibrant green flesh covered by a fuzzy brown skin. It is highly nutritious, packed with essential nutrients like vitamins C and E, potassium, and dietary fiber. Kiwi is often enjoyed raw, in salads, smoothies, or desserts. Its high vitamin C content surpasses the daily recommended intake, and it also contains beneficial antioxidants and serotonin.', 'The kiwi, also known as kiwifruit or Chinese gooseberry, is a small, fuzzy, brown-skinned fruit native to China but now primarily grown in New Zealand, Italy, and California. Its vibrant green flesh offers a unique tart-sweet flavor and is encased by a thin, edible skin. Kiwi is highly nutritious and is often enjoyed raw in salads, smoothies, or simply scooped straight from the skin.• Taste and Culinary Uses: Kiwi has a distinctive tart-sweet flavor, often described as a mix of strawberries, melons, and bananas. Its bright green flesh and black seeds make it visually appealing, and it can be used in salads, desserts, smoothies, or served with yogurt. Kiwi can also be used as a tenderizer for meats due to its high content of the enzyme actinidin.• Health Benefits: Kiwi is packed with essential nutrients such as vitamins C and E, potassium, and dietary fiber. It is particularly known for its high vitamin C content, with just one kiwi providing more than the daily recommended intake. Kiwi also contains antioxidants and serotonin, which can improve sleep quality.• Cultivation and Harvest: Kiwi plants are vine-grown, often requiring trellising for support. They thrive in temperate climates with plenty of sunshine and well-drained soil. Kiwi fruit is typically harvested before it is fully ripe, as it continues to ripen after being picked. The fruit is ready to eat when it yields to gentle pressure, similar to a ripe peach.', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/7015d197-f527-4e1f-93c7-fe5261625da2_1.db3520db33d6509cbf440d3f3b8a08ba.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7015d197-f527-4e1f-93c7-fe5261625da2_1.db3520db33d6509cbf440d3f3b8a08ba.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7015d197-f527-4e1f-93c7-fe5261625da2_1.db3520db33d6509cbf440d3f3b8a08ba.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
