INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (421259493, 'Brussels Sprouts, 12 Oz.', 2.48, '605806122354', 'Brussles Sprouts, Bag 12 OZ Steams in pack. Per Serving: 35 calories; 0 g sat fat (0% DV); 20 mg sodium (1% DV); 2 g sugars; vitamin C (120% DV); vitamin K (190% DV). Find Delicious Recipes: GreenGiantFresh.com. Questions or comments? 1-800-998-9996. Follow us on: Facebook and Twitter. Facebook. Twitter. Find delicious recipes, helpful tips & more: Scan code with app; greengiantfresh.com/value-added. Product of USA. Perishable. Keep refrigerated. Microwave in Bag Directions: 1. Pierce bag with fork. 2. Place bag on microwavable plate. 3. Microwave on high for 2-3 minutes. For softer texture, add up to 1 minute. Let sit for 1 minute. Caution: Contents and bag hot! 4. Open bag, pour contents into serving dish and enjoy. Because microwaves vary, cook times are approximate. Saute Directions: 1. Cut 12 oz Brussels Sprouts in half. 2. Heat 2 tbsp olive oil in a skillet on medium-high. Add Brussels Sprouts, 1/2 tsp salt and 1/4 tsp pepper; toss to coat. 3. Pan roast for 8-10 minutes or until nicely browned and tender. 4. Serve and enjoy. Oven-Roast Directions: 1. In a bowl, toss to coat 12 oz Brussels Sprouts, halved, in 2 tbsp olive oil, 1/2 tsp salt, 1/4 tsp pepper. 2. Place on a baking sheet. 3. Roast at 400 degrees F for 25-35 minutes or until nicely browned and tender. 4. Serve and enjoy. Serving Suggestions: Roast according to recipe above adding 2 oz diced pancetta until golden brown. Sprinkle with grated parmesan cheese and serve. Shred (thinly sliced) Brussels Sprouts for a salad or slaw. Make a crunchy topping for cooked meats and side dishes. Lightly toss thinly sliced Brussels Sprouts with olive oil, a pinch of salt and pepper, or your favorite seasonings. Bake at 450 degrees F stirring often until crispy, about 10-15 minutes. 12 oz (340 g) Salinas, CA 93901 800-998-9996 2013 Growers Marketing, LLC', 'Brussels SproutsSteams in pack. Per Serving: 35 calories; 0 g sat fat (0% DV); 20 mg sodium (1% DV); 2 g sugars; vitamin C (120% DV); vitamin K (190% DV). Find Delicious Recipes: GreenGiantFresh.com. Questions or comments? 1-800-998-9996. Follow us on: Facebook and Twitter. Facebook. Twitter. Find delicious recipes, helpful tips & more: Scan code with app; greengiantfresh.com/value-added. Product of USA.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/db46c4f4-45f3-44d0-adab-1a2f475f13bc.bd54e0f5870b1c8483dd6dcec7f211d0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/db46c4f4-45f3-44d0-adab-1a2f475f13bc.bd54e0f5870b1c8483dd6dcec7f211d0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/db46c4f4-45f3-44d0-adab-1a2f475f13bc.bd54e0f5870b1c8483dd6dcec7f211d0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
