INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (430906516, 'Robinson Fresh Anaheim Peppers, 1 Pound Bag', 2.68, '883616005054', 'Discover the Anaheim pepper, a culinary delight! With its narrow, round-tipped shape and vibrant pale to glossy green color, this pepper measures approximately 6-8 inches in length. Named after its birthplace, Anaheim, California, it is cherished for its sweet and mild flavor. Elevate your dishes with the irresistible taste of the Anaheim pepper - a true culinary gem. Find this Whole and Fresh pepper at Walmart.', 'Anaheim’s may be used as a slightly hotter pepper substitute for bell peppers. > For a more mild, smoky flavor, roast before using. For a fresh, hot flavor, consume raw. If used in Latin American recipes, pair with cilantro, lime, mole sauce, beans, tomatillos and tomatoes. For Asian dishes, pair with coconut milk, fish sauce, ginger, limes, peanuts, sesame oil and soy sauce. To store, refrigerate in its original packaging for up to one week. Wash well before using. Peppers are a great way to add flavor into one\'s diet and lessen the need to add salt. Anaheim’s may be used as a slightly hotter pepper substitute for bell peppers. > For a more mild, smoky flavor, roast before using. For a fresh, hot flavor, consume raw. If used in Latin American recipes, pair with cilantro, lime, mole sauce, beans, tomatillos and tomatoes. For Asian dishes, pair with coconut milk, fish sauce, ginger, limes, peanuts, sesame oil and soy sauce. To store, refrigerate in its original packaging for up to one week. Wash well before using. Enjoy the crisp fresh flavor. Wash before eating', 'Robinson Fresh', 'https://i5.walmartimages.com/asr/12beb1a4-4e51-49b2-a646-ab31e9370691.3a8257fe3a3f62914e2b5df63d313a52.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/12beb1a4-4e51-49b2-a646-ab31e9370691.3a8257f