INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (431691571, 'Aprium, 1.5 lb Carton', 5.38, '847081000419', 'Any fan of plums or apricots should experience the hybrid taste of Apriums. Combining all your favorite parts of an apricot with a healthy touch of plum, apriums are small and juicy with a velvety exterior, firm texture, and sweet taste that makes them excellent for creating a variety of homemade goods. Chutneys, desserts, and fruity garnishes are all perfect recipes to test out the aprium\'s unique flavor profile, and you can simply swap them for apricots in any of your current favorites. For a quick snack on the go, apriums are also enjoyable when eaten raw, just like any apricot or plum. Expand your stone fruit experience and be sure to try out Apriums.', 'Apriums, 1.5 lbs, 9 Count: 9-pack of fresh apriums Hybrid stone fruit created from a mixture of apricots and plums Firm texture with smooth skin and slight fuzz Sweet taste Can be substituted in recipes in the place of apricots Enjoyable in homemade bakes or when eaten raw', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6f47b32f-e4f8-4f49-823a-be261b540d7d.61ee9f038b819d848a9cbf5af23fa022.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6f47b32f-e4f8-4f49-823a-be261b540d7d.61ee9f038b819d848a9cbf5af23fa022.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6f47b32f-e4f8-4f49-823a-be261b540d7d.61ee9f038b819d848a9cbf5af23fa022.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
