INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (431946908, 'Lady Alice Fresh Apples, Each', 2.97, '804305036043', 'Lady Alice Apples are a premium variety of fresh apples known for their sweet and tangy flavor. These apples are firm and juicy with a unique texture that is perfect for snacking, baking, and cooking. They have a beautiful deep red color with yellow speckles that make them an elegant choice for fruit bowls and centerpieces. Lady Alice Apples are available seasonally and make a great addition to any fall recipe or festive occasion. Order now to enjoy the delicious taste of this exquisite fruit.', 'Lady Alice Apples are a premium apple variety known for their unique flavor, firm texture, and beautiful appearance. Each apple is medium to large in size, with a round shape and a striking orange-red color that fades into yellow-green at the stem. The flesh of the Lady Alice apple is firm and crisp, with a juicy and sweet flavor that has notes of honey and vanilla. This apple variety is perfect for snacking, but also holds up well in cooking and baking, maintaining its shape and flavor. Lady Alice Apples are a good source of fiber, vitamin C, and antioxidants, and can be enjoyed as a healthy and flavorful addition to any meal. With their distinctive taste and appearance, Lady Alice apples are a premium choice for apple lovers and foodies alike.', 'Lady Alice', 'https://i5.walmartimages.com/asr/7a837d0e-c919-42d4-a8a4-ce24412eff56.5f1b91e333e15f50cfc86bd6da505af9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7a837d0e-c919-42d4-a8a4-ce24412eff56.5f1b91e333e15f50cfc86bd6da505af9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7a837d0e-c919-42d4-a8a4-ce24412eff56.5f1b91e333e15f50cfc86bd6da505af9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
