INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (433450924, 'Fresh Gala Apples, 3 lb. Bag', 3.97, '855857005179', 'Savor the sweet taste of Gala Apples. Gala apples are sweet and mild with a subtle floral aroma making them perfect for breakfast, lunch, dinner, and dessert. Perfect for snacking, they have a creamy white flesh with low acidity. Chop the apples up and add them to a salad with walnut, mixed greens, and a poppy seed vinaigrette for a crunchy delicious salad that you can enjoy for lunch or dinner. Add it to your favorite smoothie or juice blend for a morning pick me up to get your day started right. Serve with a dollop of peanut butter and enjoy as a healthy snack that both kids and adults will love. Enjoy the delicious taste of Gala Apples.', 'Sweet and mild with a subtle floral aroma Perfect for breakfast, lunch, dinner, and dessert Chop them up and add to a salad, add them to a smoothie or juice blend, or serve with peanut butter Perfect for snacking They have a creamy white flesh with low acidity', 'Unbranded', 'https://i5.walmartimages.com/asr/af429a77-d9b3-492c-bdce-a37a1352127d.cb79424e07c374f20a2a09991c28b4bd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/af429a77-d9b3-492c-bdce-a37a1352127d.cb79424e07c374f20a2a09991c28b4bd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/af429a77-d9b3-492c-bdce-a37a1352127d.cb79424e07c374f20a2a09991c28b4bd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
