INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (433865151, 'Navel Oranges, 3 lb Bag', 3.94, 'deleted_033383110011', 'Fresh Oranges are a good addition to a healthy diet along with other fruit. They\'re oval with thick, easy-to-remove peel and segments that separate cleanly. Oranges are a fruit that contains vitamin C and other nutrients that can be eaten as is or juiced for a smooth beverage at breakfast. It is suitable for use in all kinds of sweet and savory dishes, from cakes to weeknight chicken dinners. Citric acid fruits like oranges can be stored at room temperature for several days or in the refrigerator for up to two weeks. Available in a 4 lb package.', 'Oranges, 4 lb: A good addition to a healthy diet Easy to peel segments Contains vitamin C and other nutrients Can be juiced for a breakfast beverage Suitable for use in all kinds of sweet and savory dishes Store fresh oranges at room temperature or refrigerate', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/fc1cfe6a-5af9-475b-8e91-069089a6deef_1.09eeca82e9774dd2cde2f764ccd30d35.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fc1cfe6a-5af9-475b-8e91-069089a6deef_1.09eeca82e9774dd2cde2f764ccd30d35.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fc1cfe6a-5af9-475b-8e91-069089a6deef_1.09eeca82e9774dd2cde2f764ccd30d35.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
