INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (435224016, 'Fresh Cherry on the Vine Tomato, 12 oz Package', 3.98, 'deleted_684924011290', 'Fresh Cherry on the Vine Tomatoes are the perfect cooking tomato. Because of their notable flavor and thicker skin, they are a versatile tomato option that\'s fit for grilling, sauteing, roasting, or baking. Their small size also makes them a quick and simple addition to a fresh salad as well as an excellent finger food for whenever you\'re in the mood for a light snack. Packed with nutrients, cherry on the vine tomatoes are a deliciously healthy ingredient that adds both vibrant color and mouthwatering flavor to any recipe. For the best flavor and freshness, store these tomatoes at room temperature on your kitchen counter. Make your next meal a marvelous one with Cherry on the vine Tomatoes from Walmart.', 'Cherry on the Vine Tomato, 12 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/58f7fda5-2b5f-4b97-8ebb-30cf97ee6cf9.f29785bf74753d7ebddfe7b674383158.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/58f7fda5-2b5f-4b97-8ebb-30cf97ee6cf9.f29785bf74753d7ebddfe7b674383158.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/58f7fda5-2b5f-4b97-8ebb-30cf97ee6cf9.f29785bf74753d7ebddfe7b674383158.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
