INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (437442565, 'Earthbound Farms Fresh Organic Cauliflower Florets, 9 oz, Fresh', 3.98, '032601952792', 'Enjoy Organic Cauliflower Florets from Earthbound Farms -- versatile, healthy, and satisfyingly crunchy. Pre-washed, cut, and ready to serve or eat, these packaged veggies can be enjoyed right out of the package with a nice dip or be added to your favorite recipe. This nine-ounce package of Earthbound Farms Organic Cauliflower Florets contains about three servings. With only 25 calories and loads of nutrients per one cup serving, you can have a healthy side dish on the table in no time. Each serving gives you six percent of your daily recommended intake of potassium, and they even have two grams of protein and two grams of fiber! To serve these Organic Cauliflower Florets from Earthbound Farms, simply place them raw on a vegetable tray with assorted fresh vegetables and your favorite dip. They look great next to carrots, red pepper, and broccoli. To cook cauliflower, try roasting them on a sheet pan with other firm vegetables like sweet potato, carrots, mushrooms, and broccoli. Simply toss them with olive oil or coconut oil first, then roast for about 20 minutes at 400 to 425 degrees.', 'Earthbound Farms Fresh Organic Cauliflower Florets are versatile, healthy, and satisfyingly crunchy Ready to eat on the go Fresh organic snack Recipe-ready vegetables Washed and ready to enjoy 9-ounce package has about 3 servings', 'Earthbound Farm', 'https://i5.walmartimages.com/asr/5496099c-2115-474a-89dd-f3035cb8c020.8d16b16d5c69a6abbd8496165177fa90.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5496099c-2115-474a-89dd-f3035cb8c020.8d16b16d5c69a6abbd8496165177fa90.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5496099c-2115-474a-89dd-f3035cb8c02