INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (437708856, 'Vegetable Tray with Meat And Cheese 35 oz, Fresh', 11.97, '709351302787', 'The PRODUCE UNBRANDED Vegetable Tray with Meat and Cheese is a versatile and delicious option for those looking for a convenient and healthy appetizer or snack. This 35 oz. (2.19 lbs) tray offers an assortment of fresh vegetables, meats, and cheeses to cater to a range of tastes and preferences. The Vegetable Tray with Meat and Cheese is perfect for parties, picnics, or as a quick and healthy snack for the whole family. To maintain the freshness and quality of the ingredients, store the tray in the refrigerator and consume within a few days of purchase. Once opened, it is best to cover the tray with plastic wrap or transfer the remaining items to an airtight container to keep them fresh.', 'Vegetable Tray With Meat And Cheese 35oz The Vegetable Plastic Tray with Meat and Cheese is perfect for parties, picnics, or as a quick and healthy snack for the whole family. To maintain the freshness and quality of the ingredients, store the tray in the refrigerator and consume within a few days of purchase. Once opened, it is best to cover the tray with plastic wrap or transfer the remaining items to an airtight container to keep them fresh.', 'Unbranded', 'https://i5.walmartimages.com/asr/f2a02344-708b-4b63-b72c-ac363d3ffe16_3.172bd0ab1da3f6b5312b42384251e32a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f2a02344-708b-4b63-b72c-ac363d3ffe16_3.172bd0ab1da3f6b5312b42384251e32a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f2a02344-708b-4b63-b72c-ac363d3ffe16_3.172bd0ab1da3f6b5312b42384251e32a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
