INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (441516239, 'Butter Lettuce, each', 2.94, '865755000213', 'Butter lettuce, with its tender texture and vibrant green or rich reddish-purple hue, is a versatile addition to your culinary creations. Its scrumptious leaves are perfect for crafting delicate lettuce wraps, refreshing salads, or adding a layer of crispness to sandwiches. Elevate your meals with the delightful taste of butter lettuce and enjoy a healthy and visually stunning ingredient in your dishes.', 'Explora Greens Butter Lettuce EXCELLENT SOURCE OF VITAMIN K GOOD SOURCE OF FOLATE AND VITAMIN A LUTEIN AND ZEAXANTHIN', 'Explora Greens', 'https://i5.walmartimages.com/asr/39d236dd-2db6-43f7-a7d3-2dd44f5adafa.783a95e64a8466cbb438cbf6cef047d6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39d236dd-2db6-43f7-a7d3-2dd44f5adafa.783a95e64a8466cbb438cbf6cef047d6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39d236dd-2db6-43f7-a7d3-2dd44f5adafa.783a95e64a8466cbb438cbf6cef047d6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (442067920, 'Fresh Roma Tomato, 2 lb Bag', 1.28, '086009105205', 'With Roma Tomatoes, it\'s easy to make a wholesome, delicious meal. Roma tomatoes are an ideal ingredient for whipping up a variety of wonderful dishes. You can use them to create a zesty tomato sauce for stirring into a homemade pasta dish, crush them up to make a delightful Roma tomato bruschetta, or simply enjoy them on their own as a nutritious snack or as a party platter option for dipping in your favorite vegetable dipping sauce. If you\'re feeling a classic tomato dish, Roma tomatoes can even lend themselves in making a comforting and appetizing tomato soup or a flavorful salsa. No matter how you choose to use them, these tomatoes will add stunning flavor to any meal. Just find the recipe and experience the tasty results for yourself! Elevate your recipes and add fresh Roma Tomatoes to your Walmart produce purchase today.', 'Roma Tomatoes, 2 lb Bag: Wholesome and delicious Ideal ingredient for a variety of dishes Flavor in each bite Perfect for making zesty tomato sauces Enjoyable as a nutritious snack Excellent for homemade salsa', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2f860752-38f8-43a5-96b7-afda3b890630.59821395b55a4259f90cc71edfa15258.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2f860752-38f8-43a5-96b7-afda3b890630.59821395b55a4259f90cc71edfa15258.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2f860752-38f8-43a5-96b7-afda3b890630.59821395b55a4259f90cc71edfa15258.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
