INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (443695685, 'Fresh Feijoas - Sweet Tropical Fruits', 1.5, '000000042659', 'Feijoas, or pineapple guavas, are fresh fruits with a sweet, tangy flavor profile reminiscent of pineapple, guava, and mint. As fresh fruits, they can be enjoyed directly or incorporated into a variety of culinary creations like smoothies, desserts, and chutneys. Grown in South America\'s tropical climate, these fruits are not just delicious but also high in vitamin C and fiber. Their jelly-like center adds a unique texture, making them a tasty and nutritious addition to any meal or snack.', 'Fresh fruit known as Feijoas or pineapple guavas. Sweet, tangy flavor with hints of pineapple, guava, and mint. High in vitamin C and dietary fiber. Perfect for fresh eating, smoothies, baking, and making chutneys. Grown in tropical climates of South America. Notable for their jelly-like center and fragrant aroma.', 'Hypermart', 'https://i5.walmartimages.com/asr/c8141e4b-6adf-4051-9c69-6f652dffbb7b.c25e60a929a74812e66604e7fb0e3184.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c8141e4b-6adf-4051-9c69-6f652dffbb7b.c25e60a929a74812e66604e7fb0e3184.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c8141e4b-6adf-4051-9c69-6f652dffbb7b.c25e60a929a74812e66604e7fb0e3184.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (443840508, 'Fresh Pineberries, 10 oz Container', 4.72, '769197000094', 'The sweet, juicy flavor of Fresh Pineberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. These juicy berries have a tropical pineapple flavor with the texture and feel of strawberries making them an irresistible treat. Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful salad, or puree them to make a delicious cocktail. They contain essential vitamins and nutrients like vitamin C and dietary fiber, making them perfect for a healthy diet. Prior to serving simply gently wash them and remove the leafy caps, then enjoy the fresh taste. Refrigerate the berries in original clam shell tray to keep them fresh and ready for use. Pick up Fresh Pineberries today and savor the delectable flavor.', 'Fresh Pineberries, 10 oz Light, refreshing pineapple taste Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail Prior to serving gently wash them and remove leafy cap Refrigerate your strawberries in the original clam shell container to maintain freshness Keep dry for optimal freshness', 'Fresh Produce', 'https://i5.walmartimages.com/asr/3734fbb9-ba73-40a0-82f0-1e87b883e489.33d535fdf245abdf14bbc31347b64ed7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3734fbb9-ba73-40a0-82f0-1e87b883e489.33d535fdf245abdf14bbc31347b64ed7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3734fbb9-ba73-40a0-82f0-1e87b883e489.33d535fdf245abdf14bbc31347b64ed7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
