INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (445255635, 'Welch\'s Bi-Color Fresh Seedless Grapes, 2 lb Package', 6.97, '095829210198', 'Treat yourself to the delicious, juicy flavor of Fresh Bicolor Grapes. These grapes are bursting with flavor and are completely seedless. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the fresh taste of Fresh Red Seedless Grapes.', 'Fresh Bicolor Grapes Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/53cd4e2b-8636-48c5-8466-b248c3042f58.41044e74e6bc2553e4cde6f1ed9614c1.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/53cd4e2b-8636-48c5-8466-b248c3042f58.41044e74e6bc2553e4cde6f1ed9614c1.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/53cd4e2b-8636-48c5-8466-b248c3042f58.41044e74e6bc2553e4cde6f1ed9614c1.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
