INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (447093133, 'Cupid Grape Hybrid Tomato Plant - 3.5\" Pot - Beats Other Grape Tomatoes in Taste - Indoors/Out', 4.99, '811332037370', 'TOMATO: Tomatoes are rich in vitamins and antioxidants, and the seeds are high in fiber. The green parts are mildly poisonous, which is not surprising, as tomatoes are closely related to both nightshade and tobacco. The tomato was originally believed to be poisonous when introduced into Europe, and was used solely as an ornamental plant during the 16th and 17th centuries. The first traces of its use as a food date back to the first half of the 18th century. Tomatoes are now a tasty ingredient in many dishes, and are used fresh, canned, stewed or even sun-dried. Tip-top tomato taste! Our exclusive grape tomato sets a high standard. Consistently the top choice in our summer taste tests, ‘Cupid\' maintains a higher sugar content than any other grape tomato—and the sweetness doesn\'t fade in late summer. The elongated, shiny red 1\" globes produce in abundance on the vigorous vines. One of the best tomatoes to grow indoors in a sunny window.', '1 ounce fruit. Midseason High sugar content Indeterminate- Grow indoors or out Easy to grow. Very productive.', 'Hirt\'s Gardens', 'https://i5.walmartimages.com/asr/ea0d66f9-8d0b-4d3d-b039-73fdac800662_1.5175d2155acbd5fd9bee6671d80890ae.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea0d66f9-8d0b-4d3d-b039-73fdac800662_1.5175d2155acbd5fd9bee6671d80890ae.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ea0d66f9-8d0b-4d3d-b039-73fdac800662_1.5175d2155acbd5fd9bee6671d80890ae.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (447097252, 'Sweet Potatoes, 5 lb, Bag', 4.48, '617620000114', 'These versatile vegetables can be used to make savory sides or sweet treats. Try them roasted, baked, or grilled for a tasty addition to any dish or try them in a traditional sweet potato pie for a sweet dessert. The mouthwatering possibilities are endless with this hearty vegetable. Add something amazing to your meals with sweet potatoes!', 'Sweet Potatoes 5 lb Bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8933bd9d-2b42-4ec1-ac71-b19adb06b70f.c15c7aa37ba358dc3951cdd13016a888.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8933bd9d-2b42-4ec1-ac71-b19adb06b70f.c15c7aa37ba358dc3951cdd13016a888.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8933bd9d-2b42-4ec1-ac71-b19adb06b70f.c15c7aa37ba358dc3951cdd13016a888.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (447146911, 'Yellow Grape Tomato, 10 oz Package', 4.28, 'deleted_689259000483', 'A unique spin on the time-tested grape tomato, these colorful cousins of the grape tomato boast unique citrusy, floral notes. Refreshingly vibrant and versatile, you can enjoy it for snacking, salads, grilling, roasting or sautéing. Try this tomato roasted in a chunky sauce, grilled on kabobs, or chopped into a zesty salsa.', 'Orange Grape Tomatoes', 'Fresh Produce', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (447446580, 'Fresh Organic Mini Cucumbers', 2.98, 'deleted_816426013131', 'Enjoy the crisp, delicious flavor of Fresh Organic Mini Cucumbers. You can use this tasty vegetable in a variety of recipes. Use these cucumbers to make healthy treats such as a cucumber salad with tomatoes and onions in a vinaigrette dressing; mix diced cucumbers with Greek yogurt, lemon, dill, and garlic for a refreshing tzatziki sauce for gyros or veggies; add to a crisp, fresh veggie salad; or thinly slice and add to a vinegar brine for quick pickles. Any way you slice, dice, or spiralize them, Fresh Organic Mini Cucumbers are a refreshing, healthy addition to any meal.', 'These fresh organic mini cucumbers are crisp and delicious Use in a variety of recipes or enjoy on its own Make a cucumber salad with tomatoes and onions in a vinaigrette dressing Thinly slice and add to a vinegar brine for quick pickles', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9728c1de-d9aa-4f3a-8c5c-14a9dbed5173.1017666711f6bd17872dad2b6c42b851.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9728c1de-d9aa-4f3a-8c5c-14a9dbed5173.1017666711f6bd17872dad2b6c42b851.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9728c1de-d9aa-4f3a-8c5c-14a9dbed5173.1017666711f6bd17872dad2b6c42b851.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (447882834, 'Tasteful Selections Sunburst Blend Organic Bite Size Potatoes, 24oz Mesh Bag', 4.88, '826088523107', 'Experience the delicious blend of creamy textures and tender skins with our organic Sunburst Blend Potatoes. These bite-size wonders are a delightful fusion of honey gold and red potatoes, offering a flavorful and healthy addition to your meals. Conveniently packaged in a 24oz mesh bag, these fresh vegetables are perfect for quick and easy storage. Add a nutritious touch to your diet with these versatile potatoes that deliver a satisfying culinary experience. Ideal for steaming, roasting, or mashing, they are a healthy food choice, brought to you fresh and ready-to-cook.', 'Creamy textures and tender skins for the ultimate flavor fusion Includes a mix of honey gold and red potatoes Organic and fresh from farm to table Convenient bite-size potatoes for easy cooking Packaged in a 24oz mesh bag for freshness and storage ease Ideal for a variety of cooking methods and meal options, ensuring a healthy food choice', 'Tasteful Selections', 'https://i5.walmartimages.com/asr/83f1f162-ff87-4376-9ad9-fafd711f4050.861b4395a4ef2d4cd2b8c265d1b2d64c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/83f1f162-ff87-4376-9ad9-fafd711f4050.861b4395a4ef2d4cd2b8c265d1b2d64c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/83f1f162-ff87-4376-9ad9-fafd711f4050.861b4395a4ef2d4cd2b8c265d1b2d64c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
