INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (448898165, 'Org Bell Green Pepper', 3.97, 'deleted_823874000187', 'Organic Green Bell Peppers are an extremely versatile vegetable that is a must-have for every cook. Naturally low in calories, bell peppers are exceptionally rich in vitamin C and other antioxidants, and our green bell peppers are certified organic by the U.S. Department of Agriculture. You can choose to eat them raw and dip them in ranch, or you can incorporate them into a variety of recipes. Dice them and put them in a hearty chili, slice them and add to a deli sandwich, saute them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out green bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. The culinary possibilities are endless with Organic Green Bell Peppers.', 'Organic Green Bell Peppers, 2 Pack: 2-pack of organic bell peppers Naturally low in calories Exceptionally rich in vitamin C and other antioxidants Create delicious recipes with these organic bell peppers', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/f5a05d30-e54c-4fd3-951a-25a0e67e2047_1.2ff1b683c796a3f03a79077fbb3c6e2d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f5a05d30-e54c-4fd3-951a-25a0e67e2047_1.2ff1b683c796a3f03a79077fbb3c6e2d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f5a05d30-e54c-4fd3-951a-25a0e67e2047_1.2ff1b683c796a3f03a79077fbb3c6e2d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
