INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (449447343, 'Fresh Buttercup Squash, Each', 5.27, '000000047586', 'Add rich flavor and color to your meals with fresh Buttercup Squash. If you like pumpkin, then you\'re sure to love the sweet taste of buttercup squash. Try using it to make a comforting soup that will warm you up when it\'s cold outside, or try it cubed and roasted with your favorite spices for a satisfying side dish. You can also use this versatile winter squash to make something sweet. Try stuffing it with pecans, apples, cinnamon, brown sugar, and butter for a delicious dessert. Be sure to save the seeds because you can roast them just like you would pumpkin seeds for a tasty snack. Create your next culinary masterpiece with fresh Buttercup Squash.', 'Buttercup Squash, 1 Each: Sweet winter squash Great to use in a comforting soup to warm you up Roast with your favorite spices for a tasty side dish Stuff with apples, cinnamon and brown sugar for a delicious dessert Great source of beta-carotene Good source of vitamins and minerals', 'Fresh Produce', 'https://i5.walmartimages.com/asr/279ce8b7-8c67-4e67-a186-fcf706ffe185.a5e85714fa59323777c20c5c7d3aec4f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/279ce8b7-8c67-4e67-a186-fcf706ffe185.a5e85714fa59323777c20c5c7d3aec4f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/279ce8b7-8c67-4e67-a186-fcf706ffe185.a5e85714fa59323777c20c5c7d3aec4f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
