INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (449822160, 'Freshness Guaranteed Watermelon Bowl', 4.97, '263035000005', 'Experience a burst of summertime goodness with this delicious Freshness Guaranteed Watermelon. This pre-cut ripe watermelon is juicy, sweet, and refreshing to the taste. In addition, watermelons are a great natural source of vitamins A and C. Carry them with you and eat them straight out of the tray any time you want, at home, or on-the-go. Pair them with a tasty salad or sandwich for a nutritious and delicious lunch. You can also use them as a naturally sweet ingredient in a fruit salad. Add some fresh fruit to your daily menu with this Freshness Guaranteed Watermelon.Freshness Guaranteed provides you and your family with high quality fresh food that save you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Watermelon, 16 oz: Pre-cut watermelon chunks Convenient take-and-go packaging Good source of vitamins A and C No preservatives, artificial colors or artificial flavors Perfect for your next backyard cookout Net weight: 16 oz Sweet and Juicy', 'Fresh Produce', '', '', '');
