INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (454746658, 'Fresh Cassava , Pound', 0.88, 'deleted_405878099840', 'Create something delicious with this fresh Yuca (Cassava). Yuca, also known as Cassava, is a tuber cultivated throughout Latin America and Asia. Its flesh is hard, dense and white like a coconut, and has a hard, waxy bark-like covering. Yuca has a starchy, slightly sweet flavor, and must be cooked before eating. They may be prepared in a variety of ways, such as mashed, baked, boiled, fried, and more. Use it to make crispy fries, a comforting stew, or even a sweet cake. It\'s also naturally gluten-free, cholesterol-free, and fat-free. Make your next culinary masterpiece with Yuca (Cassava).', 'Naturally gluten-free, cholesterol-free, and fat-free Rich in vitamin C and vitamin B Mash with garlic and butter or add to soups and stews Fresh and whole Peel and cook before eating (do not eat raw) Versatile and delicious', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/6fe438f2-111f-4431-a3a2-8b0111ee4356.74ff54b4b426043928320ff9a2a1f6d7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6fe438f2-111f-4431-a3a2-8b0111ee4356.74ff54b4b426043928320ff9a2a1f6d7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6fe438f2-111f-4431-a3a2-8b0111ee4356.74ff54b4b426043928320ff9a2a1f6d7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
