INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (458511849, 'Fresh Apple Red, Each, Sweet', 4.47, '', 'Grown with care and picked at the peak of ripeness, our Red Fresh Apples are sure to satisfy your cravings. With their sweet and juicy taste, they make for a perfect snack any time of the day. Graced with a classic, vibrant red color, these apples are full of nutrients such as fiber, vitamin C, and antioxidants. Get your daily dose of health and deliciousness with our Red Apples.', 'Sweet, crisp, and juicy Creamy white flesh with low acidity Excellent snacking apple Higher antioxidants due to the rich, deep red skin Make a creamy smoothie or a nutritious juice blend Serve with your pancake breakfast Adds flavor to a variety of recipes Make apple butter or applesauce Make sweet desserts like apple cobbler, apple crisp, and apple pie', 'Unbranded', 'https://i5.walmartimages.com/asr/ada31246-1c45-4c41-aec7-e2d607500bdf.38553668d16b287cd56e935e3f043740.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ada31246-1c45-4c41-aec7-e2d607500bdf.38553668d16b287cd56e935e3f043740.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ada31246-1c45-4c41-aec7-e2d607500bdf.38553668d16b287cd56e935e3f043740.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
