INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (459862052, 'Hass Avocados, each', 1.18, '', 'Avocados aren’t just great-tasting fresh produce items, but they are a nutrient-dense fruit that can be enjoyed throughout the year. Hass avocados are a versatile ingredient with a creamy texture and mild flavor that can be used in many different types of recipes and dishes that are perfect for enjoying at barbecues and outdoor gatherings with friends and family during the summer. Enjoy avocados in countless ways that will make those barbecues and gatherings with family and friends even more exciting. Use avocados in flavorful recipes that everybody can share and enjoy while being together outside. Try avocados in individual Mexican food items like tacos or burritos, as part of appetizers like avocado crostini, or in a fresh guacamole or avocado dip so everybody can dip tortilla chips into something delicious. The possibilities are deliciously endless if you need additional food options for barbecues. Not only is a avocado a great ingredient to use in numerous ways, but it is also a healthy food that contributes unsaturated “good” fats and almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9. A ripe avocado will have a dark green to nearly black skin color, a bumpy skin texture and should yield to gentle pressure without leaving indentations or feeling mushy. Avocados with a slightly bumpy texture should be ripe in 1 to 2 days. They will also be somewhat firm and have a dark green and black speckled color. Once you’ve selected the perfect bag of avocados, you’ll be ready to enjoy all kinds of different healthy foods and recipes for the next time you’re enjoying an outdoor gathering with friends and families.', '● One Hass Avocado ● Fresh fruit with a creamy texture and mild flavor ● Fresh avocados are great for using in tacos, burritos, appetizers, avocado dip and fresh guacamole so that you have delicious food to share and enjoy during Cinco De Mayo ● A cholesterol free fruit that contains almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9 ● Small hass avocados are the lowest sugar fruit and provide unsaturated “good fats” that help absorb Vitamin A, Vitamin D, Vitamin K and Vitamin E ● Small ripe avocados will have dark green to nearly black skin color, a bumpy texture and should yield to gentle pressure without leaving indentations', 'Fresh Produce', 'https://i5.walmartimages.com/asr/0b27dfbf-7446-495a-9169-7a4870dca6e4.8dc71e65fc81b403186e3f7bc997aa63.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0b27dfbf-7446-495a-9169-7a4870dca6e4.8dc71e65fc81b403186e3f7bc997aa63.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0b27dfbf-7446-495a-9169-7a4870dca6e4.8dc71e65fc81b403186e3f7bc997aa63.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
