INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (464315522, 'Fresh Sliced Baby Bella Mushrooms, 8 oz package', 2.38, 'deleted_021706200105', 'Experience the fresh taste of our Sliced Baby Bella Mushrooms. Baby bella mushrooms look similar in size and shape to white mushrooms, but they\'re hardier and provide a deeper earthy taste. They are just like the large portabella mushrooms you know and love but have been harvested just a few days before becoming large enough to fit a burger. This means they have that same firm, meaty texture you love about portabella caps, just in a tasty bite-size form. Pre-cleaned and pre-sliced, their hearty, full-bodied taste makes them an excellent addition to beef, wild game, and vegetable dishes. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out our Sliced Baby Bella Mushrooms. Comes in a Light Tray.', 'Fresh Sliced Baby Bella Mushrooms, 8 oz tray: 8-ounce package of sliced baby bella mushrooms Naturally fat free Cholesterol free Low in calories, carbs and sodium Fresh and all natural Pre-cleaned Natural source of the antioxidant selenium Excellent addition to beef, wild game and vegetable dishes', 'Utah', 'https://i5.walmartimages.com/asr/700c52ac-1020-459e-936d-0fe6004ff6c3.8edf7423c90239a7d4e004acb8f50c64.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/700c52ac-1020-459e-936d-0fe6004ff6c3.8edf7423c90239a7d4e004acb8f50c64.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/700c52ac-1020-459e-936d-0fe6004ff6c3.8edf7423c90239a7d4e004acb8f50c64.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (465093022, 'Fresh Whole White Onion 2lb, Bag', 3.27, '819255020950', 'Add flavor to your next meal with Fresh White Onions ( Cebolla Blanca). For breakfast, you could dice them and add to an omelet loaded with cheese, ham, and mushrooms. You can dice these onions and add them to a fresh garden salad for a satisfying crunch or sprinkle them on top of your fish tacos. White onions also make delicious golden onion rings to serve alongside juicy hamburgers and hot dogs at your next backyard barbecue. You can keep these onions at room temperature until ready to use. Stock your pantry with this three-pound bag of Fresh White Onions', 'Fresh whole white onions, 2-lb bag Ideal ingredient in a variety of recipes Can be sauteed and put in your favorite foods for added flavor Use to top sandwiches, hamburgers, and hot dogs Fresh onions can be stored in a cabinet or pantry and are easy to prepare', 'Unbranded', 'https://i5.walmartimages.com/asr/22e70759-b86f-4a5b-bfc9-304ecbe7bd55.f44d867bf1a837b6d1885ffe46040bee.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/22e70759-b86f-4a5b-bfc9-304ecbe7bd55.f44d867bf1a837b6d1885ffe46040bee.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/22e70759-b86f-4a5b-bfc9-304ecbe7bd55.f44d867bf1a837b6d1885ffe46040bee.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
