INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (465841657, 'Aerofarms Arugula Microgreens Salad, 2 oz Clam Shell, Fresh', 3.98, '815063021240', 'Peppery and bright, AeroFarms arugula microgreens add a bold spice to any dish. Our Micro Arugula falls in the light green and yellow portions of the AeroFarms FlavorSpectrum™, representing an intensely peppery profile with light vegetal notes. Microgreens can contain considerably higher levels of vitamins and carotenoids—about 5X greater—than their mature plant counterparts, according to the United States Department of Agriculture. AeroFarms greens are grown with zero pesticides and are ready to enjoy right out of the container. Taste the AeroFarms difference - enjoy Micro Arugula by adding a heaping handful to boost any meal including sandwiches, wraps, soups, salads, takeout, and more.', 'Bursting With Flavor No Pesticides Ever No Washing Needed', 'AeroFarms', 'https://i5.walmartimages.com/asr/0d19de3f-fd85-41d1-be43-85f1431dd9a8.e703b4d3ad7348ff02b30b13eba9399c.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d19de3f-fd85-41d1-be43-85f1431dd9a8.e703b4d3ad7348ff02b30b13eba9399c.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d19de3f-fd85-41d1-be43-85f1431dd9a8.e703b4d3ad7348ff02b30b13eba9399c.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (465896238, 'Fresh Organic Green Kiwi, 2 lb Clamshell', 6.94, '756110900104', 'Treat yourself to the refreshing flavor of Fresh Organic Green Kiwi. Enjoy this tasty kiwi on its own as a healthy snack or incorporate it into a variety of delicious recipes. For breakfast, you can make a sweet fruit bowl with sliced kiwi, strawberries, pineapple, and cantaloupe. For an extra special treat, top with a dollop of whipped cream. Cut it into small pieces and put it in a fresh salad along with chicken, cucumbers, tomatoes, and a light dressing. You can even use kiwi to make a sweet sorbet or scrumptious muffins. Enjoy the sweet and juicy taste of Fresh Organic Green Kiwi.', 'Fresh Organic Green Kiwi is a flavorful addition to many recipes Enjoy on its own or add to a mixed fruit salad Add to your fresh garden salad Get creative and make a refreshing sorbet Explore all the delicious ways to add fresh kiwi to your favorite recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/3342798d-ea58-4782-87a7-aefc5068f3ac.6ea154d1827290e061d78a1776a4f284.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3342798d-ea58-4782-87a7-aefc5068f3ac.6ea154d1827290e061d78a1776a4f284.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3342798d-ea58-4782-87a7-aefc5068f3ac.6ea154d1827290e061d78a1776a4f284.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
