INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (466868123, 'Marketside Beyond Baby Kale & Crispy Leaf Lettuce, 4 oz Clam Shell, Fresh', 2.98, '194346001484', 'Enjoy the fresh flavor of Marketside Beyond Baby Kale and Crispy Leaf Lettuce. These greens are indoor and vertically grown for peak-season freshness all year long. Indoor vertical farms are a controlled growing environment giving each plant the optimal amount of light and nutrients for fresh and flavorful produce any time of the year. Farming vertically means our produce can be grown using significantly less water and land than traditional outdoor farms. Create something delicious with Marketside Beyond Baby Kale and Crispy Leaf Lettuce. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Fresh baby kale and crispy leaf lettuce Indoor and vertically grown for peak-season freshness all year long No pesticides, herbicides or fungicides applied to our greens Convenient peel and reseal packaging Keep refrigerated until ready to enjoy', 'Marketside Beyond', 'https://i5.walmartimages.com/asr/d99f731e-6ca9-44ee-9c18-3f9c55c87407.f809f23f517f2a6d07331145d9656725.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d99f731e-6ca9-44ee-9c18-3f9c55c87407.f809f23f517f2a6d07331145d9656725.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d99f731e-6ca9-44ee-9c18-3f9c55c87407.f809f23f517f2a6d07331145d9656725.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (467396410, 'Fresh Mango Puerto Rico, Each', 0.98, '405673947872', 'Savor the irresistible taste of a fresh Mango. Mangoes are an excellent fruit to add to your breakfast, lunch, dinner, or dessert. For breakfast, you can chop the mango up and add it to yogurt or a smoothie for a sweet treat that\'s sure to get your morning started on a high note. For dessert, you could use a mango to make a refreshing sorbet or put a tropical twist on a cobbler. You can also use it to make creamy milkshakes or delicious juices that everyone is sure to enjoy. The culinary possibilities are endless when you keep your kitchen stocked with fresh Mangoes.', 'Irresistibly sweet and juicy Delicious on its own or in a variety of recipes Make a creamy milkshake or a nutritious juice blend Add mango to yogurt or a smoothie Use to top your salad for a tropical twist', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d4993498-cb0a-4539-bee5-b3c0db4a6702.ee3057845556133bab8fb2cd8e56b1a1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d4993498-cb0a-4539-bee5-b3c0db4a6702.ee3057845556133bab8fb2cd8e56b1a1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d4993498-cb0a-4539-bee5-b3c0db4a6702.ee3057845556133bab8fb2cd8e56b1a1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
