INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (470724848, 'Fresh Yellow Bell Pepper, 1Each', 2.47, '000000049245', 'Enhance your meals with the delicious flavor of Fresh Yellow Bell Peppers. This fresh vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Yellow bell pepper, also known as red capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them, sauté them with onions or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out red bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudité. Cooked or uncooked, Yellow Bell Peppers are an excellent item to have on hand.', 'Fresh High on Vitamin A Large amounts of Vitamin E', 'Fresh Produce', 'https://i5.walmartimages.com/asr/133de766-420b-43ac-a9b7-9a85392131b6.b61c13709a2e3abc008873564ebee329.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/133de766-420b-43ac-a9b7-9a85392131b6.b61c13709a2e3abc008873564ebee329.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/133de766-420b-43ac-a9b7-9a85392131b6.b61c13709a2e3abc008873564ebee329.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
