INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (471168085, 'Fresh Marketside Sweet Potato Cubes, 24 oz', 3.98, '681131377379', 'Marketside Sweet Potato Cubes are a delicious and easy dish that the entire family will enjoy. Use them to whip up a delicious side or incorporate them into your favorite meals from soups and casseroles to stir fries and more. Try the recipe for Roasted Sweet Potato Risotto on the back of the bag. Easy to prepare, these sweet potatoes may be cooked in the microwave or on the stovetop. There are about six servings per bag and each serving has only 90 calories. Add Marketside Sweet Potato Cubes to your next nutritious meal.Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Sweet Potato Cubes, 24 oz: Microwaves in bag in 6 minutes Washed and ready to cook Make a tasty casserole or add to a delicious soup Cook in the microwave or on the stovetop About 6 servings per bag Keep refrigerated', 'Marketside', 'https://i5.walmartimages.com/asr/6812e8fd-8913-4bf8-95a3-6b467fbc627c.9105776022e56d014d0f22a20bf327a4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6812e8fd-8913-4bf8-95a3-6b467fbc627c.9105776022e56d014d0f22a20bf327a4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6812e8fd-8913-4bf8-95a3-6b467fbc627c.9105776022e56d014d0f22a20bf327a4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
