INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (479396825, 'Marketside Organic Cauliflower Florets, 10 oz', 3.98, '681131161589', 'Marketside Organic Cauliflower Florets are packed fresh, washed and ready to eat for your convenience. These florets have a great fresh taste that is loaded with nutrients. Enjoy them as a healthy side or use them in all your favorite recipes. They are a great addition to pastas and casseroles. Season them with salt, pepper and garlic and serve with grilled steak, grilled Brussel sprouts and bread rolls for a filling dinner. Get creative and use it to make a cauliflower crust pizza that is a healthier alternative to traditional pizza or make homemade cauliflower rice. They come packaged inside a microwaveable bag that cooks in less than five minutes. Dinner sides are made easy with Marketside Organic Cauliflower Florets. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes. Microwave in bag: Pierce bag with fork. Microwave on high for 3 to 4 minutes or until desired tenderness. Carefully remove bag from microwave. Be cautious when opening the bag as the vegetables and steam will be very hot. Season to taste and enjoy.', 'Microwave in bag Washed and ready to eat Use to make cauliflower pizza crust or cauliflower rice 20 calories per serving Net weight 10 oz', 'Marketside', 'https://i5.walmartimages.com/asr/546ff9d7-43f4-429f-a799-d896847a281b_2.2f555e9db60555dfb077b9546fd96ead.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/546ff9d7-43f4-429f-a799-d896847a281b_2.2f555e9db60555dfb077b9546fd96ead.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/546ff9d7-43f4-429f-a799-d896847a281b_2.2f555e9db60555dfb077b9546fd96ead.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (479851882, 'Sabra Mexican Street Corn Inspired Guacamole from Hass Avocados, 16 oz', 5.88, '040822345477', 'Sabra Mexican Street Corn Inspired Guacamole will be the go-to appetizer for every summer occasion. Inspired by the delicious flavors of Mexico, our newest guacamole features juicy sweet corn, lime, and chipotle powder and is combined with hand-picked, Mexican-grown Hass avocados. This flavor-packed guacamole dip tastes just like homemade but is easy to store until serving. Whether you\'re enjoying summer fun by the pool, Memorial Day, or July 4th celebrations, it won\'t be long before Sabra Mexican Street Corn Inspired Guacamole becomes the snacking staple at every summer event.In addition to Mexican Street Corn Inspired Guacamole, Sabra offers chunky guacamole dip in a variety of irresistible flavors, including Classic, Spicy, and Classic with Lime.', 'Inspired by the flavors of Mexico, juicy sweet corn, lime, and chipotle powder are combined with hand-picked, Mexican-grown Hass avocados to create a flavorful guacamole experience. Sabra Mexican Street Corn Inspired Guacamole is served best with tortilla chips, tacos, and more for summer entertaining, BBQs or as an everyday snack. Made with ripe, hand-scooped, Mexican-grown Hass avocados (see product image for list of ingredients). Vegetarian; Kosher; GMO-free', 'Sabra', 'https://i5.walmartimages.com/asr/a36e3817-509f-46ad-86e7-9a3ace56d6fd.3625d500fb0973ea20ed0bd8b5ba050d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a36e3817-509f-46ad-86e7-9a3ace56d6fd.3625d500fb0973ea20ed0bd8b5ba050d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a36e3817-509f-46ad-86e7-9a3ace56d6fd.3625d500fb0973ea20ed0bd8b5ba050d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
