INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (490974576, 'BrightFarms Sweet Baby Butter Leaf Lettuce, 4 oz Salad', 2.48, '857062004848', 'BrightFarms Sweet Baby Butter is the perfect base for any salad, burger or sandwich. It is delicate and sweet, while having a satisfying crunch. Grown nearby in a state-of-the-art greenhouse, the salad greens go from farm to store in as little as 24 hours ensuring they are fresh, crunchy and long-lasting in your fridge -- in fact we guarantee it! By growing indoors using a hands-free growing process, we eliminate the use of pesticides on our produce so that the greens are ready to eat from the container, with no need to wash. At BrightFarms, we are on a mission to grow salads in a way that is better for people and the planet, transforming the way people eat and enjoy fresh produce - and shaping a more sustainable future for food.', 'Pesticide, herbicide and fungicide free greens Greenhouse grown, for guaranteed fresh greens year-round No need to wash Responsibly grown, harnessing the power of technology to do more with less: less water, less land, less shipping fuel to produce more Non-GMO', 'BrightFarms', 'https://i5.walmartimages.com/asr/08f8d57c-6ee7-488b-9a78-aafc501cf589.8c17c737e1bbf3c6c08080b0e618223a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/08f8d57c-6ee7-488b-9a78-aafc501cf589.8c17c737e1bbf3c6c08080b0e618223a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/08f8d57c-6ee7-488b-9a78-aafc501cf589.8c17c737e1bbf3c6c08080b0e618223a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
