INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (492909841, 'Marketside Fresh Cut Watermelon, 16 oz Tray', 3.84, '681131180665', 'Enjoy the sweet, refreshing taste of Marketside Watermelon. This pre-cut watermelon is great for breakfast, lunch, dessert, or when you want a snack. Watermelon is a good source of vitamin C, vitamin A, and potassium making them an excellent healthy treat. You can eat them right out of the container, infuse them with water for a refreshing drink, or chop them up and make a mouthwatering watermelon salad with feta and mint. With 16-ounces in each container, this watermelon is great for sharing with friends and family or keeping it for yourself. It comes in a re-closable container to help maintain freshness. Bring home Marketside Cut Watermelon today for a refreshing, healthy treat. Marketside provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Marketside item.', 'Marketside Cut Watermelon, 16 oz Sweet and Juicy Pre-cut watermelon spears in a convenient resealable package to keep fruit fresh and allow for easy storage. Ideal for busy lifestyles, picnics, road trips school lunches, quick snacks or salads. Good source of vitamins A and C No preservatives, artificial colors or artificial flavors Perfect for your next backyard cookout Net weight: 16 oz', 'Marketside', 'https://i5.walmartimages.com/asr/8d2dca33-59ca-4dbf-bc01-b9ecee0088e4.75cb490cee40ed3f873adce45d567e9d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8d2dca33-59ca-4dbf-bc01-b9ecee0088e4.75cb490cee40ed3f873adce45d567e9d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8d2dca33-59ca-4dbf-bc01-b9ecee0088e4.75cb490cee40ed3f873adce45d567e9d.jpeg?odnHeight=450&odn