INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (500152257, 'Fresh Organic Mandarin Oranges, 2 lb Bag', 5.36, 'deleted_849315000417', 'Enjoy the fresh sweetness of Organic Mandarin Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these mandarin oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are also used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. However you choose to use them, Organic Mandarin Oranges add flavor to any meal or beverage.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes Use as a garnish for your favorite cocktail Make sweet desserts like ambrosia, orange bars, and orange pie Grown, harvested, and packed without chemicals, pesticides or preservatives Available in a 2-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/19ae05d6-ea3b-4ac0-ae57-7166e37dca18_3.b04fb12f9b7fd7a78a5bb358420c6ad2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19ae05d6-ea3b-4ac0-ae57-7166e37dca18_3.b04fb12f9b7fd7a78a5bb358420c6ad2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/19ae05d6-ea3b-4ac0-ae57-7166e37dca18_3.b04fb12f9b7fd7a78a5bb358420c6ad2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
