INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (503710389, 'Fresh Pluots, 2 lb Bag', 4.97, '683953001173', 'Fresh Plumcots are the perfect blend of flavor and texture of a plum and an apricot. There are more than 20 different plumcot varieties, each one with its own distinct appearance, color, and size. You can use them as a substitute in recipes with plums for a sweet twist. Bake a mouthwatering plumcot cake, plumcot and blueberry crisp, or roast them with honey and goat cheese for a decadent dish. Enjoy it as is as a healthy snack, add it to your lunch for a healthy side, or pack multiple and take on a picnic with friends and family. Enjoy the delicious flavor of Fresh Plumcots.', 'Fresh Plumcots, 2 lb Bag Perfect blend of a plum and an apricot Use as a substitute in recipes using plums Bake a mouthwatering plumcot cake, plumcot and blueberry crisp, or roast them with honey and goat cheese Enjoy it as is as a healthy snack, add it to your lunch for a healthy side, or pack multiple and take on a picnic More than 20 different plumcot varieties', 'Produce UB', 'https://i5.walmartimages.com/asr/14136e15-a1ea-4b02-ab6b-66000369a6d7.6e0e5eeedc6ec892f6a5f000ba057ff8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/14136e15-a1ea-4b02-ab6b-66000369a6d7.6e0e5eeedc6ec892f6a5f000ba057ff8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/14136e15-a1ea-4b02-ab6b-66000369a6d7.6e0e5eeedc6ec892f6a5f000ba057ff8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
