INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (505746814, 'Marketside Fresh Chopped Cauliflower, 12 oz', 2.98, '681131221818', 'Add fresh and ready to eat chopped cauliflower to your meal with Marketside Chopped Cauliflower. Serve as is, or add your favorite spices for additional flavor. Add onion, thyme, garlic, olive oil, parmesan cheese, salt and pepper to cauliflower to create a yummy side dish, use as a substitute for rice in stir fries and skillet meals, or steam and mash as a change of pace from mashed potatoes. As a good source of calcium, potassium, and dietary fiber and a quick cooking time of 3-4 minutes in the microwave, Marketside Chopped Cauliflower is an easy and nutritious addition to any meal. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Washed and ready to eat Great addition to any meal Healthy side Net weight 12 oz', 'Marketside', 'https://i5.walmartimages.com/asr/f475f0c2-93ac-40b0-a8af-1c7242c2d679_1.701a98638269130e137cfc0109eff257.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f475f0c2-93ac-40b0-a8af-1c7242c2d679_1.701a98638269130e137cfc0109eff257.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f475f0c2-93ac-40b0-a8af-1c7242c2d679_1.701a98638269130e137cfc0109eff257.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
