INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (511188322, 'Aroma One Organics Garlic Puree', 2.98, '750448908658', 'Aroma One Organics Garlic Puree 80G Transform your dishes with the Aroma One Organics Garlic Puree 80G, an essential pantry item for any home cook. Made from organically grown, carefully selected garlic, this puree brings a potent, bold flavor to any recipe. Whether you’re preparing garlic bread, a flavorful stir-fry, or a savory marinade, this puree offers the perfect balance of convenience and authenticity.', '100% Organic: Pure garlic with no additives or chemicals, for a clean and natural taste. Convenient and Time-Saving: Ready-to-use, eliminating the need for peeling and mincing fresh garlic. Bold and Robust Flavor: Adds a rich and intense garlic taste that will elevate your dishes instantly. Versatile: Ideal for sauces, dressings, soups, dips, and more No Artificial Ingredients: Free from preservatives, colors, or flavor enhancers, making it a clean choice for health-conscious consumers. Packed with Health Benefits: Garlic is renowned for its immune-boosting properties and heart-healthy benefits. Eco-Friendly: Produced in sustainable conditions, supporting environmentally responsible farming practices. Long-Lasting Freshness: Enjoy fresh garlic flavor year-round with a long shelf life. Ideal for Quick Meals: Perfect for busy cooks who want the full flavor of garlic without the preparation time. Make every meal a standout with the bold, pungent flavor of Aroma One Organics Garlic Puree 80G. Whether you\'re cooking up a quick weeknight dinner or creating a gourmet dish, this garlic puree is the perfect way to enhance your recipes in no time.', 'Aroma One', 'https://i5.walmartimages.com/asr/926b69c7-a163-4f0f-832e-a062f4614c54.a657216bd89bf415c90454517f4e4fa3.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartim