INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (511896139, 'Tomato on the Vine, Bag', 2.48, '405545141070', 'Keep your recipes simple and classic with fresh tomatoes on the vine. With their vibrant red color, firm and juicy flesh, and unmistakably delicious flavor, this fresh produce item is sure to impress more than just your taste buds. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. The list is endless! Plus, they come right to your kitchen still on the vine that they grew on, meaning that their mouthwatering taste and freshness will be long-lasting for your culinary convenience. Stock up on Walmart\'s Tomatoes On The Vine and keep your dishes looking great and tasting equally as excellent.', 'Tomatoes On The Vine Per Lb', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (512375019, 'Fresh Bells Nursery Hot House Cucumber', 4.34, '045009853820', 'Introducing our fresh hot house cucumbers - a crispy and refreshing addition to your meals. Grown in controlled environments, these cucumbers boast a vibrant green color and unparalleled flavor. Enjoy them sliced in salads, as a healthy snack, or add them to sandwiches for a satisfying crunch. With their firm texture and delicious taste, our hot house cucumbers are a must-have for any kitchen.', 'Bells Nursery Hot House Cucumber Introducing our fresh hot house cucumbers - a crispy and refreshing addition to your meals. Grown in controlled environments, these cucumbers boast a vibrant green color and unparalleled flavor. Enjoy them sliced in salads, as a healthy snack, or add them to sandwiches for a satisfying crunch. With their firm texture and delicious taste, our hot house cucumbers are a must-have for any kitchen.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a64a9fa0-a464-4b36-8a09-4443dce4274c.cbbf75c953a480bd4c4d466d513095ad.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a64a9fa0-a464-4b36-8a09-4443dce4274c.cbbf75c953a480bd4c4d466d513095ad.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a64a9fa0-a464-4b36-8a09-4443dce4274c.cbbf75c953a480bd4c4d466d513095ad.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
