INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (515024184, 'Fresh Valencia Orange, Each', 1.37, '405878099826', 'Fresh Valencia Orange is a juicy and vibrant citrus fruit with a sweet and tangy flavor. Known for its bright orange color and refreshing taste, it is a popular choice for both eating and juicing. With its high vitamin C content and refreshing aroma, Fresh Valencia Orange is a healthy and delicious addition to any meal or snack.', 'Fresh Valencia Orange is a delightful citrus fruit that offers a burst of juicy goodness with every bite. Its vibrant and enticing bright orange color is a feast for the eyes, while its sweet yet tangy flavor is a treat for the taste buds. This versatile fruit is widely recognized for its refreshing taste, making it a perfect choice for both eating and juicing. What sets Fresh Valencia Orange apart is its exceptional juiciness, which makes it an ideal candidate for extracting fresh and flavorful orange juice. The juice of this variety is known for its distinct sweetness and tang, offering a refreshing and invigorating experience with every sip. Whether enjoyed on its own or mixed in with other fruits, this orange variety is a fantastic way to quench your thirst and revitalize your senses. In addition to its delectable taste, Fresh Valencia Orange is also packed with nutritional benefits. One of its standout qualities is its high vitamin C content, which is essential for boosting the immune system and promoting overall health. This vitamin not only helps protect against common illnesses but also aids in collagen production, contributing to healthy skin and connective tissues. The aroma of Fresh Valencia Orange is equally enticing, filling the air with a citrusy and invigorating scent. The mere whiff of this fruit can instantly uplift your mood and transport you to a sunny orchard, creating a sensory experience that is truly delightful. Whether enjoyed as a snack on its own, squeezed into a refreshing glass of juice, or incorporated into various recipes, Fresh Valencia Orange offers a burst of flavor and a dose of health benefits. Its juicy and tangy nature, coupled with its vibrant color and refreshing aroma, make it a must-have addition to any culinary repertoire. So, embrace the zestiness and indulge in the delightful flavors of Fresh Valencia Orange for a truly invigorating and enjoyable experience.', 'Unbranded', 'https://i5.walmartimages.com/asr/51f232ae-5f25-4c84-938e-a09f4bee8278.6363c8bd69cafa25a7a57d16039fa8ac.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/51f232ae-5f25-4c84-938e-a09f4bee8278.6363c8bd69cafa25a7a57d16039fa8ac.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/51f232ae-5f25-4c84-938e-a09f4bee8278.6363c8bd69cafa25a7a57d16039fa8ac.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (515076572, 'Fresh Lemons, 2 lb Bag', 3.92, 'deleted_842586100138', 'Enjoy the juicy goodness of citrus when you eat a Lemon. Deliciously tart and juicy, these lemons are very easy to squeeze. Among the fruits in the citrus family, lemons have a pleasing tart flavor with few seeds. Generally a winter fruit, lemons are now available year-round. Lemons are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the lemons hang out in a bowl on your counter or table to breathe. Lemons are great to cook, bake, add a twist to your water or your after hours favorite drink. Available in a 2 lb bag.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Add to your iced or hot tea Make a satisfying and refreshing strawberry lemonade Use lemon zest to make lemon cookies or lemon loaf Adds flavor to a variety or recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/03038099-488e-4089-9289-df46ee43fe7a.55fc8dfe15cdf98e017420d5cd6b61e3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03038099-488e-4089-9289-df46ee43fe7a.55fc8dfe15cdf98e017420d5cd6b61e3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03038099-488e-4089-9289-df46ee43fe7a.55fc8dfe15cdf98e017420d5cd6b61e3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (515121290, 'Fresh Black Seedless Grapes, Bag (2.25 lbs/Bag Est.)', 2.98, '073748111116', 'Treat yourself to the delicious, juicy flavor of Fresh Black Seedless Grapes. These grapes are bursting with flavor and are completely seedless, so you can easily enjoy a handful as a fresh snack any time of day. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the fresh taste of Fresh Black Seedless Grapes.', 'Fresh Black Seedless Grapes Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e2391f14-e952-4a96-bfc0-f03caee053e2_2.f62f0f07bb7f152d0b4a1df00d1de457.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e2391f14-e952-4a96-bfc0-f03caee053e2_2.f62f0f07bb7f152d0b4a1df00d1de457.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e2391f14-e952-4a96-bfc0-f03caee053e2_2.f62f0f07bb7f152d0b4a1df00d1de457.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
