INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (528284895, 'Meyer Lemons, 2 Lb.', 3.48, '885674000385', 'Enhance your recipes with the Meyer Lemons 2lb bag. Meyer lemons are a winter citrus fruit that\'s distinctively different than the average lemon. These organic Meyer lemons are bursting with flavor, with a unexpected sweetness. The variety is believed to be a hybrid of lemons and mandarin oranges, which give the fruit its unique flavor and color. Meyer lemon juice is fantastic for marinades, dressings and mixed drinks, as well as marmalades, desserts and sauces. The 2lb Meyer lemons bag needs no refrigeration. Meyer Lemons, 2lb Bag:', 'Organic Meyer lemons2 lb bagLighter, sweeter flavor than most lemonsSweet winter citrus fruit that tastes like a cross between a regular lemon and a mandarin orangeIdeal for marinades, marmalades, cocktails, dressings and more', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a9d2d5df-6df6-41de-9c48-693487089f47_1.37f24f4e5945e54cd674169517939a8b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a9d2d5df-6df6-41de-9c48-693487089f47_1.37f24f4e5945e54cd674169517939a8b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a9d2d5df-6df6-41de-9c48-693487089f47_1.37f24f4e5945e54cd674169517939a8b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
