INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (529656618, 'Fresh Orange Cauliflower', 7.97, '027918034361', 'Introducing our Whole Fresh Orange Cauliflower, a vibrant twist on a classic favorite! Bursting with color and flavor, this cauliflower variety is a nutritional powerhouse. Packed with vitamin C, potassium, fiber, iron, calcium, and magnesium, it offers a wholesome addition to your meals. Whether roasted, steamed, or added to stir-fries, our Whole Fresh Orange Cauliflower brings a delightful pop of color and a nutritious boost to your plate. Experience the goodness of orange cauliflower today!', 'Excellent source of vitamin C Slightly nutty and a little sweet Crunchy texture', 'Tanimura & Antle', 'https://i5.walmartimages.com/asr/efd38d76-ef1d-482d-bb58-fbe62d24478e.8307f2eee28a795b37e05dab2d58be6d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/efd38d76-ef1d-482d-bb58-fbe62d24478e.8307f2eee28a795b37e05dab2d58be6d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/efd38d76-ef1d-482d-bb58-fbe62d24478e.8307f2eee28a795b37e05dab2d58be6d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (529935485, 'Fresh Cut In-Store Cucumber Slices, 1-1.75 lbs', 2.56, '262969000006', 'Enjoy the cool, refreshing taste of our Fresh Cut In-Store Cucumber Slices. Freshly prepared, each cucumber slice is carefully cut to the perfect thickness, promising high quality in every bite. Weighing between 1-1.75 pounds, these cucumbers are versatile and perfect for various culinary uses. Toss them in a salad for a refreshing crunch, add them to sandwiches for a burst of freshness, or snack on them for a healthy, hydrating option. The clear, sturdy container serves a dual purpose - it not only showcases the freshness and quality of the product, but also allows for easy storage and transport. Whether you\'re always on the go, meal prepping, or simply looking for a fresh, healthy snack, our Fresh Cut In-Store Cucumber Slices are a perfect choice.', 'Fresh Cut In-Store Cucumber Slices, 1-1.75 lbs Freshly cut in-store to ensure maximum freshness and quality Perfect for various culinary uses, such as in salads, sandwiches, or as a standalone snack Come in a clear, sturdy container for easy storage and transportation Ready to be enjoyed straight from the container', 'Fresh Produce', 'https://i5.walmartimages.com/asr/bc4a57ec-da74-4176-98f0-6045a013fabd.3a3075df58d1845e58a5a17b22de3332.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bc4a57ec-da74-4176-98f0-6045a013fabd.3a3075df58d1845e58a5a17b22de3332.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bc4a57ec-da74-4176-98f0-6045a013fabd.3a3075df58d1845e58a5a17b22de3332.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (530346478, 'BrightFarms Spring Mix Lettuce, 8 oz Family Pack Salad Salad', 4.97, '857062004510', 'BrightFarms Spring Mix Lettuce is the perfect base for any salad, wrap or sandwich. It combines crunchy lettuces with sweet, tender baby lettuces for a mix that is versatile in texture, color and flavor. Grown nearby in a state-of-the-art greenhouse, the salad greens go from farm to store in as little as 24 hours ensuring they are fresh, crunchy and long-lasting in your fridge -- in fact we guarantee it! By growing indoors using a hands-free growing process, we eliminate the use of pesticides on our produce so that the greens are ready to eat from the container, with no need to wash. At BrightFarms, we are on a mission to grow salads in a way that is better for people and the planet, transforming the way people eat and enjoy fresh produce - and shaping a more sustainable future for food.', 'Pesticide, herbicide and fungicide free greens Greenhouse grown, for guaranteed fresh greens year-round No need to wash Responsibly grown, harnessing the power of technology to do more with less: less water, less land, less shipping fuel to produce more Non-GMO', 'BrightFarms', 'https://i5.walmartimages.com/asr/4362a557-f674-4e47-98a6-c6529a2181ea.c1bad3289a00faf1887b6c13bc75c9f6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4362a557-f674-4e47-98a6-c6529a2181ea.c1bad3289a00faf1887b6c13bc75c9f6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4362a557-f674-4e47-98a6-c6529a2181ea.c1bad3289a00faf1887b6c13bc75c9f6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
