INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (532114944, 'Fresh Guanabana, 20 lb Package', 5.97, '000000033817', 'The Fresh Guanabana, 20 lb Package is a delightful assortment of delicious and exotic guanabana fruits, carefully hand-picked and packaged to ensure maximum freshness and flavor. Guanabana, also known as soursop, is a tropical fruit with a unique taste that combines the flavors of pineapple, strawberry, and citrus, resulting in a truly refreshing and tangy experience. This 20 lb package is perfect for those who want to indulge in the heavenly taste of guanabana or for those who wish to share this exquisite fruit with friends and family. Each fruit is plump, juicy, and bursting with vitamins, minerals, and antioxidants, making it a healthy choice for a snack or a versatile ingredient for various culinary creations. Whether enjoyed on its own, blended into smoothies, or incorporated into salads and desserts, the Fresh Guanabana, 20 lb Package is a true tropical treasure that will transport your taste buds to paradise.', 'Item Type: Edge Clamp Brand: TE-CO Manufacturer Part Number: 33817 Made in the United States', 'TE-CO', 'https://i5.walmartimages.com/asr/b4685596-b822-4de4-b573-80d8e6e2a996.d85000087726f875fcc2107029387a34.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b4685596-b822-4de4-b573-80d8e6e2a996.d85000087726f875fcc2107029387a34.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b4685596-b822-4de4-b573-80d8e6e2a996.d85000087726f875fcc2107029387a34.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
