INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (536965498, 'Fresh Cocktail Tomato, 1 lb Package', 2.98, 'deleted_813595010275', 'Holding the ideal balance of sweetness and acidity, it\'s easy to see why Cocktail Tomatoes are called the tomato lover\'s tomato. Cocktail tomatoes are small, making them an ideal choice for appetizers to pair with your everyday meals and for when you\'re entertaining guests. You can combine these tasty little tomatoes with fresh mozzarella and basil drizzled with olive oil or slice them up and add them to a freshly tossed salad. If you\'re feeling something classic, you can always cut one up to add that fresh tomato taste to a sandwich or dice up a few to make a delightful pizza topping. Plus, cocktail tomatoes are packed with nutrients, including vitamins A, B6, B12, C, D, E, K, phosphorous, magnesium and zinc, so you can feel good about adding some extra flavor to your meals. Be sure to add Cocktail Tomatoes to your inventory of fresh ingredients today.', 'Cocktail Tomato, 1 lb Package: The tomato lover\'s tomato Small size is ideal for salads and appetizers Ideal ingredient for a variety of dishes These European-style whole tomatoes are ideal all year long Add to party trays or school lunches Delicious and nutritious 16-ounce package of cocktail tomatoes To maintain sweetness, do not refrigerate', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e9cd5b61-4764-440a-824f-27c48ab73adb.9d45497f656a74cee90bea61ec675494.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e9cd5b61-4764-440a-824f-27c48ab73adb.9d45497f656a74cee90bea61ec675494.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e9cd5b61-4764-440a-824f-27c48ab73adb.9d45497f656a74cee90bea61ec675494.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
