INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (537606379, 'Forest-grown Japanese Dried Shiitake KOSHIN, 42-75mm, 70g', 29.99, '', 'Sugimoto shiitake are naturally cultivated outdoors on special sweet sap oak logs. Moreover, our drying and packaging process keeps the moisture content to less than 9% which enhances the Shiitake flavor and VitaminD content. Sugimoto Shiitake promotes 100% natural and sustainable cultivation using only carefully selected local cultivators. This Shiitake mushroom is called ?Koshin? and is picked after the cap of the Mushroom blooms into an umbrella. It is more large and flat than the ?Donko? Shiitake mushroom which is picked earlier while the cap is still in a bud form. Since Koshin is less thick than the Donko, it is easier and quicker to use requiring less time to rehydrate. Koshin is best used cut and in stir-fries, soups, sauces, where smaller pieces are used with other ingredients. Our products pass a yearly quality audit guaranteeing the consistency of the sourcing and production process of our Dried Shiitake mushroom. This Audit is conducted by the Japanese Ministry of Agriculture, Forestry, and Fisheries with the Japanese Consumers\' Co-operative Union. (JCCU)', 'Forest-grown shiitake mushroom Kosher certified Endorsed by famous Japanese chef Dr. Yukio Hattori and his show \'Iron Chef\' Sustainable cultivation methods Grown in collaboration with 600+ local cultivators', 'Sugimoto Co.', 'https://i5.walmartimages.com/asr/025f8e00-1df6-4bfb-9070-78dc433e6fd7.a425ac5af388e363ececf8282ee22bc8.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/025f8e00-1df6-4bfb-9070-78dc433e6fd7.a425ac5af388e363ececf8282ee22bc8.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/025f8e00-1df6-4bfb-9070-78dc433e6fd7.a425ac5af388e363ececf8282ee22bc8.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
