INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (538365156, 'Cebolla Roja 24/2lb', 2.87, '405873145061', 'Introducing our Cebolla Roja 24/2lb pack - a bulk supply of premium-quality red onions that add a pop of color and rich flavor to your culinary creations. These versatile onions, known for their vibrant hue and distinct taste, come in 24 handy 2lb bags, ensuring you have ample supply for your recipes. Ideal for salads, salsas, or a variety of cooked dishes, Cebolla Roja 24/2lb offers convenience and consistent quality for your kitchen or food service needs.', 'Cebolla Roja 24/2lb Introducing our Cebolla Roja 24/2lb pack - a bulk supply of Whole Fresh premium-quality red onions that add a pop of color and rich flavor to your culinary creations. These versatile onions, known for their vibrant hue and distinct taste, come in 24 handy 2lb bags, ensuring you have ample supply for your recipes. Ideal for salads, salsas, or a variety of cooked dishes, Cebolla Roja 24/2lb offers convenience and consistent quality for your kitchen or food service needs.', 'Cebolla Roja', 'https://i5.walmartimages.com/asr/e7869246-c92d-4913-8bdd-eaef681b52d7.ba6b0e5f109105872b3af118e9d863f2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e7869246-c92d-4913-8bdd-eaef681b52d7.ba6b0e5f109105872b3af118e9d863f2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e7869246-c92d-4913-8bdd-eaef681b52d7.ba6b0e5f109105872b3af118e9d863f2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
