INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (538961555, 'Earthbound Farms Fresh Organic Broccoli Florets, 9 oz', 3.48, '032601952693', 'Ready to eat or cook, Earthbound Farms Organic Broccoli Florets are deliciously fresh and organic. These packaged broccoli florets are washed and prepped, so they\'re ready to toss into your favorite recipe or to be dipped in your favorite veggie dip right from the package. One nine-ounce package contains three servings. With 35 calories and loads of nutrients per three-ounce serving, you can have a healthy side dish on the table in no time. Each serving gives you six percent of your daily recommended intake of potassium plus two grams of protein! Earthbound Farms Organic Broccoli Florets are also great in baked recipes like casseroles or in creamy soups like cream or broccoli or cream of potato soup.', 'Earthbound Farms Fresh Organic Broccoli Florets are ready for your favorite dips or recipes Ready to eat on the go Recipe-ready vegetables Washed and ready to enjoy Fresh organic snack Good source of Vitamin K Each 9-ounce package has 3 servings', 'Earthbound Farm', 'https://i5.walmartimages.com/asr/e0ecdf25-f74f-46ee-926e-8908dfa712ef.cde246cae27bbd04944f7f8356f95d5e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e0ecdf25-f74f-46ee-926e-8908dfa712ef.cde246cae27bbd04944f7f8356f95d5e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e0ecdf25-f74f-46ee-926e-8908dfa712ef.cde246cae27bbd04944f7f8356f95d5e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
