INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (539569198, 'Freshness Guaranteed Pineapple Medium', 4.37, '262825000003', 'Experience a burst of tropical flavors with these Freshness Guaranteed Pineapple Chunks. The pre-cut slices of ripe pineapple are juicy and sweet to taste and are packed in its own juice. Carry them with you and eat them straight out of the tray any time you want, at home or on-the-go. You can also use them to top desserts and ice creams, in a fruit salad or blend them with milk to make milkshakes. Pineapples are known to have a number of nutrients, and they are especially rich in vitamin C. Add some fresh fruits to your daily menu today with these Freshness Guaranteed Pineapple Chunks.Freshness Guaranteed provides you and your family with high quality fresh food that save you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Pineapple Medium', 'Freshness Guaranteed', '', '', '');
