INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (546740780, 'Organic Cucumber, 2 Each', 2.98, '095829400469', 'Wholesum\'s organic cucumbers are perfectly crisp and have a cool, mildly sweet and refreshing flavor. They are a top choice for slicing and eating fresh on a chef\'s salad or serving on a veggie tray with hummus. Keep hydrated with fresh cucumber infused water or slice one up for a quick on-the-go snack. As a low calorie and vitamin rich food, cucumbers also offer many nutritional benefits, helping support bone and cardiovascular health. Enjoy them along with other Wholesum organic fresh vegetables such as grape tomatoes and bell peppers and top with your favorite dressing. Wholesum is committed to bringing you a variety of premium organic produce that is fresh, flavorful, and responsibly grown.', 'Wholesum Organic Cucumbers Certified Organic 2 Count Cucumbers Great for salads Great for snacking Responsibly grown', 'Marketside', 'https://i5.walmartimages.com/asr/54e78389-436c-4823-af99-5aba6086a690.a5ede5f807a385faa636cc6eb9472161.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/54e78389-436c-4823-af99-5aba6086a690.a5ede5f807a385faa636cc6eb9472161.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/54e78389-436c-4823-af99-5aba6086a690.a5ede5f807a385faa636cc6eb9472161.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
