INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (547571575, 'Sun Dried Tomato Half, 1 Pound', 6.92, '204802000002', 'We’ll show you how to dry tomatoes in the sun, how to dry tomatoes in the oven, how to dry tomatoes in the dehydrator and how to store dried tomatoes. AND we’ll give you a list of ideas for delicious recipes using your sun dried tomatoes! We grow our own tomatoes every year and enjoy eating them fresh in salads, diced up for homemade canned tomatoes, transformed into our famous marinara sauce, spiced up in our restaurant-style salsa, made smooth and creamy in our perfect creamy tomato soup, and any other way we can think to use them. Another one of my favorite ways to use our tomatoes, especially when I’ve got a large end-of-season bumper crop, is to dry them. While I don’t often “sun dry” them, the tomatoes are sun-ripened on the vine and once they’re dried in the oven or the dehydrator, these “sun dried” tomatoes taste so incredible you’d never even know the difference!', 'Sun Dried Tomato Half, 1 Pound The possibilities are endless! Here are a few ideas to get you started. Use sun-dried tomatoes in or on: Pasta Salad Sauces Dips Salad Dressings Compound Butter Soups Sandwiches Burgers Antipasto/cheese/charcuterie platters Meatballs Risotto', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4cf2b3e3-0f8a-4a1e-933d-f201d21526fb.c37331aff05464e6edc511f635adf8d8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4cf2b3e3-0f8a-4a1e-933d-f201d21526fb.c37331aff05464e6edc511f635adf8d8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4cf2b3e3-0f8a-4a1e-933d-f201d21526fb.c37331aff05464e6edc511f635adf8d8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
