INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (549383840, 'Fresh Limes, 4 Count', 1.98, '820402299082', 'Stock up on several of these tart, juicy, Fresh Limes to enjoy with everyday meal planning. Freshly squeezed limes provide a healthy dose of vitamin C and antioxidants to your diet and are a key ingredient in many recipes, from homemade salsa to chicken dishes. Drizzle lime juice over fish or add it to your favorite sauces. Serve wedges of raw lime with your favorite cocktails and use the juice and the zest when baking cakes, cookies, and tarts. You can even use limes as a natural cleaning agent and to neutralize odors. Mix lime juice with vinegar and water and use as a surface spray for a nontoxic cleaning option. Limes are sold in a four-pack, so you can stock up on as many as you need. Enjoy the refreshing, tart flavor of Fresh Limes.', 'Fresh Limes, 4 Count: Juicy and fresh, packed with vitamin C and antioxidants Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use lime juice and zest when baking cakes, cookies, and tarts Refreshing, tart flavor', 'Fresh Produce', 'https://i5.walmartimages.com/asr/8b76a74d-992c-4d8b-9583-e3bf32c1c1be.3e734700d313786a96eb7feab35c0996.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8b76a74d-992c-4d8b-9583-e3bf32c1c1be.3e734700d313786a96eb7feab35c0996.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8b76a74d-992c-4d8b-9583-e3bf32c1c1be.3e734700d313786a96eb7feab35c0996.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
