INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (553070590, 'Gourmet212 Fried Eggplant 13.4oz (6 Pack), Fresh, Tin, Canned', 56.95, '191822007169', 'Have you ever tasted fried eggplant? Eggplant can offers you a bigger convenience than buying and preparing fresh eggplants. Eggplant has a unique taste but if you do not want to struggle cooking it, you can buy canned eggplant fries. Our product has a homemade taste like you just made it, so you open and serve any time you want. You can consume fried eggplants cold or warm as you like. We suggest you serve and eat eggplants with yoghurt. If you have never tried it before, it might be your new favorite. There are some features that may make you try our product: Fried eggplants are ready to serve and eat Our product has a homemade taste It is prepared with extra virgin olive oil It is Kosher Certified It is Halal Certified Ingredients: Eggplant 65%, Roasted Tomato Paste 16&, Extra Virgin Olive Oil 4%, Tomato Paste, Sunflower Oil, Garlic, Sugar, Salt, Spices. Just reading these features can make you buy our fried eggplant. It is delicious!', 'Gourmet212 Fried Eggplant 13.4 oz (6 Pack), Airtight Tin, Canned, Stainless Steel, Kosher, and Halal Certified. Our product has a homemade taste like you just made it. You can consume fried eggplants cold or warm as you like. Fried eggplants are ready to serve and eat. It is Kosher and Halal Certified Ingredients: Eggplant 65%, Roasted Tomato Paste 16%, Extra Virgin Olive Oil 4%, Tomato Paste, Sunflower Oil, Garlic, Sugar, Salt, Spices.', 'Gourmet212', 'https://i5.walmartimages.com/asr/a428a642-e76f-4e23-adac-d421e66b917a.7128eb4578d328329dc7d8889ab326bf.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a428a642-e76f-4e23-adac-d421e66b917a.7128eb4578d328329dc7d8889ab326bf.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.wa