INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (561637681, 'Marketside Organic Fuji Apples, 2lb Bag', 5.5, 'deleted_741839004301', 'There are lots of reasons why the Marketside Organic Fuji Apple is a fan favorite. The versatility of Fuji apples makes them a great choice for many different occasions. Developed by researches in Fujisaki, Japan in the 1930’s, Fuji apples are crisp and very juicy with a sugary-sweet flavor. Fuji apples store well, which makes them a great treat all year long! Use them for snacking, in salads, in fruit salads, and for baking; the Fuji apple is a great choice for any occasion! Pick up some Marketside Organic Fuji Apples today and have a handy snack you can feel good about. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Fuji Apples, 2lb Bag: One of the most popular apple varieties Crisp and juicy Use for snacking, salads, or for baking Organic', 'Marketside', 'https://i5.walmartimages.com/asr/11921682-7513-417d-b4e4-2056e21adf9e.d0b0b570aaa043c16dffcd74280a3147.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/11921682-7513-417d-b4e4-2056e21adf9e.d0b0b570aaa043c16dffcd74280a3147.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/11921682-7513-417d-b4e4-2056e21adf9e.d0b0b570aaa043c16dffcd74280a3147.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (561813433, 'Organic Pitted Deglet Noor Dates 19.8LB Sun-Dried/Certified NON-GMO/KOSHER/VEGAN', 69, '850023294043', 'These are the renowned authentic Algerian Deglet Noor Dates. They are blondish brown, of an amber hue. USDA Organic, taken straight from the Palm Tree into your hands. Chop chop and throw some in your salad, smoothie, pre-workout shake, or blend them with your cake mix, or eat them whole for a healthy nutritious snack. They are naturally sweet, packed with fiber, vitamins and minerals. We are passionate about these dates and we would really love for you to try them! 100% Certified USDA Organic – Our farms and plants are certified organic by the USDA. Our products are graded by USDA and approved by FDA Deglet Noor- a firmer date than Medjool Premium taste, color, and texture- Our dates have a translucent amber color and a unique mild caramel, honey flavor that is light sweet Freshly hand-picked- no additives, no preservatives, all you get is dates Can be eaten whole, added to cereal as a natural sweetener, a topping for salads, or made into delicious appetizers, baked goods, and smoothies', '19.8 lb bulk box of premium organic pitted Deglet Noor dates Naturally sweet with a smooth, caramel-like flavor Ready to use for baking, blending, meal prep, or food production No added sugar, no preservatives, nothing artificial USDA Organic, vegan, gluten-free, non-GMO, and kosher certified', 'Alya Foods', 'https://i5.walmartimages.com/asr/03fe3f7f-ece7-4f93-9970-9c9111a9cf6a.962bb96d15dab014fae7c2471c380cfc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03fe3f7f-ece7-4f93-9970-9c9111a9cf6a.962bb96d15dab014fae7c2471c380cfc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03fe3f7f-ece7-4f93-9970-9c9111a9cf6a.962bb96d15dab014fae7c2471c380cfc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (562159250, 'Cocktail Tomato, 1 lb Package', 2.98, 'deleted_057830020753', 'Holding the ideal balance of sweetness and acidity, it\'s easy to see why Cocktail Tomatoes are called the tomato lover\'s tomato. Cocktail tomatoes are small, making them an ideal choice for appetizers to pair with your everyday meals and for when you\'re entertaining guests. You can combine these tasty little tomatoes with fresh mozzarella and basil drizzled with olive oil or slice them up and add them to a freshly tossed salad. If you\'re feeling something classic, you can always cut one up to add that fresh tomato taste to a sandwich or dice up a few to make a delightful pizza topping. Plus, cocktail tomatoes are packed with nutrients, including vitamins A, B6, B12, C, D, E, K, phosphorous, magnesium and zinc, so you can feel good about adding some extra flavor to your meals. Be sure to add Cocktail Tomatoes to your inventory of fresh ingredients today.', 'Cocktail Tomato, 1 lb Package: The tomato lover\'s tomato Small size is ideal for salads and appetizers Ideal ingredient for a variety of dishes These European-style whole tomatoes are ideal all year long Add to party trays or school lunches Delicious and nutritious 16-ounce package of cocktail tomatoes To maintain sweetness, do not refrigerate', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e9cd5b61-4764-440a-824f-27c48ab73adb.9d45497f656a74cee90bea61ec675494.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e9cd5b61-4764-440a-824f-27c48ab73adb.9d45497f656a74cee90bea61ec675494.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e9cd5b61-4764-440a-824f-27c48ab73adb.9d45497f656a74cee90bea61ec675494.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
