INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (567926690, 'Grape Tomato, 10 oz', 1.97, '042808001810', 'Fresh grape tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily compliments your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Grape Tomatoes are the perfect choice.', 'Grape Tomatoes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d9ab5cfa-d0a8-4811-89a4-21340d203979.38416fb0219739eb6a2502179f5b8a34.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d9ab5cfa-d0a8-4811-89a4-21340d203979.38416fb0219739eb6a2502179f5b8a34.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d9ab5cfa-d0a8-4811-89a4-21340d203979.38416fb0219739eb6a2502179f5b8a34.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (568035406, 'Fresh Stuffed Baby Bella Mushrooms, Fiesta Cheese Blend, 8.5 oz, 6 Count', 4.97, '070475657245', 'Fiesta Cheese Blend Stuffed Baby Bella Mushrooms are stuffed with a tasty combination of pepper jack cheese, queso fresco, queso Gallego cheese, dried tomatoes, bell peppers, onion, garlic, and jalapenos. These stuffed mushrooms are perfect for both grilling and baking and can even be cooked in the microwave. The stuffed caps are great as an appetizer or as a delicious side dish. Serve with tender New York strip steak and broccoli florets for an unforgettably delicious dinner the whole family will enjoy. They also offer nutritional benefits as they are a good source of dietary fiber, protein, calcium, and iron. Spice up your routine sides with Fiesta Cheese Blend Stuffed Baby Bella Mushrooms.', 'Stuffed Baby Bella Mushrooms, Fiesta Cheese Blend, 8.5 oz, 6 Count: Baby bella mushrooms stuffed with a tasty combination of pepper jack cheese, queso fresco, queso Gallego cheese, dried tomatoes, bell peppers, onion, garlic, and jalapenos Cooks in the tray Oven safe and microwavable tray Great as an appetizer or side item Good source of protein Net weight 8.5 oz', 'Giorgio', 'https://i5.walmartimages.com/asr/35bdfb87-0927-4eb5-b02d-fa506413afc7.cf63f3dd7221a6731d9b749574b64a19.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/35bdfb87-0927-4eb5-b02d-fa506413afc7.cf63f3dd7221a6731d9b749574b64a19.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/35bdfb87-0927-4eb5-b02d-fa506413afc7.cf63f3dd7221a6731d9b749574b64a19.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
