INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (570562294, 'Mother Earth Products Freeze Dried Sliced Mushrooms, Quart Mylar', 15.35, '810919031855', 'Mother Earth Products Freeze Dried Sliced Mushrooms: a healthy & convenient addition to every area of your life without the headache: emergency preparedness, snacking, long and short term storage, traveling, everyday cooking, hiking, backpacking, spicing up your recipes, etc. use it now or later. Mother Earth Products Freeze Dried Mushrooms are made with real, Non-GMO Mushrooms, no additives or preservatives, & is kosher - a guilt-free, robust food that makes eating tasty & rewarding, without the hassle of weekly trips to the store or the worry of spoiling. It’s so delicious you won’t store it away and hope you never have to use it. Taste the Goodness of Mother Earth Products', '100% mushrooms; long term storage; short term storage; pantry; portable; convenient; nothing added; emergency preparedness; great flavor; easy to cook with; can eat straight from container without reconstituting', 'Mother Earth Products', 'https://i5.walmartimages.com/asr/7c11b790-3f7d-4af9-be82-fd40e0f0ce9f.89c4b2849db3bad2fa8e6cf4c9ddce52.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7c11b790-3f7d-4af9-be82-fd40e0f0ce9f.89c4b2849db3bad2fa8e6cf4c9ddce52.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7c11b790-3f7d-4af9-be82-fd40e0f0ce9f.89c4b2849db3bad2fa8e6cf4c9ddce52.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
