INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (571251131, 'Fresh Starfruit, Each', 1.48, '000000042567', 'Fresh Starfruit, also known as carambola, gets its name from its five-pointed shape, which yields slices of juicy, lush translucent stars when sliced. The fruit ripens to a bright, light yellow and begins to exude a light, tropical aroma. Browning on the tips of the ridges is simply a sign of ripeness. Sweet and mild, the flavor compares to plums, grapes, pineapple and pear, with notes of lemon. Enjoy for breakfast, lunch, dinner or dessert. Make a star fruit upside-down cake or slice for an elegant star fruit mosaic atop a frosted cake or glazed tart. For dinner, this tropical fruit also pairs well with seafood. Starfruit\'s pale yellow, juicy flesh contains a few small, flat seeds and has a distinctly tropical flavor. Except for the seeds, the entire starfruit is edible. The culinary possibilities are endless with Fresh Starfruit.', 'Fresh tropical Starfruit Delicious on its own or in a variety of recipes Keep refrigerated in a paper or plastic bag for up to one week Wash well before slicing Slices may also be frozen for later use Low in fat, saturated fat, cholesterol, and sodium Good source of fiber High in vitamin C, pantothenic acid, and copper Also known as Carambola and Five Finger Fruit around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1a2ccef0-a235-4666-89a4-a7b8efc7007e.fa905b18c5c95bf9e2ff40855595f99d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1a2ccef0-a235-4666-89a4-a7b8efc7007e.fa905b18c5c95bf9e2ff40855595f99d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1a2ccef0-a235-4666-89a4-a7b8efc7007e.fa905b18c5c95bf9e2ff40855595f99d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
