INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (573037505, 'Miravalle Corn Husk, 8 oz Package', 8.88, '712810008151', 'Corn husks are thin, papery, and have a fibrous texture, also known as hojas de maíz, are a traditional and important ingredient used for preparing many dishes. They are most commonly used to make tamales, a popular dish made of corn masa dough filled with various meats, vegetables, or cheese, then wrapped in a corn husk and steamed. They can be used to wrap and steam food, imparting a subtle corn flavor and aroma. They are also an excellent natural alternative to aluminum foil or parchment paper for wrapping food for grilling or baking.', 'Elevate your culinary skills by using Corn Husks (hojas de maíz) to create authentic tamales, with the added bonus of a subtle corn flavor and aroma Choose an eco-friendly and natural alternative to aluminum foil or parchment paper by using Corn Husks to wrap and steam your favorite dishes Enjoy versatile Corn Husks for grilling or baking, as they not only provide a unique presentation but also keep your food moist and flavorful.', 'Miravalle', 'https://i5.walmartimages.com/asr/4c27a0a6-1578-4063-bc9b-bfe9f36b9d2d_1.7f4ea5b66e8d9752c0243467541339db.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4c27a0a6-1578-4063-bc9b-bfe9f36b9d2d_1.7f4ea5b66e8d9752c0243467541339db.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4c27a0a6-1578-4063-bc9b-bfe9f36b9d2d_1.7f4ea5b66e8d9752c0243467541339db.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
