INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (586083289, 'Fresh Sliced Baby Bella Mushrooms, 8 oz', 2.17, '037102170102', 'Experience the fresh taste of Sliced Brown Mushrooms. Brown mushrooms look similar in size and shape to white mushrooms but they\'re heartier and provide a deep earthy taste. They are just like portabella mushrooms but have been harvested just a few days before becoming large enough to fit a burger. This means they have that same firm, meaty texture you love about portabella caps, just in a tasty bite-size form. Pre-sliced, their hearty, full-bodied taste makes them an excellent addition to beef, wild game, and vegetable dishes. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try Sliced Brown Mushrooms.', 'Sliced Brown Mushrooms, 8 oz tray: 8-ounce package of sliced Brown mushrooms Naturally fat-free Cholesterol-free Low in calories, carbs and sodium Fresh and all natural Best if kept refrigerated Wash before use Natural source of the antioxidant selenium Excellent addition to beef, wild game and vegetable dishes', 'Monterey', 'https://i5.walmartimages.com/asr/315fbff0-615f-4c06-b887-1a83cd430bc7.890878855c20c2f6fad3e7a4f4259a64.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/315fbff0-615f-4c06-b887-1a83cd430bc7.890878855c20c2f6fad3e7a4f4259a64.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/315fbff0-615f-4c06-b887-1a83cd430bc7.890878855c20c2f6fad3e7a4f4259a64.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (586267385, 'Sliced Gourmet Mushrooms, 16 oz', 3.74, 'deleted_037102686061', 'Experience the fresh taste of Sliced Gourmet Mushrooms. If you\'re looking for a traditional mushroom with a mild earthy taste, white mushrooms are just what you need. They\'ve remained the most popular mushroom for several decades and although all mushrooms are versatile, white mushrooms are the most versatile of them all. Pre-cleaned and sliced, they are perfect for adding to stir-frys, sauces, soups, pizzas, salads, and stews to create culinary works all your own. They are free of fat and cholesterol and are low in calories and sodium. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out Sliced Gourmet Mushrooms.', 'Sliced Gourmet Mushrooms, 16 oz: 16-ounce package of sliced mushrooms Naturally fat-free Cholesterol-free Low in calories, carbs and sodium Fresh and all natural Natural source of the antioxidant selenium Great for salads, pizzas, and much more', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/91bbef7a-0662-41fa-9a28-2af086944a7e.418cd71daf42589d324111624fe2e79b.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/91bbef7a-0662-41fa-9a28-2af086944a7e.418cd71daf42589d324111624fe2e79b.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/91bbef7a-0662-41fa-9a28-2af086944a7e.418cd71daf42589d324111624fe2e79b.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
