INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (586789258, 'Fresh Red Seedless Grapes, Bag (2.25 lbs/Bag Est.)', 3.5, '681131433648', 'Treat yourself to the delicious, juicy flavor of Fresh Red Seedless Grapes. These grapes are bursting with flavor and are completely seedless, so you can easily enjoy a handful as a fresh snack any time of day. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Freshness Guaranteed Fresh Red Seedless Grapes.Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Spark Fresh item.', 'Fresh Red Seedless Grapes Bag Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes Whole and healthy option for a natural treat', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e55dbaa1-87c3-4b86-85de-202b84120f9e.2708c9466465f6a23cf47d8197fab9b6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e55dbaa1-87c3-4b86-85de-202b84120f9e.2708c9466465f6a23cf47d8197fab9b6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e55dbaa1-87c3-4b86-85de-202b84120f9e.2708c9466465f6a23cf47d8197fab9b6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (586823130, 'Fresh Sweet Rainier Cherries, 1.25 lb Pouch', 7.48, '850247002028', 'Treat yourself to the refreshing flavor of Fresh Sweet Rainier Cherries. This golden yellow cherry with a red blush has a crisp bite and delicate super-sweet flavor. Enjoy them on their own or add them to a variety of recipes. For breakfast, you could use them to make a filling parfait with yogurt, granola, and other fruit. Make a fresh cherry cobbler and serve with your favorite ice cream at your next party. Use them to top off your decadent cheesecake or classic ice cream sundae. Enjoy the satisfying taste of summer with Fresh Sweet Rainier Cherries.', 'Fresh Sweet Rainier Cherries, 1.25 lb Pouch have a crisp bite and delicate super-sweet flavor Enjoy on their own or add to a variety of recipes Make a filling yogurt parfait for breakfast Make a cherry cobbler and serve with your favorite ice cream Use to top a cheesecake or a classic ice cream sundae To enjoy fresh cherries: store in the refrigerator and wash just before eating Grown in US', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d7536075-5e54-44e3-8001-ab434911573f.12f15c0628985b8c1a64c9893a4ac7d1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d7536075-5e54-44e3-8001-ab434911573f.12f15c0628985b8c1a64c9893a4ac7d1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d7536075-5e54-44e3-8001-ab434911573f.12f15c0628985b8c1a64c9893a4ac7d1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
