INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (587130338, 'Organic Whole Bulbs of Black Garlic - Black Garlic North America Brand - Quantity: 2 Packs of 2 Bulbs Each', 11.99, '637801971514', '2 Packs of 2 Bulbs of Whole Bulb Organic Black Garlic (total of 4 bulbs). Black Garlic is ready to eat and has exceptional sweetness with date, balsamic, and slight garlic undertones. The consistency is soft and chewy, and our black garlic is Vegan, Natural, Preservative-Free, Gluten-Free, Kosher and Organic-Certified! At Black Garlic North America Brand, we believe in treating our environment, bodies & conscience ethically, which is why we feel providing our customers with organic options is important. Try in: Sauces and Dressings, on Salads and in Soups, on top of Pizza, and even in Breads, Chocolate Chip Cookies and other Desserts for an explosion of flavor!', '2 Packs of 2 Bulbs (4 total bulbs). Adding a couple diced or crushed black garlic cloves improves even your best creations, both sweet AND savory! Contains 2X the antioxidants of fresh garlic. Vegan, Natural, Preservative-Free, Gluten-Free, Kosher and Organic-Certified!', 'Black Garlic North America', 'https://i5.walmartimages.com/asr/75c89b23-546b-4474-b08f-4ec8ea85addb.26478de85d40942c9d317d3bd524a77a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75c89b23-546b-4474-b08f-4ec8ea85addb.26478de85d40942c9d317d3bd524a77a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75c89b23-546b-4474-b08f-4ec8ea85addb.26478de85d40942c9d317d3bd524a77a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
