INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (588800917, 'Butternut Squash Whole Fresh, 1 Each', 4.48, '856862005093', 'Add some fresh flavor to your meal with Butternut Squash. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. Roast the whole squash for a simple and flavorful side dish, chop it into cubes and put it in the slow cooker with chicken breast, kidney beans, and spices, or make butternut noodles for a gluten-free pasta alternative. For a sweet treat turn the squash into a rich and spicy pie, perfect for the holiday season. With so many uses, this vegetable will become a pantry staple. Create tasty and flavorful meals with Butternut Squash.', 'Produce Unbranded Butternut Squash Whole Fresh, 1 Each Natural food Versatile ingredient Will become a pantry staple Make butternut squash noodles for a gluten free pasta alternative', 'Fresh Produce', 'https://i5.walmartimages.com/asr/bdcdc288-3e95-4321-b587-f5e4b4d07388.5a8a78f466b5605d67c7605ba12dc303.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bdcdc288-3e95-4321-b587-f5e4b4d07388.5a8a78f466b5605d67c7605ba12dc303.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bdcdc288-3e95-4321-b587-f5e4b4d07388.5a8a78f466b5605d67c7605ba12dc303.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
