INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (591833746, 'Freshness Guaranteed Diced Mirepoix Mix, 10 oz', 2.88, 'deleted_681131276511', 'Add a little color and texture to your next dish with our Freshness Guaranteed Diced Mirepoix Mix. With yellow onion, carrots, and celery all diced up and mixed together in this one convenient package, you can skip the prep work and have just what you need to create a flavorful soup stock or a savory sauce. Just throw this mix into a pan with some butter or oil, cook on low heat until beautifully carmelized, and you\'ll have the perfect base ready to enhance the flavor profile in a wide variety of recipes. Casseroles, chicken noodle soup, stews, and more are quickly and easily perfected when you use our Freshness Guaranteed Diced Mirepoix Mix.Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Spark Fresh item.', 'Freshness Guaranteed Diced Mirepoix Mix, 10 oz: Classic Mirepoix mix consisting of yellow onions, celery, and carrots Ingredients come pre-diced for your convenience Great way to add color, flavor, and texture to a wide variety of dishes Excellent for creating soups, stews, sauces, braises, and casseroles Resealable container makes it easy to use as much or as little at a time as you need', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6a49b487-08c1-4c61-9cd3-323ee4d599c4.1496bd974c811e9cdd42de5da8c1e440.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6a49b487-08c1-4c61-9cd3-323ee4d599c4.1496bd974c811e9cdd42de5da8c1e440.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6a49b487-08c1-4c61-9cd3-323ee4d599c4.1496bd974c811e9cdd42de5da8c1e440.jpeg?odnHeight=450&odnWidth=450&odnB