INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (592064430, 'Fresh Express Twisted Caesar Pesto, 9.5 oz Bag, Fresh', 3.98, '071279302164', 'Why choose between pesto and caesar when you can have it all? NEW Fresh Express Twisted Pesto Caesar Chopped Salad Kit, 9.7 oz is an incredible symphony of flavors you won’t want to miss! Crispy iceberg, green leaf lettuce, crunchy garlic brioche croutons, savory shredded Parmesan cheese and decadently creamy Pesto Caesar Dressing all come together in a magical symphony of flavors. Try it today for an unforgettable culinary experience. Look for it in the fresh produce section.', 'Thoroughly washed and ready to eat Premium, restaurant quality ingredients A refreshing and tasty meal that\'s perfect for any occasion', 'Fresh Express', 'https://i5.walmartimages.com/asr/79ffd81c-b7da-4212-acc1-09ad59a2b61a.4b7e2d6655b0764187b3a5c6854ee7e4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/79ffd81c-b7da-4212-acc1-09ad59a2b61a.4b7e2d6655b0764187b3a5c6854ee7e4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/79ffd81c-b7da-4212-acc1-09ad59a2b61a.4b7e2d6655b0764187b3a5c6854ee7e4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
