INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (592682060, 'Fresh Serrano Pepper, 4 Ounce Bag', 1.58, '711069541204', 'Enhance your meals with the delicious flavor of Serrano Peppers. Naturally low in calories, fat, and cholesterol, this vegetable is a great source of vitamins C, B6, and A, as well as iron and magnesium. Serrano peppers have a bright and biting flavor that enhances a variety of recipes. Make a zesty pico de gallo or salsa using fresh serrano peppers, add to a sweet peach jam to make a glaze for hot wings, or add to eggs for out of this world huevos rancheros. You can even add some diced serrano peppers and cheese to cornbread batter for a delectable chile cheese cornbread that will have everyone asking for seconds. Lunches and dinners are more scrumptious when fresh Serrano Peppers are part of the meal. Also known as Chile serrano, Serrano chili, Filfil serrano and Serrano mirch around the world.', 'Serrano Pepper, 4 oz: Naturally low in calories Rich in vitamins C, B6, and A Add to enchiladas or chili, make a zesty salsa or pico de gallo, or add to peach jam for a glaze for hot wings Approximately 8-12 peppers per .25 lb Versatile and delicious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/71784258-8461-44ee-9ef1-04e1e012413b.3e7b782e9e363172a67e961a4a9fcc5a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71784258-8461-44ee-9ef1-04e1e012413b.3e7b782e9e363172a67e961a4a9fcc5a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71784258-8461-44ee-9ef1-04e1e012413b.3e7b782e9e363172a67e961a4a9fcc5a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
