INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (597915162, 'Dynamic Duo Creamer Potato', 5.48, '629307042546', 'short description is not available', 'Potatoes, Dynamic Duo, Variety Pack A wonderful combination of our most popular red and yellow varietals they complement each other well with smooth thin skins and buttery yellow flesh. Dynamic duo cooks quickly offering a nutritious yet exquisitely fluffy texture. 12% DV of fiber per serving. 100 calories per serving. Naturally fat-free. Gluten free. Good source of potassium. Cholesterol free. No peeling required. Creamer potatoes, coveted by leading chefs and foodies, are a premium little potato varietal that is typically thin-skinned, rich in flavor, and highly nutritious. In 1996, when my father and I introduced these flavorful little potatoes, we grew a one-acre plot that we harvested, washed and bagged by hand. Since then, we focus solely on selecting creamer potatoes that are outstanding in taste, nutrition and texture. It\'s all we do. Our proprietary varietals are harvested when they are mature and at their best. My family and I still enjoy the original, diverse taste of these exceptional potatoes, and I am excited to share them with you. Angela, co-founder and chief potato champion. LittlePotatoes.com. Facebook. Twitter. Instagram. Pinterest. YouTube. Product of Canada. Product of USA.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/d2c9f08e-280c-4643-bd0d-4463c784fe5e_2.3aed0cac4d706de0ca5a08e1746c7d8d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d2c9f08e-280c-4643-bd0d-4463c784fe5e_2.3aed0cac4d706de0ca5a08e1746c7d8d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d2c9f08e-280c-4643-bd0d-4463c784fe5e_2.3aed0cac4d706de0ca5a08e1746c7d8d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
