INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (599977385, 'Spice Select Garlic Paste, 32oz', 7.25, '076114310175', 'Spice Select\'s Ready to-use Garlic Paste is an essential piece to any household cook\'s spice cabinet. Sitting between fresh minced garlic and garlic powder, garlic paste is perfect for adding the perfect consistency to making marinades, soups, and sauces while bringing on the bold garlic flavor you love. With this ready-to-use garlic paste, all you have to do is prepare your meal up to the point you\'re ready to add some garlic, and then simply add as much of the garlic paste as you need—no defrosting or heating up required. Because it\'s so versatile, it\'s handy to always have a jar of Spice Select\'s Ready to-use Garlic Paste on hand when you\'re cooking up dinner for the family.', 'Spice Select Garlic Paste, 32oz: Ready-to-use garlic paste soft, creamy consistency is perfect for sauces, soups, and marinades Brings the bold taste of fresh garlic you love to any dish About 189 servings per container Kosher', 'Spice Select', 'https://i5.walmartimages.com/asr/52717319-ca80-4763-b308-78d198ab7611_1.bf56dad5d1415211cea62f3e38ca74e8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/52717319-ca80-4763-b308-78d198ab7611_1.bf56dad5d1415211cea62f3e38ca74e8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/52717319-ca80-4763-b308-78d198ab7611_1.bf56dad5d1415211cea62f3e38ca74e8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
