INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (601368870, 'Marketside Greenhouse Grown Fresh Strawberries, 12 oz Container', 4.78, '699058999352', 'The sweet, juicy flavor of Marketside Greenhouse Grown Fresh Strawberries make them a refreshing and delicious treat. These sweet and flavorful strawberries are grown in a greenhouse and found in our premium selection. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. They contain essential vitamins and nutrients like vitamin C, dietary fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Marketside Greenhouse Grown Fresh Strawberries today and savor the delectable flavor. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Greenhouse Grown Fresh Strawberries, 12 oz Container Premium selection Prior to serving gently wash them and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'Marketside', 'https://i5.walmartimages.com/asr/621e5ad3-5e96-408f-8ccc-92edb0bcb732.3f1ca05169e9bd36a1d1433cab09c9cf.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/621e5ad3-5e96-408f-8ccc-92edb0bcb732.3f1ca05169e9bd36a1d1433cab09c9cf.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/621e5ad3-5e96-408f-8ccc-92edb0bcb732.3f1ca05169e9bd36a1d1433cab09c9cf.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
