INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (601673274, 'Spaghetti Squash, Each', 7.4, '856862005086', 'Treat yourself to a delicious and healthy meal with Spaghetti Squash. When, cooked this unique squash falls apart into ribbons that are the perfect substitute for spaghetti. Roast the squash and serve with marinara sauce and meatballs for a healthy spin on a classic or bake some with pancetta and make a creamy, decadent carbonara. You can even make scrumptious vegan or vegetarian meals using this versatile squash. If you’re feeling creative you can make Spaghetti Squash tacos, Spaghetti Squash casserole, or even pad Thai. Try serving it for breakfast by making Spaghetti Squash nests with a sunny side up egg. The possibilities are endless when you bring home Spaghetti Squash.', 'Spaghetti Squash, 1 Each: When cooked, this squash falls apart into ribbons that are the perfect substitute for spaghetti Perfect for a healthy dinner Incorporate into all sorts of recipes from traditional Italian cuisine to Asian inspired dishes Can even be enjoyed for breakfast with eggs Great for vegan and vegetarian options', 'Fresh Produce', 'https://i5.walmartimages.com/asr/75847174-a16b-465d-89bf-c497505e7c53.84944e37ec234278389fc3d29fd78618.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75847174-a16b-465d-89bf-c497505e7c53.84944e37ec234278389fc3d29fd78618.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/75847174-a16b-465d-89bf-c497505e7c53.84944e37ec234278389fc3d29fd78618.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
