INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (615326756, 'Sweet Cherry Tomato - 2\" x 3\" Pot -Sweet/Intense Flavor', 4.99, '810046277201', 'CHERRY TOMATO: A cherry tomato is a smaller garden variety of tomato. It is popular as a snack and in salads. Cherry tomatoes range in size from a thumbtip up to the size of a golf ball, and can range from being round to slightly oblong in shape. The more oblong ones often share characteristics with plum tomatoes, and are known as grape tomatoes.', 'Flavor is sweet and intense, packed into small, red, round fruits Large sweet cherry tomatoes Indeterminate Easy to grow', 'Hirt\'s Gardens', 'https://i5.walmartimages.com/asr/db00f0cf-7f0b-48c2-bc6e-66f33efa366b_1.4cb67e7a799049964542214387c04d38.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/db00f0cf-7f0b-48c2-bc6e-66f33efa366b_1.4cb67e7a799049964542214387c04d38.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/db00f0cf-7f0b-48c2-bc6e-66f33efa366b_1.4cb67e7a799049964542214387c04d38.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
