INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (616167357, 'NATURAURA - Dried Morel Mushrooms (Morchella Conica) Fresh Flavor, Nutritious, Gourmet Morel Mushrooms 3-4inch Size (2 Ounces)', 27.99, '718910898807', 'NATURAURA works with purveyors from all around the globe to bring you the freshest and finest quality herbs, dried goods, teas, and more! Morchella Mushrooms (Morels) are extremely fragrant and smokey mushrooms that are perfect for soups and other dishes. High in potassium, vitamins, and a wonderful source of Vitamin D. Did you know Morel Mushrooms are known to contain the HIGHEST amounts of Vitamin D out of all edible mushrooms? Yum. - Extremely Fresh & Fragrant Dried Morchella Mushrooms - Morels - Premium Quality Morel Mushrooms - Morchella Mushrooms - Morels contain the HIGHEST amount of -VITAMIN D in ALL edible mushrooms! - Morels are non-GMO, Kosher, & Gluten Free without certification in accordance to CRC Guidelines - High in Vitamins, Potassium, and a great source of Vitamin D', 'Morel Mushrooms are rarely grown commercially, making them a seasonal product generally found in the spring time. You will find morel mushrooms growing by the river beds, forest floors, or in forests that have been in recent fires. We saved you the foraging trip to bring to you morel mushrooms that are expertly dried, extremely fragrant, & naturally delicious. Premium Quality Morel Mushrooms - Morchella Mushrooms are a great source of natural vitamins, and make for a great meat-replacement Did you know? Morel Mushrooms contain the HIGHEST amount of VITAMIN D in ALL edible mushrooms - eating healthy never tasted this good! Yummy! Morels are non-GMO, Kosher, & Gluten Free without certification in accordance to CRC Guidelines - Premium Grade Morels are Packed & Inspected in our California facility. High in Vitamins, Potassium, and a great source of Vitamin D - Eat as many morels as you\'d like, without the guilt!', 'NATURAURA', 'https://i5.walmartimages.com/asr/904c7d3b-c279-4ac0-8aa1-66448c45b5aa.8d6dfb324ae7812036007c0dbec46c2e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/904c7d3b-c279-4ac0-8aa1-66448c45b5aa.8d6dfb324ae7812036007c0dbec46c2e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/904c7d3b-c279-4ac0-8aa1-66448c45b5aa.8d6dfb324ae7812036007c0dbec46c2e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
