INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (621496806, 'Grape Tomato, 10 oz Package', 2.23, 'deleted_059749964012', 'Fresh grape tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily compliments your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Grape Tomatoes are the perfect choice.', 'Grape Tomato, 10 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Fresh produce in a convenient package Store at room temperature for best results', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c7ede83f-b8fe-4651-a689-c1fd2d62c6d2.72513d64ad7bb3a4c5490082646cd67a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (621497000, 'Mann\'s Fresh Green Beans Veggie Sides, 7.8 oz', 3.97, '716519009839', 'Elevate mealtime with the Mann\'s Green Beans Veggie Sides. Made with charred onions and bacon sauce, this side of veggies is a perfect addition to your meals. Pair them with a perfectly cooked steak and potatoes for a delicious meal that will have you feeling like you dined at the best steakhouse in town. You can also serve them with grilled chicken, rolls, and sweet potatoes for a well-rounded dinner your friends and family is sure to love. In just three minutes, you can be enjoying the delicious taste of these green beans. Simply place the bag in the microwave, microwave on high for three minutes, stir until combined, and enjoy. Complete your meals with the Mann\'s Green Beans Veggie Sides.', 'Greens beans with charred onions and bacon sauce Pair with steak and potatoes for a mouthwatering meal Serve with grilled chicken, rolls, and sweet potatoes for a well-rounded meal Ready in just 3 minutes Perfect addition to your meals', 'Unbranded', 'https://i5.walmartimages.com/asr/49aafce9-ae03-41be-94a4-dded974626db.3faf663acc1cf07340c4f9b88a196163.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/49aafce9-ae03-41be-94a4-dded974626db.3faf663acc1cf07340c4f9b88a196163.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/49aafce9-ae03-41be-94a4-dded974626db.3faf663acc1cf07340c4f9b88a196163.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (622057236, 'Fresh Blackberries, 12 oz. Container', 4.84, '033383240015', 'The sweet, juicy flavor of Fresh Blackberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes or yogurt, bake them into mouthwatering blackberry cobbler, mix them with other fruit for a light and flavorful salad, or add them to a creamy smoothie. They contain essential vitamins and nutrients like vitamin C, fiber, potassium, vitamin K and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them with cool water and enjoy the fresh taste. Refrigerate the berries to keep them fresh and ready for use. Pick up a Fresh Blackberry container today and savor the delectable flavor.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blackberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blackberries are plump, juicy, and bursting with natural sweetness. The versatility of blackberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these tasty gems into your baking endeavors, whether it\'s cobblers, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blackberries delicious, but they also offer an array of health benefits. Loaded with vitamins and dietary fiber, blackberries are are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blackberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness.', 'Multiple Suppliers', 'https://i5.walmartimages.com/asr/f3be97b4-beed-464f-8cd4-b09b3127f463.2a64e25bc7eb923e6f0b730a7184fb5c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f3be97b4-beed-464f-8cd4-b09b3127f463.2a64e25bc7eb923e6f0b730a7184fb5c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f3be97b4-beed-464f-8cd4-b09b3127f463.2a64e25bc7eb923e6f0b730a7184fb5c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
