INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (627455471, 'Hot House Cucumber', 1.38, 'deleted_885773000705', 'Enjoy the fresh, crisp, delicious flavor of English Cucumber. Packed with nutritional benefits such as being naturally low in calories, carbohydrates, sodium, fat, and cholesterol, cucumbers also provide potassium, fiber, and vitamin C and clock in at a cool 16 calories per cup. Use this cucumber to make healthy treats such as a cucumber salad with tomatoes and onions in a vinaigrette dressing, toss with fresh mozzarella, tomatoes, and a drizzle of balsamic vinegar, mix diced cucumbers with Greek yogurt, lemon, dill, and garlic for a refreshing tzatziki sauce for gyros or veggies, add to a crisp, fresh veggie salad, or thinly slice and add to a vinegar brine for quick pickles. Any way you slice, dice, or spiralize them, English Cucumber is a refreshing, healthy addition to any meal.', 'English Cucumber, 1 Each: Single cucumber Crisp, delicious, and refreshing Naturally low in calories, carbohydrates, sodium, fat, and cholesterol Provides potassium, fiber, and vitamin C, among other nutrients Create delicious recipes with this fresh cucumber', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/a7d339de-3af8-45cd-bc69-86a17cd5d73a_1.14fce5b7065225996e0144b2dbd78305.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a7d339de-3af8-45cd-bc69-86a17cd5d73a_1.14fce5b7065225996e0144b2dbd78305.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a7d339de-3af8-45cd-bc69-86a17cd5d73a_1.14fce5b7065225996e0144b2dbd78305.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (627993635, 'Shrink Cap | Shortbread w/Large Midnight Black Grapes (100/Pack)', 29.95, '776982330939', 'Elevate Your Wine Experience with Our European Crafted Shrink Caps Enhance Bottle Presentation and Ensure Freshness with Our Shrink Caps! Our Premium Shrink Caps are the perfect addition to any wine bottle, combining elegance with functionality. These caps, expertly crafted in Europe, not only enhance the visual appeal of your bottles but also play a crucial role in maintaining the cork\'s integrity. Our shrink caps are ideal for winemakers, wine enthusiasts, or those who love to gift homemade wine. They are a simple yet effective way to elevate your wine\'s presentation and ensure freshness. Key Features: High-Quality Material:Manufactured in Europe, guaranteeing premium quality and durability. Universal Fit:Designed to fit 375ml, 750ml, and 1500ml wine bottles perfectly. Easy Tear-Off Design:Facilitates a smooth bottle-opening experience. Precise Dimensions:Measuring 30.5mm x 55mm for a flawless fit. Elevated Presentation:Adds a sophisticated touch to any wine bottle. Usage Guide: Slide the Cap:Place the shrink cap over the neck of the wine bottle. Apply Heat:Use a heat gun or steam to shrink the cap around the bottleneck securely. Tear & Pour:Enjoy the easy tear-off design for quick access to your wine. FAQs: Q:Can these shrink caps be used for beverages other than wine?A:They are versatile for any bottled beverage with compatible dimensions. Q:How resistant are these caps to external factors like moisture?A:Crafted with high-quality materials, they resist moisture and other external elements effectively. Q:Are special tools required for application?A:A heat gun or steam source is needed to secure the cap\'s shrinking. Q:Do these caps leave any residue upon removal?A:No, they are designed for clean and residue-free removal.', 'High-Quality Corks and Stoppers for Wine Bottles – Designed to provide a secure seal, preserving the freshness and flavor of your wine with every use. Perfect for Home and Professional Winemakers – Whether for DIY projects or commercial bottling, our corks and stoppers ensure reliable performance and a professional finish. Durable and Easy to Use – Made from premium materials, our wine corks and stoppers are easy to insert and remove, making them ideal for sealing and storing your homemade beverages.', 'ABC Cork', 'https://i5.walmartimages.com/asr/b0f71f2a-8eb6-4f89-a7ac-8f23f9209edc.ba6624c8814ddb31a9b5ff2487e57e72.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b0f71f2a-8eb6-4f89-a7ac-8f23f9209edc.ba6624c8814ddb31a9b5ff2487e57e72.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b0f71f2a-8eb6-4f89-a7ac-8f23f9209edc.ba6624c8814ddb31a9b5ff2487e57e72.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
