INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (634503354, 'Fresh Purple Eggplant, pound', 1.47, '405878099833', 'Create something wholesome and delicious with Eggplant (Berenjena). Eggplants are incredibly versatile and can be used to make a myriad of different recipes. Try them coated in breadcrumbs and fried for a comforting side, or for a healthier option you can stuff them and roast them in the oven. They can also be used to make cheesy eggplant rollatini, decadent eggplant parmesan, and scrumptious eggplant ravioli. You can even incorporate them into hearty stews or use them to top pizzas and more. Use your imagination to create something amazing and tasty with this squash. The mouthwatering possibilities are endless with this hearty vegetable. Add something amazing to your meals with fresh Eggplant.', 'Versatile and delicious Try them coated in breadcrumbs and fried or a comforting side, or for a healthier option you can stuff them and roast them in the oven Can also be used to make cheesy eggplant rollatini, decadent eggplant parmesan, and scrumptious eggplant ravioli.', 'Unbranded', 'https://i5.walmartimages.com/asr/4f18c20a-cf3c-4f33-bca7-73caa1e2c18c.38bfeb59cacabea640eb3364ffec95a0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4f18c20a-cf3c-4f33-bca7-73caa1e2c18c.38bfeb59cacabea640eb3364ffec95a0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4f18c20a-cf3c-4f33-bca7-73caa1e2c18c.38bfeb59cacabea640eb3364ffec95a0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
