INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (635640858, 'Fresh Bartlett Pears, 3 lb Bag', 4.67, '033383001272', 'Savor the sweet taste of Fresh Bartlett Pears. Bartlett Pears are aromatic and have a definitive pear flavor that make them great for breakfast, lunch, dinner, and dessert. Chop the pears up and add them to muffins with walnuts and vanilla for a sweet treat that’s great for breakfast to get your morning started on a high note. Slice them up and top a pizza with prosciutto, goat cheese, and arugula for a mouthwatering meal perfect for a family dinner or dinner party. Cut the pear in half and cook it in a skillet with butter, brown sugar, and vanilla and serve with a scoop of vanilla ice cream for a decadent dessert. Enjoy tasty meals any time of day with Fresh Bartlett Pears.', 'Fresh Bartlett Pears, 3 lb Bag Sweet, crisp, and juicy Excellent snacking pear Make a creamy smoothie or a nutritious juice blend Add to your salad for extra crunch and flavor Adds flavor to a variety of recipes Make pear butter or poached pears Make sweet desserts like pear cobbler, pear crisp or pear tarts', 'Fresh Produce', 'https://i5.walmartimages.com/asr/044859e7-4495-4429-a7d5-57a35d54b7ac.8074ec2e6f35bed8159c3584304a0922.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/044859e7-4495-4429-a7d5-57a35d54b7ac.8074ec2e6f35bed8159c3584304a0922.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/044859e7-4495-4429-a7d5-57a35d54b7ac.8074ec2e6f35bed8159c3584304a0922.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
