INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (636198423, 'Fresh Organic Whole Baby Bella Mushrooms, 16 oz', 5.62, 'deleted_037102281464', 'Experience the fresh taste of Organic Whole Baby Bella Mushrooms. Baby bella mushrooms look similar in size and shape to white mushrooms, but they\'re heartier and provide a deep earthy taste. They are just like portabella mushrooms but have been harvested just a few days before becoming large enough to fit a burger. This means they have that same firm, meaty texture you love about portabella caps, just in a tasty bite-size form. Their hearty, full-bodied taste makes them an excellent addition to beef, wild game and vegetable dishes. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try Organic Whole Baby Bella Mushrooms.', 'Organic Whole Baby Bella Mushrooms, 16 oz: 16-ounce package of organic whole baby bella mushrooms Naturally fat-free Cholesterol-free Low in calories, carbs and sodium Fresh and all natural Wash before use Natural source of the antioxidant selenium Excellent addition to beef, wild game and vegetable dishes', 'Monterey Mushrooms', 'https://i5.walmartimages.com/asr/15767202-08d2-434d-afa1-e0015eb11ca2_2.6195b8da50a357483e89dc2aa3d4c4b2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15767202-08d2-434d-afa1-e0015eb11ca2_2.6195b8da50a357483e89dc2aa3d4c4b2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15767202-08d2-434d-afa1-e0015eb11ca2_2.6195b8da50a357483e89dc2aa3d4c4b2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
