INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (636241090, 'Fresh Opo Squash, Each', 3.05, '000000031417', 'Create something delicious with our fresh Opo Squash. Also known as bottle gourd or calabash, this tasty squash is used in cuisines around the world. You can use it in a stir-fry dish or use it to make a tasty soup with meatballs or your favorite fish. In the Philippines, it\'s used to make a popular dish called Ginisang Upo. However you choose to use them, this opo squash will add flavor and texture to any recipe. Explore new recipes and discover all the delicious ways to prepare this tasty and nutritious squash. Add something fresh and satisfying to your next meal with our Opo Squash.', 'Opo Squash, each: Extremely versatile vegetable Also known as the bottle gourd or calabash Perfect ingredient for cuisines from around the world Try in a stir-fry or a tasty soup Make Ginisang Upo Explore delicious new recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c0f6dac4-532f-443a-8a5b-b789a1058a09.585c97d487c9ca0d549a767706ff8c43.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c0f6dac4-532f-443a-8a5b-b789a1058a09.585c97d487c9ca0d549a767706ff8c43.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c0f6dac4-532f-443a-8a5b-b789a1058a09.585c97d487c9ca0d549a767706ff8c43.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
