INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (636862014, 'Topline Orange Sweet Bell Pepper, 1 Each', 1.5, 'deleted_856122001438', 'Enhance your meals with the delicious flavor of Greenhouse grown Red Bell Peppers. Red bell pepper has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them and add to a deli sandwich, saute them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out red bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper. They also taste delicious raw alongside other vegetables. Red Bell Peppers are an excellent item to have on hand.', 'Naturally low in calories, Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh red peppers', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/00e64d4c-dd5c-47ee-b909-1d8429bba5b8_1.761ddaf9b0d37dfb961ee480c520838a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/00e64d4c-dd5c-47ee-b909-1d8429bba5b8_1.761ddaf9b0d37dfb961ee480c520838a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/00e64d4c-dd5c-47ee-b909-1d8429bba5b8_1.761ddaf9b0d37dfb961ee480c520838a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
