INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (638628040, 'Seeds of Change 1G Lettuce Green Romaine Vegetable Plant Seeds Full Sun', 2.69, '748404081798', 'Experience the euphoria of growing fresh, flavorful salads with our Green Romaine Lettuce Seeds. These seeds promise a bountiful harvest of long, broad leaves that hold together in perfect bunches. Not only can you enjoy the crisp and juicy texture of the lettuce, but you can also savor its unmatched sweetness. Our Green Romaine Lettuce Seeds are the perfect choice for any garden. Start cultivating your lettuce dreams today and create anything but ordinary salads. Grow lettuce like a pro with our premium seeds!', 'Sow directly in the garden as early as the soil can be made fine and loose. Plant seeds every 2 inches, covering firmly with soil. Thin plants to 8 inches apart when they are 2 inches tall. Light Needs: Full Sun Plant Lifecycle: Annual Hardiness Zones: 2 - 11', 'Seeds Of Change', 'https://i5.walmartimages.com/asr/353f40d5-3f9c-4dcd-a3a2-1b5d54fbd050.0c81b7339b0279352d1fd450f4b5e38c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/353f40d5-3f9c-4dcd-a3a2-1b5d54fbd050.0c81b7339b0279352d1fd450f4b5e38c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/353f40d5-3f9c-4dcd-a3a2-1b5d54fbd050.0c81b7339b0279352d1fd450f4b5e38c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (638705858, 'Fresh Dragon Fruit, Each', 4.96, '405529687945', 'Savor the flavors of the tropics when you bring home this sweet Dragon Fruit. Native to Central America and Mexico, this delectable fruit tastes like a combination of a pear and a kiwi. Enjoy this dragon fruit on its own or incorporate it into a variety of recipes. For breakfast, you can use it to make a nutritious and delicious smoothie or add it to a bowl of oatmeal. You can also use it to make a variety of desserts including a refreshing sorbet, a dragon fruit cheesecake, and even dragon fruit chocolate chip cookies. However you choose to use it, this fresh Dragon Fruit is sure to please the entire family.', 'Dragon Fruit, Each Tastes like a combination of a pear and a kiwi Tropical fruit native to Mexico and Central America Enjoy on its own or in a variety of recipes Use to make a delicious smoothie Make a refreshing sorbet Incorporate into your favorite adult beverage Also known as Pitaya, Pitahaya, and Strawberry Pear around the world', 'Fresh Produce', 'https://i5.walmartimages.com/asr/31d47a06-ed1a-479f-9ae2-4dd910134264.52e413fae85171f17e4f55fa3f131ebc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/31d47a06-ed1a-479f-9ae2-4dd910134264.52e413fae85171f17e4f55fa3f131ebc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/31d47a06-ed1a-479f-9ae2-4dd910134264.52e413fae85171f17e4f55fa3f131ebc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (638908858, 'Hot Peppers, 3 oz', 1.98, '684924040542', 'Hot Peppers will add heat and color to your favorite recipes. There are so many ways to incorporate these greenhouse-grown peppers into your favorite foods. Slice them and pickle them so you can have them ready to add to nachos, sandwiches, burritos, and tacos. Add them to a spicy beef and pepper stir fry or use them to add some heat to your homemade guacamole. If you\'re up to it, try them on their own for a fiery snack. These peppers are low in calories, and they\'re also a great source of vitamins. If you\'re looking for a crunchy kick of heat, grab some of these amazing Hot Peppers.', 'Hot Peppers, 3 oz: Colorful & spicy Pickle them & use on nachos, sandwiches, burritos & more Perfect for salsas & guacamole Add to your next stir fry or enchiladas Good source of vitamins Explore delicious new recipes', 'Pure Flavor', 'https://i5.walmartimages.com/asr/08ff33b3-5aac-4acf-91b8-28e7645c5022_1.d731cb94b0cb244fa539dcdd0288fb50.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/08ff33b3-5aac-4acf-91b8-28e7645c5022_1.d731cb94b0cb244fa539dcdd0288fb50.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/08ff33b3-5aac-4acf-91b8-28e7645c5022_1.d731cb94b0cb244fa539dcdd0288fb50.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
