INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (642388758, 'Fresh Mandarin , pound', 1.86, '405826276576', 'Enjoy the juicy goodness of citrus when you eat a Tangerine (Mandarina). Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, tangerines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, tangerines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the tangerines hang out in a bowl on your counter or table to breathe. Compact and portable, tangerines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Tangerines on hand for an easy, healthy treat.', 'Fresh, delicious, tangerine Pleasing sweet-tart flavor Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate', 'Unbranded', 'https://i5.walmartimages.com/asr/69d185d0-ac33-4817-948d-843df37c9467.9b57ed646f5af610f5a679c4b2668765.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/69d185d0-ac33-4817-948d-843df37c9467.9b57ed646f5af610f5a679c4b2668765.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/69d185d0-ac33-4817-948d-843df37c9467.9b57ed646f5af610f5a679c4b2668765.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
