INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (642733276, 'Fresh Slicing Tomato, 1lb Pack', 3.74, '405556009062', 'Bring the fresh, delicious taste of Slicing Tomatoes into your home. These tomatoes deliver sweet and juicy flavor with each bite and are an ideal ingredient in a variety of recipes. They would make a tasty, garden-inspired addition to salads, burgers, gourmet sandwiches, and so much more. They are picked at peak freshness and specially bred for deep red color, intense flavor, and higher lycopene content than standard tomatoes. Whether you slice or dice them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with these fresh Slicing Tomatoes.', 'Slicing Tomato, 1 lb Pack Wholesome, fresh, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, burgers, gourmet sandwiches, and more Add to party trays or school lunches Bred to have higher lycopene than standard tomatoes A good source of vitamin C, K, potassium and folate', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b8ec3dcc-c960-422d-b6e0-2357ea2ffa1f.8f077c19f547fd04eae261d7aa88e385.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b8ec3dcc-c960-422d-b6e0-2357ea2ffa1f.8f077c19f547fd04eae261d7aa88e385.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b8ec3dcc-c960-422d-b6e0-2357ea2ffa1f.8f077c19f547fd04eae261d7aa88e385.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
