INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (643690716, 'Fresh Sweet Corn on the Cob, 4ct', 4.88, '850251002168', 'Treat everyone to the delicious taste of this Fresh Sweet Corn on the Cob. While sweet corn typically invokes images of summer barbeques, it has many health benefits. Sweet corn is a great source of vitamin A and C, with one ear of corn containing over 10% of the daily value of vitamin C and over 6% daily value of vitamin A. It\'s not truly summer until you\'ve had some Fresh Sweet Corn on the Cob - just add butter and salt', 'Fresh Corn on the Cob, 4 Pack Sweet gourmet corn on the cob Husked, field fresh, prewashed, and ready to eat Low in fat and cholesterol free Ideal for your next backyard barbecue or summer camp out May be cooked in the microwave, steamed or boiled', 'Unbranded', 'https://i5.walmartimages.com/asr/a1494139-471e-4991-9652-4a379d727856.31c4c613db4bda009bd2f27e625bd924.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a1494139-471e-4991-9652-4a379d727856.31c4c613db4bda009bd2f27e625bd924.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a1494139-471e-4991-9652-4a379d727856.31c4c613db4bda009bd2f27e625bd924.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
