INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (644342170, '8oz Chile Costeno by 1400s Spices', 14.97, '850035960387', 'At 1400S Spices, we pledged to deliver a wide range of spices, teas and seasonings that will stand out with the superior quality of the ingredients, delightful blends of flavors, and amazing natural properties. Our products are made with carefully selected, fresh and natural ingredients from reliable suppliers, and check all standards of safety and quality, so you can fully enjoy all the benefits from mother nature in your dietary regime. Not completely satisfied with your order? Don’t worry, we are always at your service to address any issues or concerns. Costeno Dried Peppers – Add Spiciness and Flavor to Your Dishes Our dried peppers will delight all your senses with their fruity aroma and lingering taste that will fill your mouth with savor and pleasant smoky flavors! The dried pepper pods have a beautiful, intense red color and fine texture that will make a great addition to traditional Mexican dishes, international dishes, and other delicious recipes, such as tamales, mole, chili, sauces, marinades, meat dishes or vegetable casseroles. Still not convinced? Here are some of the amazing features of this product: • Natural and fresh; • Dried as a whole for preserving the aroma and taste; • Extremely versatile and easy to use; • Great in combination with vegetables, meat, poultry, pork, cheese, garlic and other spices; • Can be used as a whole or ground; • Intense fruity aroma; • Fine red skin; • Heat sealed bag; Indulge in the authentic Mexican taste of the costeno chiles!', 'A Must for Spice Lovers: Whether you are a fan of spicy food or you want to add a little bit of heat to your dishes the dried chili peppers from 1400s Spices are a must-have in your kitchen! Fresh and intense, these dried pepper pods are a versatile cooking ingredient that will enrich your recipes! Fresh Chili Peppers: Our dried peppers are carefully picked fresh costeno chiles, which were naturally dried and packed in a heat sealed bag to preserve their aroma and freshness intact for longer, bringing intense flavor to your dishes! Intense and Flavorful: The 1400s Spices costeno dried chiles have a medium heat with smoky, pleasant notes that will satisfy the cravings for spicy lovers and add a balanced touch to various traditional recipes, Mexican food, or international cuisine. Unique Aroma and Texture: The costeno red chili peppers stand out with a complex fruity fragrance that leaves a long-lasting taste while the fine, red skin brings not only delight but also color to traditional dishes. Versatile Ingredient: These costeno chili peppers are versatile and full of flavor, so you can add the whole pods to your cooking or ground them for preparing Mexican dishes such as tamales, mole, sauces, salsa, making a great pair with pork, poultry, vegetables, and meat dishes.', '1400s Spices', 'https://i5.walmartimages.com/asr/1323c113-19d6-48b3-957f-e5d18bd9ba4b.1a5c0d802c0bf92bc3dad627634c28cc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1323c113-19d6-48b3-957f-e5d18bd9ba4b.1a5c0d802c0bf92bc3dad627634c28cc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1323c113-19d6-48b3-957f-e5d18bd9ba4b.1a5c0d802c0bf92bc3dad627634c28cc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
