INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (646549102, 'Fresh Grape Tomato, 2.5 oz Cup', 1.48, '751666418851', 'Add color and flavor to your next meal with Grape Tomatoes. Similar to larger Roma tomatoes, grape tomatoes have a lower water content than cherry tomatoes, making them meatier, more flavorful, and even a little tidier with every bite. They are hardier and less fragile than a traditional tomato as well, so there\'s no need to worry about bruising either. Perfectly bite-sized, grape tomatoes are not only a simple and delicious addition to salads and pastas, but also serve as a quick and convenient snack all on their own. Plus, grape tomatoes have a longer shelf-life, which means it\'s perfectly fine to keep them in storage for several days at a time. All you have to do is grab and enjoy to experience the class tomato taste of Grape tomatoes.', 'Grape Tomatoes, 2.5 oz: Lower water content and longer shelf-life than cherry tomatoes Hardier and more resistant to bruising than traditional tomatoes Conveniently bite-sized Quick and excellent addition to salads and snack trays Best stored at room temperature out of sunlight', 'Fresh Produce', 'https://i5.walmartimages.com/asr/df5ed044-bded-4216-b14d-eddbc569333e.14855ff5c8b5b9e37a3aedc6c49acaf2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/df5ed044-bded-4216-b14d-eddbc569333e.14855ff5c8b5b9e37a3aedc6c49acaf2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/df5ed044-bded-4216-b14d-eddbc569333e.14855ff5c8b5b9e37a3aedc6c49acaf2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
