INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (646842793, 'Gourmet Garden Gluten Free Roasted Garlic Stir-in Paste, 4.0 oz Tube', 3.94, '875208001544', 'Gourmet Garden Gluten Free Roasted Garlic Stir-in Paste, 4 oz Tube. Roasty-toasty garlic flavor without the pungent smell of garlic on your fingers? It\'s possible, thanks to Gourmet Garden Roasted Garlic Stir-in Paste, our ready-to-use, crushed roasted garlic that enhances almost any food…meats, chicken, soups, marinades, stir-fries or dips to name a few. Packed inside each squeezable tube you\'ll find garlic that\'s been slowly roasted and smoothly crushed to deliver a warm, caramelized garlic punch. Our garlic paste is at its best flavor, color and aroma when it reaches your family\'s table. Use at the end of your cooking to add roasted sweet flavor to sautéed mushrooms, garlic bread, creamy pasta sauces and roasted veggies. Use 1 teaspoon of paste in place of 1 medium garlic clove. Store refrigerated for weeks after opening. This Gourmet Garden Roasted Garlic Stir-in Paste is in a Plastic tube that is 4 ounces. Store this Refrigerated item at an ambient temperature.', 'Gourmet Garden Gluten Free Roasted Garlic Stir-in Paste, 4 oz Tube Roasted, crushed garlic packed into a convenient squeezable tube No prep necessary Stays fresh in refrigerator for weeks after opening Gluten Free Adds sweet, caramelized flavor to garlic bread, pasta sauces, soups & veggies Use 1 tsp. of paste in place of 1 medium garlic clove This product is in a Plastic Tube', 'Gourmet Garden', 'https://i5.walmartimages.com/asr/d1bdc60e-1c29-45cd-b07c-46476b717646.de52bea8332a13bb9a97a3757fa0fd24.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d1bdc60e-1c29-45cd-b07c-46476b717646.de52bea8332a13bb9a97a3757fa0fd24.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/as