INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (649701131, 'Fresh Hydroponic Grown Strawberries, 1 lb Container', 5.72, '086951000030', 'The sweet, juicy flavor of Hydroponic Strawberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. They contain essential vitamins and nutrients like vitamin C, fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Hydroponic Strawberries today and savor the natural delectable flavor.', 'Premium selection Prior to serving gently wash the strawberries and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b72a1d68-d4a1-4b9f-a42f-a0944ef1b8f9.7921f4e711ab8be32944328c3acbbb27.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b72a1d68-d4a1-4b9f-a42f-a0944ef1b8f9.7921f4e711ab8be32944328c3acbbb27.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b72a1d68-d4a1-4b9f-a42f-a0944ef1b8f9.7921f4e711ab8be32944328c3acbbb27.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
