INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (650088511, 'Freshness Guaranteed Chunky Avocado Spread, 15 oz', 5.23, '681131276450', 'Freshness Guaranteed Chunky Avocado Spread is bursting with bold Mexican flavors. Spread this fresh avocado dip made from Hass avocados on toasted whole wheat toast and serve with scrambled egg whites and fresh fruit for a healthy breakfast. Get creative and mix this chunky spread with homemade salsa and peppers to make a zesty dip for game night, or add to sandwiches, wraps and burgers to ensure a mouthful of flavor in every bite. This versatile spread is great for get togethers, parties or any occasion with family and friends! Add the fresh flavor of Freshness Guaranteed Chunky Avocado Spread to your next meal. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Spark Fresh item.', 'Freshness Guaranteed Chunky Avocado Spread, 15 oz: Product of Mexico Made from Hass avocados Great to serve with chips Excellent addition to burgers, wraps and sandwiches', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7177b4fb-dba9-4c97-9321-b6628f5fd52f.f2ab950ce3b77d7c70a990aed5731f2e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7177b4fb-dba9-4c97-9321-b6628f5fd52f.f2ab950ce3b77d7c70a990aed5731f2e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7177b4fb-dba9-4c97-9321-b6628f5fd52f.f2ab950ce3b77d7c70a990aed5731f2e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (650295410, 'Fresh Red Grapefruit, 3lb Bag', 5.27, '605049465720', 'Grapefruit is the perfect balance between tart and sweet. The balance between tart and sweet is great for both savory and sweet dishes any time of day. Enjoy half of a grapefruit sprinkled with sugar with some eggs in the morning for a light, sweet breakfast. Slice it up and put in a salad with spinach, avocado, and red onion topped with a mustard and balsamic vinegar dressing for lunch or dinner. Make delicious grapefruit bars that showcase the sweet and tartness of this versatile fruit. For an adult recipe juice the grapefruit and pair with some simple syrup and alcohol for a refreshing cocktail. This fruit is the perfect addition to a healthy diet as it is a great source of vitamin C and vitamin A. With such versatility, Grapefruit will become a pantry staple in your home.', 'Bursting with delicious juice and boasting a distinct tangy flavor, the fresh grapefruit pack a offers a nutritional punch withmany culinary uses. Refreshing and tangy: Grapefruit is known for its vibrant flavor profile, with a perfect balance of refreshing citrus notes and a tangy kick. Its zesty and invigorating taste can awaken your senses and leave you feeling energized. Immune-boosting powerhouse: Packed with essential vitamins like vitamin C, grapefruit is a natural immune booster. Its high antioxidant content helps protect the body against free radicals and supports overall health and wellness. Versatile and nutritious: Grapefruit is a versatile fruit that can be enjoyed in various ways. Whether you prefer it fresh, juiced, or added to salads and desserts, this citrus fruit is not only delicious but also a great source of vitamins, minerals, and fiber. It\'s a nutritious addition to any balanced diet.', 'Sunkist Growers', 'https://i5.walmartimages.com/asr/13e8aae4-61d1-44b3-b703-39082ec840e8.083d5fae8267df88814795582fb77ab3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/13e8aae4-61d1-44b3-b703-39082ec840e8.083d5fae8267df88814795582fb77ab3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/13e8aae4-61d1-44b3-b703-39082ec840e8.083d5fae8267df88814795582fb77ab3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
