INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (657339515, 'Fresh Organic Romaine Lettuce, Each', 2.16, '033383904092', 'Make salads and sandwiches sing with Organic Romaine Lettuce. This crisp, flavorful lettuce is a staple in Caesar and mixed green salads, deli sandwiches and more, with a cool, refreshing crunch in every bite. Trader Joe\'s romaine lettuce is premium quality and completely organic, crafted without pesticides or herbicides. It contains no fat, no cholesterol, no sodium, no sugar and just eight calories per one cup serving. The whole-leaf lettuce is picked at the peak of flavor and comes ready to chop or use in sandwiches, lettuce cups and more. Trader Joe\'s lettuce should be washed before serving or dicing.', 'Make salads and sandwiches sing with Organic Romaine Lettuce. This crisp, flavorful lettuce is a staple in Caesar and mixed green salads, deli sandwiches and more, with a cool, refreshing crunch in every bite. Trader Joe\'s romaine lettuce is premium quality and completely organic, crafted without pesticides or herbicides. It contains no fat, no cholesterol, no sodium, no sugar and just eight calories per one cup serving. The whole-leaf lettuce is picked at the peak of flavor and comes ready to chop or use in sandwiches, lettuce cups and more. Trader Joe\'s lettuce should be washed before serving or dicing.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/141f0676-09af-4081-ac13-372ba8bd4c52.871f1f2cb031e35690c3141d8323fbdf.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/141f0676-09af-4081-ac13-372ba8bd4c52.871f1f2cb031e35690c3141d8323fbdf.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/141f0676-09af-4081-ac13-372ba8bd4c52.871f1f2cb031e35690c3141d8323fbdf.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
