INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (664519749, 'Sliced Baby Bella Mushrooms, 8 oz', 2.18, 'deleted_631661999879', 'Add flavor and texture to your meals with Sliced Baby Bella Mushrooms. Baby Bella mushrooms are also known as portobello mushrooms. This versatile ingredient is perfect for a variety of dishes, whether it\'s for breakfast, lunch, or dinner. Mince some up and put them in your omelet with peppers and ham for a filling and nutritious breakfast. Add them to a healthy salad for lunch or use them to top off your next homemade pizza. Baby Bella mushrooms are an excellent source of niacin and are naturally low in fat and cholesterol-free. Enjoy the delicious taste of Sliced Baby Bella Mushrooms any way you prepare them.', 'Sliced Baby Bella Mushrooms, 8 oz: Adds flavor and texture to your meals Great for breakfast, lunch, or dinner Mince them for an omelet, put them in a salad, or use as a topping on pizza Naturally low in fat and cholesterol-free Rich source of niacin', 'Fresh Produce', 'https://i5.walmartimages.com/asr/3e32c0f5-b81b-41d8-b810-15475fb95279.10e200b9442aef9d105550e3fead7b1e.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e32c0f5-b81b-41d8-b810-15475fb95279.10e200b9442aef9d105550e3fead7b1e.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e32c0f5-b81b-41d8-b810-15475fb95279.10e200b9442aef9d105550e3fead7b1e.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (664677584, 'Kabocha Squash', 1.48, '000000047692', 'Kabocha Squash is also known as Japanese pumpkin and is ideal for creating tasty Asian dishes. It features a dark green outer skin that is marked with uneven stripes. This organic kabocha squash has finely textured golden flesh on the inside that resembles a pumpkin or sweet potato in flavor. Like other winter squash, it\'s rich in nutrients that include fiber, beta carotene and potassium. Kabocha is a fat-free vegetable that can be cooked or baked as is with the skin on or used in pies, soups and more.', 'Kabocha squash is also known as Japanese pumpkin Ideal for creating tasty Asian dishes Features a dark green outer skin with uneven stripes Inside has a finely textured golden flesh Resembles pumpkin or sweet potato in flavor Rich in fiber, beta carotene and potassium Fat-free vegetable used in pies, soups and more', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5d1d068a-7b60-491c-9099-2ec9a29577d4.ecfea1f9c8a30e96c1c93045ae5944e4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d1d068a-7b60-491c-9099-2ec9a29577d4.ecfea1f9c8a30e96c1c93045ae5944e4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d1d068a-7b60-491c-9099-2ec9a29577d4.ecfea1f9c8a30e96c1c93045ae5944e4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
