INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (667677667, 'China Fresca Mondada', 4.98, '826594105071', 'Enjoy the juicy goodness of Fresh Navel Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes', 'China Fresca', 'https://i5.walmartimages.com/asr/e39e5863-a82e-4342-b1ed-afb0c1dcf30a.879b01680d07730f2abb7cfc7284f91b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e39e5863-a82e-4342-b1ed-afb0c1dcf30a.879b01680d07730f2abb7cfc7284f91b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e39e5863-a82e-4342-b1ed-afb0c1dcf30a.879b01680d07730f2abb7cfc7284f91b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (667892999, 'Fresh Black Seedless Grapes', 2.08, 'deleted_814326010021', 'Treat yourself to the delicious, juicy flavor of Fresh Black Seedless Grapes. These grapes are bursting with flavor and are completely seedless, so you can easily enjoy a handful as a fresh snack any time of day. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the fresh taste of Fresh Black Seedless Grapes.', 'Fresh Black Seedless Grapes: Seedless black grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Incorporate into fruit salad Perfect for quick, easy and healthy snacks', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/afe6f179-14e7-45ab-b015-a069c18afd72.9ddad7f820d1981e1d57d83261a3ac74.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/afe6f179-14e7-45ab-b015-a069c18afd72.9ddad7f820d1981e1d57d83261a3ac74.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/afe6f179-14e7-45ab-b015-a069c18afd72.9ddad7f820d1981e1d57d83261a3ac74.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (668305688, 'Freshness Guaranteed Red Apple Slices, 14 oz', 2.98, '681131180047', 'Enjoy the sweet, refreshing taste of Freshness Guaranteed Red Apple Slices. These pre-cut slices are great for breakfast, lunch, dessert, or when you want a snack. Apples are a good source of vitamin C, fiber, and potassium making them an excellent healthy treat. You can eat the slices right out of the container, serve with a dollop of peanut butter for a sweet treat, or cover them in nutmeg and cinnamon and bake in the oven for a mouthwatering dish. With 14-ounces in each container, these apples are great for sharing with friends and family or keeping it for yourself. Them come in a reclosable container to help maintain freshness. Bring home Freshness Guaranteed Red Apples Slices today for a refreshing, healthy treat. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Red Apple Slices, 14 oz Sweet, refreshing treat Great for breakfast, lunch, dessert, or when you want a snack Good source of vitamin C, fiber, and potassium Enjoy right out of the container, serve with a dollop of peanut butter, or cover in nutmeg and cinnamon and bake Share with friends and family or keep for yourself Comes in a re-closable container to help maintain freshness', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/636ce479-bc80-4f01-a8ab-783ec183dd96.553dce4be0acae99770887255a538d7d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/636ce479-bc80-4f01-a8ab-783ec183dd96.553dce4be0acae99770887255a538d7d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/636ce479-bc8