INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (670791352, 'Fresh Pears Bosc , 3 lb. Bag', 9.47, '', 'The Bosc pear is a variety widely recognized for its sweet flavor, firm texture, and distinctive appearance. Its skin is cinnamon-brown or tan, often with a slightly rough texture. It has an elongated body and a well-defined neck, more slender than other pears. Its firm texture makes it perfect for warm cooking, where other pears fall apart. It doesn\'t change color much when ripe, unlike other varieties. It is very aromatic. Excellent for baking, roasting, or poaching because it maintains its shape. It is used in pies, compotes, salads, jams, or simply on its own with cheese.', 'Fresh Bosc Pears, 3 lb Bag It is used in pies, compotes, salads, jams, or simply on its own with cheese. It is very aromatic. It doesn\'t change color much when ripe, unlike other varieties. Sweet and spicy flavor, sometimes with a hint of honey or nuts.', 'Unbranded', 'https://i5.walmartimages.com/asr/3acbee8f-3b94-4380-ba0f-05a971cb5982.cbcf5a4fd03f6a8bf2d5aefabe6df3ff.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3acbee8f-3b94-4380-ba0f-05a971cb5982.cbcf5a4fd03f6a8bf2d5aefabe6df3ff.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3acbee8f-3b94-4380-ba0f-05a971cb5982.cbcf5a4fd03f6a8bf2d5aefabe6df3ff.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
