INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (671874658, 'Fresh Orange Bell Pepper, Each', 2.47, '000000049504', 'Enhance your meals with the delicious flavor of Fresh Orange Bell Peppers. This fresh vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Orange bell pepper, also known as red capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them, sauté them with onions or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out red bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudité. Cooked or uncooked, Orange Bell Peppers are an excellent item to have on hand.', 'This item has a large amounts of vitamins such as A, E, B6, B9, C & K. It also a great source of minerals such as zinc, magnesium, potassium and sodium. Fresh High on Vitamin A Large amounts of Vitamin E', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e3ac8bb7-bf73-407e-947a-5b10de54ddc7.b9c0a3d6f58069d8057b7daa38c62429.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e3ac8bb7-bf73-407e-947a-5b10de54ddc7.b9c0a3d6f58069d8057b7daa38c62429.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e3ac8bb7-bf73-407e-947a-5b10de54ddc7.b9c0a3d6f58069d8057b7daa38c62429.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (672030629, 'Fresh Medium Salad Tomatoes, 2 lb Bag', 0.5, '405533272694', 'Slicing Tomatoes are the leader when it comes to yummy, fresh tomatoes. The juicy tomato taste and meaty texture make these tomatoes the perfect choice for slicing up and topping your favorite slider and sandwiches. Use them to make a hearty grilled cheese and tomato sandwich that\'s bursting with flavor. Slice some up and pair with fresh mozzarella, basil, and balsamic vinegar for a delicious appetizer. You can even enjoy a slice topped with a sprinkle of salt and pepper for a fresh, healthy snack. Add Slicing Tomatoes to your fresh produce basket today for a delicious juicy addition.', 'Whole, Fresh, Whole Tomatoes picked at their peak Medium sized salad tomatoes, 1 lb. Approximately 2-3 tomatoes per lb Grown for peak flavor Slicing Tomatoes are the leader when it comes to yummy, fresh tomatoes. T he juicy tomato taste and meaty texture make these tomatoes the perfect choice for slicing up and topping your favorite slider and sandwiches. Use them to make a hearty grilled cheese and tomato sandwich that\'s bursting with flavor. Slice some up and pair with fresh mozzarella, basil, and balsamic vinegar for a delicious appetizer. You can even enjoy a slice topped with a sprinkle of salt and pepper for a fresh, healthy snack. Add Slicing Tomatoes to your fresh produce basket today for a delicious juicy addition.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2d15e187-76cb-45fd-ba51-efeb13ef44e9.5e8fe94af9ad13039b11a52194045401.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2d15e187-76cb-45fd-ba51-efeb13ef44e9.5e8fe94af9ad13039b11a52194045401.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2d15e187-76cb-45fd-ba51-efeb13ef44e9.5e8fe94af9ad13039b11a5219404540