INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (674160451, 'Fresh Mango', 0.98, '405955703059', 'Mangoes are a tropical fruit known for their sweet, slightly tart flavor and buttery texture. They are a rich source of vitamins A and C, dietary fiber, and antioxidants, offering various health benefits such as improved digestion, heart health, and immune function. Mangoes are widely consumed globally, used in a variety of dishes ranging from smoothies and salads to curries and desserts. Their ripeness can be determined by a sweet aroma and slight softness to touch.', 'Mangoes are tropical fruits known for their sweet and slightly tangy flavor, buttery texture, and vibrant color. They are one of the most widely consumed fruits globally, particularly in Asia, Central and South America, and the Middle East. Mangoes offer a myriad of health benefits due to their rich nutrient profile and are versatile in their culinary uses, often being used in both sweet and savory dishes. Taste and Culinary Uses: Mangoes possess a unique flavor that is lusciously sweet with a hint of tartness and a rich, creamy texture. They are commonly eaten fresh, but they can also be incorporated into a variety of dishes. Mangoes are used in making smoothies, salads, salsas, curries, and desserts like ice cream and pastries. Also, dried and pickled mangoes are popular snacks in many cultures. Health Benefits: Mangoes are a nutritional powerhouse packed with vitamins A and C, dietary fiber, and antioxidants. They can support heart health, improve digestion, promote healthy skin and hair, and boost the immune system. The high levels of antioxidants in mangoes are linked to fighting against certain types of cancer. Cultivation and Harvest: Mango trees thrive in tropical climates and can grow quite large, often reaching heights of 100 feet. They bear fruit annually, with the major harvest season varying depending on the region. The fruit is harvested when mature, but not fully ripe, and it continues to ripen off the tree. The ripeness of a mango can usually be determined by its slightly sweet aroma and slight give when gently pressed.', 'Unbranded', 'https://i5.walmartimages.com/asr/d4993498-cb0a-4539-bee5-b3c0db4a6702.ee3057845556133bab8fb2cd8e56b1a1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d4993498-cb0a-4539-bee5-b3c0db4a6702.ee3057845556133bab8fb2cd8e56b1a1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d4993498-cb0a-4539-bee5-b3c0db4a6702.ee3057845556133bab8fb2cd8e56b1a1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (674219887, 'Medley Tomato, 12 oz Package', 4.48, 'deleted_816239011058', 'Bring the fresh, delicious taste of Grape Tomatoes into your home. These little, round tomatoes deliver sweet and juicy flavor with each bite, making them a lovely, garden-inspired addition to salads at lunch or dinner, pasta, flatbreads, omelets, and so much more. They are small and bite sized, which makes them easy to enjoy as a healthy snack, whether they\'re on a party tray with other vegetables or tucked inside your kiddo\'s school lunch. However you choose to use them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with this package of Grape Tomatoes.', 'Tomato Medley', 'Fresh Produce', '', '', '');
