INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (681216192, 'Red Bell Pepper, each', 1.38, 'deleted_816053020045', 'Enhance your meals with the delicious flavor of Red Bell Peppers. This vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Red bell pepper, also known as red capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them and add to a deli sandwich, saute them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out red bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. Lunches and dinners are more scrumptious when fresh red peppers are part of the meal. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudite. Cooked or uncooked, Red Bell Peppers are an excellent item to have on hand.', 'Red Bell Pepper, 1 each: Naturally low in calories Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh red peppers', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/3e7798c2-b396-47ca-af17-78dfa3ce2b4a_2.013ab2925acb792bc065227f97aac0da.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e7798c2-b396-47ca-af17-78dfa3ce2b4a_2.013ab2925acb792bc065227f97aac0da.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3e7798c2-b396-47ca-af17-78dfa3ce2b4a_2.013ab2925acb792bc065227f97aac0da.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
