INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (681782609, 'Organic Micro Mustard Greens', 1.98, '768573417624', 'The spice is right! This is the perfect blend of sweet and heat. Microgreens are baby greens only 7-14 days old. Why do we harvest them so young? When they are harvested that young, all of the flavor potential of that plant is condensed into the young microgreen. This means you get a TON of flavor in the smallest tiny green! Talk about bang for your buck!', 'Organic Micro Mustard Greens', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ee84f5c5-f496-4865-b4c2-d18f6325ba6a_2.6f1f19624922d0fb0eb62647869a1556.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ee84f5c5-f496-4865-b4c2-d18f6325ba6a_2.6f1f19624922d0fb0eb62647869a1556.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ee84f5c5-f496-4865-b4c2-d18f6325ba6a_2.6f1f19624922d0fb0eb62647869a1556.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
