INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (683705157, 'Fresh Dragon Fruit Puerto Rico, Each', 4.97, '405873138513', 'Dragon fruit, also known as pitaya, is a vibrant tropical fruit native to Central America. Recognizable for its bright pink or yellow, spiky skin and creamy pulp filled with tiny seeds, it offers a subtly sweet taste reminiscent of kiwi or pear. Dragon fruit is a nutritional powerhouse, providing high amounts of fiber, vitamin C, essential minerals, and antioxidants. Grown on a climbing cactus, this refreshing fruit is harvested when its skin color fully develops, offering a unique and healthful treat.', 'Dragon fruit, also known as pitaya, is a tropical fruit that belongs to the cactus family. Native to Central America but now grown all over the world, dragon fruit is known for its unique appearance, vibrant color, and a wealth of health benefits. The fruit has a leathery, slightly leafy skin that is bright pink or yellow in color, while the inside boasts a sweet, creamy pulp dotted with tiny, crunchy seeds. Appearance and Taste: Dragon fruit stands out for its flamboyant appearance, with its bright pink or yellow, spiky skin, and white or red flesh speckled with small black seeds. The taste of dragon fruit is subtly sweet and often compared to that of a kiwi or pear, with the seeds providing a satisfying crunch. Its texture is wonderfully juicy and creamy, making it a refreshing treat on a hot day. Health Benefits: Dragon fruit is a nutritional powerhouse, packed with a range of beneficial compounds. It\'s high in fiber, vitamin C, and several essential minerals like iron and magnesium. Dragon fruit is also rich in antioxidants, which help fight off free radicals and prevent cell damage. Moreover, it contains prebiotics, which promote the growth of beneficial bacteria in your gut, contributing to a healthy digestive system. Cultivation and Harvest: Dragon fruit grows on a cactus plant that climbs up trees or walls with the help of its aerial roots. It thrives best in a dry tropical climate with a moderate amount of rain. The fruit is harvested when its skin color changes from bright green to pink or yellow, depending on the variety. Despite its exotic appearance, dragon fruit is easy to eat; simply slice it in half and scoop out the flesh with a spoon.', 'Unbranded', 'https://i5.walmartimages.com/asr/6d46cc06-b9ab-4e6d-9b17-e1382991294d.55a0a0edc7c44b84f29bd065c7d43da4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6d46cc06-b9ab-4e6d-9b17-e1382991294d.55a0a0edc7c44b84f29bd065c7d43da4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6d46cc06-b9ab-4e6d-9b17-e1382991294d.55a0a0edc7c44b84f29bd065c7d43da4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (683743845, 'Prico Papaya Chunks, 12OZ', 4.27, '794504171624', 'Papaya is a tropical fruit that originated in the tropics of the Americas and is known to be a great source of vitamins C, A, fiber, and antioxidants. When ripe, this fruit has a butter-like texture with a fairly sweet flavor similar to cantaloupe and can be eaten raw, without skin or seeds. Papaya can be prepared in a variety of ways; you can mix them with grapefruit and avocado for a bright summer salad, add them to a zesty salsa for some sweetness, freeze them and turn them into refreshing popsicle spears, or bake them in the oven with a melted brown sugar mixture. The sky\'s the limit! Get ready for a taste-bud party with Fresh Papaya.', 'Creamy, butter-like flavor when ripe Rich in vitamins A, C, fiber, and antioxidants Fairly sweet flavor like cantaloupe and mango Great addition to smoothies, salads, salsa, and more Delicious and nutritious Saves time', 'Prico', 'https://i5.walmartimages.com/asr/6b0b4bf5-d45a-4a1b-9cf4-74339d69df11.58deea78e570ba5906cc3b66311d6a46.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6b0b4bf5-d45a-4a1b-9cf4-74339d69df11.58deea78e570ba5906cc3b66311d6a46.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6b0b4bf5-d45a-4a1b-9cf4-74339d69df11.58deea78e570ba5906cc3b66311d6a46.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
