INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (686784846, 'Fresh Roma Tomato, Each Weight', 1.97, '000000017657', 'With Fresh Roma Tomatoes from Walmart, it\'s easy to make a wholesome, delicious meal. Roma tomatoes are a fresh produce ingredient for whipping up a variety of wonderful dishes. You can use them to create a zesty tomato sauce for stirring into a homemade pasta dish, crush them up to make a delightful Roma tomato bruschetta, or simply enjoy them on their own as a nutritious snack or as a party platter option for dipping in your favorite vegetable dipping sauce. If you\'re feeling a classic tomato dish, Roma tomatoes can even lend themselves in making a comforting and appetizing tomato soup or a flavorful salsa. However you choose to use them, each Roma tomato will add stunning flavor to your meal. Just find the recipe and experience the tasty results for yourself! Elevate your recipes with Roma Tomatoes.', 'Wholesome and delicious fresh produce Ideal ingredient for a variety of dishes Perfect for making zesty tomato sauces Enjoyable as a nutritious snack Excellent for homemade salsa', 'Hypermart', 'https://i5.walmartimages.com/asr/ecef8a3e-ab96-445e-a16a-d639b40eb5fb.93fcc627f542f02488e5ee9d8e26f152.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ecef8a3e-ab96-445e-a16a-d639b40eb5fb.93fcc627f542f02488e5ee9d8e26f152.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ecef8a3e-ab96-445e-a16a-d639b40eb5fb.93fcc627f542f02488e5ee9d8e26f152.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
