INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (687495340, 'Wild Twist Frehs Apples, Each', 0.62, '000000035194', 'Indulge in a unique twist of flavor with our Apple Wild Twist! This delicious snack combines the sweetness of fresh apples with the tangy taste of wild berries for a taste bud-tingling experience. Our Wild Twist is made with real fruit and contains no artificial flavors or preservatives, making it a healthy snack option. Perfect for on-the-go or as a midday snack, our Apple Wild Twist is sure to satisfy your cravings. Order now and experience the perfect balance of sweet and tangy!', 'Looking for a fresh delicious and unique apple variety to add to your fruit bowl or recipe? Look no further than our Wild Twist Apples! These apples are hand-selected for their distinctive flavor and appearance - each one has a unique combination of sweet and tart notes, with a beautiful marbled appearance that makes them stand out from other apple varieties. Perfect for snacking or baking, our Wild Twist Apples are sure to add a burst of flavor to any dish. And with our bulk option, you\'ll have plenty to share with friends and family. Plus, they\'re packed with essential nutrients and antioxidants, making them a healthy choice for any time of day. So why settle for ordinary apples when you can enjoy the unique taste and appearance of our Wild Twist Apples? Order yours today and experience the deliciousness for yourself! Make a creamy smoothie or a nutritious juice blend Perfect as a healthy treat or seasonal baking ingredient Great for packing in lunches Make a creamy smoothie or a nutritious juice blend Adds flavor to a variety of recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/273a4d10-e113-4fde-84f4-dd405828c3ae.3fd08fe27fc4df5b996c57b1aac5b289.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/273a4d10-e113