INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (692697485, 'Marketside Organic Fresh Garlic, 3 Count', 2.33, 'deleted_681131180733', 'Spice up your meal by adding some Marketside Organic Fresh Garlic. Each sleeve contains three bulbs, and they are certified organic as per USDA standards. Mince them to the desired size or use a clove and enjoy a zesty flavor that you will love. It can be applied to different kinds of bread in butter or oil to create a variety of classic dishes, such as garlic bread, garlic toast, bruschetta, crostini, and canape. You can also add them to soups, stews, sauces, dressings, gravy, meat, fish, pizza and more. Enhance the flavor of your cooked meals with Marketside Organic Fresh Garlic.Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Fresh Garlic, 3 Count: Certified organic as per USDA standards Sleeve contains three bulbs Provides the classic zesty garlic flavor that you love Use to make garlic bread or bruschetta Add to pasta, stew, pizza, and more', 'Marketside', 'https://i5.walmartimages.com/asr/b555b30e-bec4-47fb-8e4c-feb93db5fec6.9143fb8b62fb90fee36d4e8c35966c75.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b555b30e-bec4-47fb-8e4c-feb93db5fec6.9143fb8b62fb90fee36d4e8c35966c75.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b555b30e-bec4-47fb-8e4c-feb93db5fec6.9143fb8b62fb90fee36d4e8c35966c75.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (693055912, 'Fresh Slicing Tomato, 2 Pack', 2.48, '679508081363', 'Bring the fresh, delicious taste of Slicing Tomatoes into your home. These tomatoes deliver sweet and juicy flavor with each bite and are an ideal ingredient in a variety of recipes. They would make a tasty, garden-inspired addition to salads, burgers, gourmet sandwiches, and so much more. They are picked at peak freshness and specially bred for deep red color, intense flavor, and higher lycopene content than standard tomatoes. Whether you slice or dice them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with these fresh Slicing Tomatoes.', 'Slicing Tomato, 2 Pack: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, burgers, gourmet sandwiches, and more Add to party trays or school lunches Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e648291f-0ccf-4ef5-a8f8-7fbe8d8686bb.192e42a5f946db220a42352ce18ef6f8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e648291f-0ccf-4ef5-a8f8-7fbe8d8686bb.192e42a5f946db220a42352ce18ef6f8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e648291f-0ccf-4ef5-a8f8-7fbe8d8686bb.192e42a5f946db220a42352ce18ef6f8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
