INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (704777981, 'Organic Grape Tomatoes, 10 oz Package', 2.48, '751666156708', 'Organic Medley Tomatoes are an exciting summer treat, and they\'re the perfect size for skewers, salads and roasting. These bite-sized medley tomatoes look and taste great. Medley tomatoes are a low-calorie treat that are also low in sodium and are a good source of fiber. Whether you are snacking or adding them to your favorite dish. their uses are almost limitless. Try these grape tomatoes with feta cheese, fresh dill and a drizzle of olive oil for a light and delicious Mediterranean treat. Or make a caprese salad with medley tomatoes, fresh basil, fresh mozzarella and balsamic vinegar. With 10-ounces of tomatoes in each package, you\'ll have plenty to make mouthwatering meals. Use your imagination to create delicious dishes with Organic Medley Tomatoes.', 'Organic Medley Tomatoes, 10 oz Package: Perfect size for skewers, salads and roasting Low-calorie, low in sodium, and a good source of fiber Pair with feta cheese, fresh dill, and a drizzle of olive oil for a Mediterranean dish Certified organic', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c12abd1f-2dcc-48ec-8f2f-7ae68c5c7191.f5ee8743ba711fe48df16e3eadf72686.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c12abd1f-2dcc-48ec-8f2f-7ae68c5c7191.f5ee8743ba711fe48df16e3eadf72686.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c12abd1f-2dcc-48ec-8f2f-7ae68c5c7191.f5ee8743ba711fe48df16e3eadf72686.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
