INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (705581913, 'Watermelon Chunks 32oz', 10.98, '045009891242', 'Experience a burst of summertime goodness with this delicious Freshness Guaranteed Watermelon. This pre-cut ripe watermelon is juicy, sweet, and refreshing to the taste. In addition, watermelons are a great natural source of vitamins A and C. Carry them with you and eat them straight out of the tray any time you want, at home, or on-the-go. Pair them with a tasty salad or sandwich for a nutritious and delicious lunch. You can also use them as a naturally sweet ingredient in a fruit salad. Add some fresh fruit to your daily menu with this Freshness Guaranteed Watermelon.Freshness Guaranteed provides you and your family with high quality fresh food that save you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Watermelon Chunks, 32 oz: Ready to eat watermelon Bag Great for fruit salad Summer treat Net weight 32 oz Sweet and Juicy', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a6977c73-d8a5-4514-9b4d-93002d2c49dc.2a7856e7d56baaf2f00551e23bb98e55.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6977c73-d8a5-4514-9b4d-93002d2c49dc.2a7856e7d56baaf2f00551e23bb98e55.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6977c73-d8a5-4514-9b4d-93002d2c49dc.2a7856e7d56baaf2f00551e23bb98e55.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (705848836, 'Dried Mushroom Kibble by Its Delish, 8 Oz Large Jar Dark Chilean Dehydrated and Chopped Boletus Luteus Mushrooms for Cooking and Flavoring', 36.99, '799137109228', 'Dried Kibbled Mushrooms by Its Delish Boletus Luteus mushrooms is a wild-grown dark mushroom with a deep and earthy flavor, commonly called the brown or Chilean mushroom, sorted, washed, trimmed, and air-dried. There are a good source of vitamin, minerals and protein. These are 100% all-natural with no added ingredients or preservatives. These chopped mushroom flakes are used in a wide variety of applications for rich-flavored mushroom for including sauces, gravy, soups, vegetable stock, broth and stews, pasta products, meats and sausages, seasoning blends, salad products, pot pies, and casseroles and ready meals. Prep Instruction Ideas: Add these mushrooms while slow cooking soups, stews, sauces, casseroles and other foods with sufficient liquid content. In other applications, hydrate by using 1 part dried mushroom and 5 parts water. Simmer for 10-15 minutes. Add water if necessary. Yields 1 oz equals about 1/2 cup dry. Generally, air dried vegetables double in volume when hydrated. Dry/Fresh Ratio 1 lb of air dried boletus luteus mushrooms, once rehydrated, equals approximately 6 lbs of fresh prepared boletus luteus mushrooms. Storage Suggestion Best if used within 18 months. Store tightly sealed in a dry location away from sunlight. Tip: For ready to use mushrooms, soak the dry mushrooms in a sealed container and store in the refrigerator. Stock up and enjoy! About It\'s Delish! It\'s Delish was established in 1992 and is located in North Hollywood, California. It\'s Delish is a food manufacturer and distributor who produces over 500 gourmet food products including licorice, sour belts, taffies, caramels, Jordan almonds, chocolates, nuts, fruits, trail mixes, spices, and the spice blends. It\'s Delish also produces organics and all-natural products. We give you the opportunity to order from the factory direct!', 'PREMIUM - Gourmet Dried Mushrooms Kibble Similar to Porcini and chopped into small dices VALUE SIZE - Half Pound 8 Oz Convenient Large Jar by the Its Delish brand ENHANCE your culinary experience with hearty flavor, bold taste and vibrant aroma. Add rich flavors paired with vitamins, minerals and protein to your favorite recipes and dishes AWESOME in sauces, gravy, soups, vegetable stock, broth and stews, pasta products, meats and sausages, seasoning blends, salad products, pot pies, risottos and casseroles and ready meals. QUALITY - Certified Kosher OU Parve, Non-Dairy, Vegan, All-Natural, No MSG, No preservatives, Gluten Free, Packaged in the USA and Shipped to you Direct!', 'It\'s Delish', 'https://i5.walmartimages.com/asr/94d643da-b2b9-451f-978f-24dbcfaeca10.d300a6a22aaefdc274c993786857c5b3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/94d643da-b2b9-451f-978f-24dbcfaeca10.d300a6a22aaefdc274c993786857c5b3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/94d643da-b2b9-451f-978f-24dbcfaeca10.d300a6a22aaefdc274c993786857c5b3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
