INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (707143838, 'Marketside Organic Super Blend, 10 oz', 3.98, '681131179423', 'Marketside Super Blend is packed with a wholesome blend of broccoli, colored carrots, green cabbage and kale. This crisp medley is packed fresh, washed and ready to eat for your convenience. Use this blend to make our delicious super blend with apples recipe located on the back of the packaging. All you need is one small organic apple, half a cup of organic almonds and half a cup of organic balsamic vinaigrette. In a large bowl, combine super blend, chopped apple and almonds. Pour balsamic vinaigrette over bowl, toss ingredients, cover and chill. Serve this prepared side with baked chicken and grilled asparagus for a delicious and healthy meal. Dinner sides are made easy with Marketside Organic Super Blend Slaw. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Super Blend, 10 oz: Blend of broccoli, colored carrots, green cabbage and kale USDA Organic Washed and ready to eat Net weight 10 oz', 'Marketside', 'https://i5.walmartimages.com/asr/0da279ea-3878-457b-9b22-b67cbd383681_2.2e61c037b7fc45cf67dd21ba247f88f2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0da279ea-3878-457b-9b22-b67cbd383681_2.2e61c037b7fc45cf67dd21ba247f88f2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0da279ea-3878-457b-9b22-b67cbd383681_2.2e61c037b7fc45cf67dd21ba247f88f2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
