INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (715363420, 'Fresh Pineapple, Each', 3.57, '405698173997', 'Enjoy a burst of tropical flavor with this Fresh Pineapple. This pineapple can be a satisfying afternoon snack, or you can use it in a variety of recipes. For breakfast, use this pineapple to make a rich and creamy smoothie or serve it alongside your pancakes, sausage, and eggs. Slice it up and use to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. For dessert, you could make a crowd-pleasing pineapple upside down cake or a comforting pineapple crisp. However you choose to use it, this Fresh Pineapple will add flavor to any meal or beverage.', 'Pineapples are more than just a tropical fruit; they are a treasure trove of health benefits. This juicy, sweet fruit is loaded with vitamins and minerals, including vitamin C, manganese, copper, and folate. Pineapples are also the only source of the unique enzyme, bromelain, which aids digestion, reduces inflammation, and can help to fight against cancer and heal wounds. They are also packed with antioxidants, known for boosting the immune system, and their high fiber content helps to maintain a healthy digestive system. With a high water content, pineapples also contribute to hydration and can support weight loss by promoting feelings of fullness.', 'Unbranded', 'https://i5.walmartimages.com/asr/1f8bda13-cca8-42e7-8de8-07b8f9bb9380.b372efb198082dfe0bcb33cbbf786e57.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1f8bda13-cca8-42e7-8de8-07b8f9bb9380.b372efb198082dfe0bcb33cbbf786e57.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1f8bda13-cca8-42e7-8de8-07b8f9bb9380.b372efb198082dfe0bcb33cbbf786e57.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (716066698, 'Organic Marketside Fresh Celery Stalk, Each', 2.87, '294070000002', 'Marketside Organic Celery is flavorful and tender; the ideal vegetable for your kitchen. Celery can be used in a variety of ways in the kitchen and are perfect for health-conscious individuals, since they are USDA Organic and serve as a satisfying snack with many health benefits. Celery is great for juicing, braised, in soups or served raw with a favorite dip. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Tender & Flavorful USDA Organic Excellent juiced, braised, in soups or served raw with a favorite dip Keep refrigerated', 'Marketside', 'https://i5.walmartimages.com/asr/f2cc9284-53fa-4c72-88d7-387b61742ec2.01cfc558033dc659c7a4cc33568ea3ed.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f2cc9284-53fa-4c72-88d7-387b61742ec2.01cfc558033dc659c7a4cc33568ea3ed.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f2cc9284-53fa-4c72-88d7-387b61742ec2.01cfc558033dc659c7a4cc33568ea3ed.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (716698539, 'Fresh Seedless Red Grape Puerto Rico, Bag', 2.17, '405705810952', 'Indulge in the irresistible sweetness of our fresh seedless red grapes, conveniently packed in a bag. These plump and juicy grapes are a delightful treat for any occasion. Each grape is carefully hand-picked to ensure the highest quality and optimal ripeness. With a vibrant red color, these grapes are visually enticing and will add a pop of color to any fruit platter or dessert. The absence of seeds makes them a hassle-free snacking option, allowing you to enjoy the pure, juicy goodness without any interruptions. The firm yet juicy texture of these grapes creates a satisfying burst of flavor with every bite. Whether enjoyed as a quick and healthy snack, added to salads, or used in desserts, our fresh seedless red grapes are a delicious and versatile fruit that will leave your taste buds craving for more.', 'Uva Roja Sin Semilla', 'Unbranded', 'https://i5.walmartimages.com/asr/20529a01-44a5-46fb-b7c4-26a769f28069.a8df8537d9e01c6d9c08ebdb227bd1aa.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/20529a01-44a5-46fb-b7c4-26a769f28069.a8df8537d9e01c6d9c08ebdb227bd1aa.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/20529a01-44a5-46fb-b7c4-26a769f28069.a8df8537d9e01c6d9c08ebdb227bd1aa.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
