INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (719838605, 'Freshness Guaranteed Diced Fresh Mirepoix Blend, 10 oz', 2.88, '030223022947', 'Add a little color and texture to your next dish with our Freshness Guaranteed Diced Mirepoix Mix. With yellow onion, carrots, and celery all diced up and mixed together in this one convenient package, you can skip the prep work and have just what you need to create a flavorful soup stock or a savory sauce. Just throw this mix into a pan with some butter or oil, cook on low heat until beautifully caramelized, and you\'ll have the perfect base ready to enhance the flavor profile in a wide variety of recipes. Casseroles, chicken noodle soup, stews, and more are quickly and easily perfected when you use our Freshness Guaranteed Diced Mirepoix Mix. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Diced Mirepoix Mix, 10 oz Includes diced yellow onion, carrots, and celery Convenient prep free mix for quick cooking Perfect for soup stock, sauces, stews, and casseroles Creates a flavorful base when sauteed with butter or oil Great for enhancing a wide variety of recipes', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/aa93816d-5665-453d-9522-95000e5d46cd.1b4021e7c77aa345defbfd88c2247e95.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aa93816d-5665-453d-9522-95000e5d46cd.1b4021e7c77aa345defbfd88c2247e95.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aa93816d-5665-453d-9522-95000e5d46cd.1b4021e7c77aa345defbfd88c2247e95.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
