INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (720205113, 'Fresh White Turnip, 1 LB', 4.97, '405946892595', 'The white turnip is a food of neutral thermal nature, with a sweet and bitter flavor at the same time. It improves the body\'s energy circulation, helps mobilize and rebuild blood, relieves cough and helps eliminate accumulations of moisture from the body. Turnip leaves can be consumed raw, in a salad, or cooked with potatoes or in an omelette. . The root can be consumed grated in salads, as if they were radishes, or cooked with rice or legumes. And added in the preparation of broths, they provide an extra dose of minerals.', 'Sweet and bitter taste at the same time They provide an extra dose of minerals Promotes intestinal regularity and provides fiber', 'Unbranded', 'https://i5.walmartimages.com/asr/de171ad6-6b44-4f0b-9ea6-2e3d613d3a20.2ba5b257a7d1c9f243c60bb5de0860b8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de171ad6-6b44-4f0b-9ea6-2e3d613d3a20.2ba5b257a7d1c9f243c60bb5de0860b8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de171ad6-6b44-4f0b-9ea6-2e3d613d3a20.2ba5b257a7d1c9f243c60bb5de0860b8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (720337666, 'Garlic Bulb Whole Fresh, Each', 4.97, 'deleted_000000046084', 'Take your culinary creations to the next level with this flavorful fresh Jumbo Garlic. Garlic\'s signature flavors become caramelized and sweeter when cooked, making it a perfect accompaniment to many dishes such as pasta, shrimp, chicken, stews, and more. Garlic also goes great in creamed soups, on all types of roasts, in a variety of egg dishes, or used simply with sauteed or roasted vegetables. To prepare garlic for cooking, you\'ll need to break it up into individual cloves and peel the skin. Once you\'ve done this, you can mince the garlic by chopping it into fine pieces. Or take the flavor profile to the next level and slice the top off the bulb, drizzle with olive oil, wrap in foil, and roast in the oven. When cool, it makes a delicious spread for crusty French bread or a tasty addition to recipes. Spice up your next meal with a tasty clove of fresh Jumbo Garlic.', 'Jumbo Garlic, Per Pound: Ideal addition to every pantry Flavorful addition to many recipes Add to pasta, shrimp, chicken, stews, and more Try sauteed with roasted vegetables Explore all the delicious ways to add fresh garlic to your favorite recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4716545a-144b-4403-90ae-59957d9138e1.3a80708ae95b71cb102d0793e1d47bba.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4716545a-144b-4403-90ae-59957d9138e1.3a80708ae95b71cb102d0793e1d47bba.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4716545a-144b-4403-90ae-59957d9138e1.3a80708ae95b71cb102d0793e1d47bba.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (720609646, 'Fresh Grapefruit, 5 lb Bag', 5.98, 'deleted_848163004639', 'Indulge in the tangy and refreshing taste of fresh grapefruit, straight from the citrus groves. Our hand-picked grapefruits come in a convenient bag, perfectly ripe and bursting with juicy goodness. Loaded with vitamin C and antioxidants, grapefruit is the ideal choice for a healthy snack or a zesty addition to salads and cocktails. Order now and savor the delightful taste of freshly picked grapefruit!', 'Nutrient-Rich: Grapefruits are tangy, juicy, and packed with vitamins and minerals like vitamin C, potassium, and fiber for a healthy diet. Versatile Taste: With a sweet-tart flavor, enjoy grapefruits alone, in salads, smoothies, or as a fresh addition to recipes. Health Benefits: Grapefruits support immune function, hydration, and may assist in weight loss, making them a nutritious choice for a healthy lifestyle.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5d884a7b-342e-4b8e-b90d-9cb6631d48c6.5dff8264816983a82b7ebefdf0192a26.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d884a7b-342e-4b8e-b90d-9cb6631d48c6.5dff8264816983a82b7ebefdf0192a26.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d884a7b-342e-4b8e-b90d-9cb6631d48c6.5dff8264816983a82b7ebefdf0192a26.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (720640702, 'Organic Green Bell Pepper, Each', 2.96, '814780010315', 'Organic Green Bell Peppers are an extremely versatile vegetable that is a must-have for every cook. Bell peppers are exceptionally rich in vitamin C and other antioxidants, and our green bell peppers are certified organic by the U.S. Department of Agriculture. You can choose to eat them raw and dip them in ranch, or you can incorporate them into a variety of recipes. Dice them and put them in a hearty chili, slice them and add to a deli sandwich, sauté them with onions and serve on a hoagie roll with a bratwurst, or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out green bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. The culinary possibilities are endless with Organic Green Bell Peppers.', '2-pack of organic bell peppers Naturally low in calories Exceptionally rich in vitamin C and other antioxidants Create delicious recipes with these organic bell peppers', 'Marketside', 'https://i5.walmartimages.com/asr/ffc87c0e-b5c8-4a0b-b143-2cabfc9c8b95.e93357c16c94f681c369a1debfaa684e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ffc87c0e-b5c8-4a0b-b143-2cabfc9c8b95.e93357c16c94f681c369a1debfaa684e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ffc87c0e-b5c8-4a0b-b143-2cabfc9c8b95.e93357c16c94f681c369a1debfaa684e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
