INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (721102421, 'Ready Pac Foods Ready Pac Complete Salad Kit, 11 oz', 6.97, '077745247472', 'Complete Salad Kit, Chopped, Mediterranean, Bag 11.5 OZ Salad & Toppings: 8.75 oz (248 g). Dressing: 2.25 oz (2 fl oz) 59 ml. Robust escarole, endive, radicchio, shredded broccoli stalks, sweet carrots, shredded cauliflower stalks, tangy red cabbage, herb seasoned flatbread strips, feta cheese, basil balsamic dressing. Thoroughly washed. Mediterranean cuisine combines simple and fresh ingredients to bring out exciting flavors from healthy food. Ready Pac does the same in this exciting and flavorful restaurant-style Mediterranean Chopped kit. We carefully select and chop escarole, endive, radicchio and combine with shredded broccoli stalks, sweet carrots, shredded cauliflower stalks and tangy red cabbage. Then, add crunchy herb-seasoned flatbread strips, feta cheese, and a delightful, refreshing basil balsamic dressing for a true Mediterranean experience at home. Ready Pac Mediterranean Chopped Salad Kit has everything you need right in the bag! Ready Pac Chopped Salad Kits follow techniques that provide the highest level of freshness and quality. We trim our fresh produce with care, wash it thoroughly, and then place it in special pillow-packaging that protects against bruising and keeps the salad crisper. Ready Pac Foods is committed to providing the highest quality fresh salads. Visit our website at www.readypac.com for more information. For questions or comments, please call 1-800-800-7822. Ready Pac Foods - Giving people the freedom to eat healthier. Keep refrigerated. Perishable. For Optimum Freshness: For the freshest taste, use within two days of opening and keep refrigerated in this breathable bag. Contains: milk, wheat. 11 oz (312 g) Irwindale, CA 91706 800-800-7822 Ready Pac Foods, Inc., 2016', 'Complete Salad Kit, Mediterranean, Chopped Salad & Toppings: 8.75 oz (248 g). Dressing: 2.25 oz (2 fl oz) 59 ml. Robust escarole, endive, radicchio, shredded broccoli stalks, sweet carrots, shredded cauliflower stalks, tangy red cabbage, herb seasoned flatbread strips, feta cheese, basil balsamic dressing. Thoroughly washed. Mediterranean cuisine combines simple and fresh ingredients to bring out exciting flavors from healthy food. Ready Pac does the same in this exciting and flavorful restaurant-style Mediterranean Chopped kit. We carefully select and chop escarole, endive, radicchio and combine with shredded broccoli stalks, sweet carrots, shredded cauliflower stalks and tangy red cabbage. Then, add crunchy herb-seasoned flatbread strips, feta cheese, and a delightful, refreshing basil balsamic dressing for a true Mediterranean experience at home. Ready Pac Mediterranean Chopped Salad Kit has everything you need right in the bag! Ready Pac Chopped Salad Kits follow techniques that provide the highest level of freshness and quality. We trim our fresh produce with care, wash it thoroughly, and then place it in special pillow-packaging that protects against bruising and keeps the salad crisper. Ready Pac Foods is committed to providing the highest quality fresh salads. Visit our website at www.readypac.com for more information. For questions or comments, please call 1-800-800-7822. Ready Pac Foods - Giving people the freedom to eat healthier.', 'Ready Pac Foods', 'https://i5.walmartimages.com/asr/87d8f578-0525-486c-b358-da6455feb7a2.455371f7b6a4d8c3ddff14e66ced6dbf.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/87d8f578-0525-486c-b358-da6455feb7a2.455371f7b6a4d8c3ddff14e66ced6dbf.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/87d8f578-0525-486c-b358-da6455feb7a2.455371f7b6a4d8c3ddff14e66ced6dbf.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (721112635, 'Bako Sweet Organic Sweet Potatoes Bag, 48 Oz', 5.28, 'deleted_819614010080', 'Grown from the sweet spot of California, our organic sweet potatoes are the sweetest you have ever tasted. They are packaged in a 3lb bag and thoroughly washed which means they are ready for you to cook and enjoy! This sweet potato is orange on the outside and orange on the inside, delivering a sweet and earthy flavor. Load up and enjoy! Our organic sweet potatoes are certified by both CCOF Organic and the USDA. Working with these organizations ensures that our farming practices are up to standards so that we can provide the safest and best tasting produce for your family. Sweet potatoes are a pantry essential that you should have always in your kitchen. Just one sweet potato is an excellent source of vitamin containing 368% Vitamin A daily value. They are loaded with beta carotene which acts as a potent antioxidant, making it easy to feel good about what you are about to enjoy! And when you just can’t get enough of them, this bag is pretty sweet.', 'Sweet Potatoes Organic. Certified Organic by CCOF. Gluten free. Vegan. GMO free. From California\'s sweet spot. Grown with pride form Valpredo Farms bakersfield, CA. Since 1944. bakosweet.com. Produce of USA.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/89c43d89-000b-43c2-8b51-00dadd15494a.94b88372286835480ba240444c760abc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/89c43d89-000b-43c2-8b51-00dadd15494a.94b88372286835480ba240444c760abc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/89c43d89-000b-43c2-8b51-00dadd15494a.94b88372286835480ba240444c760abc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
