INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (722417907, 'Fresh Grapefruit, lb', 1.57, '405999074221', 'Grapefruit (Toronja) is the perfect balance between tart and sweet. The balance between tart and sweet is great for both savory and sweet dishes any time of day. Enjoy half of a grapefruit sprinkled with sugar with some eggs in the morning for a light, sweet breakfast. Slice it up and put in a salad with spinach, avocado, and red onion topped with a mustard and balsamic vinegar dressing for lunch or dinner. Make delicious grapefruit bars that showcase the sweet and tartness of this versatile fruit. For an adult recipe juice the grapefruit and pair with some simple syrup and alcohol for a refreshing cocktail. This fruit is the perfect addition to a healthy diet as it is a great source of vitamin C and vitamin A. With such versatility, Grapefruit will become a pantry staple in your home', 'Great for both savory and sweet dishes Enjoy it for breakfast, lunch, dinner, or dessert Enjoy half a grapefruit sprinkled with sugar in the morning, slice it up and put it in salad for lunch or dinner, or make grapefruit bars Great source of vitamin C and vitamin AToronja Blanca', 'Unbranded', 'https://i5.walmartimages.com/asr/03d2d8cf-e487-4ed0-b45b-02f860ea6695.eef891593ed974f21dac604986f62180.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03d2d8cf-e487-4ed0-b45b-02f860ea6695.eef891593ed974f21dac604986f62180.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/03d2d8cf-e487-4ed0-b45b-02f860ea6695.eef891593ed974f21dac604986f62180.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (722758914, 'Bowery Farming Spring Mix Pesticide-Free, Locally Grown Salad Greens, 10oz', 4.48, '851536007595', 'Spring Mix is a classic, sweet, and zesty salad blend. It\'s perfect in a wrap or as a beautiful, fresh salad.Bowery Farming grows positively tasty, fresh produce in a cleaner, more sustainable way: in local, indoor smart farms. Every Bowery leaf is grown and handled with care, without pesticides. Bowery\'s smart farms use less water & create less waste on less land. Because Bowery\'s farms are local, you can trust that your produce is freshly harvested, picked at peak freshness 365 days a year, and available on shelf in just a few days.', 'Bowery Farming Spring Mix Pesticide-Free, Locally Grown Salad Greens, 10oz: 100% Pesticide-free 100% Locally grown 100% Fully traceable Indoor-grown Protected Produce Clean & ready to eat Non-GMO Project Verified Recycled Packaging', 'Bowery Farming', 'https://i5.walmartimages.com/asr/73a51b94-7996-48e1-ab2d-8b681189e72c.1e52f29e83b0b34851b61f575ac98db7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/73a51b94-7996-48e1-ab2d-8b681189e72c.1e52f29e83b0b34851b61f575ac98db7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/73a51b94-7996-48e1-ab2d-8b681189e72c.1e52f29e83b0b34851b61f575ac98db7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
