INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (725442947, 'Fresh Dragon Fruit , lb', 2.48, '861010000141', 'Dragon fruit, also known as pitaya, is a vibrant tropical fruit native to Central America. Recognizable for its bright pink or yellow, spiky skin and creamy pulp filled with tiny seeds, it offers a subtly sweet taste reminiscent of kiwi or pear. Dragon fruit is a nutritional powerhouse, providing high amounts of fiber, vitamin C, essential minerals, and antioxidants. Grown on a climbing cactus, this refreshing fruit is harvested when its skin color fully develops, offering a unique and healthful treat.', 'Dragon fruit, also known as pitaya, is a tropical fruit that belongs to the cactus family. Native to Central America but now grown all over the world, dragon fruit is known for its unique appearance, vibrant color, and a wealth of health benefits. The fruit has a leathery, slightly leafy skin that is bright pink or yellow in color, while the inside boasts a sweet, creamy pulp dotted with tiny, crunchy seeds. Appearance and Taste: Dragon fruit stands out for its flamboyant appearance, with its bright pink or yellow, spiky skin, and white or red flesh speckled with small black seeds. The taste of dragon fruit is subtly sweet and often compared to that of a kiwi or pear, with the seeds providing a satisfying crunch. Its texture is wonderfully juicy and creamy, making it a refreshing treat on a hot day. Health Benefits: Dragon fruit is a nutritional powerhouse, packed with a range of beneficial compounds. It\'s high in fiber, vitamin C, and several essential minerals like iron and magnesium. Dragon fruit is also rich in antioxidants, which help fight off free radicals and prevent cell damage. Moreover, it contains prebiotics, which promote the growth of beneficial bacteria in your gut, contributing to a healthy digestive system. Cultivation and Harvest: Dragon fruit grows on a cactus plant that climbs up trees or walls with the help of its aerial roots. It thrives best in a dry tropical climate with a moderate amount of rain. The fruit is harvested when its skin color changes from bright green to pink or yellow, depending on the variety. Despite its exotic appearance, dragon fruit is easy to eat; simply slice it in half and scoop out the flesh with a spoon.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/09bd462f-cb64-43a5-a554-705fda26532d.2f24c1400f856dcbd27c10a1e672ea93.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/09bd462f-cb64-43a5-a554-705fda26532d.2f24c1400f856dcbd27c10a1e672ea93.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/09bd462f-cb64-43a5-a554-705fda26532d.2f24c1400f856dcbd27c10a1e672ea93.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
