INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (727744868, 'Sunset Tomatoes Organic Angel Sweet, 1lb Packet', 4.37, '057836900165', 'Organic Tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily complements your recipes. Juicy and delicious, tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Tomatoes are the perfect choice.', 'A mix of our grape tomato Cherubs, sweet yellow Comets, mini-heirloom Twilights, and orange cherry tomatoes Certified Equitable Food Initiative Non-GMO', 'Fresh Produce', 'https://i5.walmartimages.com/asr/56d1f686-6487-4606-a8b5-1b06a22dfe59.369910b2f3fe6fae370a10060f7266c4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/56d1f686-6487-4606-a8b5-1b06a22dfe59.369910b2f3fe6fae370a10060f7266c4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/56d1f686-6487-4606-a8b5-1b06a22dfe59.369910b2f3fe6fae370a10060f7266c4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
