INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (728124576, 'Petite Russet Potatoes Whole Fresh, 3 lb Bag', 3.97, '847597010599', 'Create something wholesome and delicious with these fresh Sweet Potatoes. Sometimes referred to as yams, these versatile fresh produce vegetables can be used multiple ways: to make savory sides or sweet treats. Try them roasted or baked for a tasty addition to any dish. You could also use them to make seasoned sweet potato fries or a flavorful hummus dip for your next party. If you want to satisfy your sweet tooth, try them in a traditional sweet potato casserole or use them to make sweet potato and brown sugar ice cream. The mouthwatering possibilities are endless with this hearty vegetable. Add something amazing to your meals with this three-pound bag of Organic Sweet Potatoes.', 'Fresh Petite Russet Potatoes 3 Lb Bag Ideal ingredient as a versatile, flavorful kitchen staple Perfect for a Baked Potato Bar at your next party. Make a classic baked potato to pair with your favorite cut of meat Idaho Homegrown Potato Rich in potassium, vitamin C and B6', 'Fresh Produce', 'https://i5.walmartimages.com/asr/202efa81-88a9-48df-be33-adb92b06ef0b.2e8931e286feb9d156441de32b9bdd3f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/202efa81-88a9-48df-be33-adb92b06ef0b.2e8931e286feb9d156441de32b9bdd3f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/202efa81-88a9-48df-be33-adb92b06ef0b.2e8931e286feb9d156441de32b9bdd3f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
