INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (729844539, 'Fresh Tomatoes on the Vine, 1 lb Carton', 2.98, '699058455124', 'Keep your recipes simple and classic with Fresh Tomatoes on the Vine. With their vibrant red color, firm and juicy flesh, and unmistakably delicious flavor, these fresh tomatoes on the vine are sure to impress more than just your taste buds. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. The list is endless! Plus, they come right to your kitchen still on the vine that they grew on, meaning that their mouthwatering taste and freshness will be long-lasting for your culinary convenience. Stock up on Fresh Tomatoes on The Vine and keep your dishes looking great and tasting delicious.', 'Fresh Tomatoes on the Vine, 1 lb Carton: Vibrant red color Firm and juicy flesh Unmistakably delicious flavor Tomatoes come still on the vine for maximum freshness and taste Slice them to garnish a sandwich or burger Dice them to top a pizza or some pasta Crush them to make a decadent bruschetta or sauce Blend them to create homemade salsa', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
