INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (732109224, 'Marketside Organic Broccoli & Carrots, 12 oz', 3.98, '681131179447', 'Marketside Organic Broccoli and Carrots are packed fresh, washed and ready to eat for your convenience. They have a great fresh taste that is loaded with nutrients and a vibrant green and orange color that are sure to add a pop to all your dishes. Enjoy them as a healthy side or use them in all your favorite recipes. Season them with salt, pepper and garlic and serve with grilled steak, mashed potatoes and bread rolls for a filling dinner. They come packaged inside a microwaveable bag that cooks in less than five minutes. Dinner is made easy with Marketside Organic Broccoli & Carrots. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes. Microwave in bag: Place bag on a microwave-safe dish. Microwave on high for 3 to 4 minutes or until desired tenderness. Carefully remove bag from microwave. Be cautious when opening the bag as the vegetables and steam will be very hot. Season to taste and enjoy.', 'Marketside Organic Broccoli & Carrots, 12 oz: Microwave in bag Washed and ready to eat USDA Organic Net weight 12 oz', 'Marketside', 'https://i5.walmartimages.com/asr/46ae1270-c8d5-4d17-ac30-746d9599950b_2.b13542b75740e57e4c2584737e7f2cba.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/46ae1270-c8d5-4d17-ac30-746d9599950b_2.b13542b75740e57e4c2584737e7f2cba.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/46ae1270-c8d5-4d17-ac30-746d9599950b_2.b13542b75740e57e4c2584737