INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (734287546, 'Plenty Baby Arugula, Fresh Zero Pesticides, 4.5oz resealable', 2.97, '810567030439', 'Let\'s get spicy. Plenty Baby Arugula has the natural bite to add fresh, zingy flavor to any dish. With softer, more velvety leaves than your typical arugula, this will become your Zero Pesticides staple for salads that feel like they walked out of a restaurant. Better yet? No need to wash this gorgeous green, just peel back the resealable lid, crunch, and go. At Plenty, we\'re reimagining what a farm can be. It’s no secret–farming can be a little dirty. Like dirt under your nails, but also dirty like land use, water waste, pollution, and contaminants on your food. We grow fresh, flavorful produce vertically indoors – so everything is a little… cleaner. From a controlled, indoor environment to zero-pesticide greens on your table – Plenty is cleaner for the world and cleaner for you.', 'Plenty Baby Arugula, 4.5 oz : Zingy, spicy taste you\'ll crave Zero Pesticides and no need to wash Sick of salads? Plenty arugula makes a great base for Pesto or garnish for chicken dishes Indoor and vertically grown for peak-season freshness all year long Convenient 4.5oz peel and reseal packaging', 'PLENTY', 'https://i5.walmartimages.com/asr/4fd4289a-c596-49c9-aedd-85fe132616ba.090820fd201485990dc42c31e616538d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4fd4289a-c596-49c9-aedd-85fe132616ba.090820fd201485990dc42c31e616538d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4fd4289a-c596-49c9-aedd-85fe132616ba.090820fd201485990dc42c31e616538d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
