INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (734562425, 'Sunset Wild Wonders Medley Tomato, 16 oz Package, Fresh', 3.5, '057836021785', 'SUNSET Wild Wonders Gourmet Tomato Medley is 16 ounces of mixed color snacking tomatoes! Perfect for snacking, lunch, or dinner - fresh or cooked. Try them in salads, pastas, omelets, flatbreads, and more. Discover the world\'s flavors! This gourmet medley features a delightful array of shapes and colors with a sweet and juicy flavor. Hothouse grown to ensure consistent quality and freshness. Certified non-GMO tomatoes. Store at room temperature for optimal flavor, and wash before enjoying. Plastic tray featuring a peel and reseal film to help keep tomatoes fresh. Enjoy SUNSET Wild Wonders Gourmet Tomato Medley all year long.', 'SUNSET fresh Wild Wonders Tomato Medley Discover the world\'s flavors A delightful array of shapes and colors with a sweet and juicy flavor Perfect for snacking, lunch, or dinner - fresh or cooked Try them in salads, pastas, omelets, flatbreads, and more Wash and enjoy Available all-year-long Non-GMO certified Hothouse grown to ensure consistent quality and freshness 16-oz plastic container featuring a peel and reseal film to help keep tomatoes fresh Store at room temperature for optimal flavor\"', 'SUNSET', 'https://i5.walmartimages.com/asr/90285596-2ec5-4d6b-b152-faa563e17303_1.88a0a78e31a5612b98cb622203a9e5b5.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/90285596-2ec5-4d6b-b152-faa563e17303_1.88a0a78e31a5612b98cb622203a9e5b5.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/90285596-2ec5-4d6b-b152-faa563e17303_1.88a0a78e31a5612b98cb622203a9e5b5.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (734633197, 'Fresh Red Grapefruit, 5 lb Bag', 5.98, 'deleted_072240754852', 'Red Grapefruit is the perfect balance between tart and sweet. The balance between tart and sweet is great for both savory and sweet dishes any time of day. Enjoy half of a grapefruit sprinkled with sugar with some eggs in the morning for a light, sweet breakfast. Slice it up and put in a salad with spinach, avocado, and red onion topped with a mustard and balsamic vinegar dressing for lunch or dinner. Make delicious grapefruit bars that showcase the sweet and tartness of this versatile fruit. For an adult beverage, juice the grapefruit and pair with some simple syrup and alcohol for a refreshing cocktail. This fruit is the perfect addition to a healthy diet as it is a great source of vitamin C and vitamin A. With such versatility, Red Grapefruit will become a pantry staple in your home.', 'Great for both savory and sweet dishes Enjoy it for breakfast, lunch, dinner, or dessert Enjoy half a grapefruit sprinkled with sugar in the morning, slice it up and put it in salad for lunch or dinner, or make grapefruit bars Great source of vitamin C and vitamin A', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2f5ff23c-604f-465f-9f24-798aa67f5bb3_1.adb2d52364be4bcc35aed4da0e54a52d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2f5ff23c-604f-465f-9f24-798aa67f5bb3_1.adb2d52364be4bcc35aed4da0e54a52d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2f5ff23c-604f-465f-9f24-798aa67f5bb3_1.adb2d52364be4bcc35aed4da0e54a52d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
