INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (738901619, 'Fresh Organic Yellow Squash, 2 Count', 2.96, '681131091343', 'Wholesum\'s fresh organic yellow squash is as delicious as it is versatile, making it the perfect addition to healthy and hearty meals. With its mildly sweet flavor and tender, edible skin, this bright and nutritious vegetable is easy to prepare and does not require long cooking. For more savory options, try them grilled, roasted, or air fried. They are also a perfect addition to vegetable, pasta dishes and skewers. If craving something on the sweet side, you may even feature this lovely vegetable on the dessert table. Try grating them into a fluffy yellow squash Bundt cake or bread. Any way that you enjoy it, yellow squash promises to deliver on flavor and is rich in essential vitamins, nutrients, and antioxidants. Wholesum is committed to bringing you a variety of premium Wrapped organic produce that is fresh, flavorful, and responsibly grown.', 'Wholesum Organic Yellow Squash Certified Organic 2 Count Squash Great for salads Great for grilling Responsibly grown', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9fc8525e-988b-403e-bfc3-0b167a416b49.f4edfaea061d4ed3c2f4af843208498d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9fc8525e-988b-403e-bfc3-0b167a416b49.f4edfaea061d4ed3c2f4af843208498d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9fc8525e-988b-403e-bfc3-0b167a416b49.f4edfaea061d4ed3c2f4af843208498d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (739446588, 'Organic Tomato on the Vine, 1 lb Bag', 2.84, '000000031493', 'Keep your recipes simple and classic with fresh tomatoes on the vine. With their vibrant red color, firm and juicy flesh, and unmistakably delicious flavor, this fresh produce item is sure to impress more than just your taste buds. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. The list is endless! Plus, they come right to your kitchen still on the vine that they grew on, meaning that their mouthwatering taste and freshness will be long-lasting for your culinary convenience. Stock up on Walmart\'s Tomatoes On The Vine and keep your dishes looking great and tasting equally as excellent.', 'Tomatoes On The Vine, 1 lb: 1-pound bag of tomatoes on the vine Vine helps tomatoes maintain peak freshness and flavor Perfect for slicing, dicing, crushing and blending Great for sandwiches, pastas, pizzas and salsas Essential ingredient in every home-cook\'s kitchen', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e5cd9099-5b09-4cec-bf7b-2d63171f2a34.5f61dc1fc2b1fa276fbdc2e1158994a3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
