INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (747312032, 'Fresh Organic Roma Tomatoes, 1 lb Package', 2.36, '405744830706', 'Organic Grape Tomatoes are an exciting summer treat, and they\'re the perfect size for skewers, salads and roasting. These bite-sized grape tomatoes look and taste great. Grape tomatoes are a low-calorie treat that are also low in sodium and are a good source of fiber. Whether you are snacking or adding them to your favorite dish. their uses are almost limitless. Try these grape tomatoes with feta cheese, fresh dill and a drizzle of olive oil for a light and delicious Mediterranean treat. Or make a caprese salad with grape tomatoes, fresh basil, fresh mozzarella and balsamic vinegar. With 10-ounces of tomatoes in each package, you\'ll have plenty to make mouthwatering meals. Use your imagination to create delicious dishes with Organic Grape Tomatoes.', 'Organic Grape Tomatoes, 10 oz Package: Perfect size for skewers, salads and roasting Low-calorie, low in sodium, and a good source of fiber Pair with feta cheese, fresh dill, and a drizzle of olive oil for a Mediterranean dish Certified organic', 'Fresh Produce', 'https://i5.walmartimages.com/asr/eb0806e6-701a-435c-9172-99daede19227.47e8216fd6b38ea4fdbf0250bf52a6f4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/eb0806e6-701a-435c-9172-99daede19227.47e8216fd6b38ea4fdbf0250bf52a6f4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/eb0806e6-701a-435c-9172-99daede19227.47e8216fd6b38ea4fdbf0250bf52a6f4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
