INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (750499074, 'Fresh Figs, 12 oz Package', 7.84, '898249002011', 'Enjoy the delicious sweetness of these Fresh Figs. These figs taste wonderful raw, but you could also use them in a wide variety of recipes. Use them to make a tasty fig jam that you can spread on toast or biscuits. Blend them with some honey to make a creamy smoothie for breakfast. If you\'re looking for something more on the savory side, try wrapping them in bacon for an appetizer that all your guests will love. For dessert, you could use them to make cookies, bars, and even ice cream. However you choose to prepare them, everyone is sure to enjoy the taste of these Fresh Figs.', 'Fresh Figs, 12 oz Clamshell Enjoy them fresh or use them in a variety of recipes Use to make fig jam or a creamy smoothie Wrap them in bacon for a crowd-pleasing appetizer Add to a fresh salad Make sweet cookies, bars, and even ice cream', 'Unbranded', 'https://i5.walmartimages.com/asr/803287b0-3d38-47e8-b840-6505c6844ebe.a297ca01b7f7d79491ac22d821a89af2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/803287b0-3d38-47e8-b840-6505c6844ebe.a297ca01b7f7d79491ac22d821a89af2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/803287b0-3d38-47e8-b840-6505c6844ebe.a297ca01b7f7d79491ac22d821a89af2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
