INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (751690120, 'Premium Grape Tomato, 1.5 lb Package', 5.24, 'deleted_699058796920', 'Premium Grape Tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily complements your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Premium Grape Tomatoes are the perfect choice.', 'Premium Grape Tomato, 1.5 lb Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Fresh produce in a convenient package Store at room temperature for best results', 'Fresh Produce', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (752752485, 'Fresh Tomate Grape, 10oz Clamshell', 3.47, '882035500393', 'Fresh grape tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily compliments your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Grape Tomatoes are the perfect choice.', 'Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious', 'NONBRANDED', 'https://i5.walmartimages.com/asr/5e2de05b-5da5-47c9-97f5-1b1815cddc76.be4860417f458f21738c485b78ceb74e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5e2de05b-5da5-47c9-97f5-1b1815cddc76.be4860417f458f21738c485b78ceb74e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5e2de05b-5da5-47c9-97f5-1b1815cddc76.be4860417f458f21738c485b78ceb74e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (752914255, 'Aerofarms Broccoli Microgreens Salad, 2 oz Clam Shell, Fresh', 3.98, '815063021257', 'Mighty and balanced, AeroFarms broccoli microgreens have earthy notes and a slightly sweet finish. Our Micro Broccoli falls in the forest green portion of the AeroFarms FlavorSpectrum™, representing a grassy and green flavor profile with earthy notes. Microgreens can contain considerably higher levels of vitamins and carotenoids—about 5X greater—than their mature plant counterparts, according to the United States Department of Agriculture. AeroFarms greens are grown with zero pesticides and are ready to enjoy right out of the container. Taste the AeroFarms difference - enjoy Micro Broccoli by adding a heaping handful to boost any meal including sandwiches, wraps, soups, salads, takeout, and more.', 'Bursting With Flavor No Pesticides Ever No Washing Needed', 'AeroFarms', 'https://i5.walmartimages.com/asr/23c01bf9-ce50-477d-ab3c-6d4e32723da7.4d87a6b8dc2fae86bda6802f1d5bd19a.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/23c01bf9-ce50-477d-ab3c-6d4e32723da7.4d87a6b8dc2fae86bda6802f1d5bd19a.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/23c01bf9-ce50-477d-ab3c-6d4e32723da7.4d87a6b8dc2fae86bda6802f1d5bd19a.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
