INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (754113136, 'Mann\'s Fresh Cauliflower Veggie Sides, 8.8 oz', 4.47, '716519009822', 'Elevate mealtime with the Mann\'s Cauliflower Veggie Sides. Made with a parmesan peppercorn sauce, this side of veggies is a perfect addition to your meals. Pair them with a perfectly cooked steak and potatoes for a delicious meal that will have you feeling like you dined at the best steakhouse in town. You can also serve them with grilled chicken, rolls, and sweet potatoes for a well-rounded dinner your friends and family is sure to love. In just three minutes, you can be enjoying the delicious taste of this cauliflower. Simply place the bag in the microwave, microwave on high for three minutes, stir until combined, and enjoy. Complete your meals with the Mann\'s Cauliflower Veggie Sides.', 'Cauliflower with a parmesan peppercorn sauce Pair with steak and potatoes for a mouthwatering meal Serve with grilled chicken, rolls, and sweet potatoes for a well-rounded meal Ready in just 3 minutes Perfect addition to your meals', 'Mann\'s', 'https://i5.walmartimages.com/asr/3a89e52a-d9e6-4a9e-9316-d4dc45ccc866.90604e0371f93fdc4381dffaaa96872c.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3a89e52a-d9e6-4a9e-9316-d4dc45ccc866.90604e0371f93fdc4381dffaaa96872c.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3a89e52a-d9e6-4a9e-9316-d4dc45ccc866.90604e0371f93fdc4381dffaaa96872c.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
