INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (754471518, 'Fieldpack Unbranded Bagged Poblano Pepper', 2.64, 'deleted_823874000903', 'Enjoy the fresh and delicious flavor of Poblano Peppers. Poblano peppers are known for their mild heat and rich flavor. Best of all this versatile pepper can be used in a myriad of recipes. Use them to make delicious Mexican inspired recipes like chile relleno. Stuff some with sausage, rice and spices to make a hearty, healthy and delicious dinner. Pan roast some with your favorite cheese and herbs for a yummy side, add them to your hearty chili recipes or turn some into a wonderful autumn soup. Any way you slice, dice, or cook them, Poblano Peppers are a refreshing, healthy addition to any meal.', 'Poblano Peppers, 16 oz: Includes 1 lb of poblano peppers Known for their mild heat and rich flavor Versatile pepper can be used in a myriad of recipes Use them to make delicious Mexican inspired recipes like chile relleno Stuff some with sausage, rice and spices to make a hearty, healthy and delicious dinner Create a variety of yummy recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/59bf999a-1f85-49ad-952e-088efaefb6a2_1.12cf264a49dd7b491c6e300309dc5f10.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59bf999a-1f85-49ad-952e-088efaefb6a2_1.12cf264a49dd7b491c6e300309dc5f10.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/59bf999a-1f85-49ad-952e-088efaefb6a2_1.12cf264a49dd7b491c6e300309dc5f10.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (754553336, 'Aprium, 1 lb Pack', 4.88, '896460002919', 'Treat everyone to the sweet taste of Fresh Grown Apriums. Part apricot and part plum, this fruit is great to hand out to the kids as a tasty after-school snack. Add these apriums to a fruit salad to serve at your next party or to a delectable salad as a sweet topping. Serve them with cheese, salami, and almonds for a wonderful picnic cheese plate. You could also slice them to top your yogurt and granola for a healthy breakfast, or even make a tasty aprium crumble dessert for your next dinner party. The culinary opportunities are endless with Fresh Grown Apriums.', 'Fresh Grown Apriums, 16 oz: Part apricot and part plum Sweet and juicy Subtle sweetness and faint tartness Hand out to the kids as a tasty after-school snack Use to make a delicious fruit salad Slice and use to top your yogurt and granola for a healthy breakfast', 'Fresh Produce', 'https://i5.walmartimages.com/asr/476b1382-b89f-4580-998f-56a281642478.f35436b1ae3df515ddec10b1b1cd592a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/476b1382-b89f-4580-998f-56a281642478.f35436b1ae3df515ddec10b1b1cd592a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/476b1382-b89f-4580-998f-56a281642478.f35436b1ae3df515ddec10b1b1cd592a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
