INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (755693559, 'Fresh Grape Tomato, 1 pt.', 3.97, '850019660104', 'Fresh grape tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily compliments your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Grape Tomatoes are the perfect choice.', 'Great in salads, pastas, salsas and sauces Sweet, juicy flavor in each bite Thick skin Low water content and a long shelf-life Low in calories and are a good source of fiber Contain vitamins A and C, lycopene and other vitamins and minerals Wholesome, versatile, and delicious Delicious and nutritious', 'Hypermart', 'https://i5.walmartimages.com/asr/e008c0d6-bdbb-4438-9aae-062f383302ef.089b46b9d850dd54b5ed6248634f1ecb.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e008c0d6-bdbb-4438-9aae-062f383302ef.089b46b9d850dd54b5ed6248634f1ecb.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e008c0d6-bdbb-4438-9aae-062f383302ef.089b46b9d850dd54b5ed6248634f1ecb.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
