INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (759012200, 'Chayote Squash', 1.04, 'deleted_045255179743', 'Chayote Squash', 'Chayote Squash A member of the gourd family, this versatile produce item from Mexico is quickly becoming a produce department standard. Roughly pear-sized in shape and light apple-green in color, Chayote Squash has a smooth skin with slight ridges running from stem to end. The average Chayote weighs about 1/2 pound and measures approximately 5 inches in length. Though similar to summer squash, Chayote usually requires a longer cooking time because of its firmer texture. Chayote makes a wonderful addition to soups or stir-fries and may be sliced or chopped and used raw like a cucumber. The seeds are also edible. Store Chayote Squash at 45°-50°F. At home, Chayote Squash stays freshest lightly wrapped and refrigerated for up to one week. No need to peel before using.', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/959afd12-4158-4bc9-af71-d08e3132768c_1.fd677f077b9cc5f60bc00f20baac6d04.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/959afd12-4158-4bc9-af71-d08e3132768c_1.fd677f077b9cc5f60bc00f20baac6d04.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/959afd12-4158-4bc9-af71-d08e3132768c_1.fd677f077b9cc5f60bc00f20baac6d04.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
