INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (759487618, 'Field Roast Apple & Maple Plant-Based Breakfast Sausage', 4.98, '638031611805', 'Bring a hit of sweet and savory indulgence to your plant-based breakfast with Field Roast Apple & Maple Plant-Based Breakfast Sausage. Perfect as a side for pancakes or chopped up in breakfast burritos and quiches, these fully cooked vegan sausages deliver a satisfying taste and texture as a breakfast protein alternative. Simply brown the meatless sausages in a sauté pan to bring the welcoming flavors of apple, maple syrup, and nutmeg to your favorite morning dishes. Since 1997, the Field Roast brand has crafted plant-based meats and cheeses from grains, fresh-cut vegetables, herbs, and spices, honoring our culinary roots to create authentic sensory experiences people crave.', 'FULLY COOKED VEGAN BREAKFAST SAUSAGES: A satisfying meat alternative for plant-based meals SWEET AND SAVORY: The classic breakfast flavors of apple, maple syrup, and nutmeg QUICK PREPARATION: Simply brown the sausage in a pan with some oil or break apart to use in scrambles, breakfast burritos, and more CERTIFIED VEGAN AND NON-GMO: Non-GMO Project Verified and Certified Vegan for delicious taste and texture without the guilt FOR ALL THE FLAVOR TRAILBLAZERS: Dedicated to crafting bold flavor profiles, Field Roast brand transforms everyday meals into seriously delicious creations', 'Field Roast', 'https://i5.walmartimages.com/asr/326159d5-f18f-4d15-82e5-1306c9d88e44.5c854c85ece77befdda56a69eb33d95e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/326159d5-f18f-4d15-82e5-1306c9d88e44.5c854c85ece77befdda56a69eb33d95e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/326159d5-f18f-4d15-82e5-1306c9d88e44.5c854c85ece77befdda56a69eb33d95e.jpeg?odnHeight=450&odnWidth=450&odnBg=ff