INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (767417176, 'Marketside Beyond Zero Pesticides Baby Arugula, 4 oz Clam Shell, Fresh', 3.73, '194346001446', 'Enjoy the fresh flavor of Marketside Beyond Baby Arugula. These greens are indoor and vertically grown for peak-season freshness all year long. Indoor vertical farms are a controlled growing environment giving each plant the optimal amount of light and nutrients for fresh and flavorful produce any time of the year. Farming vertically means our produce can be grown using significantly less water and land than traditional outdoor farms. Create something delicious with Marketside Beyond Baby Arugula. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Beyond Baby Arugula, 4 oz: Fresh and flavorful baby arugula Indoor and vertically grown for peak-season freshness all year long No pesticides, herbicides or fungicides applied to our greens Convenient peel and reseal packaging Keep refrigerated until ready to enjoy', 'Marketside Beyond', 'https://i5.walmartimages.com/asr/a4ccd1ce-4e8f-46e8-b1b6-1a8bc1b1099a.2516732c8b32472df828b24a6de85b86.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a4ccd1ce-4e8f-46e8-b1b6-1a8bc1b1099a.2516732c8b32472df828b24a6de85b86.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a4ccd1ce-4e8f-46e8-b1b6-1a8bc1b1099a.2516732c8b32472df828b24a6de85b86.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
