INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (767702436, 'Little Leaf Farms Baby Spring Mix Salad Blend, 4 oz, Fresh', 2.98, '857394006121', 'Little Leaf Farms Baby Spring Mix combines our signature crispy green leaf with the peppery additions of arugula and mizuna to take your salad to the next level. Our deliciously crisp, wonderfully fresh, and uniquely long-lasting greens are grown in a state-of-the-art, sustainable greenhouse that harnesses sunlight and fresh rainwater. With an a fully automated, hands-free growing process to seeding to packaging, there’s no need to wash. Just open the container and enjoy!', 'Cultivated in controlled greenhouse environments to maintain optimal growing conditions and superior taste Convenient pre-mixed greens for quick meal preparation Pesticide, Herbicide, and Fungicide Free Non GMO- Naturally cultivated without genetic modification Versatile for salads, sandwiches, wraps, and more Distinctive flavor profile enhanced by peppery arugula and mizuna', 'Little Leaf Farms', 'https://i5.walmartimages.com/asr/577cf0f5-9271-4a34-bec8-17461dd38ec3.857e4547e4575395af9385c58e162d02.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/577cf0f5-9271-4a34-bec8-17461dd38ec3.857e4547e4575395af9385c58e162d02.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/577cf0f5-9271-4a34-bec8-17461dd38ec3.857e4547e4575395af9385c58e162d02.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (767858113, 'Freshness Guaranteed Cantaloupe Small', 4.67, '262817000004', 'Enjoy the sweet, refreshing taste of Freshness Guaranteed Cantaloupe Chunks. This pre-cut cantaloupe is great for breakfast, lunch, dessert, or when you want a snack. You can eat them right out of the container, use them to infuse water for a refreshing drink. This cantaloupe is great for sharing with friends and family or keeping it for yourself. It comes in a reclosable container to help maintain freshness. Bring home Freshness Guaranteed Cantaloupe Chunks today for a refreshing, healthy treat.Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Cantaloupe Small Contains Cantaloupe Packed in a secure plastic bowl with lid Portable and convenient Provides many essential nutrients', 'Freshness Guaranteed', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (767905460, 'Fresh Long Stem Strawberries, 1 lb Container', 7.48, '852298002071', 'The sweet, juicy flavor of Fresh Long Stem Strawberries make them a refreshing and delicious treat. These strawberries are larger than normal strawberries, making them perfect for dipping in chocolate. Decorate them with white-chocolate drizzle, crushed nuts, chocolate sprinkles for a special touch. They contain essential vitamins and nutrients like vitamin C, dietary fiber, potassium, vitamin B and magnesium, making them perfect for a healthy diet. Prior to serving simply gently wash the strawberry, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Fresh Long Stem Strawberries today and savor the delectable flavor.', 'Fresh Long Stem Strawberries, 1 lb: Larger than normal strawberries Prior to serving gently wash the strawberries and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Decorate with chocolate to serve on their own, or top strawberry desserts', 'Fresh Produce', 'https://i5.walmartimages.com/asr/36c5ea4c-2c0d-4d7c-ba6d-ed84b37385ea_1.7a6295c6421572ca726dfc0c34f838dd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/36c5ea4c-2c0d-4d7c-ba6d-ed84b37385ea_1.7a6295c6421572ca726dfc0c34f838dd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/36c5ea4c-2c0d-4d7c-ba6d-ed84b37385ea_1.7a6295c6421572ca726dfc0c34f838dd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
