INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (769945528, 'Fresh Rave Apples, Each', 1.1, '000000034876', 'Fresh Rave Apples are the perfect combination of sweet and tart in every bite. These crisp and juicy apples are hand-picked at the peak of ripeness to ensure maximum flavor and quality. With their vibrant red and green skin, Fresh Rave Apples are sure to stand out in any fruit bowl. Whether you enjoy them as a snack or use them in your favorite recipes, Fresh Rave Apples are a delicious and healthy choice.', 'Rave Apples are a premium fresh apple variety that will take your taste buds on an adventure. Each Rave Apple is medium to large in size, with a round shape and a bright red color that fades into a green-yellow background. The flesh of the Rave Apple is crisp, juicy and has an explosively sweet and tangy flavor that will make your taste buds dance. This apple variety is perfect for snacking, but also holds up well in cooking and baking, maintaining its shape and flavor. Rave Apples are a good source of fiber, vitamin C, and antioxidants, and can be enjoyed as a healthy and flavorful addition to any meal or snack. With their distinctive taste and appearance, Rave Apples are a premium choice for apple lovers and foodies who are looking for something unique and delicious.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/3ea73f13-2671-4bb5-96ab-48bbd330ebd8_1.d78156982aa3ed7728f6243858567a26.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3ea73f13-2671-4bb5-96ab-48bbd330ebd8_1.d78156982aa3ed7728f6243858567a26.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3ea73f13-2671-4bb5-96ab-48bbd330ebd8_1.d78156982aa3ed7728f6243858567a26.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
