INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (770489489, 'Fresh Blood Oranges, 2 lb Bag', 3.93, 'deleted_092148219642', 'Enjoy the fresh sweetness of Blood Oranges. These crimson-fleshed oranges have a tangy and sweet flavor with hints of berry. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite adult beverage. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Blood Oranges add flavor to any meal or beverage.', 'Fresh Blood Oranges, 2 lb Bag Great source of vitamin C Crimson-fleshed citrus fruit have a tangy and sweet flavor with a hint of berry Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes Use as a garnish for your favorite adult beverage Make sweet desserts like ambrosia, orange bars, and orange pie', 'Fresh Produce', 'https://i5.walmartimages.com/asr/aefd395d-cef4-4601-a3f1-54791e11f517.998b17436f0c6a1f49c0c02872508fa3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aefd395d-cef4-4601-a3f1-54791e11f517.998b17436f0c6a1f49c0c02872508fa3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/aefd395d-cef4-4601-a3f1-54791e11f517.998b17436f0c6a1f49c0c02872508fa3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (770549881, 'German Butterball Potato - 6 Tubers', 9.99, '811332033815', 'Butter-me-not! So versatile -- great for baking, frying, or mashing. 100 days. An heirloom russet with flavor so rich and sweet it would be a crime to smother it in butter, German Butterball is an all-around potato you can rely on as your \"main crop\" for great year-round eating. You will fall in love with the creamy-sweet flavor even before you appreciate the heavy yields and long storage ability of this favorite! German Butterball sets medium-sized oblong to round russets with yellow flesh, as if they\'d already been covered in melted butter. Resistant to disease and scab, these taters look as good as they taste, maturing late in potato season on plants that refuse to be confined to their allotted space, but wander gloriously instead! This plant grows tall, providing great shade protection for the potatoes with large, abundant foliage. Give it plenty of space (because it will take it even if you don\'t!) and let these flavor-filled roots mature slowly to perfection. You will absolutely love the flavor. German Butterball consistently wins taste tests, but it\'s also quite versatile, as happy being mashed as it is fried, baked, or boiled. Rely on it for homegrown potato goodness!', 'An heirloom russet with flavor so rich and sweet An all-around potato you can rely on as your \"main crop\" for great year-round eating Ideal for microwave, frying or baking Easy to grow, Prefers well drained soil, high in organic matter', 'Hirt\'s Gardens', 'https://i5.walmartimages.com/asr/de189a10-79a0-4ae6-bcb0-e5547928e635.e4e33ed66bb7a2e6a840ea9bc69e515f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de189a10-79a0-4ae6-bcb0-e5547928e635.e4e33ed66bb7a2e6a840ea9bc69e515f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/de189a10-79a0-4ae6-bcb0-e5547928e635.e4e33ed66bb7a2e6a840ea9bc69e515f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
