INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (774344130, 'Fresh Hidroponico Del Pais Lechuga Oakleaf, Each', 2.97, '036446046128', 'Introducing Fresh Lechuga Oakleaf, an exquisite variety of lettuce that adds a touch of elegance and vibrant flavor to your salads and culinary creations. With its unique, oakleaf-shaped leaves in a beautiful mix of green and burgundy hues, this lettuce provides a delightful visual appeal and a tender, crisp texture. Grown with care and harvested at the peak of freshness, our Fresh Lechuga Oakleaf offers a subtle, sweet taste that pairs well with a variety of dressings and ingredients. Elevate your salads and dishes with the unmatched quality and flavor of Fresh Lechuga Oakleaf.', 'Introducing Fresh Lechuga Oakleaf, an exquisite variety of lettuce that adds a touch of elegance and vibrant flavor to your salads and culinary creations. With its unique, oakleaf-shaped leaves in a beautiful mix of green and burgundy hues, this lettuce provides a delightful visual appeal and a tender, crisp texture. Grown with care and harvested at the peak of freshness, our Fresh Lechuga Oakleaf offers a subtle, sweet taste that pairs well with a variety of dressings and ingredients. Elevate your salads and dishes with the unmatched quality and flavor of Fresh Lechuga Oakleaf.', 'Hidroponico Del Pais', 'https://i5.walmartimages.com/asr/101ee8c0-c31f-4276-a1bb-c3fdff231cc7.dfd17ee7600cb5750658e899daa79d84.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/101ee8c0-c31f-4276-a1bb-c3fdff231cc7.dfd17ee7600cb5750658e899daa79d84.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/101ee8c0-c31f-4276-a1bb-c3fdff231cc7.dfd17ee7600cb5750658e899daa79d84.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
