INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (784338229, 'Fresh Organic Roma Tomato, 1 lb Bag', 2.98, '711069548753', 'Bring the fresh, delicious taste of Organic Roma Tomatoes into your home. These meaty tomatoes deliver sweet and juicy flavor with each bite and are an ideal ingredient in a variety of recipes. They would make a tasty, garden-inspired addition to salads, burgers, gourmet sandwiches, and so much more. They are picked at peak freshness and specially bred for deep red color, intense flavor, and higher lycopene content than standard tomatoes. Whether you slice or dice them, these tomatoes will add big flavor and unforgettable taste to any meal. Get creative in the kitchen and enjoy some wholesome deliciousness with these Fresh Organic Roma Tomatoes.', 'Fresh Organic Roma Tomato, 1 lb Bag Wholesome, fresh, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, burgers, gourmet sandwiches, and more Add to party trays or school lunches Delicious and nutritious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/78e6bdaa-8c81-4a59-8ab2-196846bdb8ff.c23aa5a9a6298b3bf1bd67a37fed0cf3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/78e6bdaa-8c81-4a59-8ab2-196846bdb8ff.c23aa5a9a6298b3bf1bd67a37fed0cf3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/78e6bdaa-8c81-4a59-8ab2-196846bdb8ff.c23aa5a9a6298b3bf1bd67a37fed0cf3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
