INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (784896733, 'Minced Garlic, 8 oz Jar', 3.27, 'deleted_023562010515', 'Add bold flavor to your homemade meals with Fresh Minced Garlic in Water. Ready to use, this garlic is gluten and salt free. Brush or spread on meats, fish, or poultry; stir or blend easily into sauces, dressings, and gravies; or blend with softened butter and parsley for out-of-this-world garlic bread. The possibilities are almost endless with this versatile spice. Packed in a convenient glass jar with a screw-on top, you can keep a bottle of this seasoning in your fridge ready to go at any moment. Flavor up your meals with Garland Foods Minced Garlic in Water.', 'Minced garlic 8-ounce jar Refrigerate after opening Ready to use Brush or spread on meats, fish, or poultry Garlic becomes caramelized and sweeter when cooked A flavorful addition to many dishes Stir or blend easily into sauces, dressings, and gravies', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4239dc06-61c4-4b54-8cf3-5559541af5c9.d8e601eede7199e2d2e8ad400371bb40.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4239dc06-61c4-4b54-8cf3-5559541af5c9.d8e601eede7199e2d2e8ad400371bb40.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4239dc06-61c4-4b54-8cf3-5559541af5c9.d8e601eede7199e2d2e8ad400371bb40.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
