INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (786343527, 'Fresh Klondike Potatoes, Each', 2.47, '000000047296', 'These Fresh, Klondike Potatoes are hand selected for excellent quality. Firm, well-shaped, and smooth, these potatoes can be cooked in almost any way imaginable. They have a wonderful, buttery texture and flavor when baked, roasted, boiled, steamed, sauteed, or mashed. Feature them in a potato salad or cook them up and serve as a savory side dish to your favorite protein. To preserve the nutrients, leave the skins on and simply scrub gently in water before cooking. Always store potatoes in a cool, well-ventilated area rather than in the refrigerator. Enjoy nutrients, flavor, and all-around deliciousness when you cook up Klondike Potatoes.', 'Klondike Limited Potato Tote Per Pound', 'Klondike', 'https://i5.walmartimages.com/asr/8ec0507b-0fe3-43b6-a2fa-e38061d0c8fd.9d25dc0c23a825edc2c3dbc92cc330b3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8ec0507b-0fe3-43b6-a2fa-e38061d0c8fd.9d25dc0c23a825edc2c3dbc92cc330b3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8ec0507b-0fe3-43b6-a2fa-e38061d0c8fd.9d25dc0c23a825edc2c3dbc92cc330b3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
