INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (789005024, 'Cauliflower Crumbles, 16 oz Bag', 2.78, '681131148351', 'Add fresh and ready to eat chopped cauliflower to your meal with Marketside Chopped Cauliflower. Serve as is, or add your favorite spices for additional flavor. Add onion, thyme, garlic, olive oil, parmesan cheese, salt and pepper to cauliflower to create a yummy side dish. Marketside Chopped Cauliflower are a quick and healthy side dish and a great addition to any meal. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes. Microwave: Pierce holes in bag with fork. Place on a microwave safe dish and microwave on high for 2 or 3 minutes. Using caution as the steam from the bag will be very hot.', 'Marketside Chopped Cauliflower, 16 oz Microwave in bag Washed and ready to eat Ready in 4 minutes Picked fresh for you', 'Marketside', 'https://i5.walmartimages.com/asr/adecc32d-c9dd-4727-acc5-0cc5e1bfff46_4.6c0ba8e0240278d2cf61d993ad50b686.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/adecc32d-c9dd-4727-acc5-0cc5e1bfff46_4.6c0ba8e0240278d2cf61d993ad50b686.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/adecc32d-c9dd-4727-acc5-0cc5e1bfff46_4.6c0ba8e0240278d2cf61d993ad50b686.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
