INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (806006443, 'Louisiana Pepper Exchange 4oz Orange Habanero Pepper Puree Sauce', 2.89, '850014104030', 'Louisiana Pepper Exchange 4oz Orange Habanero Pepper Puree Sauce Discover the vibrant flavors of our Orange Habanero Pepper Puree, a sweet and spicy habanero pepper sauce that brings a perfect balance of heat and tropical fruitiness to your dishes. With its smooth, thin consistency, this habanero salsa easily blends into your favorite recipes, elevating them with bold flavor. Our habanero seasoning offers a convenient alternative to chopping and deseeding fresh peppers, providing consistent heat without the hassle. Made with only orange habanero peppers and a pinch of salt, it’s gluten-free, calorie-free, and bursting with natural flavor. Perfect for pairing with mango, coconut, fresh fish, or even Peruvian ceviche, this versatile habanero hot sauce is the secret to creating delicious, flavor-packed meals.', 'EXOTIC TROPICAL FLAVOR: Add a burst of vibrant, fruity heat with our Orange habanero pepper seasoning, perfect for enhancing any dish. NO CHOPPING NEEDED: Skip the prep with our easy-to-use hot and sweet habanero sauce, offering quick flavor without the hassle. TWO SIMPLE INGREDIENTS: Made with just orange habanero peppers and a pinch of salt, this spicy sauce is gluten-free and calorie-free for guilt-free enjoyment. EASY PEPPER SUBSTITUTE: Replace habanero powder with 1-3 teaspoons of our habanero puree for a quick and simple recipe boost. VERSATILE HEAT: Ideal for fish, ground meats, or creative cocktails like margaritas, this habanero spicy seasoning brings the perfect mix of sweet heat.', 'Louisiana Pepper Exchange', 'https://i5.walmartimages.com/asr/ee585289-7a1a-4429-a2e6-4c582a60d08e.0b43192ef2d294bbad41339996cd3959.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ee585289-7a1a-4429-a2e6-4c582a60d08e.0b43192ef2d294bbad41339996cd3959.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ee585289-7a1a-4429-a2e6-4c582a60d08e.0b43192ef2d294bbad41339996cd3959.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
