INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (815062490, 'Fresh Premium Grape Tomato, 1.5 lb Package', 5.28, '884051050135', 'Premium Grape Tomatoes are a quick and flavorful addition to any homemade meal. Perfect for mixing into a fresh salad, adding into a pasta dish, or enjoying on their own, this fresh produce item provides marvelous texture, vibrant color, and an amazingly smooth taste that easily complements your recipes. Juicy and delicious, grape tomatoes are known for their beautiful bright red color, thick skin, low water content, and long shelf-life. They\'re low in calories, are a good source of fiber, and contain vitamins A and C, lycopene and other vitamins and minerals, which means on top of bringing exceptional flavor and texture depth to the table, they also offer essential nutrients to lend themselves as a wholesome ingredient to any culinary creation. Whether you\'re looking for a quick and healthy snack or a deliciously easy ingredient to add to a meal, these Premium Grape Tomatoes are the perfect choice.', 'Premium Grape Tomato, 1.5 lb Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Fresh produce in a convenient package Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ef2dcbc7-1fc9-40cd-bf3e-09d72a0218d9.1d2f7b812b05175eccc5c66761b3fa2e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ef2dcbc7-1fc9-40cd-bf3e-09d72a0218d9.1d2f7b812b05175eccc5c66761b3fa2e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ef2dcbc7-1fc9-40cd-bf3e-09d72a0218d9.1d2f7b812b05175eccc5c66761b3fa2e.jpeg?odnHeight=450&odnWidth=450&odnBg=