INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (825595553, 'Bowery Farming Arugula Mix Pesticide-Free, Locally Grown Salad Greens, 4oz', 2.98, '851536007618', 'Arugula Mix is popular for its peppery, zesty, and high-definition flavor. This salad blend adds a spicy and refreshing punch to your favorite salad, wrap, and vegetable bowl recipes.Bowery Farming grows positively tasty, fresh produce in a cleaner, more sustainable way: in local, indoor smart farms. Every Bowery leaf is grown and handled with care, without pesticides. Bowery\'s smart farms use less water & create less waste on less land. Because Bowery\'s farms are local, you can trust that your produce is freshly harvested, picked at peak freshness 365 days a year, and available on shelf in just a few days.', 'Bowery Farming Arugula Mix Pesticide-Free, Locally Grown Salad Greens, 4oz: 100% Pesticide-free 100% Locally grown 100% Fully traceable Indoor-grown Protected Produce Clean & ready to eat Non-GMO Project Verified Recycled Packaging', 'Bowery Farming', 'https://i5.walmartimages.com/asr/fec0367c-fb23-484f-8da6-144aca39a03e.4e9cb2e4f1885c839ec5fda9c7542e3d.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fec0367c-fb23-484f-8da6-144aca39a03e.4e9cb2e4f1885c839ec5fda9c7542e3d.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fec0367c-fb23-484f-8da6-144aca39a03e.4e9cb2e4f1885c839ec5fda9c7542e3d.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
