INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (826495231, 'Fresh Red Grapefruit, 5 lb Bag', 5.92, 'deleted_605049465768', 'Sunkist Ruby Grapefruit pack a bold citrus flavor with its signature tartness that is sure to help kick start your day. Slice this grapefruit in half and enjoy it with your breakfast for a burst of juicy flavor. Sprinkle it with sugar for a touch of sweetness. This grapefruit is also perfect for juicing and enjoying any time of day; you can even use the juice as a mixer for your favorite cocktails or mocktails. Slice it up and serve with avocado and a tangy vinaigrette for a fresh and light appetizer at your next dinner party or use it to create stunning desserts like baked brown sugar glazed grapefruit or tangy grapefruit meringue pie. The possibilities are endless with the juicy, fresh taste of Sunkist Ruby Grapefruit.', 'Sunkist Ruby Grapefruit, 5 lbs: Juicy, deliciously tart and citrusy flavor Enjoy as a healthy breakfast side or use it to make yummy juice Use it to make a fresh, light avocado and grapefruit summer salad with a tangy vinaigrette Incorporate into your favorite desserts like grapefruit meringue pies and grapefruit cakes Comes in a 5 lb bag giving you plenty of grapefruit to enjoy', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c2090fc4-545e-4ae7-8609-d30b1fde36b6_1.14cf15c2e83ff8bab247392d43d2e384.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c2090fc4-545e-4ae7-8609-d30b1fde36b6_1.14cf15c2e83ff8bab247392d43d2e384.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c2090fc4-545e-4ae7-8609-d30b1fde36b6_1.14cf15c2e83ff8bab247392d43d2e384.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (826497108, 'Spice World Jumbo Garlic Bulb Whole Fresh, Each', 0.66, 'deleted_070969101360', 'Take your culinary creations to the next level with this flavorful fresh Jumbo Garlic. Garlic\'s signature flavors become caramelized and sweeter when cooked, making it a perfect accompaniment to many dishes such as pasta, shrimp, chicken, stews, and more. Garlic also goes great in creamed soups, on all types of roasts, in a variety of egg dishes, or used simply with sauteed or roasted vegetables. To prepare garlic for cooking, you\'ll need to break it up into individual cloves and peel the skin. Once you\'ve done this, you can mince the garlic by chopping it into fine pieces. Or take the flavor profile to the next level and slice the top off the bulb, drizzle with olive oil, wrap in foil, and roast in the oven. When cool, it makes a delicious spread for crusty French bread or a tasty addition to recipes. Spice up your next meal with a tasty clove of fresh Jumbo Garlic.', 'Jumbo Garlic, per Pound: Fresh garlic Ideal for pastas, stews, soups, and more Adds delicious flavor to a variety of meals Combine with other fresh herbs to create a gourmet meal Take your culinary creations to the next level', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4716545a-144b-4403-90ae-59957d9138e1.3a80708ae95b71cb102d0793e1d47bba.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4716545a-144b-4403-90ae-59957d9138e1.3a80708ae95b71cb102d0793e1d47bba.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4716545a-144b-4403-90ae-59957d9138e1.3a80708ae95b71cb102d0793e1d47bba.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (826616539, 'Aerofarms Micro Spicy Mix 2 Oz', 3.98, '815063020632', 'AeroFarms Micro Spicy Mix (2 oz) is a bold and zesty blend of spicy mustard greens, peppery arugula & juicy bok choy for an instant pop of heat. Add a heaping handful to any meal for a delicious and nutritious boost: dress up salads, sandwiches + wraps, boost soups, snacks + smoothies, & top pizza + takeout, or have the whole container as a bite-sized personal salad. In addition to bursting with flavor and crunch, our microgreens can contain more nutrition than mature leafy greens—about 5X more vitamins, according to the United States Department of Agriculture. AeroFarms is an award-winning vertical farming company passionately growing real food for elevated flavor and a brighter future for all. We select the most flavorful varietals of microgreens and baby greens, then perfect them in our indoor vertical farms for optimal quality and a unique, signature FlavorSpectrum™: our kale is sweet + tender, our arugula is perfectly peppery, and we’re harvesting millions of data points to make them even more delicious. Taste our difference.', 'Sustainably grown indoors No pesticides ever Non-GMO Verified No Washing Needed B Corporation Certified Grown using up to 95% less water, 99% less land than field farming 40% Less Plastic, Post-Consumer Recycled Trays OU Kosher', 'AeroFarms', 'https://i5.walmartimages.com/asr/ac33369b-97a8-4b95-acab-5109fb08c9fe.2e7474e445a7376b9081f19eff41b05d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ac33369b-97a8-4b95-acab-5109fb08c9fe.2e7474e445a7376b9081f19eff41b05d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ac33369b-97a8-4b95-acab-5109fb08c9fe.2e7474e445a7376b9081f19eff41b05d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (826730740, 'Fresh Whole Baby Bella Mushrooms', 0.87, '000000046480', 'Experience the fresh taste of our Whole Baby Bella Mushrooms. Baby Bella Mushrooms give you that same earthy taste you love about mushrooms, but take it up a notch with their firm, meaty texture. Similar in size and shape to white mushrooms, baby bellas are hardier and provide a deeper earthy taste. They\'re the same portabella mushrooms you\'ve enjoyed before, they\'ve just been harvested a few days earlier before becoming those large caps you\'ve seen in vegetarian and vegan cuisines. With their hearty, full-bodied taste, baby bellas are an excellent addition to beef, wild game, and vegetable dishes. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out our Whole Baby Bella Mushrooms.', 'Fresh Whole Baby Bella Mushrooms tray: Naturally fat free Cholesterol free Low in calories, carbs and sodium Fresh and all natural Pre-cleaned Natural source of the antioxidant selenium Excellent addition to beef, wild game and vegetable dishes', 'Unbranded', 'https://i5.walmartimages.com/asr/3010d164-4cc1-43d1-b02a-a1678d73ec8d.45ce903d1a0d6fa027e4903213c5d8b4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3010d164-4cc1-43d1-b02a-a1678d73ec8d.45ce903d1a0d6fa027e4903213c5d8b4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3010d164-4cc1-43d1-b02a-a1678d73ec8d.45ce903d1a0d6fa027e4903213c5d8b4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
