INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (827233830, 'Gourmet212 Ricotta Cherry Peppers 10.5oz (12 Pack), Glass Jar', 112.95, '191822004182', 'Ricotta and smoked pepper came together and made a great compound within cherry peppers. Then, the surprising flavor of ricotta and smoked pepper stuffed cherry peppers showed up.? You can consume those peppers at your meals or present this delicious taste to your guests. Ricotta and smoke pepper stuffed cherry peppers are also able be great appetizers because of the fact that smoked peppers will increase your appetite and add flavor with its mild bitterness. Smoked peppers are also known as isot or Urfa red peppers. Our cherry peppers which are originally African are grown in our own field in Akhisar, Manisa. The sweet, sharp, and bitter taste that comes with the end makes the product very special. If you add some different tastes, you can fill the peppers with cheese, tuna, or vegetables. Our product does not contain any kind of preservatives. You must keep it in a cool and dry place and consume it within a few days after opening. If you have second thoughts, just try once. You will be amazed when you taste the savory pepper and cheese blend with the gentle touch of smoked pepper.', 'Gourmet212 Ricotta and Smoked Pepper Stuffed Cherry Peppers 10.5oz (12 Pack), Glass Jar, and Fresh. Ricotta and smoked pepper comes together and make a great compound within cherry peppers. The sweet, sharp, and bitter taste that comes with the end makes the product very special. You must keep it in a cool and dry place and consume it within a few days after opening. Our product does not contain any kinds of preservatives.', 'Gourmet212', 'https://i5.walmartimages.com/asr/6ce69a0a-dcdb-4de5-8916-ed54925031f5.f7be45ea45626f3c906b469fffa8a380.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6ce69a0a-dcdb-4de5-8916-ed54925031f5.f7be45ea45626f3c906b469fffa8a380.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6ce69a0a-dcdb-4de5-8916-ed54925031f5.f7be45ea45626f3c906b469fffa8a380.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
