INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (836303521, 'Marketside Organic Red Potatoes Whole Fresh, 3 lb Bag', 5.28, '856417005493', 'When you\'re wondering what to have for supper, pick up some Marketside Organic Red Potatoes. You can use them to make a delicious and nutritious potato salad. They\'ll add a vibrant color to your meals with their red skins. These non-GMO potatoes will bake nicely and make a filling side to go with a grilled steak. They\'re certified organic by CCOF, so you can be confident they were grown in a pesticide-free environment. These fresh produce potatoes are all-natural and have not been genetically altered. They\'re rich in vitamins and minerals, so you will feel good feeding them to your family. Pick up this 3-pound bag of Marketside Organic Red Potatoes today.', 'Marketside Organic Red Potatoes, 3 pound Bag Plenty of potatoes for your next meal or gathering Premium potatoes with a red skin color Great for baking, frying, roasting, and more Delicious fresh produce', 'Marketside', 'https://i5.walmartimages.com/asr/9219d9f9-5447-45fb-9f57-03fcabb9c637.6cc8e59e73f6184f37832127f02a1a76.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9219d9f9-5447-45fb-9f57-03fcabb9c637.6cc8e59e73f6184f37832127f02a1a76.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9219d9f9-5447-45fb-9f57-03fcabb9c637.6cc8e59e73f6184f37832127f02a1a76.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
