INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (836396432, 'Serrano Pepper, 4oz', 1.58, 'deleted_857419005450', 'Enhance your meals with the delicious flavor of Serrano Peppers. Naturally low in calories, fat, and cholesterol, this vegetable is a great source of vitamins C, B6, and A, as well as iron and magnesium. Serrano peppers have a bright and biting flavor that enhances a variety of recipes. Make a zesty pico de gallo or salsa using fresh serrano peppers, add to a sweet peach jam to make a glaze for hot wings, or add to eggs for out of this world huevos rancheros. You can even add some diced serrano peppers and cheese to cornbread batter for a delectable chile cheese cornbread that will have everyone asking for seconds. Lunches and dinners are more scrumptious when fresh Serrano Peppers are part of the meal.', 'Serrano Pepper, 4oz bag Naturally low in calories Rich in Vitamins C, B6 and A Versatile and Delicious Fresh Whole Serrano Pepper', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b3ca1a55-2be4-495b-8743-9d32a1d6f141.d3467f5ce6bca1ef448523b56dceb495.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b3ca1a55-2be4-495b-8743-9d32a1d6f141.d3467f5ce6bca1ef448523b56dceb495.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b3ca1a55-2be4-495b-8743-9d32a1d6f141.d3467f5ce6bca1ef448523b56dceb495.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (836658379, 'That\'s Tasty Organic Butter Lettuce', 2.98, 'deleted_768573710039', 'That\'s Tasty Organic Butter Lettuce gives you truly delicious organic flavor that you can trust. This lettuce is hydroponically grown in Virginia and is USDA certified organic. It comes an entire head of lettuce with the roots, so you can see how fresh this lettuce really is. Use it to make delicious salads topped with your favorite croutons, nuts, cheese, vegetables, protein and dressing for a fresh taste in every bite. Use it to top sandwiches and burgers or make delicious lettuce wraps. Fill the wraps with hummus and vegetables for a vegetarian option or use your favorite deli meat slices, condiments and vegetables for healthier lunch alternative. Enjoy freshness you can see with That\'s Tasty Organic Butter Lettuce.', 'That\'s Tasty Organic Butter Lettuce: Pure USDA certified organic flavor Hydroponically grown in Virginia Contains 1 full head of lettuce with the roots for freshness you can see Make fresh salads with your favorite toppings, proteins and dressing Top burgers and sandwiches or make tasty lettuce wraps', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/71c22c77-7213-4410-98d2-1682555eb586_1.a51045197f51cf33e27fd29b8e05cdae.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71c22c77-7213-4410-98d2-1682555eb586_1.a51045197f51cf33e27fd29b8e05cdae.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/71c22c77-7213-4410-98d2-1682555eb586_1.a51045197f51cf33e27fd29b8e05cdae.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
