INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (841832654, 'NY SPICE SHOP Sour Tamarind Whole - 1 Pound - Tamarind Pods - Thai Sour Tamarind - Tamarind Candy', 12.99, '768253238365', 'NY Spice Shop sour tamarind is light brown in color sweet, tangy, and sour in taste. There are two special kinds of tamarinds “Sweet Tamarinds & Sour Tamarinds”, both are available at our NY Spice Shop. It is used to add in biryani, sweet and sour rice, and a variety of chickpeas chats. It is a strong base for varieties of chutneys, squashes, BBQ stew, and sauces. Sour tamarind is also used in Thai and other cuisines.', 'All-Natural Whole Tamarind Pods – NY Spice Shop sour tamarind pods are covered the fresh, delicious, edible fruit which is packed with healthy fibers, and antioxidants. Versatile Meal Enhancer – Our tamarind can be used for creating Thai pasts, Mexican candies or Agua Fresca, traditional Asian meals, amazing curry, Malaysian satay, and other exciting options friends and family will enjoy. HEALTHY & DELICIOUS – Sour tamarind chutney is naturally sour, no sugar added whole pods can make savory dishes and snacks. Delivered Fresh in Resealable Bag –Our tamarind comes in 3lbs. bags with a resealable top to ensure they’re fresh and taste great from start to finish. And because we’re focused on natural, organic ingredients you can trust they’re perfect. Trusted Quality in Every Bite – We want to make your meals, snacks, and sweet treats more memorable which is why we carefully source all our products to ensure they reach you ready to eat and with a stable shelf life.', 'NY Spice Shop', 'https://i5.walmartimages.com/asr/fffd7d96-5659-4f2a-b05c-8b9ee5a77595.1291c83787155c61e6f63ab47936a30c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/fffd7d96-5659-4f2a-b05c-8b9ee5a77595.1291c83787155c61e6f63ab47936a30c.jpeg?odnHeight=180