INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (842280555, 'Taylor Farms Mozzarella & Tomato Salad Bowl, 6.1 oz, Fresh', 2.98, '030223060314', 'Try this fresh Mozzarella and Tomato Salad from Taylor Farms. This on-the-go deli salad bowl will fill you up with six grams of protein. It contains crisp romaine lettuce, juicy grape tomatoes, mozzarella cheese, and a balsamic vinaigrette dressing. With no synthetic colors or high fructose corn syrup, it has only 150 calories per serving. This 6.1-ounce salad includes a fork and is ready to eat. Keep refrigerated until ready to enjoy. Reach for the Taylor Farms Mozzarella and Tomato Bowl that is sure to be your new favorite salad on the go.', 'Taylor Farms Mozzarella and Tomato Salad Bowl is ready when you are Crisp romaine lettuce, juicy grape tomatoes, mozzarella cheese, and a balsamic vinaigrette dressing Includes a fork 150 calories per 6.1-ounce serving No synthetic colors or high fructose corn syrup 6 grams of protein per serving Fresh produce is washed and ready to eat Keep refrigerated until ready to enjoy', 'Taylor Farms', 'https://i5.walmartimages.com/asr/28476927-aa04-4173-90ef-b370cf7d1fc7.91b4201b613bb7d3c5fd2e868f625d3c.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28476927-aa04-4173-90ef-b370cf7d1fc7.91b4201b613bb7d3c5fd2e868f625d3c.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28476927-aa04-4173-90ef-b370cf7d1fc7.91b4201b613bb7d3c5fd2e868f625d3c.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (842432737, 'Goya Purple Corn Beverage, Chicha Morada, 15 Oz', 7.5, '041331050531', 'This corn is grown in the Andes region on Peru, it is used in chicha morada (a drink made by boiling purple corn with pineapple, cinnamon, clove, and sugar) and mazamorra, a type of pudding. The kernels of Purple Corn have long been used by the people of the Peruvian Andes to color foods and beverages, a practice just beginning to become popularized in the industrialized world. Besides its use as food and dye, purple corn is thought to have many health benefits', 'Goya Purple Corn Beverage, Chicha Morada, 15 Oz', 'GOYA', 'https://i5.walmartimages.com/asr/5d80c736-54ea-4dc7-b64d-4cc26e1bfdab_2.41b63fcaec73d79bbf1bb2eb70cc6794.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d80c736-54ea-4dc7-b64d-4cc26e1bfdab_2.41b63fcaec73d79bbf1bb2eb70cc6794.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5d80c736-54ea-4dc7-b64d-4cc26e1bfdab_2.41b63fcaec73d79bbf1bb2eb70cc6794.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
