INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (842931823, 'Fresh Manzano Banana, Each', 1.24, '821783042335', 'Our fresh bananas are made with organic ingredients and are the perfect healthy snack! These sweet and delicious fruits are filled with essential vitamins and minerals that provide energy and help maintain a balanced diet. Enjoy them as a quick on-the-go snack or add them to smoothies and desserts for a delicious treat. Trust us, you won\'t be disappointed!', 'Taste is mildly sweet and - Whole Manzano bananas are a type of fresh produce that can be enjoyed in their natural, unprocessed form, offering a delightful and unique Taste experience compared to standard bananas. As a fresh produce item, Manzano bananas retain their full nutritional value, providing essential vitamins and minerals that contribute to overall health and well-being. When consumed Whole and fully ripe, Manzano bananas have a sweet, tangy Taste with hints of apple and strawberry flavors, making them a delicious and satisfying snack or addition to various recipes. tangy. This banana variety is compact and half the size of a regular banana which makes great for travel and day snacks.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/9fd6c02a-7106-4ea8-9fa9-1f62d7c843e6.662ea636f6591b10adc33844938ee647.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9fd6c02a-7106-4ea8-9fa9-1f62d7c843e6.662ea636f6591b10adc33844938ee647.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9fd6c02a-7106-4ea8-9fa9-1f62d7c843e6.662ea636f6591b10adc33844938ee647.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (843278705, 'Fresh Organic Beefsteak Tomato, 2 Pack', 2.46, '078742051123', 'Create something wholesome and delicious with Fresh Organic Beefsteak Tomatoes. These ripe tomatoes are the ideal fresh produce ingredient for a variety of tasty dishes. Use them to make a zesty tomato sauce for a pasta dish, try using them to make a tomato bruschetta, or simply enjoy each of them on their own as a nutritious snack. They would make a comforting and appetizing tomato soup and a flavorful salsa. You could also serve them at your next party alongside your favorite vegetable dipping sauce or add them to your famous guacamole recipe. However you choose to use them, these tomatoes will add flavor and taste to any meal. Elevate your recipes with Fresh Organic Beefsteak Tomatoes.', 'Fresh Organic Beefsteak Tomato, 2 Pack Wholesome, versatile, and delicious Rich, juicy flavor in each bite Ideal ingredient for a variety of dishes Use to make pasta sauce, tomato soup, or fresh salsa Make a tasty pesto or bruschetta to serve at your next dinner party Delicious and nutritious fresh produce', 'Fresh Produce', 'https://i5.walmartimages.com/asr/3b3c245b-321c-442c-ad0e-7be6f57a0cd4.49cb3aad993bd0eb1c6ebc7267108c77.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3b3c245b-321c-442c-ad0e-7be6f57a0cd4.49cb3aad993bd0eb1c6ebc7267108c77.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3b3c245b-321c-442c-ad0e-7be6f57a0cd4.49cb3aad993bd0eb1c6ebc7267108c77.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
