INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (844665579, 'Fresh Large Hass Avocado Bag, 3- 4 Count', 6.8, '849351000068', 'Large Whole Hass Avocados aren’t just great-tasting fresh produce items, but they are a nutrient-dense fruit that can be enjoyed throughout the year. Hass avocados are a versatile ingredient with a creamy texture and mild flavor that can be used in many different types of recipes and dishes that are perfect for enjoying at barbecues and outdoor gatherings with friends and family during the summer. Use avocados in flavorful recipes that everybody can share and enjoy while being together outside. Try avocados in individual Mexican food items like tacos or burritos, as part of appetizers like avocado crostini, or in a fresh guacamole or avocado dip so everybody can dip tortilla chips into something delicious. The possibilities are deliciously endless. Not only is a large avocado a great ingredient to use in numerous ways, but it is also a healthy food that contributes unsaturated \"good\" fats and almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9. A large ripe 1.7 lb avocado will have a dark green to nearly black skin color, a bumpy skin texture and should yield to gentle pressure without leaving indentations or feeling mushy. Avocados with a slightly bumpy texture should be ripe in 1 to 2 days. They will also be somewhat firm and have a dark green and black speckled color. Once you’ve selected the perfect bag of Large Hass Avocados, you’ll be ready to enjoy all kinds of different healthy foods and recipes for your next gathering with friends and families.', 'Fresh fruit with a creamy texture and mild flavor Fresh avocados are great for using in tacos, burritos, appetizers, avocado dip and fresh guacamole A cholesterol free fruit that contains almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9 Large Hass avocados are the lowest sugar fruit and provide unsaturated \"good fats\" that help absorb Vitamin A, Vitamin D, Vitamin K and Vitamin E Large ripe avocados will have dark green to nearly black skin color, a bumpy texture and should yield to gentle pressure without leaving indentations', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f7f54a85-4f77-4c30-ab80-f57352473347.da61567dd7da970e19efee00d4ba591c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f7f54a85-4f77-4c30-ab80-f57352473347.da61567dd7da970e19efee00d4ba591c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f7f54a85-4f77-4c30-ab80-f57352473347.da61567dd7da970e19efee00d4ba591c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
