INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (845843843, 'Cherry Tomato, 10 oz Package', 2.97, '057836021709', 'Bring the fresh, delicious taste of Cherry Tomatoes into your home. Because of their notable flavor and thicker skin, they are a versatile tomato that\'s great for grilling, sauteing, roasting, or baking. Their small size also makes them a quick and simple addition to a fresh salad as well as an excellent finger food for whenever you\'re in the mood for a light snack. Packed with nutrients, cherry tomatoes are a deliciously healthy ingredient that adds both vibrant color and mouthwatering flavor to any recipe. For the best flavor and freshness, store these tomatoes at room temperature on your kitchen counter. Make your next meal a marvelous one with these fresh Cherry Tomatoes.', 'Cherry Tomato, 10 oz Package: Wholesome, versatile, and delicious Sweet, juicy flavor in each bite Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Store at room temperature for best results', 'Fresh Produce', 'https://i5.walmartimages.com/asr/39585953-8ae1-4909-a68a-40c3288c87ba.b7af54eb72069bdaca0bd4d3d88f9d2b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39585953-8ae1-4909-a68a-40c3288c87ba.b7af54eb72069bdaca0bd4d3d88f9d2b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/39585953-8ae1-4909-a68a-40c3288c87ba.b7af54eb72069bdaca0bd4d3d88f9d2b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (845914949, 'Fresh Grower\'s Choice Weekly Harvest Specialty Stone Fruit, 1 lb', 3.77, '813187011222', 'Looking for a fun and exciting snack that\'s full of mystery and possibility? Look no further than our Grower\'s Choice Weekly Harvest Specialty Stone Fruit Variety! This mystery box item is filled with a delicious suprise of premium fresh stone fruits, carefully selected from our growers\' seasonal harvest. You might find juicy plums, sweet apricots, luscious nectarines, succulent peaches, or an intriguing set of plumcots - each one offering a unique taste experience. With over 20 distinct varieties that our grower may choose, you\'ll be in for a treat with each bite. Each fruit boasts its own unique appearance, color, and size, ensuring a fun and exciting snacking experience. Whether you enjoy them on their own as a healthy snack or incorporate them into your favorite recipes, these stone fruits are sure to bring a burst of flavor and nutrition to your day. Looking for some tasty ideas to get you started? Try substituting these fruits for a refreshing twist in your favorite recipes. From scrumptious cakes and crisps to roasted dishes with honey and goat cheese, the possibilities are endless! So why settle for just any snack when you can indulge in the surprise and delight of our Weekly Harvest Specialty Stone Fruit Variety? Stock up today and discover the joy of these delicious fruits in every bite!', 'Fresh Grower\'s Choice Weekly Harvest Specialty Stone Fruit, 1 lb Clamshell: Delight in a surprise selection of premium plums, apricots, nectarines, peaches, or plumcots Indulge in the unique flavors presented in these varieties that have been selected by our growers Rich in vitamins and nutrients, promoting a healthy diet Ideal for both sweet and savory dishes, showcasing their culinary versatility Add a burst of color and taste to fruit salads and charcuterie boards Create tantalizing jams, preserves, and chutneys with their unique flavor profile Perfect for incorporating into smoothies and juices for a refreshing twist Impress dinner guests with elegant desserts and appetizers A delightful addition to breakfast dishes, such as oatmeal, yogurt, and pancakes Explore the exciting world of premium stone fruits with many different varieties to try throughout the season', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f0e86178-8842-4111-8133-815350976f00.15a403d2d95c15afe36fe434b26b6449.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f0e86178-8842-4111-8133-815350976f00.15a403d2d95c15afe36fe434b26b6449.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f0e86178-8842-4111-8133-815350976f00.15a403d2d95c15afe36fe434b26b6449.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
