INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (848312911, 'Comets Fresh Yellow Grape Tomato, 10 oz Package', 2.98, '751666950054', 'Make snack time or salads even brighter with fresh NatureSweet Comets. The vibrant yellow color isn’t the only thing that makes these grape tomatoes so special. They’re also sweeter and less acidic than their popular red siblings. Plus, with the same signature Raised Right qualities of other NatureSweet goods, the same stellar satisfaction extends to whatever dish you choose to incorporate Comets into.', 'Wholesome, versatile, and delicious Colorful tomatoes with citrusy, floral notes Ideal ingredient for a variety of dishes Perfect for salads, pasta salads, flatbreads, omelets, and healthy snacking Add to party trays or school lunches Delicious and nutritious Fresh produce in a convenient package Store at room temperature for best results', 'NatureSweet', 'https://i5.walmartimages.com/asr/e4adf34f-13f2-46cf-a614-a99708679d79.3d06234188bcf2c909a3331e055ccbec.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4adf34f-13f2-46cf-a614-a99708679d79.3d06234188bcf2c909a3331e055ccbec.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4adf34f-13f2-46cf-a614-a99708679d79.3d06234188bcf2c909a3331e055ccbec.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
