INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (848709845, 'Fresh Black Mission Figs, 8 oz', 4.56, '045255148152', 'Dramatically dark and sinfully sweet, Black Mission Figs taste as good with your morning yogurt as they do for dessert. Sweet yet mild, mellow yet rich, Black Mission Figs deserve their reputation as the most consistently delicious fresh fig available. While they have a flavor all their own, the taste could be described as a mix of strawberry, melon, and banana flavors, with a pleasantly jammy, creamy texture. These figs can be enjoyed just as they are, or prepared and cooked. They make an excellent addition to cheese platters and are a welcome addition to salads with spicy greens. You can even stuff the figs with cheese or ham, or slice them up and include them in grilled cheese sandwiches. However you choose to enjoy them, Black Mission Figs are a decadent addition to your collection of fresh, fruity ingredients.', 'Fresh Black Mission Figs, 8 oz 8-ounce container of fresh Black Mission Figs Excellent flavor addition to a wide variety of recipes from baked goods to hot sandwiches Smell fresh and are fairly soft Ripen at room temperature or refrigerate for a few days Figs may also be sealed in a plastic bag and frozen for up to six months', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1ad789ba-9aca-4d91-be2c-23e55994af0a.ed124cd0103bfeef4a2189bc7ba15e39.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1ad789ba-9aca-4d91-be2c-23e55994af0a.ed124cd0103bfeef4a2189bc7ba15e39.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1ad789ba-9aca-4d91-be2c-23e55994af0a.ed124cd0103bfeef4a2189bc7ba15e39.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
