INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (849923449, 'Freshness Guaranteed Watermelon Small', 4.97, '262819000002', 'Experience a burst of summertime goodness with this delicious Freshness Guaranteed Watermelon. This pre-cut ripe watermelon is juicy, sweet, and refreshing to the taste. In addition, watermelons are a great natural source of vitamins A and C. Carry them with you and eat them straight out of the tray any time you want, at home, or on-the-go. Pair them with a tasty salad or sandwich for a nutritious and delicious lunch. You can also use them as a naturally sweet ingredient in a fruit salad. Add some fresh fruit to your daily menu with this Freshness Guaranteed Watermelon.Freshness Guaranteed provides you and your family with high quality fresh food that save you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Watermelon, 10 oz: Pre-cut watermelon chunks Convenient take-and-go packaging Good source of vitamins A and C No preservatives, artificial colors or artificial flavors Perfect for your next backyard cookout Net weight: 10 oz Sweet and Juicy', 'Fresh Produce', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (849996714, 'Bowery Farming Spring Mix Salad Blend, 8 oz Clam Shell, Fresh', 4.48, '851536007571', 'Spring Mix is a classic, sweet, and zesty salad blend. It\'s perfect in a wrap or as a beautiful, fresh salad.Bowery Farming grows positively tasty, fresh produce in a cleaner, more sustainable way: in local, indoor smart farms. Every Bowery leaf is grown and handled with care, without pesticides. Bowery\'s smart farms use less water & create less waste on less land. Because Bowery\'s farms are local, you can trust that your produce is freshly harvested, picked at peak freshness 365 days a year, and available on shelf in just a few days.', 'Bowery Farming Spring Mix Pesticide-Free, Locally Grown Salad Greens, 8oz: 100% Pesticide-free 100% Locally grown 100% Fully traceable Indoor-grown Protected Produce Clean & ready to eat Non-GMO Project Verified Recycled Packaging', 'Bowery Farming', 'https://i5.walmartimages.com/asr/a2572fc2-fd2c-4fa8-a876-d82cd5908010.709450ff2912f4ba549255de122e1e82.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a2572fc2-fd2c-4fa8-a876-d82cd5908010.709450ff2912f4ba549255de122e1e82.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a2572fc2-fd2c-4fa8-a876-d82cd5908010.709450ff2912f4ba549255de122e1e82.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
