INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (852338655, 'Fresh Cosmic Crisp Apples, 3 lb Bag', 4.57, '033383005263', 'Meet your new favorite apple, the Cosmic Crisp. Cosmic Crisp Apples are prized for their vibrant red color, pearl-colored flesh, perfectly balanced flavor and delightfully crisp texture. An excellent choice for baking, snacking and entertaining, Cosmic Crisp Apples are the delicious result of 20 years of research by Washington State University’s world-class tree fruit breeding program. The Cosmic Crisps is a cross of the Enterprise and Honeycrisp varieties. The large, juicy and red apple has a perfectly balanced flavor and firm texture, making it ideal for snacking, cooking, baking, and entertaining. The striking color and shape of the Cosmic Crisp shines in fresh decor like wreaths, floral arrangements and tablescapes', 'Cosmic Crisp Apples Cross of the Enterprise and Honeycrisp varieties Large, juicy and red apple has a perfectly balanced flavor and firm texture Ideal for snacking, cooking, baking, and entertaining Shines in fresh decor like wreaths, floral arrangements and tablescapes Cosmic Crisp Apples Cross of the Enterprise and Honeycrisp varieties Large, juicy and red apple has a perfectly balanced flavor and firm texture Ideal for snacking, cooking, baking, and entertaining Shines in fresh decor like wreaths, floral arrangements and tablescapes Make a creamy smoothie or a nutritious juice blend Perfect as a healthy treat or seasonal baking ingredient Great for packing in lunches Make a creamy smoothie or a nutritious juice blend Adds flavor to a variety of recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/dbd3a99b-88f0-43f2-b7de-89385d103111.f1bdf2065b438c94c8f1a6038e3b9b6f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dbd3a99b-88f0-43f2-b7de-89385d103111.f1bdf2065b438c94