INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (854838280, 'Fresh Seedless Lemons, 2 lb Bag', 5.48, '072240546792', 'These Seedless Lemons are juicy, zesty, naturally seedless, and Non-GMO Project Verified. They\'re everything you love about lemons, minus the pesky little seeds. These lemons can add a twist to a wide variety of recipes. Slice them and use them in your iced or hot tea or use the lemon juice to make satisfying and refreshing strawberry lemonade. Zest the lemon peel to use in recipes such as lemon cookies or a tasty lemon loaf. You can also use lemons in savory recipes like asparagus with lemon zest or shrimp scampi with linguini. Enhance the flavor of your next meal with these Seedless Lemons.', 'Naturally seedless lemons Use to add zest and flavor to your meals and beverages Add to your iced or hot tea Make a satisfying and refreshing strawberry lemonade Use lemon zest to make lemon cookies or lemon loaf Non-GMO Project verified Available in a 2-pound bag', 'Wonderful', 'https://i5.walmartimages.com/asr/b5cc869b-1322-4e0c-8c56-219116bec46d.0cbc93f437d454590b3624cbfc658575.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b5cc869b-1322-4e0c-8c56-219116bec46d.0cbc93f437d454590b3624cbfc658575.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b5cc869b-1322-4e0c-8c56-219116bec46d.0cbc93f437d454590b3624cbfc658575.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
