INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (855391604, 'Green Giant Fresh Sweet Potatoes', 2.98, '605806000799', 'Green Giant™ Fresh Sweet Potatoes.Steams in pack.Net Wt 340 g (12 oz). Keep refrigerated.Microwave Directions:1. Tear bag at notch.2. Open pouch and run under cold water to rinse Sweet Potatoes. Drain water from pouch. Reseal pouch leaving about 1 inch open. Microwave on high for 3 minutes, or until desired tenderness.Because microwaves cook differently, times are approximate.Caution: Hot! Pouch may be hot to the touch. Let stand 1 minute in microwave before removing.Fresh Serving Suggestions:Toss Sweet Potatoes with olive oil, season with herbs and roast alongside quartered onions at 350°F for 25-30 minutes.Boil Sweet Potatoes in chicken stock with onions, celery, cinnamon and nutmeg. When tender, puree and season to taste for a simple Sweet Potato soup.Season Sweet Potatoes with olive oil, brown sugar, cumin and chili powder. Roast at 425°F for 15 minutes or until golden and tender for a sweet & crispy side dish.Roast Sweet Potatoes until tender, then puree with butter, cream, salt and smoked paprika.', 'Green Giant Fresh Sweet Potatoes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/01821dfc-1536-4c86-92dd-856dd820d280_1.ddcb9258867726f04cca9c03e12c1ed3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/01821dfc-1536-4c86-92dd-856dd820d280_1.ddcb9258867726f04cca9c03e12c1ed3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/01821dfc-1536-4c86-92dd-856dd820d280_1.ddcb9258867726f04cca9c03e12c1ed3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
