INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (860584306, 'Grown True Organic Fresh Roma Tomatoes, 16 oz', 2.46, '891824002413', 'Grown True Organic Fresh Roma Tomatoes are a great beginning to your next homecooked meal. An excellent ingredient for use in a wide variety of dishes, Roma tomatoes are versatile and can lend themselves to just about any recipe your cookbook suggests. You can use them to create a zesty tomato sauce for stirring into a homemade pasta dish, crush them up to make a delightful Roma tomato bruschetta, or simply enjoy them on their own as a nutritious snack or as a party platter option for dipping in your favorite vegetable dipping sauce. If you\'re feeling a classic tomato dish, Roma tomatoes can even lend themselves in making a comforting and appetizing tomato soup or a flavorful salsa. Experience the best of nature with these Grown True Organic Fresh Roma Tomatoes.', 'Grown True Organic Fresh Roma Tomatoes, 16 oz: USDA Organic Roma tomatoes Ideal ingredient for a variety of dishes Perfect for making zesty tomato sauces Enjoyable as a nutritious snack Excellent for homemade salsa', 'Grown True', 'https://i5.walmartimages.com/asr/278b1ac3-a58c-4751-b956-a0d9191c1f7b_2.eafdc16c3e1439337a2b45546dd458d7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/278b1ac3-a58c-4751-b956-a0d9191c1f7b_2.eafdc16c3e1439337a2b45546dd458d7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/278b1ac3-a58c-4751-b956-a0d9191c1f7b_2.eafdc16c3e1439337a2b45546dd458d7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
