INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (860788341, 'Zucchini, 2 Pack', 1.57, '711069541150', 'Add some fresh flavor to your meal with Zucchini. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. This nutrient dense vegetable is great in soups, casseroles, pot roasts and other tasty recipes. Slice it up and enjoy with baby carrots and ranch dressing for a healthy snack. Season with fresh chopped garlic, saute and serve with grilled chicken breast and roasted carrots. Spiralize it and saute for a great pasta replacement. Or shred it for mouth-watering breads and muffins. It is great for health-conscious individuals as they are USDA organic and rich in vitamin C, B-6, and calcium. With so many uses, this vegetable will become a pantry staple. Create tasty and flavorful meals with Zucchini.', 'Zucchini, 2 Pack: Versatile ingredient Slice it up and enjoy with baby carrots and ranch dressing for a healthy snack Great in soups, casseroles, pot roasts and other tasty recipes Rich in vitamin C, calcium, and vitamin B-6 Will become a pantry staple', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f88083d5-3c6e-4a75-8833-3faf3ded2af6_1.a626c3d41931d5fbc6eaf8d7513cbee7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f88083d5-3c6e-4a75-8833-3faf3ded2af6_1.a626c3d41931d5fbc6eaf8d7513cbee7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f88083d5-3c6e-4a75-8833-3faf3ded2af6_1.a626c3d41931d5fbc6eaf8d7513cbee7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
