INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (861438471, 'Marketside Organic Fresh Broccoli Florets, 12 oz', 3.77, '681131161565', 'Marketside Fresh Organic Broccoli Florets are a nutritious and versatile vegetable you can enjoy with a variety of meals. Season them with olive oil, garlic, salt, and black pepper and roast them in the oven for a delightful side dish. Cut the florets into small pieces and mix with purple cabbage and shredded carrots for a yummy broccoli slaw. Each serving contains just 30 calories and has zero fat, cholesterol, and added sugars. Whether you enjoy them roasted, fried, blanched, or steamed, Marketside Organic Broccoli Florets are an excellent addition to any meal. Marketside Organic foods are simple, wholesome and USDA certified.', 'USDA certified organic Flavorful, Authentic. Guaranteed Delicious.™ Microwaves in only 3 minutes 30 calories per serving 0g total fat, cholesterol, and added sugars 4 servings per container 12oz bag of fresh, washed and ready-to-eat broccoli florets', 'Marketside', 'https://i5.walmartimages.com/asr/6741ff9c-8f77-42e8-8f4a-56c31eaad6c6.565a0b4438c11d26d74ec10fb78123ca.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6741ff9c-8f77-42e8-8f4a-56c31eaad6c6.565a0b4438c11d26d74ec10fb78123ca.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6741ff9c-8f77-42e8-8f4a-56c31eaad6c6.565a0b4438c11d26d74ec10fb78123ca.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
