INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (866748621, 'Cara Cara Oranges, 3 lb Bag', 4.74, 'deleted_092148146290', 'Enjoy the fresh sweetness of Cara Cara Oranges. These pink-fleshed oranges are very sweet and have a lower acidity than Navel oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite adult beverage. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Cara Cara Oranges add flavor to any meal or beverage.', 'Cara Cara Oranges, 3 lb Bag: Great source of vitamin C Pink-fleshed citrus fruit with a very sweet flavor & low acidity Use to add zest & flavor to your meals & beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety of recipes Use as a garnish for your favorite adult beverage Make sweet desserts like ambrosia, orange bars & orange pie', 'Fresh Produce', 'https://i5.walmartimages.com/asr/7ed5a1fe-890f-49db-979f-7b84db887725_1.527f0dfe8b4f993948ab1f69612ea269.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7ed5a1fe-890f-49db-979f-7b84db887725_1.527f0dfe8b4f993948ab1f69612ea269.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7ed5a1fe-890f-49db-979f-7b84db887725_1.527f0dfe8b4f993948ab1f69612ea269.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
