INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (868823571, 'Fresh Limes, 2lb Bag', 4.98, 'deleted_744430275620', 'Add zest and flavor to your meals and beverages with these Limes. Freshly squeezed limes provide a healthy dose of vitamin C to your diet and are a key ingredient in many recipes, from homemade salsa to chicken dishes. The citrusy tropical flavor of these limes are sure to add a zing to all your cooked meals. Drizzle lime juice over fish or add it to your favorite sauces. Serve wedges of raw lime with your favorite cocktails and use them when baking cakes, cookies, and tarts. These limes are sold in a two-pound bag, so you\'ll have plenty for all your culinary creations. Enjoy the refreshing, tart flavor of Limes.', 'Fresh and juicy limes Drizzle lime juice over fish or add it to your favorite sauces Serve wedges of raw lime with your favorite cocktails Use them when baking cakes, cookies, and tarts Refreshing, tart flavor Seedless', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/dfd60266-c675-4e8a-ae71-257f27bb9984.5df7ac1421edf06ea6618d8d4425adb5.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dfd60266-c675-4e8a-ae71-257f27bb9984.5df7ac1421edf06ea6618d8d4425adb5.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/dfd60266-c675-4e8a-ae71-257f27bb9984.5df7ac1421edf06ea6618d8d4425adb5.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
