INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (870677386, 'Fresh Tangerine, Each', 0.44, '846189044493', 'Enjoy the juicy goodness of citrus when you eat a Fresh Tangerine. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, tangerines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, tangerines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the tangerines hang out in a bowl on your counter or table to breathe. Compact and portable, tangerines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Fresh Tangerines on hand for an easy, healthy treat.', 'Fresh Tangerine, Each Fresh, delicious, tangerine Pleasing sweet-tart flavor Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6b9ea942-4548-4d7e-a2fe-b2c8c8b66a25.04a1152f2e89f7692a98bf2f004bd772.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6b9ea942-4548-4d7e-a2fe-b2c8c8b66a25.04a1152f2e89f7692a98bf2f004bd772.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6b9ea942-4548-4d7e-a2fe-b2c8c8b66a25.04a1152f2e89f7692a98bf2f004bd772.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
