INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (875707062, 'Fresh Grape Red Globe, Bag', 2.17, '405767277083', 'Treat yourself to the delicious, juicy flavor of Fresh Green Seedless Grapes. These grapes are bursting with flavor and are completely seedless. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the fresh taste of Fresh Green Seedless Grapes.', 'Fresh Red Globe Seeded Grapes Bag Bursting with flavor and known for their large size Enjoy a handful as a fresh snack Add to a stunning cheese board or charcuterie plate Dry them to make raisins', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ef792e1b-5d00-4bdf-954c-34f14e8bc325.96dcbb55011e69c157a4b3999ae80cdd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ef792e1b-5d00-4bdf-954c-34f14e8bc325.96dcbb55011e69c157a4b3999ae80cdd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ef792e1b-5d00-4bdf-954c-34f14e8bc325.96dcbb55011e69c157a4b3999ae80cdd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
