INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (876369860, 'Freshness Guaranteed Chipotle Guacamole, 8 oz', 2.98, '681131305259', 'Turn up the smokiness with Freshness Guaranteed Chipotle Guacamole. This tasty guacamole features a creamy combination of Hass Avocados, chipotle peppers, jalapeno peppers, onions, and zesty mix of herbs and spices to ensure a mouth full of flavor in every bite. Add a dollop to your quesadillas, burgers, burritos, and sandwiches for a taste that will have you coming back for seconds. With 8 servings per container, this guacamole is perfect for serving up at small gatherings, barbecues, and game nights with family and friends. Plus, the inclusion of the reclosable lid in the packaging helps maintain its freshness between snack sessions. Scoop up some flavor with Freshness Guaranteed Chipotle Guacamole. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Spark Fresh Item.', 'Freshness Guaranteed Chipotle Guacamole, 8 oz: Smokey flavor profile 8 servings per container Pairs perfectly with chips Delicious as a spread on wraps, sandwiches, and toast', 'Fresh Produce', 'https://i5.walmartimages.com/asr/24f3afbc-7ff4-4506-a902-d3c69f9cdd15_1.32162f3e120eb765342a87f5f7d8b39c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/24f3afbc-7ff4-4506-a902-d3c69f9cdd15_1.32162f3e120eb765342a87f5f7d8b39c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/24f3afbc-7ff4-4506-a902-d3c69f9cdd15_1.32162f3e120eb765342a87f5f7d8b39c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (876768778, 'Fresh Saturn Peach, 1.3 lb Container', 4.34, '000000031134', 'Treat everyone to the sweet taste of Fresh California Grown Saturn Peaches. Also known as donut peaches, this fruit is great to hand out to the kids as a tasty after-school snack. Add these peaches to a fruit salad to serve at your next party or to a delectable salad as a sweet topping. Serve them with cheese, salami, and almonds for a wonderful picnic cheese plate. You could also slice them to top your yogurt and granola for a healthy breakfast, or even make a tasty peach crumble dessert for your next dinner party. The culinary opportunities are endless with Fresh California Grown Saturn Peaches.', 'Fresh California Grown Saturn Peaches: Also known as donut peaches because of their unique shape Sweet and juicy Hand out to the kids as a tasty after-school snack Use to make a delicious fruit salad Slice and use top your yogurt and granola for a healthy breakfast', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5ccffb25-de52-4c58-b33d-1e8303b758b5.291871104347784b221ee737f9f7dd58.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5ccffb25-de52-4c58-b33d-1e8303b758b5.291871104347784b221ee737f9f7dd58.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5ccffb25-de52-4c58-b33d-1e8303b758b5.291871104347784b221ee737f9f7dd58.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
