INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (877224146, 'Marketside Fresh Celery Sticks, 1.6 oz, 4 Pack', 1.97, '681131161510', 'Marketside Celery Sticks are a tasty and smart snack that you can enjoy any time of the day. Celery is a low calorie snack that is also a good source of fiber, calcium and potassium. These celery sticks come in a ready-to-eat package making it easy to enjoy on the go for you and your kids. Pair with peanut butter for a delicious, protein-rich snack or dip in your favorite dressing for quick, flavorful treat. Keep this plastic package refrigerated for a cool, refreshing taste. Enjoy a refreshing snack with the wholesome taste of Marketside Celery Sticks. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Fresh Celery Sticks, 1.6 oz, 4 Pack 4 pack of celery sticks Pair with peanut butter for a delicious, protein-rich snack or dip in your favorite dressing for quick, flavorful treat Good source of fiber Only 5 calories per pack Packaged in a 6.4 oz plastic bag', 'Marketside', 'https://i5.walmartimages.com/asr/090a5a24-e3be-4728-964b-57952404b359.1f02ca476740e5e2d70e0e31dc28058f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/090a5a24-e3be-4728-964b-57952404b359.1f02ca476740e5e2d70e0e31dc28058f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/090a5a24-e3be-4728-964b-57952404b359.1f02ca476740e5e2d70e0e31dc28058f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
