INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (878576025, 'Produce Unbranded Red Bell Pepper, 1 Each', 1.38, 'deleted_856977005292', 'Enhance your meals with the delicious flavor of Red Bell Peppers. This vegetable contains essential vitamins such as A and C, and minerals including calcium and magnesium. Red bell pepper, also known as red capsicum, has a crisp flavor that enhances a variety of recipes. Dice bell peppers and put them in a hearty chili, slice them, saute them with onions or stir-fry with thinly-sliced steak and serve with rice. A hollowed-out red bell pepper can be filled with sausage, mushrooms and rice to create a delicious stuffed pepper that will have the family asking for seconds. They also taste delicious raw alongside other vegetables. Add your favorite dip for a healthy, crunchy crudite. Cooked or uncooked, Red Bell Peppers are an excellent item to have on hand.', 'Red Bell Pepper, 1 each: Naturally low in calories Exceptionally rich in vitamin C and other antioxidants Delicious cooked or uncooked Create delicious recipes with fresh red peppers', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/4f92e5bb-3fc7-4894-9fac-11af41bfb025.69c58e1f4a487c78f9684a3050ca8d0a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4f92e5bb-3fc7-4894-9fac-11af41bfb025.69c58e1f4a487c78f9684a3050ca8d0a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4f92e5bb-3fc7-4894-9fac-11af41bfb025.69c58e1f4a487c78f9684a3050ca8d0a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
