INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (883640849, 'Fresh Cosmic Crisp Apples, Each', 0.94, '000000035071', 'Meet your new favorite apple, the Cosmic Crisp. Cosmic Crisp Apples are prized for their vibrant red color, pearl-colored flesh, perfectly balanced flavor and delightfully crisp texture. An excellent choice for baking, snacking and entertaining, Cosmic Crisp Apples are the delicious result of 20 years of research by Washington State University’s world-class tree fruit breeding program. The Cosmic Crisps is a cross of the Enterprise and Honeycrisp varieties. The large, juicy and red apple has a perfectly balanced flavor and firm texture, making it ideal for snacking, cooking, baking, and entertaining. The striking color and shape of the Cosmic Crisp shines in fresh decor like wreaths, floral arrangements and tablescapes.', 'Apple Cosmic Crisp, Each Cross of the Enterprise and Honeycrisp varieties Large, juicy and red apple has a perfectly balanced flavor and firm texture Ideal for snacking, cooking, baking, and entertaining Shines in fresh decor like wreaths, floral arrangements and tablescapes Adds flavor to a variety of recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/6e8284d0-ba2f-497a-92c1-705aac4f63d1.8b2619781e5d3318cab2bf21805b9741.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6e8284d0-ba2f-497a-92c1-705aac4f63d1.8b2619781e5d3318cab2bf21805b9741.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6e8284d0-ba2f-497a-92c1-705aac4f63d1.8b2619781e5d3318cab2bf21805b9741.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (883971287, 'Mother Earth Products Crunchy Seedless Red Grape Halves, 2 Cup Jar', 7.98, '810919034504', 'Mother Earth Products Freeze Dried Red Grape Halves (Seedless): a healthy & convenient addition to every area of your life without the headache: emergency preparedness, snacking, long and short term storage, traveling, everyday cooking, hiking, backpacking, spicing up your recipes, etc. – use it now or later. Mother Earth Products Freeze Dried Red Grape Halves (Seedless) are made with real, Non-GMO Red Grapes: preservative free, additive free, & kosher - a guilt-free, hearty food that makes eating wonderfully delectable & appealing, without the hassle of weekly trips to the store or the worry of spoiling. It’s so delicious you won’t store it away and hope you never have to use it. Taste the Goodness of Mother Earth Products.', '100% red grapes; long term storage; short term storage; pantry; portable; convenient; nothing added; emergency preparedness; great flavor; easy to cook with; can eat straight from container without reconstituting; snack on immediately', 'Mother Earth Products', 'https://i5.walmartimages.com/asr/1cd0b4ed-cd9e-4dec-b7b8-a08cf168faad.38222b539f1cc9bba28743db6f3f51ed.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1cd0b4ed-cd9e-4dec-b7b8-a08cf168faad.38222b539f1cc9bba28743db6f3f51ed.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1cd0b4ed-cd9e-4dec-b7b8-a08cf168faad.38222b539f1cc9bba28743db6f3f51ed.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
