INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (885064063, 'Fresh Jumbo Blueberries, 9.5oz', 4.98, '', 'Create decadent meals with sweet and light Fresh Blueberries. Enjoy them for breakfast, lunch, dinner, or dessert. Use them to make a lemon and blueberry galette, bake them into delicious blueberry muffins, cook up a sweet and savory pizza topped with blueberries and bacon, or reduce them for a sauce to use on grilled chicken or cheesecake. They contain essential vitamins and nutrients like, vitamin C, vitamin K, antioxidants, and manganese making them perfect for a healthy diet', 'Light, refreshing taste Healthy treat Prior to serving gently wash them with cool water Refrigerate your berries in the original container to maintain freshness', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/24893ec1-4563-41fa-9efb-42ba1d0d5e98.f417a4c35f49d4ecd5c479905aa827b3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/24893ec1-4563-41fa-9efb-42ba1d0d5e98.f417a4c35f49d4ecd5c479905aa827b3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/24893ec1-4563-41fa-9efb-42ba1d0d5e98.f417a4c35f49d4ecd5c479905aa827b3.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
