INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (885551930, 'Freshness Guaranteed Fajita Mix, 8 oz', 2.88, '681131093026', 'Freshness Guaranteed Fajita Mix brings together crisp yellow onions, green bell peppers, and red bell peppers that are sliced and ready to add vibrant flavor to your favorite meals. This colorful blend offers a convenient way to prepare quick weeknight dinners, whether you are making sizzling stovetop fajitas, layering veggies into tacos, or adding fresh taste to salads and rice bowls. Each ingredient is prepped to save you time while still delivering a satisfying crunch and natural sweetness that enhances every bite. With its versatile use and fresh taste, Freshness Guaranteed Fajita Mix makes it simple to enjoy delicious meals with ease. Freshness Guaranteed Fajita Mix helps you create flavorful dishes your whole family will love. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Fajita Mix, 8 oz Pre sliced mix of yellow onions and bell peppers Ready to use for quick meal prep Great for fajitas, tacos, salads, and rice bowls Adds fresh flavor and crisp texture to dishes Convenient eight ounce portion size', 'Fresh Produce', 'https://i5.walmartimages.com/asr/61196911-adfa-41d2-8d51-f7aabe3f890e.2950ffd58d31f5b945df797ee6960a3b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/61196911-adfa-41d2-8d51-f7aabe3f890e.2950ffd58d31f5b945df797ee6960a3b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/61196911-adfa-41d2-8d51-f7aabe3f890e.2950ffd58d31f5b945df797ee6960a3b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
