INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (886962116, 'Fresh Passion Fruit, Each', 2.74, '405655340523', 'Get ready for a tropical taste bomb with this juicy Fresh Passion Fruit. This fresh and whole fruit has a hard purple shell protecting the bright yellow interior with black seeds. Cut the fruit in half, scoop the pulp out with a spoon and enjoy. If it\'s too tart, try sprinkling sugar to sweeten the treat. You can also use this fresh passion fruit in several baking recipes including a delicious cream pie or fruit truffles. You can even use them to make a marinade or a passion fruit vinaigrette. However you choose to use them, their sweet flavor will bring a smile to everyone\'s face. Treat the family to the irresistible taste of Fresh Passion Fruit.', 'Fresh Passion Fruit, Each Sweet and juicy Fresh and whole fruit with a hard purple shell Scoop the pulp out with a spoon and enjoy Use to make a delicious cream pie or fruit truffles Make a marinade or a passion fruit vinaigrette salad dressing', 'Fresh Produce', 'https://i5.walmartimages.com/asr/f74ab571-6ff0-4784-877d-37200a1c3d84.7743cedecfeafb038f3be240bff14bb5.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f74ab571-6ff0-4784-877d-37200a1c3d84.7743cedecfeafb038f3be240bff14bb5.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f74ab571-6ff0-4784-877d-37200a1c3d84.7743cedecfeafb038f3be240bff14bb5.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (887064557, 'Organic Whole White Mushrooms, 16 oz', 4.94, 'deleted_037102281419', 'Experience the fresh taste of Organic Whole White Mushrooms. If you\'re looking for a traditional mushroom with a mild earthy taste, white mushrooms are just what you need. They\'ve remained the most popular mushroom for several decades, and although all mushrooms are versatile, white mushrooms are the most versatile of them all. Pre-cleaned and in their whole form, they are perfect for slicing, dicing, and cutting however you like to create culinary works all your own. They are free of fat and cholesterol and are low in calories and sodium. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out Organic Whole White Mushrooms.', 'Organic Whole White Mushrooms, 16 oz: 16-ounce package of organic whole white mushrooms Naturally fat-free Cholesterol-free Low in calories, carbs and sodium Fresh and all natural Natural source of the antioxidant selenium Great for salads, pizzas, and much more', 'Monterey', 'https://i5.walmartimages.com/asr/d1646df2-1733-46b0-875a-4c3904c55eab.56c455cc7999bc321eafcef945330e53.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d1646df2-1733-46b0-875a-4c3904c55eab.56c455cc7999bc321eafcef945330e53.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d1646df2-1733-46b0-875a-4c3904c55eab.56c455cc7999bc321eafcef945330e53.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (887082105, 'Fresh Juici Apple, Each', 1.06, '000000034678', 'Fresh Juici Apple is a refreshing and crisp apple variety known for its juicy and sweet flavor. Each apple is carefully selected and handpicked to ensure maximum freshness and quality. With a bright, vibrant red skin and a delightful crunch, Fresh Juici Apple is the perfect snack or ingredient to add a burst of natural sweetness to any dish. Whether enjoyed on its own or used in desserts, salads, or smoothies, each Fresh Juici Apple promises a satisfying and mouthwatering experience.', 'Fresh, whole, juicy and sweet apple Exceptional Juiciness: Juici Apples are known for their exceptional juiciness, providing a refreshing and satisfying eating experience. With every bite, you can enjoy the burst of natural juice that runs down your chin, making them perfect for quenching your thirst or satisfying a craving for something juicy and delicious Crisp Texture: Juici Apples have a crisp and firm texture that adds to their overall appeal. Whether you prefer biting into a crunchy apple or slicing it for a crisp addition to salads or desserts, Juici Apples maintain their texture and freshness, ensuring a delightful eating experience every time. Sweet and Tangy Flavor: Juici Apples offer a perfect balance of sweetness and tanginess, making them a popular choice for apple lovers. The natural sweetness is complemented by a subtle tang, creating a flavor profile that is both refreshing and satisfying. Whether eaten on their own or used in various culinary creations, Juici Apples bring a burst of flavor to every dish.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e83cfb54-40f6-433a-8f3a-5e11af4bdc93.49ba5b028ba589a44e3f8e9d4541e6d8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e83cfb54-40f6-433a-8f3a-5e11af4bdc93.49ba5b028ba589a44e3f8e9d4541e6d8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e83cfb54-40f6-433a-8f3a-5e11af4bdc93.49ba5b028ba589a44e3f8e9d4541e6d8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
