INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (887852760, 'Aerofarms Kale Microgreens Salad, 2 oz Clam Shell, Fresh', 3.98, '815063021233', 'Sweet and wholesome, AeroFarms kale microgreens are tender, mild, and a versatile recipe staple. Our Micro Kale falls in the light blue portion of the AeroFarms FlavorSpectrum™, representing a slight sweetness with green, mellow notes. Microgreens can contain considerably higher levels of vitamins and carotenoids—about 5X greater—than their mature plant counterparts, according to the United States Department of Agriculture. AeroFarms greens are grown with zero pesticides and are ready to enjoy right out of the container. Taste the AeroFarms difference - enjoy Micro Kale by adding a heaping handful to boost any meal including sandwiches, wraps, soups, salads, smoothies, takeout, and more.', 'Bursting With Flavor No Pesticides Ever No Washing Needed', 'AeroFarms', 'https://i5.walmartimages.com/asr/ed564ed1-22b7-4c5f-bcb3-b12dd66d7b54.4013cd0646ae8b403ba679d138fb3519.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed564ed1-22b7-4c5f-bcb3-b12dd66d7b54.4013cd0646ae8b403ba679d138fb3519.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed564ed1-22b7-4c5f-bcb3-b12dd66d7b54.4013cd0646ae8b403ba679d138fb3519.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
