INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (891543948, 'Organic White Beech Mushrooms, 3.5 oz', 3.98, 'deleted_021706672339', 'Experience the fresh taste of Organic White Beech Mushrooms. Beech mushrooms have a crunchy texture that offers a delicate, mild flavor that is both satisfyingly sweet and nutty. Perfect for soups, stews, sauces, or stir-fry\'s, Beech mushrooms retain their crisp texture when added as the last ingredient. Try sauteeing or roasting them on their own for a delectable side dish. They are free of fat and cholesterol and are low in calories and sodium. Plus, mushrooms are a natural source of the antioxidant selenium, making them an excellent addition to your diet. For a natural ingredient that will bring a marvelous taste and texture to your meal, be sure to try out Organic White Beech Mushrooms.', 'Organic White Beech Mushrooms, 3.5 oz: 3.5-ounce package of organic white Beech mushrooms Delicate, mild flavor that is both satisfyingly sweet and nutty Naturally fat-free Cholesterol-free Low in calories, carbs and sodium Fresh and all natural Natural source of the antioxidant selenium Great for soups, stews, sauces, or stir-fry\'s', 'PRODUCE', 'https://i5.walmartimages.com/asr/23d49ade-ad0e-400a-b275-b3a39e4e816f.2a0faf07104a43c26c0ce17b8f33ad05.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/23d49ade-ad0e-400a-b275-b3a39e4e816f.2a0faf07104a43c26c0ce17b8f33ad05.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/23d49ade-ad0e-400a-b275-b3a39e4e816f.2a0faf07104a43c26c0ce17b8f33ad05.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
