INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (900408843, 'Fresh White Beans, 12oz', 3.97, '794504173321', 'White beans are versatile and can be used in a variety of dishes, such as soups, stews, salads, dips, and spreads. They can be a great addition to almost all kinds of foods. Use them to make baked beans, pork and beans and soups. Their delicate flavor is great for any stew, dip, cassoulet, sauce, and white chili. They contain many essential nutrients and are very low in saturated fat. It is a good source of protein, iron, and dietary fiber. Most white beans sold commercially are dried or canned. There is also a nutritional difference; dried goods lose most of their water soluble vitamins. These include vitamins B-complex and C. Although neither vitamin is present in great numbers in beans.', 'White beans are an excellent source of fiber, protein, vitamins, and minerals. They may help improve digestion, manage blood sugar levels, promote heart health. Support healthy weight management.', 'Prico', 'https://i5.walmartimages.com/asr/c39a9c5c-404a-4584-ad2a-ee5b401c2af6.381afb9fbfff21ca0596b174b107c7e9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c39a9c5c-404a-4584-ad2a-ee5b401c2af6.381afb9fbfff21ca0596b174b107c7e9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c39a9c5c-404a-4584-ad2a-ee5b401c2af6.381afb9fbfff21ca0596b174b107c7e9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
