INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (902457972, 'Fresh Organic Red Radish, 12oz Bag', 4.23, '078783908158', 'Serve up something amazing when you cook with Organic Fresh Red Radish. This versatile root vegetable is a great addition to a healthy diet and can be prepared in a variety of ways. Their slightly peppery flavor adds a natural, subtle spice to salads and slaws. Their crisp texture makes them a natural, healthy choice for dips. Try them as a low-carb substitute for potatoes when roasted or as a healthy side dish when grilled. However you choose to use them, these fresh radishes will add big flavor and unforgettable taste to any meal. The culinary possibilities are endless with Organic Fresh Red Radish.', 'Add to a recipe or enjoy on their own Try them grilled, roasted, or pickled Low carb substitute for starchy vegetables High in vitamin C and folate Antioxidant and anti-inflammatory properties support heart and blood health', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4399fc98-4f75-4182-9aa5-8b33fcad4f44.02420ce53bd10676eaf0d13f55c0d82a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4399fc98-4f75-4182-9aa5-8b33fcad4f44.02420ce53bd10676eaf0d13f55c0d82a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4399fc98-4f75-4182-9aa5-8b33fcad4f44.02420ce53bd10676eaf0d13f55c0d82a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
