INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (903882052, 'Fresh Mo Qua Squash, Each', 3.48, '000000048453', 'Mo Qua Squash is a tasty vegetable that the entire family is sure to enjoy. Of Chinese origin and a relative of winter melon, Mo Qua looks like a zucchini with medium green skin and is covered with delicate white hairs. Inside, the flesh is lightly colored and has a mild flavor. This versatile ingredient will absorb the flavors of whatever it is cooked with, and you can use it as you would zucchini or summer squash. Typically, this squash is used in stir fries, added to tasty soups, boiled, or braised. You could also incorporate it into a unique bread recipe or a hearty stew. Add something delicious and nutritious to your next meal with Mo Qua Squash.', 'Lightly colored flesh Mild taste that absorbs flavors of what it is cooked with Use as you would zucchini & summer squash Add to your next stir fry or hearty stew Good source of vitamins Explore delicious new recipes', 'Fresh Produce', 'https://i5.walmartimages.com/asr/cfa3f12f-ae2d-4308-b1b2-c5d7c382c5a9.cbe2841ba662c4df0e80d6e4e145b289.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cfa3f12f-ae2d-4308-b1b2-c5d7c382c5a9.cbe2841ba662c4df0e80d6e4e145b289.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cfa3f12f-ae2d-4308-b1b2-c5d7c382c5a9.cbe2841ba662c4df0e80d6e4e145b289.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
