INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (906716072, 'Organic Cherry Tomato - 4.5\" Pot - Up to 2000 Cherry Tomatoes', 4.99, '811332038605', 'CHERRY TOMATO: A cherry tomato is a smaller garden variety of tomato. It is popular as a snack and in salads. Cherry tomatoes range in size from a thumbtip up to the size of a golf ball, and can range from being round to slightly oblong in shape. The more oblong ones often share characteristics with plum tomatoes, and are known as grape tomatoes. Sweet Million Cherry Tomato - Plant produces heavy yields of 1\" red cherry tomatoes. Very sweet and flavorful. Plant can produces over 500 cherry tomatoes. Crack Resistant. Excellent for salads and snacks. Suitable for home garden or market growers.', 'Plant produces heavy yields of 1\" red cherry tomatoes Excellent for salads and snacks Suitable for home garden or market growers Very sweet and flavorful. Indeterminate, 60 days.', 'Hirt\'s Gardens', 'https://i5.walmartimages.com/asr/8c01bcdc-5928-4d97-bed4-8f8def82a46a_1.b802f9d8a7a55340c058d76de532ce6f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8c01bcdc-5928-4d97-bed4-8f8def82a46a_1.b802f9d8a7a55340c058d76de532ce6f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8c01bcdc-5928-4d97-bed4-8f8def82a46a_1.b802f9d8a7a55340c058d76de532ce6f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
