INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (915293418, 'Marketside Organic Zucchini, 6 oz, 2 Count', 2.96, 'deleted_681131221054', 'Marketside Organic Zucchini is an extremely versatile vegetable that is a must-have for every cook. You can prepare zucchini in a variety of ways. You can choose to eat it raw, or you can saute it slightly with olive oil and salt. If you?re trying to cut down on carbohydrates, zucchini noodles are a great alternative to pasta. Simply use a spiralizer, julienne peeler or a knife to create thin strips of zucchini. Once you have your zucchini noodles, you can saute or bake them and add them to your favorite sauce. You can even use zucchini to make zucchini nut bread. The culinary possibilities are endless with Marketside Organic Zucchini. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Zucchini, 6 oz, 2 Count: USDA Organic Use to make zucchini noodles Refrigerate after opening Use within 2-3 days of opening Only about 30-50 calories per zucchini', 'Marketside', 'https://i5.walmartimages.com/asr/7587f0b5-1ce2-4db8-85ce-753c12329bf9_2.131d850bfa91440b880b52dc8bb5af65.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7587f0b5-1ce2-4db8-85ce-753c12329bf9_2.131d850bfa91440b880b52dc8bb5af65.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7587f0b5-1ce2-4db8-85ce-753c12329bf9_2.131d850bfa91440b880b52dc8bb5af65.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
