INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (919484438, 'Fresh Jalapenos, 8 Ounce Bag', 1, '711069542270', 'Enhance your meals with the delicious flavor of Jalapeno Peppers. Naturally low in calories, fat, and cholesterol, this vegetable is a great source of vitamins C, B6, A, and K, as well as folate and manganese. Jalapeno peppers have a range of pungency, and a crisp flavor that enhances a variety of recipes. Stuff jalapeno peppers with cheese and wrap in bacon for everyone?s favorite poppers, add them to enchiladas, put some diced jalapeno in your famous chili recipe, or make a zesty salsa using fresh jalapeno peppers. You can even add some diced jalapeno peppers and cheese to cornbread batter for a delectable chile cheese cornbread that will have everyone asking for seconds. Lunches and dinners are more scrumptious when fresh Jalapeno Peppers are part of the meal. Also known as Jalapeño, Spicy chili, Filfil har and Mirch around the world.', 'Naturally low in calories Rich in vitamins C, B6, A, and K Stuff jalapeno peppers and wrap in bacon for poppers, add to enchiladas or chili, or make a zesty salsa Approximately 3-5 peppers per .25 lb Versatile and delicious', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ed77cf30-f88d-40cc-933b-f6b2415c3db9.4a2704eabaf798127e7bdae5b5411559.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed77cf30-f88d-40cc-933b-f6b2415c3db9.4a2704eabaf798127e7bdae5b5411559.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ed77cf30-f88d-40cc-933b-f6b2415c3db9.4a2704eabaf798127e7bdae5b5411559.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (919642904, 'Fresh Granny Smith Apples, 3 lb Bag', 5.47, '', 'Treat yourself to Freshness Granny Smith Apples (Manzana Verde). Granny Smith apples are firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor, perfect for use in a variety of dishes morning, noon, and night. Slice them up and cook in a skillet with brown sugar, butter, cloves, and nutmeg for a simple, sweet treat. Mix them with cabbage, grapes, honey, mayonnaise and, celery to make a fresh, apple slaw for a summer cookout. Use them to make a sweet, classic apple pie that your friends and family with love. Create delicious meals and treats with Freshness Guaranteed Granny Smith Apples.', 'Firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor Great for breakfast, lunch, dinner, or dessert Cook in a skillet with butter, brown sugar, and spices; mix with cabbage, grapes, honey, mayonnaise and, celery for apple slaw; or make a classic apple pie Versatile ingredient perfect for both savory and sweet dishes Meets or exceeds U.S. Extra Fancy They have a creamy white flesh with low acidity', 'Unbranded', 'https://i5.walmartimages.com/asr/737c9964-cec4-4154-a2f2-6ebcb94683cb.5fa488f67759a15d60f44660045281df.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/737c9964-cec4-4154-a2f2-6ebcb94683cb.5fa488f67759a15d60f44660045281df.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/737c9964-cec4-4154-a2f2-6ebcb94683cb.5fa488f67759a15d60f44660045281df.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
