INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (926101259, 'Fresh Pink Guava, Each', 3.93, '851502006331', 'Fresh Pink Guava is a tropical fruit known for its sweet, fragrant flavor and vibrant pink interior. With its green outer skin and juicy, rosy flesh, this fruit is both delicious and refreshing. Guava can be enjoyed sliced fresh, blended into smoothies, or used to create jams, juices, and desserts. Packed with natural nutrients, it\'s a wholesome snack that brings a taste of the tropics to your table. Whether eaten on its own or added to recipes, Fresh Pink Guava is a flavorful way to enjoy fresh produce.', 'Fresh Pink Guava, Each Features a green outer skin with pink, juicy flesh Sweet and fragrant tropical flavor Perfect for eating fresh, blending, or cooking Great for smoothies, juices, jams, and desserts Wholesome fruit option with natural nutrients', 'Unbranded', 'https://i5.walmartimages.com/asr/0facf6b8-efd8-451d-8c94-804d4434a7da.263c23026f5432a62c30e50663c1e6c4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0facf6b8-efd8-451d-8c94-804d4434a7da.263c23026f5432a62c30e50663c1e6c4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0facf6b8-efd8-451d-8c94-804d4434a7da.263c23026f5432a62c30e50663c1e6c4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
