INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (927992619, 'Gourmet212 Stuffed Cabbage Leaves 14.11oz., 6 Pack', 62.95, '191822007282', 'You might have loved cabbage. In fact, you might have searched ?cabbage rolls near me? or where can I buy cabbage rolls? on the Internet before; now, you are at the right place to buy some stuffed cabbage leaves. Stuffed cabbage leaves are a very popular dish in Turkey. They can be prepared with both olive oil and ground meat. To be able to offer you a vegan dish, we prefer to make it with olive oil. It is ready to serve so you can open and immediately serve the stuffed cabbage leaves to your guests. Also, you can take it with you to the workplace and enjoy this cheap and healthy meal during your lunch break. You can buy our product in inner peace because of the reasons given below: It is ready to serve It is prepared with extra virgin olive oil It is all natural It is Kosher Certified It is Halal Certified Ingredients: Cabbage 34,6%, Onion 26%, Rice 21,7%, Extra virgin olive oil 5%, Sunflower oil, Tomato paste 3%, Pepper Paste, Spice mix (mint, black pepper, dill, parsley), Salt, Water, Acidity Regulator (Citric acid). Enjoy the healthy stuffed cabbage leaves. Bon appetite!', 'Gourmet212 Stuffed Cabbage Leaves 14.11oz (Pack of 6), Fresh Vegetable Preserved in Airtight Stainless Steel Tin Canned. It is Halal and Kosher Certified. The stuffed cabbage leaves are a dish highly appreciated in Turkey. You can make them with olive oil and minced meat. It is all-natural and prepared with extra virgin olive oil. Ingredients: Rice 21.7%, Cabbage 34,6%, Onion 26%, Extra virgin olive oil 5%, Tomato paste 3%, Sunflower oil, Pepper Paste, Spice mix (mint, black pepper, dill, parsley), Salt, Water, Acidity Regulator (Citric acid).', 'Gourmet212', 'https://i5.walmartimages.com/asr/892924f6-cbfa-4cba-91a0-1b1b383ad826.3b85985f665a08a93c265e6aedd45c5d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/892924f6-cbfa-4cba-91a0-1b1b383ad826.3b85985f665a08a93c265e6aedd45c5d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/892924f6-cbfa-4cba-91a0-1b1b383ad826.3b85985f665a08a93c265e6aedd45c5d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
