INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (928979605, 'Tomato on the Vine, Bag', 1.98, '', 'Keep your recipes simple and classic with fresh tomatoes on the vine. With their vibrant red color, firm and juicy flesh, and unmistakably delicious flavor, this fresh produce item is sure to impress more than just your taste buds. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. The list is endless! Plus, they come right to your kitchen still on the vine that they grew on, meaning that their mouthwatering taste and freshness will be long-lasting for your culinary convenience. Stock up on Walmart\'s Tomatoes On The Vine and keep your dishes looking great and tasting equally as excellent.', 'Tomato on the Vine, Bag: Wholesome, versatile, and delicious Ideal ingredient for a variety of dishes Make a zesty tomato sauce to go along with your favorite pasta Enjoy on their own as a nutritious snack Make a flavorful salsa or add some pop to your guacamole', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (929099565, 'White Salt Potatoes Whole Fresh, 5 lb Bag', 5.24, '077890926918', 'These Fresh Idaho Potatoes are a must-have for any pantry. With so many ways to prepare potatoes, you\'ll want to add them to every meal. For breakfast, you could make crispy hash browns smothered in cheese and diced ham or add them to a savory omelet. For lunch or dinner, you could use these fresh potatoes to make au gratin potatoes, garlic mashed potatoes, or a baked potato loaded with cheese, sour cream, green onions, and bacon bits. If you\'re hosting a neighborhood get-together, you can use them to make creamy potato salad or homestyle French fries. Serve up something delicious when you cook with Fresh Idaho Potatoes.', 'White Salt Potatoes Whole Fresh, 5 lb Bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (929297252, 'Fresh Bartlett Pears, 3 lb Bag', 3.78, '829570305243', 'Savor the sweet taste of Fresh Bartlett Pears. Bartlett Pears are aromatic and have a definitive pear flavor that make them great for breakfast, lunch, dinner, and dessert. Chop the pears up and add them to muffins with walnuts and vanilla for a sweet treat that’s great for breakfast to get your morning started on a high note. Slice them up and top a pizza with prosciutto, goat cheese, and arugula for a mouthwatering meal perfect for a family dinner or dinner party. Cut the pear in half and cook it in a skillet with butter, brown sugar, and vanilla and serve with a scoop of vanilla ice cream for a decadent dessert. Enjoy tasty meals any time of day with Fresh Bartlett Pears.', 'Fresh Bartlett Pears, 3 lb Bag Sweet, crisp, and juicy Excellent snacking pear Make a creamy smoothie or a nutritious juice blend Add to your salad for extra crunch and flavor Adds flavor to a variety of recipes Make pear butter or poached pears Make sweet desserts like pear cobbler, pear crisp or pear tarts', 'Fresh Produce', 'https://i5.walmartimages.com/asr/44bb606a-512b-4168-a56c-d7786ff254db.dee214abc8bfffb8294163c2b428ce57.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/44bb606a-512b-4168-a56c-d7786ff254db.dee214abc8bfffb8294163c2b428ce57.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/44bb606a-512b-4168-a56c-d7786ff254db.dee214abc8bfffb8294163c2b428ce57.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
