INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (931192536, 'Fresh Red Grapes, lb', 4.98, '', 'Treat yourself to the delicious, juicy flavor of Fresh Red (Uvas) Grapes Bag. These grapes are bursting with flavor and are completely seedless. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Fresh Red Grapes.', 'Grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes', 'Dole', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (931337435, 'Mother Earth Products Dehydrated Mushrooms, 2 Full Cup Mylar Bag', 6.61, '810919032593', 'Mother Earth Products Dehydrated Champignon Mushrooms: a healthy & convenient addition to every area of your life without the headache: emergency preparedness, snacking, long and short term storage, traveling, everyday cooking, hiking, backpacking, spicing up your recipes, etc. use it now or later. Mother Earth Products Dehydrated Champignon Mushrooms are made with real, Non-GMO Champignon Mushrooms, no additives or preservatives, & is kosher - a guilt-free, robust food that makes eating tasty & rewarding, without the hassle of weekly trips to the store or the worry of spoiling. It?s so delicious you won?t store it away and hope you never have to use it. Taste the Goodness of Mother Earth Products', '100% champignon mushrooms; spice; good for all recipes, especially soups, stir fry, and pizza; long term storage; short term storage; pantry; portable; convenient; nothing added; emergency preparedness; great flavor; easy to cook with', 'Mother Earth Products', 'https://i5.walmartimages.com/asr/ffabef4d-d373-4746-b62f-00cea74602c9.bacb9cfdcbfd6c3c5943c52bb83196ae.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ffabef4d-d373-4746-b62f-00cea74602c9.bacb9cfdcbfd6c3c5943c52bb83196ae.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ffabef4d-d373-4746-b62f-00cea74602c9.bacb9cfdcbfd6c3c5943c52bb83196ae.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
