INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (948904558, 'Fresh Cocktail Tomato, 1 lb Package', 2.98, '751666613850', 'Holding the ideal balance of sweetness and acidity, it\'s easy to see why Cocktail Tomatoes are called the tomato lover\'s tomato. Cocktail Tomatoes are small in size, making them an ideal choice for appetizers to pair with your everyday meals and for when you\'re entertaining guests. You can combine these tasty little tomatoes with fresh mozzarella and basil drizzled with olive oil or slice them up and add them to a freshly tossed salad. If you\'re feeling something classic, you can always cut one up to add that fresh tomato taste to a sandwich or dice up a few to make a delightful pizza topping. Plus, Cocktail Tomatoes are packed with nutrients, including vitamins A, B6, B12, C, D, E, K, phosphorous, magnesium and zinc, so you can feel good about adding some extra flavor to your meals. Be sure to add Cocktail Tomatoes to your inventory of fresh ingredients today.', 'Cocktail Tomatoes, 16 oz The tomato lover\'s tomato Small size is ideal for salads and appetizers To maintain sweetness, do not refrigerate 16-oz package of fresh, whole Cocktail tomatoes These European-style whole tomatoes are ideal all year long', 'Fresh Produce', 'https://i5.walmartimages.com/asr/522d842b-bea3-446b-9f17-8fd6889a97e4.c6bcf7c8099a0081480129465e3ba397.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/522d842b-bea3-446b-9f17-8fd6889a97e4.c6bcf7c8099a0081480129465e3ba397.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/522d842b-bea3-446b-9f17-8fd6889a97e4.c6bcf7c8099a0081480129465e3ba397.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
