INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (954212028, 'Fresh Snapdragon Apples, 2 lb Bag', 4.97, '863046000126', 'Snapdragon apples are renowned for their extraordinary sweetness, epic flavor, and incredible juiciness, making them the perfect choice for a healthy snack. These apples provide a legendary eating experience and are conveniently sized to fit in lunchboxes or enjoy on the go. Packed with fiber, they offer a nutritious alternative to a second cup of coffee, leaving you satisfied and prepared for any adventure. Developed by Cornell University in Ithaca, NY, and grown by 150 dedicated farmers in New York State, SnapDragon apples guarantee exceptional homegrown quality.', 'Apples, SnapDragon 2-1/4 inch diameter. Monster crunch. SnapDragonApple.com. US extra fancy. Crunchy with a sweet & juicy flavor you will love! Get a Bite of Monster Crunch: Our passion is for growing - and eating - great apples. So when this new delight came along from the renowned breeders at Cornell University 145 New York apple growers fell in love. We\'ve called it SnapDragon, for its snappy monster crunch and spicy-sweet flavor. Chomp a SnapDragon apple whenever you need a feel good energy boost and a sweet treat. For more information and to meet the growers, visit: SnapDragonApple.com. New York State Apple Country. Facebook: crunchtimeapplegrowers. Twitter: crunchtimeapple. Coated with food grade vegetable and or shellac based wax resin to maintain freshness. Grown in New York. Produce of USA.', 'Unbranded', 'https://i5.walmartimages.com/asr/c3909f9b-900a-4aea-963f-02db91550ace.4e34e750fb58e7a55ed07f20a855a97f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c3909f9b-900a-4aea-963f-02db91550ace.4e34e750fb58e7a55ed07f20a855a97f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c3909f9b-900a-4aea-