INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (957113693, 'Gourmet212 Oven Roasted Cherry Tomatoes 8.11oz, 12 Pack', 112.95, '191822004922', 'Have you tried semi dried cherry tomatoes? If your answer is no, you should try our product to not to miss out. Sun dried tomatoes are highly recommended just as semi dried tomatoes if it is not the season of fresh tomatoes, however, oven semi dried tomatoes are closer to natural tomato taste than sun dried tomatoes. The semi dried tomatoes are juicier and lighter in color and are also sliced. They are then put in high quality ovens for 6-7 hours with low temperatures. Dehydrated slowly, semi dried tomatoes preserve their taste in flavored oil for long time without any additives. This product is packed with so high quality that keeps fresh for one year on the shelf without oxygen exposure. Some reasons to buy our semi dried cherry tomatoes: It is Halal Certified It is Kosher Certified It?s made with seasonal tomatoes It?s the perfect product for any meat or chicken dish It?s a delicious ingredient for antipasti, pizza, salad, sandwich and pasta Ingredients: sun dried tomatoes (57%), canola oil, salt, sugar, vinegar, garlic powder, spices, acidity regulator (citric acid), antioxidant (ascorbic acid) If you like cherry tomatoes, you shouldn?t miss this product.', 'Gourmet212 Oven Roasted Cherry Tomatoes 8.11 oz (12 Pack), Stuffed, Airtight Glass Jarred The semi-dried tomatoes are juicier and lighter in color. They are put in high-quality ovens for 6-7 hours with low temperatures. Dehydrated slowly, semi-dried tomatoes preserve their taste in flavored oil for a long time without any additives. It is Halal and Kosher Certified Ingredients: sun-dried tomatoes (57%), canola oil, salt, sugar, vinegar, garlic powder, spices, acidity regulator (citric acid), antioxidant (ascorbic acid).', 'Gourmet212', 'https://i5.walmartimages.com/asr/6a0f8f82-f93a-4624-bc49-7767d339a7d8.ff0982393d9e79b38ff96159da8d8ceb.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6a0f8f82-f93a-4624-bc49-7767d339a7d8.ff0982393d9e79b38ff96159da8d8ceb.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6a0f8f82-f93a-4624-bc49-7767d339a7d8.ff0982393d9e79b38ff96159da8d8ceb.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
