INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (962321127, 'Marketside Fresh Sugar Snap Peas, 16 oz', 5.98, 'deleted_681131221757', 'Add fresh and ready to eat sugar snap peas to your meal with Marketside Sugar Snap Peas. These sugar snap peas are a great source of iron and dietary fiber. Marketside Sugar Snap Peas are a quick and healthy side dish and a great addition to any meal. Marketside Sugar Snap Peas are packed fresh, washed and ready to eat for your convenience. They have a delicious crisp texture and a vibrant green color that is sure to add a pop to all your dishes. Enjoy them as a healthy side or use them in all your favorite recipes. They are a great addition to stir fry and other Asian cuisines. Season them with salt, pepper and butter and serve with grilled chicken breast, grilled squash and bread for a filling dinner. Toss them with fresh cut carrot sticks for a tasty snack at the office. Snacking is made healthy with Marketside Sugar Snap Peas. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Fresh Sugar Snap Peas, 20 oz Washed and ready to eat Great addition to any meal Pieces of snap peas are a healthy snack Packaged in a 20 oz plastic bag', 'Marketside', 'https://i5.walmartimages.com/asr/af5d4f46-6d0e-47ec-8252-3393db4ff537.6efab2818454908624eb17162a3cbdf3.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/af5d4f46-6d0e-47ec-8252-3393db4ff537.6efab2818454908624eb17162a3cbdf3.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/af5d4f46-6d0e-47ec-8252-3393db4