INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (963868963, 'Little Leaf Farms Baby Red and Green Leaf Lettuce Salad Blend, 4 oz Clam Shell, Fresh', 2.98, '857394006114', 'Little Leaf Farms Baby Red & Green Leaf lettuce combines our signature crispy green leaf with a pop of color and texture from our softer red leaf lettuce, making it the perfect addition to any salad or sandwich. Our deliciously crisp, wonderfully fresh, and uniquely long-lasting greens are grown in a state-of-the-art, sustainable greenhouse that harnesses sunlight and fresh rainwater. With an a fully automated, hands-free growing process to seeding to packaging, there’s no need to wash. Just open the container and enjoy!', 'Grown in a greenhouse for consistent quality and freshness year-round. Combines the classic crispness of green leaf lettuce with the vibrant color and softer texture of red leaf lettuce. Perfect for salads, sandwiches, wraps, and as a colorful garnish. Pesticide, Herbicide, and Fungicide Free Non GMO Offers a unique balance of flavors, textures, and colors for visually appealing dishes', 'Little Leaf Farms', 'https://i5.walmartimages.com/asr/0d9ce7e7-0a2e-4f5f-ac70-fdac7e110bd7.645eabc05aaddfb455fb432d4ef4a4a2.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d9ce7e7-0a2e-4f5f-ac70-fdac7e110bd7.645eabc05aaddfb455fb432d4ef4a4a2.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d9ce7e7-0a2e-4f5f-ac70-fdac7e110bd7.645eabc05aaddfb455fb432d4ef4a4a2.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
