INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (965084592, 'Dried Mushroom Kibble by Its Delish, 8 Oz Bag Dark Chilean Dehydrated and Chopped Boletus Luteus Mushrooms for Cooking and Flavoring', 34.99, '799137109266', 'Dried Kibbled Mushrooms by Its Delish Boletus Luteus mushrooms is a wild-grown dark mushroom with a deep and earthy flavor, commonly called the brown or Chilean mushroom, sorted, washed, trimmed, and air-dried. There are a good source of vitamin, minerals and protein. These are 100% all-natural with no added ingredients or preservatives. These chopped mushroom flakes are used in a wide variety of applications for rich-flavored mushroom for including sauces, gravy, soups, vegetable stock, broth and stews, pasta products, meats and sausages, seasoning blends, salad products, pot pies, and casseroles and ready meals. Prep Instruction Ideas: Add these mushrooms while slow cooking soups, stews, sauces, casseroles and other foods with sufficient liquid content. In other applications, hydrate by using 1 part dried mushroom and 5 parts water. Simmer for 10-15 minutes. Add water if necessary. Yields 1 oz equals about 1/2 cup dry. Generally, air dried vegetables double in volume when hydrated. Dry/Fresh Ratio 1 lb of air dried boletus luteus mushrooms, once rehydrated, equals approximately 6 lbs of fresh prepared boletus luteus mushrooms. Storage Suggestion Best if used within 18 months. Store tightly sealed in a dry location away from sunlight. Tip: For ready to use mushrooms, soak the dry mushrooms in a sealed container and store in the refrigerator. Stock up and enjoy! About It\'s Delish! It\'s Delish was established in 1992 and is located in North Hollywood, California. It\'s Delish is a food manufacturer and distributor who produces over 500 gourmet food products including licorice, sour belts, taffies, caramels, Jordan almonds, chocolates, nuts, fruits, trail mixes, spices, and the spice blends. It\'s Delish also produces organics and all-natural products. We give you the opportunity to order from the factory direct!', 'PREMIUM - Gourmet Dried Mushrooms Kibble Similar to Porcini and chopped into small dices VALUE SIZE - Half Pound 8 Oz, about four cups dry Bag by the Its Delish brand ENHANCE your culinary experience with hearty flavor, bold taste and vibrant aroma. Add rich flavors paired with vitamins, minerals and protein to your favorite recipes and dishes AWESOME in sauces, gravy, soups, vegetable stock, broth and stews, pasta products, meats and sausages, seasoning blends, salad products, pot pies, risottos and casseroles and ready meals. QUALITY - Certified Kosher OU Parve, Non-Dairy, Vegan, All-Natural, No MSG, No preservatives, Gluten Free, Packaged in the USA and Shipped to you Direct!', 'It\'s Delish', 'https://i5.walmartimages.com/asr/3dfff43c-9e22-4dc1-836c-5695c1015375.83b92677bde7b4a648328e18edbab474.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3dfff43c-9e22-4dc1-836c-5695c1015375.83b92677bde7b4a648328e18edbab474.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3dfff43c-9e22-4dc1-836c-5695c1015375.83b92677bde7b4a648328e18edbab474.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
