INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (966769640, 'Back to the Roots Organic Tomato \'Red Cherry\', 1 Seed packet', 2.97, '810667031800', 'Our 100% Organic and non-GMO red cherry tomatoes are small in size, brightly red and offer a sweet and juicy taste. These seeds are heirloom-quality, meaning they are open pollinated and passed down without being modified for at least 50-years. Additionally, once you grow your tomatoes, you can harvest the seeds and save them to plant the following year.', 'Annual seeds give rise to indeterminate/vining plants, allowing for harvesting throughout the season Organic USA seeds 100% guaranteed to grow: we\'re on a mission to get America growing, if you are not satisfied or have any issues, just shoot us a note and our dedicated garden support team will make sure we get you growing or send you a refund/replacement, let\'s grow, together #Growonegiveone, help us make gardening a part of every classroom, share a photo of your growing garden and we\'ll donate a grow kit and stem curriculum to an elementary school classroom of your choice', 'Back to the Roots', 'https://i5.walmartimages.com/asr/54e1324f-efe9-44dd-896f-2829d12d6d05.3fdc25c17ffe642dc9e0d39cf2d7df51.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/54e1324f-efe9-44dd-896f-2829d12d6d05.3fdc25c17ffe642dc9e0d39cf2d7df51.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/54e1324f-efe9-44dd-896f-2829d12d6d05.3fdc25c17ffe642dc9e0d39cf2d7df51.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (967450467, 'Fresh Whole Japanese Purple Yam', 1.86, '000000033336', 'Introducing our delectable Japanese Purple Yam, a vibrant, nutrient-rich, and exotic delicacy that will elevate your culinary experience. Grown in the fertile soils , this unique tuber boasts a striking purple hue, velvety texture, and a delightful balance of sweet and earthy flavors. Packed with antioxidants, vitamins, and minerals, the Japanese Purple Yam is not only a feast for the eyes but a powerhouse of health benefits. Whether incorporated into savory dishes, enticing desserts, or enjoyed simply roasted, our Japanese Purple Yams will undoubtedly add an unforgettable touch of elegance and taste to your dining table.', 'Fresh Japanese Purple Yam Introducing our delectable Japanese Purple Yam, a vibrant, nutrient-rich, and exotic delicacy that will elevate your culinary experience. Grown in the fertile soils , this unique tuber boasts a striking purple hue, velvety texture, and a delightful balance of sweet and earthy flavors. Packed with antioxidants, vitamins, and minerals, the Japanese Purple Yam is not only a feast for the eyes but a powerhouse of health benefits. Whether incorporated into savory dishes, enticing desserts, or enjoyed simply roasted, our Japanese Purple Yams will undoubtedly add an unforgettable touch of elegance and taste to your dining table.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/2eb7b9a4-d8aa-473d-9d67-88a9c0b38373.5313774622659e3ac14ebe3bf89931ef.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2eb7b9a4-d8aa-473d-9d67-88a9c0b38373.5313774622659e3ac14ebe3bf89931ef.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2eb7b9a4-d8aa-473d-9d67-88a9c0b38373.5313774622659e3ac14ebe3bf89931ef.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
