INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (968786782, 'Yellow Potatoes Whole Fresh, 5lb Bag', 4.47, 'deleted_688286000084', 'Fresh Yellow Potatoes (Papa Amarilla) are a staple for your kitchen this holiday season. Use yellow potatoes to create a variety of cooked and baked dishes- from creamy, flavorful mashed potatoes, to fluffy, filling baked potatoes topped with cheese, bacon, and sour cream, or cheesy, succulent au gratin potatoes. Make fried potatoes for a hearty holiday breakfast, shred them for hash browns, or use these yellow potatoes to make a pleasing, tummy-warming potato soup to chase away the chill on a cold winter\'s day. Make time-honored family favorite recipes or create new favorites with Yellow Potatoes', '5-pound bag of yellow potatoes Perfect for mashing, frying, baking, soups, and French fries Rich in potassium, vitamin C and iron Cholesterol, fat, and sodium free Versatile, flavorful kitchen staple', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/7241df1c-cbbb-4a39-98e9-266b41cc2c77.5102649422b8d27f97009da4c0dfcc99.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7241df1c-cbbb-4a39-98e9-266b41cc2c77.5102649422b8d27f97009da4c0dfcc99.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7241df1c-cbbb-4a39-98e9-266b41cc2c77.5102649422b8d27f97009da4c0dfcc99.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
