INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (970029152, 'Fresh Navel Orange, LB', 1.37, '406523179498', 'Enjoy the juicy goodness of Fresh Navel Oranges (China Nebo). A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these navel oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Fresh Navel Oranges add flavor to any meal or beverage', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/05a33b9e-e4f0-4b24-8ba0-28dc215544fe.95088f3c9af8ad72e4d74ecfeb07d36e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/05a33b9e-e4f0-4b24-8ba0-28dc215544fe.95088f3c9af8ad72e4d74ecfeb07d36e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/05a33b9e-e4f0-4b24-8ba0-28dc215544fe.95088f3c9af8ad72e4d74ecfeb07d36e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (970068030, 'Fresh Cactus Pears, Each', 0.75, '000000042550', 'Become a part of the prickly pear sensation with our fresh produce Cactus Pears! Slightly sweet and so refreshing, the prickly pear, also known as nopal or higo chumbo, is widely revered for the unique flavor it adds to a variety of beverages and treats. Simply remove the flesh from the studded skin and extract the fruit\'s natural juices to use as a drink mixer, flavoring for confections, or in glazes and marinades. You can also cut the flesh, or the entire cactus pear, skin and all, into slices to add to your morning scrambled eggs, dice it up to throw into a salad, or eat as is for a quick, wholesome snack. Both a fruit and a vegetable, your body is sure to thank you for adding a little Cactus Pear to your diet.', 'Fresh Cactus Pears, Each Spiny fruit harvested from Opuntia cacti Commonly referred to as prickly pear, nopal, Tuna Fruit or higo chumbo Slightly sweet in flavor with a taste similar to watermelon Extracted juice makes a delicious addition to beverages, confections, and glazes Also good for slicing or dicing and adding to salads or eating alone May come in a plastic bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/4ee0f26c-585c-4056-96df-d299d54f20a5.217584c930baa530ac7d5164e76120f0.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4ee0f26c-585c-4056-96df-d299d54f20a5.217584c930baa530ac7d5164e76120f0.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4ee0f26c-585c-4056-96df-d299d54f20a5.217584c930baa530ac7d5164e76120f0.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
