INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (976380053, 'Ginger Root 8oz Bag', 2.48, '883616005184', 'Ginger Root, this extremely versatile root is known for its popularity in Asian and Indian cooking. The Chinese, Japanese, and East Indians use Ginger Root in many forms by grating or grinding them. Fresh Ginger is available in two forms; Young Ginger and Mature Ginger. Young Ginger is very tender and has a milder flavor than its mature counterpart, which has a tough skin that preserves a peppery, slightly sweet-hot flesh underneath. Grown in Jamaica, India, Africa, and China, Ginger is a gnarled and knobby root that has a brown, dry skin and a pale yellow to ivory flesh. Ginger Root serves a variety of usages and is utilized to make confections, baked goods, and even certain liqueurs. Ginger is the flavor of popular beverages like Ginger Ale and Ginger Beer. It is delicious in many savory dishes such as soups, curries, and meats and is indispensable in the making of sweets such as Gingerbread, Gingersnaps, and many spice cookies.', 'Ginger Root • Possesses antioxidant activity that counteracts with molecules that can cause damage in the body • Has antimicrobial properties • Prevents nausea and motion sickness • Helps maintain the body’s detoxification process • Incorporating ginger in your meals along with a good diet may positively support brain health', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/8ee6a2ca-60a2-4d08-b6cb-f2eebc5eefcb.334460ebb8576f34c344068ec3675dbc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8ee6a2ca-60a2-4d08-b6cb-f2eebc5eefcb.334460ebb8576f34c344068ec3675dbc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8ee6a2ca-60a2-4d08-b6cb-f2eebc5eefcb.334460ebb8576f34c344068ec3675dbc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
