r garlic to have choice morsels. Being essential in Turkish cuisine, peppers are used in various ways in Turkish dishes. Ingredients: Red pepper (65%), water, vinegar.', 'Gourmet212', 'https://i5.walmartimages.com/asr/28d190e5-c871-4066-8327-f7515a6b2d5f.bae04826054ae6f64cc837aab091228e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28d190e5-c871-4066-8327-f7515a6b2d5f.bae04826054ae6f64cc837aab091228e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/28d190e5-c871-4066-8327-f7515a6b2d5f.bae04826054ae6f64cc837aab091228e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
