INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (978913343, 'Marketside Organic Spring Mix & Feta Salad with Chicken, 4.75oz', 3.76, '681131221238', 'When you want to enjoy a quick and easy salad, grab one of these Marketside Organic Spring Mix and Feta Salad with Chicken bowls. The Spring Mix and Feta salad bowl includes organic spring mix, chicken meat, Feta cheese, and sweetened dried cranberries, all ready to be tossed in the included basil balsamic dressing. This Spring Mix and Feta Salad with Chicken is ideal for a light lunch or dinner. The convenient single serving bowl is a good source of protein, calcium, iron, and vitamins A and C. The salad is easy to toss in the bowl it comes in., and is an easy favorite to round out any lunch or dinner. Bring home a Marketside Spring Mix and Feta Salad with Chicken tonight.Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Organic Spring Mix and Feta Salad with Chicken, 4.75 oz: Quick and easy salad, ready to toss and eat! Spring mix, chicken meat, Feta cheese, sweetened dried cranberries, and basil balsamic dressing included Ideal for a light lunch or dinner Good source of protein, calcium, iron, and vitamins A and C', 'Marketside', 'https://i5.walmartimages.com/asr/0c9fcc82-7ba5-44c5-97b6-40bb59c54b46_3.27124f4c8eb19d96980db5a947b8fca1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0c9fcc82-7ba5-44c5-97b6-40bb59c54b46_3.27124f4c8eb19d96980db5a947b8fca1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0c9fcc82-7ba5-44c5-97b6