INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (979258270, 'Boomer Gold Potatoes, 1.5 Lb.', 3.44, 'deleted_629307123344', 'Boomer Gold Potatoes, 1.5 Lb.', 'Potatoes, Boomer GoldU.S. No.1 (3/4 in- 1 5/8 in). Fresh. Straight from the farm. Easy pre-washed. Thin skinned. No peeling required. Nutritious. Fat, gluten and cholesterol free. Good source of potassium. Our signature Creamer potato, the Boomer Gold varietal is coveted for its exquisite combination of delicate golden skin, velvety flesh, and naturally butterfly flavor. We have carefully selected every Boomer Gold for consistent sizing to ensure they all cook quickly and evenly whether roasted, boiled, or microwaved. The virtues of being small. 1.855.516.6075. Facebook. Twitter. This bag is not suitable for microwaving. The Little Potato Company is focused on solely on carefully selecting and growing little potatoes that have outstanding flavors, great texture, and better nutrition. It???s all we do. And we harvest our unique, proprietary potato varieties when they???re mature at their best. You can taste the difference! As a mother and businesswoman. I am pleased to bring these little potatoes to you. My father and I grew on our first crop by acre in 1996, sorting, washing, and bagging our first crop by hand. We remain dedicated to bringing back the original, diverse goodness of little potatoes. Our potatoes will have you proclaiming the virtues of being small! Angela. Co-founder and chief potato champion. Product of USA.', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/ce9f8f8a-bb0d-47e7-8a40-cbf5b1567bf3.dce77155402ac9391575a472df95011b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ce9f8f8a-bb0d-47e7-8a40-cbf5b1567bf3.dce77155402ac9391575a472df95011b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ce9f8f8a-bb0d-4