INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (981923194, 'Fresh Navel Oranges, 4 lb Bag', 4.97, '811857021052', 'Fresh Navel Oranges are a good addition to a healthy diet along with other fruit. They\'re oval with a thick, easy-to-remove peel and segments that separate cleanly. Oranges are a fruit that contains vitamin C and other nutrients that can be eaten as is or juiced for a smooth beverage at breakfast. It is suitable for use in all kinds of sweet and savory dishes, from cakes to weeknight chicken dinners. Citric acid fruits like oranges can be stored at room temperature for several days or in the refrigerator for up to two weeks. Available in a 4 lb package, these Fresh Navel Oranges are great for the entire family.', 'Fresh Navel Oranges, 4 lb Bag A good addition to a healthy diet Easy to peel segments Contains vitamin C and other nutrients Can be juiced for a breakfast beverage Suitable for use in all kinds of sweet and savory dishes Store fresh oranges at room temperature or refrigerate', 'Unbranded', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (982649277, 'Fresh Delicata Squash, Each', 0.97, '000000004763', 'Create something wholesome and delicious with Fresh Delicata Squash. These versatile vegetables can be used to make savory sides or sweet treats. Try them dipped in batter and fried for a comforting side or, for a healthier option, you can make a filling squash and chicken chowder, or roast them in the oven stuffed with ground turkey. If you\'re looking for something sweet, you can use squash to make a zesty lemon squash bread, a creamy squash custard pie, or even a squash chocolate loaf. Use your imagination to create something amazing and tasty with this squash. The mouthwatering possibilities are endless with this hearty vegetable. Add something amazing to your meals with Fresh Delicata Squash.', 'Fresh Delicata Squash, Each Wholesome and delicious Ideal ingredient for a variety of dishes Make fried squash, a fresh squash salad, or a hearty autumn squash soup Use to make lemon squash bread and squash custard pie Versatile and hearty', 'Produce', 'https://i5.walmartimages.com/asr/f197139f-5a10-4d75-91fb-bb2b00b05809.a7c9660c98a324bb4e87bedf500d233a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f197139f-5a10-4d75-91fb-bb2b00b05809.a7c9660c98a324bb4e87bedf500d233a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f197139f-5a10-4d75-91fb-bb2b00b05809.a7c9660c98a324bb4e87bedf500d233a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
