INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (983480331, 'Earthbound Farms Fresh Organic Green Beans, 12 oz', 3.77, '032601952815', 'Ready to eat or cook, Earthbound Farms Organic Green Beans are deliciously crispy and organic. These packaged green beans are washed and prepped, ready to be tossed into action in your steamer, saute pan, wok, or casserole. With 30 calories and loads of nutrients per one cup serving, you can have a healthy side dish of fresh produce on the table in no time. To cook organic green beans, you can steam them, saute them in butter or oil, or even toss them in an instant pot very quickly. They are firm enough to stand up well in casseroles (the age-old green bean casserole is a prime example), but they can also be added to Pasta Primavera sauce, minestrone soup, and rice-based casseroles. Cook up something delicious with 12-ounce Earthbound Farms Organic Green Beans.', 'One 12-ounce package of Earthbound Farms Fresh Organic Green Beans contains 4 servings Ready to eat on the go Recipe-ready vegetables Washed and ready to enjoy Fresh organic snack Good source of Vitamin K', 'Earthbound Farm', 'https://i5.walmartimages.com/asr/b529a9c7-2cb9-4611-850d-ab87ada412d8.121f62551a5accaac3c80606ed9ed27f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b529a9c7-2cb9-4611-850d-ab87ada412d8.121f62551a5accaac3c80606ed9ed27f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b529a9c7-2cb9-4611-850d-ab87ada412d8.121f62551a5accaac3c80606ed9ed27f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
