INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (985429713, 'Fresh Candy Apple Without Nuts, Each', 0.98, '034986916277', 'Indulge in the timeless pairing of nuts and sweet with our Candy Caramel Fresh Apple with Nuts. This classic dessert is perfect for anyone who loves a little bit of crunch with their sweet treats. We start with a crisp and juicy apple and dip it into a soft, gooey, and delicious red candy caramel coating. Then, we generously sprinkle on a blend of roasted and chopped nuts, adding the perfect amount of crunch to every bite. Our Candy Caramel Apple with Nuts is not only a delicious treat, but also an ideal party supply that can add a touch of fun and entertain your guests. The combination of candied caramel and nuts has been thrilling customers for years, and continues to be a popular choice for those who want to indulge in something sweet and satisfying. So go ahead and treat yourself to a little bit of sweetness with our Candy Caramel Apple with Nuts, and savor the perfect balance of soft, crunchy, and sweet flavors in every bite.', 'Candy Apple, 1 Pack Crunch Topping The Red Candy Caramel Apple with Crunch is covered with soft, gooey, and delicious Red Candy Caramel. This Caramel brings an ever so slightly candied twist to a traditional fresh Apple, but is just as soft and easy to eat! The Crunch is a proprietary sweet, slightly sweetened cereal based coating that does not contain nuts. Combined with a small batch candied caramel recipe, this timeless pairing of crunch and sweet has been thrilling customers, and frustrating competitors ever since.', 'Unbranded', 'https://i5.walmartimages.com/asr/6a0fd4ac-35b6-4f69-b893-38ddce327fbe.8f87e62639eaabf635c0b7ff63bd24e4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/6a0fd4ac-35b6-4f69-b893-38ddce327fbe.8f87e62639eaabf635c0b7ff63bd24e4.jpeg?odnHei