INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (987238675, 'Fresh Clementines, 2 lb Bag', 5.78, 'deleted_810343021200', 'Enjoy the juicy goodness of citrus when you eat a Fresh Clementine. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, clementines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, clementines are now available year-round in most markets. Clementines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, clementines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Fresh Clementines on hand for an easy, healthy treat.', 'Delicious, sweet, juicy citrus Pleasing sweet-tart flavor Easy to peel and segment Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless You\'ll have plenty for everyone with this 5-pound bag', 'Fresh Produce', 'https://i5.walmartimages.com/asr/5239bd74-c85d-4d08-b8da-c3bc7ef938c8.52a18c9d52147dd9c6402004a243dddd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5239bd74-c85d-4d08-b8da-c3bc7ef938c8.52a18c9d52147dd9c6402004a243dddd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5239bd74-c85d-4d08-b8da-c3bc7ef938c8.52a18c9d52147dd9c6402004a243dddd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (987484376, 'Fresh Farms Better Crunch Lettuce, 12 oz', 2.98, '716519002106', 'Fresh Farms Better Crunch Lettuce is a premium sweet and extra crisp lettuce. It combines the crisp and crunchy bite of iceberg lettuce with the shape, color and nutritional value of a Cos lettuce. This package includes individual leaves that are washed and ready to eat. Use it as the base for your favorite salad, create a delicious lettuce wrap, or top sandwiches and burgers. But it doesn’t stop there! This lettuce is also perfect for grilling and creating lettuce wedges. The possibilities are endless with Fresh Farms Better Crunch Lettuce', 'Premium sweet and extra crisp lettuce Combines the crisp and crunchy bite of iceberg lettuce with the shape, color and nutritional value of a Cos lettuce Includes individual leaves that are washed and ready to eat Great for sandwiches, salads, wedges, wraps, and grilling', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1b341891-9051-4e1b-b008-21b7a0e6563b.9dcb6b23678fea8aa031d96ed3682d00.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1b341891-9051-4e1b-b008-21b7a0e6563b.9dcb6b23678fea8aa031d96ed3682d00.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1b341891-9051-4e1b-b008-21b7a0e6563b.9dcb6b23678fea8aa031d96ed3682d00.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (987536645, 'Tomato on the Vine, Bag', 1.98, 'deleted_768981111114', 'Keep your recipes simple and classic with fresh tomatoes on the vine. With their vibrant red color, firm and juicy flesh, and unmistakably delicious flavor, this fresh produce item is sure to impress more than just your taste buds. You can slice them up to garnish a sandwich or burger for added flavor and texture, dice them up to create a pizza or pasta topping, crush them up to make a decadent bruschetta or sauce, or finely blend them to create your own personalized salsa. The list is endless! Plus, they come right to your kitchen still on the vine that they grew on, meaning that their mouthwatering taste and freshness will be long-lasting for your culinary convenience. Stock up on Walmart\'s Tomatoes On The Vine and keep your dishes looking great and tasting equally as excellent.', 'Tomato on the Vine, Bag: Wholesome, versatile, and delicious Ideal ingredient for a variety of dishes Make a zesty tomato sauce to go along with your favorite pasta Enjoy on their own as a nutritious snack Make a flavorful salsa or add some pop to your guacamole', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1397cd52-8636-48d7-90a7-3c15d4c3967c.7544db07683e1eed49dbd813de13e291.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
