INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (994998279, 'Mango', 0.98, '840437101587', 'Savor the irresistible taste of a fresh Mango. Mangoes are an excellent fruit to add to your breakfast, lunch, dinner, or dessert. For breakfast, you can chop the mango up and add it to yogurt or a smoothie for a sweet treat that\'s sure to get your morning started on a high note. For dessert, you could use a mango to make a refreshing sorbet or put a tropical twist on a cobbler. You can also use it to make creamy milkshakes or delicious juices that everyone is sure to enjoy. The culinary possibilities are endless when you keep your kitchen stocked with fresh Mangoes.', 'Irresistibly sweet and juicy Delicious on its own or in a variety of recipes Make a creamy milkshake or a nutritious juice blend Add to yogurt or a smoothie Use to top your salad for a tropical twist', 'Unbranded', 'https://i5.walmartimages.com/asr/cc54242f-cb87-4a25-9baa-fccaa20f5443.64fa79325ad44a7352dcd3c2a8b477be.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc54242f-cb87-4a25-9baa-fccaa20f5443.64fa79325ad44a7352dcd3c2a8b477be.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc54242f-cb87-4a25-9baa-fccaa20f5443.64fa79325ad44a7352dcd3c2a8b477be.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
