INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (995451931, 'Grape Multi Pack', 4.88, '030223030201', 'Introducing the Grape Multi Pack, a selection of nature\'s finest grapes in one convenient package. Our carefully curated assortment features a variety of colors and flavors, from juicy reds to sweet greens and plump black grapes. This versatile and nutritious snack is perfect for on-the-go enjoyment, lunchboxes, or as a delightful addition to your favorite recipes. Savor the taste of quality and freshness with the Grape Multi Pack, your go-to source for delicious, premium grapes.', 'Grape Multi Pack Introducing the Whole Grape Multi Pack, a selection of nature\'s finest grapes in one convenient package. Our carefully curated assortment features a variety of colors and flavors, from juicy reds to sweet greens and plump black grapes. This versatile and nutritious snack is perfect for on-the-go enjoyment, lunchboxes, or as a delightful addition to your favorite recipes. Savor the taste of quality and freshness with the Grape Multi Pack, your go-to source for delicious, premium grapes. Made with Organic Ingredients.', 'Unbranded', 'https://i5.walmartimages.com/asr/20a46e7f-7126-4e47-aa4e-e1137289cbcb.79d1170b3b21fc8bf50a33b8d723abee.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/20a46e7f-7126-4e47-aa4e-e1137289cbcb.79d1170b3b21fc8bf50a33b8d723abee.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/20a46e7f-7126-4e47-aa4e-e1137289cbcb.79d1170b3b21fc8bf50a33b8d723abee.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
