INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (999977230, 'Fresh Sierra Honey Plums, 1 lb', 4.67, '847081000952', 'Elevate your day with the luscious Sierra Honey Plums, 1 lb. Fruit serves as a nutritious snack and a vital component of a wholesome diet for most individuals. It offers fiber, essential vitamins, and minerals. Sierra Honey Plums are no exception, providing vitamin A and other nutrients. Each bite of these plums is delightfully sweet and delectable. Savor one on its own or incorporate it into salads and various recipes. Honey Plums boast a distinctive flavor and a succulent, yet tender texture. Approximately five to seven plums are included per pound pack. Indulge in the irresistible taste of Sierra Honey Plums.', 'Plums, 1 lb Extra sweet and juicy Late season variety Delicious as a snack Excellent ingredient for salads Approximately 5-7 plums per 1 lb pack', 'Fresh Produce', 'https://i5.walmartimages.com/asr/ddc9d80b-3646-4a02-9f9d-81baea8d086a_1.fe9313b8f7907ee770316dc5dbc5c265.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ddc9d80b-3646-4a02-9f9d-81baea8d086a_1.fe9313b8f7907ee770316dc5dbc5c265.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ddc9d80b-3646-4a02-9f9d-81baea8d086a_1.fe9313b8f7907ee770316dc5dbc5c265.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
