INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1026430265, 'Taylor Farms Berry Blend 14oz', 6.97, '030223038306', 'Taylor Farms Mixed Berries, 14 oz, is a vibrant and refreshing blend of fresh strawberries and blueberries—perfectly packed for snacking, topping, or mixing into your favorite meals. Hand-selected for ripeness and flavor, each berry bursts with natural sweetness and juicy texture. Whether you\'re looking to start your day with a nutritious breakfast or need a light, satisfying afternoon snack, this berry mix delivers delicious versatility and a dose of antioxidants. Add it to yogurt, cereal, smoothies, or simply enjoy it on its own. With no added sugars or preservatives, you’re getting nothing but pure fruit goodness. Strawberries and blueberries are both naturally high in Vitamin C, and the mix is low in calories and fat, making it a health-conscious choice you can feel good about. Conveniently packaged in a resealable plastic container to maintain freshness and easy storage in the fridge. This product contains no major allergens and is Dairy-free.', 'Taylor Farms Mixed Berries Strawberry & Blueberry, 14oz Tray (Fresh) Fresh-cut blend of strawberries and blueberries Naturally high in Vitamin C and low in fat', 'Taylor Farms', 'https://i5.walmartimages.com/asr/a20b278b-05cb-4ce2-8a43-f49bc587edb4.0dad52d373e7f2fbf81ebee43d511af8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a20b278b-05cb-4ce2-8a43-f49bc587edb4.0dad52d373e7f2fbf81ebee43d511af8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a20b278b-05cb-4ce2-8a43-f49bc587edb4.0dad52d373e7f2fbf81ebee43d511af8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
