INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1042137375, 'Fresh Valencia Oranges, 1 Each', 0.83, '036515340133', 'Known for their sweet flavor, Valencia Oranges have a thin skin and are typically very juicy. It is the most popular orange for juicing. It\'s juice will remain perfectly sweet even after air exposure. With a balanced sweet-to-tart flavor ratio that carries over to their juice, Valencia Oranges are widely available during the spring and summer months. Use Valencia oranges to make fresh orange juice, or use their flesh, juice, and zest in baked goods, cocktails, sauces, and marinades. Keep some sunshine on hand with Valencia Oranges. Available by the each.', 'Fresh Valencia oranges Thin skin and very juicy Most popular orange for juicing Balanced sweet-to-tart flavor ratio Widely available during the spring and summer months Use their flesh, juice, and zest in baked goods, cocktails, sauces, and marinades', 'Fresh Produce', 'https://i5.walmartimages.com/asr/a6054c7f-7e7b-4de8-9f04-1f87bafa4c3e.76cf34255799375020421060def8bb2e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6054c7f-7e7b-4de8-9f04-1f87bafa4c3e.76cf34255799375020421060def8bb2e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6054c7f-7e7b-4de8-9f04-1f87bafa4c3e.76cf34255799375020421060def8bb2e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1049977058, 'Del Monte No Sugar Added Citrus Salad with Grapefruit and Orange, 52 oz Jar', 8.97, '024000258148', 'Del Monte No Sugar Added Citrus Salad, 52 oz Jar makes it easy to enjoy high quality fruit in minutes. Enjoy the perfect balance of sweet and tart in our citrus medley, which includes Vitamin-C packed red grapefruit, white grapefruit and orange slices with no added sugar. Refreshingly chilled, Del Monte Citrus Salad is picked at the peak of ripeness and hand-cut for your convenience. Picked and packed at the peak of freshness, the jarred fruit slices are ideal as part of a quick lunch snack or as a flavorful addition to fruit cocktail. Each jar is easy to open, reseal, and store for a convenient fruit snack whenever you need delicious fruit on-the-go. Bring wholesome goodness to your family with Del Monte!', 'One 52 oz jar of Del Monte No Sugar Added Citrus Salad Del Monte No Sugar Added Citrus Salad offers a quick and easy way to have a citrus fruit snack in just minutes Made with red grapefruit, white grapefruit and orange slices picked at the peak of freshness and immersed in sweetened water Del Monte No Sugar Added Citrus Salad is ideal for fruit cocktail or salads Bring wholesome goodness to your family with Del Monte No Sugar Added Citrus Salad', 'Del Monte', 'https://i5.walmartimages.com/asr/8a01b7a2-c891-492c-ad94-2734be27b796.0333d5240da848684c19d98af383570d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8a01b7a2-c891-492c-ad94-2734be27b796.0333d5240da848684c19d98af383570d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8a01b7a2-c891-492c-ad94-2734be27b796.0333d5240da848684c19d98af383570d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1061983099, 'OS SEEDLESS GREEN GRAPES 6/3LBS', 55, '066022002378', 'Whether round or oval, red, green, or black, a platter of freshly rinsed grapes offers the perfect opportunity to pluck, pop, and savor. They bring luscious color to charcuterie boards and are the perfect complement to sharp cheeses with their crisp texture and palate-cleansing, sweet taste. Ocean Spray® fresh grapes are passionately grown and hand-picked to come straight from the farm to your family.', 'Whether round or oval, red, green, or black, a platter of freshly rinsed grapes offers the perfect opportunity to pluck, pop, and savor. They bring luscious color to charcuterie boards and are the perfect complement to sharp cheeses with their crisp texture and palate-cleansing, sweet taste. Ocean Spray® fresh grapes are passionately grown and hand-picked to come straight from the farm to your family.', 'Ocean Spray', 'https://i5.walmartimages.com/asr/d97e6cfc-0b5a-4783-af55-6ffbec5f8635.a7d4dcd96bbe69eebdb59a5f3c4d9cf0.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d97e6cfc-0b5a-4783-af55-6ffbec5f8635.a7d4dcd96bbe69eebdb59a5f3c4d9cf0.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d97e6cfc-0b5a-4783-af55-6ffbec5f8635.a7d4dcd96bbe69eebdb59a5f3c4d9cf0.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1064046885, 'Fresh Navel Oranges, 8 lb Bag', 8.94, 'deleted_605049623175', 'Enjoy the juicy goodness of these Large Bagged Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, these Large Bagged Oranges will add flavor to any meal or beverage.', 'A good addition to a healthy diet Easy to peel segments Contains vitamin C and other nutrients Can be juiced for a breakfast beverage Suitable for use in all kinds of sweet and savory dishes Store fresh oranges at room temperature or refrigerate', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/96fc49a5-e281-4329-8a19-8da6dd59fb9f.182dd7b4be8635bae8fefed18a8eefd1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/96fc49a5-e281-4329-8a19-8da6dd59fb9f.182dd7b4be8635bae8fefed18a8eefd1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/96fc49a5-e281-4329-8a19-8da6dd59fb9f.182dd7b4be8635bae8fefed18a8eefd1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1064764886, 'Clementines, 3lb Bag', 4.97, '033383103167', 'Enjoy the juicy goodness of citrus when you eat a Clementine. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Among the smallest fruits in the orange family, clementines have a pleasing sweet-tart flavor and are typically seedless. Generally a winter fruit, clementines are now available year-round in most markets. Clementines are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, clementines are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious Clementines on hand for an easy, healthy treat.', 'Delicious, sweet, juicy citrus Pleasing sweet-tart flavor Easy to peel and segment Excellent source of vitamin C, potassium, and folic acid For maximum flavor, do not refrigerate Typically seedless', 'Fresh Produce', 'https://i5.walmartimages.com/asr/33ea1138-975e-47a4-81ff-62d88546df67.419bf6bc44206b42dccd3becbd04f4a4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/33ea1138-975e-47a4-81ff-62d88546df67.419bf6bc44206b42dccd3becbd04f4a4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/33ea1138-975e-47a4-81ff-62d88546df67.419bf6bc44206b42dccd3becbd04f4a4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1086250163, 'Taylor Farms Fresh Ready to Eat Grapes, 10 oz Tray', 3.47, '030223038191', 'Treat yourself to the delicious, juicy flavor of Fresh Red Seedless Grapes. These grapes are bursting with flavor and are completely seedless. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks.', 'Fresh Red Seedless Grapes Seedless grapes that are bursting with delicious flavor Enjoy a handful as a fresh snack any time of day Pair with your favorite meats and cheeses for a charcuterie appetizer Great for using in fruit salad Freeze and use as fun ice cubes', 'Taylor Farms', 'https://i5.walmartimages.com/asr/a882a702-0240-474e-a825-0dce31e60512.441b50947b8ae65532bbccb3fdee1258.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a882a702-0240-474e-a825-0dce31e60512.441b50947b8ae65532bbccb3fdee1258.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a882a702-0240-474e-a825-0dce31e60512.441b50947b8ae65532bbccb3fdee1258.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1106481646, 'Welchs Red Delicious Fresh Apple, 3lb Bag', 5.97, '095829211324', 'Treat yourself to the delicious, sweet taste of Red Delicious Apples. These apples are known for their classic sweet flavor with mild acidity and creamy white flesh with low acidity. Crisp and juicy, these apples have higher levels of antioxidants due to the rich, deep red skin. Enjoy one with breakfast or lunch or as a fresh snack any time of day. An excellent snacking or juicing apple, the Red Delicious is an excellent addition to green, fruit, and chopped salads, or an unexpected twist to sandwiches, quesadillas, or burgers. You can even pair them with sharp cheeses and crackers to create a stunning appetizer cheese board to share with guests', 'Sweet, crisp, and juicy Creamy white flesh with low acidity Excellent snacking apple Higher antioxidants due to the rich, deep red skin Make a creamy smoothie or a nutritious juice blend Serve with your pancake breakfast Adds flavor to a variety of recipes Make apple butter or applesauce Make sweet desserts like apple cobbler, apple crisp, and apple pie', 'Welch\'s', 'https://i5.walmartimages.com/asr/32f0433e-70bd-4ceb-8bd7-28f615589881.b5b83a9a712a0f2a4c09950d9de5e087.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/32f0433e-70bd-4ceb-8bd7-28f615589881.b5b83a9a712a0f2a4c09950d9de5e087.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/32f0433e-70bd-4ceb-8bd7-28f615589881.b5b83a9a712a0f2a4c09950d9de5e087.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
