INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1165865931, 'Fresh Honeycrisp Apple, 2lb', 5.87, '095829211553', 'Treat yourself to the delicious, crisp taste of Honeycrisp Apples. These medium-to-large apples are known for their light green and yellow background covered with a red-orange flush and a strong hint of pink, and a honey-sweet, tart flavor. Enjoy one with breakfast or lunch or as a fresh snack any time of day. Best of all, these delicious apples hold up well when cooked and can be used in both savory and sweet dishes. They can be used for baking, snacking, salads, pairing, or made into a delicious sauce that pairs perfectly with pork. Try incorporating them into soups and compotes or using to make yummy jam or juice. Use them to create apple crisp, pie and strudel for a sweet treat. You can even pair them with sharp cheeses and crackers to create a stunning appetizer cheese board to share with guests. The possibilities are endless with Honeycrisp Apples.', 'Fresh, light green and yellow background covered with a red-orange flush and a strong hint of pink Honey-sweet, tart flavor with a sugar hint Cross of Macoun apple and honey gold apple Good for baking and applesauce Can be enjoyed fresh or cooked into both savory and sweet dishes', 'Welch\'s', 'https://i5.walmartimages.com/asr/3321ed9d-e8d0-43e0-9c16-102054998725.88a05ca32f0899ab2ce41addcb7d399c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3321ed9d-e8d0-43e0-9c16-102054998725.88a05ca32f0899ab2ce41addcb7d399c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3321ed9d-e8d0-43e0-9c16-102054998725.88a05ca32f0899ab2ce41addcb7d399c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
