INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1263871290, 'Del Monte No Sugar Added Red Grapefruit, 52 oz Jar', 8.97, '024000258155', 'Del Monte No Sugar Added Red Grapefruit, 52 oz Jar makes it easy to enjoy high quality fruit in minutes. Red Grapefruit is packed with delicious, ripe grapefruit slices in sweet water for a ready to eat fruit snack you can feel good about. Del Monte No Sugar Added Red Grapefruit offers a good source of Vitamin C, has 50% less sugar and 30% fewer calories than Grapefruit in Extra Light Syrup, making them a convenient, wholesome and ready to eat citrus fruit option for busy nights. Picked and packed at the peak of freshness, peeled and sectioned, and immersed in sweetened water,* the jarred fruit slices are ideal as part of a quick lunch snack or as a flavorful addition to fruit cocktail. Each jar is easy to open, reseal, and store for a convenient fruit snack whenever you need delicious fruit on-the-go. Bring wholesome goodness to your family with Del Monte!', 'One 52 oz jar of Del Monte No Sugar Added Red Grapefruit Del Monte No Sugar Added Red Grapefruit offers a quick and easy way to have a citrus fruit snack in just minutes Made with red grapefruit picked at the peak of freshness and immersed in sweet water Del Monte No Sugar Added Red Grapefruit is ideal for fruit cocktail Bring wholesome goodness to your family with Del Monte No Sugar Added Red Grapefruit', 'Del Monte', 'https://i5.walmartimages.com/asr/a6bfce45-3005-43f1-8803-a2696e67034e.809ef532f8583c5f6056a38c8cb4ecfb.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6bfce45-3005-43f1-8803-a2696e67034e.809ef532f8583c5f6056a38c8cb4ecfb.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6bfce45-3005-43f1-8803-a2696e67034e.809ef532f8583c5f6056a38c8cb4ecfb.jpeg?odnHeight=450&odnWidth=450&odnBg