INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1265941554, 'Fresh Yellow Mango, Bag', 2.88, '853516005270', 'Treat yourself to a burst of tropical goodness when you bring home a bag of Yellow Honey Mangos. Mangoes boast a deliciously sweet fragrance and juicy flavor that is sure to wake up your taste buds. They are packed with over 20 vitamins and minerals including A and C, making them not only scrumptious but also a healthy treat. They can be used for everything from salads and smoothies to fresh salsas and luscious desserts. For the best experience, these mangos should be cut in half, sliced while in the peel and then scooped out. Bring home a bag of Yellow Honey Mangos today.', 'Deliciously fresh, sweet and juicy. Packed with sweet tropical flavor. Makes a healthy snack.', 'Fresh Produce', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1267241868, 'Freshness Guaranteed Fresh Pineapple Rings', 5.97, '194346097166', 'Enjoy the sweet, tropical flavor of Freshness Guaranteed Pineapple Rings. These pre-cut chunks are great for breakfast, lunch, dessert, or when you want a snack. Pineapple is a good source of vitamin C, vitamin A and vitamin B6 making them an excellent healthy treat. You can eat the rings right out of the container, infuse them with water and mint for a refreshing drink, use them to make a decadent pineapple upside down cake, or chop them up and make a mouthwatering pineapple salsa with jalapenos, tomatoes, and red onion. There’s plenty for sharing with friends and family or keeping it for yourself, and it comes in a reclosable container to help maintain freshness. Bring home Freshness Guaranteed Pineapple Rings today for a refreshing, healthy treat. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Fresh Pineapple Rings Sweet, refreshing treat Great for breakfast, lunch, dessert, or when you want a snack Good source of vitamin C, vitamin A, and vitamin B6 Enjoy right out of the container, infuse with water and mint, or mix with jalapenos, tomatoes, and red onion for salsa Share with friends and family or keep for yourself Comes in a re-closable container to help maintain freshness', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/1a5299b2-5911-4f32-ac18-29f48e9aab82.0527a7cfaffd130c0d22468bb1351534.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1a5299b2-5911-4f32-ac18-29f48e9aab82.0527a7cfaffd130c0d22468bb1351534.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https