INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1337423463, 'Welchs Granny Smith Fresh Apple, 3lb Bag', 5.97, '095829211348', 'Treat yourself to Welch Granny Smith Apples. Granny Smith apples are firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor, perfect for use in a variety of dishes morning, noon, and night. Slice them up and cook in a skillet with brown sugar, butter, cloves, and nutmeg for a simple, sweet treat. Mix them with cabbage, grapes, honey, mayonnaise and, celery to make a fresh, apple slaw for a summer cookout. Use them to make a sweet, classic apple pie that your friends and family with love.', 'Firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor Great for breakfast, lunch, dinner, or dessert Cook in a skillet with butter, brown sugar, and spices; mix with cabbage, grapes, honey, mayonnaise and, celery for apple slaw; or make a classic apple pie Versatile ingredient perfect for both savory and sweet dishes', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/f134bdf1-e64e-4088-ab87-bc0fca64add5.3fe6af3369948d447cc0a561a0fce7dc.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f134bdf1-e64e-4088-ab87-bc0fca64add5.3fe6af3369948d447cc0a561a0fce7dc.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f134bdf1-e64e-4088-ab87-bc0fca64add5.3fe6af3369948d447cc0a561a0fce7dc.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
