INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1391361284, 'Fieldpack Unbranded Papaya', 1.24, '', 'Get flavor and nutrition with our Fresh Papaya. Papaya is a tropical fruit that originated in the tropics of the Americas and is known to be a great source of vitamins C, A, fiber, and antioxidants. When ripe, this fruit has a butter-like texture with a fairly sweet flavor similar to cantaloupe and can be eaten raw, without skin or seeds. Papaya can be prepared in a variety of ways; you can mix them with grapefruit and avocado for a bright summer salad, add them to a zesty salsa for some sweetness, freeze them and turn them into refreshing popsicle spears, or bake them in the oven with a melted brown sugar mixture. The sky\'s the limit! Get ready for a taste-bud party with Fresh Papaya.', 'Creamy, butter-like flavor when ripe Rich in vitamins A, C, fiber, and antioxidants Fairly sweet flavor like cantaloupe and mango Great addition to smoothies, salads, salsa, and more Delicious and nutritious', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1394735690, 'Seedless Watermelon Bin', 317.65, 'deleted_860036002207', 'Seedless watermelon is a delicious, sweet fruit. Watermelon is perfect for healthy snacking, fun gatherings, and feeding large families. A summertime favorite that is dense in nutrients and packs delicious, juicy flavor. Watermelon is especially tasty when served cold, and enjoys a long shelf life. . Enjoy watermelon on its own, or try it in salads, desserts, and more. Its red, sweet fruit is enjoyable at picnics or simply out of a bowl in your own home. Try a fresh watermelon today!', 'Seedless Watermelon, 1 Each Sweet Juicy Fresh Dense in nutrients Perfect for families or large gatherings Healthy snack Long shelf life', 'Optima', 'https://i5.walmartimages.com/asr/d2e7598b-13ec-4dd8-86f5-f31ac3dfec9e.d31fe27ba791a600950a5c23d83b80f1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d2e7598b-13ec-4dd8-86f5-f31ac3dfec9e.d31fe27ba791a600950a5c23d83b80f1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d2e7598b-13ec-4dd8-86f5-f31ac3dfec9e.d31fe27ba791a600950a5c23d83b80f1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
