INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1480742816, 'Driscoll\'s Fresh Mixed Berry Rainbow Pack, 7 oz. Container', 5.98, '715756500185', 'Indulge in the sweet and tangy taste of freshness with this irresistible mix of juicy blueberries, luscious blackberries, and plump raspberries. Our carefully selected berries are packed in a convenient clamshell container, perfect for snacking on the go or adding a burst of flavor to your favorite recipes. The berries in our Rainbow Pack are freshly picked and carefully handled to ensure maximum flavor and nutrition. With no added sugars or preservatives, you can enjoy these berries guilt-free. Plus, they\'re an excellent source of antioxidants, fiber, and vitamins to support a healthy lifestyle. Whether you\'re looking for a quick breakfast boost, a midday snack, or a delicious addition to your favorite salads, smoothies, or yogurt parfaits, our Rainbow Pack clamshell has got you covered. So go ahead, treat yourself to a taste of paradise with every bite!', 'Are you ready to experience the vibrant taste and health benefits of Fresh Berries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Berries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blueberries, blackberries and raspberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day.', 'Driscoll\'s, Inc.', 'https://i5.walmartimages.com/asr/7814d58b-31cc-4f6f-94ad-0780c97f02b7.1da19af803b3f810e1343c6ce51c995a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7814d58b-31cc-4f6f-94ad-0780c97f02b7.1da19af803b3f810e1343c6ce51c995a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/7814d58b-31cc-4f6f-94ad-0780c97f02b7.1da19af803b3f810e1343c6ce51c995a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1487358163, 'Fresh Organic Blueberries, 18 oz Container', 7.56, '812049009605', 'Fresh Blueberries are a delightful and nutritious treat that brings a burst of flavor to any dish. These plump and juicy berries are picked at the peak of freshness, ensuring a sweet and tangy taste that is hard to resist. Perfect for snacking, baking, or adding to your favorite recipes, these blueberries are a versatile fruit that can be enjoyed in countless ways. Whether you sprinkle them on top of your morning cereal, blend them into a smoothie, or bake them into a delicious pie, Fresh Blueberries are sure to satisfy your cravings for a healthy and delicious snack.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blueberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blueberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blueberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these blue gems into your baking endeavors, whether it\'s muffins, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blueberries delicious, but they also offer an array of health benefits. Loaded with antioxidants, vitamins, and dietary fiber, blueberries are known to promote heart health, support brain function, and boost the immune system. They are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blueberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blueberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/57ef4ede-61ce-40f5-a4fa-950ffe107d57.42b40429fe4f42dbb6af6a4486ca135d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/57ef4ede-61ce-40f5-a4fa-950ffe107d57.42b40429fe4f42dbb6af6a4486ca135d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/57ef4ede-61ce-40f5-a4fa-950ffe107d57.42b40429fe4f42dbb6af6a4486ca135d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1532424484, 'Fresh White Nectarines, 2 lb Bag', 4.48, '810248031878', 'Discover the delightful sweetness of these Fresh White Nectarines. Enjoy them on their own as a sweet snack or use them in a variety of recipes. For breakfast, you could slice them to put into your oatmeal or use them to make a delicious yogurt parfait. You can also use these fresh nectarines in several baking recipes including a comforting crisp topped with ice cream, a tasty upside-down cake, or a scrumptious tart. You can even use them to make a jam or a smooth sorbet. However you choose to use them, their sweet flavor will bring a smile to everyone\'s face. Treat the family to the irresistible taste of Fresh White Nectarines.', 'Fresh White Nectarines, 2lb Bag Slice as a sweet topping for waffles or pancakes Add to iced tea to create a refreshing summertime flavor Use in a variety of baking recipes Make a tasty jam or a smooth sorbet Enjoy on their own as a satisfying snack', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e4ece64c-b28b-4c34-a1c0-b4876e0a3760.d541c68c2edd514e5d0a099bc88bdd19.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4ece64c-b28b-4c34-a1c0-b4876e0a3760.d541c68c2edd514e5d0a099bc88bdd19.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4ece64c-b28b-4c34-a1c0-b4876e0a3760.d541c68c2edd514e5d0a099bc88bdd19.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1567276662, 'Fresh Red Kiwi, 1 lb Package', 5, '014668530014', 'Savor the irresistible taste of Fresh Red Kiwi. Enjoy this tasty kiwi on its own as a healthy snack or incorporate it into a variety of delicious recipes. For breakfast, you can make a sweet fruit bowl with sliced kiwi, strawberries, pineapple, and cantaloupe. For an extra special treat, top with a dollop of whipped cream. Cut it into small pieces and put it in a fresh salad along with chicken, cucumbers, tomatoes, and a light dressing. You can even use kiwi to make a sweet sorbet or scrumptious muffins. Enjoy the sweet and juicy taste of Fresh Red Kiwi.', 'Fresh Red Kiwi, 1 lb Package Flavorful addition to many recipes Enjoy on its own or add to a mixed fruit salad Add to your fresh garden salad Get creative and make a refreshing sorbet Explore all the delicious ways to add fresh kiwi to your favorite recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/bf8797ca-1c58-49d0-a318-e1ce2ca09e38.b180bb1eb433e4e63fb27da156ad1ad4.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bf8797ca-1c58-49d0-a318-e1ce2ca09e38.b180bb1eb433e4e63fb27da156ad1ad4.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/bf8797ca-1c58-49d0-a318-e1ce2ca09e38.b180bb1eb433e4e63fb27da156ad1ad4.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1572264967, 'Sweet Gourmet Fresh Bosc Pear, 2lbs Bag', 4.97, '847473004155', 'Discover the Fresh Bosc Pear - a premium produce with a sweet and juicy taste, distinctive elongated shape, and brownish-golden skin. Perfect for snacking, cooking, and baking, this versatile fruit holds up well under heat and adds a touch of sweetness to your dishes in theri 2 Lb Bag presentation. Rich in essential vitamins and minerals, the Bosc pear is a nutritious and healthy addition to your fruit basket. Order now and indulge in the goodness of this delicious fruit.', 'Indulge in the sweet and juicy flavor of our Sweet Gourmet Bosc Pears! Hand-selected for their irresistible taste and exceptional quality, these pears are perfect for snacking, baking, or adding to your favorite salads Each 2lb bag is filled with premium pears that are carefully harvested at peak ripeness to ensure maximum sweetness and flavor. With their soft, buttery texture and delicate skin, these pears are a true gourmet delight. Plus, they\'re packed with essential nutrients and antioxidants, making them a healthy and delicious choice for any time of day. Whether you\'re enjoying them as a snack or using them in your favorite recipes, our Sweet Gourmet Bosc Pears are sure to satisfy your sweet tooth and elevate your culinary creations. Don\'t miss out on this delectable and healthy treat - order yours today!', 'Sweet Gourmet', 'https://i5.walmartimages.com/asr/3866b95c-bb90-4016-b3e6-098cce8edda2.d8d4ba6c1612a33bdea814be6077e6c5.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3866b95c-bb90-4016-b3e6-098cce8edda2.d8d4ba6c1612a33bdea814be6077e6c5.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3866b95c-bb90-4016-b3e6-098cce8edda2.d8d4ba6c1612a33bdea814be6077e6c5.jpeg?odnHeight=450&