INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1599172053, 'Fresh Valencia Oranges, 1 Each', 0.97, 'deleted_000000040136', 'Known for their sweet flavor, Valencia Oranges have a thin skin and are typically very juicy. It is the most popular orange for juicing. It\'s juice will remain perfectly sweet even after air exposure. With a balanced sweet-to-tart flavor ratio that carries over to their juice, Valencia Oranges are widely available during the spring and summer months. Use Valencia oranges to make fresh orange juice, or use their flesh, juice, and zest in baked goods, cocktails, sauces, and marinades. Keep some sunshine on hand with Valencia Oranges. Available by the each.', 'Valencia Oranges Small in size, bursting in flavor Sweet and tangy Typically more difficult to peel than navel Typically more juicier than a navel Available by the each', 'Fresh Produce', 'https://i5.walmartimages.com/asr/383d6fe9-8325-4619-a4eb-af17f924bd38.bba0fcace8118f8889d6846da04fb9dd.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/383d6fe9-8325-4619-a4eb-af17f924bd38.bba0fcace8118f8889d6846da04fb9dd.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/383d6fe9-8325-4619-a4eb-af17f924bd38.bba0fcace8118f8889d6846da04fb9dd.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
