INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1638069540, 'Superfresh Kids Fuji Apples, 2lb', 4.97, '883391000039', 'There is an inherent spicy-savory flavor to these Fuji Apples that makes them an all-around favorite for both fresh and cooked uses. It is perhaps natural that this apple, with its Japanese heritage, would pair well with Asian flavors such as cilantro, chili pepper, rice vinegar and sesame. This is a wine-friendly apple, making it a good choice for recipes served as an appetizer or main course accompanied by wine. It pairs particularly well with Riesling, Chianti, Merlot and Pinot Noir wines.', 'Super sweet Fresh and sophisticated flavor Hints of spice and savory earth character Juicy and aromatic Healthy snack', 'Superfresh Kids', 'https://i5.walmartimages.com/asr/a6b0c885-1e17-4e40-b422-94e049649e49.160bff1b1d9038e51f7a76f259eaecf2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6b0c885-1e17-4e40-b422-94e049649e49.160bff1b1d9038e51f7a76f259eaecf2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a6b0c885-1e17-4e40-b422-94e049649e49.160bff1b1d9038e51f7a76f259eaecf2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
