INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1677195107, 'Fresh Navel Oranges, 4 lb Bag', 8.98, '014668120017', 'Fresh Navel Oranges are a good addition to a healthy diet along with other fruit. They\'re oval with a thick, easy-to-remove peel and segments that separate cleanly. Oranges are a fruit that contains vitamin C and other nutrients that can be eaten as is or juiced for a smooth beverage at breakfast. It is suitable for use in all kinds of sweet and savory dishes, from cakes to weeknight chicken dinners. Citric acid fruits like oranges can be stored at room temperature for several days or in the refrigerator for up to two weeks. Available in a 4 lb package, these Fresh Navel Oranges are great for the entire family.', 'Fresh Navel Oranges, 4 lb Bag A good addition to a healthy diet Easy to peel segments Contains vitamin C and other nutrients Can be juiced for a breakfast beverage Suitable for use in all kinds of sweet and savory dishes Store fresh oranges at room temperature or refrigerate', 'Fresh Produce', 'https://i5.walmartimages.com/asr/0039e8fe-9fd3-45e9-a4e3-ba5a49d3d9a4.a2f2806080b5f6e94ea11458020db16e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0039e8fe-9fd3-45e9-a4e3-ba5a49d3d9a4.a2f2806080b5f6e94ea11458020db16e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0039e8fe-9fd3-45e9-a4e3-ba5a49d3d9a4.a2f2806080b5f6e94ea11458020db16e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
