INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1703778874, 'Fresh Sumo Citrus Mandarin, 2lb Bag', 5.74, 'deleted_725422000079', 'Bursting with juicy sweetness, Sumo Citrus Mandarins are one of the world\'s largest and sweetest mandarins. Distinguished for its Top Knot and uneven skin, this rare seedless hybrid variety delivers the ultimate citrus experience: incredibly sweet and easy-to-peel, without the mess! Can you peel it in one go? Each bag includes two pounds of Sumo Citrus Mandarins, so you can share the sweetest obsession! For best flavor, don\'t refrigerate Sumo Citrus Mandarins. Compact and portable, Sumo Citrus Mandarins are great to pack in your lunchbox, toss into our gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Share the sweetness with Sumo Citrus Mandarins.', 'One of the world\'s largest and sweetest mandarins No mess and easy-to-peel for more fun Each bag contains 2 pounds of Sumo Citrus Mandarins Incredibly sweet and seedless The perfect on-the-go snack', 'Sumo Citrus', 'https://i5.walmartimages.com/asr/187211cd-42d7-4851-9958-781f44b37aa6.1b06330a47dcfb08cd86f7132b033f09.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/187211cd-42d7-4851-9958-781f44b37aa6.1b06330a47dcfb08cd86f7132b033f09.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/187211cd-42d7-4851-9958-781f44b37aa6.1b06330a47dcfb08cd86f7132b033f09.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
