INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1732105323, 'Ingrilli 100% Lemon Juice from Concentrate, 4 Fl Oz Squeeze Bottles (Pack of 3)', 12.4, '642709101710', 'The Highest Product Standards From our orchard-to-bottle manufacturing process to our strict quality standards, we take pride in knowing that every bottle of Ingrilli products lives up to the Ingrilli family name. TRULY ORGANIC PRODUCTS At Ingrilli, we don’t just “label” our organic line as such – we live it. We test every batch of our organic products against common pesticides, and we have zero tolerance for any contamination or preservatives. That’s why we’ve earned the official USDA Organic seal of approval. NON-GMO Ingrilli is proud to be an official participant of the Non-GMO Project, and we are Non-GMO Project verified for all of our products. A TRADITION OF HIGH MANUFACTURING STANDARDS When we first opened our doors in 1880, we promised to deliver the highest-quality, freshest products on the market – and we still live to that standard today. That’s why we only use the freshest fruit and the latest production equipment, processes, and facilities to produce every bottle of Ingrilli juice on the shelves', 'FRESH FLAVOR, FRESH TASTE: Made from Argentinian and Brazilian 100% lemon juice concentrate, Ingrilli tastes as fresh as cutting into fresh lemons VERSATILE FLAVOR: Ingrilli Lemon Juice can be used for cooking, baking, salads and drink mixers. GOOD FOR EVERYONE: Ingrilli Lemon juice is is Non-GMO Project Verified, OU kosher certified, Vegan Certified and Gluten-Free', 'Ingrilli', 'https://i5.walmartimages.com/asr/3cbabd0c-5616-4708-9105-82c00edf9947.cf776292cff59bc6bbb7f4773d75669c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3cbabd0c-5616-4708-9105-82c00edf9947.cf776292cff59bc6bbb7f4773d75669c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3cbabd0c-5616-4708-9105-82c00edf9947.cf776292cff59bc6bbb7f4773d75669c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1732560925, 'Fresh Blueberries, 1 Pint Container', 3.17, '033383221014', 'Fresh Blueberries are a delightful and nutritious treat that brings a burst of flavor to any dish. These plump and juicy berries are picked at the peak of freshness, ensuring a sweet and tangy taste that is hard to resist. Perfect for snacking, baking, or adding to your favorite recipes, these blueberries are a versatile fruit that can be enjoyed in countless ways. Whether you sprinkle them on top of your morning cereal, blend them into a smoothie, or bake them into a delicious pie, Fresh Blueberries are sure to satisfy your cravings for a healthy and delicious snack.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blueberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blueberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blueberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these blue gems into your baking endeavors, whether it\'s muffins, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blueberries delicious, but they also offer an array of health benefits. Loaded with antioxidants, vitamins, and dietary fiber, blueberries are known to promote heart health, support brain function, and boost the immune system. They are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blueberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blueberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/58566f1b-31b1-4e76-b0c2-39403a93c0c7.c8b5bd91935856cbdb15b7587d8c031e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/58566f1b-31b1-4e76-b0c2-39403a93c0c7.c8b5bd91935856cbdb15b7587d8c031e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/58566f1b-31b1-4e76-b0c2-39403a93c0c7.c8b5bd91935856cbdb15b7587d8c031e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
