INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1810869685, 'Fieldpack Unbranded Watermelon Seedless', 5.67, 'deleted_850046329234', 'Enjoy the sweet, refreshing taste of a Seedless Watermelon. Seedless Watermelon is great for breakfast, lunch, dessert, or when you want a snack. Watermelon is a good source of vitamin C, vitamin A, and potassium making them an excellent healthy treat. Cut the watermelon into chunks for a quick snack, infuse it with water for a refreshing drink, or chop it up and make a mouthwatering watermelon salad with feta and mint. This watermelon is great for sharing with friends and family or keep it for yourself. Bring it to your next cookout or get it as a sweet after dinner treat with friends.', 'Fresh Seedless Watermelon: Enjoy a fresh Seedless Watermelon on its own or add to a mixed fruit salad Serve at your next neighborhood barbecue Get creative and make a watermelon cocktail or a refreshing sorbet Sweet and Juicy Explore all the delicious ways to add fresh watermelon to your favorite recipes', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/d9ab5cfa-d0a8-4811-89a4-21340d203979.38416fb0219739eb6a2502179f5b8a34.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d9ab5cfa-d0a8-4811-89a4-21340d203979.38416fb0219739eb6a2502179f5b8a34.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/d9ab5cfa-d0a8-4811-89a4-21340d203979.38416fb0219739eb6a2502179f5b8a34.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
