INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (1987845157, 'Fresh Organic Blueberries Dry Pint Container', 4.96, '858110006050', 'Fresh Blueberries are a delightful and nutritious treat that brings a burst of flavor to any dish. These plump and juicy berries are picked at the peak of freshness, ensuring a sweet and tangy taste that is hard to resist. Perfect for snacking, baking, or adding to your favorite recipes, these blueberries are a versatile fruit that can be enjoyed in countless ways. Whether you sprinkle them on top of your morning cereal, blend them into a smoothie, or bake them into a delicious pie, Fresh Blueberries are sure to satisfy your cravings for a healthy and delicious snack.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blueberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blueberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blueberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these blue gems into your baking endeavors, whether it\'s muffins, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blueberries delicious, but they also offer an array of health benefits. Loaded with antioxidants, vitamins, and dietary fiber, blueberries are known to promote heart health, support brain function, and boost the immune system. They are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blueberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blueberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Fresh Produce', 'https://i5.walmartimages.com/asr/c2ba8df8-8d4a-4cb4-8141-d81b19fcc6e4.e53fe1f9eaa58f9ff95ae592f0f3db95.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c2ba8df8-8d4a-4cb4-8141-d81b19fcc6e4.e53fe1f9eaa58f9ff95ae592f0f3db95.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c2ba8df8-8d4a-4cb4-8141-d81b19fcc6e4.e53fe1f9eaa58f9ff95ae592f0f3db95.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2000589495, 'HARVEAST Dried Apple Slices | Unsulfured Gourmet Dehydrated Apples, No Sugar, Gluten Free, Kosher, Vegan, Non-GMO | Dried Sliced Apple Fruit in Resealable Bag, Delicious Healthy Snack 20 Oz 2 Pack', 41.13, '686754386012', 'Why Choose HARVEAST Dried Apple Slices? We at HARVEAST take pride in cultivating delicious, healthy & mouthwateringly sweet dried apples from the hearty & robust apple trees on our farm. Our all-natural dehydrated apple slices are responsibly grown and packaged with care without the use of gluten, preservatives, GMO or added sugar/sulfur. They are tasted, tested and inspected several times throughout the growing, cultivating and drying process to maintain great taste & consumer safety. Our hard work pays off when we see our customers enjoying our mouthwatering dried apples. Four Image Highlights 2 Pound Resealable Bag After you are done snacking on these delicious dried apple slices, simply reseal the included bag to keep them fresh and flavorful. Need to satisfy your sweet tooth again? Simply unseal the bag and snack away. No more chip clips or food storage clamps needed! Perfect Gourmet Snack Gift Your loved one, friends and family will love these delicious dehydrated apple fruit slices! They are a perfect healthy snack gift for people of all ages and lifestyles. Gift it to them for a birthday, Mother’s Day, Christmas, Father’s Day or any other special occasion! Remarkably Nutritious & Flavorsome These dried apples are a hearty, healthy and absolutely delicious snack. You will love how each bite offers a tender, yet chewy texture, as well as delightfully sweet taste. Get a large percentage of your daily value in vitamins, fiber, potassium and other minerals when snacking on this dried fruit. Delicious Ingredient for Snacks & Meals You will love how you can add these dehydrated apple slices to your daily yogurt, smoothies, salad, tea, oatmeal, granola, trail mix, ice cream, cake, pie & other meals! Want to make a delicious meat & cheese platter? Add this delectable dried fruit to your next charcutier board to impress your friends and family!', 'Delicious Dried Apple Slices - These kosher dehydrated apples are unsulfured for your health & safety. They have a lusciously sweet taste, while also providing you outstanding nutritional value. They are rich in many vitamins and minerals, particularly vitamin C and potassium. Healthy Snack for the Entire Family - You will be amazed that such a delectable treat can provide your body an abundance of fiber, vitamin C, potassium, vitamin K, vitamin B6, manganese, and copper! Our non-GMO dried apple slices are fat-free. low in calories & high in flavor! Truly a perfect addition for the kid s lunch box or simply a healthy nibble to satisfy your sweet-tooth. Gluten Free, Kosher, Vegan, Unsulfured - Rest easy knowing that these dried apple fruit slices are all-natural, unsulfured, gluten free, vegan & Kosher! No sugar or syrups are ever added in the process of cultivating or packaging these dehydrated apples. It is a healthy & mouth-watering snack! Add to Yogurt, Smoothies, Cereal & Salad - Add these delicious & delicate dried apple slices to your favorite snacks & meals. We have customers all over the world use these nutritious dried apples in their yogurt, smoothies, salad, cereal, cheese platter, charcutier boards, granola, trail mix, pies, cakes, ice cream & much more! Cultivated & Dried to Perfection - We take pride in growing & sourcing our gourmet dried apple slices directly from our farm-grown, luscious & robust apple trees. Our premium dehydrated apples are naturally grown and dried without the use of harmful chemicals or GMOs.', 'HARVEAST', 'https://i5.walmartimages.com/asr/2606894b-59f5-422e-9575-5bd575bc3627.db516e7bf7431b73ed9b54b6c989f616.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2606894b-59f5-422e-9575-5bd575bc3627.db516e7bf7431b73ed9b54b6c989f616.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/2606894b-59f5-422e-9575-5bd575bc3627.db516e7bf7431b73ed9b54b6c989f616.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
