INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2439709182, 'Fresh Navel Orange, lb', 0.97, '406585344018', 'Enjoy the juicy goodness of Fresh Navel Oranges (China Nebo). A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these navel oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Fresh Navel Oranges add flavor to any meal or beverage', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes', 'Unbranded', 'https://i5.walmartimages.com/asr/05a33b9e-e4f0-4b24-8ba0-28dc215544fe.95088f3c9af8ad72e4d74ecfeb07d36e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/05a33b9e-e4f0-4b24-8ba0-28dc215544fe.95088f3c9af8ad72e4d74ecfeb07d36e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/05a33b9e-e4f0-4b24-8ba0-28dc215544fe.95088f3c9af8ad72e4d74ecfeb07d36e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
