INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2569986501, 'Ingrilli 100% Lemon Juice from Concentrate, 7 Fl Oz Squeeze Bottles (Pack of 3)', 15.98, '642709101833', 'The Highest Product Standards From our orchard-to-bottle manufacturing process to our strict quality standards, we take pride in knowing that every bottle of Ingrilli products lives up to the Ingrilli family name. TRULY ORGANIC PRODUCTS At Ingrilli, we don’t just “label” our organic line as such – we live it. We test every batch of our organic products against common pesticides, and we have zero tolerance for any contamination or preservatives. That’s why we’ve earned the official USDA Organic seal of approval. NON-GMO Ingrilli is proud to be an official participant of the Non-GMO Project, and we are Non-GMO Project verified for all of our products. A TRADITION OF HIGH MANUFACTURING STANDARDS When we first opened our doors in 1880, we promised to deliver the highest-quality, freshest products on the market – and we still live to that standard today. That’s why we only use the freshest fruit and the latest production equipment, processes, and facilities to produce every bottle of Ingrilli juice on the shelves', 'FRESH FLAVOR, FRESH TASTE: Made from Argentinian and Brazilian 100% lemon juice concentrate, Ingrilli tastes as fresh as cutting into fresh lemons VERSATILE FLAVOR: Ingrilli 100% Lemon Juice can be used for cooking, baking, salads and drink mixers. GOOD FOR EVERYONE: Ingrilli 100% Lemon Juice is Non-GMO Project Verified, OU kosher certified, Vegan Certified and Gluten-Free', 'Ingrilli', 'https://i5.walmartimages.com/asr/531b1eb0-95fc-453d-89b9-56f16af423a5.d1d46245d2a47ee56120c38cf9dc9044.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/531b1eb0-95fc-453d-89b9-56f16af423a5.d1d46245d2a47ee56120c38cf9dc9044.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/531b1eb0-95fc-453d-89b9-56f16af423a5.d1d46245d2a47ee56120c38cf9dc9044.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
