INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2799892982, 'Fieldpack Unbranded Papaya', 1.14, 'deleted_857962007376', 'Get flavor and nutrition with our Fresh Papaya. Papaya is a tropical fruit that originated in the tropics of the Americas and is known to be a great source of vitamins C, A, fiber, and antioxidants. When ripe, this fruit has a butter-like texture with a fairly sweet flavor similar to cantaloupe and can be eaten raw, without skin or seeds. Papaya can be prepared in a variety of ways; you can mix them with grapefruit and avocado for a bright summer salad, add them to a zesty salsa for some sweetness, freeze them and turn them into refreshing popsicle spears, or bake them in the oven with a melted brown sugar mixture. The sky\'s the limit! Get ready for a taste-bud party with Fresh Papaya.', 'Creamy, butter-like flavor when ripe Rich in vitamins A, C, fiber, and antioxidants Fairly sweet flavor like cantaloupe and mango Great addition to smoothies, salads, salsa, and more Delicious and nutritious', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
