INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2829893059, 'Rancho Meladuco California-Grown Medjool Dates, Whole Fresh Un-Pitted, 1 lb. Box Dates', 10.9, '851418008139', 'Did you know dates are the only Superfood that tastes like Candy? Soft and chewy, dates taste like caramel and brown sugar. Our 1 lb. box of sweet and delicious California Grown Medjool Dates will become your new favorite go-to sweet treat. Dates are a nutrient dense, bite sized fruit grown in the warm sunny deserts of Southern California under our plentiful Sunshine. Celebrating the history of California\'s date farms and love affair with dates, you\'ll find a recipe for the classic roadside date shake right on the box. Dates are the better-for-you natural \"candy\", providing sustained energy and fuel for both competitive athletes and everyday people alike, and are versatile enough to add a touch of sweetness to countless dishes and recipes. Dates contain more potassium ounce for ounce than bananas and are a good source of daily fiber as well as containing iron, magnesium and other essential vitamins and nutrients. Despite their sweetness dates are lower on the glycemic index for people monitoring their blood sugar. We love our dates stuffed with a little crunchy nut butter, ice cream, or even tangy blue cheese. Chop them and add to oatmeal, yogurt, salads, or savory dishes or add them to your baked goods for a nutrient dense natural sweetener. Dates are one of the top trending foods for good reason and we\'re sure you\'ll fall in love with dates too! These dates contain a seed so please enjoy with care and remove the seed before eating. Allergen warning: our dates are packed in a facility that may also process tree nuts & peanuts. Allergens not contained: free of soy, gluten, egg, dairy, casein. Condition: Whole, un-pitted Organic Medjool dates. No sugar added. Shelf stable, but to enhance freshness store in a cool location.', 'One pound box of whole, un-pitted Medjool Dates Approximately 20-25 dates per pound Contains a seed, remove before eating. Tastes like caramel and brown sugar with hints of cinnamon Naturally sweet, whole fruit and nutrient dense superfood No added sugar CONTAINS WHOLE, UN-PITTED CALIFORNIA GROWN MEDJOOL DATES- Grown and hand picked in the Coachella Valley of Southern California. Our Dates are a delicious and nutritious snack that is perfect for any occasion. Our Dates are naturally SWEET and SOFT, and are packed with essential vitamins and minerals. They are a great source of dietary fibers, and are a great way to satisfy your sweet tooth without the guilt. Enjoy them as a snack, or add them to your favorite recipes for a delicous and healthy treat.', 'Rancho Meladuco Date Farm', 'https://i5.walmartimages.com/asr/4b1f0262-0812-4cfb-9787-f20dadcc6e10.4937c4155238eeb5f3dac0fe1d377544.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4b1f0262-0812-4cfb-9787-f20dadcc6e10.4937c4155238eeb5f3dac0fe1d377544.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4b1f0262-0812-4cfb-9787-f20dadcc6e10.4937c4155238eeb5f3dac0fe1d377544.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2838447209, '2.5lbs Organic Pitted Dates | 100% Algerian Deglet Noor | Certified ORGANIC, NON-GMO, VEGAN, KOSHER, naturally sweet and Gluten-free, NO sugar added, NO sulfurs or preservatives, Nut-Free.', 17.99, '860003981009', 'The Soleil Deglet Noor dates bring you a taste of tradition, purity, and nutritional goodness—all in one bite. No matter if you’re seeking organic dates pitted unsweetened or looking to stock up on dates bulk, this is the quality you’ve been waiting for. USDA ORGANIC CERTIFIED & ALL-NATURAL These halal dates are USDA Organic certified and made with nothing but nature—no added sugar, no sulfurs, no preservatives. Our pitted dates organic no sugar added are also non-GMO, gluten-free, and nut-free, making them a clean, guilt-free snack for any lifestyle. AUTHENTIC ALGERIAN DEGLET NOOR Harvested from Algeria’s sunlit oases, our Deglet dates—also known as Deglet Noor dates organic pitted—are cherished for their light golden translucence and firm texture. As one of the most sought-after dry dates, they’ve earned their title as “the Queen of all dates.” DISTINCTIVE FLAVOR & TEXTURE With just the right amount of medium sweetness, these dates organic offer a chewy bite and finish with a nutty note similar to roasted peanuts. They’re perfect straight out of the bag or added to recipes. NATURALLY ENERGIZING Rich in vitamins, minerals, and balanced natural sugars, these organic dates pitted unsweetened provide lasting energy. They’re an ideal snack, especially great dates for pregnancy, active lifestyles, or whenever you crave something sweet. PURITY YOU CAN TASTE From datiles naturales organicos to datiles organicos sin azucar, these seedless snacks are known across cultures for their purity and nutritional value. Available in organic dates bulk package for everyday enjoyment. Enjoy the heritage and flavor with the Soleil Deglet Noor dates organic pitted — your perfect choice for clean, nourishing, and versatile snacking. ORDER yours NOW. Whether you\'re stocking up on deglet dates bulk or trying dry dates for the first time, there\'s no better way to snack naturally.', 'USDA Organic Certified – Grown without synthetic pesticides or fertilizers, the Soleil organic pitted dates meet the highest organic standards and are fully USDA Organic certified. Premium Deglet Noor Variety – Known as \"the Queen of all dates,\" Deglet Noor organic dates (meaning \"dates of light\") are prized for their translucent appearance, medium sweetness, and firm texture. Delicious Nutty Flavor – These dried dates pitted no sugar added taste yummy and offer a pleasant, nutty aftertaste reminiscent of lightly roasted peanuts, making them a naturally satisfying treat. Nutrient-Rich Energy Boost – With balanced natural sugars, vitamins, and essential minerals, the organic dates pitted snacks make a healthy option when craving something sweet or a quick source of energy. 100% Natural & Allergen-Friendly – Non-GMO, gluten-free, nut-free, with no added sugar, sulfurs, or preservatives, these seedless dates are a clean and guilt-free indulgence. Healthy natural and delicious snack for the whole family!', 'Soleil', 'https://i5.walmartimages.com/asr/38566fae-5327-4b0e-b49c-e4de24fecc0c.0a8d2f5746cbcda5b716b39ea34c7017.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/38566fae-5327-4b0e-b49c-e4de24fecc0c.0a8d2f5746cbcda5b716b39ea34c7017.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/38566fae-5327-4b0e-b49c-e4de24fecc0c.0a8d2f5746cbcda5b716b39ea34c7017.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
