INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2878973462, 'Freshness Guaranteed Fresh Fruit Medley Bowl, 10 oz', 5.97, '194346097180', 'Experience a burst of fresh flavor with this Freshness Guaranteed Fresh Fruit Medley Bowl. This delicious medley contains strawberries, blueberries and coconut and blueberries arranged in a transparent tray with a lid. Carry them with you and eat them straight out of the tray any time you want, at home or on the go. You can also use them to top desserts and ice creams, in a fruit salad or blend them with ice to make smoothies. Add some fresh fruit to your day with this Freshness Guaranteed Fresh Fruit Medley Bowl. Freshness Guaranteed provides you and your family with high-quality fresh food that saves you time and money, many of which are cooked fresh or prepared in stores. Convenient solutions with value added in every Freshness Guaranteed item.', 'Freshness Guaranteed Fresh Fruit Medley Bowl, 10 oz Delicious mix of strawberries, blueberries, and coconuts Sweet, refreshing treat Great for breakfast, lunch, dessert, or when you want a snack Ingredients may vary by season Enjoy right out of the container, blend into a smoothie, or use as a fresh topping for ice cream and more Share with friends and family or keep for yourself Comes in a re-closable container to help maintain freshness', 'Freshness Guaranteed', 'https://i5.walmartimages.com/asr/b0f678f1-7013-4d96-8246-a276a875f782.943dda685e9845a4b5860c0f72b1280f.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b0f678f1-7013-4d96-8246-a276a875f782.943dda685e9845a4b5860c0f72b1280f.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b0f678f1-7013-4d96-8246-a276a875f782.943dda685e9845a4b5860c0f72b1280f.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
