INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2892696341, 'Superfresh Granny Smith Kids Apples, 2lb - Fresh Tart & Crisp Variety', 5.46, '883391000794', 'Discover the irresistible flavor of Superfresh Granny Smith Apples. These crisp and juicy apples are known for their tart, subtly sweet taste and firm texture. Perfect for various recipes, they can be used in both savory and sweet dishes. Enjoy them fresh, as a snack, or incorporate them into your meals for breakfast, lunch, and dinner. Cook them with butter and spices for a simple delight, or create an apple pie that everyone loves. Superfresh Granny Smith Apples are ideal for every occasion and meal.', 'Firm and juicy with a crisp texture and a tart, acidic, yet subtly sweet flavor Perfect for breakfast, lunch, dinner, or dessert Enjoy fresh as a snack or cook in a skillet for easy dishes Create sweet treats like apple pies or savory dishes like apple slaw Flexible ingredient for a wide range of recipes Naturally grown and handpicked for the best quality', 'Superfresh Kids', 'https://i5.walmartimages.com/asr/ddb68a2a-e882-4080-9913-b66b38c8e217.572b8479db3d0b2a326737e498ad1730.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ddb68a2a-e882-4080-9913-b66b38c8e217.572b8479db3d0b2a326737e498ad1730.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/ddb68a2a-e882-4080-9913-b66b38c8e217.572b8479db3d0b2a326737e498ad1730.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2918254984, 'Fresh Driscoll\'s Tropical Bliss Strawberries, 9 oz Container', 3.99, '715756211333', 'The berry bursting with natural flavors of fruit punch, pineapple and passionfruit, these juicy strawberries are selected for their extra-sweet deliciousness. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, or mix them with cucumbers for a light and flavorful salad. They contain essential vitamins and nutrients like vitamin C, fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use.', 'Premium selection Only Driscoll\'s grows Tropical Bliss Strawberries from one proprietary berry variety. Driscoll\'s Tropical Bliss Strawberries combine the classic flavor or sweet berries and refreshing notes of tropical punch, with hints of pineapple and passionfruit. With naturally white and yellow hues, they are perfectly ripe and intensely sweet at first, balanced by a crisp finish. Refrigerate your strawberries in the original Clam Shell tray to maintain freshness Delicious on their own as a healthy snack or as part of a recipe Rich in vitamin C', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/1ebc796c-b840-4e08-8c39-300760d84f57.c4c6ec410d9547a3a86630a4b703f559.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1ebc796c-b840-4e08-8c39-300760d84f57.c4c6ec410d9547a3a86630a4b703f559.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1ebc796c-b840-4e08-8c39-300760d84f57.c4c6ec410d9547a3a86630a4b703f559.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
