INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (2948406945, 'Fresh Strawberries, 1 lb', 3.24, '852575008741', 'The sweet, juicy flavor of Fresh Strawberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. They contain essential vitamins and nutrients like, vitamin C, dietary fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use. Pick up Fresh Strawberries today and savor the delectable flavor.', 'Prior to serving gently wash the fruit and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/b54a64ad-e961-46cf-b60c-bc763716fb0b.a481cdfd237c5ab5438d5c9e90bead07.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b54a64ad-e961-46cf-b60c-bc763716fb0b.a481cdfd237c5ab5438d5c9e90bead07.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b54a64ad-e961-46cf-b60c-bc763716fb0b.a481cdfd237c5ab5438d5c9e90bead07.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (3013821133, 'Fresh Blueberries, 6 oz', 4.12, '850011052044', 'Fresh Blueberries are a delightful and nutritious treat that brings a burst of flavor to any dish. These plump and juicy berries are picked at the peak of freshness, ensuring a sweet and tangy taste that is hard to resist. Perfect for snacking, baking, or adding to your favorite recipes, these blueberries are a versatile fruit that can be enjoyed in countless ways. Whether you sprinkle them on top of your morning cereal, blend them into a smoothie, or bake them into a delicious pie, Fresh Blueberries are sure to satisfy your cravings for a healthy and delicious snack.', 'Are you ready to experience the vibrant taste and health benefits of Fresh Blueberries? These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blueberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blueberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack, or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these blue gems into your baking endeavors, whether it\'s muffins, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blueberries delicious, but they also offer an array of health benefits. Loaded with antioxidants, vitamins, and dietary fiber, blueberries are known to promote heart health, support brain function, and boost the immune system. They are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blueberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blueberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness. Fresh', 'Fresh Produce', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (3046250946, 'Welch Fresh Black Seedless Grapes, 3lb', 9.97, '095829210556', 'Treat yourself to the delicious, juicy flavor of Fresh Black Seedless Grapes. These grapes are bursting with flavor and are completely seedless, so you can easily enjoy a handful as a fresh snack any time of day. Prized for their lush, juicy pulp, very sweet flavors, and highly aromatic skins that offer a pleasant chewiness, they are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto.', 'Welch fresh black Seedless Grape Wash before use Keep refrigerated', 'Welch\'s', 'https://i5.walmartimages.com/asr/04f6076f-bc86-46c9-a597-5bd2f455c266.ec41895adce76827f713d880764e05a9.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/04f6076f-bc86-46c9-a597-5bd2f455c266.ec41895adce76827f713d880764e05a9.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/04f6076f-bc86-46c9-a597-5bd2f455c266.ec41895adce76827f713d880764e05a9.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (3048415499, 'Ingrilli 100% Lemon Juice from Concentrate, 7 Fl Oz Squeeze Bottles (Pack of 6)', 21.98, '642709101840', 'The Highest Product Standards From our orchard-to-bottle manufacturing process to our strict quality standards, we take pride in knowing that every bottle of Ingrilli products lives up to the Ingrilli family name. TRULY ORGANIC PRODUCTS At Ingrilli, we don’t just “label” our organic line as such – we live it. We test every batch of our organic products against common pesticides, and we have zero tolerance for any contamination or preservatives. That’s why we’ve earned the official USDA Organic seal of approval. NON-GMO Ingrilli is proud to be an official participant of the Non-GMO Project, and we are Non-GMO Project verified for all of our products. A TRADITION OF HIGH MANUFACTURING STANDARDS When we first opened our doors in 1880, we promised to deliver the highest-quality, freshest products on the market – and we still live to that standard today. That’s why we only use the freshest fruit and the latest production equipment, processes, and facilities to produce every bottle of Ingrilli juice on the shelves', 'FRESH FLAVOR, FRESH TASTE: Made from Argentinian and Brazilian 100% lemon juice concentrate, Ingrilli tastes as fresh as cutting into fresh lemons VERSATILE FLAVOR: Ingrilli 100% Lemon Juice can be used for cooking, baking, salads and drink mixers. GOOD FOR EVERYONE: Ingrilli 100% Lemon Juice is Non-GMO Project Verified, OU kosher certified, Vegan Certified and Gluten-Free', 'Ingrilli', 'https://i5.walmartimages.com/asr/531b1eb0-95fc-453d-89b9-56f16af423a5.d1d46245d2a47ee56120c38cf9dc9044.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/531b1eb0-95fc-453d-89b9-56f16af423a5.d1d46245d2a47ee56120c38cf9dc9044.jpeg?odnHeight=180&odnWidth=180&odnBg