INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (3109520666, 'Nature Fresh USDA Organic Greenhouse Grown Strawberries, 12 oz Container', 6.98, '689259005723', 'The sweet, juicy flavor of Fresh USDA Organic Greenhouse Grown Strawberries make them a refreshing and delicious treat. These sweet and flavorful strawberries are our premium selection. They are great for homemade smoothies, desserts, or enjoying as a yummy and healthy snack. Serve up a bowl plain or topped with whipped cream for a delicious treat. Add to fruit salads, ice cream, yogurt or milkshakes. Use it to top off cereal, pancakes or waffles. It is also great as a topping for strawberry cheesecake and other dessert recipes. These organic berries contain essential vitamins and nutrients like, vitamin C, fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell tray to keep them fresh and ready for use.', 'Premium selection Certified organic Prior to serving gently wash the strawberries and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful strawberry salad, or puree them to make a delicious cocktail', 'Nature Fresh', 'https://i5.walmartimages.com/asr/eb86f20b-ffe7-4a37-8ec3-d7b714915603.f01b04d31fe002da0f41d0e4f43348a6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/eb86f20b-ffe7-4a37-8ec3-d7b714915603.f01b04d31fe002da0f41d0e4f43348a6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/eb86f20b-ffe7-4a37-8ec3-d7b714915603.f01b04d31fe002da0f41d0e4f43348a6.jpeg?odnHei