INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (3711629612, '11LB Large Size Medjool Dates-Golden Dates Farm-California Fresh-Dried Fruits', 46, '727785392273', 'Our Medjool dates have no added preservatives and no chemical. They taste great and are the best quality you will get at a reasonable price. They are naturally and locally grown in California by Golden Dates Farm. These Medjool dates have plenty of health benefits. They contain potassium, fibers, vitamin B, and much more. Simply eat them as a snack on their own or add them to oatmeal, shakes, baked goods, or smoothies. If you have any questions feel free to message us!', 'Fresh Medjool Dates Large Size Dried Fruit Sweet Juicy Naturally and Locally Grown in California Dried Fruit Medjool', 'Golden Dates Farm', 'https://i5.walmartimages.com/asr/1927d188-da79-42b2-8e93-7e42234d2955.97d9b453ebac89f65c5d02ed5e40b07f.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1927d188-da79-42b2-8e93-7e42234d2955.97d9b453ebac89f65c5d02ed5e40b07f.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1927d188-da79-42b2-8e93-7e42234d2955.97d9b453ebac89f65c5d02ed5e40b07f.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (3775809406, 'Fresh Navel Oranges, 8 lb Bag', 8.94, 'deleted_033383130064', 'Enjoy the juicy goodness of these Large Bagged Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, these Large Bagged Oranges will add flavor to any meal or beverage.', 'A good addition to a healthy diet Easy to peel segments Contains vitamin C and other nutrients Can be juiced for a breakfast beverage Suitable for use in all kinds of sweet and savory dishes Store fresh oranges at room temperature or refrigerate', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/96fc49a5-e281-4329-8a19-8da6dd59fb9f.182dd7b4be8635bae8fefed18a8eefd1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/96fc49a5-e281-4329-8a19-8da6dd59fb9f.182dd7b4be8635bae8fefed18a8eefd1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/96fc49a5-e281-4329-8a19-8da6dd59fb9f.182dd7b4be8635bae8fefed18a8eefd1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
