INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (3976863513, 'Fresh Passion Fruit, Each', 2.74, 'deleted_851502006348', 'Get ready for a tropical taste bomb with this juicy Fresh Passion Fruit. This fresh and whole fruit has a hard purple shell protecting the bright yellow interior with black seeds. Cut the fruit in half, scoop the pulp out with a spoon and enjoy. If it\'s too tart, try sprinkling sugar to sweeten the treat. You can also use this fresh passion fruit in several baking recipes including a delicious cream pie or fruit truffles. You can even use them to make a marinade or a passion fruit vinaigrette. However you choose to use them, their sweet flavor will bring a smile to everyone\'s face. Treat the family to the irresistible taste of Fresh Passion Fruit.', 'Fresh Passion Fruit, Each Sweet and juicy Fresh and whole fruit with a hard purple shell Scoop the pulp out with a spoon and enjoy Use to make a delicious cream pie or fruit truffles Make a marinade or a passion fruit vinaigrette salad dressing', 'Fresh Produce', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
