INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (5094408659, 'Fresh Picasso Melon, Each', 4.48, '736558000505', 'Treat yourself to the refreshing flavor of a fresh Picasso Melon. Enjoy this tasty melon on its own as a healthy snack or incorporate it into a variety of delicious recipes. For breakfast, you can make a sweet fruit bowl with sliced melon, strawberries, pineapple, and kiwi. For an extra special treat, top with a dollop of whipped cream. Cut it into small pieces and put it in a fresh salad along with chicken, cucumbers, tomatoes, and a light dressing. You can even use Picasso Melon to make a refreshing summer cocktail, a spreadable jam or a light sorbet. Enjoy the sweet and juicy taste of fresh Picasso Melon.', 'Ideal addition to every kitchen Flavorful addition to many recipes Enjoy on its own or add to a mixed fruit salad Add to your fresh garden salad Get creative & make a fruit cocktail or a refreshing sorbet Explore all the delicious ways to add fresh Picasso Melon to your favorite recipes', 'Picasso Melon', 'https://i5.walmartimages.com/asr/55e9f3c9-c8fd-408b-90b7-ad8cd7d4e0ac.87ba527096a51a093cc249a8c1307d1b.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/55e9f3c9-c8fd-408b-90b7-ad8cd7d4e0ac.87ba527096a51a093cc249a8c1307d1b.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/55e9f3c9-c8fd-408b-90b7-ad8cd7d4e0ac.87ba527096a51a093cc249a8c1307d1b.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (5148256463, 'Fresh Limes, 2 lb Bag', 4.98, '', 'Limes are a versatile citrus fruit, loved for their tangy, refreshing flavor and vibrant green color. Perfect for enhancing drinks, marinades, and desserts, they add a zesty twist to both sweet and savory dishes. Rich in vitamin C and bursting with aroma, limes are a kitchen staple that brings freshness and flavor to every meal. Available in a 2 lb bag.', 'Fresh Limes, 2 lb Bag', 'PRODUCE UNBRANDED', 'https://i5.walmartimages.com/asr/9b785f2a-eb91-4f60-a730-e2708689b315.26c32c3ac789cd1fc6c60ee0b6ce4106.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b785f2a-eb91-4f60-a730-e2708689b315.26c32c3ac789cd1fc6c60ee0b6ce4106.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9b785f2a-eb91-4f60-a730-e2708689b315.26c32c3ac789cd1fc6c60ee0b6ce4106.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
