INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (5157327534, 'Fresh Tangerines, 2 lb Bag', 2.88, '848163004479', 'Tangerines, with their small size and convenient peel, are a fantastic choice for a quick snack in lunch boxes or while on the move. They have a delightful sweetness, few seeds, and offer numerous health benefits. Tangerines are rich in Vitamin A, provide ample fiber, folate, and potassium. Whether enjoyed on their own or combined with a crisp leafy green salad, tangerines are a delicious and nutritious option.', 'Fresh Tangerines, 2 lb Bag Bursting with vitamins Make a creamy smoothie or a delicious tart Add to a salad or use as a garnish for a cocktail Easy to peel and segment', 'Noble', 'https://i5.walmartimages.com/asr/919f649b-7bbe-4281-bb2f-13828389d1b4.5d62aab1b53dc50c22701af463773588.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/919f649b-7bbe-4281-bb2f-13828389d1b4.5d62aab1b53dc50c22701af463773588.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/919f649b-7bbe-4281-bb2f-13828389d1b4.5d62aab1b53dc50c22701af463773588.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (5211389478, 'Fresh Organic Oranges, 4 lb Bag', 5.97, '095829310775', 'Enjoy the fresh sweetness of Marketside Organic Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite adult beverage. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Marketside Organic Oranges add flavor to any meal or beverage.Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', '4 lb Bag of Fresh Organic Oranges Great Source of Vitamin C Ideal for Snacks and Recipes Perfect for Smoothies and Desserts Guaranteed Freshness by Walmart Sourced from Trusted Farmers', 'Fresh Produce', 'https://i5.walmartimages.com/asr/e4685626-7fd0-4eab-8c9d-f3c718b76a30.e976058c7d2944efc5b70d2b64001d5c.webp?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4685626-7fd0-4eab-8c9d-f3c718b76a30.e976058c7d2944efc5b70d2b64001d5c.webp?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/e4685626-7fd0-4eab-8c9d-f3c718b76a30.e976058c7d2944efc5b70d2b64001d5c.webp?odnHeight=450&odnWidth=450&odnBg=ffffff');
