INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (5256904046, 'Fresh Organic Oranges, 3 lb Bag', 5.97, '033383104027', 'Enjoy the fresh sweetness of Fresh Organic Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite adult beverage. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Fresh Organic Oranges add flavor to any meal or beverage.', 'Fresh Organic Oranges, 3 lb Bag Great source of vitamin C Fresh, sweet citrus flavor for snacking or recipes Versatile for breakfast, lunch, desserts, and beverages Ideal for smoothies, salads, marmalade, and sorbet', 'Unbranded', 'https://i5.walmartimages.com/asr/cb01a034-7861-4b08-a68d-de81e21bbbab.d2a4092166d7fcb05d80e44fafa4f1f2.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cb01a034-7861-4b08-a68d-de81e21bbbab.d2a4092166d7fcb05d80e44fafa4f1f2.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cb01a034-7861-4b08-a68d-de81e21bbbab.d2a4092166d7fcb05d80e44fafa4f1f2.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
