INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (5288715245, 'Imported Medjool Dates, 3 Pounds – Unsweetened and Unsulphured , Vegan, Sirtfood, Bulk Dates.', 27.07, '840374818586', 'Imported Medjool dates have been considered a delicacy for thousands of years. Their exceptional nutritional value as well as their delightfully sweet flavor earned them a place at the tables of kings. Today dates are not the luxury food they used to be, so everyone can enjoy the benefits they offer. These fruits are delicious, sweet, free of “bad” fats, and give you a boost of energy. Imported Medjool dates contain 50% more potassium than bananas. Imported Medjool dates make a great standalone snack, and they can also be used in a variety of recipes. They go especially well with granolas, candy, biscuits, and salads. You can also add them to special cereal dishes, like couscous or wild rice casserole. Adding some dates to sweeten your protein shake can improve its taste as well as boost its nutritional value.', '✔️Premium Quality, Large Size, Fat Free, Cholesterol Free, Sodium Free, High in Potassium, Grown in Israel. ✔️The Imported Medjool Dates are the finest dates in the world. Dates are thought to be one of the world’s oldest cultivated fruits. ✔️Each date is handpicked to ensure its exceptional quality and size. Imported Medjool Dates are truly the cream of a very exclusive crop. These dates are the largest, the sweetest and the juiciest. Extremely meaty dates with tiny pits. Imported Medjool Dates are fresh and ready for you to enjoy in your home. They are great for cooking, baking and snacking. ✔️The Imported Medjool Dates from Food to Live are high in vitamins, and minerals.', 'Food to Live', 'https://i5.walmartimages.com/asr/b48cfe91-f008-4767-a383-c70b48abf7ac.11f7cc13075447451fa30fad65ff1578.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b48cfe91-f008-4767-a383-c70b48abf7ac.11f7cc13075447451fa30fad65ff1578.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b48cfe91-f008-4767-a383-c70b48abf7ac.11f7cc13075447451fa30fad65ff1578.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (5295981573, 'Fresh Bluey Kiwi Fruit, 2 lb Clamshell', 5.12, '732313002425', 'Introducing this delightful Fresh Kiwi Fruit, a vibrant and flavorful treat that will make your taste buds dance with joy! Our Kiwi fruit, featuring Bluey, offers a delightful twist on this delicious fruit. Bluey, the lovable and mischievous character from the popular animated series, adds an extra element of fun and excitement to your Kiwi fruit experience. With its bright green flesh and a burst of tangy sweetness, this Kiwi fruit is sure to delight both kids and adults alike. But it\'s not just about the playful character on the packaging - the real star of the show is the Kiwi fruit itself. Packed with essential vitamins and minerals, our Kiwi fruit is a nutritional powerhouse. With a high vitamin C content, it supports a healthy immune system and helps keep you feeling your best. The fiber content aids in digestion and promotes a healthy gut, while the antioxidants present in Kiwi fruit contribute to overall well-being. Not only is our Kiwi fruit healthy, but it\'s also incredibly versatile. Slice it up and add it to your breakfast cereal or yogurt for a burst of freshness. Blend it into a smoothie for a refreshing and nutritious drink. Or simply enjoy it as a snack on its own - the choice is yours! With its fuzzy brown skin and vibrant green flesh, our Kiwi fruit, featuring Bluey, is not only a feast for the taste buds but also a visual delight. Its unique appearance and irresistible flavor make it a standout fruit that is bound to impress your family and friends. So why wait? Treat yourself to the delightful combination of Kiwi fruit and Bluey and experience the joy and goodness they bring. Order your Kiwi fruit with Bluey today and embark on a delicious and nutritious journey that will leave you wanting more!', 'F