!', 'Fresh Bluey Kiwi Fruit, 1 lb Clamshell Delicious sweet and tangy kiwi fruit Packed with vitamin C, fiber and antioxidants with a scrumptious fruit taste Enjoy a fresh kiwi with your breakfast to start your day off on the right foot Bring one to work and treat yourself to a scrumptious healthy snack at the office Great for school lunches Perfect for topping desserts', 'Fresh Produce', 'https://i5.walmartimages.com/asr/26a01767-b95e-4fc6-b3c5-9203a35d0495.932ffc123d5b7300a358e6c6fc812148.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/26a01767-b95e-4fc6-b3c5-9203a35d0495.932ffc123d5b7300a358e6c6fc812148.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/26a01767-b95e-4fc6-b3c5-9203a35d0495.932ffc123d5b7300a358e6c6fc812148.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
