INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (6695573280, 'Organic California Medjool Dates, 1 Pound – Non-GMO Whole Dry Fancy Dates with Pits', 18.32, '840374820749', 'Indulge in nature\'s candy with delectable California Medjool Dates from Food to Live . These soft, juicy, and unsweetened dates are a guilt-free treat packed with fiber, B vitamins, and essential minerals like calcium, iron, copper, and selenium. Grown and harvested in the USA, these non-GMO, vegan, kosher, and gluten-free dates are the perfect snack for those following a Sirtfood diet or simply looking to boost their nutritional intake. With a large size and meaty texture, these dates are sure to satisfy your sweet cravings without any added sugars or sulfites. Enjoy them straight out of the bag or incorporate them into your favorite recipes. Boasting a long shelf life of up to 1.5 years, these Organic California Medjool Dates are a convenient and delicious addition to your pantry.', '✔️MEDJOOL DATES: Unsweetened Organic California Medjool Dates with pits from Food to Live, perfect as a nutritious snack. ✔️NON-GMO & VEGAN: These fancy dates are non-GMO, unsulphured, vegan, kosher, gluten-free, and sodium-free. ✔️NUTRIENT-RICH: Rich in fiber, B vitamins, calcium, iron, copper, and selenium, making Organic California Medjool Dates a great addition to your diet. ✔️SOFT & JUICY: Enjoy the delightful taste of Organic California Medjool Dates from Food to Live, nature\'s candy - soft, juicy. ✔️LONG-LASTING FRESHNESS: With proper storage, these dates can stay fresh for up to 1 year.', 'Food to Live', 'https://i5.walmartimages.com/asr/15e38386-2f10-483b-8988-58e254c973a7.19c4c6c4d6b6eb2b4f04ba57ddb103a6.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15e38386-2f10-483b-8988-58e254c973a7.19c4c6c4d6b6eb2b4f04ba57ddb103a6.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/15e38386-2f10-483b-8988-58e254c973a7.19c4c6c4d6b6eb2b4f04ba57ddb103a6.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (7593624638, 'Fresh Small Hass Avocado Bag, 4-5 Count', 6.87, '852761008609', 'Avocados aren’t just great-tasting fresh produce items, but they are a nutrient-dense fruit that can be enjoyed throughout the year. Hass avocados are a versatile ingredient with a creamy texture and mild flavor that can be used in many different types of recipes and dishes that are perfect for enjoying at barbecues and outdoor gatherings with friends and family during the summer. Enjoy Small avocados in countless ways that will make those barbecues and gatherings with family and friends even more exciting. Use avocados in flavorful recipes that everybody can share and enjoy while being together outside. Try avocados in individual Mexican food items like tacos or burritos, as part of appetizers like avocado crostini, or in a fresh guacamole or avocado dip so everybody can dip tortilla chips into something delicious. The possibilities are deliciously endless if you need additional food options for barbecues. Not only is a Small avocado a great ingredient to use in numerous ways, but it is also a healthy food that contributes unsaturated “good” fats and almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9. A Small ripe avocado will have a dark green to nearly black skin color, a bumpy skin texture and should yield to gentle pressure without leaving indentations or feeling mushy. Avocados with a slightly bumpy texture should be ripe in 1 to 2 days. They will also be somewhat firm and have a dark green and black speckled color. Once you’ve selected the perfect bag of avocados, you’ll be ready to enjoy all kinds of different healthy foods and recipes for the next time you’re enjoying an outdoor gathering with friends and families.', 'Bag of 4 Small Hass Avocados Fresh fruit with a creamy texture and mild flavor Fresh avocados are great for using in tacos, burritos, appetizers, avocado dip and fresh guacamole so that you have delicious food to share and enjoy during barbecues and the summer months A cholesterol free fruit that contains almost 20 vitamins, minerals and phytonutrients including Vitamin E, Vitamin K, Vitamin C and Vitamins B5 and B9 Small hass avocados are the lowest sugar fruit and provide unsaturated “good fats” that help absorb Vitamin A, Vitamin D, Vitamin K and Vitamin E Small ripe avocados will have dark green to nearly black skin color, a bumpy texture and should yield to gentle pressure without leaving indentations', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/57d0ccdc-b7fa-4f73-aae4-42a1b8f4f64d.408d0c83a663cb912c7a4dbf7d130792.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/57d0ccdc-b7fa-4f73-aae4-42a1b8f4f64d.408d0c83a663cb912c7a4dbf7d130792.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/57d0ccdc-b7fa-4f73-aae4-42a1b8f4f64d.408d0c83a663cb912c7a4dbf7d130792.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
