INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (15020316716, 'Marketside Fresh Cut Pineapple, 24 oz Tray', 6.47, '194346455942', 'Treat yourself to a refreshing taste of the tropics with the 24 oz bowl of Marketside Cut Pineapple. Hand-cut for peak ripeness, this bowl is packed with sweet, golden pineapple that’s bursting with juicy flavor and ready to enjoy right out of the container. Whether you\'re adding it to your morning smoothie, packing it for a quick snack, or serving it as a healthy side at dinner, this pineapple delivers a crisp texture and naturally sweet taste that everyone will love. Packaged in a peel and reseal container, it’s designed for maximum freshness and on-the-go convenience: perfect for busy lifestyles, school lunches, or outdoor adventures. Backed by the Marketside commitment to quality, the Pineapple Bowl makes it easier than ever to bring high-quality, ready-to-eat fruit into your daily routine. Fresh ideas and quality ingredients, that\'s how Marketside brings the best foods to your table. We are committed to deliver freshness that you can taste and see. Marketside offers the best in fresh food, guaranteed by Walmart, working in partnership with farmers, bakers and chefs for the highest quality, authentic ingredients and favorite recipes.', 'Marketside Fresh Cut Pineapple, 24 oz Tray Sweet, juicy, and hand-cut for peak ripeness and maximum flavor No prep needed; perfect for quick snacks, lunch sides, or healthy desserts Keeps fruit fresh longer and adds grab-and-go convenience Ideal for busy mornings, school lunches, or road trip snacks Great for smoothies, fruit salads, yogurt bowls, or just as-is Shareable portion that’s great for families or entertaining', 'Marketside', 'https://i5.walmartimages.com/asr/a7919365-d74e-4c77-a0d8-986676daf9ec.82ae4437f61ab969e2adc490746458ce.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a7919365-d74e-4c77-a0d8-986676daf9ec.82ae4437f61ab969e2adc490746458ce.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a7919365-d74e-4c77-a0d8-986676daf9ec.82ae4437f61ab969e2adc490746458ce.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (15354824613, '(3 pack) Rancho Meladuco California-Grown Medjool Dates, Whole Fresh Un-Pitted, 1 lb. Box Dates', 32.7, '460325017242', 'Did you know dates are the only Superfood that tastes like Candy? Soft and chewy, dates taste like caramel and brown sugar. Our 1 lb. box of sweet and delicious California Grown Medjool Dates will become your new favorite go-to sweet treat. Dates are a nutrient dense, bite sized fruit grown in the warm sunny deserts of Southern California under our plentiful Sunshine. Celebrating the history of California\'s date farms and love affair with dates, you\'ll find a recipe for the classic roadside date shake right on the box. Dates are the better-for-you natural \"candy\", providing sustained energy and fuel for both competitive athletes and everyday people alike, and are versatile enough to add a touch of sweetness to countless dishes and recipes. Dates contain more potassium ounce for ounce than bananas and are a good source of daily fiber as well as containing iron, magnesium and other essential vitamins and nutrients. Despite their sweetness dates are lower on the glycemic index for people monitoring their blood sugar. We love our dates stuffed with a little crunchy nut butter, ice cream, or even tangy blue cheese. Chop them and add to oatmeal, yogurt, salads, or savory dishes or add them to your baked goods for a nutrient dense natural sweetener. Dates are one of the top trending foods for good reason and we\'re sure you\'ll fall in love with dates too! These dates contain a seed so please enjoy with care and remove the seed before eating. Allergen warning: our dates are packed in a facility that may also process tree nuts & peanuts. Allergens not contained: free of soy, gluten, egg, dairy, casein. Condition: Whole, un-pitted Organic Medjool dates. No sugar added. Shelf stable, but to enhance freshness store in a cool location.', 'One pound box of whole, un-pitted Medjool Dates Approximately 20-25 dates per pound Contains a seed, remove before eating. Tastes like caramel and brown sugar with hints of cinnamon Naturally sweet, whole fruit and nutrient dense superfood No added sugar CONTAINS WHOLE, UN-PITTED CALIFORNIA GROWN MEDJOOL DATES- Grown and hand picked in the Coachella Valley of Southern California. Our Dates are a delicious and nutritious snack that is perfect for any occasion. Our Dates are naturally SWEET and SOFT, and are packed with essential vitamins and minerals. They are a great source of dietary fibers, and are a great way to satisfy your sweet tooth without the guilt. Enjoy them as a snack, or add them to your favorite recipes for a delicous and healthy treat.', 'Rancho Meladuco', 'https://i5.walmartimages.com/asr/9636fe50-358a-41c3-800f-90678c60bc07.6ef5a666f5392aa59e7f3c368ecd9304.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9636fe50-358a-41c3-800f-90678c60bc07.6ef5a666f5392aa59e7f3c368ecd9304.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/9636fe50-358a-41c3-800f-90678c60bc07.6ef5a666f5392aa59e7f3c368ecd9304.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (15421721133, 'Fresh Blueberries Driscoll\'s Sweetest Batch, Dry Pint Container', 6.62, '715756500178', 'Sweetest batch blueberries are a special variety selected for their extra-sweet deliciousness. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as a topping for pancakes, bake them in a mouthwatering bread, mix them with lemon and water for a flavorful and refreshing drink. They contain essential vitamins and nutrients like vitamin C, fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them and enjoy the fresh taste. Refrigerate the berries in original Clam Shell to keep them fresh and ready for use.', 'Premium selection Only Driscoll\'s grows Sweetest Batch Blueberries from proprietary berry variety Bursting with delicious flavor, these juicy berries are selected for their extra-sweet deliciousness. Refrigerate your blueberries in the original package to maintain freshness Delicious on their own as a healthy snack or as part of a recipe', 'Driscoll\'s Inc.', 'https://i5.walmartimages.com/asr/a3ba3fa6-7184-42d2-b90a-43679b696992.442d97fdaae27d3eb475c188a1c1b64a.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a3ba3fa6-7184-42d2-b90a-43679b696992.442d97fdaae27d3eb475c188a1c1b64a.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/a3ba3fa6-7184-42d2-b90a-43679b696992.442d97fdaae27d3eb475c188a1c1b64a.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (15444959398, 'Premium Khudri Saudi Dates (2.2 LB) – Fresh, Nutrient-Rich, High in Antioxidants & Fiber – Whole Dates from Saudi Arabia – Entaj Al Nakheel brand', 20.99, '', 'Indulge in the natural sweetness and rich flavor of Khudri dates from Entaj Al Nakheel, a premium selection imported directly from Saudi Arabia. These whole dates are carefully harvested and packaged to preserve their soft, chewy texture and nutritional benefits. Packed with fiber and antioxidants, these versatile dates make for a delightful healthy snack, perfect for baking, smoothies, or as a natural sweetener. The elegant packaging, adorned with traditional geometric patterns, makes this 2.2 lb box an excellent gift choice or a sophisticated addition to your pantry.', 'Indulge in the natural sweetness of premium Khudri dates from Entaj Al Nakheel, a brand that sources these dates directly from Saudi Arabia. These whole dates are carefully harvested and packaged to preserve their rich, authentic flavor and soft, chewy texture. Naturally packed with fiber and antioxidants, these dates can satisfy your sweet cravings while providing nutritional benefits. The elegant packaging, adorned with traditional geometric patterns, makes these dates an excellent gift choice or a sophisticated addition to your pantry. Enjoy these dates as a wholesome snack any time of day, or use them in cooking, baking, or as a natural sweetener in your recipes. The protective window box preserves the freshness of the dates while allowing you to see the product.', 'Entaj Al Nakheel', 'https://i5.walmartimages.com/asr/11e11544-9107-4961-833c-a680891b1488.39bcf6b126dbfdec5954abaefe1f9af3.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/11e11544-9107-4961-833c-a680891b1488.39bcf6b126dbfdec5954abaefe1f9af3.png?odnHeight=180&odn