INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (16228157176, 'Welchs Green Grapes, 3 Lb', 9.97, '095829210112', 'Treat yourself to the delicious, juicy flavor of Fresh /White Grapes. These grapes are bursting with sweet flavor, so you can easily enjoy a handful as a fresh snack any time of day. Enjoy them for breakfast, lunch, dinner, or dessert. They are also perfect for creating stunning cheese boards and charcuterie plates by pairing them with fresh cheese, crackers, or delectable meats like prosciutto. If you want to be really creative, you can freeze them and use them and ice cubes that won\'t melt and release water into your favorite drinks. Treat yourself to the whole fresh taste of Fresh White Grapes. Fresh Product.', 'Freeze and use as cubes Great for using in fruit salad Pair with your favorite meats and cheeses for a charcuterie appetizer', 'Welch\'s', 'https://i5.walmartimages.com/asr/4e50cb5f-2717-4b43-9153-16c69e3f6627.be4a6973b570bf7c5b7820b6e8eeeae7.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4e50cb5f-2717-4b43-9153-16c69e3f6627.be4a6973b570bf7c5b7820b6e8eeeae7.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4e50cb5f-2717-4b43-9153-16c69e3f6627.be4a6973b570bf7c5b7820b6e8eeeae7.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (16462316478, 'Fresh Sour Oranges for Juicing and Cooking', 1.98, '897505002604', 'Fresh Sour Oranges are ideal for adding tangy citrus flavor to recipes. These tart and tangy fruits, known for their slightly bitter undertone, are perfect for culinary applications such as marinades, dressings, beverages, and traditional dishes. Typically medium-sized with a thick, textured peel, they exhibit a vibrant orange color when ripe. Whether you\'re cooking, juicing, or making a refreshing beverage, these sour oranges bring a zesty zing to any dish. Enjoy the unique flavor and aromatic freshness that only sour oranges can deliver.', 'Fresh Sour Oranges for a perfect tangy flavor Tart and tangy with a slightly bitter undertone, ideal for culinary and beverage applications Medium-sized fruit with a thick, textured peel; bright orange color when ripe Ideal for cooking and juicing Food condition: Fresh Fruit type: Citrus', 'Fresh King Inc/Unity Groves', 'https://i5.walmartimages.com/asr/56ca316a-4c2e-4653-b00e-78c33eab874e.9de35614fd46be44016e9f9094b45473.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/56ca316a-4c2e-4653-b00e-78c33eab874e.9de35614fd46be44016e9f9094b45473.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/56ca316a-4c2e-4653-b00e-78c33eab874e.9de35614fd46be44016e9f9094b45473.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (16511653326, 'Fresh Tropical Breadfruit - Versatile and Nutritious Alternative', 1.38, '897505002598', 'Fresh Breadfruit is a versatile tropical fruit prized for its starchy texture and mild flavor. When cooked, it becomes tender and hearty, making it a satisfying addition to both sweet and savory recipes. This fresh fruit can be baked, boiled, fried, or roasted, and is often used as a wholesome alternative to potatoes or rice. With its golden-green exterior and creamy white interior, it brings a taste of the islands right to your kitchen. Enjoy Fresh Breadfruit as part of a nourishing meal or experiment with it in your favorite recipes for a unique twist. Fresh Breadfruit is a delicious way to add variety to your table. Food Condition: Fresh.', 'Fresh Breadfruit, Each Large tropical fruit with a mild, starchy flavor Can be baked, boiled, fried, or roasted Excellent alternative to potatoes or rice Golden-green exterior with creamy white interior Perfect for both sweet and savory recipes Also known as \'Ulu\' and \'Panapen\' around the world. Food Condition: Fresh.', 'Unbranded', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/68dc6b98-1c47-4d5b-8edf-ec73d319a040.8753fc2505594b8a1f11e7be644cfebe.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (16511957433, 'Welch\'s Blueberries 6oz', 3.87, '095829210686', 'Fresh Blueberries are a delightful and nutritious treat that brings a burst of flavor to any dish. These plump and juicy berries are picked at the peak of freshness, ensuring a sweet and tangy taste that is hard to resist. Perfect for snacking, baking, or adding to your favorite recipes, these blueberries are a versatile fruit that can be enjoyed in countless ways. Whether you sprinkle them on top of your morning cereal, blend them into a smoothie, or bake them into a delicious pie, Fresh Blueberries are sure to satisfy your cravings for a healthy and delicious snack.', 'These little bursts of flavor are not only delicious but also packed with nutrients, making them an ideal addition to your diet. Hand-picked at the peak of freshness, our Fresh Blueberries are plump, juicy, and bursting with natural sweetness. Each berry is carefully selected to ensure the perfect balance of sweetness and tanginess, ensuring a delightful taste sensation with every bite. The versatility of blueberries knows no bounds. Enjoy them straight out of the container as a refreshing and guilt-free snack or sprinkle them over your morning cereal or yogurt for a burst of fruity goodness. Blend them into a smoothie for a nutritious and energizing drink that will kickstart your day. Get creative in the kitchen and incorporate these blue gems into your baking endeavors, whether it\'s muffins, cakes, or pies, their vibrant color and juicy texture will enhance any recipe. Not only are blueberries delicious, but they also offer an array of health benefits. Loaded with antioxidants, vitamins, and dietary fiber, blueberries are known to promote heart health, support brain function, and boost the immune system. They are a nutritious choice that will keep you feeling good from the inside out. Our Fresh Blueberries come conveniently packaged and can be enjoyed immediately or stored in the refrigerator for later use. The possibilities are endless with these versatile berries, allowing you to explore new culinary creations and indulge in their wholesome goodness. Treat yourself to the delightful taste and nutritional benefits of Fresh Blueberries. Elevate your dishes, satisfy your cravings, and experience the joy of these plump and juicy berries. Order your batch today and unlock a world of flavor and wellness.', 'Welch\'s', 'https://i5.walmartimages.com/asr/92f21f75-4f8b-4b8c-812c-84473f813869.b7912692e380478f5a100991660f3ae7.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/92f21f75-4f8b-4b8c-812c-84473f813869.b7912692e380478f5a100991660f3ae7.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/92f21f75-4f8b-4b8c-812c-84473f813869.b7912692e380478f5a100991660f3ae7.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (16804910930, 'Welch Cherries, 1 Lb.', 6.97, '095829211621', 'Cherries are a family favorite: ideal as a snack, the perfect addition to breakfast with oatmeal or yogurt, an excellent ingredient for baking or salads, and delicious on their own. Our family recipe for cherry cookies is a hit with family and friends. Rich in antioxidants, they are a source of vitamin C, potassium, and fiber. Low in calories compared to other sweet fruits, they have been associated with anti-inflammatory benefits and improved sleep thanks to their natural melatonin content.', 'Rich in antioxidants, they are a source of vitamin C, potassium, and fiber. Ideal for snacks They are usually eaten fresh, in desserts or in jams They help reduce oxidative stress and contribute to cardiovascular health.', 'Welch\'s', 'https://i5.walmartimages.com/asr/c41d615c-e21e-45bc-8ee1-85d7cc6999a5.a2f7b4488207c40d7995718007abee6c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c41d615c-e21e-45bc-8ee1-85d7cc6999a5.a2f7b4488207c40d7995718007abee6c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/c41d615c-e21e-45bc-8ee1-85d7cc6999a5.a2f7b4488207c40d7995718007abee6c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
