INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (17283650637, 'Thai Guava Fresh Tropical Fruit, Each', 1.32, '897505002611', 'Thai Guava is a fresh, crisp, and refreshing tropical fruit ideal for snacking or enhancing your favorite dishes. It features a vibrant green skin with a pale interior and offers a mildly sweet flavor with a crunchy texture, making it a unique treat. Enjoy it fresh with a sprinkle of salt or chili for an adventurous twist, or incorporate it into salads and smoothies. Thai Guava is a fresh, juicy fruit option providing a tropical experience that’s both delicious and versatile. Experience it fresh for the ultimate taste.', 'Thai Guava, Each Bright green skin with pale, crisp interior Mildly sweet flavor with crunchy texture Great for snacking, salads, or smoothies Can be paired with salt or chili for a bold taste Refreshing tropical fruit option Available fresh for optimal taste', 'Unbranded', 'https://i5.walmartimages.com/asr/5db2abb0-5b85-4289-bd09-89334a0d17d4.89e6322dda6b3556d68e1982ce4b7af1.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5db2abb0-5b85-4289-bd09-89334a0d17d4.89e6322dda6b3556d68e1982ce4b7af1.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5db2abb0-5b85-4289-bd09-89334a0d17d4.89e6322dda6b3556d68e1982ce4b7af1.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (17358255648, 'Fresh Whole Shallots 16oz Bag', 2.88, '045255126501', 'Experience the exquisite flavor of Fresh Whole Shallots, perfect for enhancing any dish. These 16oz bags are filled with fresh, aromatic, and versatile shallots, which are indispensable for chefs and home cooks alike. They provide a milder taste than onions, making them ideal for salads, dressings, and more. Their fine texture and unique blend of garlic and onion flavors elevate your culinary creations, whether sautéed, roasted, or used raw. Keep these handy for adding depth and flair to sauces, marinades, and soups.', 'Fresh and Aromatic: Our whole shallots are carefully sourced to ensure premium quality and rich flavors. Versatile Ingredient: Perfect for use in a wide variety of recipes, from salads to sauces. Food Condition: Fresh, ensuring you get the best taste and texture. Ideal for Cooking: Adds depth and flair to your culinary creations with its unique garlic-onion flavor.', 'Unbranded', 'https://i5.walmartimages.com/asr/5cb7625b-8a08-4125-bf87-74e2105f20fd.6a315818580725349bb4f8bc82b2e62f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5cb7625b-8a08-4125-bf87-74e2105f20fd.6a315818580725349bb4f8bc82b2e62f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/5cb7625b-8a08-4125-bf87-74e2105f20fd.6a315818580725349bb4f8bc82b2e62f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (17401664280, 'Bright Farms Butter Crunch 8 Oz', 4.97, '850051825158', 'BrightFarms Butter Crunch is the perfect base for any salad, burger or sandwich. It combines our signature Crunchy Green Leaf Lettuce with our Sweet Baby Butter for an approachable and satisfying blend that is versatile and packed with texture. Grown nearby in a state-of-the-art greenhouse, the salad greens go from farm to store in as little as 24 hours ensuring they are fresh, crunchy and long-lasting in your fridge -- in fact we guarantee it! By growing indoors using a hands-free growing process, we eliminate the use of pesticides on our produce so that the greens are ready to eat from the container, with no need to wash. At BrightFarms, we are on a mission to grow salads in a way that is better for people and the planet, transforming the way people eat and enjoy fresh produce - and shaping a more sustainable future for food.', 'Pesticide, herbicide and fungicide free greens Greenhouse grown, for guaranteed fresh greens year-round No need to wash Responsibly grown, harnessing the power of technology to do more with less: less water, less land, less shipping fuel to produce more Non-GMO Perfect for salads, sandwiches, wraps and more', 'BrightFarms', 'https://i5.walmartimages.com/asr/4f37c7f7-12b8-441f-bd31-ca357e7f5dcd.00142ac5563c1347abd76f3f16dff76c.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4f37c7f7-12b8-441f-bd31-ca357e7f5dcd.00142ac5563c1347abd76f3f16dff76c.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/4f37c7f7-12b8-441f-bd31-ca357e7f5dcd.00142ac5563c1347abd76f3f16dff76c.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (17452455869, 'Flavorables Vampire Killer Seasoned Fresh Petite Potatoes in Microwave-Safe 16 oz Tray', 4.48, '813652011450', 'Flavorables® Fresh Petite Potatoes – Vampire Killer Seasoning is a delightful fresh vegetable option that transforms snack time into a bold flavor adventure. This 16 oz microwave-safe pack is designed for ultimate convenience and taste. Fresh potatoes are seasoned with Spiceology\'s “Vampire Killer” blend that includes garlic, Parmesan, onion, and sea salt. Ready to cook in minutes, these fresh potatoes offer a crispy texture whether prepared in the microwave or air fryer. Perfect for key occasions as a snack, a flavorful side, or a standout at parties, these fresh potatoes appeal to adventurous eaters who love bold flavors.', '16 oz pack for convenient snacking – easy to prepare and share. Unique and bold flavor profile – Garlic, Parmesan, sea salt, and onion come together in the “Vampire Killer” seasoning for a taste that stands out. Crispy texture for maximum enjoyment – cooks quickly in the microwave or air fryer for a satisfying bite. Perfect for parties and gatherings – a flavorful side dish or snack that pairs with any occasion. High-quality ingredients used – real fresh petite potatoes with authentic spices from Spiceology®. Ideal for adventurous snackers – crafted for those who crave big flavors and bold combinations with a fresh twist.', 'Flavorables', 'https://i5.walmartimages.com/asr/13fd16ef-4e96-4cba-afab-7a771295f295.c94ebc2bfc77e765141e37a7c004bb17.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/13fd16ef-4e96-4cba-afab-7a771295f295.c94ebc2bfc77e765141e37a7c004bb17.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/13fd16ef-4e96-4cba-afab-7a771295f295.c94ebc2bfc77e765141e37a7c004bb17.jpeg?odnHeigh