rts the sturdy melon crop.', 'HZY', 'https://i5.walmartimages.com/asr/0d96db96-1e89-46ab-828d-e904decae2fd.ec9a9627b9aa259562d101e638610630.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d96db96-1e89-46ab-828d-e904decae2fd.ec9a9627b9aa259562d101e638610630.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/0d96db96-1e89-46ab-828d-e904decae2fd.ec9a9627b9aa259562d101e638610630.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
