INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (17687202926, 'Sunchaser Apples 3lb Bag', 3.22, '883391004907', 'Naturally Sweet, Wildly Adventurous. Sunchaser™ apples are sweet, crisp, and ready to fuel your day. Take one with you and bite into adventure. Sunchaser apples sport warm, sweet flavors with a gentle crunch, and familiar aromatics that remind you of your fun days outside with family and friends. Grown in the heart of Washington state apple country, Sunchaser apples soak up summer sun, clean water, and healthy soils, packing flavor and nutrients for your next great escape. Powered by the perfect balance of carbohydrates, fiber, and natural sugars, Sunchaser apples give you clean, steady energy for life’s everyday adventures. Send it with Sunchaser apples!', 'Naturally sweet, crisp, and ready to fuel your day. Warm, sweet flavors. Gentle crunch and familiar aromatics. Perfect balance of carbohydrates, fiber, and natural sugars', 'Sunchaser', 'https://i5.walmartimages.com/asr/76352ca5-3b1e-4d99-a220-3abc6a8111a5.4a976baa8cd6430c1f5a6def0b64f920.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/76352ca5-3b1e-4d99-a220-3abc6a8111a5.4a976baa8cd6430c1f5a6def0b64f920.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/76352ca5-3b1e-4d99-a220-3abc6a8111a5.4a976baa8cd6430c1f5a6def0b64f920.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (17703609853, 'Djon-Djon Dried Mushrooms 20g', 4.98, '850008908651', 'Quisqueya Djon-Djon Dried Mushrooms bring the rich, earthy flavor of Haiti’s most beloved culinary ingredient to your kitchen. Known for their deep umami taste and distinctive aroma, Djon-Djon mushrooms are a staple in Haitian cuisine, most famously used in Diri Djon Djon (black mushroom rice). These premium dried mushrooms are carefully selected, sun-dried, and packed to preserve their natural flavor and nutrients.', 'Authentic Haitian Ingredient – Sourced and produced in Haiti for true Caribbean flavor. Rich, Earthy Taste – Adds depth and umami to rice, stews, soups, and sauces. Premium Quality – Carefully dried to lock in aroma, flavor, and nutrients. Nutrient-Rich – Good source of protein and iron, low in fat and sodium. Versatile Use – Ideal for traditional Haitian dishes like Diri Djon Djon, as well as gourmet recipes. Easy to Prepare – Simply soak in hot water before use to release its signature flavor. Shelf-Stable – Long storage life when kept in a cool, dry place. Convenient Size – 0.70 oz (20g) pouch, perfect for home cooking.', 'Quisqueya', 'https://i5.walmartimages.com/asr/deaacf40-fd49-4d42-942e-364fd4fb6e28.ff3ac57629344b9dc820b01511e1ff43.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/deaacf40-fd49-4d42-942e-364fd4fb6e28.ff3ac57629344b9dc820b01511e1ff43.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/deaacf40-fd49-4d42-942e-364fd4fb6e28.ff3ac57629344b9dc820b01511e1ff43.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
