INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (17980859105, 'Fresh Colada Royale Pineapple', 4.88, '643126972334', 'Boldly Exotic. Pure indulgence. Dole’s latest tropical masterpiece, 15 years in the making and exclusively grown in Honduras, is a completely non-GMO pineapple variety that redefines indulgence. Its soft golden color is lighter and brighter than your typical pineapple, signaling a more refined fruit—juicier, more aromatic, and bursting with a sweet and tangy complexity that truly captivates the palate. With a smaller core for maximum edible fruit and 2.5X higher vitamin B6 levels than other pineapples, Colada Royale™ is as nutritionally rich as it is indulgent. This fresh tropical fruit is perfect for both culinary creativity and everyday luxury. Colada Royale™ isn’t just grown, it’s nurtured with intention. A portion of every purchase supports the development of a community center in Honduras, dedicated to delivering education, healthcare, and vocational training to uplift the region where the fruit’s journey began.', 'Fresh Colada Royale Pineapple Naturally sweeter, golden-fleshed pineapple with a refined tropical flavor Nutritionally rich with 2.5X more vitamin B6 than typical pineapples Supports education, healthcare, and community growth in Honduras', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/8a81f072-bd1a-4390-9bf6-b6645c071227.c882d7f00b1eeefacab2f6b37149f89d.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8a81f072-bd1a-4390-9bf6-b6645c071227.c882d7f00b1eeefacab2f6b37149f89d.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8a81f072-bd1a-4390-9bf6-b6645c071227.c882d7f00b1eeefacab2f6b37149f89d.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18002104746, 'Fresh Navel Oranges, 8 lb Bag', 9.97, '072240601187', 'Enjoy the juicy goodness of Fresh Navel Oranges. A great source of vitamin C, these oranges can be a satisfying afternoon snack, or you can use them in a variety of recipes. For breakfast, use these navel oranges to make a rich and creamy smoothie or serve them alongside your pancakes, sausage, and eggs. Slice these oranges and use them to add flavor to a lunchtime salad or as a garnish for your favorite cocktail. Oranges are used in many tasty desserts like ambrosia, orange bars, and zesty orange pie. Get creative in the kitchen and make homemade orange marmalade or a refreshing orange sorbet. However you choose to use them, Fresh Navel Oranges add flavor to any meal or beverage.', 'Great source of vitamin C Use to add zest and flavor to your meals and beverages Enjoy on their own or in a variety of recipes Make a creamy orange smoothie Serve with your pancake breakfast Adds flavor to a variety or recipes Use as a garnish for your favorite cocktail Make sweet desserts like ambrosia, orange bars, and orange pie', 'FIELDPACK UNBRANDED', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18061719361, 'Prico Fresh Squash Chunks, 16oz', 2.97, '687398561063', 'Add some fresh flavor to your meal with \"Calabaza en Trozos\" fresh squash. This versatile vegetable can be used in a variety of dishes to create delicious and decadent meals. You place in the slow cooker with chicken breast, kidney beans, and spices. Create tasty and flavorful meals with this vegetable.', 'Versatile ingredient Roast the whole squash for the perfect side dish put into a slow cooker, and mix with chicken breast, beans, and spices for a flavorful dish Versatile ingredient Roast the whole squash for the perfect side dish or chop into cubes, put into a slow cooker, and mix with chicken breast, beans, and spices for a flavorful dish Use it to create a sweet and decadent pie', 'PRICO PRODUCE LLC', 'https://i5.walmartimages.com/asr/3d930da9-7178-4bb0-b48d-728ebb5dbea4.689e07664daabd8535976b6a726f2f06.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3d930da9-7178-4bb0-b48d-728ebb5dbea4.689e07664daabd8535976b6a726f2f06.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/3d930da9-7178-4bb0-b48d-728ebb5dbea4.689e07664daabd8535976b6a726f2f06.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18124201399, 'Spice World Fresh Garlic Sleeve, 3 Count', 1.74, '070969000908', 'Take your culinary creations to the next level with fresh, flavorful Garlic. Garlic\'s signature flavors become caramelized and sweeter when cooked, making it a perfect accompaniment to many dishes such as pasta, shrimp, chicken, stews, and more. Garlic also goes great in creamed soups, on all types of roasts, in a variety of egg dishes, or used simply with sauteed or roasted vegetables. To prepare garlic for cooking, you\'ll need to break it up into individual cloves and peel the skin. Once you\'ve done this, you can mince the garlic by chopping it into fine pieces. Spice up your next meal with a tasty clove of fresh Garlic.', 'Spice World Fresh Garlic Bulbs, 3 count', 'Fresh Produce', 'https://i5.walmartimages.com/asr/1987f303-5f7b-4250-a4be-15735b797999.ee158276b27318447e0e876cc3b1291b.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1987f303-5f7b-4250-a4be-15735b797999.ee158276b27318447e0e876cc3b1291b.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/1987f303-5f7b-4250-a4be-15735b797999.ee158276b27318447e0e876cc3b1291b.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
