INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18264416589, 'Fresh Kishu Kisses Mandarins, 1 lb Bag', 1.64, '899783002147', 'Enjoy the delightful freshness of Kishu Kisses Mandarins, perfect for snacking anytime. These miniature mandarins offer a burst of sweetness and tang with every bite, packed in a convenient 1 lb bag. Great for kids and adults alike, they are easy to peel and full of flavor, making them an ideal choice for healthy munching throughout the day. With high vitamin C content and other nutritional benefits, these mandarins are both delicious and nutritious, sourced and packaged with care for superior quality and taste.', 'Sweet and tangy flavor ideal for fresh snacking Each bag contains 1 lb of tiny mandarins Easy to peel and enjoy for all ages Packed with Vitamin C and essential nutrients Perfect for adding zest to your fruit salads', 'Kishu Kisses', 'https://i5.walmartimages.com/asr/f489b337-9c7f-4b1e-83b7-e5af3681c33c.3c70ddca48cdf1acacaf7b9241a934dc.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f489b337-9c7f-4b1e-83b7-e5af3681c33c.3c70ddca48cdf1acacaf7b9241a934dc.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/f489b337-9c7f-4b1e-83b7-e5af3681c33c.3c70ddca48cdf1acacaf7b9241a934dc.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18296219457, 'Fresh Green Leaf Lettuce, Each', 2.62, '882623762677', 'Fresh Green Leaf Lettuce is the perfect way to add more greens to your diet. This leafy lettuce is the perfect base for creating a variety of salads. Chop it up, add a protein like grilled chicken, a cheese like feta, candied pecans, and dried cranberries with a sweet vinaigrette for a sweet and tangy salad. Add it to spring rolls for a crunchy, refreshing addition. You could use it as a lettuce boat or wrap when you are wanting to still eat leafy greens but don\'t want a salad. It\'s low in calories making it perfect for adding to a healthy diet. Enjoy the crisp and refreshing taste of Fresh Green Leaf Lettuce.', 'Fresh Green Leaf Lettuce, Each Perfect base for creating salads Chop it and mix with grilled chicken, feta cheese, candied pecans, dried cranberries and a vinaigrette Add it to a spring roll for fresh addition Use it as a lettuce wrap or lettuce boat for something different Low calorie making it perfect for a healthy diet', 'Fresh Produce', 'https://i5.walmartimages.com/asr/43584fcd-d522-41d9-8b26-c8e671d4850e.86fe376258eaa7ba3a75e3e261877292.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/43584fcd-d522-41d9-8b26-c8e671d4850e.86fe376258eaa7ba3a75e3e261877292.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/43584fcd-d522-41d9-8b26-c8e671d4850e.86fe376258eaa7ba3a75e3e261877292.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
