INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18334352056, 'Fresh Strawberries, 2 lb Package', 8.78, '715756200221', 'The sweet, juicy flavor of Fresh Strawberries make them a refreshing and delicious treat. Enjoy them for breakfast, lunch, dinner, or dessert. Use them as topping for pancakes, bake them in a mouthwatering bread, mix them with cucumbers for a light and flavorful salad, or puree them for strawberry shortcake. They contain essential vitamins and nutrients like, vitamin C, fiber, potassium, vitamin B and magnesium making them perfect for a healthy diet. Prior to serving simply gently wash them, remove the leafy caps, and enjoy the fresh taste. Refrigerate the berries in original Clam Shell to keep them fresh and ready for use. Pick up Fresh Strawberries today and savor the delectable flavor.', 'Fresh Strawberries, 2 lb: Prior to serving gently wash them and remove leafy cap Refrigerate your strawberries in the original Clam Shell container to maintain freshness Keep dry for optimal freshness Rich in vitamin C Use them as topping for pancakes, mix them with spinach and goat cheese for a light and flavorful salad, or puree them to make a delicious cocktail', 'FIELDPACK UNBRANDED', '', '', '');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18340206833, 'Fresh Peelz California Mandarin Oranges, 5 lb Bag', 6.67, '091636000038', 'Peelz mandarin oranges are nature’s most convenient snack; juicy, sweet, and easy to peel. Grown in California and picked at peak ripeness, these seedless mandarin oranges are a great source of vitamin C and perfect for busy days, lunch boxes, or healthy snacking at home. No prep, no mess; just delicious citrus flavor in every bite. Peelz mandarin oranges are happiness you can hold.', 'Fresh mandarin oranges Seedless, sweet, and easy-to-peel Excellent source of vitamin C Great for snacks, school lunches, and on-the-go Grown and harvested in California Naturally flavorful and refreshing', 'Peelz Citrus', 'https://i5.walmartimages.com/asr/8eb8e0f4-d2f7-47fd-95a1-a5a1378897bc.a65fd83ff834e5a470d1be3e51b7daac.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8eb8e0f4-d2f7-47fd-95a1-a5a1378897bc.a65fd83ff834e5a470d1be3e51b7daac.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/8eb8e0f4-d2f7-47fd-95a1-a5a1378897bc.a65fd83ff834e5a470d1be3e51b7daac.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18340256470, 'Organic Grape Tomato', 3.98, '741243001453', 'short description is not available', 'Organic Grape Tomato', 'Unbranded', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b95ba6f2-9927-49d6-91b9-a5cb893c49ac.a4ecb396d30d1009ae015fe71c1afa7e.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18379756903, 'Brightfarms Butter Crunch 4 Oz', 2.48, '857062004992', 'BrightFarms Butter Crunch is the perfect base for any salad, burger or sandwich. It combines our signature Crunchy Green Leaf Lettuce with our Sweet Baby Butter for an approachable and satisfying blend that is versatile and packed with texture. Grown nearby in a state-of-the-art greenhouse, the salad greens go from farm to store in as little as 24 hours ensuring they are fresh, crunchy and long-lasting in your fridge -- in fact we guarantee it! By growing indoors using a hands-free growing process, we eliminate the use of pesticides on our produce so that the greens are ready to eat from the container, with no need to wash. At BrightFarms, we are on a mission to grow salads in a way that is better for people and the planet, transforming the way people eat and enjoy fresh produce - and shaping a more sustainable future for food.', 'Pesticide, herbicide and fungicide free greens Greenhouse grown, for guaranteed fresh greens year-round No need to wash Responsibly grown, harnessing the power of technology to do more with less: less water, less land, less shipping fuel to produce more Non-GMO Perfect for salads, sandwiches, wraps and more', 'BrightFarms', 'https://i5.walmartimages.com/asr/b3a8160d-9f4a-409e-97ec-bce088429a1a.d75498a01d56c4f0e2c5d8431982aa04.png?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b3a8160d-9f4a-409e-97ec-bce088429a1a.d75498a01d56c4f0e2c5d8431982aa04.png?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/b3a8160d-9f4a-409e-97ec-bce088429a1a.d75498a01d56c4f0e2c5d8431982aa04.png?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18404772802, 'Rambutan Bag 12oz', 4.98, '858335003872', 'Fresh Rambutan brings a burst of tropical sweetness to your table with its juicy, mildly tart flavor and exotic appeal. This unique fruit has a soft, translucent flesh that\'s easy to peel and enjoy, revealing a refreshing taste similar to lychee or grapes. The seed in the center can even be cooked and eaten, adding versatility to your kitchen creations. Perfect for snacking, fruit salads, or party platters, rambutan makes a colorful and fun addition to any occasion. Add a touch of the tropics to your day with Fresh Rambutan.', 'Rambutan Bag 12oz Sweet and mildly acidic tropical fruit with juicy flesh Easy to peel to enjoy the soft, refreshing inside Seed in the center can be cooked and eaten Great for fruit salads, desserts, or snacking Vibrant, eye-catching fruit ideal for entertaining', 'Unbranded', 'https://i5.walmartimages.com/asr/77e6eb3b-0889-432a-a260-8b57077acea9.ca904ceed7db4651ca4f1cee9934400f.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77e6eb3b-0889-432a-a260-8b57077acea9.ca904ceed7db4651ca4f1cee9934400f.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77e6eb3b-0889-432a-a260-8b57077acea9.ca904ceed7db4651ca4f1cee9934400f.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (18545811032, 'Fresh Mandarin, 2 lb Bag', 4.47, '856552006898', 'Enjoy the juicy goodness of citrus when you eat a Fresh Mandarin Orange. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Generally a winter fruit, mandarins are now available year-round in most markets. Mandarins are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, mandarins are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious fresh mandarin on hand for an easy, healthy treat.', 'Excellent source of vitamin C, potassium, and folic acid Easy to peel and segment Delicious, sweet, juicy citrus', 'Tropic sun', 'https://i5.walmartimages.com/asr/77fe3f93-6452-4025-86fb-580abf7cfee1.7211c31e4ad71d91494cdfed05f06348.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77fe3f93-6452-4025-86fb-580abf7cfee1.7211c31e4ad71d91494cdfed05f06348.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77fe3f93-6452-4025-86fb-580abf7cfee1.7211c31e4ad71d91494cdfed05f06348.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
