INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (19131953443, 'Welch Fresh Mandarin, 2 lb Bag', 4.47, '095829851704', 'Enjoy the juicy goodness of citrus when you eat a Fresh Mandarin Orange. Deliciously sweet and juicy, these orange orbs of goodness are very easy to peel. Generally a winter fruit, mandarins are now available year-round in most markets. Mandarins are an excellent source of vitamin C, potassium, and folic acid. For maximum flavor, don\'t refrigerate; just let the mandarins hang out in a bowl on your counter or table to breathe. Compact and portable, mandarins are great to pack in your lunchbox, toss into your gym bag for a post-workout refreshment, or take on a road trip as a healthy alternative to those gas station snacks. Keep some easy-to-peel, juicy, sweet, and delicious fresh mandarin on hand for an easy, healthy treat.', 'Excellent source of vitamin C, potassium, and folic acid Easy to peel and segment Delicious, sweet, juicy citrus', 'Welch\'s', 'https://i5.walmartimages.com/asr/77fe3f93-6452-4025-86fb-580abf7cfee1.7211c31e4ad71d91494cdfed05f06348.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77fe3f93-6452-4025-86fb-580abf7cfee1.7211c31e4ad71d91494cdfed05f06348.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/77fe3f93-6452-4025-86fb-580abf7cfee1.7211c31e4ad71d91494cdfed05f06348.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
INSERT INTO `Walmart` (`item_id`, `name`, `retail_price`, `upc`, `shortDescription`, `longDescription`, `brandName`, `thumbnailImage`, `mediumImage`, `largeImage`) VALUES (19226723392, 'FRESH SQUASH CHAYOTE', 2.27, '687398561285', 'Create tasty meals and side dishes with Chayote Squash. It\'s ideal to use for creating authentic Cajun cuisine and can be grilled, stir-fried, boiled, steamed or baked. This chayote squash can also be sliced or shredded and used in salads and slaws, or you can boil it and mash like a potato. It has a mild and slightly sweet taste with light notes of cucumber. Naturally low in calories and fat, chayote squash is an excellent source of vitamin C, vitamin B6, folate, fiber, and potassium. Expand your culinary repertoire when you use Chayote Squash to create delicious dishes.', 'Ideal for making authentic Cajun dishes Can be grilled, stir-fried, boiled, steamed or baked Slice or shred raw chayote to use in salads and slaws Mild and slightly sweet taste Provides an excellent source of vitamin C, vitamin B6, folate, dietary fiber and potassium Use in soups, stews, curries and casseroles', 'PRICO PRODUCE', 'https://i5.walmartimages.com/asr/cc50caec-e342-4082-af5d-863233ba8261.d00f4210171436005691efba725fa6a8.jpeg?odnHeight=100&odnWidth=100&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc50caec-e342-4082-af5d-863233ba8261.d00f4210171436005691efba725fa6a8.jpeg?odnHeight=180&odnWidth=180&odnBg=ffffff', 'https://i5.walmartimages.com/asr/cc50caec-e342-4082-af5d-863233ba8261.d00f4210171436005691efba725fa6a8.jpeg?odnHeight=450&odnWidth=450&odnBg=ffffff');
